INSERT INTO `jokes` VALUES (9, 'Computer jokes', 'A ragged individual stranded for several months on a small desert island in the middle of the Pacific Ocean one day noticed a bottle lying in the sand with a piece of paper in it. Rushing to the bottle, he pulled out the cork and with shaking hands withdrew the message. "Due to lack of maintenance," he read, "we regretfully have found it necessary to cancel your e-mail account."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (10, 'Computer jokes', 'This customer comes into the computer store. "Im looking for a mystery Adventure Game with lots of graphics. You know, something really challenging." "Well," replied the clerk, "Have you tried Windows 98?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (11, 'Computer jokes', 'Redmond, WA --Microsoft announced today that the official release date for the new operating system "Windows 2000" will be delayed until the second quarter of 1901.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
