INSERT INTO `jokes` VALUES (25, 'Accountant jokes', 'An accountant visited the Natural History museum. While standing near the dinosaur he said to his neighbor: "This dinosaur is two billion years and ten months old"."Where did you get this exact information?" "I was here ten months ago, and the guide told me that the dinosaur is two billion years old."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (26, 'Accountant jokes', 'Two accountants are in a bank, when armed robbers burst in. While several of the robbers take the money from the tellers, others line the customers, including the accountants, up against a wall, and proceed to take their wallets, watches, etc. While this is going on accountant number one jams something in accountant number twos hand. Without looking down, accountant number two whispers, "What is this?" to which accountant number one replies, "its that $50 I owe you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (27, 'Accountant jokes', 'An accountant is having a hard time sleeping and goes to see his doctor. "Doctor, I just cant get to sleep at night.""Have you tried counting sheep?""Thats the problem - I make a mistake and then spend three hours trying to find it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (28, 'Accountant jokes', 'A patient was at her doctors office after undergoing a complete physical exam. The doctor said, "I have some very grave news for you. You only have six months to live."The patient asked, "Oh doctor, what should I do?" The doctor replied, "Marry an accountant." "Will that make me live longer?" asked the patient. "No," said the doctor, "but it will SEEM longer."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (29, 'Accountant jokes', 'Why do accountants make good lovers? Theyre great with figures.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
