INSERT INTO `jokes` VALUES (35, 'Apple jokes', 'The desk sergeant answered the phone, and at once a woman began screaming. "Youve got to help me! Theres a giant gray thing in my yard, and its pulling apples off the tree with its tail!" "Whats he doing with the apples?" the sergeant asked. "If I told you," the woman cried, "you wouldnt believe me!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (36, 'Apple jokes', 'What did one maggot say to the other who was stuck in an apple? Worm your way out of that one, then!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (37, 'Apple jokes', 'Why didnt the two worms go into Noahs ark in an apple?Because everyone had to go in pairs !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
