INSERT INTO `jokes` VALUES (55, 'Bar jokes beer booze and fun', 'A drunk stammers out of a bar and runs into two priests. He runs up to them and says, Im Jesus Christ. The first priest says, No, son, Im Jesus Christ. So the drunk says it to the second priest. The second priest replies, No, son, Im Jesus Christ. The drunk says, Look, I can prove it. and walks back into the bar with the priests. The bartender takes on look at the drunk and exclaims, Jesus Christ, youre here again?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (56, 'Bar jokes beer booze and fun', 'There were these three brothers that were very close to each other. The brothers always went to a local bar on every Friday at 5:30 on the dot. When the brothers got married they all got married to their wifes to be on the same day and at the same place. When the brothers moved away from each other to go on with their lives with their new wife, they all promised each other that they would still go to the bar every friday at 5:30 and drink for each other. On the first Friday that the brothers were separated, the first brother went to a local bar and ordered three drinks. He took one sip from the first glass the took one sip from the second glass then from the third. He did this until all the beer was gone, then he paid the bartender and went home. This kept up for about three week before the bartender finally asked why he did that. The guy explained about the promise th at he had with his brothers. The bartender said that he thought that was a very good promise to keep with each other. One day the same guy came in and asked for only two glasses of beer. The bartender thinking something awful has happened, said "I am awfully sorry about your brother." The guy not knowing anything about what the bartender was talking about said "What happened to him?" The bartender said that when he only ordered two drinks instead of three he thought that something awful had happened. The brother then said "No, nothing happened to my brother, I just decided to give up alcohol."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (57, 'Bar jokes beer booze and fun', 'A man walks in to a bar and says to the bartenter " Give me twenty shots of your best singlemalt scotch quick!"] The bartender pours the shots, and the man drinks them as fast as he can. The bartender says " Wow. I never saw anybady drink that fast." The man says " well you would drink as fast as I do if you had what I have." The bartender says " Oh my god . what is it. what do you have?" The man looks at him and says " Fifty cents."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (58, 'Bar jokes beer booze and fun', 'A guy stumbles through the front door of a bar, ambles up to the bartender and orders a beer. The bartender looks at the drunk man and says,"Im sorry sir, but I cant serve you...youve already had too much to drink." The guy swears and walks out of the bar. Five minutes later the guy comes flying through the side door of the bar, and yells for a beer. Again the bartender says,"Im sorry, sir...but I cant serve you...youve already had too much to drink!" Ten minutes later, the same guy comes barrel-assing through the back door of the bar, storms up to the bartender, and demands a beer. Again, the bartender says to the man..."Im really sorry, sir, but youve had too much to drink...youre going to have to leave!" The guy looks quizzically at the bartender and says finally, "My God, man... How many bars do you work at?!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (59, 'Bar jokes beer booze and fun', 'One day an Englishman, an American, and a Canadian walked into a pub together. The proceeded to each buy a pint of Molson Canadian. Just as they were about to enjoy their beverage three flies landed in each of their pints. The Englishman pushed his beer away from him in disgust. The American fished the offending fly out of his beer and continued drinking it as if nothing had happened. The Canadian picked the fly out of his drink and started shaking it over the pint, yelling... "SPIT IT OUT, SPIT IT OUT YOU BASTARD!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
