INSERT INTO `jokes` VALUES (67, 'Bath jokes', 'Boy: Dad, dad, theres a spider in the bath. Dad: Whats wrong with that? Youve seen spiders before. Boy: Yes, but this one is three feet wide and using all the hot water!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (68, 'Bath jokes', 'Doctor: And did you drink your medicine after your bath, Mrs Soap? Mrs Soap: No, doctor. By the time Id drunk the bath there wasnt room for medicine.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
