INSERT INTO `jokes` VALUES (78, 'Bed jokes', 'What should you do if you find a witch in your bed? Run!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (79, 'Bed jokes', 'Father: Why did you put a toad in your sisters bed? Son: I couldnt find a spider.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (80, 'Bicycle jokes', 'While crossing the US-Mexican border on his bicycle, the man was stopped by a guard who pointed to two sacks the man had on his shoulders. "Whats in the bags?", asked the guard."Sand," said the cyclist."Get them off - well take a look," said the guard. The Cyclist did as he was told, emptied the bags, and proving they contained nothing but sand, reloaded the bags, put them on his shoulders and continued across the border. Two weeks later, the same thing happened. Again the guard demanded to see the two bags, which again contained nothing but sand. This went on every week for six months, until one day the cyclist with the sand bags failed to appear. A few days later, the guard happened to meet the cyclist downtown. "Say friend, you sure had us crazy", said the guard. "We knew you were smuggling something across the border. I wont say a word - but what is it you were smu ggling?" "Bicycles!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (81, 'Bicycle jokes', 'What is a ghost-proof bicycle? One with no spooks in it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (82, 'Bicycle jokes', '"Lie flat on your backs, class, and circle your feet in the air as if you were riding your bikes," said the gym teacher. "Fred! What are you doing? Move your feet, boy." "Im freewheeling, sir."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (83, 'Bicycle jokes', 'Did you hear about the vampire bicycle that went round biting peoples arms off? It was a vicious cycle.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (84, 'Bicycle jokes', 'My dog is a nuisance. He chases everyone on a bicycle. What can I do? Take his bike away.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (85, 'Biologist jokes', 'Two biologists are in the field following the tracks of a radio-collared grizzly bear. All of a sudden, the bear crashes out of the brush and heads right for them. They scramble up the nearest tree, but the bear starts climbing up the tree after them. The first biologist starts taking off his heavy leather hiking boots and pulls a pair of sleek running shoes from his back-pack. The second biologist gives him a puzzled look and says, "What in the world are you doing?"He replies, "I figure when the bear gets close to us, well jump down and make a run for it."The second guy says, "Are you crazy? We both know you cant outrun a full-grown grizzly bear."The first guy says, "I dont have to outrun the bear, I only have to outrun you!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (86, 'Biologist jokes', 'A boy was assigned a paper on childbirth and asked his mother, "How was I born?""Well honey..." said the slightly prudish mother, "the stork brought you to us.""Oh," said the boy, "and how did you and daddy get born?""Oh, the stork brought us too.""Well how were grandpa and grandma born?" the boy persisted."Well darling, the stork brought them too!" said the mother, by now starting to squirm a little.Several days later, the boy handed in his paper to the teacher who read with confusion the opening sentence: "This report has been very difficult to write due to the fact that there hasnt been a natural childbirth in my family for three generations."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (87, 'Biologist jokes', 'How do you eat a DNA spaghetti?With a replication fork (you can also use your zinc fingers...)', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (88, 'Biologist jokes', 'A biologist was interested in studying how far bullfrogs can jump. He brought a bullfrog into his laboratory, set it down, and commanded, "Jump, frog, jump!"The frog jumped across the room.The biologist measured the distance, then noted in his journal, "Frog with four legs jumped eight feet."Then he cut the frogs front legs off. Again he ordered, "Jump, frog, jump!"The frog struggled a moment, then jumped a few feet.After measuring the distance, the biologist noted in his journal, "Frog with two legs jumped three feet."Next, the biologist cut off the frogs back legs. Once more, he shouted, "Jump, frog, jump!"The frog just lay there."Jump, frog, jump!" the biologist repeated.Nothing.The biologist noted in his journal, "Frog with no legs - lost its hearing."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (89, 'Biologist jokes', 'A boy frog telephones the Psychic Hotline and his Personal Psychic Advisor tells him: "You are going to meet a beautiful young girl who will want to know everything about you."The frog is thrilled, "This is great! Will I meet her at a party?""No," says his Advisor, "in her biology class."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (90, 'Bird jokes', 'A man with a talking parrot is getting married. On the day of the wedding he says to the parrot "Now look here, I know you are always sat in that window sticking your beak in, when me and my new wife get back from the wedding I want you to turn round and and no matter what you hear I do not want you to turn back or Ill break your neck, do you understand?" The parrot reluctantly agrees.On returning from the wedding the parrot turns round as instructed, and behind him the bride and groom start to pack for the honeymoon. The wife however has packed too much and they cant get the case closed. "Get on top and sit on it baby!" Says the man the woman does so and grunts and moans but cant shut the case. "You get on top baby it might be better" Says the wife, so the man grunts and groans and tries his best but still cant shut the case.After a little thought the man says "Ok well both get on top see  if thats any better!" The parrot turns round and says "Neck or no neck I have to see this!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (91, 'Bird jokes', 'David received a parrot for his birthday. This parrot was fully grown with a bad attitude and terrible vocabulary. Every other word was an expletive. Those that werent expletives were, to say the least, rude. David tried hard to change the birds attitude. He was constantly saying polite words and playing soft music, he did anything he could think of. Nothing worked. When he yelled at the bird, the bird got worse. If he shook the bird, the bird got madder and ruder. Finally in a moment of desperation, David put the parrot in the freezer. For a few moments he heard the bird squawking, kicking and screaming and then suddenly, there was quiet. David was frightened that he might have actually hurt the bird and quickly opened the freezer door. The parrot calmly stepped out onto Davids extended arm and said: "Im sorry that I might have offended you with my language and actions, so I ask for your forgiven ess. I will try to correct my behavior." David was astounded at the birds change in attitude and was about to ask what had changed him when the parrot continued: "May I ask what the chicken did?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (92, 'Bird jokes', 'Q: Why do hens lay eggs?A: If they dropped them, theyd break', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (93, 'Bird jokes', 'Q: What is a crowbar?A: A place were crows go to get a drink!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (94, 'Bird jokes', 'Q: Why did the turkey cross the road?A: To prove he wasnt chicken.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (95, 'Birthday jokes', 'A man asked his wife, "What would you most like for your birthday?"She said, "Id love to be ten again."On the morning of her birthday, he got her up bright and early and they went to a theme park. He put her on every ride in the park - the Death Slide, The Screaming Loop, the Wall of Fear. She had a go on every ride there was.She staggered out of the theme park five hours later, her head reeling and her stomach turning.Then off to a movie theater, popcorn, cola and sweets.At last she staggered home with her husband and collapsed into bed.Her husband leaned over and asked, "Well, dear, what was it like being ten again?"One eye opened and she groaned, "Actually, honey, I meant dress size!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (96, 'Birthday jokes', 'A couple have not been getting along for years, so the husband thinks,"Ill buy my wife a cemetery plot for her birthday."Well, you can imagine her disappointment.The next year, her birthday rolls around again and thistime he doesnt get her anything.She says, "Why didnt you get me a birthday present!?"He replies, "You didnt use what I got you last year!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (97, 'Birthday jokes', 'Home - A - Age Jokes"Thats an excellent essay for someone your age," said the English teacher. "How about for someone my Mums age, Miss?" "Welcome to school, Simon," said the nursery school teacher to the new boy. "How old are you?" "Im not old," said Simon. "Im nearly new."Miss Jones agreed to be interviewed by Fred for the school magazine. "How old are you, maam?" asked Fred. "Im not going to tell you that," she replied. "But Mr Hill the technical teacher and Mr Hill the geography teacher told me how old they were." "Oh well," said Miss Jones. "Im the same age as both of them." The poor teacher was not happy when she saw what Fred wrote: Miss Jones, our English teacher, confided in me that she was as old as the Hills. "Now remember, boys and girls," said the science teacher, "you can tell a trees age by counting the rings in  a cross section. One ring for each year." Fred went home for tea and found a chocolate roll on the table. "Im not eating that, Mum!" she said. "Its five years old." Grandma: Youve left all your crusts, Fred. When I was your age I ate every one. Fred: Do you still like crusts, Grandma? Grandma: Yes, I do. Fred: Well, you can have mine. How old is your wife?Approaching forty.From which direction?An eminent old man was being interviewed, and was asked if it was correct that he had just celebrated his ninety-ninth birthday.`Thats right, said the old man. `Ninety-nine years old, and I havent an enemy in the world. Theyre all dead.`Well, sir, said the interviewer, `I hope very much to have the honour of interviewing you on your hundredth birthday.The old man looked at the young man closely, and said, `I cant see why you shouldnt. You  look fit and healthy to me!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (98, 'Birthday jokes', 'Johnny was racing around the garden on his new bicycle and called out to his mother to watch his tricks. Look, Mum! No hands! Look, Mum! No feet! Waaah! Look, Mum! No teeth!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (99, 'Birthday jokes', 'First boy: Are you having a party for your birthday? Second boy: No, Im having a witch do. First boy: Whats a witch do? Second boy: She flies around on a broomstick casting spells.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (100, 'Blind jokes', 'One day two blind men started fighting.Pretty soon a crowd surrounded them.Then one of the members of the crowd yelled out "I bet 10 bucks on the one with the knife."Both men ran away.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (101, 'Blind jokes', 'Q: Why dont blind people skydive?A: It scares the heck out of the dog.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (102, 'Blind jokes', 'A blind man walks into a store with his seeing eye dog. All of a sudden, he picks up the leash and begins swinging the dog over his head. The manager runs up to the man and asks, "What are you doing?!!" The blind man replies, "Just looking around."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (103, 'Blind jokes', 'A blind man was describing his favorite sport, parachuting. When asked how this was accomplished, he said that things were all done for him: "I am placed in the door with my seeing eye dog and told when to jump. My hand is placed on my release ring for me and out I go with the dog.""But how do you know when you are going to land?" he was asked. "I have a very keen sense of smell, and I can smell the trees and grass when I am 300 feet from the ground" he answered."But how do you know when to lift your legs for the final arrival on the ground?" he was again asked. He quickly answered: "Oh, the dogs leash goes slack."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (104, 'Blind jokes', 'There once was a blind man who decided to visit Texas. When he arrived on the plane, he felt the seats and said, "Wow, these seats are big!" The person next to him answered, "Everything is big in Texas." When he finally arrived in Texas, he decided to visit a bar. Upon arriving in the bar, he ordered a beer and got a mug placed between his hands. He exclaimed, "Wow these mugs are big!" The bartender replied, "Everything is big in Texas." After a couple of beers, the blind man asked the bartender where the bathroom was located. The bartender replied, "Second door to the right." The blind man headed for the bathroom, but accidentally tripped over and skipped the second door. Instead, he entered the third door, which lead to the swimming pool and fell into the pool by accident. Scared to death, the blind man started shouting, "Dont flush, dont flush!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (105, 'Blonde jokes', 'A blonde goes into work one morning crying her eyes out. Her boss, concerned about his employees well being, asks sympathetically, "Whats the matter?" The blonde replies, "Early this morning I got a phone call saying that my mother had passed away." "Im terribly sorry to hear that. Why dont you go home for the day... we arent terribly busy. Just take the day off to relax and rest." The blonde very calmly explains, "No, Id be better off here. I need to keep my mind off it and I have the best chance of doing that here." The boss agrees and allows the blonde to work as usual. "If you need anything, just let me know," he says. A few hours pass and the boss decides to check on the blonde. He looks out over his office and sees the blonde crying hysterically. He rushes out to her, and asks, "Are you going to be okay? Is there anything I can do to help?" "No," re plies the blonde, "I just got a call from my sister, and she said that HER mom died too!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (106, 'Blonde jokes', 'A young ventriloquist is touring the clubs and one night hes doing a show in a small club in a small town in Arkansas. With his dummy on his knee, hes going through his usual dumb blonde jokes when a blonde woman in the fourth row stands on her chair and starts shouting: "Ive heard enough of your stupid blonde jokes. What makes you think you can stereotype women that way? What does the color of a persons hair have to do with her worth as a human being? Its guys like you who keep women like me from being respected at work and in the community and from reaching our full potential as a person, because you and your kind continue to perpetuate discrimination against, not only blondes, but women in general...and all in the name of humor!"The ventriloquist is embarrassed and begins to apologize, when the blonde yells, "You stay out of this, mister! Im talking to that little idiot on your knee!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (107, 'Blonde jokes', 'The assistant asked the blonde if she would like her pizza cut into six pieces or twelve. "Six please" she said, "I could never eat twelve!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (108, 'Blonde jokes', 'A blonde was walking down the road with a healthy looking pig under her arm. As she passed the bus stop, someone asked, "Where did you get that?"The pig replied, "I won her in a raffle!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (109, 'Blonde jokes', 'A person went into the office kitchen one morning and found a new blonde girl painting the walls. She was wearing a new fur coat and a nice denim jacket.Thinking this was a little strange, he asked her why she was wearing them rather than old clothes or an overall.She showed him the instructions on the tin, "For best results, put on two coats".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
