INSERT INTO `jokes` VALUES (115, 'Brother and sister jokes', 'So you are distantly related to the family next door, are you?Yes- their dog is our dogs brother.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (116, 'Brother and sister jokes', 'A scoutmaster asked one of his troop what good deed he had done for the day. Well, said the Scout. Mum had only one dose of castor oil left, so I let my baby brother have it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (117, 'Brother and sister jokes', 'First Boy: Why is your brother always flying off the handle ?Second Boy: Because hes got a screw loose !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (118, 'Brother and sister jokes', 'Peter: My brother wants to work badly!Anita: As I remember, he usually does !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (119, 'Brother and sister jokes', 'Dan: My little brother is a real pain.Nan: Things could be worse.Dan: How?Nan: He could be twins !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (120, 'Burger jokes', 'Are hamburgers male?Yes, because theyre boygers, not girlgers!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (121, 'Burger jokes', 'Can a hamburger marry a hot dog?Only if they have a very frank relationship!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
