INSERT INTO `jokes` VALUES (125, 'Bus jokes', 'Cross-eyed monster: When I grow up I want to be a bus driver. Witch: Well, I wont stand in your way.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (126, 'Bus jokes', 'How do eels get around the seabed? They go by octobus.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (127, 'Bus jokes', 'Bus passenger: Id like a ticket to New York, please. Ticket seller: By Buffalo? Bus passenger: Of course not, Im in the bus queue, arent I?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (128, 'Bus jokes', 'What did the bus conductor say to the frog? Hop on.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (129, 'Bus jokes', 'Why did the bat miss the bus? Because he hung around for too long.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (130, 'Cannibal jokes', 'Why dont cannibals eat comedians?They taste funny.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (131, 'Cannibal jokes', 'Did you hear about the cannibal spider that ate his uncles wife? He was an aunteater.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (132, 'Cannibal jokes', 'Why was the cannibal expelled from school? Because he kept buttering up the teacher.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
