INSERT INTO `jokes` VALUES (134, 'Cannibal jokes', 'What does a cannibal eat with cheese? Pickled organs.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (135, 'Business jokes', 'These two construction workers always noticed that their boss always left early on Fridays. So one asked the other that if the boss left early next Friday if he would want to also. The other man agreed. Sure enough, when Friday came, the boss left early. Therefore, the two men left also. The one offered the other to join him down at the bar, but he decided to just head on home. When he arrived home, he heard a noise from up stairs. When he reached the top of the stairs, he noticed that the noise was coming from the bedroom. He opened the door and saw his boss sleeping with his wife, so he quietly closed the door and headed back down the stairs and out the front door. He made his way down to the bar to see if his friend was still there and he was. His friend asked, "I thought you were headed home?" The man replied, "I did, but this is the last time I ever leave work early a gain." His friend asked, "Whys that?" The man replied, "I almost got caught by the boss."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (136, 'Business jokes', 'A man is flying in a hot air balloon and realizes he is lost. He reduces his altitude and spots a man down below. He lowers the balloon further and shouts: "Excuse me, can you tell me where I am?"The man below says: "Yes, youre in a hot air balloon, hovering 30 feet above this field.""You must work in Technical Support," says the balloonist."I do," replies the man. "How did you know?""Well" says the balloonist, "everything you have told me is technically correct, but completely useless."The man below says: "You must be in management.""I am," replies the balloonist, "but how did you know?""Well", says the man, "you dont know where you are, or where youre going, but you expect me to be able to help. Youre still in the same position you were before we met, but now its my fault."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (137, 'Business jokes', 'Several weeks after a young man had been hired, he was called intothe personnel directors office. "What is the meaning of this?" thedirector asked. "When you applied for this job, you told us you had fiveyears experience. Now we discovered this is the first job youve everheld.""Well," the young man replied, "in your advertisement you said youwanted somebody with imagination."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (138, 'Business jokes', 'There was this man who was in a horrible accident, and was injured. But the only permanent damage he suffered was the amputation of both of his ears. As a result of this unusual handicap, he was very self-conscious about his having no ears. Because of the accident, he received a large sum of money from the insurance company. It was always his dream to own his own business, so he decided with all this money he had, he now had the means to own a business. So he went out and purchased a small, but expanding computer firm. But he realized that he had no business knowledge at all, so he decided that he would have to hire someone to run the business. He picked out three top candidates, and interviewed each of them. The first interview went really well. He really liked this guy. His last question for this first candidate was, Do you notice anything unusual about me? The guy s aid, Now that you mention it, you have no ears. The man got really upset and threw the guy out. The second interview went even better than the first. This candidate was much better than the first. Again, to conclude the interview, the man asked the same question again, Do you notice anything unusual about me? This guy also noticed, Yes, you have no ears. The man was really upset again, and threw this second candidate out. Then he had the third interview.. The third candidate was even better than the second, the best out of all of them. Almost certain that he wanted to hire this guy, the man once again asked, Do you notice anything unusual about me? The guy replied Yeah, youre wearing contact lenses. Surprised, the man then asked, Wow! Thats quite perceptive of you! How could you tell? The guy burst out laughing and said, Well, You cant wear glasses if you d ont have any ears!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (139, 'Business jokes', 'When Abraham Liebowitz gets to school he discovers that he is the only Jewish kid in the class. But its a decent town and nobody really bothers him. One day the teacher asks the class "Who was the greatest person who ever lived? and why?" And to make it interesting she held a twenty dollar bill in the air and said "whoever gives the best answer will get this twenty dollars". All of the kids called out their guesses. One said "George Washington - because he was the father of our country." "Thats excellent" said the teacher. Another said "Abraham Lincoln - because he freed the slaves." "Thats also good" said the teacher, reluctant to bestow an excellent, but still being polite. One little girl said "Joan of Arc - because she saved France." Another excellent choice said the teacher. Then Abraham Liebowitz, raised his hand. \r nSo the teacher called on him. "Abraham, who do you think was the greatest person who ever lived, and why?" And Abraham said "Jesus Christ." The teacher was shocked. "Abraham," she said "Im very surprised. Class, I think we can all agree that Abraham should get the twenty dollars." And she handed Abraham Liebowitz the money. At recess, the teacher was still very impressed. So she asked Abraham why he said Jesus. Abraham said "Look, personally I think Moses was the greatest person who ever lived, but... business is business!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (140, 'Car and train jokes', 'A grizzled old man was eating in a truck stop when three Hells Angels bikers walked in. The first walked up to the old man, pushed his cigarette into the old mans pie and then took a seat at the counter. The second walked up to the old man, spat into the old mans milk and then he too took a seat at the counter. The third walked up to the old man, turned over the old mans plate, and then he took a seat at the counter. Without a word of protest, the old man quietly left the diner. Shortly thereafter, one of the bikers said to the waitress, "Humph, not much of a man, was he?" The waitress replied, "Not much of a truck driver either, he just backed his big-rig over three motorcycles."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (141, 'Car and train jokes', 'A man was in court charged with parking his car in a restricted area. The judge asked if he had anything to say in his defense. "They shouldnt put up such misleading notices," said the man. "It said FINE FOR PARKING HERE."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (142, 'Car and train jokes', 'As a senior citizen was driving down the freeway, his car phone rang. Answering, he heard his wifes voice urgently warning him, "Herman, I just heard on the news that theres a car going the wrong way on 280 Interstate. Please be careful!" "Hell," said Herman, "Its not just one car. Its hundreds of them!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (143, 'Car and train jokes', 'One day there was a family driving in the car to Michigan to visit their relatives. They were looking for the street they had to turn on to get to their relatives house. They accedently turned on the wrong street so they had to pull in a driveway and turn around. When they pulled into the driveway the girl asked her mother "Why dont these people have electricity?" Very confused the mother said, "Wut are u talking about?" The girl quickly replied, "Well, the sign back there said NO OUTLET!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (144, 'Car and train jokes', 'A man is driving along in the Irish countryside, when he comes to a petrol station, since hes in need of petrol, the man decides to stop. He says to the attendant at the station, "Fill it up, will you?". The man says "Sorry - were right out of petrol." So the man considers, and says "Well, Im a bit low on oil, would you mind topping that up?" And the attendant responds"Sorry, but no oil either." The man thinks, and asks the attendant to wash his windscreen, to which he gets the by-now predictable response that he cant do that. The man at this point is fairly mad, so he asks the attendant "Just what kind of petrol station is this ?" The attendant then looks both ways, and very carefully whispers to the man "To tell you the truth, this is just an IRA front." The man then says "Well, in that case, you can blow up the tyres !"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (145, 'Cat jokes', 'For all of you with teenagers or who have had teenagers, or are a teenager, you may want to know why they really have a lot in common with cats: - Neither teenagers nor cats turn their heads when you call them by name. - No matter what you do for them, it is not enough. Indeed, all humane efforts are barely adequate to compensate for the privilege of waiting on them hand and foot. - You rarely see a cat walking outside of the house with an adult human being, and it can be safely said that no teenager in his or her right mind wants to be seen in public with his or her parents. - Even if you tell jokes as well as Jay Leno, neither your cat nor your teen will ever crack a smile. - No cat or teenager shares you taste in music. - Cats and teenagers can lie on the living-room sofa for hours on end without moving, barely breathing. - Cats have nine lives. Teenagers carry o n as if they did.- Cats and teenagers yawn in exactly the same manner, communicating that ultimate human ecstasy -- a sense of complete and utter boredom. - Cats and teenagers do not improve anyones furniture. - Cats that are free to roam outside sometimes have been known to return in the middle of the night to deposit a dead animal in your bedroom. Teenagers are not above that sort of behavior. Thus, if you must raise teenagers, the best sources of advice are not other parents, but veterinarians. It is also a good idea to keep a guidebook on cats at hand at all times. And remember, above all else, put out the food and do not make any sudden moves in their direction. When they make up their minds, they will finally come to you for some affection and comfort, and it will be a triumphant moment for all concerned.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (146, 'Cat jokes', 'A woman is walking in the park when she sees a man playing chess with his cat. She says to the man "I cant believe what Im seeing, a cat that plays chess, what a clever animal!!" The man replied "Nah lady this cats not clever at all Im beating it 6 games to 1"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (147, 'Cat jokes', 'Little Tim was in the garden filling in a hole when his neighbor peered over the fence. Interested in what the cheeky-faced youngster was up to, he politely asked, "Whatcha doing, Tim?" "My goldfish died," replied the boy tearfully, without looking up. "And Ive just buried him." The neighbor was concerned. "Thats an awfully big hole for a goldfish, isnt it?" Tim patted down the last heap of earth then replied, "Thats because hes inside your cat."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (148, 'Cat jokes', 'Q: When is a bad time to cross a black cat?A: When you are a mouse!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (149, 'Cat jokes', 'Q: Where did the kittens go on their class trip? - A: To a mewseum.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (150, 'Children jokes', 'A mother was reading a book about animals to her 3 year old daughter. Mother: "What does the cow say?" Child: "Moo!" Mother: "Great! What does the cat say?" Child: "Meow." Mother: "Oh, youre so smart! What does the frog say?" And this wide-eyed little 3 year-old looked up at her mother and in her deepest voice replied, "Bud."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (151, 'Children jokes', 'A group of young children were siting in a circle with their teacher. She was going around in turn asking them all questions. "Davy, what noise does a cow make?" "It goes moo." "Alice, what noise does a cat make?" "It goes meow." "Jamie, what sound does a lamb make?" "It goes baaa." "Jennifer, what sound does a mouse make?" "Errr.., it goes.. click!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (152, 'Children jokes', 'Why were ancient Egyptian children confused? Because their daddies were mummies.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (153, 'Children jokes', 'A little boy walked down the aisle at a wedding. As he made his way to the front, he would take two steps, then stop, and turn to the crowd, alternating between the brides side and the grooms side. While facing the crowd, he would put his hands up like claws and roar. And so it went-step, step, ROAR, step, step, ROAR-all the way down the aisle.As you can imagine, the crowd was near tears from laughing so hard by the time he reached the pulpit.The little boy, however, was getting more and more distressed from all the laughing, and he was near tears by the time he reached the pulpit.When asked what he was doing, the child sniffed back his tears and said, "I was being the ring bear."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (154, 'Children jokes', 'A certain little girl, when asked her name, would reply, "Im Mr. Sugarbrowns daughter." Her mother told her this was wrong, she must say,"Im Janey Sugarbrown." The Vicar spoke to her in Sunday School, and said,"Arent you Mr. Sugarbrowns daughter?" With her mother standing just a few feet away, the little girl replied, "I thought I was, but Mommy says Im not."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (155, 'Christmas jokes', 'What do monkeys sing at Christmas ?Jungle Bells, Jungle bells.. !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (156, 'Christmas jokes', 'Why are Christmas trees like bad knitters ?They both drop their needles !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (157, 'Christmas jokes', 'What did the bald man say when he got a comb for Christmas ?Thanks, Ill never part with it !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (158, 'Christmas jokes', 'Why is a burning candle like being thirsty ?Beacause a little water ends both of them !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (159, 'Christmas jokes', 'What do you get if you cross an apple with a Christmas tree ?A pineapple !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (160, 'Clinton jokes', 'Q: How does Bill Clinton say "Im about to hurt you"?A: "Trust me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (161, 'Clinton jokes', 'Q: Whats the difference between Hillary Clinton and a pit bull?A: The pit bull doesnt carry a briefcase.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (162, 'Clinton jokes', 'Q: What is the difference between Dan Quayle, Bill Clinton and Jane Fonda?A: Jane Fonda went to Vietnam.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (163, 'Clinton jokes', 'Saddam Hussein calls President Clinton and tells him, "Bill, I had awonderful dream last night. I could see America, the whole beautifulcountry, and on each house I saw a banner.""What did it say on the banners?" Clinton asks.Saddam replies, "Allah is god, god is Allah."Clinton says, "You know, Saddam, I am really happy you called. Last night I had a similar dream. I could see all of Baghdad, and it was more beautiful than ever. It had been rebuilt completely, and on each house flew an enormous banner.""What could you see on the banners?" Saddam asks.Clinton replies, "I dont know. I cant read Hebrew."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (164, 'Clinton jokes', 'Q: How can you tell Bill Clinton apart from a cow?A: By the wise look in the eyes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (165, 'College jokes', 'An applicant was being interviewed for admission to a prominent medical school. "Tell me," inquired the interviewer, "where do you expect to be ten years from now?""Well, lets see," replied the student. "Its Wednesday afternoon. I guess Ill be on the golf course by now."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (166, 'College jokes', 'Teenage Driver: But, officer, Im a college man.Policeman: Sorry, but ignorance is no excuse.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (167, 'College jokes', 'Why do University of Arkansas graduates tape their diplomas to the windshields of their cars? So they can park in handicapped spaces.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (168, 'College jokes', 'How do you know a Brigham Young students been mowing the lawn? The welcome mat is destroyed.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (169, 'College jokes', 'What does the N on the Nebraska football helmet stand for? "Nowledge."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (170, 'Cow jokes', 'Q: What do you call cattle with a sense of humor?A: Laughing stock.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (171, 'Cow jokes', 'What did the farmer call the cow that would not give him any milk ? An udder failure !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (172, 'Cow jokes', 'Camper: Look at that bunch of cows.Farmer: Not bunch, herd.Camper: Heard what?Farmer: Of cows.Camper: Sure Ive heard of cows.Farmer: No, I mean a cowherd.Camper: So what? I have no secrets from cows!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (173, 'Cow jokes', 'Why do cows wear bells around their necks?Because their horns dont work.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (174, 'Cow jokes', 'A man climbed over a fence into a field to pick some flowers. He noticed a bull nearby. Say, farmer. Is that bull safe? Well, hes a lot safer than you are right now!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (175, 'Cowboy jokes', 'The cowboy lay sprawled across three entire seats in the posh Amarillo theatre. When the usher came by and noticed this he whispered to the cowboy, "Sorry, sir, but youre only allowed one seat." The cowboy groaned but didnt budge. The usher became more impatient. "Sir, if you dont get up from there, Im going to have to call the manager. The cowboy just groaned. The usher marched briskly back up the aisle. In a moment he returned with the manager. Together the two of them tried repeatedly to move the cowboy, but with no success. Finally, they summoned the police. The cop surveyed the situation briefly then asked, "All right buddy, whats youre name?" "Sam," the cowboy moaned. "Where ya from, Sam?" With pain in his voice Sam replied.... "The balcony."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (176, 'Cowboy jokes', 'Three cowboys were hanging out in the bunkhouse. "I know that smart aleck Tex," said the first. "Hes going to start bragging about that new foreign car he bought as soon as he gets back." "Not Tex," the second cowboy replied. "Hell always be just a good ol boy. When he walks in, Im sure all hell say is hello." "I know Tex better than either of you," said the third. "Hes so smart, hell figure out a way to do both. Here he comes now." Tex swung open the bunkhouse door and shouted, "Audi, partners!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (177, 'Cowboy jokes', 'The cowboy was trying to buy a health insurance policy. The insurance agent was going down the list of standard questions."Ever have an accident?""Nope, nary a one.""None? Youve never had any accidents.""Nope. Aint never had one. Never.""Well, you said on this form you were bit by a snake once. Wouldnt you consider that an accident?""Heck, no. That dang varmint bit me on purpose."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (178, 'Cowboy jokes', 'Teacher: When do astronauts eat?Pupil: At launch time!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (179, 'Cowboy jokes', 'A cowboy and a biker are on death row, and are to be executed on the same day. The day comes, and they are brought to the gas chamber. The warden asks the cowboy if he has a last request, to which the cowboy replies, "Ah shore do, wardn. Ahd be mighty grateful ifn yood play Achy Breaky Heart fur me bahfore ah hafta go.""Sure enough, cowboy, we can do that," says the warden. He turns to the biker, "And you, biker, whats your last request?""That you kill me first."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (180, 'Criminal jokes', 'Several years ago, Andy was sentenced to prison. During his stay, he got along well with the guards and all his fellow inmates. The warden saw that deep down, Andy was a good person and made arrangements for Andy to learn a trade while doing his time. After three years, Andy was recognized as one of the best carpenters in the local area. Often he would be given a weekend pass to do odd jobs for the citizens of the community.... and he always reported back to prison before Sunday night was over.The warden was thinking of remodeling his kitchen and in fact had done much of the work himself. But he lacked the skills to build a set of kitchen cupboards and a large counter top which he had promised his wife. So he called Andy into his office and asked him to complete the job for him.But, alas, Andy refused. He told the warden, "Gosh, Id really like to help you but counter fitting is what got  me into prison in the first place".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (181, 'Criminal jokes', 'A murderer, sitting in the electric chair, was about to be executed."Have you any last requests? asked the chaplain."Yes," replied the murderer. "Will you hold my hand?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (182, 'Criminal jokes', 'Two men, sentenced to die in the electric chair on the same day were led down to the room in which they would meet their maker. The priest had given the last rites, the formal speech had been given by the warden, and a final prayer had been said among the participants. The Warden, turning to the first man, solemnly asked, "Son, do you have a last request?" To which the man replied, "Yes sir, I do. I love dance music. Could you please play The Macarena for me one last time?" "Certainly," replied the warden. He turned to the other man and asked, "Well, what about you, son? What is your final request?" "Please," said the condemned man, "kill me first."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (183, 'Criminal jokes', 'A prisoner at the Edmonton Max started training a large fly to do tricks.For years, for thousands of hours, he worked with the insect. It learned to walk across a miniature high wire, ride a tiny one-wheel bike, balance on a pair of stilts and sing songs from PHANTOM OF THE OPERA. "When you and I get out of here," the jailbird said to the fly. "were going to tour the nightspots and make a fortune." Finally the day arrived. Fly safely tucked away in his pocket, (inside its matchbox home), the ex-con made his way to a bar to celebrate. At the bar, he brought out his trick fly. On cue, it started moonwalking. "What about this fly, eh?" he said to the bartender. In one swift motion, the bartender reached for his copy of the newspaper THE EDMONTON SUN, rolled it up and squished the fly with a mighty swipe. "Glad you saw it," muttered the bartender. "Blasted things are eve rywhere."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (184, 'Criminal jokes', 'Why do they put a suicide watch on death row prisoners? Why would you care if a man youre planning to kill anyway, kills himself? Does it spoil the fun? I also think about the death row prisoner in Texas who, on the day before his execution, managed to take a drug overdose. They rushed him to a hospital, saved his life, then brought him back to prison and killed him.Apparently, just to anger him.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (185, 'Dance jokes', 'Q. What do you have when only one line dancer comes to your party?A. A One Liner!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (186, 'Dance jokes', 'Q. What do you call two line dancers doing the dance Shoot the Rooster?A. A Pair of Shoot (parachute)', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (187, 'Dance jokes', 'Q. What do you call a one legged linedancer?A. Eileen (I Lean)', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (188, 'Dance jokes', 'Q. Where do tired linedancers go for Breakfast?A. Ihop', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (189, 'Dance jokes', 'Andy: "Doc, I had the worst dream of my life last night. I dreamed I was with twelve of the most beautiful chorus girls in the world. Blondes, brunettes, redheads, all dancing in a row." Doctor: "Hold it, Andy. That doesnt sound so terrible." Andy: Oh yeah? In the dream, I was the third girl from the end."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (190, 'Dead and dying jokes', 'A woman goes into the local newspaper office to see that the obituary for her recently deceased husband is published. Afterthe editor informs her that the fee for the obituary is 50cents a word, she pauses, reflects and then says, "Well, then,let it read Fred Brown died."Confounded at the womans thrift, the editor stammers that thereis a 7-word minimum for all obituaries. The woman pauses again,counts on her fingers and replies, "In that case, Fred Browndied: 1983 Pick-up for sale."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (191, 'Dead and dying jokes', 'A Packer fan was enjoying himself at the game in a packed Lambeau Field,until he noticed an empty seat down in front. He went down and asked theguy next to it if he knew whose seat it was. The guy said, "Yes, thatsmy wifes seat. We have never missed a game since the Lombardi days, butnow my wife is dead." The fan offered his sympathy and said it was reallytoo bad he couldnt find some relative to give the ticket to so they couldenjoy the game together... "Oh no," the guy said, "theyre all at the funeral."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (192, 'Dead and dying jokes', 'A woman goes into a funeral home to make arrangements for herhusbands funeral. She tells the director that she wants her husbandto be buried in a dark blue suit.He asks, "Wouldnt it just be easier to bury him in the black suitthat hes wearing?"But she insists that it must be a blue suit and gives him a blankcheck to buy one.When she comes back for the wake, she sees her husband in the coffinand he is wearing a beautiful blue suit. She tells the director howmuch she loves the suit and asks how much it cost.He says, "Actually, it didnt cost anything. The funniest thinghappened. As soon as you left, another corpse was brought in, this onewearing a blue suit. I noticed that they were about the same size, andasked the other widow if she would mind if her husband were buried ina black suit. She said that was fine with her. So... I switched theheads."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (193, 'Dead and dying jokes', 'Sam was on his death bed, and his wife and children were gatheredaround him. Suddenly the aroma of chopped liver filled the room.Sam perked up a bit and said to his wife, "Thats it, one last timebefore I die I must have some of your delicious chopped liver."Sams wife looked at him sadly and said, "Sorry Sam, its for after."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (194, 'Dead and dying jokes', 'Whats the difference between a very old, shaggy Yeti and a dead bee? Ones a seedy beast and the others a deceased bee.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (195, 'Dentist jokes', 'A dentist, after completing work on a patient, came to him begging.Dentist: Could you help me? Could you give out a few of your loudest, most painful screams?Patient: Why? Docor, it wasnt all that bad this time.Dentist: There are so many people in the waiting room right now, and I dont want to miss the four oclock ball game.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (196, 'Dentist jokes', 'A patient came to his dentist with problems with his teeth.Patient: Doctor, I have yellow teeth, what do I do?Dentist: Wear a brown tie!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (197, 'Dentist jokes', 'Dentist: I have to pull the aching tooth, but dont worry it will take just five minutes.Patient: And how much will it cost?Dentist: Its $90.00. Patient: $90.00 for just a few minutes work???Dentist: I can extract it very slowly if you like.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (198, 'Dentist jokes', '"I came in to make an appointment with the dentist." said the man to the receptionist."Im sorry sir." she replied. "Hes out right now, but...""Thank you," interrupted the obviously nervous prospective patient. "When will he be out again ?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (199, 'Dentist jokes', 'A husband and wife entered the dentists office. The husband said, "I want a tooth pulled. I dont want gas or Novocain because Im in a terrible hurry. Just pull the tooth as quickly as possible.""Youre a brave man," said the dentist. "Now, show me which tooth it is."The husband turns to his wife and says, "Open your mouth and show the dentist which tooth it is, dear."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (200, 'Dinosaur jokes', 'Q: Why doesnt the dinosaur cross the road anymore?A: Because their eggs stink. (Theyre extinct)', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (201, 'Dinosaur jokes', 'Q: What do you get when dinosaurs crash their cars?A: Tyrannosaurus wrecks!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (202, 'Dinosaur jokes', 'Q: How did the dinosaur feel after he ate a pillow? A: Down in the mouth!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (203, 'Dinosaur jokes', 'Q: Whats green and purple and goes up and down?A: Barney in an elevator.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (204, 'Dinosaur jokes', 'Q: What did the dinosaur say when he saw the volcano explode? A: What a lavaly day!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (205, 'Dirty jokes', 'An old man approaches the window of a cinema with a chicken on his shoulder, and asks for 2 tickets. The girl at the counter wants to know who is going in with him. He replies, "Well, my pet chicken, of course!" "Im sorry," The girl tells him. "We cant allow animals in the cinema." The man goes around the corner and stuffs the chicken into his trousers. He returns to the window, buys his ticket and goes in. Inside the cinema, the chicken starts to get hot and begins to squirm, so the man unzips his trousers so the chicken can stick its head out and watch the film. Seated next to him is a woman. She looks over at his lap and is horrified. She elbows her friend Agnes and whispers, "Agnes, this man over here has just unzipped his trousers!" Agnes whispers back, "Oh, dont worry about it...youve seen one, youve seen them all." Madge says, "I KNOW...but this ones eating my POPCORN!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (206, 'Dirty jokes', 'Two Marines were sitting around talking one day. The first Marine asked the second Marine, "If they were to drop a bomb right now, what would be the first thing you would do?"The second Marine said, "I would screw the first thing that moved. What would you do?"The first Marine replied, "I would stand very still for half an hour."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (207, 'Dirty jokes', 'The officer shouted orders to a nearby soldier. With considerable bravery, the GI ran directly onto the field of battle, in the line of fire, to retrieve a dispatch case from a dead soldier. In a hail of bullets, he dove back to safety."Private," the officer said, "Im recommending you for a medal. You risked your life to save the locations of our secret warehouses.""Warehouses?" the private shouted. "I thought you said whorehouses!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (208, 'Dirty jokes', 'Whats the speed limit of sex?68; at 69 you have to turn around.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (209, 'Dirty jokes', 'Whats the ultimate rejection?When youre masturbating and your hand falls asleep.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (210, 'Divorce jokes', 'A judge was interviewing a woman regarding her pending divorce, and asked, "What are the grounds for your divorce?" She replied, "About four acres and a nice little home in the middle of the property with a stream running by." "No," he said, "I mean what is the foundation of this case?" "It is made of concrete, brick and mortar," she responded. "I mean," he continued, "What are your relations like?" "I have an aunt and uncle living here in town, and so do my husbands parents." He said, "Do you have a real grudge?" "No," she replied, "We have a two-car carport and have never really needed one." "Please," he tried again, "is there any infidelity in your marriage?" "Yes, both my son and daughter have stereo sets. We dont necessarily like the music, but the answer to your questions is yes." "Maam, does your husband ever beat you up?" "Yes,"  she responded, "about twice a week he gets up earlier than I do." Finally, in frustration, the judge asked, "Lady, why do you want a divorce?" "Oh, I dont want a divorce," she replied. "Ive never wanted a divorce. My husband does. He said he cant communicate with me!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (211, 'Divorce jokes', 'Two men are talking. The first sez, "I got married because I was tiredof eating out, cleaning the house, doing the laundry and wearingshabby clothes.""Amazing," said the second, "I just got divorced for the very samereasons."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (212, 'Divorce jokes', 'Regardless of what you may hear, theres still many women these dayswho are excellent "housekeepers". Seems each time they get a divorce,they keep the house.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (213, 'Divorce jokes', 'Staring down from the bench to announce the terms of thedivorce decree, the judge turned to the husband and said:"Im going to award her alimony in the amount of $250 a month." To which the womans about-to-be ex replied: "Thats mightykind of you, judge. Ill try to help her all I can, too."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (214, 'Divorce jokes', 'A friend of mine just got divorced. He and his ex-wife split thehouse. He got the outside.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (215, 'Doctor and nurse jokes', 'A doctor and his wife were having a big argument at breakfast."You arent so good in bed either!" he shouted and stormed off to work.By midmorning, he decided hed better make amends and phoned home. After many rings, his wife picked up the phone."What took you so long to answer?""I was in bed.""What were you doing in bed this late?""Getting a second opinion."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (216, 'Doctor and nurse jokes', 'Did you hear the new penalty for speeding in Illinois? The first offense they give you Bears tickets and the second offense they make you use them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (217, 'Doctor and nurse jokes', 'The surgeon told his patient that woke up after having been operated: "Im afraid were going to have to operate you again. Because, you see, I forgot my rubber gloves inside you.""Well, if its just because of them, Id rather pay for them if you just leave me alone."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (218, 'Doctor and nurse jokes', 'Doctor Doctor I swallowed a bone.Are you choking?No, I really did!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
