INSERT INTO `jokes` VALUES (241, 'Face jokes', 'Louise was watching her big sister covering her face with cream. "Whats that for?" she asked. "To make me beautiful," came the reply. Louise then watched in silence as she wiped her face clean. "Doesnt work, does it?" was her comment.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (242, 'Face jokes', 'What happened when the witch went for a job as a TV presenter? The producer said she had the perfect face for radio.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
