INSERT INTO `jokes` VALUES (244, 'Face jokes', 'Fred: Youve got a Roman nose. Harry: Like Julius Caesar? Fred: No, its roamin all over your face.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (245, 'Ethnic jokes', 'Three men are traveling in the Amazon, a German, an American, and a Mexican, and they get captured by some Amazons. The head of the tribe says to the German, "What do you want on your back for your whipping?"The German responds, "I will take oil!" So they put oil on his back, and a large Amazon whips him ten times. When he is finished the German has these huge welts on his back, and he can hardly move.The Amazons haul the German away, and say to the Mexican, "What do you want on your back?" "I will take nothing!" says the Mexican, and he stands there straight and takes his ten lashings without a single flinch."What will you take on your back?" the Amazons ask the American. He responds, "Ill take the Mexican."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (246, 'Ethnic jokes', 'An Englishman, Frenchman, Mexican, and Texan were flying across country on a small plane when the pilot comes on the loud speaker and says " Were having mechanical problems and the only way we can make it to the next airport is for 3 of you to open the door and jump, at least one of you can survive"The four open the door and look out below. The Englishman takes a deep breath and hollers "God Save The Queen" and jumps.The Frenchman gets really inspired and hollers "Viva La France" and he also jumps.This really pumps up the Texan so he hollers "Remember the Alamo" and he grabs the Mexican and throws him out of the plane.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (247, 'Ethnic jokes', 'There were three Aggies; one crane operator, one pole climber, one guide. The guide tied the crane to the end of a pole. The crane operator would then pick the pole up on end. The climber climbed to the top and dropped a tape measure which the guide promptly read and noted the measurement. The crane operator then lowered the pole to the ground and repsitioned to pick up another pole. This went on several times when the foreman came over and asked why they couldnt measure the poles while they were laying on the ground? The Aggies replied, "we need to know how tall the poles are, not how long".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (248, 'Ethnic jokes', 'Three Englishmen were in a bar and spotted an Irishman. So, one of the Englishmen walked over to the Irishman, tapped him on the shoulder, and said, "Hey, I hear your St. Patrick was a drunken loser.""Oh really, hmm, didnt know that."Puzzled, the Englishman walked back to his buddies. "I told him St. Patrick was a loser, and he didnt care." The second Englishman remarked, "You just dont know how to set him off...watch and learn." So, the second Englishman walked over to the Irishman, tapped him on the shoulder and said, "Hey, I hear your St. Patrick was lying, cheating, idiotic, low-life scum!""Oh really, hmm, didnt know that."Shocked beyond belief, the Englishman went back to his buddies. "Youre right. Hes unshakable!"The third Englishman remarked, "Boys, Ill really tick him off... just watch." So the third Englishman walked over to the Irishman, tapped hi m on the shoulder and said, "I hear St. Patrick was an Englishman!""Yeah, thats what your buddies were trying to tell me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (249, 'Ethnic jokes', 'A US Border Patrol Agent catches an illegal alien in the bushes right by the border fence, he pulls him out and says "Sorry, you know the law, youve got to go back across the border right now." The mexican man pleads with them, "No, noooo Senior, I must stay in de USA! Pleeeze!" The Border Patrol Agent thinks to himself, Im going to make it hard for him and says "Ok, Ill let you stay if you can use 3 english words in a sentence". The Mexican man of course agrees. The Border Patrol Agent tells him, "The 3 words are: Green, Pink and Yellow. Now use them in 1 sentence." The Mexican man thinks really hard for about 2 minutes, then says, "Hmmm, Ok. The phone, it went Green, Green, Green, I Pink it up and sez Yellow?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (250, 'Firefighter jokes', 'The Fire brigade phones George Graham in the early hours of Sunday morning."Mr Graham sir, White Hart Lane is on fire!""The cups man! Save the cups!" cries George."Uh, the fire hasnt spread to the canteen yet, sir."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (251, 'Firefighter jokes', 'After the fire-truck arrived at a burning building in a small Spanish town, the firemen observed a man dressed in a matadors costume prancing around on the roof. Four of the firemen held a safety-net and urged him to escape from the burning building by jumping into the net. He refused and loudly proclaimed, "Im Fearless Jose the bullfighter who fears nothing, not even fire."The firemen begged and pleaded but to no avail. Jose kept prancing around while repeating the same phrase over and over until the firemen got really sick and tired of hearing it. Finally, when the flames began to scorch his butt, Jose announced he had changed his mind, was ready to jump and then leaped off the rooftop. As his body hurtled toward the safety-net, the four firemen shouted, "Ole!" and quickly moved it aside.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (252, 'Firefighter jokes', 'A man who worked at a fire hydrant factory was always late for work. When confronted by his boss the man explained:"You cant park anywhere near this place!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (253, 'Firefighter jokes', 'A man calls the fire department and says, "Yes, I have just had my front yard landscaped, I have a nice new flower bed, a new fish pond with a fountain and a new rose garden.""Very nice," the firefighter says, "but what does that have to do with the fire service?""Well," the man answers, "the house next door is on fire and I dont want you to trample my front yard."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (254, 'Firefighter jokes', 'How many firemen does it take to change a light bulb?Four - three to cut a hole in the roof and one to change the bulb.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (255, 'Farmer jokes', 'This farmer has 500 hens but no rooster so he goes to his neighbor and asks him if he could buy a rooster for $100. The neighbor says, "You can have this rooster. His names Roy. Hell get all your hens pregnant. Hes a real stud." So the farmer takes him home and says, "Its your first day so take it slow, okay?" The farmer puts Roy in the hen house and then hears all the hens crying and yelling. Roy nailed every one of those hens and then nailed a duck and a goose at a pond. The next morning the farmer finds Roy lying dead with his legs sticking in the air and buzzards circling overhead. The farmer says, "Roy, did you have to die?" Roy says, "Quiet! Theyre about to land!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (256, 'Farmer jokes', 'There was a farmer who had a lot of live stock. He had cows, horses, chickens, pigs, and bulls. One day a terrible twister came and the man and his family were only saved by throwing themselves in the nearest ditch. After it was all over, he looked up to see that the house was gone. Saddened by the loss, he went out to see if any of the animals had survived. The horses, chickens, pigs, and cows were laid out flat but the bulls were standing! The farmer was amazed and asked them, "How is it that all the other animals are down and you are still standing?" The bulls replied, "We bulls wobble but we dont fall down!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (257, 'Farmer jokes', 'A jogger running down a country road is startled as a horse yells at him "Hey-come over hear buddy". The jogger is stunned but runs over to the fence where the horse is standing and asks"Were you talking to me"? The horse replies"Sure was, man Ive got a problem. I won the Kentucky Derby a few years ago and this farmer bought me and now all I do is pull a plow and Im sick of it. Why dont you run up to the house and offer him $5,000 to buy me. Ill make you some money cause I can still run." The jogger thought to himself,"boy a talking horse" Dollar signs started appearing in his head. So he runs to the house and the old farmer is sitting on the porch. The jogger tells the farmer"Hey man Ill give you $5,000 for that old broken down nag youve got in the field". The farmer replies"Son you cant believe anything that horse says-Hes never even been to Kentucky.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (258, 'Farmer jokes', 'On a rural road a state trooper pulled this farmer over and said: "Sir, do you realize your wife fell out of the car several miles back?"To which the farmer replied: "Thank God, I thought I had gone deaf!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (259, 'Farmer jokes', 'A big-city lawyer was representing the railroad in a lawsuit filed by an old rancher. The ranchers prize bull was missing from the section through which the railroad passed. The rancher only wanted to be paid the fair value of the bull. The case was scheduled to be tried before the justice of the peace in the back room of the general store. The attorney for the railroad immediately cornered the rancher and tried to get him to settle out of court. The lawyer did his best selling job, and finally the rancher agreed to take half of what he was asking. After the rancher had signed the release and took the check, the young lawyer couldnt resist gloating a little over his success, telling the rancher, "You know, I hate to tell you this, old man, but I put one over on you in there. I couldnt have won the case. The engineer was asleep and the fireman was in the caboose when the train went thr ough your ranch that morning. I didnt have one witness to put on the stand. I bluffed you!" The old rancher replied, "Well, Ill tell you, young feller, I was a little worried about winning that case myself, because that durned bull came home this morning."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (260, 'Fishing jokes', 'Bob is sitting on the ice all day fishing with no luck, not even a nibble. Cold and tired he is about to leave, when a guy walks up cuts a hole in the ice beside him, and starts pulling out fish as fast a he can drop his hook in the water. Bob cant believe it, he yells over " whats your secret?" "woogatkakeptewrwm" he answers back. "what did you say?" replies Bob. The man spits a large ball of worms on the ice and says to Bob, " you have to keep your worms warm".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (261, 'Fishing jokes', 'If youre fishing on ice, you should never tell a joke on ice. WHY??? The ice will crack up!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (262, 'Fishing jokes', 'Q:what do you catch when you go ice fishing A:a cold', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (263, 'Fishing jokes', 'Q:what did the fish say when he hit the concrete wall? A:Damn', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (264, 'Fishing jokes', 'It was well known that a certain lake was very poor for fishing up north, but a game warden happened to notice that one guy kept coming home with his limit of fish on several occations. He asked the guy: "How is it that you are catching fish out of that lake when no one else can?" The guy replied: "Well I am going back up there tommorow, why dont you come along?" And, so the warden did. They were in the boat when the fisherman reached over and lit a stick of dynamite and then tossed it overboard. BOOM!!! There were fish floating to the surface all over! The game warden freaked out, and said: "You cant do that! Thats illeagal!" The fisherman reached over and lit another stick and said: "Are you going to fish, or talk?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (265, 'Food jokes', 'Q. What did the salt say to the pepper?A. Hey Baby, whats SHAKING!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (266, 'Food jokes', 'One day, Bill and Tom went to a restaurant for dinner. As soon as the waiter took out two steaks, Bill quickly picked out the bigger steak for himself.Tom wasnt happy about that: "When are you going to learn to be polite?"Bill: "If you had the chance to pick first, which one would you pick?"Tom: "The smaller piece, of course."Bill: "What are you whining about then? The smaller piece is what you want, right?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (267, 'Food jokes', 'A customer was bothering the waiter in a restaurant. First, he asked that the air conditioning be turned up because he was too hot, then he asked it be turned down cause he was too cold, and so on for about half an hour.Surprisingly, the waiter was very patient, he walked back and forth and never once got angry. So finally, a second customer asked him why he didnt throw out the pest."Oh, I really dont care or mind," said the waiter with a smile. "We dont even have an air conditioner."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (268, 'Food jokes', 'A customer was bothering the waiter in a restaurant. First, he asked that the air conditioning be turned up because he was too hot, then he asked it be turned down cause he was too cold, and so on for about half an hour.Surprisingly, the waiter was very patient, he walked back and forth and never once got angry. So finally, a second customer asked him why he didnt throw out the pest."Oh, I really dont care or mind," said the waiter with a smile. "We dont even have an air conditioner."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (269, 'Food jokes', 'A family of three tomatoes were walking downtown one day when the little baby tomato started lagging behind. The big father tomato walks back to the baby tomato, stomps on her, squashing her into a red paste, and says, "Ketchup!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (270, 'Frog jokes', 'A librarian was quietly working when three chickens walked in and jumped on to the counter eyed her and said "BUK BUK BUK" Not sure she was sane she gave the chikens three books and they left.An hour later in walked the chickens again jumped onto the counter, returned the books they had taken earlier and said "BUK BUK BUK" Now convinced she was out of her mind she gave them three books, they took one each and left. This time she decided to follow them. She followed them down to the local pond and stood horrified as they threw the books into the water.All of a sudden they flew back out of the pond and a frog stuck its head up saying "RREDIT RREDIT RREDIT!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (271, 'Frog jokes', 'Q: What do you call a frog with no hind legs?A: Unhoppy!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (272, 'Frog jokes', 'Id like a new frog, please. But you bought one only yesterday. What happened? It Kermit-ted suicide.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (273, 'Frog jokes', 'How do frogs manage to lay so many eggs ?They sit eggsaminations !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
