INSERT INTO `jokes` VALUES (280, 'Gorilla jokes', 'A man walks outside to his car for work, when he notices a gorilla in his tree. He rushs to his phone book and finds the animal control number, calls and asks them to send over someone whos a gorilla expert. When the man arrives, he is carrying a shotgun, a chihuahua and a pair of handcuffs. The man says,What are all of those for? The animal control officer says, Ill climb up in the tree, knock the gorilla down, the dog will bite him in the nuts and you must slap the handcuffs on his wrists. The man asks,What is the gun for? The animal control officer responds, If I fall first, you shoot the dog!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (281, 'Gorilla jokes', 'Q: Whats black and dangerous and lives in a tree?A: A gorilla with a machine gun.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (282, 'Gorilla jokes', 'Q: Why did the gorilla fall out of the tree ?A: Because it was dead.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
