INSERT INTO `jokes` VALUES (285, 'Halloween jokes', 'What do witches eat at Halloween? Spook-etti, Halloweenies, Devils food cake and Boo-berry pie.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (286, 'Halloween jokes', 'Why did the wizard wear a yellow robe to the Halloween party?He was going as a banana.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
