INSERT INTO `jokes` VALUES (288, 'Halloween jokes', 'What happened to the girl who wore a mouse costume to her Halloween party? The cat ate her.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (289, 'Halloween jokes', 'What did the really ugly man do for a living? He posed for Halloween masks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (290, 'Hair and bald jokes', 'A man enters a barber shop for a shave. While the barber is foaming him up, he mentions the problems he has getting a close shave around the cheeks. "I have just the thing," says the barber taking a small wooden ball from a nearby drawer. "Just place this between your cheek and gum." The client places the ball in his mouth and the barber proceeds with the closest shave the man has ever experienced. After a few strokes the client asks in garbled speech. "And what if I swallow it?" "No problem," says the barber. "Just bring it back tomorrow like everyone else does."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (291, 'Hair and bald jokes', 'A man and a little boy entered a barbershop together. After the man received the full treatment - shave, shampoo, manicure, haircut, etc. - he placed the boy in the chair."Im goin to buy a green tie to wear for the parade," he said. "Ill be back in a few minutes."When the boys haircut was completed and the man still hadnt returned, the barber said, "Looks like your daddys forgotten all about you." "That wasnt my daddy," said the boy. "He just walked up, took me by the hand and said, Come on, son, were gonna get a free haircut!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (292, 'Hair and bald jokes', 'A man was getting a haircut prior to a trip to Rome. He mentioned the trip to the barber who responded, "Rome? Why would anyone want to go there?Its crowded & dirty and full of Italians. Youre crazy to go to Rome.So, how are you getting there?""Were taking TWA," was the reply. "We got a great rate!""TWA?" exclaimed the barber. "Thats a terrible airline. Their planes are old, their flight attendants are ugly, and theyre always late.So, where are you staying in Rome?""Well be at the downtown International Marriott.""That dump! Thats the worst hotel in the city. The rooms are small, the service is surly and theyre overpriced. So, whatcha doing when you get there?""Were going to go to see the Vatican and we hope to see the Pope.""Thats rich," laughed the barber. "You and a million other people trying to see him. Hell look the size  of an ant. Boy, good luck on this lousy trip of yours. Youre going to need it."A month later, the man again came in for his regular haircut. The barber asked him about his trip to Rome."It was wonderful," explained the man, "not only were we on time in one of TWAs brand new planes, but it was overbooked and they bumped us up to first class. The food and wine were wonderful, and I had a beautiful 28 year old stewardess who waited on me hand and foot.And the hotel-it was great! Theyd just finished a $25 million remodeling job and now its the finest hotel in the city. They, too, were overbooked, so they apologized and gave us the presidential suite at no extra charge!""Well," muttered the barber, "I know you didnt get to see the pope.""Actually, we were quite lucky, for as we toured the Vatican, a Swiss Guard tapped me on the shoulder and explained that the pope likes to personally me et some of the visitors, and if Id be so kind as to step into his private room and wait the pope would personally greet me. Sure enough, five minutes later the pope walked through the door and shook my hand! I knelt down as he spoke a few words to me.""Really?" asked the Barber. "Whatd he say?"He said, "Whered you get the lousy haircut?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (293, 'Hair and bald jokes', 'A little girl climbed into her grandfathers lap and studied his white, balding head. She ran her fingers along the deep wrinkles and road mapped his face and neck. "Did god make you?", she asked. "yes" he answered. "did god makeme, to?" she wondered. "yes", he replied. "well, she shrugged, "dont you think hes doing a better job now than he used to?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (294, 'Hair and bald jokes', 'two mates at a pub having a beer when the bald one starts complaining about being bald. the other guy says to have a transplant operation.the bald guy says he cant afford it.so his mate says to go and have some rabbits tattooed on his head. The bald guy says how will that help? His mate says well from a distance they will look like hares.(hairs)', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (295, 'History jokes', 'Woman: Why are you begging for a quarter?Beggar: I didnt think someone like you would give me a dollar.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (296, 'History jokes', '"What did George Washington, Abraham Lincoln, and Christopher Columbus all have in common? They were all born on holidays."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (297, 'History jokes', 'What did General Patton do on Thanksgiving? He gave tanks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (298, 'History jokes', '"You know an ancestor of mine came over on the Mayflower." "Really? Which rat was he?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (299, 'History jokes', 'Teacher: "What did the Indians bring to the first Thanksgiving?" Student: "Baseballs." Teacher: "Baseballs?" Student: "Yeah, they were Cleveland Indians!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (300, 'Heaven and hell jokes', 'A man dies and goes to Heaven. He gets to meet GOD and asks GOD if he can ask him a few questions."Sure," GOD says, "Go right ahead". "OK," the man says. "Why did you make women so pretty?"GOD says, "So you would like them." "OK," the guy says. "But how come you made them so beautiful?" "So you would LOVE them", GOD replies. The man ponders a moment and then asks, "But why did you make them such airheads?" GOD says, "So they would love you!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (301, 'Heaven and hell jokes', 'A new York Divorce Lawyer died and arrived at the pearly gates. Saint Peter asks him "What have you done to merit entrance into Heaven?" The Lawyer thought a moment, then said, "A week ago, I gave a quarter to a homeless person on the street." Saint Peter asked Gabriel to check this out in the record, and after a moment Gabriel affirmed that this was true. Saint Peter said, "Well , thats fine, but its not really quite enough to get you into Heaven." The Lawyer said, "Wait Wait! Theres more! Three years ago I also gave a homeless person a quarter." Saint Peter nodded to Gabriel, who after a moment nodded back, affirming this, too, had been verified. Saint Peter then whispered to Gabriel, "Well, what do you suggest we do with this fellow?" Gabriel gave the Lawyer a sidelong glance, then said to Saint Peter, "Lets give him back his 50 cents and tell him to go to Hell."  Each man gives a storyThree men were standing in line to get into heaven one day. Apparently it had been a pretty busy day, though, so Peter had to tell the first one, "Heavens getting pretty close to full today, and Ive been asked to admit only people who have had particularly horrible deaths. So whats your story?" So the first man replies: "Well, for a while Ive suspected my wife has been cheating on me, so today I came home early to try to catch her red-handed. As I came into my 25th floor apartment, I could tell something was wrong, but all my searching around didnt reveal where this other guy could have been hiding. Finally, I went out to the balcony, and sure enough, there was this man hanging off the railing, 25 floors above ground! By now I was really mad, so I started beating on him and kicking him, but wouldnt you know it, he wouldnt fall off. So finally I went back into my apartment  and got a hammer and starting hammering on his fingers. Of course, he couldnt stand that for long, so he let go and fell -- but even after 25 stories, he fell into the bushes, stunned but okay. I couldnt stand it anymore, so I ran into the kitchen, grabbed the fridge and threw it over the edge where it landed on him, killing him instantly. But all the stress and anger got to me, and I had a heart attack and died there on the balcony." "That sounds like a pretty bad day to me," said Peter, and let the man in. The second man comes up and Peter explains to him about heaven being full, and again asks for his story. "Its been a very strange day. You see, I live on the 26th floor of my apartment building, and every morning I do my exercises out on my balcony. Well, this morning I must have slipped or something, because I fell over the edge. But I got lucky, and caught the railing of the balcony on the f loor below me. I knew I couldnt hang on for very long, when suddenly this man burst out onto the balcony. I thought for sure I was saved, when he started beating on me and kicking me. I held on the best I could until he ran into the apartment and grabbed a hammer and started pounding on my hands. Finally I just let go, but again I got lucky and fell into the bushes below, stunned but all right. Just when I was thinking I was going to be okay, this refrigerator comes falling out of the sky and crushes me instantly, and now Im here." Once again, Peter had to concede that that sounded like a pretty horrible death. The third man came to the front of the line, and again Peter explained that heaven was full and asked for his story. "Picture this," says the third man, "Im hiding inside a refrigerator..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (302, 'Heaven and hell jokes', 'Three men were standing in line to get into heaven one day. Apparently it had been a pretty busy day, though, so Peter had to tell the first one, "Heavens getting pretty close to full today, and Ive been asked to admit only people who have had particularly horrible deaths. So whats your story?" So the first man replies: "Well, for a while Ive suspected my wife has been cheating on me, so today I came home early to try to catch her red-handed. As I came into my 25th floor apartment, I could tell something was wrong, but all my searching around didnt reveal where this other guy could have been hiding. Finally, I went out to the balcony, and sure enough, there was this man hanging off the railing, 25 floors above ground! By now I was really mad, so I started beating on him and kicking him, but wouldnt you know it, he wouldnt fall off. So finally I went back into my apartment and  got a hammer and starting hammering on his fingers. Of course, he couldnt stand that for long, so he let go and fell -- but even after 25 stories, he fell into the bushes, stunned but okay. I couldnt stand it anymore, so I ran into the kitchen, grabbed the fridge and threw it over the edge where it landed on him, killing him instantly. But all the stress and anger got to me, and I had a heart attack and died there on the balcony." "That sounds like a pretty bad day to me," said Peter, and let the man in. The second man comes up and Peter explains to him about heaven being full, and again asks for his story. "Its been a very strange day. You see, I live on the 26th floor of my apartment building, and every morning I do my exercises out on my balcony. Well, this morning I must have slipped or something, because I fell over the edge. But I got lucky, and caught the railing of the balcony on the floor  below me. I knew I couldnt hang on for very long, when suddenly this man burst out onto the balcony. I thought for sure I was saved, when he started beating on me and kicking me. I held on the best I could until he ran into the apartment and grabbed a hammer and started pounding on my hands. Finally I just let go, but again I got lucky and fell into the bushes below, stunned but all right. Just when I was thinking I was going to be okay, this refrigerator comes falling out of the sky and crushes me instantly, and now Im here." Once again, Peter had to concede that that sounded like a pretty horrible death. The third man came to the front of the line, and again Peter explained that heaven was full and asked for his story. "Picture this," says the third man, "Im hiding inside a refrigerator..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (303, 'Heaven and hell jokes', 'A forester and a lawyer were in car accident and showed up at the pearly gates together.St. Peter greets them at the pearly gates and takes them to the homeswhere they will spend all of eternity. They get into St. Peters holy vehicle and head on down a gold road, which turns into a platinum road, which turns onto an even grander road paved with diamonds, to a huge mansion where St. Peter turns to the lawyer and says, here is your home for the rest of eternity, enjoy! And if there is anything you need, just let me know. Then St. Peter took the forester to his home, back down the diamond studded boulevard, down the platinum highway, down the street of gold, down an avenue of silver, along a stone alley and down an unpaved footpath to a shack. St Peter says "Here you go" and goes to leave when the forester says "Waitaminute!, how come the lawyer gets the big mansion and I get this s hack?"St. Peter says: "Well, Foresters are a dime a dozen here, we have never had a lawyer before."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (304, 'Heaven and hell jokes', 'Three men died in a car accident and met Jesus himself at the Pearly Gates. The Lord spoke unto them saying, "I will ask you each a simple question. If you tell the truth I will allow you into heaven, but if you lie....Hell is waiting for you. To the first man the Lord asked, "How many times did you cheat on your wife?" The first man replied, "Lord, I was a good husband. I never cheated on my wife." The Lord replied, "Very good! Not only will I allow you in, but for being faithful to your wife I will give you a huge mansion and a limo for your transportation. To the second man the Lord asked, "How many times did you cheat on your wife?" The second man replied, "Lord, I cheated on my wife twice." The Lord replied, "I will allow you to come in, but for your unfaithfulness, you will get a four- bedroom house and a BMW. To the third man the Lord asked, "So, how many times did y ou cheat on your wife?" The third man replied, "Lord, I cheated on my wife about 8 times." The Lord replied, "I will allow you to come in, but for your unfaithfulness, you will get a one-room apartment, and a Yugo for your transportation. A couple hours later the second and third men saw the first man crying his eyes out. "Why are you crying?" the two men asked. "You got the mansion and limo!" The first man replied, "Im crying because I saw my wife a little while ago, and she was riding a skateboard!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (305, 'Horse jokes', '"Will I ever be able to race my horse again" the owner asked the vet.The vet replied, "You certainly will, and youll probably beat her too!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (306, 'Horse jokes', 'A stallion and a mare where due to get married, but the stallion didnt show up at the church.He got colt feet', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (307, 'Horse jokes', 'As horses say to one another.Any friend of yours is a palomino!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (308, 'Horse jokes', 'Did you find my horse well behaved?Indeed, whenever we came to a fence he let me over first!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (309, 'Horse jokes', 'Did you hear about Mike Tysons horse?It got angry and bit at the champ!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (310, 'Humor jokes', 'How do you get pikachu on to a boat? You pokemon', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (311, 'Humor jokes', 'Well, a man was driving down a country road, and he decided to get out and get some fresh air. He got out, and started walking in a meadow. As he walked, he came upon a hole. Wanting to see how deep it was, he threw a pebble down. No sound. So he threw a medium-sized rock down. No sound. The man started to get frustrated, so he threw a boulder down. No sound. As he searched about, he spotted a railroad beam. He hauled it over to the hole, and shoved it in. No sound. He sat down on the ground, exhausted. Suddenly, he saw a goat running at him, full speed. He leaped up, and it brushed past him, and fell in the hole. He listened, but there was no sound. He sat down again. A few minutes later, a farmer came walking up. The man asked him, "How deep is this hole?" The farmer said, "Oh. Thats the bottomless pit. It never ends. Say, have you seen my prize goat?" The man, not wanting to g et the blame, said, "No." The farmer said, "Oh well. He cant get far. He was tied to a railroad beam."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (312, 'Humor jokes', 'There was a guy walking down the street in San Francisco, and he tripped over an old looking oil lamp. He picked it up and hid it under his jacket, because he thought it was priceless. While he was running to the antique shop to cash this puppy in, it rubbed against his shirt. POOF! A genie popped out of his pocket!The very angry looking Genie said, "All right, I have had enough with this three wish stuff, and cuz you stole me away from my HBO Special, I will only give you one wish!" The surprised man said, "OK, I want to live in Hawaii in a huge condo on the beach with three million dollars in the master bedroom, but I am afraid of boats and planes so I want you to build a bridge from here to Hawaii." The genie replied with a smirk, "Are you crazy? Do you know how long that will take, with the pillars going down to the bottom of the ocean, all the cement it wou ld take for the highway? No Im sorry, it just cant happen." The man said, "Fine then, I want to understand women." The genie said, " Would you like two lanes or four?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (313, 'Humor jokes', 'Sherlock Holmes and Matthew Watson were on a camping and hiking trip. They had gone to bed and were lying there looking up at the sky. Holmes said, "Watson, look up. What do you see? "Well, I see thousands of stars." "And what does that mean to you?" "Well, I guess it means we will have another nice day tomorrow. What does it mean to you, Holmes?" "To me, it means someone has stolen our tent."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (314, 'Humor jokes', 'Big Louie the Torpedo was becoming increasingly curious about one of the newer members of his mob, Benny the Rod. Benny had been in the business for many years in another part of the country. During that time he had garnered quite a reputation for being the most conscientious and honorable hit man available. He was also considered quite eccentric, perhaps odd, in that for the last ten years or so he always kept one hand in his pocket - clutching his cold steel weapon in readiness (hence the nickname, Benny the Rod). When Benny arrived at Louies office, the question was put to him."So whats the story with you and this here gun of yours, eh? Like, are you scared or somethin or you just want to always be ready or what?""Not scared ..." Benny growled, "been doin it dis way ever since me sister-in-laws weddin bout ten ten years ago now"."Oh yeah? ... so ...?""Wel l, I used ta know her fiance at da time - a no good chisler. He never even loved the goil so much ... but he made her happy and so I kept me mouth shut about it", Benny explained.Louie leaned in, expecting the point of the matter."And since dat time I gotta do it dis way"."But WHY?!", Louie finally demanded?"Well, I was at da wedding", grumbled Benny, and I wasnt about to say nuttin about it then, so now I gotta do like da preacher said ..."Speak Now or Forever Hold Your Piece!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (315, 'Hunting jokes', 'An avid duck hunter was in the market for a new bird dog. His search ended when he found a dog that could actually walk on water to retrieve a duck. Shocked by his find, he was sure none of his friends would ever believe him.He decided to try to break the news to a friend of his, the eternal pessimist who refused to be impressed with anything. This, surely, would impress him. He invited him to hunt with him and his new dog.As they waited by the shore, a flock of ducks flew by. they fired, and a duck fell. The dog responded and jumped into the water. The dog, however, did not sink but instead walked across the water to retrieve the bird, never getting more than his paws wet. This continued all day long; each time a duck fell, the dog walked across the surface of the water to retrieve it. The pessimist watched carefully, saw everything, but did not say a single word.On the drive  home the hunter asked his friend, "Did you notice anything unusual about my new dog?""I sure did," responded the pessimist. "He cant swim."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (316, 'Hunting jokes', 'Two guys are out hunting deer. The first guy says, "Did you see that?""No," the second guy says."Well, a bald eagle just flew overhead," the first guy says."Oh," says the second guy.A couple of minutes later, The first guy says, "Did you see that?""See what?" the second guy asks."Are you blind? There was a big, black bear walking on that hill, over there.""Oh."A few minutes later the first guy says: "Did you see that?"By now, the second guy is getting aggravated, so he says, "Yes, I did!"And the first guy says: "Then why did you step in it?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (317, 'Hunting jokes', 'Two hunters got a pilot to fly them into the far north for elk hunting. They were quite successful in their venture and bagged six big bucks. The pilot came back, as arranged, to pick them up. They started loading their gear into the plane, including the six elk. But the pilot objected and he said, "The plane can only take four of your elk; you will have to leave two behind." They argued with him; the year before they had shot six and the pilot had allowed them to put all aboard. The plane was the same model and capacity. Reluctantly, the pilot finally permitted them to put all six aboard. But when the attempted to take off and leave the valley, the little plane could not make it and they crashed into the wilderness. Climbing out of the wreckage, one hunter said to the other, "Do you know where we are?" "I think so," replied the other hunter. I think this is about the same place where  we landed last year!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (318, 'Hunting jokes', 'A hunter visited another hunter and was given a tour of his home. Ibn the den was a stuffed lion. The visiting hunter asked, "when did you bag him?" The host said, "that was three years ago, when I went hunting with my wife." "Whats he stuffed with," asked the visiting hunter. "My wife."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (319, 'Hunting jokes', 'Two men went bear hunting. While one stayed in the cabin, the other went out looking for a bear. He soon found a huge bear, shot at it but only wounded it.The enraged bear charged toward him, he dropped his rifle and started running for the cabin as fast as he could. He ran pretty fast but the bear was just a little faster and gained on him with every step. Just as he reached the open cabin door, he tripped and fell flat.Too close behind to stop, the bear tripped over him and went rolling into the cabin.The man jumped up, closed the cabin door and yelled to his friend inside, "You skin this one while I go and get another!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (320, 'Idiot and fool jokes', 'Two Canadian guys, Mike and Rob were on the roof, laying tile, when a sudden gust of wind came and knocked down their ladder. "I have an idea," said Mike. "Well throw you down, and then you can pick up the ladder." "What, do you think Im stupid? I have an idea. Ill shine my flashlight, and you can climb down on the beam of light." "What, do you think Im stupid? Youll just turn off the flashlight when Im halfway there."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (321, 'Idiot and fool jokes', 'Two men were digging a ditch on a very hot day. One said to the other, "Why are we down in this hole digging a ditch when our boss is standing up there in the shade of a tree?" "I dont know," responded the other. "Ill ask him."So he climbed out of the hole and went to his boss. "Why are we digging in the hot sun and youre standing in the shade?" "Intelligence," the boss said. "What do you mean, intelligence?"The boss said, "Well, Ill show you. Ill put my hand on this tree and I want you to hit it with your fist as hard as you can." The ditch digger took a mighty swing and tried to hit the boss hand. The boss removed his hand and the ditch digger hit the tree. The boss said, "Thats intelligence!"The ditch digger went back to his hole. His friend asked, "What did he say?" "He said we are down here because of intelligence." "Whats intelligence?" said the friend. T he ditch digger put his hand on his face and said, "Take your shovel and hit my hand."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (322, 'Idiot and fool jokes', 'I saw a pen in a store the other day. I picked it up and took a look at itcause it was prettier than most.The clerk said, "Its made in Germany".I said, "Thats too bad, I cant use it then".The clerk said, "Whats the matter? You dont like German pens?"I said, "No. I just never learned to write German."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (323, 'Idiot and fool jokes', 'Did you hear about the hillbilly who went into the hardware store tobuy a chain saw ?He said I want one that will cut down at least 10 trees a day.He was back at the hardware store with the saw a couple days latercomplaining that it onlycut one tree and that took all day.The clerk at the hardware store started the saw to see what theproblem was.The hillbilly jumped back and said what the hell is that noise?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (324, 'Idiot and fool jokes', 'Shes so stupid she thinks a shoplifter is a very strong person who goes round picking up shops.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (325, 'Insect jokes', 'What goes hum-choo, hum choo?A bee with a cold !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (326, 'Insect jokes', 'What is a bees favourite classical music composer ?Bee-thoven !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (327, 'Insect jokes', 'What does a queen bee do when she burps ?Issues a royal pardon !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (328, 'Insect jokes', 'Where would you put an injured insect ?In an antbulance !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (329, 'Insect jokes', 'What do bees do if they want to use public transport ?Wait at a buzz stop !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (330, 'Internet jokes', 'What kind of doctor fixes broken websites?A URLologist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (331, 'Internet jokes', 'Q: How many internet mail list subscribers does it take to change a light bulb?A: Exactly five hundred.1 to change the light bulb and to post to the mail list that the light bulb has been changed.7 to share similar experiences of changing light bulbs and how the light bulb could have been changed differently or to caution about the dangers of changing light bulbs.17 to point out spelling/grammar errors in posts about changing light bulbs.21 to flame the spell checkers.49 to write to the list administrator complaining about the light bulb discussion and its inappropriateness to this mail list.20 to correct spelling in the spelling/grammar flames.32 to post that this list is not about light bulbs and to please take this email exchange to alt.lite.bulb.69 to demand that cross posting to alt.grammar, alt.spelling and alt.punctuation about changing light bul bs be stopped.41 to defend the posting to this list saying that we all use light bulbs and therefore the posts are relevant to this mail list.106 to debate which method of changing light bulbs is superior, where to buy the best light bulbs, what brand of light bulbs work best for this technique, and what brands are faulty.12 to post URLs where one can see examples of different light bulbs.8 to post that the URLs were posted incorrectly, and to post corrected URLs.2 to post about links they found from the URLs that are relevant to this list which makes light bulbs relevant to this list.15 to concatenate all posts to date, then quote them including all headers and footers, and then add pointedly, "Me Too."6 to post to the list that they are unsubscribing because they cannot handle the light bulb controversy.9 to quote the "Me Toos" and happily add, "Me Three!"3 to suggest that  posters request the light bulb FAQ.1 to propose new alt.change.lite.bulb newsgroup.24 to say this is just what alt.physic.cold_fusion was meant for, leave it here.53 votes for alt.lite.bulb.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (332, 'Internet jokes', 'Whats O. J. Simpsons Internet address? Slash, slash, backslash, slash, slash, escape.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (333, 'Internet jokes', 'Can you show me how to use the Internet?Id better - otherwise youll just go round and round in circles.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (334, 'Internet jokes', 'Do you want some help using the Internet, son?No thanks, Dad, I can muck it up all by myself.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (335, 'Journalist jokes', 'A car was involved in an accident in a street. As expected a large crowd gathered. A newspaper reporter, anxious to get his story could not get near the car.Being a clever sort, he started shouting loudly, "Let me through! Let me through! I am the son of the victim."The crowd made way for him.Lying in front of the car was a donkey.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (336, 'Journalist jokes', 'A photographer for a national magazine was assigned to get photos of a great forest fire. Smoke at the scene was too thick to get any good shots, so he frantically called his home office to hire a plane."It will be waiting for you at the airport!" he was assured by his editor. As soon as he got to the small, rural airport, sure enough, a plane was warming up near the runway. He jumped in with his equipment and yelled, "Lets go! Lets go!" The pilot swung the plane into the wind and soon they were in the air."Fly over the north side of the fire," said the photographer, "and make three or four low level passes.""Why?" asked the pilot."Because Im going to take pictures! Im a photographer, and photographers take pictures!" said the photographer with great exasperation.After a long pause the pilot said, "You mean youre not the instructor?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (337, 'Journalist jokes', 'Three men: an editor, a photographer, and a journalist are covering a political convention in Miami. They decide to walk up and down the beach during their lunch hour. Halfway up the beach, they stumbled upon a lamp. As they rub the lamp a genie appears and says "Normally I would grant you three wishes, but since there are three of you, I will grant you each one wish."The photographer went first. "I would like to spend the rest of my life living in a huge house in St. Thomas with no money worries." The genie granted him his wish and sent him on off to St. Thomas.The journalist went next. "I would like to spend the rest of my life living on a huge yacht cruising the Mediterranean with no money worries." The genie granted him his wish and sent him off to the Mediterranean.Last, but not least, it was the editors turn. "And what would your wish be?" asked the genie."I want the m both back after lunch" replied the editor, "the deadline for tomorrows newspaper is in about ten hours.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (338, 'Journalist jokes', 'A cub reporter for a small town newspaper was sent out on his first assignment. He submitted the following report to his editor. "Mrs. Smith was injured in a car accident today. She is recovering in County Hospital with lacerations on her breasts."The Editor scolded the new reporter, "This is a family paper. We dont use words like breasts around here. Now go back and write something more appropiate!"The young reporter thought long and hard. Finally he handed the Editor the following report. "Mrs. Smith was injured in a car accident today. She is recovering in County Hospital with lacerations on her ( . )( . ) "', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (339, 'Journalist jokes', 'When a visitor to a small town in Georgia came upon a wild dog attacking a young boy, he quickly grabbed the animal and throttled it with his two hands.A reporter saw the incident, congratulated the man and told him the headline the following day would read, "Valiant Local Man Saves Child by Killing Vicious Animal."The hero told the journalist that he wasnt from that town."Well, then," the reporter said, "the headline will probably say, Georgia Man Saves Child by Killing Dog.""Actually," the man said, "Im from Connecticut.""In that case," the reporter said in a huff, "the headline should read, Yankee Kills Family Pet."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (340, 'Judge jokes', 'The cross eyed judge looked at the three defendants in the dock and said to the first one, "So how do you plead?""Not guilty" said the second defendant."I wasnt talking to you" the judge replied."I never said a word" the third defendant replied.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (341, 'Judge jokes', 'The defendant stood up in the dock and said to the judge, "I dont recognize this court!""Why?" asked the Judge."Because youve had it decorated since the last time I was here."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (342, 'Judge jokes', 'Taking his seat in his chambers, the judge faced the opposing lawyers. "So," he said, "I have been presented, by both of you, with a bribe." Both lawyers squirmed uncomfortably. "You, attorney Leon, gave me $15,000. And you, attorney Campos, gave me $10,000."The judge reached into his pocket and pulled out a check. He handed it to Leon ... "Now then, Im returning $5,000, and were going to decide this case solely on its merits."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (343, 'Judge jokes', 'A red-faced judge convened court after a long lunch. The first case involved a man charged with drunk driving who claimed it simply wasnt true."Im as sober as you are, your honor," the man claimed. The judge replied, "Clerk, please enter a guilty plea. The defendant is sentenced to 30 days."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (344, 'Judge jokes', 'The Judge admonished the witness, "Do you understand that you have sworn to tell the truth?""I do.""Do you understand what will happen if you are not truthful?""Sure," said the witness. "My side will win."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (345, 'King Kong jokes', 'After being away on business, Tim thought it would be nice to bring his wife a little gift."How about some perfume?" he asked the cosmetics clerk.She showed him a bottle costing $50.00."Thats a bit much," said Tim, so she returned with a smaller bottle for $30.00."Thats still quite a bit," Tim complained.Growing annoyed, the clerk brought out a tiny $15.00 bottle."What I mean," said Tim, "is Id like to see something really cheap."The clerk handed him a mirror.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (346, 'King Kong jokes', 'Why did King Kong join the army?To learn about gorilla warfare.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (347, 'King Kong jokes', 'What do you do if King Kong sits in front of you at the cinema? Miss most of the film!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (348, 'King Kong jokes', 'What happened when King Kong swallowed Big Ben?He found time-consuming.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (349, 'King Kong jokes', 'What do you get if you cross King Kong with a giant frog?A monster that climbs up the Empire State Building and catches aeroplanes with its tongue.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (350, 'Knock Knock jokes', 'Knock KnockWhos there !Aardvark !Aardvark who ?Aardvark a million miles for one of your smiles !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (351, 'Knock Knock jokes', 'Knock KnockWhos there !Aaron !Aaron who !Aaron the barbers floor !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
