INSERT INTO `jokes` VALUES (354, 'Knock Knock jokes', 'Knock KnockWhos there !Abe !Abe who ?Abe C D E F G H... !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (355, 'Lawyer jokes', 'A lawyer with insomnia consulted her doctor. "Which side is it best to lie on?" she asked."The side that pays your fee," replied the doctor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (356, 'Lawyer jokes', 'A defendant was on trial for murder. There was very strong evidence indicating guilt, but no corpse had been found. In the defenses closing statement the lawyer, knowing that his client would probably be convicted, decided to try a trick. "Ladies and gentlemen of the jury, I have a surprise for you all," the lawyer said as he looked at his watch. "Within one minute, the person presumed dead in this case will walk into this courtroom!" He looked toward the courtroom door. The jurors, somewhat stunned, all looked, eagerly. A minute passed. Nothing happened. Finally, the lawyer said, "Actually, I made up the previous statement. But you all looked on with anticipation. I therefore put it to you that there is reasonable doubt in this case as to whether anyone was killed and insist that you return a verdict of not guilty." With that, the jury retired to deliberate. But after only a few  minutes, they came back and pronounced a verdict of guilty. "But how?" the lawyer asked. "You must have had some doubt. I saw all of you stare at the door." "Oh, yes," the jury foreman replied. "We all looked - but your client didnt!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (357, 'Lawyer jokes', 'A big-city lawyer was representing the railroad in a lawsuit filed by an old rancher. The ranchers prize bull was missing from the section through which the railroad passed. The rancher only wanted to be paid the fair value of the bull. The case was scheduled to be tried before the justice of the peace in the back room of the general store. The city-slicker attorney for the railroad immediately cornered the rancher and tried to get him to settle out of court. He did his best selling job, and finally the rancher agreed to take half of what he was asking. After the rancher had signed the release and took the check, the young lawyer couldnt resist gloating a little over his success, telling the rancher, "You are really a country hick, old man, but I put one over on you in there. I couldnt have won the case. The engineer was asleep and the fireman was in the caboose when the t rain went through your ranch that morning. I didnt have one witness to put on the stand. I bluffed you!" The old rancher replied, "Well, Ill tell you young feller, I was a little worried about winning that case myself, because that durned bull came home this morning."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (358, 'Lawyer jokes', 'If two lawyers were drowning, and you could only save one ofthem, would you read the paper or go to lunch?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (359, 'Lawyer jokes', 'The bartender asks him "Whatll you have?". The guy answers, "A scotch, please". The bartender hands him the drink, and says "Thatll be five dollars", to which he replies "What are you talking about? I dont owe you anything for this".A lawyer, sitting nearby and overhearing the conversation, then says to the bartender, "You know, hes got you there. In the original offer, which consitutes a binding contract upon acceptance, there was no stipulation of remuneration". The bartenders not impressed, but says to the guy, "Okay, you beat me for a drink. But dont ever let me catch you in here again".The next day, same guy walks into the bar. Bartender says, "What the hell are you doing in here? I cant believe youve got the audacity to come back!". The guy says "What are you talking about? Ive never been in this place in my life", to which the bartender replies "Im \r nvery sorry, but this is uncanny. You must have a double."To which the guy replies "Thank you! Make it a scotch."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (360, 'Letter jokes', 'Crazy Aunt Maud received a letter one morning, and upon reading it burst into floods of tears. "Whats the matter?" asked her companion. "Oh dear," sobbed Auntie, "Its my favorite nephew. Hes got three feet." "Three feet?" exclaimed her friend. "Surely thats not possible?" "Well," said Auntie, "his mothers just written to tell me hes grown another foot !"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (361, 'Letter jokes', 'Are you writing a thank you letter to Grandma like I told you to? Yes Mom. Your handwriting seems very large. Well, Grandmas very deaf, so Im writing very loudly.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (362, 'Letter jokes', 'Which two letters are rotten for your teeth? D K', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (363, 'Letter jokes', 'Why is the letter "t" so important to a stick insect? Without it would be a sick insect.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (364, 'Letter jokes', 'Have you ever seen a duchess? Yes - its the same as an English "s"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (365, 'Lotto jokes', 'One day, the wife comes home with a spectacular diamond ring. "Where did you get that ring?" her husband asks. "Well, she replies, "my boss and I played the lotto and we won, so I bought it with my share of the winnings. A week later, his wife comes home with a long shiny fur coat. "Where did you get that coat?" her husband asks. She replies "My boss and played the lotto and we won again, so I bought it with my share of the winnings. Another week later, his wife comes home, driving in a red Ferrari. "Where did you get that car?" her husband asks. Again she repeats the same story about the lotto and her share of the winnings. That night, his wife asks him to pour her a nice warm bath while she gets undressed. When she enters the bathroom, she find that there is barely enough water in the bath to cover the plug at the far end. "And this?" she asks her husband. " Well," he replies, "we dont want to get your lotto ticket wet, do we?!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (366, 'Lotto jokes', 'A guy named Joe finds himself in dire trouble. His businessstarted going bust and he found himself in serious financialtrouble. He was so desperate that he decided to pray forhelp."Oh Lord, please help me, Ive lost my business and if Idont get some money, Im going to lose my house as well,please let me win the lotto".Lotto night arrived and somebody else won the prize.Joe again looked up and prayed..."Oh Lord, please let me win the lotto! Ive lost mybusiness, my house and Im going to lose my car as well".Again, Lotto night came and went and Joe still had no luck.Once again, he prayed... "Oh, Lord, why have you forsaken me? Ive lost my business,my house and my car. My wife and children are starving. Idont often ask you for help and I have always been a goodservant to you. Please just let me win the lotto this onetime so I can get my life back  in order ... " Suddenly there was a blinding flash of light as the heavensopened and Joe was confronted by the voice of the Lordhimself: "Joe, Meet Me Half Way On This One. Buy A Ticket!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (367, 'Marriage jokes', 'A guy gets home early from work and hears strange noises coming from the bedroom. He rushes upstairs to find his wife naked on the bed, sweating and panting.Whats up? he says.Im having a heart attack, cries the woman.He rushes downstairs to grab the phone, but just as hes dialling. his four-year-old son comes up and says, `Daddy! Daddy! Uncle Teds hiding in your wardrobe and hes got no clothes on!The guy slams the phone down and storms upstairs into the bedroom, past his screaming wife and rips open the wardrobe door.Sure enough, there is his brother, totally naked, cowering on the wardrobe floor.You jerk, yells the husband, my wifes having a heart attack and youre running around with no clothes on scaring the kids!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (368, 'Marriage jokes', 'A married couple was in a terrible accident where the womans face was severely burned. The doctor told the husband that they couldnt graft the skin from her body, so the husband offered to donate some of his own skin. However, the only skin on his body that the doctor found suitable would have to come from his rear end. The husband and wife agreed that they would tell no one about where the skin came from, and requested that the doctor also honor their secret. After all, this was a very delicate matter. After the surgery was completed, everyone was astounded at the womans new beauty. She looked more beautiful than she ever had before! All her friends and relatives just went on and on about her youthful beauty! One day, she was alone with her husband, and she was overcome with emotion at his sacrifice. She said, "Dear, I just want to thank you for everything you d id for me. There is no way I could ever repay you." "My darling," he replied," think nothing of it. I get all the thanks I need every time I see your mother kiss you on the cheek."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (369, 'Marriage jokes', 'Four married guys go golfing on Sunday. During the 3rd hole the following conversation ensued: First Guy: "Man, you have no idea what I had to do to be able to come out golfing this weekend. I had to promise my wife that I will paint every room in the house next weekend." Second Guy: "Thats nothing, I had to promise my wife that I will build her a new deck for the pool." Third Guy: "Man, you both have it easy! I had to promise my wife that I will remodel the kitchen for her." They continue to play the hole when they realized that the fourth guy has not said a word. So they ask him. "You havent said anything about what you had to do to be able to come golfing this weekend. Whats the deal?" Fourth Guy: "I dont want to talk about it. Lets just say that the foundation for the new house is being poured next Tuesday."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (370, 'Marriage jokes', 'Its not true that married men live longer than single men. It only seems longer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (371, 'Marriage jokes', 'I married Miss Right. I just didnt know her first name was Always.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (372, 'Men jokes', 'A man is dining in a fancy restaurant, and there is a gorgeous redhead sitting at the next table. He had been checking her out since he sat down, but lacked the nerve to talk with her. Suddenly she sneezes and her glass eye comes flying out of its socket towards the man. He reflexively reaches out, grabs it out of the air, and hands it back. "Oh my, I am so sorry," the woman says as she pops her eye back in place. "Let me buy you dessert to make it up to you." They enjoy a wonderful dessert together, and afterwards, the woman invites him to the theater followed by drinks. After paying for everything, she asks him if he would like to come to her place and stay for breakfast the next morning. The next morning, she cooks a gourmet meal with all the trimmings. The guy is amazed! Everything has been incredible! "You know," he said, "you are the perfect woman. Are you this nice to every guy  you meet?" "No," she replies, "you just happened to catch my eye."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (373, 'Men jokes', 'Men are like placemats. They only show up when theres food on the table.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (374, 'Men jokes', 'Men are like mascara. They usually run at the first sign of emotion.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (375, 'Men jokes', 'Men are like bike helmets. They are handy in an emergency, but otherwise they just look silly.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (376, 'Men jokes', 'Men are like government bonds. They take so long to mature.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (377, 'Mental health jokes', 'Psychiatrist to Internal Revenue agent on couch: "Nonsense! No way does everyone in the world hate you -- everyone in the US perhaps, but certainly not everyone in the world."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (378, 'Mental health jokes', 'A psychiatrist was conducting a group therapy session with four young mothers and their small children. "You all have obsessions," he observed.To the first mother he said, "You are obsessed with eating. You even named your daughter Candy."He turned to the second mom. "Your obsession is money. Again, it manifests itself in your childs name, Penny."He turned to the third mom. "Your obsession is alcohol and your childs name is Brandy."At this point, the fourth mother got up, took her little boy by the hand and whispered, "Come on sweety, lets go home."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (379, 'Mental health jokes', 'A young woman took her troubles to a psychiatrist. "Doctor, you must help me," she pleaded. "Its gotten so that every time I date a nice guy, I end up in bed with him. And then afterward, I feel guilty and depressed for a week.""I see," nodded the psychiatrist. "And you, no doubt, want me to strengthen your will power and resolve in this matter.""For Gods sake, NO!" exclaimed the woman. "I want you to fix it so I wont feel guilty and depressed afterward."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (380, 'Mental health jokes', 'A psychologist is at a party talking with a small group of people, when a man comes up behind him and taps him on the shoulder. The psychologist turns around and the man hauls off and decks him. The psychologist gets up, brushes himself off, turns to the group and declares: "Thats his problem."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (381, 'Mental health jokes', 'What is the difference between a psychiatrist and a psychologist?If you say to a psychiatrist "I hate my mother," he will ask "Why do you say that?" while a psychologist will say "Thank you for sharing that with us."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (382, 'Military jokes', 'Coach Bobby Ross had put together the perfect Lions team. The only thing he was missing was a good quarterback. He had scouted all the colleges, and even the high schools, but he couldnt find a ringer quarterback who could ensure a Super Bowl win. Then one night, while watching CNN, he saw a war-zone scene in Bosnia. In one corner of the background, he spotted a young Bosnian soldier with a truly incredible arm. He threw a hand grenade straight into a 15th-story window 200 yards away -- ka- boom! He threw another hand grenade into a group of 10 soldiers 100 yards away -- ka-blooey! Then a car passed, going 90 mph -- bulls-eye! "Ive got to get this guy!" Ross said to himself. "He has the perfect arm!" So, he brings him to the States and teaches him the great game of football, and the Lions go on to win the Super Bowl for the first time in history. The young Bosnian is lioni zed as the Great Hero of football, and when Ross asks him what he wants, all the young man wants to do is to call his mother. "Mom," he says into the phone, "I just won the Super Bowl." "I dont want to talk to you," the old woman says. "You deserted us. You are not my son." "I dont think you understand, Mother!" the young man pleads. "I just won the greatest sporting event in the world. Im here among thousands of my adoring fans." "No, let me tell you," the mother retorts. "At this very moment, there are gunshots all around us. The neighborhood is a pile of rubble. Your two brothers were beaten within an inch of their lives last week, and this week your sister was raped in broad daylight." The old lady pauses, and then tearfully says "...Ill never forgive you for making us move to Detroit."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (383, 'Military jokes', 'General Heath, a famous lover of parade music and marching drill ceremonies, once listened to a symphonic orchestra playing.When asked about his impressions, he commented:"No military precision in drill...""Why?""Did you see those violin players? They were moving their bows not in cadence."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (384, 'Military jokes', 'A retired sergeant was asked: "Well, how do you like civilian life?""Terrible," he said gruffly, "all those people around and nobody in charge!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (385, 'Military jokes', 'During an army basic training, the lieutenant took the batch on a match and asked each of them where home was. After everyone had answered, he sneered and said "you are all wrong, the army is now your home".Back at the barracks, he read the evening duties, then asked the first sergeant if he had anything to say "you bet I do" the sergeant replied, "men, while you were gone today, I found beds improperly made, clothes not hanging correctly, shoes not shined and footlockers a mess. Where do you think you are? Home?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (386, 'Military jokes', 'There was this General-in-training, and his superioirs were asking him questions "What happened on June 6, 1944?" "We stormed the beach at Normandy, which later became known as D-Day, sir!" "What was the turining point of wordl war 2?" "Battle of the bulge, sir!" "Whats is the importance of May 12" The Man thought and thought "I dont know, sir!" The superior then said "Well, Ill tell your wife that you forgot her birhtday"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (387, 'Money jokes', 'A man being mugged by two thugs put up a tremendous fight! Finally, the thugs subdued him and took his wallet. Upon finding only two dollars in the wallet, the surprised thug said "Why did you put up such a fight?" To which the man promptly replied "I was afraid that you would find the $200 hidden in my shoe!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (388, 'Money jokes', 'A little boy wanted $100 badly and prayed for two weeks but nothing happened. Then he decided to write a letter to the Lord requesting the $100.When the postal authorities received the letter addressed to the Lord, USA, they decided to send it to President Clinton. The President was so impressed, touched, and amused that he instructed his secretary to send the little boy a $5.00 bill, as this would appear to be a lot of money to a little boy.The little boy was delighted with the $5.00, and sat down to write a thank-you note to the Lord. It said:Dear Lord,Thank you very much for sending me the money. However, I noticed that for some reason you had to send it through Washington, DC and as usual, those jerks deducted $95.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (389, 'Money jokes', 'A couple was having a discussion about what to see and do now that they were safely in Florida on their honeymoon. Trying to assert himself rite off the bat, he exploded, "If it werent for my money, we wouldnt be here at all!" The wife replied, "My dear, if it werent for your money, not only would we not be in Florida, we wouldnt on a honeymoon, nor wouldthere be any "we" in the first place."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (390, 'Money jokes', 'What do you get if you cross a sorceress with a millionaire? A very witch person.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (391, 'Money jokes', 'Can I borrow that book of yours How To Become A Millionaire? Sure. Here you are. Thanks - but half the pages are missing. Whats the matter? Isnt half a million enough for you?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (392, 'Monster jokes', 'What brings the monsters babies? The Frankenstork.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (393, 'Monster jokes', 'Did you hear about the monster who went to a holiday camp? He won the ugly mug and knobbly knees competition and he wasnt even entered.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (394, 'Monster jokes', 'How does Frankenstein sit in his chair? Bolt upright.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (395, 'Monster jokes', 'What did one of Frankensteins ears say to the other? I didnt know we lived on the same block.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (396, 'Monster jokes', 'How did Frankensteins monster eat his lunch?He bolted it down.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (397, 'Mouse jokes', 'One lab mouse to another:Ive trained that crazy human at last. How have you done that? I dont know how, but every time I run through that maze and ring the bell, he gives me a piece of cheese.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (398, 'Mouse jokes', 'What do mice do when theyre at home ? Mousework !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (399, 'Mouse jokes', 'What does a twelve-pound mouse say to a cat ? Here Kitty, kitty, kitty !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (400, 'Mouse jokes', 'What kind of musical instrument do mice play ? A mouse organ !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (401, 'Mouse jokes', 'Why do mice have long tails ? Well, theyd look silly with long hair !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (402, 'Movie and TV jokes', 'A movie producer is lying by the pool at the Beverly Hilton. His partner arrives in a great state of excitement. "Howd the meeting go?" asks the first guy."It went great," says his buddy. "Tarentino will write and direct for six million, Mel Gibson will star for eight, and we can bring in the whole picture for under fifty million.""Fabulous," says the guy by the pool."Theres just one catch," his partner warns."Whats the catch?""We have to put up ten thousand in cash".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (403, 'Movie and TV jokes', 'How many film directors does it take to change a light bulb?Just one, but he wants to do it thirty-two times and when hes done, everyone says that his last light bulb was much better.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (404, 'Movie and TV jokes', 'Q: How many actors does it take to screw in a light bulb?A: 100: One to do it and ninety-nine to say "I couldve done that."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (405, 'Movie and TV jokes', 'Q: How many grips does it take to screw in a light bulb?A: Two: One to hold it, one to hammer it in.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (406, 'Movie and TV jokes', 'Q: How many Union Lighting Technicians does it take to screw in a light bulb?A: Its not a bulb, its a globe.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (407, 'Music jokes', 'Q: What do you get when you drop a piano down a mine shaft?A: A flat minor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (408, 'Music jokes', 'Q: What do you use to tie saplings to a piano so the saplings wont blow away?A: Root position cords.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (409, 'Music jokes', 'Q: How do you get 2 piccolos to play a perfect unison?A: Shoot one.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (410, 'Music jokes', 'Q: Two musicians are walking down the street, and one says to the other, "Who was that piccolo I saw you with last night?" A: The other replies, "That was no piccolo, that was my fife."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (411, 'Music jokes', 'Q: What is the difference between a saxophone and a chainsaw?A: Its all in the grip.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (412, 'Old age jokes', 'Q: Why did the old lady put wheels on her rocking chair?A: She wanted to rock and roll', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (413, 'Old age jokes', 'An elderly lady did her shopping and, upon returning to her car, found four males in the act of leaving with her car. She dropped her shopping bags and drew her handgun, proceeding to scream at them at the top of her voice, "I have a gun and I know how to use it! Get out of the car, scumbags !"The four men didnt wait for a second invitation but got out and ran like mad, whereupon the lady, somewhat shaken, proceeded to load her shopping bags into the back of the car and get into the drivers seat.She was so shaken that she could not get her key into the ignition. She tried and tried, and then it dawned on her why. A few minutes later she found her own car parked four or five spaces farther down.She loaded her bags into her car and drove to the police station.The sergeant to whom she told the story nearly tore himself in two with laughter and pointed to the other end of the counter,  where four pale white males were reporting a car jacking by a mad elderly woman described as white, less than 5 tall, glasses, and curly white hair carrying a large handgun.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (414, 'Old age jokes', 'Three old ladies met on the street on a very stormy day. The wind was so strong and loud that they had difficulty in hearing each other. "Its windy," said one. "No, its Thursday," said the next. "So am I," said the third. "Lets go and have a drink!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (415, 'Old age jokes', 'An old man visits his doctor and after thorough examination the doctor tells him: "I have good news and bad news, what would you like to hear first?"Patient: "Well, give me the bad news first."Doctor: "You have cancer, I estimate that you have about two years left."Patient: "OH NO! Thats awefull! In two years my life will be over! What kind of good news could you probably tell me, after this???"Doctor: "You also have Alzheimers. In about three months you are going to forget everything I told you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (416, 'Old age jokes', 'For the first time in many years, a an old man traveled from his rural town to the city to attend a movie. After buying his ticket, he stopped at the concession stand to purchase some popcorn.Handing the attendant $1.50, he couldnt help but comment, "The last time I came to the movies, popcorn was only 15 cents.""Well, sir," the attendant replied with a grin, "Youre really going to enjoy yourself. We have sound now.."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (417, 'Parent jokes', 'Murphy said to his daughter, "I want you home by eleven oclock." She said, "But Father, Im no longer a child!" He said, "I know, thats why I want you home by eleven."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (418, 'Parent jokes', 'With four daughters and one son always dashing to school activities and part-time jobs, our schedule was hectic.To add to this, we kept running out of household supplies.I instructed them all to let me know when they used the last of any item by writing it down on a note pad on the refrigerator.As a reminder, I wrote at the top: "IF WE ARE OUT OF IT, WRITE IT DOWN."When I checked the pad a few days later, to my delight I found the following message:"MOM, YOU MAY BE A BIT OLD-FASHIONED, BUT YOU ARE NOT OUT OF IT."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (419, 'Parent jokes', 'A man speaks frantically into the phone, "My wife is pregnant, and her contractions are only two minutes apart!" "Is this her first child?" the doctor queries. "No, you idiot!" the man shouts. "This is her *husband*!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (420, 'Parent jokes', 'A man and his wife were making their first doctor visit, the wife being pregnant with their first child.After everything checked out, the doctor took a small stamp and stamped the wifes stomach with indelible ink.The couple was curious about what the stamp was for, so when they got home, the husband got out his magnifying glass to try to see what it was.In very tiny letters, the stamp said, "When you can read this, come back and see me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (421, 'Parent jokes', 'The man passed out in a dead faint as he came out of his front door onto the porch. Someone dialed 911. When the paramedics arrived, they helped him regain consciousness and asked if he knew what caused him to faint. "It was enough to make anybody faint," he said. "My son asked me for the keys to the garage, and instead of driving the car out, he came out with the lawn mower."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (422, 'Pig jokes', 'Why did the pig go to the casino ? To play the slop machine !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (423, 'Pig jokes', 'What do you call a pig with three eyes? ...A piiig', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (424, 'Pig jokes', 'A city child came running into the farmhouse. "No wonder that mama pig is so big," she yelled. "Theres a bunch of little pigs out there blowing her up!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (425, 'Pig jokes', 'A pigs favorite movie: The Monster That Ate New York.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (426, 'Pig jokes', 'All our pigs are learning karate. Oh, I dont believe that No? Well, just watch out for their chops.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (427, 'Political jokes', 'Republicans say "Merry Christmas!" Democrats say "Happy Holidays!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (428, 'Political jokes', 'Republicans help the poor during the holidays by sending 50, one buck at a time, to panhandlers on the street.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (429, 'Political jokes', 'Democrats get back at the Republicans on their Christmas list by giving them fruitcakes. Republicans re-wrap them and send them to in-laws.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (430, 'Political jokes', 'Democrats let their kids open all the gifts on Christmas Eve. Republicans make their kids wait until Christmas morning.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (431, 'Political jokes', 'When toasting the holidays, Republicans ask for eggnog or mulled wine. Democrats ask for a "Bud."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (432, 'Police jokes', 'The Boston taxi driver backed into the stationary fruit stall and within seconds he had a cop beside him. "Name?" "Brendan OConnor." "Same as mine. Where are you from?" "County Cork." "Same as me......" The policeman paused with his pen in the air. "Hold on a moment and Ill come back and talk about the old county. I want to say something to this fella that ran into the back of your cab."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (433, 'Police jokes', 'Driving to work, a gentlman had to swerve to avoid a box that fell out of a truck in front of him. Seconds later, a policeman pulled him over for reckless driving. Fortunately, another officer had seen the carton in the road. The policmen stopped traffic and recovered the box. It was found to contain large upholstery tacks. "Im sorry sir," the first trooper told the driver, "but I am still going to have to write you a ticket." Amazed, the driver asked for what. The trooper replied, "Tacks evasion."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (434, 'Police jokes', 'A policeman pulls a man over for speeding and asks him to get out of the car. After looking the man over he says, "Sir, I couldnt help but notice your eyes are bloodshot. Have you been drinking?" The man gets really indignant and says, "Officer, I couldnt help but notice your eyes are glazed. Have you been eating doughnuts?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (435, 'Police jokes', 'A local policeman had just finished his shift one cold November evening and was at home with his wife. "You just wont believe what happened this evening , in all my years on the force Ive never seen anything like it." "Oh yes dear, what happened ?" "I came across two guys down by the canal, one of them was drinking battery acid and the other was eating fireworks." "Drinking battery acid and eating fireworks!! What did you do with them ?" "Oh that was easy, I charged one and let the other off."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (436, 'Police jokes', 'A new man is brought into Prison Cell 102. Already there is a long-time resident who looks 100 years old. The new man looks at the old-timer inquiringly. The old-timer says, "Look at me. Im old and worn out. Youd never believe that I used to live the life of Riley. I wintered on the Riviera, had a boat, four fine cars, the most beautiful women, and I ate in all the best restaurants of France." The new man asked, "What happened?" "One day Riley reported his credit cards missing!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (437, 'Rabbit jokes', 'A bumble bee was chasing a rabbit. Finally the bee turned around and flew away. Why?The rabbit had two bs already.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (438, 'Rabbit jokes', 'Baby Rabbit: Mommy, where did I come from? Mother Rabbit: Ill tell you when youre older. Baby Rabbit: Oh, Mommy, please, tell me now. Mother Rabbit: If you must know, you were pulled from a magicians hat.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (439, 'Rabbit jokes', 'Did you hear about the rabbit who got a job in a watch factory? Alike did was stand around making faces.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (440, 'Rabbit jokes', 'Did you hear about the egg laden rabbit who jumps off bridges?Hes the Easter Bungee!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (441, 'Rabbit jokes', 'Did you hear about the pub owner who raised a baby rabbit?It was an inn-grown hare!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (442, 'Religious jokes', 'A local priest and pastor stood by the side of the road holding up a sign that said, "The End is Near! Turn yourself around now before its too late!" They planned to hold up the sign to each passing car. "Leave us alone you religious nuts!" yelled the first driver as he sped by. From around the curve they heard a big splash. "Do you think," said one clergy to the other, "we should just put up a sign that says bridge out instead?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (443, 'Religious jokes', 'A little girl spoke to her teacher about whales. The teacher said it was physically impossible for a whale to swallow a human because even though it is a very large mammal, its throat is very small. The little girl said, "But how can that be? Jonah was swallowed by a whale." Irritated, the teacher reiterated that a whale could not swallow a human. "It is physically impossible!" she said. Undaunted, the little girl said, "Well, when I get to heaven I will ask Jonah." To this, the teacher said, "What if Jonah went to hell?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (444, 'Religious jokes', 'Old Mrs. Watkins awoke one spring morning to find that the river had flooded the entire first floor of her house. Looking out of her window, she saw that the water was still rising.Two men passing by on a rowboat shouted up an invitation to row to safety with them. "No, thank you," Mrs. Watkins replied. "The Lord will provide." The men shrugged and rowed on.By evening, the water level forced Mrs. Watkins to climb on top of the roof for safety. She was spotted by a man in a motorboat, who offered to pick her up. "Dont trouble yourself," she told him. "The Lord will provide."Pretty soon, Mrs. Watkins had to seek refuge atop the chimney. When a Red Cross cutter came by on patrol, she waved it on, shouting, "The Lord will provide."So the boat left, the water rose and the old woman drowned.Dripping wet and thoroughly annoyed, she came through the pearly gates and demande d to speak to God. "What happened?" she cried."For cryin out loud, lady," God said, "I sent three boats!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (445, 'Religious jokes', 'A priest was called away for an emergency. Not wanting to leave the confessional unattended, he called his rabbi friend from across the street and asked him to cover for him.The rabbi told him he wouldnt know what to say, but the priest told him to come on over and hed stay with him for a little bit and show him what to do. The rabbi comes, and he and the priest are in the confessional. In a few minutes, a woman comes in and says, Father, forgive me for I have sinned.The priest asks, What did you do?The woman says, I committed adultery.The priest says, How many times? And the woman replies, Three.Priest: Say two Hail Marys, put $5 in the box, and go and sin no more.A few minutes later a man enters the confessional. He says, Father forgive me for I have sinned.What did you do?I committed adultery. r\nHow many times?Three times.The priest says, Say two Hail Marys, put $5 in the box and go and sin no more.The rabbi tells the priest that he thinks hes got it, so the priest leaves. A few minutes later another woman enters and says, Father, forgive me for I have sinned.The rabbi says, What did you do?The woman replies, I committed adultery.The rabbi, getting it off pat, says, How many times?The woman replies, Once.The rabbi said, Go and do it two more times, We have a special this week, three for $5.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (446, 'Religious jokes', 'A Jewish guy called Jacob finds himself in dire trouble. His business has gone bust and hes in serious financial trouble. Hes so desperate that he decides to ask God for help. He goes into the synagogue and begins to pray"God, please help me, Ive lost my business and if I dont get some money, Im going to lose my house as well, please let me win the lotto".Lotto night comes and somebody else wins it.Jacob goes back to the synagogue."God, please let me win the lotto, Ive lost my business, my house and Im going to lose my car as well".Lotto night comes and Jacob still has no luck!!Back to the synagogue."My God, why have you forsaken me?? Ive lost my business, my house, my car and my wife and children are starving. I dont often ask you for help and I have always been a good servant to you. Why wont you just let me win the lotto this one time so  I can get my life back in order???".Suddenly there is a blinding flash of light as the heavens open and Jacob is confronted by the voice of GOD himself:"JACOB, MEET ME HALF WAY ON THIS ONE, BUY A DAMN TICKET"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (447, 'Restaurant jokes', 'A panda walks into a restaurant, sits down and orders a sandwich. He eats the sandwich, pulls out a gun and shoots the waiter dead. As the panda stands up to go, the manager shouts, "Hey! Where are you going? You just shot my waiter and you didnt pay for your sandwich!"The panda yells back at the manager, "Hey man, Im a PANDA! Look it up!"The manager opens his dictionary and sees the following definition for panda: "A tree dwelling marsupial of Asian origin, characterized by distinct black and white coloring. Eats shoots and leaves."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (448, 'Restaurant jokes', 'Three couples are dining together.The American husband says to his wife: "Pass me the honey, Honey".The English husband says to his wife: "Pass me the sugar, Sugar".The [you name it] husband says to his wife: "Pass me the steak, Dumb cow".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (449, 'Restaurant jokes', 'Two men were in a restaurant and ordered fish. The waiter brought a dish with two fish, one larger than the other. One of the men said to the other, "Please help yourself." The other one said "Okay", and helped himself to the larger fish. After a tense silence, the first one said, "really, now, if you had offered me the first choice, I would have taken the smaller fish!" The other one replied, "What are you complaining for; you have it, dont you?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (450, 'Restaurant jokes', '"What flavors of ice cream do you have?" inquired the customer."Vanilla, strawberry, and chocolate," answered the new waitress in a hoarse whisper.Trying to be sympathetic, the customer asked, "Do you have laryngitis?" "No...." replied the new waitress with some effort, "just...erm.... vanilla, strawberry, and chocolate."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (451, 'Restaurant jokes', 'Did you hear about the new restaurant on the moon? Great food but no atmosphere.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (452, 'Salesmen jokes', 'A salesman walking along the beach found a bottle. When he rubbed it, lo and behold, a genie appeared."I will grant you three wishes," announced the genie. "But since Satan still hates me, for every wish you make, your rival gets the wish as well -- only double."The salesman thought about this for a while. "For my first wish, I would like ten million dollars," he announced.Instantly the genie gave him a Swiss bank account number and assured the man that $10,000,000 had been deposited. "But your rival has just received $20,000,000," the genie said."Ive always wanted a Ferrari," the salesman said.Instantly a Ferrari appeared. "But your rival has just received two Ferraris," the genie said. "And what is your last wish?""Well," said the salesman, "Ive always wanted to donate a kidney for transplant."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (453, 'Salesmen jokes', 'How do salespeople traditionally greet each other?"Hi. Nice to meet you. Im better than you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (454, 'Salesmen jokes', 'A salesman was demonstrating unbreakable combs in a department store. He was impressing the people who stopped by to look by putting the comb through all sorts of torture and stress.Finally to impress even the skeptics in the crowd, he bent the comb completely in half, and it snapped with a loud crack. Without missing a beat, he bravely held up both halves of the unbreakable comb for everyone to see and said, "And this, ladies and gentlemen, is what an unbreakable comb looks like on the inside."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (455, 'Salesmen jokes', 'Two shoe salespeople were sent to Africa to open up new markets. Three days after arriving, one salesperson called the office and said, "Im returning on the next flight. Cant sell shoes here. Everybody goes barefoot."At the same time the other salesperson sent an email to the factory, telling "The prospects are unlimited. Nobody wears shoes here!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (456, 'Salesmen jokes', 'A software manager, a hardware manager, and a marketing manager are driving to a meeting when a tire blows. They get out of the car and look at the problem.The software manager says, "I cant do anything about this - its a hardware problem."The hardware manager says, "Maybe if we turned the car off and on again, it would fix itself."The marketing manager says, "Hey, 75% of it is working - lets ship it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (457, 'School jokes', 'Teacher: Whats 2 and 2?Pupil: 4Teacher: Thats good.Pupil: Good?, thats perfect!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (458, 'School jokes', 'Teacher: Who can tell me where Hadrians Wall is?Pupil: I expect its around Hadrians garden miss!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (459, 'School jokes', 'Teacher: Why does the statue of liberty stand in New York harbour?Pupil: Because it cant sit down!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (460, 'School jokes', 'Teacher: Where is your homework?Pupil: I lost it fighting this kid who said you werent the best teacher in the school', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (461, 'School jokes', 'Teacher: If 1+1=2 and 2+2=4, what is 4+4?Pupil: Thats not fair!You answer the easy ones and leave us with the hard one!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (462, 'Snake jokes', 'There where two snakes talking. The 1st one said Sidney, are we the type of snakes who wrap ourselves around our prey and squeeze and crush until theyre dead? Or are we the type of snake who ambush our prey and bite them and they are poisioned?. Then the second Snake says "Why do you ask?" The 1st one replies: "I just bit my lip!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (463, 'Snake jokes', 'A old snake goes to see his Doctor. "Doc, I need something for my eyes...cant see well these days". The Doc fixes him up with a pair of glasses and tells him to return in 2 weeks. The snake comes back in 2 weeks and tells the doctor hes very depressed. Doc says, "Whats the problem...didnt the glasses help you?" "The glasses are fine doc, I just discovered Ive been living with a water hose the past 2 years!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (464, 'Snake jokes', 'Q: What kind of snake is good at math?A: An adder.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (465, 'Snake jokes', 'What do you get if you cross a snake with a hotdog? A fangfurther.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
