INSERT INTO `jokes` VALUES (474, 'Space jokes', 'President Dubya was awakened one night by an urgent call from the Pentagon. "Mr. President," said the four-star general, barely able to contain himself, "theres good news & bad news." "Oh, no," muttered the President, "Well, let me have the bad news first." "The bad news, sir, is that weve been invaded by creatures from another planet." "Gosh, and the good news?" "The good news, sir, is that they eat reporters and pee oil."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (475, 'Space jokes', 'What do you get if you cross an alien and a hot drink ?Gravi-tea !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (476, 'Space jokes', 'A woman at a gas station noticed a spaceship landing in front of her. An alien stepped out of the spaceship and started to pump gas into it. The woman noticed the letters U.F.O. printed on the side of the ship. She turned to the alien and asked Does U.F.O. stand for Unidentified Flying Object? The alien answered, No, it stands for Unleaded Fuel Only!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
