INSERT INTO `jokes` VALUES (485, 'Spelling jokes', 'First witch: Heres a banana if you can spell it. Second witch: I can spell banana. I just dont know when to stop.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (486, 'Spelling jokes', 'The young lad had applied for a job, and was asked his full name. "Aloysius Montmorency Geoghan," he replied. "How do you spell that?" asked the manager. "Er ? sir ? er ? cant you just put it down without spelling it?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (487, 'Teeth jokes', 'Fan: Ive always admired you. Are your teeth your own? Actor: Whose do you think they are?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (488, 'Teeth jokes', 'What did the vampire call his false teeth? A new fangled device.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (489, 'Teeth jokes', 'What happened to the man who put his false teeth in backwards? He ate himself!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (490, 'Teeth jokes', 'Why did the old lady cover her mouth with her hands when she sneezed? To catch her false teeth.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (491, 'Teeth jokes', 'A man coughed violently, and his false teeth shot across the room and smashed against the wall. "Oh, dear," he said, "whatever shall I do? I cant afford a new set." "Dont worry," said his friend. "Ill get a pair from my brother for you." The next day the friend came back with the teeth, which fitted perfectly. "This is wonderful," said the man. "Your brother must be a very good dentist." "Oh, hes not a dentist," replied the friend, "hes an undertaker."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (492, 'Telephone jokes', 'After my wife and her former best buddy, another Air Force wife, were separated by a move that posted onehusband on the opposite coast, the telephone became their chief means of communication. When our phonebills showed astronomical increases, the other spouse and I sought relief. Since we both owned computers, weencourage our wives to use electronic mail. Now they call on the phone to let each other know that e-mail was sent, then call back to confirm that itarrived and have a conversation about the contents!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (493, 'Telephone jokes', 'What do you call an elephant in a phone box? Stuck.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (494, 'Telephone jokes', 'What do ghosts use to phone home? A terror-phone.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (495, 'Telephone jokes', 'Doctor, doctor, I keep thinking Im a telephone. Doctor: Whys that? I keep getting calls in the night.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (496, 'Telephone jokes', 'At three oclock one morning a veterinary surgeon was woken from a deep sleep by the ringing of his telephone. He staggered downstairs and answered the phone. "Im sorry if I woke you," said a voice at the other end of the line. "Thats all right," said the vet, "I had to get up to answer the telephone anyway."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (497, 'Time jokes', 'A blonde asked someone what time it was, and they told her it was 4:45. The blonde, with a puzzled look on her face replied,"You know, its the weirdest thing, I have been asking that question all day, and each time I get a different answer."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (498, 'Time jokes', 'A man had been driving all night and by morning was still far from his destination. He decided to stop at the next city he came to, and park somewhere quiet so he could get an hour or two of sleep. As luck would have it, the quiet place he chose happened to be on one of the citys major jogging routes. No sooner had he settled back to snooze when there came a knocking on his window. He looked out and saw a jogger running in place. "Yes?" "Excuse me, sir," the jogger said, "do you have the time?" The man looked at the car clock and answered, "8:15". The jogger said thanks and left. The man settled back again, and was just dozing off when there was another knock on the window and another jogger. "Excuse me, sir, do you have the time?" "8:25!" The jogger said thanks and left. Now the man could see other joggers passing by and he knew it was only a matter of time before another o ne disturbed him. To avoid the problem, he got out a pen and paper and put a sign in his window saying, "I do not know the time!" Once again he settled back to sleep. He was just dozing off when there was another knock on the window. "Sir, sir? Its 8:45!."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (499, 'Time jokes', 'How can you tell when witches are carrying a time bomb? You can hear their brooms tick!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (500, 'Time jokes', 'What did the Loch Ness Monster say to his friend? Long time no sea.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (501, 'Time jokes', 'What time is it when you sit on a pin? Spring time.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (502, 'Vampire jokes', 'Why did the vampire attack the clown? He wanted the circus to be in his blood.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (503, 'Vampire jokes', 'Did you hear about the vampire who had an eye for the ladies? He used to keep it in his back pocket.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (504, 'Vampire jokes', 'What is Draculas favorite fruit? Neck-tarines.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (505, 'Vampire jokes', 'When the picture of the vampires grandmother crashed to the floor in the middle of the night what did it mean? That the nail had come out of the wall.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (506, 'Vampire jokes', 'What is a vampires favourite soup ?Scream of mushroom !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (507, 'Travel and tourist jokes', 'A man wrote a letter to a small hotel in a Midwest town he planned to visit on his vacation. He wrote:"I would very much like to bring my dog with me. He is well-groomed and very well behaved. Would you be willing to permit me to keep him in my room with me at night?" An immediate reply came from the hotel owner, who said, "Ive been operating this hotel for many years. In all that time, Ive never had a dog steal towels, bedclothes, silverware or pictures off the walls. Ive never had to evict a dog in the middle of the night for being drunk and disorderly. And Ive never had a dog run out on a hotel bill. Yes, indeed, your dog is welcome at my hotel. And, if your dog will vouch for you, youre welcome to stay here, too."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (508, 'Travel and tourist jokes', 'A man was driving along the highway, and saw a rabbit hopping across the middle of the road. He swerved to avoid hitting the rabbit, but unfortunately the rabbit jumped in front of the car and was hit. The driver, being a sensitive man as well as an animal lover, pulled over to the side of the road and got out to see what had become of the rabbit. Much to his dismay, the rabbit was dead. The driver felt so awful he began to cry.A woman driving down the highway saw the man crying on the side of the road and pulled over. She stepped out of her car and asked the man what was wrong."I feel terrible," he explained. "I accidently hit this rabbit and killed it."The woman told the man not to worry. She knew what to do. She went to her car trunk and pulled out a spray can. She walked over to the limp, dead rabbit, and sprayed the contents of the can onto the rabbit. Miraculously,  the rabbit came to life, jumped up, waved its paw at the two humans and hopped down the road. 50 feet away the rabbit stopped, turned around, waved at the two again, hopped down the road another 50 feet, turned, waved, and hopped another 50 feet. The man was astonished. He couldnt figure out what substance could be in the womans spray can! He ran over to the woman and demanded, " What was in your spray can? What did you spray onto that rabbit?" The woman turned the can around so that the man could read the label. It said:"Hare Spray Restores Life to Dead Hare. Adds Permanent Wave."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (509, 'Travel and tourist jokes', 'A fellow stopped at a rural gas station and, after filling his tank, he paid the bill and bought a soft drink. He stood by his car to drink his cola and he watched a couple of men working along the roadside. One man would dig a hole two or three feet deep and then move on. The other man came along behind and filled in the hole. While one was digging a new hole, the other was about 25 feet behind filling in the old. The men worked right past the fellow with the soft drink and went on down the road. "I cant stand this," said the man tossing the can in a trash container and heading down the road toward the men. "Hold it, hold it," he said to the men. "Can you tell me whats going on here with this digging?" "Well, we work for the county government, " one of the men said. "But one of you is digging a hole and the other is filling it up. Youre not accomplishing anything. Are nt you wasting the countys money?" "You dont understand, mister," one of the men said, leaning on his shovel and wiping his brow. "Normally theres three of us--me, Rodney and Mike. I dig the hole, Rodney sticks in the tree and Mike here puts the dirt back." "Yea," piped up Mike. "Now just because Rodneys sick, that dont mean we cant work, does it?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (510, 'Travel and tourist jokes', 'Walking through Chinatown, a tourist is fascinated with all the Chinese restaurants, shops, signs and banners. He turns a corner and sees a building with the sign, "Hans Olaffsens Laundry." "Hans Olaffsen?", he muses. "How in hell does that fit in here?" So he walks into the shop and sees an old Chinese gentleman behind the counter. The tourist asks, "How did this place get a name like Hans Olaffsens Laundry?" The old man answers, "Is name of owner." The tourist asks, "Well, who and where is the owner?" "Me...is right here," replies the old man. "You? How did you ever get a name like Hans Olaffsen?" "Is simple," says the old man. "Many, many year ago when come to this country, was stand in line at Documentation Center. Man in front was big blonde Swede. Lady look at him and go, What your name? He say,Hans Olaffsen. Then she look at me and go, Wh at your name?" "I say Sem Ting."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (511, 'Travel and tourist jokes', 'During my stay at an expensive hotel in New York City, I woke up in the middle of the night with an upset stomach. I called room service and ordered some soda crackers. When I looked at the charge slip, I was furious. I called room service and raged, "I know Im in a luxury hotel, but $11.50 for six crackers is ridiculous!" "The crackers are complimentary," the voice to the other end cooly explained. "I believe you are complaining about your room number."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (512, 'Various animal jokes', 'What do you call a gigantic polar bear?Nothing, you just run away!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (513, 'Various animal jokes', 'What animal do you look like when you get into the bath ? A little bear !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (514, 'Various animal jokes', 'A lady was walking down the street to work and she saw a parrot on a perch in front of a pet store. The parrot said to her, "Hey lady, you are really ugly." Well, the lady is furious! She stormed past the store to her work. On the way home she saw the same parrot and it said to her, "Hey lady, you are really ugly." She was incredibly ticked now. The next day the same parrot again said to her, "Hey lady, you are really ugly." The lady was so ticked that she went into the store and said that she would sue the store and kill the bird. The store manager replied, "Thats not good," and promised he wouldnt say it again. When the lady walked past the store that day after work the parrot called to her, "Hey lady." She paused and said, "Yes?"The bird said, "You know."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (515, 'Various animal jokes', 'There are bats hanging of a branch upside down, all except one. Two bats comment: "Whats happened to this one?- I dont know, two minutes ago he seemed normal and then he fainted.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (516, 'Various animal jokes', 'A vampire bat came flapping in from a night of foraging, covered in fresh blood. He parked himself on the caves roof to get some sleep. Soon all the other bats smelled the blood and began hassling him about where he got it. He told them to shut up and let him get some sleep, but they persisted until he finally gave in. "OK, follow me." He flew out of the cave with hundreds of bats behind him. Down through a valley they went, across a river and into a forest of trees. Finally he slowed down and all the other bats excitedly milled around him. "Do you see that tree over there?" "YES, YES, YES!!" the bats all screamed in a frenzy. "Well I didnt!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (517, 'Waiter jokes', 'Diner: Watch out! Your thumbs in my soup!Waiter: Dont worry, Sir, its not that hot!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (518, 'Waiter jokes', 'A waiter brings the customer the steak he ordered with his thumb over the meat."Are you crazy?" yelled the customer, "with your hand on my steak?""What" answers the waiter, "You want it to fall on the floor again?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (519, 'Waiter jokes', 'Waiter: "Tea or coffee, gentlemen?"1st customer: "Ill have tea."2nd customer: "Me, too - and be sure the glass is clean!"(Waiter exits, returns)Waiter: "Two teas. Which one asked for the clean glass?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (520, 'Waiter jokes', 'Waiter, waiter, do you have frogs legs?Certainly, Sir!Well hop over here and get me a sandwich!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (521, 'Waiter jokes', 'Two attorneys went into a diner and ordered two drinks. Then they produced sandwiches from their briefcases and started to eat. The waiter became quite concerned and marched over and told them, "You cant eat your own sandwiches in here!" The attorneys looked at each other, shrugged their shoulders and then exchanged sandwiches.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (522, 'Weather jokes', 'Youre hiking around on Hampsted Heath (a park near London) at the end of a long sunny day. You run across (separately) the ghosts of Sir Winston Churchill, Sir Baden Powell, and Sir Edmund Hillary, who all give you directions to the nearest tube stop. Whom dont you believe? Your story teller, for there is no such thing as a completely sunny day in England.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (523, 'Weather jokes', 'Why did your sister cut a hole in her new umbrella ?Because she wanted to be able to tell when it stopped raining.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (524, 'Weather jokes', 'You never get anything right, complained the teacher. What kind of job do you think youll get when you leave school ?Well, I want to be the weather girl on TV.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (525, 'Weather jokes', 'What did Santa Clauss wife say during a thunderstorm?Come and look at the rain, dear.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (526, 'Weather jokes', 'How do sheep keep warm in winter ? Central bleating !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
