INSERT INTO `jokes` VALUES (528, 'Witch jokes', 'Did you hear about the witch who was ashamed of her long black hair? She always wore long gloves to cover it up.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
