INSERT INTO `jokes` VALUES (530, 'Witch jokes', 'What happened to the witch with an upside down nose? Every time she sneezed her hat blew off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (531, 'Witch jokes', 'Why did the witch lose her way? Because her hat was pointing in the wrong direction.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (532, 'Women jokes', 'Why do women have smaller feet than men? - It allows them to stand closer to the sink.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (533, 'Women jokes', 'How do you know when a woman is about to say something smart? - She starts her sentence with "A man once told me..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (534, 'Women jokes', 'How do you fix a womans watch? - It doesnt matter. There is a clock on the oven.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (535, 'Women jokes', 'If your dog is barking at the back door and your wife is yelling at the front door, who do you let in first? - The dog. Hell shut up once you let him in.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (536, 'Women jokes', 'Whats worse than a Male Chauvinist Pig? - A woman that wont do what shes told.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (537, 'Zodiac jokes', 'Q: How many Arians does it take to change a lightbulb? A: Just the one. You want to make something of it, eh?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (538, 'Zodiac jokes', 'Q: How many Arians does it take to change a lightbulb? A: None: Arians arent afraid of the dark.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (539, 'Zodiac jokes', 'Q: How many Arians does it take to change a lightbulb? A: Only one Arian, but an awful lot of light bulbs. (*smash*)', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (540, 'Zodiac jokes', 'Q: How many Aquarians does it take to change a lightbulb? A: Well, you have to remember that everything is energy so...', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (541, 'Zodiac jokes', 'Q: How many Aquarians does it take to change a lightbulb? A: A hundred, but theyll all be competing to be the one to change the bulb and bring light to the world.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (542, 'Yo momma jokes', 'Yo mama so poor when I saw her kicking a can down the street, I asked her what she was doing, she said "Moving."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (543, 'Yo momma jokes', 'Yo mama so poor she cant afford to pay attention!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
