INSERT INTO `jokes` VALUES (546, 'Yo momma jokes', 'Yo mama so poor she was in K-Mart with a box of Hefty bags. I said, "What ya doin?" She said, "Buying luggage."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (547, 'Zoo jokes', 'A kangaroo kept getting out of his enclosure at the zoo. Knowing that he could hop high, the zoo officials put up a ten-foot fence. He was out the next morning, just roaming around the zoo. A twenty-foot fence was put up. Again he go out. When the fence was forty feet high, a camel in the next enclosure asked the kangaroo, "How high do you think theyll go?"The kangaroo said, "About a thousand feet, unless somebody locks the gate at night!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (548, 'Zoo jokes', 'One day the zookeeper noticed that the orang-utang was reading two books -- the Bible and Darwins Origin of Species. In surprise he asked the ape, "Why are you reading both those books"?"Well," said the orang-utang, "I just wanted to know if I was my brothers keeper or my keepers brother."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (549, 'Zoo jokes', 'The manager of a large city zoo was drafting a letter to order a pair of animals. He sat at his computer and typed the following sentence: "I would like to place an order for two mongooses, to be delivered at your earliest convenience."He stared at the screen, focusing on that odd word mongooses. Then he deleted the word and added another, so that the sentence now read: "I would like to place an order for two mongeese, to be delivered at your earliest convenience."Again he stared at the screen, this time focusing on the new word, which seemed just as odd as the original one. Finally, he deleted the whole sentence and started all over. "Everyone knows no full-stocked zoo should be without a mongoose," he typed. "Please send us two of them."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (550, 'Zoo jokes', 'Father and son standing outside the elephants cage in the Moscow Zoo. Father tells son, "If we stand around here long enough, one of them will throw some food at us."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (551, 'Zoo jokes', 'A man went to work for a zoo veterinarian. "Look in the lions mouth," the vet told him."How do I do that?" he asked."Carefully," replied the vet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
