INSERT INTO `jokes` VALUES (699, 'Computer jokes', 'A system programmer came home from work almost at dawn and told his wife enthusiastically: "Tonight I have installed a new release of MVS/ESA together with VM/CMS and CICS/VS"."G.O.O.D" answered his wife.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
