INSERT INTO `jokes` VALUES (701, 'Computer jokes', 'The boy is smoking and leaving smoke rings into the air.The girl gets irritated with the smoke and says to her lover: "Cant you see the warning written on the cigarettes packet, smoking is injurious to health!"The boy replies back: "Darling, I am a programmer. We dont worry about warnings, we only worry about errors."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
