INSERT INTO `jokes` VALUES (703, 'Computer jokes', 'They say that the new super computer knows everything. A skeptical man came and asked the computer, "Where is my father?"The computer bleeped for a short while, and then came back with "Your father is fishing in Michigan."The skeptical man said triumphantly, "You see? I knew this was nonsense. My father has been dead for twenty years.""No", replied the super computer immediately. "Your mothers husband has been dead for twenty years. Your father just landed a three pound trout."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (704, 'Computer jokes', 'The programmer to his son: "Here, I brought you a new basketball.""Thank you, daddy, but where is the users guide?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (705, 'Computer jokes', 'The problem with physicists is that they tend to cheat in order to get results.The problem with mathematicians is that they tend to work on toy problems in order to get results.The problem with program verifiers is that they tend to cheat at toy problems in order to get results.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (706, 'Computer jokes', 'A software verifier read in the Bible that God protects all fools, and decided to test it empirically. He jumped out of the window and broke a leg. There he lies, writhing in pain, and happily thinks: "I never really considered myself a fool, but I never knew I was THAT clever!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (707, 'Computer jokes', 'How many maintenance programmers does it take to change a light bulb?None. They try to fix the old one."We looked at the light fixture and decided theres no point trying to maintain it. Were going to rewrite it from scratch. Could you wait two months?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (708, 'Computer jokes', 'How many C++ programmers does it take to change a light bulb?"Youre still thinking procedurally! A properly designed light bulb object would inherit a change method from a generic light bulb class!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
