INSERT INTO `jokes` VALUES (853, 'Accountant jokes', 'A guy in a bar leans over to the guy next to him and says, "Want to hear an accountant joke?"The guy next to him replies, "Well, before you tell that joke, you should know that Im 6 feet tall, 200 pounds, and Im an accountant. And the guy sitting next to me is 62" tall, 225 pounds, and hes an accountant. Now, do you still want to tell that joke?"The first guy says, "No, I dont want to have to explain it two times."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (854, 'Accountant jokes', 'If an accountants wife cannot sleep, what does she say?"Darling, could you tell me about your work."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (855, 'Accountant jokes', 'A 54-year-old accountant leaves a letter for his wife one evening which read: "Dear Wife, I am 54 years old, and by the time you get this letter I will be at the Grand Hotel with my beautiful and sexy eighteen year old secretary."When he arrived at the hotel, there was a letter waiting for him that read as follows: "Dear Husband, I too am 54 years old, and by the time you receive this letter I will be at the Savoy Hotel with my eighteen year old toy boy. Because you are an accountant, you will surely appreciate that l8 goes into 54 many more times than 54 goes into 18."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (856, 'Accountant jokes', 'A business owner tells her friend that she is desperately searching for an accountant.Her friend asks, "Didnt your company hire an accountant a short while ago?"The business owner replies, "Thats the accountant Ive been searching for."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (857, 'Accountant jokes', 'A young accountant spends a week at his new office with the retiring accountant he is replacing. Each and every morning as the more experienced accountant begins the day, he opens his desk drawer, takes out a worn envelope, removes a yellowing sheet of paper, reads it, nods his head, looks around the room with renewed vigor, returns the envelope to the drawer, and then begins his days work.After he retires, the new accountant can hardly wait to read for himself the message contained in the envelope in the drawer, particularly since he feels so inadequate in replacing the far wiser and more highly esteemed accountant. Surely, he thinks to himself, it must contain the great secret to his success, a wondrous treasure of inspiration and motivation. His fingers tremble anxiously as he removes the mysterious envelope from the drawer and reads the following message:"Debits in the column toward t he file cabinet.Credits in the column toward the window."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
