INSERT INTO `jokes` VALUES (947, 'Apple jokes', 'School lunches are not generally popular with those that have to eat them, and sometimes with good reason. "What kind of pie do you call this ?" asked one schoolboy indignantly."Whats it taste of ?" asked the cook. "Glue!" "Then its apple pie, the plum pie tastes of soap."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
