INSERT INTO `jokes` VALUES (957, 'Apple jokes', 'A Pittsburgh steel worker was driving through northern Californias apple country. He stopped at an orchard and asked the owner, "How much are yer apples?" "All you can pick for one dollar," said the rancher. "Okay," said the Pennsylvanian. "Ill take two dollars worth."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (958, 'Apple jokes', 'After a minor mathematical error on a routine report, a workers boss tried to belittle him in front of his peers. Angrily she asked, "If you had 4 apples and I asked for one, how many would you have left?" Quickly he replied, "If it was you who asked, Id still have 4 apples."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
