INSERT INTO `jokes` VALUES (1133, 'Baby jokes', 'A distraught mum rushed into the back yard, where eight-year-old Tommy was banging on the bottom of an old upturned tin bath with a poker. "What do you think youre doing?" she demanded. "Im just entertaining the baby," explained Tommy. "Where is the baby?" asked his Mum. "Under the bath."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
