INSERT INTO `jokes` VALUES (1145, 'Baby jokes', 'Three men were discussing at a bar about coincidences. The first man said, " my wife was reading a "tale of two cities" and she gave birth to twins""Thats funny", the second man remarked, "my wife was reading the three musketeers and she gave birth to triplets"The third man shouted, "Good God, I have to rush home!"When asked what the problem was, he exclaimed, " When I left the house, my wife was reading Ali baba and the forty Thieves"!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
