INSERT INTO `jokes` VALUES (1149, 'Baby jokes', 'Dewey and Odell met on the Brownsville main street. "Say," said Dewey, "Ah hurd yew and yore wife is goin ta night school ta take Spanish lessons. How cum?" "Uh huh," answered Odell. "We went and adopted us a little Mexican baby, and we wanna be able ta understand him when he gets old enough ta talk!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1150, 'Baby jokes', 'A baby polar bear goes up to his dad and asks, "Dad, am I pure polar bear?" The dad replies, "Sure you are son. Im all polar bear, my parents are all polar bear, your mom is all polar bear, and her parents are all polar bear." Still unsure the baby polar bear goes to his mom and asks, "Mom, am I pure polar bear?" She answers, "Of course you are honey. Im all polar bear, your father is all polar bear, my parents are all polar bear, and his parents are all polar bear." Still not convinced the baby polar bear goes to his grandparents and asks, "Grandmom...Grandpop...am I all polar bear?" His grandmother answers, "Of course you are sweetie. Were all polar bear, your mother is all polar bear, your father is all polar bear, and his parents are all polar bear. Why do you ask sweetie?" The baby polar bears replies, "Because Im f****** freezing!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1151, 'Baby jokes', 'Q: Where does a white baby go when it dies? A: Heaven Q: What does it get? A: Wings Q: What does it become? A: An angel Q: Where does a black baby go when it dies? A: Heaven Q: What does it get? A: Wings Q: What does it become? A: A Bat!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1152, 'Baby jokes', 'Q: Whats brown and in a babys diaper? A: Michael Jacksons hand !!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1153, 'Baby jokes', 'Q: Whats pink and red and cant turn round in a corridor? A: A baby with a javellin through its head.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1154, 'Baby jokes', 'A family of ducks were walking down the road when an 18-wheeler ran over all but 1 baby. Farther down the road a family of skunks were walking the other way when the same 18-wheeler ran over all but one baby. The duck and the skunk finally met each other and the duck said, "Excuse me, my mom died down the road. Would you tell me what I am?" "Well", said the skunk "You have webbed feet, a beak, and feathers. You must be a duck." "Thanks" said the duck; then the skunk said, "My mom died down the road too, will you tell me what I am?" "Well", said the duck, "Your black, your white, & your moms dead, you must be O.J.s kid"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1155, 'Baby jokes', 'Little Johnny s next door neighbors had a baby. Unfortunately, the little baby was born with no ears. When they arrived home from the hospital, the parents invited Little Johnnys family to come over and see their new baby. Little Johnnys parents were very afraid that their son would have a wise crack to say about the baby so the dad had a long talk with little Johnny before going to the neighbors. He said "Now, son... that poor baby was born without any ears. I want you to be on your best behavior and not say one word about his ears or I am really going to spank you when we get back home." "I promise not to mention his ears at all" said Little Johnny. At the neighbors home, Little Johnny leaned over in the crib and touched the babys hand He looked at its mother and said "Oh What a Beautiful little baby". The mother said "Thank you very much, Little Johnny." He then  said, "this baby has perfect little hands and perfect little feet. Why... just look at his pretty little eyes.... Did his doctor say that he can see good?" The Mother said "why, yes Johnny... his doctor said he has 20/20 vision. Little Johnny said "well, its a darn good thing, cause he sure couldnt wear glasses!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
