INSERT INTO `jokes` VALUES (1267, 'Bar jokes beer booze and fun', 'A Russian walks into a bar and orders a beer. "That will be one ruble," says the bartender. "One ruble!" the customer protests, "last week it was only fifty kopeks!" "Well," replies the bartender, "its fifty kopeks for the beer and fifty kopecs for the perestroika." Reluctantly, the customer gives the bartender a ruble, and is surprised when the bartender gives him back fifty kopecs and says, "We are out of beer."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1268, 'Bar jokes beer booze and fun', 'A Scotsman is sitting in a bar in Cuba and is minding his business when a man with a large black beard walks in. The man goes to the bar and orders a shot of whisky. The bartender serves him, the man drinks the whisky then starts walking out the door. The bartender says, "Hey arent you going to pay for that?" The man says, "Excuse me, Castros Army." The bartender says, "Alright then" and the man leaves.A few minutes later another man with a large black beard walks in. The man goes to the bar and orders a shot of whisky. The bartender serves him, the man drinks the whisky then starts walking out the door. The bartender says, "Hey arent you going to pay for that?" The man says, "Excuse me, Castros Army." The bartender says "Alright then" and the man leaves.The Scotsman gets an idea and walks up to the bar and orders a shot of whisky. He drinks the whisky then start s walking out the door. The bartender says, "Hey arent you going to pay for that?" The Scotsman says, "Excuse me, Castros Army." The bartender says, "Hey where is your big black beard?" The Scotsman thinks quickly. He lifts his Kilt and says, "Secret Service!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1269, 'Bar jokes beer booze and fun', 'A guy goes up to this girl in a bar and says, "Would you like to dance?"The girl says, "I dont like this song, but even if I did, I wouldnt dance with you."The guy says, "Im sorry, you must have misunderstood me, I said you look fat in those pants."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1270, 'Bar jokes beer booze and fun', 'Marley stopped at the town barbershop for a haircut. After thirty-five minutes of snipping and cutting, the barber held a mirror behind Marleys head."How you like it?" asked the barber. "Real fine," said the redneck. "But how bout making it a little longer in the back?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
