INSERT INTO `jokes` VALUES (1273, 'Bar jokes beer booze and fun', 'An angry wife was complaining about her husband spending so much time at the pub, so one night he took her along."Whatll ya have?" he asked."Oh, I dont know. The same as you, I suppose," she replied.So the husband ordered a couple of Jack Daniels and threw his down in one gulp.His wife watched him, then took a sip from her glass and immediately spit it out. "Yuck, thats nasty poison!" she spluttered. "I dont know how you can drink this stuff!""Well, there you go," cried the husband. "And you think Im out enjoying myself every night!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
