INSERT INTO `jokes` VALUES (1352, 'Bath jokes', 'Robot: I have to dry my feet carefully after a bath. Monster: Why? Robot: Otherwise I get rusty nails.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1353, 'Bath jokes', 'Dr Frankenstein: Ive just invented something that everyone in the world will want! You know how you get a nasty ring around the bathtub every time you use it, and you have to clean the ring off? Igor: Yes, I hate it. Dr Frankenstein: Well, you need never have a bathtub ring again! Ive invented the square tub . . .', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1354, 'Bath jokes', 'Did you hear about the idiot who had a new bath put in? The plumber said, "Would you like a plug for it?" The idiot replied, "Oh, I didnt know it was electric."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1355, 'Bath jokes', 'Hotel guest: Can you give me a room and a bath, please? Porter: I can give you a room, but youll have to wash yourself.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1356, 'Bath jokes', 'Mom: Joe, time for your medicine. Joe: Ill run the bath then.Mom: Why? Joe: Because on the bottle it says "to be taken in water."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1357, 'Bath jokes', 'Does your brother keep himself clean? Oh, yes. He takes a bath every month whether he needs one or not.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1358, 'Bath jokes', 'Doctor: Your system needs freshening up a bit. I suggest you take a cold bath every morning. Patient: Oh, but I do, doctor. Doctor: You do? Patient: Yes, every morning I take a nice cold bath and fill it with nice hot water!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1359, 'Bath jokes', 'Doctor: The best time to take a bath is before retiring. Patient: You mean I dont need another bath until Im sixty-five?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1360, 'Bath jokes', 'Why did the bank robber take a bath? So he could make a clean getaway.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1361, 'Bath jokes', 'Adam: How did Mummy know you hadnt had a bath? Eve: I forgot to dirty the towel, wet the soap and flood the bathroom.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1362, 'Bath jokes', 'Nick: Can you tell me the way to Bath? Rick: I use soap and water, personally.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1363, 'Bath jokes', 'Are you going to take a bath? No, Im leaving it where it is.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1364, 'Bath jokes', 'My mother says I look just like an animal when Im in the bath - a little bear.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1365, 'Bath jokes', 'Mum, does God use the bathroom? No, what a funny question! Then why did Dad say this morning, Oh, God, are you still in there?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1366, 'Bath jokes', 'Two small time thieves had been sent by the Big Boss to steal a van load of goods from a bathroom suppliers. One stayed in the van as look out and the other went into the storeroom. Fifteen minutes went by, then half an hour, then an hour, and no sign of him. The look out finally grew impatient and went to look for his partner. Inside the store the two came face to face. "Where have you been?" demanded the worried look out. "The boss told me to take a bath, but I couldnt find the soap and a towel."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1367, 'Bath jokes', 'Whats the difference between a peeping Tom and someone whos just got out of the bath?One is rude and nosey. The other is nude and rosey!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1368, 'Bath jokes', 'Stan: I won 92 goldfish.Fred: Where are you going to keep them ?Stan: In the bathroomFred: But what will you do when you want to take a bath ?Stan: Blindfold them !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1369, 'Bath jokes', 'May: What position does your brother play in the school football team ?Jay: I think hes one of the drawbacks !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1370, 'Bath jokes', 'Ned: Boy! Was I ever in hot water last night !Ed: You were? What did you do ?Ned: I took a bath !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1371, 'Bath jokes', 'A man walked into a lodge in Yellowstone National Park. Can you give me a room and bath? he asked the clerk.I can give you a room, the clerk said. But youll have to take the bath by yourself!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
