INSERT INTO `jokes` VALUES (1384, 'Beauty jokes', 'First Witch: I went to the beauty parlor yesterday. I was there for three hours. Second Witch: Oh, what did you have done? First witch: Nothing, I was just going in for an estimate.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
