INSERT INTO `jokes` VALUES (1388, 'Beauty jokes', 'A witch went into a beauty parlor and asked the assistant how much it would cost to make her look like a film star. "Nothing," replied the assistant. "Nothing?" she asked, "but how can I look like a film star?" "Havent you seen a film called The Creature from the Black Lagoon?" replied the assistant.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1389, 'Beauty jokes', 'A monster went to the doctor with a branch growing out of his head."Hmmm," said the doctor. "Ive no idea what it is." The next week the branch was covered in leaves and blossom. "Im stumped," said the doctor, "but you can try taking these pills." When the monster came back a month later the branch had grown into a tree, and just a few weeks later he developed a small pond, surrounded by trees and bushes, all of them on top of his head. "Ah!" said the doctor, "I know what it is. Youve got a beauty spot."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1390, 'Beauty jokes', 'Ive just come back from the beauty parlour. Pity it was closed!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
