INSERT INTO `jokes` VALUES (1396, 'Beauty jokes', 'Did you hear about the witch who did a four year course in ugliness? She finished it in two.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1397, 'Beauty jokes', 'What is yellow and goes click-click? A ball-point banana.Witch: Will I lose my looks as I get older? Wizard: With luck, yes. Witch:', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1398, 'Beauty jokes', 'A little boy came running into the kitchen. Dad, dad he said, theres a monster at the door with a really ugly faceTell him youve already got one, said his father !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1399, 'Beauty jokes', '"My boyfriend says I look like a dishy Italian!"said Miss Conceited.Then hes right said her little brother.Sophia Loren?"No-spaghetti!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1400, 'Beauty jokes', 'A woman went to a sweet store to buy some sweets. The boy behind the counter said "Gosh, your ugly arent you?, Ive never seen anyone so hideous as you before""Young man" she replied. " I didnt come here to be insulted""Really", he said, "Where do you usually go ?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1401, 'Beauty jokes', 'Little Johnny and his mother were on a train. Johnny leant over and started to whisper in his mothers ear.Johnny, how many times have I told you, said his mother,  its rude to whisper. If you have something to say, say it out loud.OK, said Johnny, why does the lady over there look like an ugly, haggard old witch ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1402, 'Beauty jokes', 'Girlfriend: Will you love me when Im old and fat and ugly?Boyfriend: Of course I do !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1403, 'Beauty jokes', 'Mary: Do you think my sisters pretty ?Gary: Well, lets just say if you pulled her pigtail shed probably say oink, oink !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1404, 'Beauty jokes', 'Did you hear about the girl monster who wasnt pretty and wasnt ugly ?She was pretty ugly', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1405, 'Beauty jokes', 'Shes the kind of girl that boys look at twice - they cant believe it the first time.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1406, 'Beauty jokes', 'Bill: My sister has lovely long red hair all down her back.Will: Pity its not on her head.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1407, 'Beauty jokes', 'Julie had broken off her engagement. Her friend asked her what had happened. I thought it was love at first sight, said Julie. It was, but it was the second and third sights that changed my mind.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1408, 'Beauty jokes', 'Beautician: Did that mud pack I gave you for your girlfriend improve her appearance ?Man: It did for a while - then it fell off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1409, 'Beauty jokes', 'Two teenage boys were talking in the classroom. One said, I took my girlfriend to see The bride of Dracula last night.Oh yeah, said the other,  what was she like ?Well she was about six foot six, white as a ghost and she had big red staring eyes and fangs.The other said, Yes, but what was The Bride of Dracula like ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1410, 'Beauty jokes', 'I cant understand why people say my girlfriends legs look like matchsticks. They do look like sticks - but they certainly dont match.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
