INSERT INTO `jokes` VALUES (1416, 'Beauty jokes', 'Monster: Im so ugly. Ghost: Its not that bad! Monster: It is! When my grandfather was born they passed out cigars. When my father was born they just passed out cigarettes. When I was born they simply passed out.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1417, 'Bed jokes', 'Doctor, doctor, Im having difficulty sleeping. Doctor: Well maybe its your bed. Oh, Im all right at night, its in the day I have problems.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1418, 'Bed jokes', 'Doctor, doctor, I keep dreaming there are great, gooey, bug-eyed monsters playing tiddley winks under my bed. What shall I do? Hide the tiddley winks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1419, 'Bed jokes', 'Witch: Doctor, doctor, I dont feel well. Doctor: Dont worry, youll just have to go to bed for a spell.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1420, 'Bed jokes', 'The hotel we stayed in for our holiday offered bed and board, but it was impossible to say which was the bed and which was the board.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1421, 'Bed jokes', 'A little boy came downstairs crying late one night. "Whats wrong?" asked his mother. "Do people really come from dust, like they said in church?" he sobbed. "In a way they do," said his mother. "And when they die so they turn back to dust?" "Yes, they do." The little boy began to cry again. "Well, under my bed theres someone either coming or going."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1422, 'Bed jokes', 'Two friends who lived in the town were chatting. "Ive just bought a pig," said the first. "But where will you keep it?" said the second. "Your yards much too small for a pig!" "Im going to keep it under my bed," replied his friend. "But what about the smell?" "Hell soon get used to that."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1423, 'Bed jokes', 'When Mr Maxwells wife left him, he couldnt sleep. Why was that? She had taken the bed.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1424, 'Bed jokes', 'Why did the composer spend all his time in bed? He wrote sheet music.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1425, 'Bed jokes', 'I dont think my Mom knows much about children. Why do you say that? Because she always puts me to bed when Im wide awake, and gets me up when Im sleepy!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1426, 'Bed jokes', 'I was once in a play called Breakfast In Bed. Did you have a big role?No, just toast and marmalade.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1427, 'Bed jokes', 'Did you hear about the granny who plugged her electric blanket into the toaster by mistake? She spent the night popping out of bed.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1428, 'Bed jokes', 'What is the softest bed for a baby to sleep on? Cot-on-wool.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1429, 'Bed jokes', 'You cant have any more chocolates tonight. Its not good for you to go to bed on a full stomach. Oh, Mum. I promise Ill lay on my side.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1430, 'Bed jokes', 'Id like to buy a bed, please. Certainly, madam. Spring mattress?Oh, no! I want to be able to use it all year.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1431, 'Bed jokes', 'Three boys were sharing the same bed on holiday, but it was so crowded that one of them decided to sleep on the floor. After a while, one of his friends told him he might as well get in to bed again. Theres lots of room now, he said.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1432, 'Bed jokes', 'How can you shorten a bed? Dont sleep long in it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1433, 'Bed jokes', 'Id love you to stay the night, but Im afraid youll have to make your own bed. Oh, thats all right, I dont mind at all.Right. Heres a hammer, a saw, and some nails. The woods in the garage. I have four legs, but only one foot. What am I? A bed', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1434, 'Bed jokes', 'A neighbour bumped into Jenny playing outside her house after dark. Hello, Jenny, said the neighbour. Isnt it time for little girls to be in bed? How would I know? asked Jenny. I havent got any little girls.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1435, 'Bed jokes', 'Why did the girl put her bed in the fireplace? Because she wanted to sleep like a log.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1436, 'Bed jokes', 'Why do people go to bed? Because the bed wont come to them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1437, 'Bed jokes', 'Shall I tell you the joke about the bed? No, because it hasnt been made up yet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1438, 'Bed jokes', 'Why did the bed spread?Because it saw the pillow slip.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1439, 'Bed jokes', 'Mother: Did you make your bed today?Daughter: Yes, Mom, but I think it would be easier to buy one.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1440, 'Bed jokes', 'Why does your brother wear a life jacket in bed?Because he sleeps on a waterbed !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1441, 'Bed jokes', 'Why did your sister keep running around her bed ?Because she was trying to catch up with her sleep.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1442, 'Bed jokes', 'Why did the girl take a ruler to bed?She wanted to see how long she slept.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1443, 'Bed jokes', 'What animal always goes to bed with its shoes on ? A horse !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1444, 'Bed jokes', 'Counselor: How many times did I tell you to make your bed?Jane: I cant answer. I didnt know I was supposed to keep count!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1445, 'Bed jokes', 'Sonny: I cant sleep. What should I do?Counselor: Lie near the edge of the bed. That way youll be sure to drop off!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1446, 'Bed jokes', 'Why are rivers lazy?Because they never get off their beds.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1447, 'Bed jokes', 'Why do you go to bed?Because the bed will not come to you.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1448, 'Bed jokes', 'Why shouldnt you believe a person in bed?Because he is lying.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1449, 'Bed jokes', 'How can you shorten a bed?Dont sleep long in it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1450, 'Bed jokes', 'When does a bed grow longer?At night, because two feet are added to it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1451, 'Bed jokes', 'When is your mind like a rumpled bed?When it isnt made up yet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1452, 'Bed jokes', 'Why did the kid punch the bed?His mother told him to hit the hay.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1453, 'Bed jokes', 'Why did the boy take the ruler to bed?He wanted to see how long he slept.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1454, 'Bed jokes', 'Why did the man take a pencil to bed ?To draw the curtains !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1455, 'Bed jokes', 'I woke up, went for a walk, my head fell off and rolled away. I picked it up and put it on. A child walked up to me and said: "Good grief, where are your feet?" I must have left them in bed !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1456, 'Bed jokes', 'Knock KnockWhos there !Bed !Bed who ?Bed you cant guess who I am!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1457, 'Bed jokes', 'What should you do if you find a 500-pound dog asleep on your bed?Sleep on the sofa.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1458, 'Bed jokes', 'How do you know when there is an elephant under your bed ?When your nose touches the ceiling !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1459, 'Bed jokes', 'What do tigers wear in bed ? Stripey pyjamas !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1460, 'Bicycle jokes', 'Romeo: Your cheeks are like petals. Juliet: Really? Romeo: Yes, bicycle pedals.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1461, 'Bicycle jokes', 'Which is the cheapest bicycle you can buy? A penny-farthing.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1462, 'Bicycle jokes', 'What did the silly boy take his bicycle to bed with him? Because he didnt want to walk in his sleep.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1463, 'Bicycle jokes', 'Why couldnt the bicycle stand up for itself? Because it was two-tyred.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1464, 'Bicycle jokes', 'A little boy out riding his bicycle knocked down an old lady. She was a bit shaken, but got up, dusted herself off, then turned to the little boy and said, Dont you know how to ride a bike?Yes, he answered, but I dont know how to ring the bell yet', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1465, 'Bicycle jokes', 'Jack and Jill were riding a tandem up a hill, but making heavy weather of it. At the top, Jack said: I didnt think wed make it! Jill replied, Nor did I - what a good thing I kept the brakes on, or wed have slid all the way back down!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1466, 'Bicycle jokes', 'I went on a long bicycle ride yesterday. Farcical?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1467, 'Bicycle jokes', 'Whats the hardest thing about learning to ride a bicycle? The road.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1468, 'Bicycle jokes', 'Johnny was racing around the garden on his new bicycle and called out to his mother to watch his tricks. Look, Mum! No hands! Look, Mum! No feet! Waaah! Look, Mum! No teeth!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1469, 'Bicycle jokes', 'Our bank manager cant ride a bike any more. Why not? He lost his balance.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1470, 'Bicycle jokes', 'The school teacher was furious when Brad knocked him down with his new bicycle in the school yard. "Dont you know how to ride that yet?" he roared. "Oh yes!" shouted Brad over his shoulder. "Its the bell I cant work yet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1471, 'Bicycle jokes', 'Q: How many bikers does it take to change a light bulb? A: It takes two. One to change the bulb, and the other to kick the switch.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1472, 'Bicycle jokes', 'The cyclist, passing a pedestrian crossing, runs into a man, and they both fall down. -"Geez, are you lucky." The cyclist says. -"What do you mean by lucky ?" The pedestrian angrily asks. "I got hurt really bad." -"Ah, youre lucky because I recently lost my license. I usually drive a bus."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1473, 'Bicycle jokes', 'A math student who used to come to the university on foot every day arrives one day on a fancy new bicycle. "Where did you get the bike from?" his friends want to know. "Its a `thank you present", he explains, "from that freshman girl Ive been tutoring. But the story is kind of weird..." "Tell us!" "Well", he starts, "yesterday she called me on the phone and told me that she had passed her math final and that she wanted to drop by to thank me in person. As usual, she arrived at my place riding her bicycle. But when I had let her in, she suddenly took all her clothes off, lay down on my bed, smiled at me, and said: `You can get from me whatever you desire!" One of his friends remarks: "You made a really smart choice when you took the bicycle." "Yeah", another friend adds, "just imagine how silly you would have looked in a girls clothes - and they wouldnt have fit you anyway!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1474, 'Bicycle jokes', 'When is a bicycle not a bicycle?When it turns into a driveway.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1475, 'Bicycle jokes', 'Why cant a bicycle stand up by itself?Because it is two-tired (too tired).', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1476, 'Bicycle jokes', 'Why cant an elephant ride a bicycle?Because he doesnt have a thumb to ring the bell.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1477, 'Bicycle jokes', 'Which Elizabethan sailor could stop bikes ?Sir Francis Brake !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1478, 'Bicycle jokes', 'What do you call a woman with a bicycle on her head ?Petal !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1479, 'Bicycle jokes', 'What do you get if you cross a bike and a rose ?Bicycle petals !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1480, 'Bicycle jokes', 'What do you get if you cross a chemical and a bicycle ?Bike carbonate of soda !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1481, 'Bicycle jokes', 'What did the bicycle call its dad?Pop-cycle', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1482, 'Bicycle jokes', 'Q: Why do bikes have kick-stands? A: Because theyre two-tired.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1483, 'Biologist jokes', 'While driving down a steep and curvy logging road, a group of biologists loose control of their 4-wd "Jimmy" and careen down the hill. The truck piles up at the bottom of the canyon, and everyone aboard perishes. Suprisingly, they all go to heaven. At an orientation they are asked, "When you are in your casket and your friends and family are mourning about your death, what would you like to hear them say about you?"The first guy, a well known botanist says, "I would like to hear them say that I was one of the greatest botanists of my time, and left an eternal contribution to the botanical world."The second guy, an ornithologist, says, "I would like to hear that I was a wonderful birder and made a huge difference in the recovery of our bird populations."The last guy, a scruffy mammalogist, replies, "I would like to hear them say... LOOK, HES MOVING!!! "', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1484, 'Biologist jokes', 'A young college student had stayed up all night studying for his zoology test the next day. As he entered the classroom, he saw ten stands with ten birds on them with a sack over each bird and only the legs showing. He sat right on the front row because he wanted to do the best job possible. The professor announced that the test would be to look at each set of bird legs and give the common name, habitat, genus, species, etc.The student looked at each set of bird legs. They all looked the same to him. He began to get upset. He had stayed up all night studying, and now had to identify birds by their legs. The more he thought about it, the madder he got. Finally, he could stand it no longer. He went up to the professors desk and said, "What a stupid test! How could anyone tell the difference between birds by looking at their legs?" With that the student threw his test on the professors desk an d walked out the door.The professor was surprised. The class was so big that he didnt know every students name, so as the student reached the door the professor called, "Mister, whats your name?"The enraged student pulled up his pant legs and said, "You guess, buddy! You guess!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1485, 'Biologist jokes', 'How many evolutionists does it take to change a light bulb?Only one, but it takes eight million years.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1486, 'Biologist jokes', 'How many biologists does it take to change a light bulb?Four. One to change it and three to write the environmental-impact statement.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1487, 'Biologist jokes', 'A young wildlife biologist got fired from his first real wildlife job. Upon his return home, his parents asked him what happened."You know what a crew boss is?" he asked. "The one who stands around and watches everyone else work." "Whats that got to do with it?" they asked. "Well, he just got jealous of me," the young biologist explained. "Everyone thought I was the crew boss."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1488, 'Biologist jokes', 'A pair of biologists are studying terns on a rock island just off the coast. While walking on a distant part of the island, they are shot at by a group of thugs operating a pot farm. This happens several times and the local law enforcement refuses to investigate.On their last day on the island they happen into a huge pile of harvested grass that has been set out to dry. Quickly they decide to set it on fire to pay the thugs back for shooting at them. The fire takes off and sends plumes of smoke into the sky. As they are running for their boat, they notice that the soaring birds are acting weird, spiraling out of control and crashing into the trees.The next day they read the headlines in the local paper:Pot Farm Burns - No Tern Left Unstoned.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1489, 'Biologist jokes', 'A wildlife biologist crew leader has several crews, each consisting of two biologists. The crews camped and worked in the woods and he made his rounds to visit each pair every few days. One particular crew, Sarah and Jim, were not getting nearly as much work accomplished as the others, so he suspected that they might be up to some funny business. The following day, he paid them a visit."Is anything funny going on here"? he asked."What do you mean by that?" the pair asked back."I mean, youre not getting much fieldwork done. Are you two, you know, maybe doing something youre not supposed to do?""Absolutely not!" the Jim replied. " We are strictly co-workers""Oh yes," the Sarah replied, " We hike all day, record our data, return back, and fall asleep exhausted."Thats right!" Jim replied, "and me in my tent, and she in hers!"The crew supervisor spent the remainder of the day in th e field with the pair. He left the field early, returned to camp, retrieved his Jeep and left the area.The following day, the biologist pair had lost their $1000 GPS unit. They searched high and low, but could not find it. It had simply disappeared from their camp. After a few frantic days, they suspected that the crew leader had taken it. It was the only plausible explanation. That evening, they called him on the 2-way radio, and politely asked weather he may have inadvertently taken the unit."As a matter of fact, I did take it the day I came up to see if you two were sleeping together. After realizing I had accidentally taken it with me from the field, I placed it in Sarahs sleeping bag where she would be sure to find it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1490, 'Biologist jokes', 'Dan had been studying whales for over 20 years and had made some thrilling breakthroughs regarding their communication. He had managed to decode many of their underwater sounds and to translate them into English. His latest research had proved that they can communicate over a distance of 300 miles. When asked what could they possibly have to say at such distances he replied, "As best as we can figure, it is something like - Hey, can you hear me now?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1491, 'Biologist jokes', 'Ben was assigned a new wildlife technician and she was driving him crazy. She was blonde and pretty and insisted on carrying beauty products in a little field bag - nail polish, hair care products, gels, creams and so on. One day they were driving the rugged four-wheel drive down a dirt road when a big rabbit ran in front of them and was hit by the truck. Ben pulls over and walks back to the dead rabbit. He felt terrible, but there was clearly nothing he could do for the dead creature. His blonde partner pipes in and yells, "Waite, I have just the thing!"She races back to the truck and begins to rifle through her beauty products. Ben watches as brushes and combs fly from the bag. Finally she races back with an aerosol can and sprays the dead rabbit with its contents. Immediately the rabbit springs to its feet, waves goodbye, hops a few feet, pauses and waves again. The rabbit repe ats this strange behavior...wave-hop-wave-hop, until it disappears over the hill.Ben is amazed and asks, "What in the world is in that can?"The blonde biologists says, " Duh...look at the label"You guessed it.... "Hair Spray .... Immediately revives dead hair and creates a permanent wave"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1492, 'Biologist jokes', 'A logger is driving down the highway and sees two botanists trying to measure the height of a small pine tree. Their tape measure is not long enough so one botanist stands on the shoulders of the other and attempts to extend the tape to the tree top but it is not long enough. While trying, he falls to the ground. They attempt this about five times and each time the top botanist falls. The logger is laughing but feels sorry for the pair, gets out of his truck, takes out an electric saw and cuts down the tree. The botanists are looking at him like he is crazy. He then takes a tape measure and measures the tree. "OK guys, the tree is 14 6." He then gets in his truck and drives away. The two botanists are stunned and speechless. Finally one says to the other ,"How do you like that, we are trying to measure the height of the tree and that stupid jerk measures the width."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1493, 'Biologist jokes', 'Garvin the mammalogist, was in Alaska studying polar bear. In sub-zero weather, he would spend 7 days out on the ice. But, after his 7 days in the field, he would return to the small town and spend a day or two resting up and drinking in the only bar in town. On one particular day it was 40 below zero and Garvin made his way into the bar. He asked Bud, the bartender, for a whiskey. "I dont know, Garvin, you sure have run-up a big bill in here." The bartender told him." I know," Garvin replied, "But Im flat broke, and I sure could use a drink."OK," The barkeep told him, "Ill just write your tab down on the piece of paper and pin it up here by the coat rack.""Oh no, dont do that, I dont want everyone in town to see it."Dont worry," The bartender replied, "Im going to cover it up with your parka until its paid!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1494, 'Biologist jokes', 'An 8th grade boy was doing some research for his career report at school. He asks his dad, "Father, how many wildlife biologists work for the Federal Government?""The honest father replies, "Oh, I would say at least half of em."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1495, 'Biologist jokes', 'A University had advertised for two biologists to help in their mammalogy department, specifically with a group of captive grizzly bears. They had only two applicants - a beautiful young women biologist and an older male biologist.The mammalogist in charge of the project knew that not everyone can handle working with such fierce creatures so he decided to test their skills with the bears. The two hopefuls followed him out to the bear pen. He first asked the young women to show him what she could do. She entered the cage, stripped down to her bikini, and the largest bear walked up and nuzzled her bare legs. The astonished mammalogist then said to the old man, "Can you do that?" "Youre darn right I can," said the old man, "just get that bear out of there first !"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1496, 'Biologist jokes', 'A wildlife biologist is working in the woods, miles from the nearest town. Hes camped alone with his dog and cat as his companions. Suddenly, an old gentleman carrying a small limp dog, franticly runs into his camp. "Please, please help me! I think something has happened to Willie. Our Winnebago is parked just around the bend and weve seen you camped here. We didnt know what to do. We thought of you because we had seen all this scientific equipment laying around here. Can you help him?"" Sir, Im not a vet, Im a wildlife biologist," the young biologist told the worried man."Can you please just have a look at him, Ill pay you anything you need. I just need to know. If hes still alive, maybe I can rush him into town.""Ok, put him here on the table." The young biologist looks the limp dog over, but its plain that the dog is dead,, no pulse or signs of breathing."Im sorry  sir, but Im afraid poor Willie is dead." "No, I cant believe that..... It cant be true...are you sure?""Yes, Im quite sure.""I just cant believe that....With all this equipment, isnt there something you can do? I must be absolutely sure."The biologist called his big yellow cat over to the table. The cat walked around the dead dog, occasionally sniffing at the carcass. He then looks up at the biologist and let out a few weak meows."Well, the cat say hes dead. Does that assure you?""No, I need more than that...Do you have anything else?"The biologist calls over his big black dog. The dog circles the body a few times, sniffing it every now and then. After a few moments, the dog barks at the biologist."Well, now the dog says hes dead. Thats all I can do for you sir.""OK, well I guess its true. Ill take him back and bury him...How much do I owe you?""Itll be $650 bucks." The biologist tells  the old man."What??", replied the old man, "How can you charge that much??!!""Well sir, I could have told you he was dead for only a dollar, but youre the one that insisted on the cat scan and the lab tests!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1497, 'Biologist jokes', 'A young biologist was sitting on a stump at the edge of their camp. On his face was the saddest hangdog expression. One of the other biologists saw his sad looks and asked, "Whats the matter?"The young biologist said, "They put me in the same tent with old Doctor Perkins. He snores all night, takes a bath once a month, and talks non-stop about back when he studied passenger pigeons. Hes so damn old, I think he was a lackey for Charles Darwin. He generally just makes my life Hell. We had a big fight about it and they split us up for a month"The older biologist said, "That should make you happy." The young biologist sadly shook his head and said, "Not when the month is up today!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1498, 'Biologist jokes', 'There were these two Engineers who decided they would go moose hunting in the backwoods of British Columbia. As it happened, they lucked out and got a moose. Unfortunately, they were about a mile from their truck. They were having a tough time dragging the animal by the hind legs when a Wildlife Biologist happened upon them.He said, "You know, the hair follicles on a moose have a grain to themthat causes the hair to lie toward the back. The way you are dragging thatmoose, it increases your coefficient of friction by a huge margin. If yougrab it by the antlers and pull, you will find the work required to be quiteminimal." The Engineers thanked him and started dragging the moose by the antlers. After about an hour, one Engineer said, "I cant believe how easy it is to move this moose this way. I sure am glad we ran across that Biologist.""Yeah.", said the other. "But we re getting further and further away from our truck."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1499, 'Biologist jokes', 'A biologist from the North Pole was showing a new recruit the ropes of a polar bear radio tracking program. The new recruit said, "I know how the transmitters work, but I have one question--how do you catch the polar bears in the first place?" "I bet you use high-powered tranquilizer dart guns, right?""Oh no!" the experienced biologist replied, "we use an ancient Eskimo technique, developed centuries ago. First, we dig a huge hole in the ice. Next, we place a circle of green peas all the way around the hole. Then, we go hide behind some ice blocks and wait. Finally, when a polar bear comes up to take a pea, we kick him in the ice-hole !!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1500, 'Biologist jokes', 'A group of goose biologists were meeting to brainstorm about the migration tactics of Canada geese. They were particularly interested in applying for a $100,000 Federal grant to investigate the "V" formation of goose flight. It had been observed that one side of the "V" is always longer than the other side. This group would put together a research proposal to apply for the $100,000 grant and hopefully find out why this happens.To start off the discussion, Todd, the Consulting Firm Biologist stands up and says in typical consultant fashion, "I say we ask for $200,000, and attempt to model the wind drag coefficients. We can have our geologists record and map the ground topography and then our staff meteorologists can predict potential updraft currents. Our internal CAD department can then produce 3-d drawings of the predicted wing tip vortices. Then, after several years of study, our in-house  publications department could produce a nice thick report full of charts and graphs."The Senior Research Biologist, a professor at the local university, cleared his throat and responded, "No, no!, Thats not it at all. We only need $150,000. We can train a group of domesticated geese to fly in formations of equal length and then compare their relative fitness to wild geese. We can then publish the results in the Journal of Wildlife Management. About then, the hardworking field biologist stands up and begins walking for the door. "Where are you going?" the group asks. "Im leaving" he replies, "Ive heard enough. No one has to give me $100,000 to find out that the reason one side of the "V" is longer is simply because there are more damn geese on that side!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1501, 'Biologist jokes', 'A biologist had been working on a remote research project in the Amazon jungle. Upon his return to the States, he came down with a terrible illness. After his health had deteriorated, his wife took him to a doctor who specialized in strange jungle diseases. The doctor gave him a complete examination and a series of tests. After receiving the results of the tests, the doctor called the wife into his office alone. He told the young biologists wife, "Your husband is suffering from a very severe disease, combined with horrible stress. If you dont do the following, your husband will surely die." "Each morning, fix him a healthy breakfast. Be pleasant, and make sure he is in a good mood. For lunch make him a nutritious meal. For dinner prepare an especially nice meal for him. Dont burden him with chores, and generally do anything he asks. Dont discuss your problems with him, as it will only make  his stress worse. And most importantly, make love with your husband several times a week and satisfy his every whim. " If you can do this for the next 10 months or so, I think your husband will regain his health completely. Otherwise.......well... Hell probably die"On the way home, the husband asked his wife. "What did the doctor say?" she replied. "Honey.....he says youre probably going to die."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1502, 'Biologist jokes', 'An old mountain man in Arkansas was sick and bedridden. He had not been outdoors for a few weeks and had a sharp craving for a meal of wild squirrel. He summoned his half-idiot son into the room and instructed him to go squirrel hunting and bring him back a squirrel or two. He also told his son to be very careful not to shoot the squirrel in the head as he would need its brains later to "tan" the squirrels pelt. (Tanning a skin using the animals brains is a common practice in certain areas, it generally takes about one brain to tan one skin).The idiot son spent most of the day searching the woods for tree squirrels, but was not having any luck. Finally, high up in a sweet-gum tree, he spotted a squirrels head sticking out from a hole. He remembered his Pas admonitions to save the brains. After deciding he may not have another chance, he shot it in the head, thus ruining the brains. r\nHis sick Pa was upset, "I cant tan that skin without no brains!" he said, "Now what am I a gonna do?" Thinking quickly, he remembered that up on the river there were 3 fisheries biologists doing some field work."Well, were only tanning one squirrel skin, walk up the river and shoot one of them dang fish biologists and Ill use his brains to tan the skin," he told the son. The son did as he was told and soon returned with the prize. As it turned out, the brain wasnt large enough and the boy was upset as he would have to make another trip to harvest the other two biologists brains."Look on the bright side, boy", the old man told him, "Two more ought to be just enough. Wed have been in real trouble if they was BOTANISTS!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
