INSERT INTO `jokes` VALUES (1509, 'Bird jokes', 'Late one night, a burglar broke into a house he thought was empty. He tiptoed through the living room but suddenly he froze in his tracks when he heard a loud voice say: "Jesus is watching you!" Silence returned to the house, so the burglar crept forward again. "Jesus is watching you," the voice boomed again. The burglar stopped dead again. He was frightened. Frantically, he looked all around. In a dark corner, he spotted a bird cage and in the cage was a parrot. He asked the parrot: "Was that you who said Jesus is watching me?" "Yes", said the parrot. The burglar breathed a sigh of relief, and asked the parrot: "Whats your name?" "Clarence," said the bird. "Thats a dumb name for a parrot," sneered the burglar. "What idiot named you Clarence?" The parrot said, "The same idiot who named the Rottweiller Jesus."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
