INSERT INTO `jokes` VALUES (1646, 'Bird jokes', 'A couple of pigeons made a date to meet on the ledge outside the tenth floor of a skyscraper. The female was there on time, but the male arrived an hour late. "Where were you? I was worried sick.""It was such nice day, I decided to walk."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1647, 'Bird jokes', '"Look at that speed!" said one hawk to another as the jet fighter plane hurtled over their heads."Hmph!" snorted the other. "You would fly fast too if your tail was on fire!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1648, 'Birthday jokes', 'Good news! Ive been given a goldfish for my birthday. . .the bad news is that I dont get the bowl until my next birthday!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1649, 'Birthday jokes', 'The housewife answered a knock on the door and found a total stranger standing on the doorstep. "Excuse me for disturbing you, maam," he said politely, "but I pass your house every morning on my way to work, and Ive noticed that every day you appear to be hitting your son on the head with a loaf of bread.""Thats right." "Every day you hit him on the head with a loaf of bread, and yet this morning you were beating him with a chocolate cake." "Well, today is his birthday."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1650, 'Birthday jokes', 'Fred: Have you noticed that your mother smells a bit funny these days? Harry: No. Why? Fred: Well, your sister told me she was giving her a bottle of toilet water for her birthday.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1651, 'Birthday jokes', 'Fred: I was going to buy you a handkerchief for your birthday. Harry: That was a kind thought. But why didnt you? Fred: I couldnt find one big enough for your nose.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1652, 'Birthday jokes', 'Id like to say something nice about you as its your birthday. Why dont you? Because I cant think of a single thing to say!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1653, 'Birthday jokes', 'A kindly old lady came across a little boy sitting on the pavement crying his eyes out. Whats the matter? she asked. Its my birthday! he hollered. And I had a bicycle and a new tracksuit and this afternoon theres to be a party with crisps and jelly and a birthday cake and a disco afterwards. . . and he had to stop talking because he was crying so hard. But thats lovely, said the old lady. Why are you crying? Because Im lost!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1654, 'Birthday jokes', 'What did you get for your birthday? Another year!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1655, 'Birthday jokes', 'When is your birthday? 17th January. What year? Every year!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1656, 'Birthday jokes', 'Sams girlfriends birthday was the same day as his fathers. He bought his girlfriend a bottle of perfume and his father a pistol. He wrapped the perfume and wrote a note to his girlfriend, saying, Use this all over yourself and think of me. Unfortunately he put the note on his fathers present.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1657, 'Birthday jokes', 'Something happened to me yesterday that will never, ever, happen to me again. How can you be so sure? I was 10 years old yesterday.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1658, 'Birthday jokes', 'How old were you on your last birthday? Eight. And how old will you be on your next birthday? Ten. Oh, I dont think thats possible. Oh, yes it is - Im nine today.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1659, 'Birthday jokes', 'Grandma, is it exciting being 99? It certainly is! If I wasnt 99 Id be dead.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1660, 'Birthday jokes', 'I forgot my brothers birthday last month. What did he say? Rick: Nothing, yet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1661, 'Birthday jokes', 'Will you come to my party on Saturday? Yes, please, Whats the address? 25 The High Street. Just push the bell with your elbow. Why with my elbow? Well, you wont be empty-handed, will you!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1662, 'Birthday jokes', 'Ive been shopping for my wifes birthday present. What did you get her? A bottle of expensive toilet water. It cost 20. 20! Why didnt you come to my house - you could have had some of ours for free!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1663, 'Birthday jokes', 'Dad bought Mum a bone-china tea set for her birthday. How lovely!Yes, but he only did it so as not to have to do the washing-up. Mums too frightened hell break it!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1664, 'Birthday jokes', 'Whats the greatest birthday present? Hard to say - but a drum takes a lot of beating.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
