INSERT INTO `jokes` VALUES (1666, 'Birthday jokes', 'Fred: I was going to buy you a handkerchief for your birthday. Betty: That was a kind thought. But why didnt you? Fred: I couldnt find one big enough for your nose.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1667, 'Birthday jokes', 'Fred: Do you like the dictionary I bought you for your birthday? Harry: Sure. Its a great present but I just cant find the words to thank you enough.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1668, 'Birthday jokes', 'A man who forgets his wifes birthday is certain to get something to remember her by.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1669, 'Birthday jokes', 'BoyFriend: Why didnt you give me anything for my birthday?GirlFriend: You told me to surprise you.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1670, 'Birthday jokes', 'A St. Louis mother telephoned the capital building over in Jefferson City and asked to speak to the game warden. After being switched from office to office, a voice finally said, "Hello." "Are you the game warden?" she asked. "Yes." "Finally Ahve got the right person!" she said. "Could yawl gimme some help with my sons birthday party?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1671, 'Birthday jokes', '"I remember when the candle shop burned down. Everyone stood around singing Happy Birthday."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1672, 'Birthday jokes', '"Artificial intelligence is a wonderful thing.I told my computer that today is my birthday,and it said that I needed an upgrade."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1673, 'Birthday jokes', 'Joe was sitting at a bar. He was totally depressed. The bartender, serving him a drink, asked what was wrong."Ill never understand women" said Joe. "The other night on my birthday, my wife said as my gift, I could do with her what I wanted.""Wow! Thats quite some gift" said the bartender. "So why are you so dejected?""Well I thought about it for a while" said Joe, "and decided to send her home to her mother, and now she wont even speak to me!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1674, 'Birthday jokes', 'It was Grandpa Jones 100th birthday and he was still in perfect health. At his birthday party he was asked how he managed to live so long and stay so fit.He explained "I put my long life down to spending so much time out of doors. Ive been in the open air, day after day, rain or shine, for the last 75th years.""How do you manage to keep up such a rigorous fitness regime?" we asked."Its simple" he said. "When I married my wife 75 years ago, we both made solemn pledge on our wedding night. We agreed that whenever we ever had a fight, whoever was proved wrong would go outside and take long walk."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1675, 'Birthday jokes', 'What is your favourite type of birthday present? Another present!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
