INSERT INTO `jokes` VALUES (1715, 'Birthday jokes', 'The housewife answered a knock on the door and found a total stranger standing on the doorstep.Excuse me for disturbing you, maam, he said politely,  but I pass your house every morning on my way to work, and Ive noticed that every day you appear to be hitting your son on the head with a loaf of bread!Thats right.Every day you wallop him on the head with a loaf of bread, and yet this morning you were hitting him with a chocolate cake....?Well, today is his birthday!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
