INSERT INTO `jokes` VALUES (1737, 'Blind jokes', 'A snake and a rabbit were racing along a pair of intersecting forest pathways one day, when they collided at the intersection. They immediately began to argue with one another as to who was at fault for the mishap. When the snake remarked that he had been blind since birth, and thus should be given additional leeway, the rabbit said that he, too, had been blind since birth. The two animals then forgot about the collision and began commiserating concerning the problems of being blind. The snake said that his greatest regret was the loss of his identity. He had never been able to see his reflection in the water, and for that reason did not know exactly what he looked like, or even what he was. The rabbit declared that he had the same problem. Seeing a way that they could help each other, the rabbit proposed that one feel the other from head to toe, and then try to describe what the other animal w as. The snake agreed, and started by winding himself around the rabbit. After a few moments, he announced, "Youve got very soft, fuzzy fur, long ears, big rear feet, and a little fuzzy ball for a tail. I think that you must be a bunny rabbit!" The rabbit was much relieved to find his identity, and proceeded to return the favor to the snake. After feeling about the snakes body for a few minutes, he asserted, "Well, youre scaly, youre slimy, youve got beady little eyes, you squirm and slither all the time, and youve got a forked tongue. I think youre a lawyer!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1738, 'Blind jokes', 'A teacher at a school for blind kids is taking his schools soccer team to an "away game". They stop for a rest break, and to let the kids work off some energy with a little impromptu practice in a nearby pasture. The teacher is sitting in a nearby diner, explaining to another patron how it is that blind kids can play soccer. "We made a special ball, with a bell in it, so the kids can keep track of where the ball is and what its doing by listening for it. Theyre pretty good at it too." "Very clever!" remarks the other patron. Just then they are interrupted as another patron, who is looking out the window, says, "Hey! Are you the guy with those damn blind kids from the bus?" "Yes," says the teacher, stung by the way "his" kids are being refered to, "what about it? You got something against blind kids?" "Nothing, ordinarily," says the guy, still scowling out the window,  r\n"but you better get them rounded up quick! Theyre kicking the hell out of my best milk cow!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1739, 'Blind jokes', 'Two blind man at a cinema: "Can you see something ?""No"."Then lets go in front !"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
