INSERT INTO `jokes` VALUES (1741, 'Blind jokes', 'There were those three guys, a priest, a doctor and an engineer, and they were playing golf. But the group before them was extremely slow and at each hole they waited hours. Finally the priest asked around, why was that other group was so slow? He was told that they were very courageous firemen who saved the golf course a couple of years ago from a terrible fire, in which they all lost their sight. As a proof of appreciation they were given the right to play on the course whenever they wanted. They like that a lot, but being blind they are just not too good at hitting the ball, let alone finding it after its hit.The priest said, "Oh my this is terrible. Tonight Ill say a little prayer for these courageous souls."The doctor heard that and said "Dont worry. Ill send them to a friend of mine, hes an ophtalmologist and he works wonders."The engineer said "Wait. Why cant they just play at ni ght?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
