INSERT INTO `jokes` VALUES (1747, 'Blonde jokes', 'Three blondes were walking through a field when they came across a set of tracks.The first blonde looked down at the tracks and said, "I think they could be bird tracks."The second blonde went to look and said, "No, I think these are deer tracks."They stepped aside and the third blonde went over to the tracks. She looked down, then got run over by the train!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1748, 'Blonde jokes', 'A blonde was driving down the road listening to the radio and was quite upset when she heard blonde joke after blonde joke. A little way down the road, she saw another blonde out in a field rowing a boat. The blonde stopped her car and angrily jumped out yelling, "You dumb blonde bimbo! Its blondes like you that give the rest of us a bad name! If I could swim Id come out there and give you whats coming to you!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1749, 'Blonde jokes', 'A blonde and a redhead went to the bar after work for a drink, and sat on stools watching the 6 Oclock news. A man was shown threatening to jump from the Brooklyn Bridge, and the blonde bet the redhead $50 that he wouldnt jump.Sure enough, he jumped, so the blonde gave the redhead $50. The redhead said, "I cant take this, youre my friend."But the blonde insisted saying, "No. A bets a bet."Then the redhead said "Listen, I have to tell you that I saw this on the 5 Oclock news, so I cant take your money."The blonde replied "Well, so did I, but I didnt think he would jump again!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1750, 'Blonde jokes', 'A dumb blonde was really tired of being made fun of, so she decided to have her hair she would look like a brunette.When she had brown hair, she decided to take a drive in the country.After she had been driving for a while, she saw a farmer and a flock of sheep and thought, "Oh! Those sheep are so adorable!"She got out and walked over to the farmer and said, "If I can guess how many sheep you have, can I take one home?"The farmer, being a bit of a gambler himself, said she could have a try.The blonde looked at the flock and guessed, "157."The farmer was amazed - she was right! So the blonde, (who looked like a brunette), picked one out and got back into her car.Before she left, farmer walked up to her and said. "If I can guess the real color of your hair, can I have my dog back?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
