INSERT INTO `jokes` VALUES (1803, 'Blonde jokes', 'A blonde suspects that her boyfriend is cheating on her, so she goes out and buys a gun.She goes to his apartment that same day, with the gun in hand. Sure enough, when she opens the door, she finds her boyfriend in the arms of a redhead. She points the gun at her boyfriend at stares him down for a moment. Then, suddenly, shes overcome with grief, so she puts the gun up to the side her head.Her boyfriend screams, "Honey, dont do it..."The blonde yells back, "Shut up! Youre next!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1804, 'Blonde jokes', 'A blonde walks up to a Coke machine and puts in a coin. Out pops a Coke. The blonde looks amazed and runs away to get some more coins. She returns and starts feeding the machine madly and of course the machine keeps feeding out drinks.Another person walks up behind the blonde and watches her antics for a few minutes before stopping her and asking if someone else could have a go.The blonde turns around and shouts, "Cant you see Im winning!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1805, 'Blonde jokes', 'One morning this blonde calls her friend and says, "Would you mind coming over and helping me out with this killer jigsaw puzzle I bought -- I cant figure out how to get started."Her friend asks, "Whats the puzzle of?""From the picture on the box, Id guess its a tiger," replied the blonde.The friend obliges, and when he arrives the blonde greets him at the front door and then shows him the puzzle spread out all over the table.He studies the pieces for a moment, then studies the box. Then, he turns to her and says, "Im afraid that no matter what I do, Im not going to be able to show you how to assemble these to look like the picture of the tiger on the box.""Why not?" asks the disappointed blonde."Because, you didnt buy a jigsaw puzzle... what you have here is a box of Frosted Flakes."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1806, 'Blonde jokes', 'A blonde, a brunette and a redhead are stuck on an island.One day, the three of them are walking along the beach and discover a magic lamp. They rub and rub, and sure enough, out pops a genie.The genie says, "Since I can only grant three wishes, you may each have one."The brunette says, "Ive been stuck here for years. I miss my family, my husband, and my life. I just want to go home."POOF! The brunette gets her wish and she is returned to her family.Then, the red head says, "Ive been stuck here for years as well. I miss my family, my husband, and my life. I wish I could go home too."POOF! The redhead gets her wish and she is returned to her family.The blonde starts crying uncontrollably.The genie asks, "My dear, whats the matter?"The blonde whimpers, "I wish my friends were still here."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1807, 'Blonde jokes', 'A blonde is walking down the street with her blouse open, exposing one of her breasts.A nearby policeman approaches her and remarks, "Maam, are you aware that I could cite you for indecent exposure?""Why, officer?" asks the blonde."Because your blouse is open and your breast is exposed.""Oh my goodness," exclaims the blonde, "I left my baby on the bus!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1808, 'Blonde jokes', 'Q. Why was the blonde in the tree?A. Because she was raking up the leaves!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1809, 'Blonde jokes', 'A blonde comes home from a day of shopping and discovers that her house is on fire, so she calls the fire department on her cell phone. "Please state the nature of your emergency," says the operator."Help! My house is on fire!" the blonde replies."Okay, where do you live?""In a house you silly billy!" the blonde replies."No,no! How do we get there?" the operator asks fustratedly."Duh! Big Red Truck!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1810, 'Blonde jokes', 'One day 2 blondes decided to drive to Disney Land. When they saw a sign that said Disney Land left they turned around and went home.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1811, 'Blonde jokes', 'A blonde goes into a Best Buy. She asks a clerk if she can buy the TV in the corner. The clerk looks at her and says that he doesnt serve blondes, so she goes back home and dyes her hair black. The next day she returns to the store and asks the same thing and again the clerk said he doesnt serve blondes. Frustrated, the blonde goes home and dyes her hair yet again, to a shade of red. Sure that a clerk would sell her the TV this time, she returns and asks a different clerk this time. To her astonishment, this clerk also says that she doesnt serve blondes. The blonde asks the clerk, "How do you know I am a blonde?"The clerk looks at her disgustedly and says,"Thats not a TV - its a microwave."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1812, 'Blonde jokes', 'A. Why do blondes always smile during lightning storms?Q. They think their picture is being taken.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1813, 'Blonde jokes', 'A man was trimming his bushes. His neighbor (the blonde) walks out, checks her mail only to see that its empty, and goes back inside.Five minutes later, she comes back out, checks her mail again only to see that its still empty, and goes back in.The third time she comes out, the man asks her, "Excuse me, is there a problem?"The blonde replies, "Darn right theres a problem! My computer keeps on telling me Ive got mail!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
