INSERT INTO `jokes` VALUES (1817, 'Blonde jokes', 'Q. What is the fastest way to get a one-armed blonde out of a tree?A. Wave at her.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1818, 'Blonde jokes', 'A blonde, wanting to earn some money, decided to hire herself out as a handyman-type and started canvassing a wealthy neighborhood. She went to the front door of the first house and asked the owner if he had any jobs for her to do. "Well, you can paint my porch. How much will you charge?"The blonde said "How about 50 dollars?" The man agreed and told her that the paint and other materials that she might need were in the garage. The mans wife, inside the house, heard the conversation and said to her husband, "Does she realize that the porch goes all the way around the house?" The man replied, "She should, she was standing on it."A short time later, the blonde came to the door to collect her money. "Youre finished already?" he asked. "Yes," the blonde answered, "and I had paint left over, so I gave it two coats." Impressed, the man reached in his pocket for the $50."And by the way," the blonde a dded, "its not a Porch, its a Ferrari."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1819, 'Blonde jokes', 'A blonde was going on a plane trip to New York. When the attendant came by and asked for her ticket, she told the blonde,"Im sorry. Your ticket isnt for first class. Could you please move to your seat." The blonde replied,"Im blonde, Im beautiful, and Im going to New York." The attendant said,"Thats fine miss, but youll have to go to your seat." The blonde responded again, "Im blonde, Im beautiful, and Im going to New York."This conversation continued, always with the blondes same response. The attendant got so upset that she went to the captain and told him about the blonde. The captain went and whispered something in the blondes ear and the blonde immeadiately got up and went to her seat in coach.The attendant asked the captain how he got the stubborn blonde to move. He said, "I just told her that this part of the plane wasnt going to New York."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
