INSERT INTO `jokes` VALUES (1827, 'Blonde jokes', 'A brunette, a blonde, and a redhead were standing in a line before a firing squad. The commander says, "READY, AIM" and the brunette yells "TORNADO!" All the people turned around and looked and the brunette ran away. Next, its the redheads turn. The commander says, "READY, AIM" and the redhead yells "HURRICANE!" Once again all the people turn around to look for the hurricane and the redhead runs away.Finally, its the blondes turn. The commander says, "READY, AIM" and the blonde yells "FIRE!" and gets shot.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
