INSERT INTO `jokes` VALUES (1834, 'Blonde jokes', 'One day while a blonde was out driving her car, she ran into a truck. The trucks driver made her pull over into a parking lot and get out of the car. He took a piece of chalk and drew a circle on the pavement. He told her to stand in the middle and not leave the circle. Furious, he went over to her car and slashed the tires. The blonde started laughing. This made the man angrier so he smashed her windshield. This time the blonde laughed even harder. Livid, the man broke all her windows and keyed her car. The blonde is now laughing hysterically, so the truck driver asks her whats so funny. The blonde giggled and replied, "When you werent looking, I stepped out of the circle three times!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1835, 'Blonde jokes', 'A redhead, a brunette and a blonde all escape from a prison together. They run into the nearby woods and all climb up seperate trees. When the police find the redheads tree and ask who is up there, the redhead chirps like a bird. Then the police go to the brunettes tree. When they ask who is up there, the brunette makes chipmunk noises. Finally, when the police go to the blondes tree and ask who is up there, the blonde goes,"MOOOOOOOOOO!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1836, 'Blonde jokes', 'A blonde, a brunette and a redhead are all stuck on a deserted island together. The island is 20 miles from the nearest inhabited island so they all decide to try to swim there. The redhead makes it 10 miles, is exhausted, gives up, and drowns. The brunette makes it 15 miles before shes too tired to go any farther and drowns. The blonde gets 19 miles away from the deserted island, decides shes too tired to go any farther, and swims all the way back to the deserted island.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
