INSERT INTO `jokes` VALUES (1932, 'Blonde jokes', 'A friend meets up with her friend as she is picking her car up from the mechanic.Her friend asks, "Everything ok with your car now?"The blonde replies, "Yes, thank goodness. I was worried that my mechanic might try to rip me off, so I was relieved when he told me all I needed was blinker fluid."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1933, 'Blonde jokes', 'A blonde bought a brand new car and decided to drive down from some place far off, to meet this friend. She reached there in a few hours. After spending a few days there, she decided to return, and called up her mother to expect her in the evening. But she didnt reach home in the evening and not the next day either. When she finally reached home on the third day, her distraught mother ran and asked her what happened?She got out, obviously very tired from a long journey, and said, "These car designers are crazy! They have four gears for going forward, but only one for going back!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1934, 'Blonde jokes', 'A 92-year old woman had a full cardiac arrest at home and was rushed to the hospital. After about thirty minutes of unsuccessful resuscitation attempts the old lady was pronounced dead. The doctor went to tell the ladys 78-yearold daughter (who wasnt blonde any longer, but just had to be at one time) that her mother didnt make it."Didnt make it? Where could they be? She left in the ambulance forty-five minutes ago!" the former blonde asked.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1935, 'Blonde jokes', 'While shopping at the grocery store, I noticed that the tuna packed in spring water was labeled dolphin safe, but the tuna packed in oil was not.I mentioned this fact to the blonde cashier and mused out loud, "I wonder why?"The blonde replied, "Must be because the oil would suffocate them."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1936, 'Blonde jokes', 'A blonde was taking the tour of a national park not long ago. The ranger mentioned to the tour group that dinosaur fossils had been found in the area. The blonde exclaimed, "Wow! I cant believe the dinosaurs would come this close to the highway!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1937, 'Blonde jokes', 'A blonde was playing Trivial Pursuit one night. It was her turn, she rolled the dice and she landed on "Science & Nature." Her question was, "If you are in a vacuum and someone calls your name, can you hear it?"She thought for a time and then asked, "Is it on or off?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1938, 'Blonde jokes', 'Two blondes are walking down the street. One notices a compact on the sidewalk and leans down to pick it up. She opens it, looks in the mirror and says, "Hmmm, this person looks familiar."The second blonde says, "Here, let me see!" So the first Blonde hands her the compact. She looks in the mirror and says, "You dummy, its me!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1939, 'Blonde jokes', 'A blonde got lost in her car in a snow storm. She remembered what her dad had once told her. "If you ever get stuck in a snow storm, wait for a snow plow and follow it." Pretty soon a snow plow came by, and she started to follow it. She followed the plow for about forty-five minutes. Finally the driver of the snow plow got out and asked her what she was doing. She explained that her dad had told her if she ever got stuck in the snow, to follow a plow. The driver nodded and said, "Well, Im done with the Wal-Mart lot, now you can follow me over to K-Mart..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1940, 'Blonde jokes', 'Two blondes were walking down the road and the first blonde said "Look at that dog with one eye!" The other blonde covers one of her eyes and goes, "Where?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1941, 'Blonde jokes', 'A blonde gets her first period, so she goes to the drugstore to get some pads. The wide selection and huge variety confuse her, so she asks the clerk for some help. "What kind of pads should I get?" she says. "This is all new to me." "Well," says the clerk, "that depends on the flow."She says, "Its ceramic tile."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1942, 'Blonde jokes', 'This executive was interviewing a nervous young blonde women for a position in his company. He wanted to find out something about her personality so he asked, "If you could have a conversation with someone, living or dead, who would it be?" The blonde quickly responded, "The living one."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1943, 'Blonde jokes', 'Did you hear about the two females who were watching a blonde walk by? The first one said, "I wonder whether shes a natural blonde or a bleached blonde." Her friend said, "Shes a suicide blonde."The other said, "Suicide blonde? Whats that?"The friend said, "Dyed by her own hand!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1944, 'Blonde jokes', 'One day a blonde went to a sea food restaurant and saw the tank where they kept the lobsters. She took pity on these creatures and hid them in her purse. Later she went to the woods to set the poor animals free.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1945, 'Blonde jokes', 'A man works in the operations department of a large bank. Employees call him from the field when they have problems with their computers. One night a blonde woman from a branch bank called him and said, "Ive got smoke coming from the back of my computer terminal. Do you guys have a fire downtown?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1946, 'Blonde jokes', 'A blondes house is on fire. She runs outside and yells, "Help me! My house is on fire! What do I do?!" Someone else yells, "Call 911!"The blonde yells back, "Whats the number?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1947, 'Blonde jokes', 'A blonde went to eletronic store and she asked, "How is much is this TV?" The salesman said, "Sorry, we dont sell to blondes." The next day she came back as a brunette. She asked the salesman how much the TV was. He said, "Sorry, we dont sell to blondes." The next day she came back as a red head and asked the salesman how much the TV was. He said, "Sorry we dont sell to blondes." She replied, " I came in here as a brunette and a red head. How do you know I am a blonde?" "Because that is not a TV, its a microwave."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1948, 'Blonde jokes', 'Why cant blondes make Kool Aid?Because they cant figure out how to get eight cups of water into that tiny little package.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1949, 'Blonde jokes', 'Q:Once there was the tooth fairy, Santa Claus, Easter bunny, a smart blonde and a dumb blonde they were walking down the road when they saw a $100 dollars bill who gets it??A: No one the first four dont exsist and the other blonde thought it was a gumwraper!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1950, 'Blonde jokes', 'Three blondes are stranded on an island. A fairy comes along and says that she will grant each person a wish.So the first blonde says she wants to be really smart so she digs and finds a cell phone and calls the Army.The second blonde says that she wants to be even smarter so she finds a flair and sets it off.The third blonde says that she wants to be even smarter than both of them, so the fairy changes herhair color to black and she says," Lets go over the bridge."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1951, 'Blonde jokes', 'A blonde and her husband were driving home, when they hit a rabit. They both got out of the car and stood over the poor creature.The blonde and her husband just stood their, when she said "Oh i know."So she when in the car and rumaged through her purse and came out with what lookeda bottle. She poured it on the rabit and they bothgot in the car. Suddenly the rabit got up hopped alittle bit and waved, hopped a little and waved,hopped to the top of the hill and waved.Then dissapered over it.The husband just stared at his wife and said "Honey, what did you pour onthat rabit?"His wife just said "Hair Restorer with a permanent wave."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1952, 'Blonde jokes', 'There was a blonde who was at an all blonde football game.At halftime she was called down to answer questions to seeif she could win $1000. The first question was what is 10 plus 11?She hesitates and says, hm.. 5! The host says no im sorry thats incorrect.All of the blondes in the stadium chanted "Give her another chance, giveher another chance!" So the host agrees and said, "ok how about 5 plus 5."She answers and says 20. Again all the blondes chanted give her another chance, give her another chance. So the host agrees again and says, ok last chance,what is 2 plus 2. The blonde says 4! and the audience says Give her another chance give her another chance!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1953, 'Blonde jokes', 'One day a blonde woman was down on her luck and she needed a quick way to get money.She saw some kids playing and thought "Hey! Maybe I can kidnap a kid and hold him for ransom!" So she creeps up and snatches one.So she began to write a note: "I have kidnaped your son and I will give him back if you put 10,000$ on the north side of the tree in the park.Signed Blonde."She sticks the note on the kid and sends himhome. The next day she goes to the north sideof the tree and in a paper bag was 10, 000$.But there was a note inside saying: "How could you do this to a fellow blonde!?!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1954, 'Blonde jokes', 'A blonde walks by a travel agency and notices a sign in the window, "Cruise Special -- $99!". She goes inside, lays her money on the counter and says, "Id like the $99 cruise special, please." The agent grabs her, drags her into the back room, ties her to a large inner tube, then drags her out the back door and downhill to the river, where he pushes her in and sends her floating. A second blonde comes by a few minutes later, sees the sign, goes inside, lays her money on the counter, and asks for the $99 special. She too is tied to an inner tube and sent floating down the river. Drifting into stronger current, she eventually catches up with the first blonde. They float side by side for a while before the first blonde asks, "Do they serve refreshments on this cruise? The second blonde replies, " They didnt last year."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (1955, 'Blonde jokes', 'Two bowling teams, one of all blondes and one of all brunettes, charter a double-decker bus for a weekend bowling tournament in Atlantic City.The brunette team rides in the bottom of the bus. The blonde team rides on the top level. The brunette team down below is having a great time, when one of them realizes she doesnt hear anything from the blondes upstairs.She decides to go up and investigate. When the Brunette reaches the top, she finds all the Blondes frozen in fear, staring straight ahead. She says, What the hecks goin on up here? Were havin a grand time downstairs!One of the blondes looks up and says,Yeah, but youve got a driver!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
