INSERT INTO `jokes` VALUES (1995, 'Blonde jokes', 'A blonde decides to learn and try horse back riding unassisted without prior experience or lessons. She mounts the horse with great effort, and the tall, shiny horse springs into motion.It gallops along at a steady and rhythmic pace, but the blonde begins to slip from the saddle. Out of shear terror, she grabs for the horses mane but cannot seem to get a firm grip. She tries to throw her arms around the horses neck, but she slides down the side of the horse anyway. The horse gallops along, seemingly oblivious to its slipping rider.Finally, giving up her frail grip, she leaps away from the horse to try and throw herself to safety.Unfortunately, her foot has become entangled in the stirrup. She is now at the mercy of the horses pounding hooves as her head is struck against the ground again and again. As her head is battered against the ground, she is mere moments away from unconsciousn ess or even death when Frank, the Wal-Mart manager runs out to shut the horse off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
