INSERT INTO `jokes` VALUES (2055, 'Blonde jokes', 'Q: Why will a blonde laugh at a joke three times?A: Once when you tell it, once when you tell her the punchline, and once when she gets it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
