INSERT INTO `jokes` VALUES (2058, 'Blonde jokes', 'Q: Did you hear about the blonde that got pregnant for the second time?A: She asked her husband if they needed to get married again.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2059, 'Blonde jokes', 'Q: Did you hear about the new blonde hoodlum?A: She runs around spray-painting her name on chain link fences.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
