INSERT INTO `jokes` VALUES (2061, 'Blonde jokes', 'Q: Did you hear about the Blonde who got a pair of water-skis?A: Shes still looking for a lake with a slope.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
