INSERT INTO `jokes` VALUES (2308, 'Burger jokes', 'Why was the burger thrown out of the Army?He couldnt pass mustard! (muster)', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2309, 'Burger jokes', 'Why were the burgers in the refrigerator embarrassed?They saw the salad dressing!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
