INSERT INTO `jokes` VALUES (2311, 'Bus jokes', 'What would you get if you crossed King Kong with a skunk? I dont know but it could always get a seat on a bus!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2312, 'Bus jokes', 'Why couldnt the skeleton pay his bus fare? Because he was skint.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2313, 'Bus jokes', 'Roger was sitting in a very full bus when a fat woman opposite said, "If you were a gentleman, young man, youd stand up and let someone else sit down." "And if you were a lady," replied Roger, "youd stand up and let four people sit down."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2314, 'Bus jokes', 'Whats the difference between a bus driver and a cold? A bus driver knows the stops, and a cold stops the nose.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2315, 'Bus jokes', 'A man standing at a bus stop was eating a hamburger. Next to him stood a lady with her little dog, which became very excited at the smell of the mans supper and began whining and jumping up at him. "Do you mind if I throw him a bit?" said the man to the lady. "Not at all," she replied, whereupon the man picked the dog up and threw it over a wall.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2316, 'Bus jokes', 'Teacher: Tommy Russell, youre late again. Tommy: Sorry, sir. Its my bus - its always coming late. Teacher: Well, if its late again tomorrow, catch an earlier one.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2317, 'Bus jokes', 'How can you kill an idiot with half a dollar? Throw it under a bus.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2318, 'Bus jokes', 'Passenger: Will this bus take me to New York? Driver: Which part? Passenger: All of me, of course!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2319, 'Bus jokes', 'As the bus came to the stop, the man at the front of the queue took out his eye, threw it up in the air and caught it before getting on the bus. An amazed conductor said, What on earth did you do that for? I wanted to know if there was room on top, replied the man.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2320, 'Bus jokes', 'When you go for a bus ride, do you like sitting upstairs or downstairs? I prefer to ride on top, but its very hard getting the horse up the stairs.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2321, 'Bus jokes', 'A man trying to get on an overcrowded bus was pushed off by the people inside. Theres no room, they said. Its full up! But you must let me on! shouted the man. Why, whats so special about you? they asked. Im the driver, replied the man.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2322, 'Bus jokes', 'Why did the bus stop? Because it saw the zebra crossing.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2323, 'Bus jokes', 'What do you call a bloke with a bus on his head? Dead.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2324, 'Bus jokes', 'Passenger: Does this bus go to London? Conductor: No. Passenger: But it says London on the front. Conductor: Theres an advertisement for baked beans on the side, but we dont sell them!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2325, 'Bus jokes', 'Sam left work after a tiring day. Take the bus home, suggested a friend. My mother would only make me take it back, Sam said.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2326, 'Bus jokes', 'Did you say that you fell over fifty feet but didnt hurt yourself? Yes - I was trying to get to the back of the bus.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2327, 'Bus jokes', 'Conductor, this bus was very slow! Oh, I expect well pick up speed now youre getting off!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2328, 'Bus jokes', 'Have you heard that all the buses and trains are stopping today? No. Is there a strike? No, theyre stopping to let the passengers off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2329, 'Bus jokes', 'What have I got in my hands? A double decker bus! You looked!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2330, 'Bus jokes', 'Do buses and trains run on time? Usually, yes. No, they dont. Buses run on wheels and trains run on the tracks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2331, 'Bus jokes', 'Does this bus stop at the river? If it doesnt therell be a very big splash.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2332, 'Bus jokes', 'Conductor, do you stop at the Savoy Hotel? I should say not, on my salary!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2333, 'Bus jokes', 'Is everyone in the bus? asked the driver before he closed the door. No, called a lady, wait until I get my clothes on. All the passengers in the bus turned towards the door to look at the woman. She got on with a bag full of laundry.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2334, 'Bus jokes', 'Janet: Whats the difference between a cake and a school bus ?Jill: I dont know.Janet: Im glad I didnt send you to pick up my birthday cake !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
