INSERT INTO `jokes` VALUES (2356, 'Cannibal jokes', 'First cannibal: I cant find anything to eat! Second cannibal: But the jungles full of people. First cannibal: Yes, but theyre all very unsavory.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2357, 'Cannibal jokes', 'Did you hear about the cannibals who captured a scrawny old hunter? It sure gave them something to chew over.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2358, 'Cannibal jokes', 'Did you hear about the cannibal family who were caught spying by the witch-doctor? They were given a right roasting.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2359, 'Cannibal jokes', 'Two cannibals were having their dinner. One said to the other "I dont like your friend." The other one said, "Well, put him to one side and just eat the vegetables."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2360, 'Cannibal jokes', 'The cannibal priest told his flock to close their eyes and say grace. "For whosoever we are about to eat, may the Lord make us truly thankful."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2361, 'Cannibal jokes', '"Well, children," said the cannibal cooking teacher. "What did you make of the new English teacher?" "Burgers, maam."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2362, 'Cannibal jokes', 'Two cannibals were having lunch. "Your wife makes a great soup," said one to the other. "Yes!" agreed the first. "But Im going to miss her terribly."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2363, 'Cannibal jokes', 'First Cannibal: Who was that girl I saw you with last night? Second Cannibal: That was no girl, that was my supper.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2364, 'Cannibal jokes', 'Did you hear about the cannibal who joined the police force?He said he wanted to grill his suspects.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2365, 'Cannibal jokes', 'Did you hear about the cannibal who commited suicide? He got himself into a real stew.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2366, 'Cannibal jokes', 'Cannibals capture three men. The men are told that they will be skinned and eaten and then their skin will be used to make canoes. Then they are each given a final request. The first man asks to be killed as quickly and painlessly as possible. His request is granted, and they poison him. The second man asks for paper and a pen so that he can write a farewell letter to his family. This request is granted, and after he writes his letter, they kill him saving his skin for their canoes. Now it is the third mans turn. He asks for a fork. The cannibals are confused, but it is his final request, so they give him a fork. As soon as he has the fork he begins stabbing himself all over and shouts, "To hell with your canoes!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2367, 'Cannibal jokes', 'A cannibal son and his father are out looking for food. They are watching people walk down the street. The son suggested a particularly plump woman and the father rejected saying that shes too fatty. Later on the son asked about a very skinny woman. Again the father refused saying that shes to skinny. After a while the son pointed out a very attractive woman." sure son" the father replied, drooling. "Well take her home and eat you mother!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2368, 'Cannibal jokes', 'Q. What did the cannibals wife give her husband when he came home late for dinner? A. The cold shoulder.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2369, 'Cannibal jokes', 'First cannibal: We had burglars last night. Second cannibal: Did they taste good?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2370, 'Cannibal jokes', 'First cannibal: I dont know what to make of my husband these days. Second cannibal: How about a curry?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2371, 'Cannibal jokes', 'The cannibal king was having dinner when a servant came running in. "Your Majesty," he said, "the slaves are revolting!""You dont have to tell me," said the king. "Im trying to eat them. "Where did we get these slaves anyway?""From the country next door," replied the servant. "We must get a new butcher," said the king. "Bring me Delia Smith." "We cant, Your Majesty, shes still cooking for you." "Well, bring her to me once shes crispy enough," said the king.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2372, 'Cannibal jokes', 'What does a cannibal call a skateboarder? Meals on wheels.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2373, 'Cannibal jokes', 'What is the cannibals favorite game? Swallow my Leader.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
