INSERT INTO `jokes` VALUES (2376, 'Cannibal jokes', 'Cannibal Boy: Ive brought a friend home for dinner. Cannibal Mom: Put him in the fridge and well have him tomorrow.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2377, 'Cannibal jokes', 'A cannibal chief was just about to stew his latest victim for dinner when the man protested, "You cant eat me ? Im the manager!" "Well," said the cannibal, "soon youll be a manager in chief."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2378, 'Cannibal jokes', 'First cannibal: My wifes a tough old bird. Second cannibal: You should have left her in the oven for another half an hour.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2379, 'Cannibal jokes', 'A cannibals dillema: If God didnt want us to eat people, why did he make them out of meat?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2380, 'Cannibal jokes', 'A man is captured by cannibals, every day they poke him with spears and use his blood to wash down their food.Finally the guy calls the chief over and says, "Hey, you can kill me or you can eat me, but Im tired of getting stuck for drinks!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2381, 'Cannibal jokes', 'Cannibal: Mom, mom, Ive been eating a missionary and I feel sick !Mom: Well, you know what they say - you cant keep a good man down !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
