INSERT INTO `jokes` VALUES (2383, 'Cannibal jokes', 'When a plane caught fire over the jungle the pilot ejected and landed in a cannibals pot. The cannibal turned to his friend and said, Whats this flier doing in my soup?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
