INSERT INTO `jokes` VALUES (2410, 'Cannibal jokes', 'First cannibal: Come and have dinner in our but tonight.Second cannibal: What are you having? First cannibal: Hard-boiled legs.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2411, 'Cannibal jokes', 'First Cannibal: "Have you seen the dentist?"Second Cannibal: "Yes, he filled my teeth at dinner time."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2412, 'Cannibal jokes', 'Why did the cannibal eat the tightrope walker?He wanted a balanced meal.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2413, 'Business jokes', 'A new business was opening and one of the owners friends wanted to send flowers for the occasion. They arrived at the new business site and the owner read the card; it said "Rest in Peace". The owner was angry and called the florist to complain. After he had told the florist of the obvious mistake and how angry he was ,the florist said. "Sir, Im really sorry for the mistake, but rather than getting angry you should imagine this: somewhere there is a funeral taking place today, and they have flowers with a note saying, "Congratulations on your new location."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2414, 'Business jokes', 'Fresh out of business school, the young man answered a wantad for an accountant. Now he was being interviewed by a verynervous man who ran a small business that he had started himself."I need someone with an accounting degree," the man said. "Butmainly, Im looking for someone to do my worrying for me.""Excuse me?" the accountant said."I worry about a lot of things," the man said. "But I dont want to have to worry about money. Your job will be to take all the money worries off my back.""I see," the accountant said. "And how much does the job pay?""Ill start you at eighty thousand.""Eighty thousand dollars!" the accountant exclaimed. "How can such asmall business afford a sum like that?""That," the owner said, "is your first worry."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2415, 'Business jokes', 'The new employee stood before the paper shredder looking confused. "Need some help?" a secretary asked. "Yes," he replied. "How does this thing work?" "Simple," she said, taking the fat report from his hand and feeding it into the shredder. "Thanks, but where do the copies come out?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2416, 'Business jokes', 'A fellow had just been hired as the new CEO of a large high tech corporation. The CEO who was stepping down met with him privately and presented him with three numbered envelopes. "Open these if you run up against a problem you dont think you can solve," he said. Well, things went along pretty smoothly, but six months later, sales took a downturn and he was really catching a lot of heat. About at his wits end, he remembered the envelopes. He went to his drawer and took out the first envelope. The message read, "Blame your predecessor." The new CEO called a press conference and tactfully laid the blame at the feet of the previous CEO. Satisfied with his comments, the press -- and Wall Street -- responded positively, sales began to pick up and the problem was soon behind him. About a year later, the company was again experiencing a slight dip in sales, combined with serious product pro blems. Having learned from his previous experience, the CEO quickly opened the second envelope. The message read, "Reorganize." This he did, and the company quickly rebounded. After several consecutive profitable quarters, the company once again fell on difficult times. The CEO went to his office, closed the door and opened the third envelope. The message said, "Prepare three envelopes."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2417, 'Business jokes', 'The farmer goes to town one day and happens to run into his old pal the tractor salesman."Hows business?" asks the farmer. "Not very good, I havent sold a tractor in months, How are things on the farm?" asked the salesman."Well-- The other day I went out to the barn to milk that old cow I have. I started milking and she swatted me with her tail, so I tied her tail to the ceiling. I started milking again and she kicked me with her left leg so I tied that to the left side of the stall. I started milking again and she kicked me with her right leg so I tied that one to the right side of the stall. About that time my wife walked in the barn, and if you can convince her that I was just trying to milk that damn cow,Ill buy a tractor from you!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2418, 'Business jokes', 'An organization is like a tree full of monkeys... all on different limbs,... at different levels,... some climbing up. The monkeys on the top look down and see a tree full ofsmiling faces. The monkeys on the bottom look up and see nothing butassholes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2419, 'Business jokes', 'A businessman was confused about a bill he had received, sohe asked his secretary for some mathematical help. "If I were to give you $20,000, minus 14%, how much wouldyou take off?" he asked her. The secretary replied, "Everything but my earrings."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2420, 'Business jokes', 'One day an out of work mime is visiting the zoo and attemptsto earn some money as a street performer. Unfortunately, assoon as he starts to draw a crowd, a zoo keeper grabs him anddrags him into his office. The zoo-keeper explains to the mime that the zoos mostpopular attraction, a gorilla, has died suddenly and thekeeper fears that attendance at the zoo will fall off. Heoffers the mime a job to dress up as the gorilla until theycan get another one. The mime accepts. So the next morning the mime puts on the gorilla suit andenters the cage before crowd comes. He discovers that its agreat job. He can sleep all he wants, play and make fun ofpeople and he draws bigger crowds than he ever did as a mime.However, eventually the crowds tire of him and he tires ofjust swinging on tires. He begins to notice that the people are paying moreattention to the lion in the cag e next to his. Not wanting tolose the attention of his audience, he climbs to the top ofhis cage, crawls across a partition, and dangles from the topto the lions cage. Of course, this makes the lion furious,but the crowd loves it. At the end of the day the zoo-keepercomes and gives the mime a raise for being such a goodattraction. Well, this goes on for some time, the mime keeps tauntingthe lion, the crowds grow larger, and his salary keeps goingup. Then one terrible day when he is dangling over thefurious lion, he slips and falls. The mime is terrified. Thelion gathers itself and prepares to pounce. The mime is so scared that he begins to run round and roundthe cage with the lion close behind. Finally, the mime startsscreaming and yelling, "Help, Help me!" but the lion is quickand pounces. The mime soon finds himself flat on his back looking up atthe angry lion and the lion says, " Shut up you idiot! Do youwant to get us both fired?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2421, 'Business jokes', 'American businessman was at a pier in a small coastalMexican village when a small boat with just one fisherman docked. Inside the small boat were several large yellow-fintuna. The American complimented the Mexican on the quality ofhis fish and asked how long it took to catch them. The Mexican replied only a little while. The American then asked why didnt he stay out longer andcatch more fish? The Mexican said he had enough to support his familysimmediate needs. The American then asked the Mexican how he spent the rest ofhis time. The Mexican fisherman said, "I sleep late, fish a little,play with my children, take siesta with my wife, Maria,stroll into the village each evening where I sip wine andplay guitar with my amigos. I have a full and busy life,senor." The American scoffed, "I am a Harvard MBA and could helpyou. You should spend more time fis hing and, with the proceeds, buy a bigger boat. With the proceeds from thebigger boat, you could buy several boats, eventually you would have a fleet of fishing boats. Instead of selling yourcatch to a middleman you would sell directly to the processor, eventually opening your own cannery. You wouldcontrol the product, processing and distribution. "You would need to leave this small coastal fishing villageand move to Mexico City, then LA and eventually NYC where youwill run your expanding enterprise." The Mexican fisherman asked, "But senor, how long will thisall take?" To which the American replied, "15-20 years." "But what then, senor?" asked the Mexican. The American laughed, and said, "Thats the best part! Whenthe time is right, you would announce an IPO and sell your company stock to the public. Youll become very rich, youwould make millions!" "Millions, senor?" replied t he Mexican. "Then what?" The American said, "Then you would retire. Move to a smallcoastal fishing village where you would sleep late, fish alittle, play with your kids, take siesta with your wife,stroll to the village in the evenings where you could sipwine and play your guitar with your amigos."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2422, 'Business jokes', 'A stockbroker was cold calling about a penny stock and found a taker. "I think this one will really move said the broker, its only $1 a share." "Buy me 1000 shares." said the client. The next day the stock was at $2. The client called the broker and said, "You were right, give me 5000 more shares." The next day the client looked in the paper and the stock was at $4. The client ran to the phone and called the broker, "Get me 10,000 more shares said the client." "Great!" said the broker. The next day the client looked in the paper and the stock was at $9. Seeing what a great profit he had in just a few days, the client ran to the phone and told the broker, "Sell all my shares!" The broker said, "To whom? You were the only one buying that stock."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2423, 'Business jokes', 'When the office photo-copies began to look faint, the office manager called in a local repair service. The friendly technician after inspecting the equipment, informed the manager that the machine was in need of a good cleaning. The tech suggested that someone might try reading the operators manual and perform the job themselves, since it would cost $100.00, if he did the work. Pleasantly surprised by his candor, the office manager asks, "Does your boss know you are discouraging business?" "Actually, my boss demands we explain this to all our customers". "After people try first to fix things themselves, we end-up making much more money on repairs"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2424, 'Business jokes', 'Resolving to surprise her husband, an executives wife stops by his office. As she walks in unannounced, she finds his secretary sitting on his lap. Without hesitating, he begins to dictated a letter... "And in conclusion gentlemen, budget cut or not, I cannot continue to operate this office with just one chair.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2425, 'Business jokes', 'Resolving to surprise her husband, an executives wife stops by his office. As she walks in unannounced, she finds his secretary sitting on his lap. Without hesitating, he begins to dictated a letter... "And in conclusion gentlemen, budget cut or not, I cannot continue to operate this office with just one chair.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2426, 'Business jokes', 'A young executive was leaving the office late one evening, when he finds the CEO standing in front of a shredder with a piece of paper in his hand. "Listen," said the CEO, "this is a very sensitive and important document here, and my secretary has gone for the night. Can you make this thing work for me?" "Certainly," the young executive says. He turns the machine on, inserts the paper, and presses the start button. "Excellent, excellent!" says the CEO as his paper disappeared inside the machine. "I just need one copy."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2427, 'Business jokes', 'A man has spent many days crossing the desert without water. His camel has died of thirst. Hes crawling through the sands, certain that he has breathed his last, when all of a sudden he sees a shiny object sticking out of the sand several yards ahead of him. He crawls to the object, pulls it out of the sand, and discovers what looks to be an ash tray from an old car. He opens it and out pops a genie.... But this is no ordinary genie. He is wearing a polka dot bow tie and a plaid sport coat. Theres a dog-eared little book in the breast pocket with a blue cover. He has a pencil tucked behind one ear. "Well, kid," says the genie. "You know how it works. You have three wishes." "Im not falling for this." says the man. "Im not going to trust a used car salesman!" "What do you have to lose? Youve got no transportation, and it looks like youre a goner anyway! " The man thinks about this for a minute, and decides that the genie is right. "OK, I wish I were in a lush oasis with plentiful food and drink." ***POOF*** The man finds himself in the most beautiful oasis he has ever seen. And he is surrounded with jugs of wine and platters of delicacies. "OK, kid, whats your second wish." "My second wish is that I were rich beyond my wildest dreams." ***POOF*** The Arab finds himself surrounded by treasure chests filled with rare gold coins and precious gems. "OK, kid, you have just one more wish. Better make it a good one!" After thinking for a few minutes, the Arab says: "I wish that no matter where I go a beautiful woman will want and need me." ***POOF*** Hes turned into a tampon. The moral of the story? If a used car salesman offers you anything at no cost, theres going to be a string attached s omewhere!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2428, 'Business jokes', 'This guy is walking with his friend. He says to this friend, "Im a walking economy." The friend replies "How so?" "My hair line is in recession, my stomach is a victim of inflation, and both of these together are putting me into a deep depression!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2429, 'Business jokes', 'The Americans and Japanese decided to engage in a boat race. Both teams practiced hard and long to reach their peak performance levels. On the big day they felt ready. The Japanese won by a mile.The American team was discouraged by the loss. Morale sagged. Corporate management decided that the reason for the crushing defeat had to be found, so a consulting firm was hired to investigate the problem and recommend corrective action.The consultants finding: The Japanese team had eight people rowing and one person steering: the American team had one person rowing and eight people steering.After a year of study and millions spent analyzing the problem, the consultant firm concluded that too many people were steering and not enough were rowing on the American team. So as race day neared again the following year, the Americans team management structure was completely reorganized. The  new structure: four steering managers, three area steering managers, and a new performance review system for the person rowing the boat to provide work incentive. The next year, the Japanese won by TWO miles!Humiliated, the American corporation laid off the rower for poor performance and gave the managers a bonus for discovering the problem.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2430, 'Business jokes', 'A man went to apply for a job. After filling out all of his applications, he waited anxiously for the outcome.The employer read all his applications and said, "We have an opening for people like you.""Oh, great," he said, "What is it?""Its called the door!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2431, 'Business jokes', 'There are three beggars begging on Wall Street.The first beggar wrote "Beggar" on his broken cup. He received $10.00 after one day.The next day, the second beggar wrote "Beggar.com" on his cup. After one day, he received hundreds of thousands of dollars and an offer to float an IPO on NASDAQ.The following day, the third beggar wrote "e-Beg" on his cup. Microsoft, IBM, and HP sent corporate vice-presidents to talk to him about strategic alliances and offered him free hardware consultancy. In addition, it was reported on CNBC that e-Beg uses 95% Oracle technology and that I2 announced the launch of BegTradeMatrix; a b2b industry portal offering supply chain integration in the beggar community.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2432, 'Business jokes', 'A man walks into a shoe store, and tries on a pair of shoes. "How do they feel?" asks the sales clerk."Well they feel a bit tight," replies the man.The assistant promptly bends down and has a look at the shoes and at the mans feet. "Try pulling the tongue out," the clerk says."Well, theyth sthill feelth a bith tighth."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2433, 'Business jokes', 'A customer walks into a restaurant and notices a large sign on the wall: $500 If we fail to fill your order! When his waitress arrives, he orders elephant nuts on rye.She calmly writes down his order and walks into the kitchen where all hell breaks loose!The restaurant owner comes storming out of the kitchen. He runs up to the customers table, slaps five $100 bills down on it and says, "You got me this time buddy, but I want you to know thats the first time in ten years weve been out of rye bread!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2434, 'Business jokes', 'A shopkeeper was dismayed when a brand new business much like his own opened up next door and erected a huge sign which read BEST DEALS.He was horrified when another competitor opened up on his right, and announced its arrival with an even larger sign, reading LOWEST PRICES.The shopkeeper panicked, until he got an idea. He put the biggest sign of all over his own shop. It read MAIN ENTRANCE.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2435, 'Business jokes', 'Smith goes to see his supervisor in the front office. "Boss," he says, "were doing some heavy house-cleaning at home tomorrow, and my wife needs me to help with the attic and the garage, moving and hauling stuff." "Were short-handed, Smith" the boss replies. "I cant give you the day off." "Thanks, boss," says Smith "I knew I could count on you!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2436, 'Business jokes', 'An elderly fisherman wrote to a mail order house the following:"Please send me one of those gasoline engines for my boat you show on page 438, and if its any good, Ill send you a check."In a short time he received the following reply: "Please send check. If its any good, well send the engine."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2437, 'Business jokes', 'A Japanese guy is at Los Angeles International Airport, waiting for his flight back home to Japan. While hes waiting, he goes to the currency exchange counter to change his remaining dollars.He counts his money at the counter. "Wait a minute," he says to the clerk, "When I came here I got more dollars for my yen. Whats going on here?""Fluctuations." says the clerk.The Japanese man stiffens. "Well! Fluck you Americans, too!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2438, 'Business jokes', 'A dinner speaker was in such a hurry to get to his engagement that when he arrived and sat down at the head table, he suddenly realized that he had forgotten his false teeth.Turning to the man next to him he said, "I forgot my teeth."The man said, "No problem." With that he reached into his pocket and pulled out a pair of false teeth. "Try these," he said.The speaker tried them. "Too loose," he said.The man then said, "I have another pair...try these."The speaker tried them and responded, "Too tight."The man was not taken back at all. He then said, "I have one more paid of false teeth...try them."The speaker said, "They fit perfectly." With that he ate his meal and gave his address.After the dinner meeting was over, the speaker went over to thank the man who had helped him."I want to thank you for coming to my aid. Where is your office? Ive been looking  for a good dentist."The man replied, "Im not a dentist. Im the local undertaker."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2439, 'Business jokes', 'A very successful businessman had a meeting with his new son-in-law. "I love my daughter, and now I welcome you into the family," said the man. "To show you how much we care for you, Im making you a 50-50 partner in my business. All you have to do is go to the factory every day and learn the operations." The son-in-law interrupted, "I hate factories. I cant stand the noise." "I see," replied the father-in-law. "Well, then youll work in the office and take charge of some of the operations." "I hate office work," said the son-on-law. "I cant stand being stuck behind a desk all day." "Wait a minute," said the father-in-law. "I just made you half-owner of a moneymaking organization, but you dont like factories and wont work in a office. What am I going to do with you?" "Easy," said the young man. "Buy me out."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2440, 'Business jokes', 'An Irishman goes for a job on a building site.The man says, "Can you brew tea?"The Irishman says, "Yes.""Good. Can you drive a fork lift?"The Irishman looks at him and asksy, "Why? How big is the teapot?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2441, 'Business jokes', 'Two gas company servicemen, a senior training supervisor and a young trainee, were out checking meters in a suburban neighborhood. They parked their truck at the end of the alley and worked their way to the other end. At the last house a woman looking out her kitchen window watched the two men as they checked her gas meter. Finishing the meter check, the senior supervisor challenged his younger coworker to a foot race down the alley back to the truck to prove that an older guy could outrun a younger one. As they came running up to the truck, they realized the lady from that last house was huffing and puffing right behind them. They stopped and asked her what was wrong.Gasping for breath, she replied, "When I see two gas men running as hard as you two were, I figured Id better run too!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2442, 'Business jokes', 'A frog goes into the bank and asks the teller for a loan. The teller tells the frog to see Mr. Paddywack, the loan officer. Mr. Paddywack looks at the frog and says, "What do you have for collateral?" The frog pulls out of his pocket a solid silver elephant. Mr. Paddywack looks at the elephant and says, "I dont know. Im going to have to ask Mr. Larson, the bank manager to approve this." He goes into Mr. Larsons office and comes back. Two minutes later, Mr. Larson comes out with the elephant and says, "Its a knick-knack Paddywack, give the frog a loan!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2443, 'Business jokes', 'Four men were bragging about how smart their dogs are. The first man was an engineer, the second man was an Accountant, the third man was a Chemist and the fourth was a Government Worker. To show off, the Engineer called to his dog, "T-square, do your stuff!". T-square trotted over to a desk, took out some paper and a pen, and promptly drew a circle, a square, and a triangle. Everyone agreed that was pretty smart. But the Accountant said his dog could do better. He called his dog and said, "Slide Rule, do your stuff!". Slide Rule went out into the kitchen and returned with a dozen cookies. He divided them into 4 equal piles of 3 cookies each. Everyone agreed that was good. But the Chemist said his dog could do better. He called his dog and said, "Measure, do your stuff!". Measure got up, walked over to the fridge, took out a quart of milk, got a 10 ounce glass from the cupboard and poured ex actly 8 ounces without spilling a drop. Everyone agreed that was good. The three men turned to the Government Worker and said, "What can your dog do?". The Government Worker called to his dog and said, "Coffee Break, do your stuff!". Coffee Break jumped to his feet, ate the cookies, drank the milk, dumped on the paper, sexually assaulted the other three dogs, claimed he injured his back while doing so, filed a grievance report for unsafe working conditions, put in for Workers Compensation and went home on sick leave.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2444, 'Business jokes', 'A young ensign had nearly completed his first overseas tour of sea duty when he was given an opportunity to display his ability at getting the ship under way. With a stream of crisp commands, he had the decks buzzing with men and soon, the ship had left port and was streaming out of the channel.The ensigns efficiency has been remarkable. In fact, the deck was abuzz with talk that he had set a new record for getting a destroyer under way. The ensign glowed at his accomplishment and was not all surprised when another seaman approached him with a message from the captain.He was, however, a bit surprised to find that it was a radio message, and he was even more surprised when he read, "My personal congratulations upon completing your underway preparation exercise according to the book and with amazing speed. In your haste, however, you have overlooked one of the unwritten rules -- make sure th e captain is aboard before getting under way!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2445, 'Business jokes', 'When I asked my boss for a salary rise because I was doing the work of three men he said he couldnt increase my pay, but if I told him the names of the three men hed fire them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2446, 'Business jokes', 'Im always delighted when people stick their noses in my business - my company makes paper tissues.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2447, 'Business jokes', 'My husbands business is rather up-and-down - he makes yo-yos.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2448, 'Business jokes', 'When Bernard got fired from his last job they were really tough. They made him hand back his keys to the executive toilets, return his company credit card, give back his company car, and even give back his ulcer!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2449, 'Business jokes', 'Another friend of mine is a very successful businessman. He started with five thousand pounds - now he owes fifty-five million.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2450, 'Business jokes', 'The Ten Commandments Of EmploymentIf it rings, put it on hold.If it clunks, call the repairman.If it whistles, ignore it.If its a friend, stop work and chat.If its the boss, look busy.If it talks, take notes.If its handwritten, type it.if its typed, copy it.If its copied, file it.If its Friday, forget it!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2451, 'Business jokes', 'Employer: "In this job we need someone who is responsible."Applicant: "Im the one you want. On my last job, every time anything went wrong, they said I was responsible."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2452, 'Business jokes', 'This is the story of four people named Everybody, Somebody, Anybody, and Nobody. There was an important job to be done and Everybody was asked to do it. Anybody could have done it, but Nobody did it. Somebody got angry about that, because it was Everybodys job. Everybody thought Anybody could do it, but Nobody realized that Everybody wouldnt do it. Consequently, it wound up that Nobody told Anybody, so Everybody blamed Somebody.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2453, 'Business jokes', 'This guy is selling three parrots. Another guy who wants to buy a parrot approaches him and asks, "How much are your parrots?"The salesman answers, "The first one is $1,000." "What does he know?""He knows 10,000 words and 500 sentences and is able to solve mathematical expressions.""How about the second one?""The second parrot costs $5,000.""What does he know?""He knows 100,000 words and 10,000 sentences, is able to solve mathematical expressions, and create computer programs.""Then what is the price for the third one?, the buyer is wondering.""This one costs $20,000.""Really?!, wonders the exciting buyer. What does he know?""This one knows absolutely nothing, but the two others always call him THEIR BOSS."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2454, 'Business jokes', 'Before going to Europe on business, a man drove his Rolls Royce to a downtown NY City bank and went in to ask for an immediate loan of $5,000. The loan officer was quite taken a back, and requested collateral. "Well, then, here are the keys to my Rolls-Royce", the man said. The loan officer promptly had the car driven into the banks underground parking for safekeeping, and gave him $5,000. Two weeks later, the man walked through the banks doors, and asked to settle up his loan and get his car back. The loan officer checked the records and told him, "That will be $5,000 in principal, and $15.40 in interest." The man wrote out a check, thanked the loan officer, and started to walk away. "Wait sir," the loan officer said, "while you were gone, I found out you are a millionaire. Why in the world would you need to borrow? The man smiled. "Where else could I securely park my Rolls-Royce in  Manhattan for two weeks and pay only $15.40?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2455, 'Business jokes', 'The Mafia was looking for a new man to make weekly collections fromall the private businesses that they were protecting. Feeling the heat from the police force, they decided to use a deafperson for this job. If he were to get caught, he wouldnt be able tocommunicate to the police what he was doing. Well, on his first week, the deaf collector picks up over $50,000. He gets greedy, decides to keep the money and stashes it in a safe place. The Mafia soon realizes that their collection is late, and sends someof their hoods after the deaf collector. The hoods find the deafcollector and ask him where the money is. The deaf collector cantcommunicate with them, so the Mafia drags the guy to an interpreter.The Mafia hood says to the interpreter, "Ask him where the money is."The interpreter signs, "Wheres the money?"  r\nThe deaf replies, "I dont know what youre talking about." Theinterpreter tells the hood, "He says he doesnt know what youretalking about." The hood pulls out a large gun and places it in the ear of the deafcollector. "NOW ask him where the money is." The interpreter signs, "Where is the money?" The deaf man replies, "The $50,000 is in Central Park, hidden in thethird tree stump on the left from the West 78th Street gate ." The interpreter says to the hood, "He says he still doesnt know whatyoure talking about, and doesnt think you have the guts to pull thetrigger."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2456, 'Business jokes', 'ttle Johnny was in class and the teacher announced that they were going to try something different to help everyone get to know each other a little better, and to help with their spelling. She explained, "I want you to stand up and give us the occupation of your father, spell it, and say one thing he would give us all if he was here today." The first student raised her hand to volunteer. "Marcy," the teacher said. "You may go first." Marcy replied, "My father is a banker. B-A-N-K-E-R and if he was here today, he would give us all a shiny new penny." The teacher said, "Very nice, Marcy, who wants to go next?" Kevin stood up and announced, "My father is a baker. B-A-K-E-R and if he was here today, he would give us all a freshly-baked cookie." "Very good," the teacher told Kevin. Jeff was next, and he said, "My father is an accountant. A-K, no wait, A-C-K, no..." \r nBefore he could attempt to spell it once more, the teacher cut him off and told him to sit back down and to think about it for a while. When he thought he knew how to spell it, he could stand back up and try again. Little Johnny raised his hand in excitement hoping to be acknowledged by the teacher. The teacher called on little Johnny to go next. Johnny said, "My father is a bookie. B-O-O-K-I-E and if he was here today, he would give us all 20:1 odds Jeff will never be able to spell "accountant."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2457, 'Business jokes', 'An American automobile company and a Japanese auto company decided to have a competitive boat race on the Detroit River. Both teams practiced hard and long to reach their peak performance. On the big day, they were as ready as they could be.The Japanese team won by a mile.Afterwards, the American team became discouraged by the loss and their morale sagged. Corporate management decided that the reason for the crushing defeat had to be found. A Continuous Measurable Improvement Team of "Executives" was set up to investigate the problem and to recommend appropriate corrective action.Their conclusion: The problem was that the Japanese team had 8 people rowing and 1 person steering, whereas the American team had 1 person rowing and 8 people steering. The American Corporate Steering Committee immediately hired a consulting firm to do a study on the management structure.After some t ime and billions of dollars, the consulting firm concluded that "too many people were steering and not enough rowing." To prevent losing to the Japanese again next year, the management structure was changed to "4 Steering Managers, 3 Area Steering Managers, and 1 Staff Steering Manager" and a new performance system for the person rowing the boat to give more incentive to work harder and become a six sigma performer. "We must give him empowerment and enrichment." That ought to do it.The next year the Japanese team won by two miles.The American Corporation laid off the rower for poor performance, sold all of the paddles, cancelled all capital investments for new equipment, halted development of a new canoe, awarded high performance awards to the consulting firm, and distributed the money saved as bonuses to the senior executives.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2458, 'Business jokes', 'Tom had this problem of getting up late in the morning and was always late for work. His boss was mad at him and threatened to fire him if he didnt do something about it. So Tom went to his doctor who gave him a pill and told him to take it before he went to bed. Tom slept well and in fact beat the alarm in the morning by almost two hours. He had a leisurely breakfast and drove cheerfully to work."Boss", he said, " The pill actually worked!""Thats all fine" said the boss, " But where were you yesterday?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2459, 'Business jokes', 'The boss returned from lunch in a good mood and called the whole staff in to listen to a couple of jokes he had picked up. Everybody, but one girl laughed uproariously."Whats the matter?" grumbled the boss. "Havent you got a sense of humor?""I dont have to laugh," she replied. "Im leaving Friday."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2460, 'Business jokes', 'Two neighbors were talking about work, when one asked, "Say, why did the foreman fire you?"Replied the second, "Well, you know how a foreman is always standing around and watching others do the work. My foreman got jealous. People started thinking I was the foreman."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2461, 'Business jokes', 'Four corporate presidents, one English, one French, one Japanese and one American, were on their way to an international business conference when they were kidnapped by terrorists and taken to a secret hideout."You, your companies, and you countries are enemies of the Revolution," screamed the terrorist leader, "and youre going to be executed! Do you have any last requests?"The Englishman spoke first."Before I die, I want to honor my country and protest this barbaric act by singing "God Save The Queen" to all you men.""That can be arranged," said the terrorist.The Frenchman said, "And I want to honor my country before I die by singing "The Marseilles" to your men."The Japanese said, "Before I die, I wish to honor my country by giving the lecture I was going to present on the Mapanese style of industrial management."The terrorist turned finally to the America n."What is your last request?"The American replied, "I want you to kill me right now so I dont have to listen to another lecture on the Japanese style of industrial management!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2462, 'Business jokes', 'The world is divided into two groups. There are those who know, and those who dont know. Those who know are no problem.Those who dont know are also in two groups.One is those who dont know and know they dont know. Well, they can learn!But then, there are those who dont know, and dont know they dont know. And they become unit managers!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2463, 'Business jokes', 'A friend of mine was a frequent user of a pay telephone at a popular truck stop, and was greatly inconvenienced when the phone went out of commission.Repeated requests for repair brought only promises.After several days, the phone company was again contacted and told that there was no longer a rush.The phone was now working fine--except that all money was being returned upon completion of each call.A repairman arrived within the hour!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2464, 'Business jokes', 'A young man asked an old rich man how he made his money.The old guy fingered his worsted wool vest and said, "Well, son, it was 1932. The depth of the Great Depression. I was down to my last nickel."I invested that nickel in an apple. I spent the entire day polishing the apple and, at the end of the day, I sold the apple for ten cents."The next morning, I invested those ten cents in two apples. I spent the entire day polishing them and sold them at 5:00 pm for 20 cents. I continued this system for a month, by the end of which Id accumulated a fortune of $1.37.""And thats how you built an empire?" the boy asked."Heavens, no!" the man replied. "Then my wifes father died and left us two million dollars."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2465, 'Business jokes', 'Q: What does Santa call his wife at tax time?A: A dependent Claus.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2466, 'Business jokes', 'Q: What do you call a credit union volunteer in a room full of bank directors?A: A superior being.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2467, 'Business jokes', 'Q: Why did the bank drive-up window teller have tire tread marks across the back of his grey suit?A: From crawling across the street when the sign said: "Dont Walk."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2468, 'Business jokes', 'Tom was so excited about his promotion to Vice President of the company he worked for and kept bragging about it to his wife for weeks on end. Finally she couldnt take it any longer, and told him, "Listen, it means nothing, they even have a vice president of peas at the grocery store!". "Really?" he said. Not sure if this was true or not, Tom decided to call the grocery store. A clerk answers and Tom says "Can I please talk to the Vice President of peas?" The clerk replies "Canned or frozen?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2469, 'Business jokes', 'A motorist, driving by a Texas ranch, hit and killed a calf that was crossing the road. The driver went to the owner of the calf and explained what had happened. He then asked what the animal was worth. "Oh, about $200 today," said the rancher. "But in six years it would have been worth $900. So $900 is what Im out." The motorist sat down and wrote out a check and handed it to the farmer. "Here," he said, "is the check for $900. Its postdated six years from now."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2470, 'Business jokes', 'According to inside contacts, the Japanese banking crisis shows no signs of ameliorating. If anything, its getting worse.Following last weeks news that Origami Bank had folded, we are hearing that Sumo Bank has gone belly up, and Bonsai Bank plans to cut back some of its branches. Karaoke Bank is up for sale, and it is (you guessed it!) going for a song.Meanwhile, shares in Kamikaze Bank have nose-dived, and 500 back-office staff at Karate Bank got the chop. Analysts report that there is something fishy going on at Sushi Bank, and staff there fear they may get a raw deal.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2471, 'Business jokes', 'The banker fell overboard from a friends sailboat.The friend grabbed a life preserver, held it up, not knowing if the banker could swim, and shouted, "Can you float alone?""Obviously," the banker replied, "but this is a heck of a time to talk business."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2472, 'Business jokes', 'A wealthy investor walked into a bank and said to the bank manager, "I would like to speak with Mr. Reginald Jones, who I understand is a tried and trusted employee of yours."The banker said, "Yes he certainly was trusted. And he will be tried as soon as we catch him."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2473, 'Business jokes', '"Im not saying that the customer service in my bank is bad, but when I went in the other day and asked the clerk to check my balance ... she leaned over and pushed me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2474, 'Business jokes', '"The fees for withdrawing money from your ATM machines are expected to double, even triple. Youre gonna pay two to three as much to withdraw your money so basically the ATM machines have become full service. Instead of getting robbed at the ATM machine the ATM machine robs you. You eliminate the middle man." - Jay Leno', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2475, 'Business jokes', 'Did you hear about the banker who was recently arrested for embezzling $100,000 to pay for his daughters college education?As the policeman, who also had a daughter in college, was leading him away in handcuffs, he said to the banker, "I have just one question for you. Where were you going to get the rest of the money?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2476, 'Business jokes', 'An investment counselor decided to go out on her own. She was shrewd and diligent, so business kept coming in, and pretty soon she realized that she needed an in-house counsel. The investment banker began to interview young lawyers."As Im sure you can understand," she started off with one of the first applicants, "in a business like this, our personal integrity must be beyond question." She leaned forward. "Mr. Mayberry, are you an honest lawyer?""Honest?" replied the job prospect. "Let me tell you something about honest. Why, Im so honest that my father lent me $15,000 for my education, and I paid back every penny the minute I tried my very first case.""Impressive. And what sort of case was that?" asked the investment counselor.The lawyer squirmed in his seat and admitted, "He sued me for the money."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2477, 'Business jokes', 'An American manufacturer is showing his machine factory to a potential customer from Albania. At noon, when the lunch whistle blows, two thousand men and women immediately stop work and leave the building."Your workers, theyre escaping!" cries the visitor. "Youve got to stop them.""Dont worry, theyll be back," says the American. And indeed, at exactly one oclock the whistle blows again, and all the workers return from their break.When the tour is over, the manufacturer turns to his guest and says, "Well, now, which of these machines would you like to order?""Forget the machines," says the visitor. "How much do you want for that whistle?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2478, 'Business jokes', 'The Mafia was looking for a new man to make weekly collections from all the private businesses that they were protecting. Feeling the heat from the police force, they decide to use a deaf person for this job, figuring if he were to get caught, he wouldnt be able to communicate to the police what he was doing. In his first week, the deaf collector picks up more than $40,000. He gets greedy, decides to keep the money, and stashes it in a safe place. The Mafia boss soon realizes the collection is late and sends some of his thugs after the deaf collector. The thugs drag the guy to an interpreter. The right-hand man says to the interpreter, "Ask him where da money is." The interpreter signs, "Wheres the money?" The deaf collector signs, "I dont know what youre talking about." The interpreter tells the main man, "He says he doesnt know what youre talking abo ut." The main man pulls out a .38 and places it in the ear of the deaf collector. "NOW ask him where da money is." The interpreter signs, "Where is the money?" The deaf collector signs, "The $40,000 is in a tree stump in Central Park just east of the big fountain." The interpreters eyes light up, and he says to the thug, "He says he still doesnt know what youre talking about, and doesnt think you have the guts to pull the trigger."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2479, 'Business jokes', 'An Arthur Anderson partner comes back to his office and says to his manager, "Did you get my message where I said, Ship the Enron documents to the Feds?"The manager goes white. "Oh My God! I thought you said rip the Enron documents to shreds."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2480, 'Business jokes', 'An applicant was filling out a job application. When he came to the question, "Have you ever been arrested?" He answered, "No."The next question, intended for people who had answered in the affirmative to the last one, was "Why?" The applicant answered it anyway: "Never got caught."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2481, 'Business jokes', '"Young man, do you think you can handle a variety of work?""I ought to be able to. Ive had ten different jobs in four months."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2482, 'Business jokes', 'A young man, hired by a supermarket, reported for his first day of work. The manager greeted him with a warm handshake and a smile, gave him a broom and said, "your first job will be to sweep out the store.""But Im a college graduate," the young man replied indignantly."Oh, Im sorry. I didnt know that," said the manager. "Here, give me the broom, Ill show you how."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2483, 'Business jokes', 'The boss called one of his employees into the office. "Rob," he said, "youve been with the company for a year. You started off in the post room, one week later you were promoted to a sales position, and one month after that you were promoted to district manager of the sales department. "Just four short months later, you were promoted to vice-chairman. Now its time for me to retire, and I want you to take over the company. "What do you say to that?" "Thanks," said the employee. "Thanks?" the boss replied. "Is that all you can say?" "I suppose not," the employee said. "Thanks, Dad."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2484, 'Business jokes', 'A young businessman rented a beautiful office and furnished it with antiques. However, no business was coming in. Sitting there, worrying, he saw a man come into the outer office. Wanting to look busy, he picked up the phone and pretended he was negotiating a big deal. He spoke loudly about big figures and huge commitments. Finally, he put down the phone and asked the visitor "Can I help you?" The man said, "Ive come to install the phone."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2485, 'Business jokes', 'Two Italian construction workers were in the field on an extremely hot day working.. the one says to the other " hey how come we do all a da work and he gets all a da money?" pointing to the supervisor. The other says, "I dont know, go ask him." So Guido goes up to the supervisor and says "Hey, how come we do all a da work and you get all a da money?" The supervisor says "Intelligence".Guido says "what is this intelligence?"The supervisor puts his hand on a tree and says "Hita myhand as hard as you can!"Guido winds up and with all his might tries to hit thesupervisors hand. Just as he almost does the supervisorpulls his hand away and Guido hits the tree! The supervisorsays "Thats intelligence".Still smarting Guido goes back to his co-worker and hisco-worker says "Hey what did he say?"With a sheepish look on his face Guido puts his hand on hisface and says "hita my hand as hard as  you can. . ."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2486, 'Business jokes', '"Information? I need the number of the Caseway Insurance Company." "Would you spell that, please?" "Certainly. C as in sea. A as in aye. S as in sea. E as in eye. W as in why. A as in are. Y as in you." The operator pauses. "Just a minute, sir. Ill connect you with my supervisor . . ."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2487, 'Business jokes', 'Why did the doughnut maker retire? He was fed up with the hole business.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2488, 'Business jokes', 'What business is King Kong in? Monkey business.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2489, 'Business jokes', 'Did you hear about the businessman who is so rich he has two swimming pools, one of which is always empty? Its for people who cant swim!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2490, 'Business jokes', 'Monster: Stick em down. Ghost: Dont you mean, stick em up. Monster: No wonder Im not making much money in this business.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2491, 'Business jokes', 'What happens when business is slow at a medicine factory? You can hear a cough drop.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2492, 'Business jokes', 'What did the ruthless businessman say to his employees? If at first you dont succeed - youre fired!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2493, 'Business jokes', 'On the first day his son joined the family firm, the founder took him on to the roof of the factory building and said,I am going to give you your very first lesson in business. Stand on the edge of the roof. Reluctantly, the boy went to stand on the edge of the roof. Now, said his father, when I say, "Jump," I want you to jump off the roof. But, Dad, said the boy, theres a huge drop! Do you want to succeed in business? Yes, Dad. And you trust me, dont you? Yes, Dad. So do as I say and jump. The boy jumped. He crashed to the ground and lay there, winded and bruised. His father went racing down the stairs and ran up to him. That was your first lesson in business, son. Never trust anyone.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2494, 'Business jokes', 'There was once a high-powered businessman who insisted on taking his three secretaries everywhere with him - a tall one for writing longhand, a short one for taking down shorthand, and a very small one for adding footnotes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2495, 'Business jokes', 'Mom and Dad are in the iron and steel business. She does the ironing and he does the stealing.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2496, 'Business jokes', 'Kowalski, fresh out of accounting school, went to a interview for a good paying job. The company boss asked various questions about him and his education, but then asked him, "What is three times seven?""Twenty-two," Kowalski replied.After he left, he double-checked it on his calculator (he knew he should have taken it to the interview!) and realized he wouldnt get the job.About two weeks later, he got a letter that said he was hired for the job! He was not one to look a gift horse in the mouth, but was still very curious.The next day, Kowalski went in and asked why he got the job, even though he got such a simple question wrong. The boss shrugged and said, "Well, you were the closest."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2497, 'Business jokes', 'Two government economists were returning home from a field meeting. As with all government travelers, they were assigned the cheapest seats on the plane so they each were occupying the center seat on opposite sides of the aisle.They continued their discussion of the knotty problem that had been the subject of their meeting through takeoff and meal service until finally one of the passengers in an aisle seat offered to trade places so they could talk and he could sleep.After switching seats, one economist remarked to the other that it was the first time an economic discussion ever kept anyone awake.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2498, 'Business jokes', 'An American manufacturer is showing his machine factory to a potential customer from Albania. At noon, when the lunch whistle blows, two thousand men and women immediately stop work and leave the building."Your workers, theyre escaping!" cries the visitor. "Youve got to stop them.""Dont worry, theyll be back," says the American. And indeed, at exactly one oclock the whistle blows again, and all the workers return from their break.When the tour is over, the manufacturer turns to his guest and says, "Well, now, which of these machines would you like to order?""Forget the machines," says the visitor. "How much do you want for that whistle?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2499, 'Business jokes', 'Im very sad to announce this morning, girls, that Miss Jones has decided to retire, said the principal at morning assembly.  Now we will all stand and sing this mornings hymn....now Thank We All Our God.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2500, 'Business jokes', 'A businessman who needed millions of dollars to clinch an important deal went to church to pray for the money. By chance he knelt next to a man who was praying for $100 to pay an urgent debt. The businessman took out his wallet and pressed $100 into the other mans hand. Overjoyed, the man got up and left the church.The businessman then closed his eyes and prayed, "And now, Lord, that I have your undivided attention .... "', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2501, 'Business jokes', 'After being laid off from five different jobs in four months, Arnold was hired by a warehouse. One day he lost control of a forklift and drove it off the loading dock. Surveying the damage, the owner shook his head and said hed have to withhold ten percent of Arnolds wages to pay for the repairs. "How much will it cost?" asked Arnold. "About $4,500," said the owner. "What a relief!" exclaimed Arnold. Ive finally got job security!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2502, 'Business jokes', 'Boss: "Ive decided to use humor in the office. Experts say humor eases tension, which is important in times when the work force is being trimmed. "Knock knock." Employee: "Whos there?" Boss: "Not you anymore."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2503, 'Business jokes', 'Boss: "I can assure you that the value of the average employee will continue to increase." Employee: "Thats because there will be fewer of us doing more work, right?" Boss: "Right. Except for the us part."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2504, 'Business jokes', 'INTERVIEWER to job applicant: "Do you think you could come up with any reason you want this job other than your parents want you out of their house?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2505, 'Business jokes', 'The social worker asked the bartender "Whats the difference between your job and mine?" The bartender replied: "I only had to go to bartender school for 6 weeks and I learned to mix a very good drinks, than wait a couple of hours to have people tell me their innermost thoughts while you went to school for 6 years, paid thousands and thousands of dollars, sit session after session using technique after technique, and you still may never hear them!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2506, 'Business jokes', 'The Americans and the Japanese decided to engage in a boat race. Both teams practiced hard and long to reach their peak performance levels. On the big day they felt ready. The Japanese won by a mile. The American team was discouraged by the loss. Morale sagged. Corporate management decided that the reason for the crushing defeat had to be found, so a consulting firm was hired to investigate the problem and recommend corrective action. The Japanese team had six people rowing and one person steering and rowing; the American team had two people rowing and five people steering. After a year of study and thousands spent analyzing the problem, the consultant firm concluded that too many people were steering and not enough were rowing on the American team. So as race day neared again the following year, the American teams management structure was completely reorganized. The new structure for the American s was: one quality assurance manager, two steering managers, one area steering managers, and a new performance review manager for the two people rowing the boat to provide work incentive. That year, the Japanese won by TWO miles !!! Humiliated, the American corporation laid off the rowers for poor performance and gave the managers a bonus for discovering the problem.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2507, 'Business jokes', 'Why did the electrician close early on Mondays?Because business was very light.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2508, 'Car and train jokes', 'Kelly was standing in front of Cohans Tavern when he saw a driverless car rolling slowly down the street. He ran to the car, jumped in, and pulled on the emergency brake with a jerk. Kelly got out and very proudly said to the man approaching him, "I stopped it!" "I know, you idiot!" said the man. "I was pushing it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2509, 'Car and train jokes', 'An Irish priest and a Rabbi get into a car accident. They both get out of their cars and stumble over to the side of the road. The Rabbi says, "Oy vey! What a wreck!" The priest asks him, "Are you all right, Rabbi?" The Rabbi responds, "Just a little shaken." The priest pulls a flask of whiskey from his coat and says, "Here, drink some of this it will calm your nerves." The Rabbi takes the flask and drinks it down and says, "Well, what are we going to tell the police?" "Well," the priest says, "I dont know what your aft to be tellin them. But Ill be tellin them I wasnt the one drinkin."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2510, 'Car and train jokes', 'It had been snowing for hours when an announcement came over the intercom: "Will the students who are parked on University Drive please move their cars so that we may being plowing." Twenty minutes later there was another announcement: "Will the nine hundred students who went to move fourteen cars return to class."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2511, 'Car and train jokes', 'While driving along the back roads of a small town, two truckers came to an overpass with a sign that read CLEARANCE 113."They got out and measured their rig, which was 124.""What do you think?" one asked the other.The driver looked around carefully, then shifted into first. "Not a cop in sight. Lets take a chance!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2512, 'Car and train jokes', 'A man goes out and buys the best car available in the US or Europe, a 2001 Turbo BeepBeep. It is the best and most expensive car in the world, and it runs him $500,000. He takes it out for a spin and, while doing so, stops for a red light. An old man on a moped, both looking about 90 years old, pulls up next to him.The old man looks over the sleek, shiny surface of the car and asks "What kind of car ya got there, sonny?".The dude replies "A 2001 Turbo BeepBeep. They cost $500,000.""Thats a lotta money!" says the old man, shocked. "Why does it cost so much?""Cause this car can do up to 320 miles an hour!" states the cool dude proudly.The old man asks "Can I take a look inside?""Sure" replies the owner.So the old man pokes his head in the window and looks around. Leaning back on his moped, the old man says "Thats a pretty nice car, alright!"Just  then the light changes, so the guy decides to show the old man what his car can do. He floors it, and within 30 seconds the speedometer reads 320. Suddenly, the guy notices a dot in his rear view mirror. It seems to be getting closer!Whhhoooooooooossssshhhhhh! Something whips by him! Going maybe three times as fast!The guy wonders "what on earth could be going faster than my Turbo BeepBeeP?" Then, ahead of him, he sees a dot coming toward him.Whooooooooooosh! Goes by again! And, it almost looked like the old man on the moped! Couldnt be thinks the guy. How could a moped outrun a Turbo BeepBeep? Again, he sees a dot in his rearview mirror!WhoooooooshhhhhhhhKa-BbbbblaMMMMM! It plows into the back of his car, demolishing the rear end.The guy jumps out and discovers it is the old man! Of course, the moped and the old man are hurting for certain. The guy runs up to the dying old man and asks "You re hurt bad! Is there anything I can do for you?"The old man replies "Yeah. Unhook my suspenders from the side-view mirror on your car!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2513, 'Car and train jokes', 'A young man comes home and says "Dad, just got my drivers license and would like to use the family car."Father replies, :"O.K., son. But, first, you have to get good grades in school, keep your room clean, make the yard is neat, and cut your hair. Come back in a few months and then well see."Well, several months pass and the young man comes into the house with his report card in his hand. "Dad, I got great marks on my report card. Ive been keeping my room as neat as a pin, and the yard is always ship-shape. How about letting me use the car?"Father replies, "Thats all true, but son you didnt cut your hair."Son says, "But, dad, Jesus had long hair."Father replies, "Yes, son, youre perfectly right. And he walked everywhere he went."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2514, 'Car and train jokes', 'Q: Do you yield when a blind pedestrian is crossing the road?A: What for? He cant see my license plate.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2515, 'Car and train jokes', 'Q: Who has the right of way when four cars approach a four-way stop at the same time?A: The pick up truck with the gun rack and the bumper sticker saying, "Guns dont kill people. I do."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2516, 'Car and train jokes', 'Q: When driving through fog, what should you use?A: Your car.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2517, 'Car and train jokes', 'Q: How can you reduce the possibility of having an accident?A: Be too drunk to find your keys.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2518, 'Car and train jokes', 'Q: What changes would occur in your lifestyle if you could no longer drive lawfully?A: I would be forced to drive unlawfully.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2519, 'Car and train jokes', 'Q: What is the difference between a flashing red traffic light and a flashing yellow traffic light?A: The color.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2520, 'Car and train jokes', 'Q: How do you deal with heavy traffic?A: Heavy psychedelics.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2521, 'Car and train jokes', 'Q: What can you do to help ease a heavy traffic problem?A: Carry loaded weapons.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2522, 'Car and train jokes', 'A driver tucked this note under the windshield wiper of his automobile. "Ive circled the block for 20 minutes. Im late for an appointment, and if I dont park here Ill lose my job. Forgive us our trespasses." When he came back he found a parking ticket and this note: "Ive circled the block for 20 years, and if I dont give you a ticket, Ill lose my job. Lead us not into temptation."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2523, 'Car and train jokes', 'A guy driving a Yugo pulled up to a stoplight next to a Rolls-Royce. He rolled down his window and shouted to the driver of the Rolls. "Hey, buddy, thats a nice car. You got a phone in your Rolls? Ive got a phone in my Yugo!" The driver of the Rolls looked over and said snobbishly, "Yes, I have a phone." The driver of the Yugo said, "Cool! Hey, you also got a fridge in there, too? Ive got one in the back seat of my Yugo!" The driver of the Rolls, much annoyed, says, "Yes, I have a refrigerator." The driver of the Yugo said, "Thats great, man! Hey, you got a TV in there? You know, I got a TV in the back seat of my Yugo!" The driver of the Rolls, quite irritated by now, replied, "Of course, I have a television. A Rolls-Royce is the finest luxury car in the world!" The driver of the Yugo said, "Yes, a very cool car! Hey, you got a bed in there? I  got a bed in the back of my Yugo!" The driver of the Rolls, upset that he did not have a bed, sped away and went straight to the dealer, where he promptly ordered a bed to be installed in the back of his Rolls-Royce. The next morning, he returned to pick up his car, and the bed looked superb It came complete with silk sheets and a brass-trimmed headboard. It was clearly a bed fit for a Rolls-Royce. So the driver of the Rolls began searching for the Yugo. He drove around all day and finally found the Yugo late that night. It was parked, with all the windows fogged up from the inside. He got out and knocked on the window of the Yugo. When there wasnt any answer, he continued knocking and knocking until finally, the owner of the Yugo lowered the window, and stuck his soaking wet head out. "I now have a bed in the back of my Rolls-Royce," the driver of the Rolls stated arrogantly. The driver of th e Yugo looked at him narrowly and said, "You got me out of the shower to tell me that?!?!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2524, 'Car and train jokes', '"When you exit the bus, please be sure to lower your head and watch your step.""If you miss your step and hit your head, please lower your voice and watch your language. Thank you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2525, 'Car and train jokes', 'In a very small alley two trucks driving in opposite directions meet.As the drivers are equally stubborn, neither of them wants to reverse.They angrily look one at the other.Finally, one of them picks up a newspaper and starts reading.The other one politely asks, "When youve finished the paper, will you please bring it over, and let me read it?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2526, 'Car and train jokes', 'After seeing a documentary on how inner city youths can removethe wheels of cars in under 4 seconds with no specialistequipment, the McLaren team decided to fire their pit crew andhire four of the youths as most races can be won or lost in thepit lane.The first race came along and the car came into the pits. Theyouths went to work but the McLaren team boss noticed a realproblem.Not only had the youths replaced all four wheels within fourseconds, but within 10 seconds, theyd re-sprayed and re-numbered the car and sold it to the Ferrari Team!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2527, 'Car and train jokes', 'Five Englishmen in an Audi Quattro arrive at the Italian border.The Italian customer agent stops them and tells them: "Itsa illegal to putta fiva people ina Quattro.""What do you mean its illegal?" asked the Englishmen."Quattro means four," replies the Italian official."Quattro is just the name of the automobile," the Englishmen says disbelievingly. "Look at the papers: this car is designed to carry 5 persons.""You canta pulla thata one ona me," replies the Italian customs agent."Quattro means four. You hava fiva people ina your car and you are therefore breakina the law".The Englishmen reply angrily, "You idiot! Call your supervisor over We want to speak to someone with more intelligence!""Sorry," responds the Italian official, "he canta come"."Hes a busy with two guys in a Uno".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2528, 'Car and train jokes', 'Andy wants a job as a signalman on the railways. He is told to meet the inspector at the signal box. The inspector puts this question to him: "What would you do if you realised that two trains were heading for each other on the same track?"Andy says, "I would switch the points for one of the trains.""What if the lever broke?" asked the inspector. "Then Id dash down out of the signal box," said Andy, "and Id use the manual lever over there." "What if that had been struck by lightning?" "Then," Andy continues, "Id run back into the signal box and phone the next signal box." "What if the phone was engaged?" "Well in that case," persevered Andy, "Id rush down out of the box and use the public emergency phone at the level crossing up there." "What if that was vandalised?" "Oh well then Id run into the village and get my uncle Silas."This puzzles the inspector, so he asks, "Why  would you do that?" Came the answer, "Because hes never seen a train crash."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2529, 'Car and train jokes', 'A man walks into an auto parts store and says "Id like a rear view mirror for my Yugo."The man behind the counter thinks about this for a while, then says "Yup, seems like a fair trade to me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2530, 'Car and train jokes', 'One day, two guys were driving to a local grocery store to get some food. On the way to the store they ran into an intersection with a stoplight. The light showed red.The man driving went right through the red light. The passenger looked at the driver and screamed, "What the heck are you doing? Youre going to get us killed!"Then the driver responded, "Dont worry, my mother allways drives like this."So later on, the two guys came to another stoplight and that too was red. The driver sped right through the light. Again the passenger looked at the driver and said, "I thought I told you, youre gonna get us killed! Would you please stop this nonsense!"The driver looked at the passenger and responded, "I get it! But like I told already, you my mother drives like this all the time!" Again, the two guys ran into another light. This time in was green. The driver slammed  on his brakes and stopped the car completely. "What the hell are you doing?" The passenger screamed. "This is the third time you almost got us killed. Why did you stop at a green light?"The driver replied, "Thats my moms car coming over there!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2531, 'Car and train jokes', 'Ole and Lena were sitting down to their usual morning cup of coffee, listening to the weather report coming over the radio."There will be 3 to 5 inches of snow today, and a snow emergency has been declared," the weather report said. "You must park your cars on the odd numbered side of the streets."Ole says "Jeez, okay," and gets up from his coffee.The next day theyre sitting down with their morning cups of coffee and the weather forecast declares "There will be 2 to 4 inches of snow today, and a snow emergency has been declared. You must park your cars on the even numbered side of the streets."Again, Ole says "Jeez, okay," and gets up from his coffee.Two days later, again theyre sitting down with their cups of coffee and the weather forecast says, "There will be 6 to 9 inches of snow today, and a snow emergency has been declared. You must park your cars on the -  "Just then the power goes out and Ole doesnt get the rest of the instructions.He turns to Lena and says "Jeez, what am I going to do now, Lena?"Lena replies "Aw, Ole, why dont you just leave the car in the garage today?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2532, 'Car and train jokes', 'A tourist is picked up by a cabbie in New York on a dark night. The passenger taps the driver on the shoulder to ask him something. The driver screams, loses control of the car, nearly hits a bus, drives up on the sidewalk, and stops inches from a shop window. For a second everything went quiet in the cab, then the driver said, "Look friend, dont EVER do that again. You scared the daylights out of me!" The passenger apologizes and says he didnt realize that a "little tap" could scare him so much. The driver, after gathering himself together replied, "Sorry, its not really your fault. Today is my first day as a cab driver - Ive been driving hearses for the last 25 years!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2533, 'Car and train jokes', 'Peter Ludwig, a caver from Austria who is appalled by American drivinghabits, offers the following advice:The probability of being involved in a traffic accident is directlyproportional to time spent on the road. Driving fast decreases onesexposure.One third of traffic accidents are caused by drunk drivers; two thirdsare caused by non-drunk drivers.Therefore, the safest way to drive is drunk and VERY fast.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2534, 'Car and train jokes', 'A Lutheran minister is driving down to New York to see the radio show and hes stopped in Connecticut for speeding. The state trooper smells alcohol on his breath and then he sees an empty wine bottle on the floor, and he says, "Sir, have you been drinking?"And the minister says, "Just water."The sheriff says, "Then why do I smell wine?"And the minister looks down at the bottle and says, "Good Lord, Hes done it again!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2535, 'Car and train jokes', 'a quadruple amputee is waiting at the bus stop.The bus pulls up.Driver says"alright John, how you getting on today?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2536, 'Car and train jokes', 'A driver, obviously drunk, was heading the wrong way downa one-way street when a policeman pulled him over. "Didntyou see the arrow, buddy?" he asked."An arrow?" the confused driver said. "I didnt even see theIndians', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2537, 'Car and train jokes', 'A state trooper pulled a car over and told the man drivingthat he was going 50 mph in a 40 mph zone."I was only going 40!" the driver protested."Not according to my radar," the trooper said."Yes, I was!" the man shouted back."No you werent!" the trooper said.With that, the mans wife leaned toward the window and said,Officer, I should warn you not to argue with my husband whenhes been drinking."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2538, 'Car and train jokes', 'A guy driving a truck in the middle of nowhere picks up a hitch-hiker.It gets dark and the hitch-hiker falls asleep. Suddenly bang, and thehitch-hiker wakes up,"what the hell was that?". The truck driverreplies, "some kinda animal, go back to sleep."Further the same thing again, bang, "What the hell was that?","some kinda animal again."Further into the night, bang, bang, bang, "What the hell was that?","Some bastard!". "How terrible",says the hitch-hiker, "but there were3 bangs"The truck driver replies, "Yeah, well I had to go through two fencesto get the bastard. . ."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2539, 'Car and train jokes', 'A man was driving up a steep and narrow mountain road.A woman was driving down the same road. As they passed each other, the woman leaned out thewindow and yelled, "Pig!" The man immediately leaned out his window and replied,"Moron!" They continue on their way and as the man rounded thenext corner, he crashes into a pig in the middle of theroad.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2540, 'Car and train jokes', 'A man is driving down the road for a long period of time. During his travel, he sees a priest with a gas can hitch hiking, so he gladly picks him up he says,"Normally father, i dont pick up hitchhikers. You seem like a man of dignity so i thought id make an exception.In fact i hate hitch hikers. The priest nods his head and they drive onAlong the way, The driver spots another man hitch hiking. "that dirty sonof %$#%#% ill fix him". He then swirves the car and tries to make the hitand run like an accident. Dang! i missed. The priests yells,"Dont worryi got him with the gas can!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2541, 'Car and train jokes', 'A young bloke has started work on a property, and the boss sends him up the back paddocks to do some fencing work, but come evening hes half an hour late. The boss gets on the CB radio to check if hes all right."Ive got a problem, Boss. Im stuck ere. Ive hit a pig!""Ah well, these things happen sometimes," the boss says. "Just drag the carcass off the road so nobody else hits it in the dark.""But hes not dead, boss. Hes gotten tangled up on the bull bar, and Ive tried to untangle him, but hes kicking and squealing, and hes real big boss. Im afraid hes gonna hurt me!""Never mind," says the boss. "Theres a .303 under the tarp in the back. Get that out and shoot him. Then drag the carcass off the road and come on home." "Okay, boss."Another half an hour goes by, but theres still not a peep from the young fella. The boss  gets back on the CB. "Whats the problem, son?""Well, I did what you said boss, but Im still stuck.""Whats up? Did you drag the pig off the road like I said?""Yeah boss, but his motorcycle is still jammed under the truck."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2542, 'Car and train jokes', 'A driver pulled up beside a rundown farmhouse. He got out and knocked at the door. A very old woman answered the door, and he asked her for directions to Des Moines."Dont know," the woman said.He got back in his car and pulled away. Then he heard voices. He looked in his rearview mirror and saw the woman and an equally old man waving for him to come back. So he made a U- turn and drove up to them."This is my husband," the old woman said. "He doesnt know how to get to Des Moines either."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2543, 'Car and train jokes', 'WIFE: "Theres trouble with the car. It has water in the carburettor."HUSBAND: "Water in the carburettor? Thats ridiculous."WIFE: "I tell you the car has water in the carburettor."HUSBAND: "You dont even know what a carburettor is. Ill check it out.Wheres the car?"WIFE: "In the pool."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2544, 'Car and train jokes', 'A fellow was following a truck in heavy traffic. Every block or so, when they were stopped at a stop light, the driver of the truck would jump out of the cab with a big stick and bang on the side of the cargo bay. Hed then jump back into the cab in time to drive away when the signal changed. The first fellow observed this for several miles, until he could stand it no longer. The next time the truck driver jumped out with the stick, the first fellow jumped out and ran up to him. "Im sorry to bother you," he said, over the din of the banging, "but I am very curious; could you tellme what you are doing?" Without breaking rhythm, the truck driver replied, "Sure, Mac. Ya see, this heres a six-ton truck but Ive got eight tons of canaries aboard, so Ive gotta keep two ton of them flying all the time so  I dont break an axle".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2545, 'Car and train jokes', 'Two cab drivers met."Hey," asked one, "whats the idea of painting one side of your cab red and the other side blue?""Well," the other responded, "when I get into an accident, you should see how all the witnesses contradict each other."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2546, 'Car and train jokes', 'What do you say to a one legged hitch-hiker?Hop in.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2547, 'Car and train jokes', 'One day a guy was driving with his 4-year-old daughterand beeped his car horn by mistake.She turned and looked at him for an explanation.He said, "I did that by accident."She replied, "I know that, daddy."He replied, "Howd you know?"The girl said, "Because you didnt say ASSHOLE! afterwards!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2548, 'Car and train jokes', 'After spending 3-1/2 hours enduring the long lines, surly clerks, andinsane regulations at the department of motor vehicles, I stopped at atoy store to pick up a gift for my son. I brought my selection - a baseball bat - to the cash register. "Cash or charge?" the clerk asked."Cash," I snapped. Then, apologizing for my rudeness, I explained, "Ive spent the afternoon at the motor-vehicle bureau.""Shall I giftwrap the bat?" the clerk asked sweetly. "Or are you goingback there?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2549, 'Car and train jokes', 'Whats black and white and red all over?A nun in a car accident.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2550, 'Car and train jokes', 'What did the monster say when he saw a rush hour train full of passengers? Oh good! A chew chew train!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2551, 'Car and train jokes', 'What is evil and ugly and goes at 125 mph? A witch in a high speed train.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2552, 'Car and train jokes', 'Where do ghost trains stop? At devil crossings.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2553, 'Car and train jokes', 'Why do you have to wait so long for a ghost train to come along? They only run a skeleton service.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2554, 'Car and train jokes', 'Monster: Ive got to walk 25 miles home. Ghost: Why dont you take a train. Monster: I did once, but my mother made me give it back.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2555, 'Car and train jokes', 'Did you hear about the boy who had to do a project on trains? He had to keep track of everything!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2556, 'Car and train jokes', 'What do you call a witch who drives really badly? A road hag.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2557, 'Car and train jokes', 'Why did the stupid racing car driver make ten pit stops during the Grand Prix? He was asking for directions.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2558, 'Car and train jokes', 'Whats the difference between a teacher and a conductor on the railroad? One trains the mind, the other minds the train.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2559, 'Car and train jokes', 'What do you get if you cross a Rolls Royce with a vampire? A monster that attacks expensive cars and sucks out their gas tanks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2560, 'Car and train jokes', 'Auntie Maud bought herself a new rear-engine European car. She took an old friend for a drive, but after only half a mile the car broke down. Both women got out and opened up the front of the car. "Oh. Maud," said her friend, "youve lost your engine!" "Never mind, dear," said auntie. "Ive got a spare one in the trunk."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2561, 'Car and train jokes', 'How do you stop a dog howling in the back of a car? Put him in the front.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2562, 'Car and train jokes', 'What car do insects drive? A Volkswagen automobile.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2563, 'Car and train jokes', 'My dad is stupid. He thinks a fjord is a Norwegian motor car.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2564, 'Car and train jokes', 'What is the meaning of afford?Its the car most sales representatives drive.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2565, 'Car and train jokes', 'Two wizards in a car were driving along and the police were chasing them for speeding. One said, "What are we going to do?" The other replied, "Quick, turn the car into a side street."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2566, 'Car and train jokes', 'What happens when a frogs car breaks down? It gets toad away..', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2567, 'Car and train jokes', 'Why did the car judder to a stop when it saw a ghost? It had a nervous breakdown.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2568, 'Car and train jokes', 'If you watch the way that many motorists drive you will soon reach the conclusion that the most dangerous part of a car is the nut behind the wheel.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2569, 'Car and train jokes', 'What should a teacher take if hes run down? The number of the car that hit him.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2570, 'Car and train jokes', 'What sort of a car has your dad got? I cant remember the name. I think it starts with T. Really - Ours only starts with gas.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2571, 'Car and train jokes', 'A man was in court charged with parking his car in a restricted area. The judge asked if he had anything to say in his defense. "They shouldnt put up such misleading notices," said the man. "It said FINE FOR PARKING HERE."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2572, 'Car and train jokes', 'On Freds 17th birthday, his Dad said hed take him out for his first driving lesson. As they got in the car, the father said, "Just one thing, Fred. If youre going to hit anything, make sure its cheap."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2573, 'Car and train jokes', 'What is an autobiography? The life story of an automobile.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2574, 'Car and train jokes', 'What is an autograph? A chart which shows car sales.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2575, 'Car and train jokes', 'Learner driver: What happens when everythings coming your way? Instructor: Youre in the wrong lane.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2576, 'Car and train jokes', '"Take the wheel, Harry!" said the nervous lady driver. "Theres a tree coming straight for us!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2577, 'Car and train jokes', 'A man whose son had just passed his driving test went home one evening and found that the boy had driven slap into the living room. "How did you manage to do that?" he fumed. "Quite simple, Dad. I came in through the kitchen and turned left!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2578, 'Car and train jokes', 'You know all that talk about backseat driving? Well, Ive been driving all my life and can safely say that Ive never heard a word from the back seat. What kind of car do you drive? A hearse!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2579, 'Car and train jokes', 'My sisters a really bad driver. What makes you say that? Every time she goes out in the car, Dad puts a glass panel in the floor so that she can see who shes run over.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2580, 'Car and train jokes', 'A motorist ran into a shop. "Do you own a black and white cat?" he asked. "No," replied the manager. "Oh dear," said the motorist, "I must have run over a nun."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2581, 'Car and train jokes', 'A passenger train is creeping along, slowly. Finally it creaks to a halt. A passenger sees a conductor walking by outside."Whats going on?" she yells out the window."Cow on the track!" replies the conductor.Ten minutes later, the train resumes its slow pace.Within five minutes, however, it stops again.The woman sees the same conductor walk again.She leans out the window and yells, "What happened? Did we catch up with the cow again?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2582, 'Car and train jokes', 'How did the woman feel when she got run over by a car? Tired.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2583, 'Car and train jokes', 'Why is it not safe to doze on trains? Because they run over sleepers.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2584, 'Car and train jokes', 'Whats the difference between a schoolteacher and a train driver? A schoolteacher says, "Spit out that toffee" and a train says, "Choo, choo."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2585, 'Car and train jokes', 'Which snakes are found on cars? Windscreen vipers.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2586, 'Car and train jokes', 'Motorist: When I bought this car you told me it was rust-free, but underneath its covered with rustDealer: Yes, sir. The car is rust-free. We didnt charge you for it, did we?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2587, 'Car and train jokes', 'Motorist: Does a deer have a horn?Police Officer: No, a deer has two horns.Motorist: Then it must have been a car that ran over my uncle.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2588, 'Car and train jokes', 'Police Officer: Why are you driving in a bathing suit?Motorist: Im in a car pool.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2589, 'Car and train jokes', 'Police Officer: Why were you speeding?Women Driver: I was late for traffic school.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2590, 'Car and train jokes', 'Policeman: Are you going to a fire?Motorist: No, Im trying to prevent one. Thats what my boss said would happen if I were late again.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2591, 'Car and train jokes', 'Policeman: Did you realize you just missed that bus with your car?Motorist: Did you want me to hit it?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2592, 'Car and train jokes', 'Policeman: Didnt you hear me whistle at you?Woman Driver: Sure, but I dont flirt when I drive.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2593, 'Car and train jokes', 'Policeman: Didnt you hear my siren?Motorist: Sure, thats why I sped up.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2594, 'Car and train jokes', 'Policeman: Didnt you see my lights flashing?Motorist: No, I was going faster than the speed of light.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2595, 'Car and train jokes', 'Policeman: Didnt you see that stop sign?Driver: I keep my eyes closed in traffic.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2596, 'Car and train jokes', 'Policeman: Didnt you see the signs with the speed limit?Driver: I thought they were just suggestions.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2597, 'Car and train jokes', 'Policeman: Do you know how fast you were going?Motorist: No, youre the one with the radar.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2598, 'Car and train jokes', 'Policeman: How can you drive so recklessly?Driver: I have to, this is a getaway car.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2599, 'Car and train jokes', 'Policeman: How can you say you dont have any outstanding tickets?Driver: Theyre all in the glove compartment.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2600, 'Car and train jokes', 'Policeman: I suppose youre going to tell me you werent speeding.Motorist: I was speeding all right, but I was testing you to see if you were paying attention.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2601, 'Car and train jokes', 'Policeman: Ive had my eye on you for some time now.Young Lady: Thats funny. I thought you were arresting me for speeding.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2602, 'Car and train jokes', 'Policeman: What do you think youre doing driving through that intersection fifty miles an hour?Driver: My brakes dont work so I was rushing home before I had an accident.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2603, 'Car and train jokes', 'Policeman: What do you think youre doing parking your car there?Motorist: I thought it was good place. It says "Safety Zone."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2604, 'Car and train jokes', 'Policeman: Why are you driving on the sidewalk?Motorist: Its too dangerous on the street.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2605, 'Car and train jokes', 'Policeman: Why are you driving that car in circles?Driver: I was just going for a little spin.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2606, 'Car and train jokes', 'Policeman: Why are you driving without a license?Motorist: Because it was revoked months ago.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2607, 'Car and train jokes', 'Policeman: Why did you crash into that stop sign?Motorist: I was only following orders.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2608, 'Car and train jokes', 'Policeman: Why did you lead me on a high-speed chase?Motorist: Because youd catch me on a slow one.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2609, 'Car and train jokes', 'Policeman: Why did you stop your car, get out, and yell "coward" at the traffic signal?Motorist: The light just turned yellow.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2610, 'Car and train jokes', 'Policeman: Why did your car just spin around in circles?Motorist: I was making a U-turn and changed my mind.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2611, 'Car and train jokes', 'Policeman: Why didnt you obey that stop sign?Driver: I dont believe everything I read.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2612, 'Car and train jokes', 'Policeman: Why didnt you stop at that red light?Motorist: Then you would have caught up with me.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2613, 'Car and train jokes', 'Policeman: Why have you parked your bus here?Bus Driver: The sign says "Bus Stop."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2614, 'Car and train jokes', 'Policeman: Why were you asleep at the wheel?Motorist: Your siren lulled me to sleep.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2615, 'Car and train jokes', 'Policeman: Why were you driving around in circles and laughing?Motorist: I thought I was on a merry-go-round.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2616, 'Car and train jokes', 'Policeman: Why were you speeding when I stopped you?Motorist: So I could race home to get my license and registration.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2617, 'Car and train jokes', 'Policeman: Why were you speeding?Driver: I didnt want to be late for my trial.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2618, 'Car and train jokes', 'Policeman: Why were you speeding?Motorist: I was trying to get away from the crime scene.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2619, 'Car and train jokes', 'Policeman: Why were you speeding?Motorist: I was trying to get home before I ran out of gas.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2620, 'Car and train jokes', 'Policeman: Why were you speeding?Motorist: I wasnt going to miss seeing myself on "Americas Most Wanted."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2621, 'Car and train jokes', 'Q: How many London taxi drivers does it take to change a lightbulb ? A: What ? Go all the way up there and come back empty ? You must be jokin mate !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2622, 'Car and train jokes', 'Q: How many auto mechanics does it take to change a light bulb? A: Six - One to force it with a hammer and five to go out for more bulbs. A: Two, one to screw in all the bulbs he has until he finds one that fits, and the other to tell you he thinks hell have to replace the whole socket.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2623, 'Car and train jokes', '"Wheres the car?" asked Professor Delberts wife when he got home. "Did I take it out?" "Yes, you drove it to school this morning." "I suppose youre right, my dear. I remember now that after I got out, I turned to thank the man who gave me a lift and wondered where hed gone."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2624, 'Car and train jokes', 'McAfee and Bracket were driving home after a big party. "Hey," said McAfee, "be sure to watch out for that bridge thats coming down the road toward us." "What are you telling me to watch out for?" asked Brackett. "Youre the one whos driving!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2625, 'Car and train jokes', 'A San Francisco motorist following a taillight in a dense fog crashed into the car ahead of him when it stopped suddenly. "Why didnt you let me know you were going to stop?" he yelled into the mist. "Why should I?" came a voice out of the fog. "Im in my own garage!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2626, 'Car and train jokes', 'Dilmer, six-foot-three, two hundred eighty pounds, was thrown from his seat when the Southern Railway train he was riding derailed. The giant teenager flew a dozen feet through the air before hitting headfirst against a steel partition. For a moment Dilmer lay dazed, rubbing his head. The conductor came by and kneeled down beside him. "Dont move!" said the conductor. "Weve called an ambulance." "Naw," said the boy, getting to his feet. "I aint hurt so bad. That steel wall musta broke my fall!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2627, 'Car and train jokes', 'Blake and his parents were drinking at the bar in a train station when they heard a whistle. The three of them rushed out of the bar onto the platform only to discover that they had missed the train. "The next train is in one hour," said the stationmaster. The three went back into the bar. The parents had another drink; Blake had a Pepsi. Again they heard a whistle, rushed out and discovered the train pulling away. "Next one is sixty minutes from now!" said the stationmaster. An hour later, Blake, with his mom and dad, raced out onto the platform, and his parents leaped onto the train as it pulled away. The boy was left standing on the platform and began to laugh uproariously. "Your parents just left you," said the stationmaster. "Why are you laughing?" "They came to see me off!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2628, 'Car and train jokes', 'Did you ever see a country boy in New York whistle for a cab? He puts two fingers in his mouth and hollers, "Taxi!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2629, 'Car and train jokes', 'The train was about to pull out of the station. Swinging a large bag, a young man managed to reach the train, throw his bag in and climb aboard, gasping for air. seeking at him, another man said, "Young man, you should be in better shape! At your age, I could catch the train by a gnats whisker and still be fresh. Look at you, panting away." The young man took a deep breath and said, "Pop, I missed this train at the *last* station."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2630, 'Car and train jokes', 'A man learned shortly before quitting time that he had to attend a meeting. He tried unsuccessfully to locate his car-pool members to let them know that he would not be leaving with them. Hastily he scribbled a message to one fellow and left it on his desk: "I have a last-minute meeting. Leave without me. Dave." At 7:00 p.m., the man stopped at his desk and found this note: "Meet us at the bar and grill across the street. You drove today, you idiot."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2631, 'Car and train jokes', 'Jills car was unreliable and she called John for a ride every time it broke down. One day John got yet another one of those calls. "What happened this time?" he asked. "My brakes went out," Jill said. "Can you come to get me?""Where are you?" John asked. "Im in the drugstore," Jill responded. "And wheres the car?" John asked. Jill replied, "Its in here with me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2632, 'Car and train jokes', 'When I get real bored, I like to drive down town and get a great parking spot, then sit in my car and count how many people ask me if Im leaving.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2633, 'Car and train jokes', 'I was going 70 miles an hour and got stopped by a cop who said, -Do you know the speed limit is 55 miles per hour?- -Yes, officer, but I wasnt going to be out that long.-', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2634, 'Car and train jokes', 'A Roadway driver is driving east on Route 66 he sees a truck driving west and the CB crackles to life . "Hey Roadway driver whos the two biggest poofs in America?" comes from the CB.The Roadway driver replies . "I dont know" .The other trucker says " You and your brother ".Well the Roadway driver gets all annoyed but the other driver tells him "Its just a joke - tell it to the next truck you see."Well the Roadway driver drives for about an hour an finally sees another truck .he gets on the CB and says " Hey other truck do you know who the two biggest poofs in the world are?"The other trucker says " I dont know who?"The roadway driver replies " Me and my brother"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2635, 'Car and train jokes', 'A man was fed up of having his car broken into and having his radio stolen he decided he would remove it when he parked his car he also left a note saying there is no point in breaking in my car as there is nothing to steal. When he returned to his car it had been broken into again and there was a new note where his had left his, saying just checking.!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2636, 'Car and train jokes', 'Personally, I like to stay and read the credits. When the last scene of Titanic faded to black and people began rushing for the exits, I shouted: "Quick! There are only enough cars in the parking lot for half of us!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2637, 'Car and train jokes', 'A tiny racing car was developed by American scientists. The Americans then sent the car over to Japan to see what the Japanese could do to better the car. The Japanese added sport wheels and an aero kit to the car, they than sent it to the U.K. The British scientists, to better the car, added a sound system and window tint. They then sent it over to the Chinese, who added on a lowered suspension to the tiny car. The Chinese then sent it over to India. The Indian scientists, looked at the tiny car, appreciated all the modifications the other countries had made, turned it over and stamped a sign on it.... MADE IN INDIA!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2638, 'Car and train jokes', 'A boy sat on a train chewing gum and staring vacantly into space, when suddenly an old woman sitting opposite said, Its no good you talking to me, young man, Im stone deaf !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2639, 'Car and train jokes', 'A monster goes to a petrol station and says: Fill me upThe man at the petrol station replies: You have to have a car for me to do that!.The monster replies: But I had a car for lunch!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2640, 'Car and train jokes', 'Why was the school principal not pleased when he bumped into an old friend ?They were both driving their cars at the time !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2641, 'Car and train jokes', 'Who drives away all his customers ?A taxi driver.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2642, 'Car and train jokes', 'Brother: How do you top a car ?Sister: Tep on the brake, tupid.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2643, 'Car and train jokes', 'Why did your sister refuse the gift of a Japanese car ?Because shed never be able to learn the language', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2644, 'Car and train jokes', 'Did you hear about the girl who was so keen on road safety that she always wore white at night ?Last Winter she was knocked down by a snow plough', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2645, 'Car and train jokes', 'Auntie Gladys bought herself a new rear-engine continental car. She took an old friend for a spin, but after only half a mile, the car broke down. Both women got out and opened up the front of the car. Oh, Gladys, said her friend, youve lost your engine! Never mind dear, said auntie. Ive got a spare one in the trunk.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2646, 'Car and train jokes', 'What do you call a pig whos been arrested for dangerous driving ? A road hog !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2647, 'Car and train jokes', 'Teacher: "Who built the first American car?" Student: "Me Pilgrims." Teacher: "The Pilgrims?" Student: "Yeah, they made the Mayflower Compact."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2648, 'Car and train jokes', 'What did one car muffler say to the other car muffler?"Am I exhausted!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
