INSERT INTO `jokes` VALUES (2768, 'Cat jokes', '"Doctor," said the patient, "I need help! I cant stop acting like a cat!""How long have you had this problem?" the doctor asked."Lests see," said the patient, "Mom had the litter in 41', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2769, 'Children jokes', 'A little boy opened the big and old family Bible with fascination, he looked at the old pages as he turned them. Then something fell out of the Bible and he picked up and looked at it closely. It was an old leaf from a tree that had been pressed in between pages."Mommy, look what I found," the boy called out. "What have you got there, dear?" his mother asked. With astonishment in the young boys voice he answered: "Its Adams clothes!!!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2770, 'Children jokes', 'On the way to preschool, the doctor had left her stethoscope on the car seat, and her little girl picked it up and began playing with it.Be still, my heart, thought my friend, my daughter wants to follow in my footsteps! Then the child spoke to the instrument: "Welcome to McDonalds. May I take your order?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2771, 'Children jokes', 'A mother was teaching her 3-year-old the Lords prayer. For several evenings at bedtime she repeated it after her mother. One night she said she was ready to solo. The mother listened with pride as she carefully enunciated each word, right up to the end of the prayer. "Lead us not into temptation," she prayed, "but deliver us some E-mail, Amen."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2772, 'Children jokes', 'A precious little girl walks into a pet shop and asks in the sweetest little lisp, "Excuthe me, mithter, do you keep widdle wabbits?" As the shopkeepers heart melts, he gets down on his knees, so that hes on her level, and asks, "Do you want a widdle white wabby or a thoft and fuwwy bwack wabby or maybe one like that cute widdle bwown wabby over there?" She in turn blushes, rocks on her heels, puts her hands on her knees, leans forward and says in a quiet voice, "I dont fink my pet python weally gives a thit."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2773, 'Children jokes', 'On a special teachers day, a kindergarten teacher was receiving gifts from her pupils. The florists son handed her a gift. She shooked it, held it over her head, and said, "I bet I know what it is - flowers!""Thats right!" said the boy, "but how did you know?""Just a wild guess," she said.The next pupil was the candy store owners daughter. The teacher held her gift overhead, shooked it, and said, "I bet I can guess what it is - a box of candy!""Thats right! But how did you know?" asked the girl."Just a lucky guess," said the teacher.The next gift was from the liquor store owners son. The teacher held the bag over her head and noticed that it was leaking. She touched a drop of the leakage with her finger and tasted it. "Is it wine?" she asked."No," the boy replied.The teacher repeated the process, touching another drop of the leakage to her  tongue. "Is it champagne?" she asked."No," the boy replied.The teacher then said, "I give up, what is it?" The boy replied, "A puppy!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2774, 'Children jokes', 'A man is walking down the street one day when he notices a very small boy trying to press a doorbell on a house across the street. However, the boy is very small and the doorbell is too high for him to reach. After watching the boys efforts for some time, the man moves closer to the boys position. He steps smartly across the street, walks up behind the little fellow and, placing his hand kindly on the childs shoulder, leans over and gives the doorbell a solid ring. Crouching down to the childs level, the man smiles benevolently and asks, "And now what, my little man?" The boy replies, "Now we run!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2775, 'Children jokes', 'Little Johnny came home from school with a note from his teacher saying that Johnny was having trouble telling the difference between boys and girls, and would his mother please sit down and have a talk with Johnny about this. So Johnnys mother takes him quietly by the hand upstairs to her bedroom, and closes the door. "First, Johnny, I want you to take off my blouse", she said, so Johnny unbuttons her blouse and takes it off. "O.K., now take off my skirt", and he takes off her skirt. "Now take off my bra", which he does. "And now, Johnny, please take off my panties". Johnny finishes removing these too. His mother then says, "Johnny, please dont wear any of my clothes to school anymore!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2776, 'Children jokes', 'A little girl was playing in the garden when she spied two spiders mating. "Daddy, what are those two spiders doing?" she asked. "Theyre mating," her father replied. "What do you call the spider on top, Daddy?" she asked. "Thats a daddy long legs," her father answered. "So, the other one is a mommy long legs?" the little girl asked. "No," her father replied. "Both of them are daddy long legs." The little girl thought for a moment, then took her foot and stomped them flat. "Well, were not having any of THAT in our garden."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2777, 'Children jokes', 'Tyler was excited about his first day at school. So excited in fact, that only a few minutes after class started, he realized that he desperately needed to go to the bathroom. So, Tyler raised his hand politely to ask if he could be excused. Of course, the teacher said yes, but asked Tyler to be quick. Five minutes later Tyler returned, looking more desperate and embarrassed. "I cant find it," he admitted. The teacher sat Tyler down and drew him a little diagram to where he should go and asked him if he will be able to find it now. Tyler looked at the diagram, said "yes" and goes on his way. Well, five minutes later he returned to the class room and says to the teacher, "I cant find it." Frustrated, the teacher asked Tommy, a boy who has been at the school for a while, to help him find the bathroom. So, Tommy and Tyler go together and five minutes later they both return  r\nand sit down at their seats. The teacher asks Tommy, "Well, did you find it?" Tommy is quick with his reply, "Oh sure, he just had his boxer shorts on backwards."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2778, 'Children jokes', 'Mrs Smith, the biology teacher, was very fond of fish. She was also rather deaf, which was great for the children in her class. "What Mrs Smith needs," said one of her colleagues, "is a herring-aid."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2779, 'Children jokes', 'Why was the lightning bug unhappy?Because her children were not very bright.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2780, 'Children jokes', 'Why was the mother flea feeling down in the dumps? Because she thought her children were all going to the dogs.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2781, 'Children jokes', '"What were you before you came to school, boys and girls?" asked the teacher, hoping that someone would say "babies." She was disappointed when all the children cried out, "Happy!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2782, 'Children jokes', 'Boy: Grandma, do you know how to croak. Grandma: No, I dont think so. Why? Boy: Because Daddy says hell be a rich man when you do.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2783, 'Children jokes', 'Mother: Did you get a good place in the geography test?Fred: Yes, Mum, I sat next to the cleverest kid in the class.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2784, 'Children jokes', 'Fred: Where does the new kid come from? Harry: Alaska. Fred: Dont bother - Ill ask her myself.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2785, 'Children jokes', 'A naughty child was irritating all the passengers on the flight from London to New York. At last one man could stand it no longer. "Hey kid," he shouted. "Why dont you go outside and play?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2786, 'Children jokes', 'I had a funny dream last night, Mom. Did you? I dreamed I was awake, but when I woke up I found I was asleep.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2787, 'Children jokes', 'Young Vestal was walking in his Florida backyard when an alligator bit him. "Mama!" yelled the boy. "A gator jus bit off mah foot!" "Which one?" called his mother from inside the cabin. "How the hell should Ah know?!" he shrieked. "They all look alike to me!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2788, 'Children jokes', 'An honest seven-year-old admitted calmly to her parents that Billy Brown had kissed her after class. "How did that happen?, " gasped her mother. "It wasnt easy," admitted the young lady, "but three girls helped me catch him!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2789, 'Children jokes', 'A little kid is sitting on a park bench eating abag of chocolates an old man walking by stops to say that if he continues to eat like that he won`t live very long; indignantly the kid says " oh yeah my grandfather lived to be 104 years old" the old man replies "im sure he did kid.but it wasn`t from eating all that chocolate "oh no sir" says the kid, it was by minding his own business !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2790, 'Children jokes', 'Did you hear about the boy who wanted to run away to the circus ?He ended up in a flea circus !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2791, 'Children jokes', 'Whats the matter son?The boy next door said I look just like you?What did you say?Nothing hes bigger than me !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2792, 'Children jokes', 'A little boy came downstairs crying late one night.  Whats wrong ? asked his mother. Do people really come from dust, like they said in church ? he sobbed. In a way they do, said his mother.  And when they die do the turn back to dust ?. Yes, they do. The little boy began to cry again.  Well, under my bed theres someone either coming or going !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2793, 'Children jokes', 'A man out for a walk came across a little boy pulling his cats tail.Hey you! he shouted,  dont pull the cats tail !Im not pulling ! replied the little boy. Im only holding on - the cats pulling !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2794, 'Children jokes', 'Did you hear about the two little boys who found themselves in a modern art gallery by mistake ?Quick, said one, run ! Before they say we did it !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2795, 'Children jokes', 'A little boy went into a bakers How much are those cakes ? he asked Two for 25 cents, said the baker  How much does one cost ? asked the boy 13 cents, said the bakerThen Ill take the other one for 12 cents ! said the boy', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2796, 'Children jokes', 'Did you hear about the boy who was known as Fog ?He was dense and wet !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2797, 'Children jokes', 'You boy ! called a policeman. Can you help ? Were looking for a man with a huge red nose called Cotters......Really ? said the boy. Whatre his ears called ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2798, 'Children jokes', 'As two boys were passing the rectory, the minister leaned over the wall and showed them a ball."Is this yours" he asked"Did it do any damage" asked one of the boys"No" replied the minister"Then its mine !"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2799, 'Children jokes', 'Two boys camping out in a backyard wanted to know the time, so they began singing at the top of their voices.Eventually one of the neighbours threw open his window and shouted down at them "Hey, less noise!, dont you know its three oclock in the morning!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2800, 'Children jokes', 'Will and Bill were quarrelling about whose father was the stronger. Will said, Well, you know the Pacific Ocean ? My fathers the one who dug the hole for it.Bill wasnt impressed,  Well, thats nothing. You know the Dead Sea ? My fathers the one who killed it !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2801, 'Children jokes', 'Young Jimmy was having a snack after school with his Gran.  Would you like another cookie ? she asked.Yes, please, replied Jimmy.What good manners you have, said his Gran.  I do like to hear young people say please and thank you.Ill say them both if I can have a big piece of that cake, replied Jimmy !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2802, 'Children jokes', 'Mum: Havent you finished filling the salt shaker yet ?Son: Not yet. Its really hard to get the salt through all those little holes !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2803, 'Children jokes', 'Why are you crying, Ted ? asked his mum.Because my new sneakers hurt.Thats because you have put them on the wrong feet.But they are the only feet I have.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2804, 'Children jokes', 'Bens dad was building a pine bookshelf and Ben was watching and occasionally helping.  What are the holes for ? Ben asked.Theyre knot holes, said his dad.What are they, then, if theyre not holes ? asked Ben.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2805, 'Children jokes', 'Dick and Jane were arguing furiously over the breakfast table.  Oh youre so stupid! shouted Dick.Dick! said their father, thats quite enough of that! Now say youre sorry.OK, said Dick. Jane, Im sorry youre stupid.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2806, 'Children jokes', 'Mum: How can you practice your trumpet and listen to the radio at the same time ?Son: Easy. I have two ears!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2807, 'Children jokes', 'William, Ive been told that you have been fighting with the boys next door, said mum.yes, but theyre twins, so I wanted some way to tell the apart.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2808, 'Children jokes', 'Eddies father called up to him, Eddie, if you dont stop playing that trumpet I think Ill go crazy!Eddy replied, I think you are already, I stopped playing half an hour ago.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2809, 'Children jokes', 'George knocked on the door of his friends house. When his friends mother answered he asked, can Albert come out to play?No, said the mother, its too cold.Well, then, said George,  can his football come out to play ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2810, 'Children jokes', 'Mum, yelled Johnny from the kitchen, you know that dish you were always worried that I would break ?Yes dear, what about it ?Well your worries are over.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2811, 'Children jokes', 'A certain little boy had been spanked by his father one morning. When his dad came in from the office that evening, the boy called out sulkily,  Mum ! your husbands just come home.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2812, 'Children jokes', 'John kept pestering his parents to buy a video, but they said they couldnt afford one. So one day John came home clutching a package containing a brand-new video.Where in the World did you get the money to pay for that ? asked his father suspiciously.Its OK, Dad, replied John, Ive traded the TV in for it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2813, 'Children jokes', 'Mum, theres a man at the door collecting for the Old Folks Home. Shall I give him Grandma ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2814, 'Children jokes', 'Two girls were talking in the corridor. That boy over there is getting on my nerves, said Clarrie.But hes not even looking at you, replied Clara.Thats whats getting on my nerves, retorted Clarrie.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2815, 'Children jokes', 'A little girl was next in line. My names Curtain, she said.I hope your first name is not Agnate ?No, its velvet !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2816, 'Children jokes', 'On the first day at school the girls were sizing each other up and boasting, trying to make good impressions on each other.I come from a one-parent family, said one little girl proudly.Thats nothing. Both my parents remarried after they got divorced. I come from a four parent family !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2817, 'Children jokes', 'Mother: I told you not eat cake before supper.Daughter: But, Mum, its part of my homework. If you take an eighth of a cake from a whole cake, how much is left.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2818, 'Children jokes', 'Mary arrived home from school covered in spots. Whatevers the matter ? asked her mother.I dont know, replied Mary, but the teacher thinks I may have caught decimals.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2819, 'Children jokes', 'Mother: What do you mean, the school must be haunted ?Daughter: Well, the principal kept going on about the school spirit.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2820, 'Children jokes', 'Mum: Jackie, go outside and play with your whistle. Your father cant read his paper.Jackie: Wow, Im only eight and I can read it', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2821, 'Children jokes', 'Trevor: Thats a cool pair of stockings you have on Jill. One red and one green.Jill: Yes, and I have another pair just like it at home.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2822, 'Children jokes', 'Mandy was applying for a summer job.How old are you? asked the owner of the store.Im twelve years old, Sir, answered Mandy.And what do you expect to be when you grow up ?Twenty one, Sir.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2823, 'Children jokes', 'The second grader was in bed with a cold and high temperature. How high is it, Doctor? she wanted to know.One hundred and three, said the doctor.What is the world record?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2824, 'Children jokes', 'Jennifer: Are you coming to my party ?Sandra: No, I aint.Jennifer: Now, you know what Miss told us. Not aint. Its I am not coming, he is not coming, she is not coming, they are not coming. Sandra: Blimey, aint nobody coming ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2825, 'Children jokes', 'Grandma: Youve left all your crusts, Mary. When I was your age I ate every one.Mary: Do you still like crusts, Grandma?Grandma: Yes, I do.Mary: Well, you can have mine.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2826, 'Children jokes', 'Teacher: "Why do we have a Thanksgiving holiday?" Student: "So we know when to start Christmas shopping!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2827, 'Children jokes', 'Why did the nutty kid throw a glass of water out of the window? He wanted to see a waterfall.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2828, 'Children jokes', 'Why did the nutty kid throw butter out of the window? He wanted to see a butterfly.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2829, 'Children jokes', 'The teacher asked Simon to say his name backwards."No mis" he replied', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2830, 'Children jokes', 'Andy was away from school for 2 days because he had a flu. On the third day when he went back to school, his teacher told him how he felt. I feel with my hands Miss !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2831, 'Children jokes', 'My granddaughter came to spend a few weeks with me, and I decided to teach her to sew. After I had gone through a lengthy explanation of how to thread the machine, she stepped back, put her hands on her hips, and said in disbelief, "You mean you can do all that, but you cant operate my Game Boy?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2832, 'Children jokes', 'A sweet little boy surprised his grandmother one morning and brought her a cup of coffee. He made it himself and was so proud. He anxiously waited to hear the verdict on the quality of the coffee. The grandmother had never in her life had such a bad cup of coffee, and as she forced down the last sip she noticed three of those little green army guys in the bottom of the cup.She asked, "Honey, why would three little green army guys be in the bottom of my cup?"Her grandson replied, "You know grandma, its like on TV, The best part of waking up is soldiers in your cup."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2833, 'Children jokes', 'A father is asked by his friend, "Has your son decided what he wants to be when he grows up?""Yes, he wants to be a garbage collector," he repliesTo this his friend responds, "Strange ambition to have for a career.""Well, he thinks that garbage collectors only work on Tuesdays!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2834, 'Children jokes', 'Father: What did you learn in school today ?Son: That three and three are seven.Father: Three and three are six !Son: I guess I didnt learn anything today then !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2835, 'Children jokes', 'Father: Youve got 4 Ds and a C on your report.Son: "Maybe I concentrated too much on the one subject !"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2836, 'Children jokes', 'Mother: Let me see your report son.Son: Here it is, Mother, but dont show it to Dad. Hes been helping me !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2837, 'Children jokes', 'Mum: From now on your going to have free school dinners.Son:But, Mum, I dont want three school dinners, one is more than enough !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2838, 'Children jokes', 'Teacher: I said to draw a cow eating some grass but youve only drawn the cow ?Pupil: Yes, the cow ate all the grass !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2839, 'Children jokes', 'Son to his father as they watch television: "Dad, tell me again how when you were a kid you had to walk all the way across the room to change the channel."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2840, 'Children jokes', 'A whole family was caught in a small boat during a sudden storm off the shores of Florida, but towed to safety in Fort Lauderdale by the ever alert U.S. Coast Guard. "I always knew God would take care of us," said the composed five year old daughter of the boat owner after the family got home. "I like to hear you say that," beamed the mother. "Always remember that God is in His heaven watching over us." "Oh, I wasnt talking about THAT God," the five year old interrupted. "I was talking about the COAST God."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2841, 'Children jokes', 'After the baby was baptized, her four-year-old brother was crying inconsolably in the back seat of the car. "Whats the matter Johnny?" asked his concerned mother. Johnny replied: "that man said that he hoped our baby would be raised in a good Christian home...I just want her to stay with you guys."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2842, 'Children jokes', 'Little Johnnys class were on an outing to their local police station where they saw pictures, of the ten most wanted men, tacked to a bulletin board. On the way out of the police station Little Johnny said to the officer, "it was so nice of you to put my daddys picture up there."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2843, 'Children jokes', 'A schoolteacher was trying to teach her six-year old class students how to say the pledge of allegiance to the flag. The schoolteacher said, O.K. children begin by putting your hand over your little heart and repeat with me, I pledge allegiance to the HOLD IT! HOLD IT! Johnny, why is your hand over your butt cheek instead of your heart? Johnny relied! I cant. Teacher asks, why not? Well you see, when my ant comes over to pick me up and pats my bottom and says, BLESS YOUR LITTLE HEART!!!!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2844, 'Christmas jokes', 'What do you give a train driver for Christmas ?Platform shoes !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2845, 'Christmas jokes', 'What happens to you at Christmas ?Yule be happy !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
