INSERT INTO `jokes` VALUES (2942, 'Christmas jokes', 'Once upon a time there was a little girl who wanted a kitten for Christmas. Her mother couldnt buy a kitten and parcel it up for Christmas Day, so she bought it a week before Christmas and gave it to the little girl. Youre getting your Christmas present a week early this year, her mother explained as she handed over the fluffy little tabby kitten. Is that what you want? The little girl said, Its wonderful, mother...just what I wanted. Theres just one thing wrong! Whats that? her mother asked. Well, it has a cute little claw on the outside of every paw and another little claw on the inside of every paw - but the poor little thing has no claws at all in the middle of its paws! Her mother smiled. Dont worry, Kitty. When you wake up on Christmas morning youll find the claws are there. Now Kitty loved her kitten dearly, but she worrie d about the claws in the middle of its paws. The days passed and there wasnt even a hint, a clue or an inkling of claws in the middle of its paws. When Christmas Eve arrived and there was still no sign, Kitty went to her mother and asked again, Are you absolutely sure that the kitten will have its middle claws tomorrow? Theres only a few hours to go and theres not a hint or clue or an inkling as to claws as far as I can see. Wait till you wake up on Christmas morning, her mother smiled and went on stuffing the turkey. So Kitty went to sleep a worried girl. When she woke up on Christmas morning she ignored the presents in her stocking and rushed downstairs to look at her little kitten. She was astounded, amazed and just a little surprised to see that her kitten had four claws on every paw! The middle ones had appeared as if by magic. Kitty rushed to her parents bedroom. Mummy , Mummy! The kitten has grown its middle claws! Of course it has, her mother grinned. But how did you know? Kitty demanded. Her father rolled over sleepily and sighed, Oh, Kitty, everybody knows that Centre-claws always comes at Christmas!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (2943, 'Christmas jokes', 'It was Christmas eve, and Santa was really busy making his list and checking it twice, when there came a knock at the door. His wife comes in. "Honey, where do you want me to put your boots and gloves?" Well, Santa is very busy and so hes slightly annoyed by this trivial question, so he snaps at her, "Put them by the front door, and stop bothering me. Im trying to get some work done." He starts back to work, but a few minutes later an elf barges in. "Santa, we got all the toys wrapped, what should we do with them?" Santa snaps, "Stick em in the sleigh! Cant you see Im trying to get ready? I dont want any more interruptions!" But sure enough, as soon as he starts back to work, there is another interruption. An angel, standing at the door, says, "Santa, I have your Christmas tree. Where would you like me to put it?" And this is where we get the tradition of placing an ange l on top of the Christmas tree.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
