INSERT INTO `jokes` VALUES (3010, 'Clinton jokes', 'Bill Clinton is visiting a school. In one class, he asks the students if anyone can give him an example of a "tragedy".One little boy stands up and offers "If my best friend who lives next door was playing in the street when a car came along and killed him, that would be a tragedy.""No," Clinton says, "That would be an ACCIDENT."A girl raises her hand. "If a school bus carrying fifty children drove off a cliff, killing everyone involved... that would be a tragedy.""Im afraid not," explains Clinton. "That is what we would call a GREAT LOSS."The room is silent; none of the other children volunteer. "What?" asks Clinton, "Isnt there any one here who can give me an example of a tragedy?"Finally, a boy in the back raises his hand. In a timid voice, he says: "If an airplane carrying Bill & Hillary Clinton were blown up by a bomb, T HAT would be tragedy." "Wonderful!" Clinton beams. "Marvelous! And can you tell me WHY that would be a tragedy?""Well," says the boy, "because it couldnt be an accident, and it certainly would be no great loss!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3011, 'Clinton jokes', 'Q: How can you tell that the guy who attacked the White house with a plane was insane? A: He seems to have thought Clinton would be in his own bedroom at night. Q: What did Hillary tell Bill when the Paula Jones story broke?A: "You idiot! I told you to let Teddy Kennedy drive her home!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
