INSERT INTO `jokes` VALUES (3018, 'Clinton jokes', 'One night Bill Clinton was awakened by George Washingtons ghost in the White House. "George, what is the best thing I could do to help the country?" Clinton asked."Set an honest and honorable example, just as I did," advised George.The next night the ghost of Thomas Jefferson moved through the dark bedroom. "Tom, what is the best thing I could do to help the country?" Clinton asked."Cut taxes and reduce the size of government," advised Tom.Clinton didnt sleep well the next night, and saw yet another figure moving in the shadows. It was Abraham Lincolns ghost. "Abe, what is the best thing I could do to help the country?" Clinton asked. Abe replied, "Go to the theater."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
