INSERT INTO `jokes` VALUES (3032, 'Clinton jokes', 'President Clinton, returning from a campaign stop in Arkansas, is climbing the steps to board Air Force One. Under each arm he is carrying a souvenir of his trip -- a live razorback. At the top of the jetway, he is met by the guard, a Marine sergeant, who issues a crisp salute."Id salute you back, Sergeant," says the President, "but as you can see, Ive got my hands full.""Yes, sir," replies the sergeant. "Very nice pigs, sir. Very nice pigs.""Why, these arent pigs," the President responds. "These are RAZORBACKS!""Yes, sir -- razorbacks. Sorry, sir.""Yup," Clinton continues. "Got this one for Chelsea, and this one for Hillary."The sergeant replies: "Very good trade, sir -- very good trade."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
