INSERT INTO `jokes` VALUES (3041, 'Clinton jokes', 'Hillary Clinton goes to her doctor for a physical, only to find outthat shes pregnant! She is furious. Here just became the senator ofNew York and this has happened to her. She gets Bill on the phone and immediately starts screaming: "How could you have let this happen?With all thats going on right now, you go and get me pregnant! Howcould you??!!! I cant believe this! I just found out I am five weeks pregnant and it is all your fault!!! Your fault!!! Well, what haveyou got to say???"There is nothing but dead silence on the phone. She screamsagain, "Did you hear me??!!" Finally she hears Bills very, veryquiet voice. In a barely audible whisper, he says, "Who is this?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
