INSERT INTO `jokes` VALUES (3053, 'Clinton jokes', 'Q: How is Clintons health care reform a lot like his haircut?A: It is a lot more expensive than it looks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3054, 'Clinton jokes', 'President Clinton to maid: Mam, can you do something about Hillarys room. She complains that its the ugliest room in the White House. Maid: Yes, Mr. President--Ill remove the mirrors right away.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3055, 'Clinton jokes', 'Q: Why were the Clintonites pushing the BTU Tax?A: Because they could spell it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3056, 'Clinton jokes', 'Why is Chelsea Clinton growing up a confused child? Because dad cant keep his pants on and mom wants to wear them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3057, 'Clinton jokes', 'Q: Why arent Clinton White House staffers given coffee breaks?A: It takes too long to retrain them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3058, 'Clinton jokes', 'Q: How can you identify a computer that has been in use at the Clinton White House?A: There is White-out on the screen.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3059, 'Clinton jokes', 'Former Vice President Quayle, Speaker of the HouseGingrich, and President Clinton are traveling in acar together in Kansas. A tornado comes along andwhirls them up into the air and tosses them thousandsof yards away. They all fall into a daze. When they come to and extract themselves from thevehicle, they realize theyre in the fabled Land of Oz. They decide to go see the famous Wizard of Oz. TheWizard is known for granting people their wishes. Quayle says, "Im going to ask the Wizard for a brain." Gingrich responds, "Im going to ask the Wizard for a heart." Clinton speaks up, "Wheres Dorothy?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3060, 'Clinton jokes', 'Q: Whats Clinton doing to make Americans happy?A: If youve paid your tax bill and have enough money left to feed your family--youre happy.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3061, 'Clinton jokes', 'Last summer, the President and Mrs. Clinton were vacationing in their home state of Arkansas. On a venture one day, they stopped at a service station to fill up the car with gas. It seemed that the owner of the station was once Hillarys high school love. They exchanged hellos, and went on their way. As they were driving on to their destination, Bill put his arm around Hillary and said, "Well, honey, if you had stayed with him, you would be the wife of a service station owner today." She smirked and replied, "No, if I had stayed with him, he would be President of the United States."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3062, 'Clinton jokes', 'A bus filled with politicians was driving through thecountryside one day, on the campaign trail. The bus driver,caught up in the beautiful scenery, loses control andcrashes into the ditch. A farmer living nearby hears the horrible crash andrushes out to discover the wreckage. Finding the politicianshe buries them.The next day, the police come to the farm to question theman. "So you buried all the politicians?" asked the policeofficer. "Were they all dead?"The farmer answered, "Some said they werent, but youknow how politicians lie."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3063, 'College jokes', 'Why did the University of Oklahoma researcher stay awake every night? He was trying to find a cure for insomnia.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3064, 'College jokes', 'Why dont Purdue athletes eat pickles? They cant get their heads in the jar.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3065, 'College jokes', 'What do you get when you cross a Texas Aggie with an ape? A retarded ape.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3066, 'College jokes', 'Professor: Heavens! Someone stole my wallet! Wife: Didnt you feel a hand in your pocket?Professor Yes, but I thought it was mine!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3067, 'College jokes', 'Did you hear about the Louisiana Tech professor who stood in front of a mirror for two hours, wondering where hed seen himself before?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3068, 'College jokes', '"Professor, I hear your wife has had twins. Boys or girls?" "Well, I believe one is a girl and one is a boy but it may be the other way around."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3069, 'College jokes', 'Astronomy Professor: What causes a half-moon? Student: When you cant get your jeans over your thighs.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3070, 'College jokes', 'Did you hear about the Western Kentucky professor who kissed the door goodbye and slammed his wife as he went by?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3071, 'College jokes', 'And then there was the UCLA professor who opened up his vest, pulled out his tie and wet his pants.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3072, 'College jokes', 'How do you measure a Villanova graduates I.Q.?With a tire gauge.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3073, 'College jokes', 'Did you hear about the Penn State professor who went around in a revolving door for six hours because he couldnt remember whether he was going in or coming out?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3074, 'College jokes', 'How many Wake Forest fraternity brothers does it take to make chocolate chip cookies? Seventeen. One to do it and sixteen to shell the M&Ms.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3075, 'College jokes', 'What do you call ten Utah State law students standing ear to ear? A wind tunnel.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3076, 'College jokes', 'How do you get a Texas Tech seniors eyes to sparkle? Shine a flashlight in his ears.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3077, 'College jokes', 'Why did the Oregon State psychology major climb up the chain link fence? To see what was on the other side.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3078, 'College jokes', 'What is a Furman freshman doing when he grasps at thin air? Collecting his thoughts.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3079, 'College jokes', '"Did you hear? Laments gettin a Ph.D.""What does Ph.D. stand for?" "in his case, Pin-headed Dope."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3080, 'College jokes', 'Did you hear about the UCLA track star who won a gold medal? He was so proud of it that he had it bronzed.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3081, 'College jokes', 'How many Buckeye football players does it take to change a lightbulb? One. But he gets three hours credit.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3082, 'College jokes', 'Jeb and Eudell, University of Michigan athletes, were driving from Ann Arbor to Cleveland. Just outside the city limits they saw a sign: "CLEAN REST ROOMS." By the time they got to Cleveland, theyd cleaned 147 Johns.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3083, 'College jokes', 'Two Kentucky psychology majors were walking through the campus. "Do you consider a 1441.Q. high?" "Yes!" "For the whole basketball team?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3084, 'College jokes', 'How can you tell a Minnesota hockey fan? Ask him what color the blue line is and wait. It may take him ten minutes to answer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3085, 'College jokes', 'What do they call a bunch of Mississippi football players standing in a circle holding hands? A dope ring.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3086, 'College jokes', 'How does a New York University psychology major turn on his lights in the morning? By opening the car door.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3087, 'College jokes', 'Did you hear about the University of Miami fullback who stayed up all night studying for his urine test?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3088, 'College jokes', 'There was the Florida State defensive tackle who thought Hertz Van Rentals was a famous Dutch painter.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3089, 'College jokes', 'How can you tell if a California State coed is a good cook? She can get the pop tart out of the toaster in one piece.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3090, 'College jokes', 'Professor: A wise man doubts everything. Only a pin-head is positive. Student: Are you sure of that, sir? Professor: Positive.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3091, 'College jokes', 'Three students from Michigan State, the University of Kentucky and Texas A & M on summer vacation in France were caught smuggling cocaine and sentenced to death by guillotine. The judge turned to the boy from Michigan and asked, "Do you have any final words, son?" "Yeah, drop dead!" snapped the Wolverine. Hearing this, the judge signaled for the sentence to be carried out. The executioner pulled the lever, and as the crowd gaped in astonishment, the giant blade came to a screeching halt three inches from the victims throat. "Its Gods will! Let him go!" cried the judge. Next the fella from U. of Kentucky was put on the block, and the judge asked again, "And what are your final remarks, my boy?" "Go to hell!" shouted the student, and the judge signaled. The razor-sharp blade fell and miraculously stopped just a quarter inch from the condemned boys neck. "Its the wi ll of God!" exclaimed the judge. "Set him free!" Finally the Texan was put into position. "Before youre beheaded," said the judge, "do you have any last words?" "Yeh!" replied the Aggie. "If yall will just put a little more grease on them grooves, the bladell come down a whole lot easier!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3092, 'College jokes', 'Tipton and Baldwin shared a room on the North Carolina campus. One day Tipton came in and said to his roommate, "I hear theres a new case of herpes in the dorm." "Great!" said Baldwin. "I was getting tired of 7-Up!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3093, 'College jokes', 'Higginbote and Goldstein, Fordham freshmen, were discussing what kind of work would supply mem with big bucks after graduation. "Well, Ive always thought Id like to be a doctor," said Higginbote. "Specialize in something or other. Like obstetrics, maybe." "Obstetrics?" scoffed Goldstein. "At the rate science is going, youd no sooner learn all about it when bingo! somebodyd find a cure for it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3094, 'College jokes', 'What is the second stupidest thing in the world? An Arkansas architectural student out in the middle of the ocean trying to build a foundation for a house. What is the stupidest thing in the world? An Arkansas contractor trying to build a house on the foundation.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3095, 'College jokes', '"Where are my shoes?" asked the Iowa State professor as the class ended. "Theyre on your feet," said one of the students. "So they are," said the professor. "Its a good thing you saw them, or I would have gone home without them!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3096, 'College jokes', 'Professor: I forgot to take my umbrella this morning. Wife: When did you first miss it, dear? Professor: When I reached up to close it after the rain had stopped.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3097, 'College jokes', 'Arvil was coming out of the Texas University student building when he was stopped by two coeds. "Would you like to become a Jehovahs Witness?" asked one of the girls. "No, I really couldnt. I didnt see the accident."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3098, 'College jokes', 'A survey was being taken on the University of Arizona campus. The survey taker asked a soccer player, "What do you think of bilingualism?" "Oh, I think its okay," said the boy, "if its between consenting adults."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3099, 'College jokes', 'Biddle and Payne, two elderly English professors, were having lunch in the cafeteria. During the course of the conversation, Biddle said,"A student gave me a peculiar answer in class today. I asked who wrote the Merchant of Venice and a sophomore said, "Please, sir, it wasnt me!" "Ha, ha!" laughed Payne. "And I suppose the little snot had done it all along!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3100, 'College jokes', 'Mrs. McKenzie was showing Corbett, the contractor, through the second floor of her new house to show him what colors to paint the rooms. "Id like the bathroom done in white!" Corbett walked over to the window and shouted, "Green up! Green up!" "I want the bedroom in blue!" continued the woman. The contractor listened and yelled out the window, "Green up! Green up!" "The halls should be done in beige!" she instructed. Again, the man barked out the window, "Green up! Green up!" "Will you stop that?!" shouted the woman. "Every time I give you a color, all you do is shout Green up! What the devil does that mean?" Tm real sorry, maam!" explained Corbett. "But I got three Oklahoma basketball players down there tryin to put in the front lawn!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3101, 'College jokes', 'A Mississippi professor was at a party and became indignant when asked if college professors were absent-minded. "Professors havent got bad memories," he declared. "Theyre not absent-minded. Dont you think I know where I am right now, and dont you think tomorrow Ill know where I was last night? Would somebody like to ask me another question?" "Yes," said another guest. "Is it true that professors are absent-minded and have bad memories?" "Good!" said the professor. "I knew sooner or later somebody would ask me that question."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3102, 'College jokes', 'Soderling, the star college halfback, was taking a math exam. The coach desperately needed him to play in the Syracuse game on Saturday, so the professor agreed to give him an oral exam. "All right," said the prof. "How many degrees are there in a circle?" "Uh, depends," said the boy. "How big is that there circle?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3103, 'College jokes', 'Tad answered the Tennessee State frat house phone. "Hi," said the voice, "this is Rollie. Come on over, were having a real wildass party." "Shit, Ahd shore love to," said Tad, "but Ah got me a bad case of gonorrhea." "Bring it along!" answered Rollie. "The way thangs is goin, mah buddiesll drink anythin!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3104, 'College jokes', 'All the fraternity brothers left the house for a long weekend except for Grady, who decided to stay behind and get some studying done. One night Grady heard a noise under his bed. Fearing it might be a burglar, he leaned over and whispered, "Anybody there?" "No," said the burglar. "Thats funny," the boy said to himself. "I could have sworn I heard a noise!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3105, 'College jokes', 'A linguistics professor was lecturing to his English class one day. "In English," he said, "A double negative forms a positive. In some languages, though, such as Russian, a double negative is still a negative. However, there is no language wherein a double positive can form a negative." A voice from the back of the room piped up, "Yeah, right."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3106, 'College jokes', 'On what kind of ships do students study?Scholarships.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3107, 'College jokes', 'Whats the difference between an American student and an English student ?About 3000 miles !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3108, 'College jokes', 'What do you get if you cross a student and an alien ?Something from another universe -ity !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3109, 'College jokes', 'An angel appears at a faculty meeting and tells the dean that in return for his unselfish and exemplary behavior, the Lord will reward him with his choice of infinite wealth, wisdom, or beauty. Without hesitating, the dean selects infinite wisdom."Done!" says the angel, and disappears in a cloud of smoke and a bolt of lightning. Now, all heads turn toward the dean, who sits surrounded by a faint halo of light. At length, one of his colleagues whispers, "Say something."The dean sighs and says, "I should have taken the money."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3110, 'College jokes', 'Two college students, Frank and Matt, are riding on a New York City subway when a beggar approaches them asking for spare change. Frank adamantly rejects the man in disgust. Matt, on the other hand, whips out his wallet, pulls out a couples of singles and gladly hands them over to the beggar with a smile.The beggar thanks him kindly and then continues on to the other passengers. Frank is outraged by his friends act of generosity. "What on earth did you do that for?" shouts Frank. "You know hes only going to use it on drugs or booze." Matt replies, "And we werent?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3111, 'College jokes', 'After the college boy delivered the pizza to Buds trailer house, Bud asked, "What is the usual tip?""Well," replied the youth, "this is my first trip here, but the other guys say if I get a quarter out of you, Ill be doing great.""Is that so?" snorted Bud. "Well, just to show them how wrong they are, heres five dollars.""Thanks," replied the youth, "Ill put this in my school fund.""What are you studying?" asked Bud.The lad smiled and said, "Applied psychology."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3112, 'College jokes', 'A kid called up his mom from his college and asked her for some money, because he ran out of it. His mom said, "Sure, sweetie. Ill will send you some money. You also left your calculus book here when you visited 2 weeks ago. Do you want me to send that up too?""Uhh, oh yeah, okay," responded the kid.So his mom wrapped the book along with the checks up in a package and went to the post office to mail the money and the book.When she gets back, her husband asked, "Well how much did you give the boy his time?"She said, "Oh, I wrote 2 checks, one for $20 and the other for $1000 out to him.""Thats $1020!" yelled her husband. Are you crazy?""Dont worry, Hon," she said. "I taped the $20 check to the cover of his book, but I put the $1000 one somewhere between the pages in chapter 19!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3113, 'College jokes', 'Wouldnt it be nice to tell the Dean of your college what you REALLY think about him/her? Well, if you like your Dean as much as I like my Dean, then youd better keep your mouth shut. I knew Id get kicked out of the college if I expressed my true feelings, so I remained silent for the last four years.But yesterday was my graduation. And as I walked across the stage, the Dean handed my diploma to me (nicely scrolled and tied with a ribbon).Once she handed it to me, I could finally tell that bitch what I REALLY thought about her. So I leaned across her podium and I looked her straight in the eye."Hey Bitch," I said. "Youre so damn ugly, you could practice birth control just by leaving the lights on!"And then I walked off the stage, and went home. I gotta tell you that it felt just as good as I had imagined it would for the last four years.Today, I unwrapped my diploma, fr amed it, and hung it in the living room, where it proudly exclaims to the world: "In order to receive your diploma, please present this certificate to the Dean of your college after final grades have been posted!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3114, 'College jokes', 'A college student was in a philosophy class which had a discussion about Gods existence. The professor presented the following logic:"Has anyone in this class heard God?" Nobody spoke."Has anyone in this class touched God?" Again, nobody spoke."Has anyone in this class seen God?" When nobody spoke for the third time, he simply stated, "Then there is no God."One student thought for a second, and then asked for permission to reply. Curious to hear this bold students response, the professor granted it, and the student stood up and asked the following questions of his classmates:"Has anyone in this class heard our professors brain?" Silence."Has anyone in this class touched our professors brain?" Silence."Has anyone in this class seen our professors brain?" When nobody in the class dared to speak, the student concluded, "Then, according to our professor s logic, it must be true that our professor has no brain!"You cant argue with that!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3115, 'College jokes', 'A somewhat advanced society has figured how to package basic knowledge in pill form. A student, needing some learning, goes to the pharmacy and asks what kind of knowledge pills are available. The pharmacist says, "Heres a pill for English literature." The student takes the pill and swallows it and has new knowledge about English literature!"What else do you have?" asks the student."Well, I have pills for art history, biology, and world history," replies the pharmacist.The student asks for these, and swallows them and has new knowledge about those subjects. Then the student asks, "Do you have a pill for math?"The pharmacist says, "Wait just a moment." He goes back into the storeroom and brings back a whopper of a pill and plunks it on the counter."I have to take that huge pill for math?" inquires the student.The pharmacist replied, "Well, you know ... mat h always was a little hard to swallow."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3116, 'College jokes', 'Optimist: A college student who opens his wallet and expects to find money.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3117, 'College jokes', 'A college student in a philosophy class was taking his first examination. On the paper there was a single line which simply said: "Is this a question?" - Discuss. After a short time he wrote: "If that is a question, then this is an answer." The student received an "A" on the exam. A Boston brokerage house advertised for a "young Harvard graduate or the equivalent." Among the inquiries received was one from a Yale grad. He said, "Do you mean two Princeton men, or a Yale man part time?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3118, 'College jokes', 'A college student in a philosophy class was taking his first examination. On the paper there was a single line which simply said: "Is this a question?" - Discuss. After a short time he wrote: "If that is a question, then this is an answer." The student received an "A" on the exam. A Boston brokerage house advertised for a "young Harvard graduate or the equivalent." Among the inquiries received was one from a Yale grad. He said, "Do you mean two Princeton men, or a Yale man part time?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3119, 'College jokes', 'Two storks are sitting in their nest: a father stork and baby stork. The baby stork is crying and crying and father stork is trying to calm him. "Dont worry, son. Your mother will come back. Shes only bringing people babies and making them happy."The next night, its fathers turn to do the job. Mother and son are sitting in the nest, the baby stork is crying, and mother is saying, "Son, your father will be back as soon as possible, but now hes bringing joy to new mommies and daddies."A few days later, the storks parents are desperate: their son has been absent from the nest all night! Shortly before dawn, he returns and the parents ask him where hes been all night.The baby stork says, "No where. Just scaring the hell out of college students!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3120, 'College jokes', 'Q. How many law professors does it take to change a light bulb?A. Hell, you need 250 just to lobby for the research grant.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3121, 'College jokes', 'Q: How many graduate students does it take to change a light bulb? A: Only one, but it may take him/her more than five years to do it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3122, 'College jokes', 'The female dormitory will be out-of-bounds for all male students, so too the male dormitory to the female students. Anybody caught breaking this rule will be fined $20 the first time. Anybody caught breaking this rule the second time will be fined $60. Being caught a third time will incur a hefty fine of $180. Are there any questions?" At this, a male student in the crowd inquires, "Er... How much for a season pass?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3123, 'College jokes', 'Q: What do college students and deer have in common?A: They both stand in the middle of the road and stare at your headlights.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3124, 'College jokes', 'A college friend was going to meet a young lady he new."An old flame? I asked.He winked and said, "More like an unlit match."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3125, 'College jokes', '"Now my motto in life," said the school chaplain, "is work hard, play hard and pray hard. How about you, Harriet?""My motto is let bygones be bygones.""Thats good. Why did you choose that?""Then I wouldnt have to take any history classes!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
