INSERT INTO `jokes` VALUES (3281, 'Cowboy jokes', 'Cowboy Joe was telling his fellow cowboys back on the ranch about his first visit to a big-city church. "When I got there, they had me park my old truck in the corral," Joe began. "You mean the parking lot," interrupted Charlie, a more worldly fellow. "I walked up the trail to the door," Joe continued. "The sidewalk to the door," Charlie corrected him. "Inside the door, I was met by this dude," Joe went on. "That would be the usher," Charlie explained. "Well, the usher led me down the chute," Joe said. "You mean the aisle," Charlie said. "Then, he led me to a stall and told me to sit there," Joe continued. "Pew," Charlie retorted. "Yeah," recalled Joe. "Thats what that pretty lady said when I sat down beside her."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3282, 'Cowboy jokes', 'Who do zombie cowboys fight? Deadskins.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3283, 'Cowboy jokes', 'What did the cowboy maggot say when he went into the saloon bar? Gimme a slug of whiskey.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3284, 'Cowboy jokes', 'Who is in cowboy films and is always broke? Skint Eastwood.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3285, 'Cowboy jokes', 'What do you call a frog who wants to be a cowboy? Hoppalong Cassidy.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3286, 'Cowboy jokes', 'A police officer saw a man dressed as a cowboy in the street, complete with huge stetson hat, spurs, and six shooters."Excuse me, sir," said the police officer, "who are you?""My names Tex, officer," said the cowboy." eh?" said the police officer, "Are you from Texas?" "Nope, Louisiana." "Louisiana? So why are you called Tex?" "Dont want to be called Louise, do I .', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3287, 'Cowboy jokes', 'Visitor: Wow, you have a lot of flies buzzing round your horses and cows. Do you ever shoo them? Cowboy: No we just let them go barefoot.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3288, 'Cowboy jokes', 'The swing doors of the Wild West saloon crashed open and in came Little Pete, black with fury. "All right!" he raged, "all right! Who did it? What goldarned varmint painted my horse blue?" The huge figure of Black Jake, notorious gunfighter and town baddie rose from a chair by the door. "It was me, shrimp," he drawled, bunching his gigantic fists, "what about it?" "Oh, well, er," stammered little Pete wretchedly, "all I wanted to say was. . .when are you going to give it another coat?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3289, 'Cowboy jokes', 'Who do zombie cowboys fight? Deadskins.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3290, 'Cowboy jokes', 'Swint and Fess, two Oklahoma cowboys, were resting their horses out on the range. "Whatd Emmaline give yew for yore birthday?" asked Swint. "Pair of cufflinks," said Fess. "But I aint got no use for them. I cant even find anyplace to get my wrists pierced."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3291, 'Cowboy jokes', 'Back in the Old West three Texas cowboys were about to be hung for cattle rustling. The lynch mob brought the three men to a tree right at the edge of the Rio Grande. The idea was that when each man had died, theyd cut the rope and hed drop into the river and drift out of sight They put the first cowboy in the noose, but he was so sweaty and greasy he slipped out, fell in the river and swam to freedom. They tied the noose around the second cowboys head. He, too, oozed out of the rope, dropped into the river and got away. As they dragged the third Texan to the scaffold, he resisted, "Please! Would yawl tighten that noose a little bit? I cant swim!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3292, 'Cowboy jokes', 'Q: Why cant the bankrupt cowboy complain?A: He has got no beef.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3293, 'Cowboy jokes', 'The cowboy lay sprawled across three entire seats in the posh Amarillo theatre. When the usher came by and noticed this he whispered to the cowboy, "Sorry, sir, but youre only allowed one seat." The cowboy groaned but didnt budge. The usher became more impatient. "Sir, if you dont get up from there, Im going to have to call the manager. The cowboy just groaned. The usher marched briskly back up the aisle. In a moment he returned with the manager. Together the two of them tried repeatedly to move the cowboy, but with no success. Finally, they summoned the police. The cop surveyed the situation briefly then asked, "All right buddy, whats youre name?" "Sam," the cowboy moaned. "Where ya from, Sam?" With pain in his voice Sam replied.... "The balcony."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3294, 'Cowboy jokes', 'Three cowboys of the world are sitting around camp talking about how tough they were and the tales kept getting bigger and bigger. The cowboy from Australia says, "I wrestled a 200 pound crocodile and may it cry like a baby." The Cowboy from Brazil shakes his head and says, "I killed a 400 pound steer with my bare hands." The Cowboy from Texas just smiled and kept stirring the campfire with his leg.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3295, 'Cowboy jokes', 'The eastern lady who was all ready to take a horseback ride said to the cowboy, "Can you get me a nice gentle pony?" "Shore," said the cowboy. "What kind of a saddle do you want, English or western?" "Whats the difference?" asked the lady. "The western saddle has a horn on it," said the cowboy. "If the traffic is so thick here in the mountains that I need a horn on my saddle, I dont believe I want to ride."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3296, 'Cowboy jokes', 'Why did the cowboy ride his horse?Because the horse was too heavy to carry.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3297, 'Cowboy jokes', 'What sickness do cowboys get from riding wild horses?Bronchitis (bronc-itis).', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3298, 'Cowboy jokes', 'Why was the cowboy a lot of laughs?He was always horsing around.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3299, 'Cowboy jokes', 'Why did the cowboy get a hot seat?Because he rode the range.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3300, 'Cowboy jokes', 'Why did the cowboys car stop?It had Injun (engine) trouble.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3301, 'Cowboy jokes', 'What do you call a cowboy who helps out in a school ?The deputy head !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3302, 'Cowboy jokes', 'If a cowboy rides into town on Friday and three days later leaves on Friday, how does he do it? The horses name is Friday!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3303, 'Cowboy jokes', 'Q: Why did the bowlegged cowboy get fired? A: Because he couldnt keep his calves together!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3304, 'Cowboy jokes', 'What advice to cows give?Turn the udder cheek and mooooove on!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3305, 'Cowboy jokes', 'Where do cowboys cook their meals?On the range.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3306, 'Criminal jokes', 'A shoplifter was caught red-handed trying to steal a watch from an exclusive jewelry store. "Listen," said the shoplifter, "I know you dont want any trouble either. What do you say I just buy the watch, and we forget about this?"The manager agreed and wrote up the sales slip. The crook looked at the slip and said, "This is a little more than I intended to spend. Can you show me something less expensive?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3307, 'Criminal jokes', 'A computer geek goes to prison for fraud, they put him in a cell with a 300LB guy, Having heard what happens to geeks in prison and being nervous he figures he had better introduce himself, He extends his hand and says with a quivering voice, Hi my name is John Smith.The big guy who actually is a nice guy extends his and says my name is Turner Brown.The geek passes out. The big guy fans him and brings him too. Why did you pass out he asked? The geek replies, what did you say your name was? Turner Brown he replies. Oh God the geek says I thought you said "TURN AROUND".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3308, 'Criminal jokes', 'It was Rockys first night in the penitentiary. All of the inmates were intheir cells and he was trying to become a bit more comfortable with hismeager surroundings. As he leaned against the bars at the front of hiscell, Rocky heard a voice call out "44" and the whole cell block eruptedinto laughter! Another voice called "16" and again there was laughter. Athird voice called "62" which was followed by laughter throughout the block.Rocky didnt know what was going on so he rapped on his cell wall."Yeah, whaddaya want?" came the gruff reply from next door."Whats going on, here?" asked Rocky."Well," said the other inmate, "down in the prison library theres only onejoke book. Weve all read the book so many times that we dont waste timetelling the joke, we just call out its number."So the next day Rocky went down to the library and, sure enough, found  r\ntheyellowed, dog-eared joke book and read it from cover to cover. That night,wanting to be part of the group, Rocky confidently called out "44" andeveryone laughed! He tried calling "16" and "62" and again there were pealsof laughter. Then he called 57, and the halls rang with laughter.After several minutes, one prisoner was still rolling on the floor laughing.More minutes - still laughing. Rocky rapped on the cell wall. "Yeah,waddaya want?" asked the other inmate."I dont understand it," asked Rocky, "Why is Bill still laughing?""Well," said the gruff inmate, "He never heard that one before!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3309, 'Criminal jokes', 'Several years ago, Andy was sentenced to prison. During his stay, he got along well with the guards and all his fellow inmates. The warden saw that deep down, Andy was a good person and made arrangements for Andy to learn a trade while doing his time. After three years, Andy was recognized as one of the best carpenters in the local area. Often he would be given a weekend pass to do odd jobs for the citizens of the community.... and he always reported back to prison before Sunday night was over.The warden was thinking of remodeling his kitchen and in fact had done much of the work himself. But he lacked the skills to build a set of kitchen cupboards and a large counter top, which he had promised his wife. So he called Andy into his office and asked him to complete the job for him.But, alas, Andy refused. He told the warden, Gosh, Id really like to help you but counter fitting is what go t me into prison in the first place.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3310, 'Criminal jokes', 'Newsflash: Two criminals have escaped from prison today. One is orange and 9ft tall, and the other green and yellow and 2ft Gin tall. The police are searching high and low for them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3311, 'Criminal jokes', 'Did you hear about the burglar who fell in the cement mixer? Now hes a hardened criminal.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3312, 'Criminal jokes', 'When the school was broken into, the thieves took absolutely everything - desks, books, blackboards, everything apart from the soap in the lavatories and all the towels. The police are looking for a pair of dirty criminals.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3313, 'Criminal jokes', 'Whats another word for a murderer who kills old ladies? A Killergran.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3314, 'Criminal jokes', 'Two small time thieves had been sent by the Big Boss to steal a van load of goods from a bathroom suppliers. One stayed in the van as look out and the other went into the storeroom. Fifteen minutes went by, then half an hour, then an hour, and no sign of him. The look out finally grew impatient and went to look for his partner. Inside the store the two came face to face. "Where have you been?" demanded the worried look out. "The boss told me to take a bath, but I couldnt find the soap and a towel."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3315, 'Criminal jokes', 'The criminal mastermind found one of his gang sawing the legs off his bed. "What are you doing that for?" demanded the crook boss. "Only doing what you ordered," said the stupid thug. "You told me to lie low for a bit!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3316, 'Criminal jokes', 'Why was the robber bionic? He was holding up a bank.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3317, 'Criminal jokes', '"Dad," said Fred to his father, who was a bank robber. "I need $50 for the school trip tomorrow." "OK, son," said his dad, "Ill get you the cash when the bank closes."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3318, 'Criminal jokes', 'A stupid bank robber rushed into a bank, pointed two fingers at the clerk and said, "This is a muck up!" "Dont you mean a stick up?" asked the girl. "No," said the robber, "its a muckup. Ive forgotten my gun."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3319, 'Criminal jokes', 'A woman woke her husband in the middle of the night. "Theres a burglar downstairs eating the cake that I made this morning." "Who shall I call," her husband asked, "police or ambulance?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3320, 'Criminal jokes', 'Fred: We had a burglary last night, and they took everything except the soap and towels. Harry: The dirty crooks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3321, 'Criminal jokes', 'Why did the burglar take a shower? He wanted to make a clean getaway', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3322, 'Criminal jokes', 'What did the burglar say to the watchmaker as he tied him up? Sorry to take so much of your valuable time.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3323, 'Criminal jokes', 'Judge: Why did you steal that bird? Prisoner: For a lark, sir.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3324, 'Criminal jokes', 'Judge: You claim you robbed the grocery store because you were starving. So why didnt you take the food instead of the cash out of the till? Burglar: Your Honour! Im a proud man, sir, and I make it a rule to pay for everything I eat.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3325, 'Criminal jokes', 'I think I hear burglars, dear. Are you awake? No!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3326, 'Criminal jokes', 'Judge: Tell me your occupation. Prisoner; Im a locksmith, Your Honour. Judge: Then what were you doing in a jewellery shop in the middle of the night when the police saw you? Prisoner; Making a bolt for the door!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3327, 'Criminal jokes', '"What makes you think the prisoner was drunk?" asked the judge. "Well, Your Honor," replied the arresting officer, "I saw him lift up a manhole cover and walk away with it, and when I asked him what it was for he said, I want to listen to it on my record-player! "', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3328, 'Criminal jokes', 'A police officer was escorting a prisoner to jail when his hat blew off. "Shall I run and get it for you?" asked the prisoner obligingly. "You must think Im daft," said the officer. "You stand here and Ill get it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3329, 'Criminal jokes', 'Why was the robber so secure? He was a safe robber.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3330, 'Criminal jokes', 'Victim (to mugger): But my watch isnt any good, it only has sentimental value.Mugger: Thats all right. Im sentimental.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3331, 'Criminal jokes', 'Criminal: Why dont you hire these twins for the robbery, boss?Criminal Boss: Im afraid of a double-cross.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3332, 'Criminal jokes', 'Detective: Do you think I should put on the cuffs?Criminal: Why? You look good in short sleeves.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3333, 'Criminal jokes', 'Detective: How did you get into counterfeiting?Criminal: I answered an ad that said, "Make money at home."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3334, 'Criminal jokes', 'Detective: Why did you dump those vegetables on my desk?Criminal: You said it was time to spill the beans.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3335, 'Criminal jokes', 'Policeman: Did you know your vehicle was reported stolen?Criminal: It wasnt when I took it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3336, 'Criminal jokes', 'A boy is in a prison cell with no windows and no doors: there are no holes in the ceiling or trapdoors in the floor, yet in the morning the jailers find him gone. How did he get out ?Through the doorway - there were no doors remember !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3337, 'Criminal jokes', 'Its a pity youve gone on hunger strike, said the convicts girlfriend on visiting day. Why ? Ive put a file in your cake.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3338, 'Criminal jokes', 'What did the burglar say to the lady who caught him stealing her silver? Im at your service, maam.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3339, 'Criminal jokes', 'How do bank robbers send messages?By flee mail!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
