INSERT INTO `jokes` VALUES (3363, 'Criminal jokes', 't was Christmas and the judge was in a merry mood as he asked the prisoner, "What are you charged with?""Doing my Christmas shopping early," replied the defendant."Thats no offense," said the judge. "How early were you doing this shopping?""Before the store opened," countered the prisoner.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3364, 'Criminal jokes', 'An English prisoner of war was held by the Germans. The Englishman was shot all over the place, and okay until one day when the German told him, "Englander,your arm is infected with gangrene vee must cut it off." The English prisoner said, "Well, okay, but could you drop it over England when you go bombing?" The German replied, "Ya, that vill not be a problem." A few weeks later the German tells the Englishman that they have to cut his other arm off. The Englishman says, "Well, could drop it over England like you did last time?""Ya, that vill be done," says the German. The next day the German tells him that they have to cut his leg off. Once again the Brit says, "Well, could you do the same as before?" The German replies, "Vhy, ya." The next the German tells him they have to cut his other leg. "Well," begins the Brit, "could you just..." The German snapped , "No! We think you are trying to escape!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3365, 'Criminal jokes', 'A mafiosos son sits at his desk writing a Christmas list to Jesus. He first writes, "Dear baby Jesus, I have been a good boy the whole year, so I want a new..." He looks at it, then crumples it up into a ball and throws it away. He gets out a new piece of paper and writes again, "Dear baby Jesus, I have been a good boy for most of the year, so I want a new..." He again looks at it with disgust and throws it away. He then gets an idea. He goes into his mothers room, takes a statue of the Virgin Mary, puts it in the closet, and locks the door. He takes another piece of paper and writes, "Dear baby Jesus. If you ever want to see your mother again..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
