INSERT INTO `jokes` VALUES (3392, 'Dance jokes', 'An avid line dancing couple go to the doctor for a check up because they are having trouble remembering anything but, all the latest line dances. The doctor finds them in excellent health (of course), but suggests that writing things down may help their memories off the dance floor. That night the husband gets up to go the kitchen and the wife asks for a dish of ice cream, suggesting that maybe he write it down. He says "I dont need to write it down" She says "Well I want Strawberries on it, so maybe you better write it down" "I don"t need to write it down" He says and walks off in a huff. Twenty minutes later he comes back with a plate of bacon and eggs. "I told you to write it down" she says, "You forgot my toast".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
