INSERT INTO `jokes` VALUES (3430, 'Dead and dying jokes', 'Did you hear someone has invented a coffin that just covers the head?Its for people like you whore dead from the neck up!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3431, 'Dead and dying jokes', 'The man who was about to die said to the Sheriff, "Say, do I really have to die swinging from a tree?" "Course not," replied the Sheriff. "We just put the rope round your neck and kick the horse away. After that its up to you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3432, 'Dead and dying jokes', 'A chemist, a shopkeeper and a teacher were sentenced to death by firing squad. The chemist was taken from his cell and as the soldiers took aim he shouted "Avalanche!" The soldiers panicked and in the confusion the chemist escaped. The shopkeeper was led out next. As the soldiers took aim he shouted "Flood!" and escaped. The teacher was then lead out. The squad took aim and the teacher, remenbering how the other two had escaped, shouted "Fire!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3433, 'Dead and dying jokes', 'At the inquest into her husbands death by food poisoning Mrs Wally was asked by the coroner if she could remember her husbands last words. "Yes," she replied. "He said I dont know how that shop can make a profit from selling this salmon at only 20 cents a tin..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3434, 'Dead and dying jokes', 'A man is calling on his best friend to pay a condolence call the day after the friends wife has died. When he knocks on the door, he gets no answer, so he decides to go in and see if everything is all right. Upon entering the house, the man discovers his friend in the living room kissing a mate."Jack", says the man, "Your wife just died yesterday!!" His friend looks up and says, "In this grief, do you think I know what Im doing?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3435, 'Dead and dying jokes', '"Why are you crying Fred?" asked the teacher. "Cos my parrot died last night. I washed it in Wisk. . ." "Fred," said the teacher. "You must have known that Wisks bad for parrots.""Oh it wasnt the Wisk that killed it, sir. It was the tumble drier."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
