INSERT INTO `jokes` VALUES (3445, 'Dead and dying jokes', 'What did the little kid do with the dead battery?He buried it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3446, 'Dead and dying jokes', 'What is posthumous work ?Something written by someone after they are dead !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3447, 'Dead and dying jokes', 'Why did the cowboy die with his boots on ?Because he didnt want to stub his toe when he kicked the bucket !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3448, 'Dead and dying jokes', 'When a knight in armour was killed in battle, what sign did they put on his grave ?Rust in peace !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3449, 'Dead and dying jokes', 'Why was George Washington buried at Mount Vernon ?Because he was dead !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3450, 'Dead and dying jokes', 'What are you doing? Im trying to call Washington! Oh, havent you heard? Hes dead!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3451, 'Dead and dying jokes', 'Waiter, theres a fly in my soup !Yes, its the rotting meat that attracts them !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3452, 'Dead and dying jokes', 'Q: What is the definition of Death?A: When you stop paying taxes suddenly.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3453, 'Dead and dying jokes', 'Three weeks after her wedding day, Joanna called her minister. "Reverend," she wailed, "John and I had a DREADFUL fight!" "Calm down, my child," said the minister, "its not half as bad as you think it is. Every marriage has to have its first fight!" "I know, I know!" said Joanna, "but what am I going to do with the BODY?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3454, 'Dead and dying jokes', 'There was a great loss today in the entertainment world. The man who wrote the song "Hokey Pokey" died. What was really horrible is that they had trouble keeping the body in the casket. They put his left leg in....Well, you know the rest.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3455, 'Dead and dying jokes', 'A dying man smells his favorite oatmeal raisin cookies cooking downstairs. It takes all the strength he has left but he gets up from the bed and crawls down the stairs. He sees the cookies cooling on the counter and staggers over to them. As he reaches for one, his wifes wrinkled hand reaches out, smacks his and she yells: "No, you cant have those! Theyre for the funeral!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3456, 'Dead and dying jokes', '"Do you believe in life after death?" the boss asked one of his employees."Yes, Sir," the new employee replied. "Well, then, that makes everything just fine," the boss went on. "After you left early yesterday to go to your grandmothers funeral, she stopped in to see you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3457, 'Dead and dying jokes', 'A chap went up to the counter in the library and said, "Have you got any books about committing suicide?"The librarian said, "Yes. Take a look over there, somewhere on the middle shelf."The chap came back a few moments later and said, "I cant find any at all."The librarian replied, "Yes, its awful. They never bring em back!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3458, 'Dead and dying jokes', 'Teacher: What can you tell me about the Dead Sea?Pupil: Dead ?, I didnt even know he was sick !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3459, 'Dead and dying jokes', 'A man is fibbing away about how great things are in his country. Finally, he starts describing the tall buildings in his country. "There is a building so tall, it took my friend Alex 72 hours to fall off it!" "Oh, my God!" says his friend. "Surely he must have died!" "Of course. He was without food or water for 3 days!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3460, 'Dead and dying jokes', 'An English guy was very ill and his son went to visit him in the hospital. Suddenly, the father began to breathe heavily and grabbed the pen and pad by the bed. With his last ounce of strength he wrote a note, dropped it, and died. The son was so overcome with grief that he didnt remember slipping the note into his pocket. At the funeral, he reached into the pocket of his coat and immediately felt the note. He excitedly read it thinking it might be something he could recite during the service. It said: YOU WANKER -- GET OFF MY OXYGEN TUBE!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3461, 'Dead and dying jokes', 'This elderly Newfoundland fisherman is on his deathbed and summons his 3 sons to his bedside. "Well boys, the time is near, and when I pass Id like to be buried at sea." So the boys agreed. A few days after his passing, the local front page read, "Local Fishermen Were Shocked Today When Their Nets Brought in Patrick McRay in a Coffin, 3 Shovels and the Bodies of His Three Sons... Funeral arrangements havent yet been made, however, it is believed all wished to be buried at sea."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3462, 'Dead and dying jokes', 'Phoning the florist to order some flowers for her lovers funeral, woman was caught off guard when asked what message she wanted on the card. "Message?" she sputtered. "Well, I guess, You will be missed." Visiting the funeral home, she was pleased that her floral tribute had arrived but mortified that the card had her exact words: "I guess you will be missed."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3463, 'Dead and dying jokes', 'Question: What did the dead raccoon say in his will? Answer: "Leave it to Beaver."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3464, 'Dead and dying jokes', 'A man was sitting in the electric chair. The executioner said, "Look, Im sorry but Im going to have to throw the switch in a minute." The man said, "Do me a favor and throw it out the window!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3465, 'Dead and dying jokes', 'Why do cemeteries have fences around them?Because people are dying to get in.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3466, 'Dentist jokes', 'Dentist begging the patient: Could you help me? Could you give out a few of your loudest, most painful screams?Patient: Why? Doc, it isnt all that bad this time.Dentist: There are so many people in the waiting room right now and I dont want to miss the 4 oclock ball game.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3467, 'Dentist jokes', 'Patient: "It must be tough spending all day with your hands in someones mouth."Dentist: "I just think of it as having my hands in their wallet."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3468, 'Dentist jokes', '"I am sorry, madam, but I shall have to charge you hundred dollars for pulling your boys tooth.""Hundred dollars! Why, I understood you to say that you charged only twenty dollars for such work!""Yes," replied the dentist, "but this youngster yelled so terribly that he scared out four other patients out of the office."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3469, 'Dentist jokes', 'What does the dentist of the year get?...A little plaque.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3470, 'Dentist jokes', 'Why did the dentist make a poor date with the manicurist?Because they fought both tooth and nail!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3471, 'Dentist jokes', 'How many dentists does it take to change a light bulb?Three. One to administer the anaesthetic, one to extract the light bulb, and one to offer the socket some vile pink mouthwash.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3472, 'Dentist jokes', 'What did the werewolf eat after hed had his teeth taken out? The dentist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3473, 'Dentist jokes', 'Monster: Doctor, doctor, Im a blood-sucking monster and I keep needing to eat doctors. Doctor: Oh what a shame. Im a dentist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3474, 'Dentist jokes', 'Freds mother was on the telephone to the boys dentist. "I dont understand it," she complained, "I thought his treatment would only cost me $20, but youve charged me $80." "It is usually $20, maam," agreed the dentist, "but Fred yelled so loudly that three of my other patients ran away!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3475, 'Dentist jokes', 'Nigel: You said the school dentist would be painless, but he wasnt. Teacher: Did he hurt you? Nigel: No, but he screamed when I bit his finger.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3476, 'Dentist jokes', 'Why are you laughing? My dentist just pulled one of my teeth out. I dont see much to laugh about in that. But it was the wrong one!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3477, 'Dentist jokes', 'As the judge said to the dentist: Do you swear to pull the tooth, the whole tooth, and nothing but the tooth?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3478, 'Dentist jokes', 'Why was the man arrested for looking at sets of dentures in a dentists window? Because it was against the law to pick your teeth in public.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3479, 'Dentist jokes', 'Who has the most dangerous job in Transylvania? Draculas dentist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3480, 'Dentist jokes', 'Im suffering from bad breath You should do something about it!I did. I just sent my wife to the dentist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3481, 'Dentist jokes', 'Dentist: Dont worry. Im painless.Patient: Im not.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3482, 'Dentist jokes', 'Patient: Doc, what should I do with all the gold and silver in my mouth?Dentist: Dont smile in a bad neighborhood.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3483, 'Dentist jokes', 'Patient: Hey, that tooth you pulled wasnt the one I wanted pulled.Dentist: Relax, Im coming to it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3484, 'Dentist jokes', 'Father: Dont you feel better now that youve gone to the dentist?Son: Sure do. He wasnt in.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3485, 'Dentist jokes', 'Cloyd went to a Charleston dentist complaining his gums had shriveled up and his teeth were falling out. After examining him, the dentist said, "Your mouth is really bad. Do you brush?" "Ah sure do!" replied Cloyd. "Everee single day!" "What do you brush with?" asked the dentist, "Preparation H," said the redneck.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3486, 'Dentist jokes', 'I thought, Miss Smith, that you wanted yesterday afternoon off because you were seeing your dentist?Thats right, Sir.So how come I saw you coming out of the movie theatre with a friend? That was my dentist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3487, 'Dentist jokes', 'At what time do most people go to the dentist?At tooth-hurty (2:30).', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3488, 'Dentist jokes', 'What did the dentist say to the golfer?"You have a hole in one. "', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3489, 'Dentist jokes', 'Why does a dentist seem moody?Because he always looks down in the mouth.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3490, 'Dentist jokes', 'Why do dentists like potatoes?Because they are so filling.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3491, 'Dentist jokes', 'What is a drill team?A group of dentists who work together.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3492, 'Dentist jokes', 'Why do people dislike going to the dentist?Because he is boring.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3493, 'Dentist jokes', 'What is a dentists office?A filling station.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3494, 'Dentist jokes', 'What do you call the Scottish dentist ?Phil McCavity !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3495, 'Dentist jokes', 'What do you call a dentist in the army ?A drill sergeant !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3496, 'Dentist jokes', 'What time is it when you have to go to the dentist ?Tooth Hurty !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3497, 'Dentist jokes', 'Did you hear about the dentist who planted a garden?...A month later he was picking his teeth', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3498, 'Dentist jokes', 'What game did the dentist play when she was a child?...Caps and robbers', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3499, 'Dentist jokes', 'What does a dentist do on a roller coaster?...He braces himself', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3500, 'Dentist jokes', 'What did the dentist see at the North Pole?...A molar bear', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3501, 'Dentist jokes', 'What was the dentist doing in Panama?...Looking for the Root Canal', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3502, 'Dentist jokes', 'Where does the dentist get his gas?...At the filling station', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3503, 'Dentist jokes', 'Why didnt the dentist ask his secretary out?...He was already taking out a tooth', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3504, 'Dentist jokes', 'What did the dentist say to the computer?...This wont hurt a byte', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3505, 'Dentist jokes', 'What did the tooth say to the departing dentist?...Fill me in when you get back', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3506, 'Dentist jokes', 'Anyone know the six most frightening words in the world ??? "The Dentist will see you now."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3507, 'Dentist jokes', '"Open wider." requested the dentist, as he began his examination of the patient. "Good God !" he said startled. "Youve got the biggest cavity Ive ever seen - the biggest cavity Ive ever seen." "OK Doc !" replied the patient. "Im scared enough without you saying something like that twice." "I didnt !" said the dentist. "That was the echo."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3508, 'Dentist jokes', 'While I was waiting to see the dentist, a woman came out of his inner office smiling. Nodding to me, she said, "Thank goodness my work is completed. Im so glad to have found a painless dentist and one whos so gentle and understanding too." When seated in the dentist chair, I related the incident to the doctor. He laughed and explained, "Oh, that was just my Mother."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3509, 'Dentist jokes', '"I came in to make an appointment with the dentist." said the man to the receptionist." "Im sorry sir." she replied. "Hes out right now, but..." "Thank you." interrupted the obviously nervous prospective patient. "When will he be out again ?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3510, 'Dentist jokes', 'Patient: Doctor, I am very nervous. You know, this is my first extraction.Young dentist: Dont worry, its my first extraction too.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3511, 'Dentist jokes', 'Dentist: There goes the only woman I ever loved.Assistant: Why dont you marry her?Dentist: I cant afford to. Shes my best patient.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3512, 'Dentist jokes', 'Dentist: Just let me finish and you will be another man after these cosmetic procedures.Patient: Okay doc, but dont forget to send your bill to the other man.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3513, 'Dentist jokes', 'Dentist to parsimonious patient "No, we give no discount for empty spaces when cleaning and polishing teeth Mrs. Borde!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3514, 'Dentist jokes', 'Young Charlie to dentists sexy chariside assistant "Aha ! Are you the lady orthodontist ?".The lady replied "No, but Ill straighten anyones teeth "', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3515, 'Dentist jokes', 'Young lady to father "Daddy, when I grow up shall I become a heart-doctor or a tooth-doctor " "Dentist" "Why father ?" "We have only one heart, but 32 teeth!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3516, 'Dentist jokes', 'Patient to Dentist: "How much to get my teeth straightened?" "Twenty thousand bucks" Patient heads for the door.Dentist to patient: "Where are you going?""To a plastic surgeon to get my mouth bent."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3517, 'Dentist jokes', 'Patient: How much to have this tooth pulled? Dentist: With pain $200 and without pain $100. Patient: Well, without pain its cheaper. Pull it WITHOUT pain.Without anesthesia neither anything, the dentist begins to extract the tooth, when the patient outcry: Aaaahhhhhhhh !!!!!Hey, WITH pain it costs $200 !!!, replies the dentist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3518, 'Dentist jokes', 'Whats worse than having your doctor tell you that you have VD? Having your dentist tell you.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3519, 'Dentist jokes', 'A patient asked the dentist, if it wasnt nasty to be all the day with the hands in someones mouth.The dentist answered "I just think of it as having my hands in their wallet."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3520, 'Dentist jokes', 'Gerald: "Have you ever come across a man who, at the slightest touch, caused you to thrill and tremble in every fiber of your being?"Mabel: "Yes, the dentist."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3521, 'Dentist jokes', 'believe that the members of the dental profession are the only men who can tell a women to open or close her mouth and get away with it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3522, 'Dentist jokes', 'Patient:Do you extract teeth painlessly?Dentis: "Not always, the other day I nearly dislocated my wrist', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3523, 'Dentist jokes', 'Papa, why is it that dentists call their offices dental parlors?""Because they are drawing-rooms, my son."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3524, 'Dentist jokes', 'Pardon me for a moment, please," said the dentist to the victim, "but before beginning this work I must have my drill.""Good heavens, man!" exclaimed the patient irritably. "Cant you pull a tooth without a rehearsal?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3525, 'Dentist jokes', 'What to do you call an old dentist? A bit long in the tooth', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3526, 'Dentist jokes', 'A man went to his dentist because he feels something wrong in his mouth.The dentist examines him and says, "that new upper plate I put in for you six months ago is eroding. What have you been eating?"The man replies, "all I can think of is that about four months ago my wife made some asparagus and put some stuff on it that was delicious ... Hollandaise sauce. I loved it so much I now put it on everything --- meat, toast, fish, vegetables, everything.""Well," says the dentist, "thats probably the problem. Hollandaise sauce is made with lots of lemon juice, which is highly corrosive. Its eaten away your upper plate. Ill make you a new plate, and this time use chrome.""Why chrome?" asks the patient. To which the dentist replies, "Its simple. Everyone knows that ... theres no plate like chrome for the Hollandaise!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3527, 'Dentist jokes', 'Dentist: "You dont need to open your mouth any wider. When I pull your tooth I expect to stand outside."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3528, 'Dentist jokes', '"Did you get your money?" ask the wife of the dentist who had just return from the delinquent patients home."Not a cent," growled the dentist, "and worse than that, he insulted me, and gnashed my teeth at me!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3529, 'Dinosaur jokes', 'Q: Why did the dinosaur cross the road?A: Because the chicken wasnt invented yet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3530, 'Dinosaur jokes', 'Q1: What vehicle does T-Rex use to go from planet to planet?A: A Dinosaucer', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3531, 'Dinosaur jokes', 'Q2: What kind of materials do dinosaurs use for the floor of their homes?A: Rep Tiles', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3532, 'Dinosaur jokes', 'Q3: What did the female dinosaur call her blouse making business?A: Try Saras Tops', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3533, 'Dinosaur jokes', 'Q4: What is the head of an Italian dinosaur family called?A: Ptera Don', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3534, 'Dinosaur jokes', 'Q5: How do you ask a dinosaur to lunch?A: Tea Rex?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3535, 'Dinosaur jokes', 'Q: What do you say to a twenty ton dinosaur with headphones on?A: Anything you want. He cant hear you.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3536, 'Dinosaur jokes', 'Q: Why didnt the T-rex skeleton attack the museum visitors?A: Because she had no guts!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3537, 'Dinosaur jokes', 'Q: What do you get when you put a bomb and a dinosaur together?A: Dino-mite.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3538, 'Dinosaur jokes', 'Q: What do you call a Blind Dinosaur?A: Do-ya-think-he-saurus.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3539, 'Dinosaur jokes', 'Q: What do you call a Blind Dinosaurs Dog?A: Do-ya-think-he-saurus-rex.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3540, 'Dinosaur jokes', 'Q: What was the most flexiest dinosaur?A: Tyrannosaurus Flex.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3541, 'Dinosaur jokes', 'Q: Why did the Apatosaurus devour the factory? A: Because she was a plant eater!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
