INSERT INTO `jokes` VALUES (3888, 'Dirty jokes', 'Little Mary was not the best student in Sunday School. Usually she slept through the class. One day the teacher called on her while she was napping, "Tell me, Mary, who created the universe?"When Mary didnt stir, little Johnny, an altruistic boy seated in the chair behind her, took a pin and jabbed her in the rear. "God Almighty!" shouted Mary, and the teacher said, "Very good," and Mary fell back asleep.A while later the teacher asked Mary, "Who is our Lord and Savior," but Mary didnt even stir from her slumber. Once again, Johnny came to the rescue, and stuck her again. "Jesus Christ!" shouted Mary, and the teacher said, "Very good," and Mary fell back asleep.Then the teacher asked Mary a third question. "What did Eve say to Adam after she had her twenty-third child?" And again, Johnny jabbed her with the pin. This time Mary jumped up and shouted, "If you stick that damn thing in me one m ore time, Ill break it in half!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3889, 'Dirty jokes', 'This guy goes to the zoo one day. While standing in front of the gorillas cage, a gust of wind swept some dust into his eye. As he rubbed his eyelid, the gorilla went crazy, bent open the bars, and beat the guy senseless.When the guy came to his senses, he reported the incident to the zookeeper. Nodding, the zookeeper explained that pulling down your eyelid means "F**k you!" in gorilla language. The explanation didnt make the victim feel any better and he vowed revenge.The next day he purchased two large knives, two party hats, two party horns, and a large sausage. Putting the sausage in his pants, he hurried to the zoo and over to the gorillas cage, where he tossed a hat, a knife, and a party horn.Knowing that gorillas were natural mimics, he put on a party hat. The gorilla looked at him, looked at the hat, and put it on. Next, he picked up his horn and blew on it. The gorilla picked up his  horn and did the same. Then the man picked up his knife, whipped the sausage out of his pants, and sliced it in half.The gorilla looked at the knife, looked at his own crotch, looked at the man, and pulled down his eyelid.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
