INSERT INTO `jokes` VALUES (3899, 'Divorce jokes', 'Miss DeAngelo was a none-too-bright young woman who had moved to Hollywood with dreams of becoming a star. She didnt find fame or glory, but she did encounter plenty of men willing to enjoy her plentiful charms, and soon she found herself called to testify in a divorce case. When it was her turn on the stand, the lawyer came forward. "Miss DeAngelo, the wife of the defendant has identified you as the other woman in her husbands life. Now, do you admit that you went to the Pricerite Motel with this Mr. Evans?""Well, yes," acknowledged Miss DeAngelo with a sniff, "but I couldnt help it." "Couldnt help it?" asked the lawyer derisively. "Hows that?" "Mr. Evans deceived me." "Exactly what do you mean?""See, when we signed in," she explained, "he told the motel clerk I was his wife."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
