INSERT INTO `jokes` VALUES (3904, 'Divorce jokes', 'An elderly man in Phoenix calls his son in New York and says, "I hate to ruin your day, but I have to tell you that your mother and I are divorcing; forty-five years of misery is enough." "Pop, what are you talking about?" the son screams. "We cant stand the sight of each other any longer," the old man says "Were sick of each other, and Im sick of talking about this, so you call your sister in Chicago and tell her," and he hangs up. Frantic, the son calls his sister, who explodes on the phone. "Like hell theyre getting divorced," she shouts, "Ill take care of this." She calls Phoenix immediately, and screams at the old man, "You are NOT getting divorced. Dont do a single thing until I get there. Im calling my brother back, and well both be there tomorrow. Until then, dont do a thing, DO YOU HEAR ME?" and hangs up. The old man hangs up his phone, too, and turns to his wif e. "Okay," he says, "theyre coming for Thanksgiving. Now what do we tell them for Christmas?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (3905, 'Divorce jokes', 'A married couple is driving down the interstate doing 55 mph. The husband is behind the wheel. His wife looks over at him and says, "Honey, I know weve been married for 15 years, but, I want a divorce." The husband says nothing but slowly increases speed to 60 mph. She then says, "I dont want you to try to talk me out of it, because Ive been having an affair with your best friend, and hes a better lover than you." Again the husband stays quiet and just speeds up as he clenches his hands on the wheels. She says, "I want the house." Again the husband speeds up, and now is doing 70 mph. She says, "I want the kids too." The husband just keeps driving faster, and faster, until hes up to 80 mph. She says, "I want the car, the checking account, and all the credit cards too." The husband slowly starts to veer toward a bridge overpass piling, as she says, "Is there an ything you want?" The husband says, "No, Ive got everything I need right here." She asks, "Whats that?" The husband replies just before they hit the wall at 90 mph, "Ive got the airbag!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
