INSERT INTO `jokes` VALUES (4000, 'Doctor and nurse jokes', 'The Doctor was puzzled "Im very sorry but I cant diagnose your trouble, Mahoney. I think it must be drink. ""Dont worry about it Dr. Kelley, Ill come back when youre sober."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4001, 'Doctor and nurse jokes', 'Patient: Im in a hospital! Why am I in here?Doctor: Youve had an accident involving a bus.Patient: What happened?Doctor: Well, Ive got some good news and some bad news. Which would you like to hear first?Patient: Give me the bad news first.Doctor: Your legs were injured so badly that we had to amputate both of them.Patient: Thats terrible! Whats the good news?Doctor: Theres a guy in the next ward who made a very good offer on your slippers.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4002, 'Doctor and nurse jokes', 'A man walks into a doctors office. He has a cucumber up his nose, a carrot in his left ear and a banana in his right ear."Whats the matter with me?" he asks the doctor.The doctor replies, "Youre not eating properly."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4003, 'Doctor and nurse jokes', 'Patient: Doctor, what should I do if my temperature goes up five more points?Doctor: Sell!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4004, 'Doctor and nurse jokes', 'A young woman went to her doctor complaining of pain."Where are you hurting?" asked the doctor."You have to help me, I hurt all over", said the woman."What do you mean, all over?" asked the doctor, "be a little more specific."The woman touched her right knee with her index finger and yelled, "Ow, that hurts." Then she touched her left cheek and again yelled, "Ouch! That hurts, too." Then she touched her right earlobe, "Ow, even THAT hurts", she cried.The doctor checked her thoughtfully for a moment and told her his diagnosis, "You have a broken finger."Dentist: $100.00.Patient: $100.00 for just a few minutes work?Dentist: Well, I can extract it very slowly if you like.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4005, 'Doctor and nurse jokes', 'Patient: Doctor, I think I swallowed a pillow.Doctor: How do you feel?Patient: A little down in the mouth.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4006, 'Doctor and nurse jokes', 'A baseball manager who had an ulcer was in his physician office for a checkup. "Remember," the doctor said, "dont get excited, dont get mad, and forget about baseball when youre off the field." Then he added, "By the way, how come you let the pitcher bat yesterday with the tying run on second and two men out in the ninth?"Doctor: Tell him I cant see him now. Next.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4007, 'Doctor and nurse jokes', '"Doctor, are you sure Im suffering from pneumonia? Ive heared once about a doctor treating someone with pneumonia and finally he died of typhus.""Dont worry, it wont happen to me. If I treat someone with pneumonia he will die of pneumonia."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4008, 'Doctor and nurse jokes', 'Patient: Doctor, you must help me. Im under such a lot of stress, I keep losing my temper with people.Doctor: Tell me about your problem.Patient: I just did, didnt I, you stupid fool!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4009, 'Doctor and nurse jokes', 'Patient: Doctor, if I give up wine, women, and song, will I live longer?Doctor: Not really. It will just seem longer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4010, 'Doctor and nurse jokes', 'A man, seeking to lose some of his excess weight, visited the local doctor.John: How can I lose twelve pounds of ugly fat?Doctor: Of course! Cut your head off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4011, 'Doctor and nurse jokes', 'A doctor has come to see one of his patients in a hospital. The patient has had major surgery to both of his hands."Doctor," says the man excitedly and dramatically holds up his heavily bandaged hands. "Will I be able to play the piano when these bandages come off?""I dont see why not," replies the doctor."Thats funny," says the man. "I wasnt able to play it before."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4012, 'Doctor and nurse jokes', 'A man went to see his doctor because he was suffering from a miserable cold. His doctor prescribed some pills, but they didnt help.On his next visit the doctor gave him a shot, but that didnt do any good.On his third visit the doctor told the man, "Go home and take a hot bath. As soon as you finish bathing throw open all the windows and stand in the draft.""But doc," protested the patient, "if I do that, Ill get pneumonia.""I know," said the doctor, "I can cure pneumonia."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4013, 'Doctor and nurse jokes', 'Patient (to cosmetic surgeon): Will it hurt me, doctor?Surgeon: Only when you get my bill, Mrs Brown.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4014, 'Doctor and nurse jokes', 'Doctor: Did you know that there are more than 1,000 bones in the human body?Larry: Shhh, doctor! There are three dogs outside in the waiting room!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4015, 'Doctor and nurse jokes', 'A new arrival, about to enter hospital, saw two white coated doctors searching through the flower beds."Excuse me," he said, "have you lost something?""No," replied one of the doctors. "Were doing a heart transplant for an income-tax inspector and want to find a suitable stone."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4016, 'Doctor and nurse jokes', 'Mary: My daughter believes in preventative medicine, doctor.Doctor: Oh, really?Mary: Yes, she tries to prevent me from making her take it!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4017, 'Doctor and nurse jokes', 'Whats the difference between a surgeon and a puppy?If you put a puppy in a room by itself for an hour, itll probably stop whining.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4018, 'Doctor and nurse jokes', 'The seven-year old girl told her mom, "A boy in my class asked me to play doctor.""Oh, dear," the mother nervously sighed. "What happened, honey?""Nothing, he made me wait 45 minutes and then double-billed the insurance company."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4019, 'Doctor and nurse jokes', 'A pipe burst in a doctors house. He called a plumber. The plumber arrived, unpacked his tools, did mysterious plumber-type things for a while, and handed the doctor a bill for $600.The doctor exclaimed, "This is ridiculous! I dont even make that much as a doctor!." The plumber quietly answered, "Neither did I when I was a doctor."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4020, 'Doctor and nurse jokes', 'Doctor: Have you ever had this before?Patient: Yes.Doctor: Well, youve got it again!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4021, 'Doctor and nurse jokes', 'Mrs. Smith: Help me, doctor! My son, John, swallowed the can opener!Doctor: Dont panic. Hell be alright.Mrs. Smith: But how do I open the can of beans?! The toast is getting cold!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4022, 'Doctor and nurse jokes', 'Doctor: Nurse, how is that little girl doing who swallowed ten quarters last night?Nurse: No change yet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4023, 'Doctor and nurse jokes', 'Nurse: Doctor, there is a man in the waiting room with a glass eye named Brown.Doctor: What does he call his other eye?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4024, 'Doctor and nurse jokes', 'A doctor and a nurse were called to the scene of an accident.Doctor: We need to get these people to a hospital now!Nurse: What is it?Doctor: Its a big building with a lot of doctors, but thats not important now!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4025, 'Doctor and nurse jokes', 'Doctor: Did you take the patients temperature?Nurse: No. Is it missing?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4026, 'Doctor and nurse jokes', 'Three nurses went to heaven, and were awaiting their turn with St. Peter to plead their case to enter the pearly gates.The first nurse said, "I worked in an emergency room. We tried our best to help patients, even though occasionally we did lose one. I think I deserve to go to heaven." St. Peter looks at her file and admits her to heaven.The second nurse says, "I worked in an operating room. Its a very high stress environment and we do our best. Sometimes the patients are too sick and we lose them, but overall we try very hard." St. Peter looks at her file and admits her to heaven.The third nurse says, "I was a case manager for an HMO."St. Peter looks at her file. He pulls out a calculator and starts punching away at it furiously, constantly going back to the nurses file. After a few minutes St. Peter looks up, smiles, and says, "Congratulations! Youve been admi tted to heaven ... for five days!"Harry was in the hospital. He was an old man. From time to time the young nurse came in and said in a patronising tone, "And how are we doing this morning?"Well, this is a story of revenge. Harry had received breakfast, and pulled the juice off the tray, and put it on his stand. He had been given a urine bottle to fill. The juice was apple juice. You know where the juice went.The nurse came in, picked up the urine bottle and said, "It seems we are a little cloudy today..." At this, Harry snatched the bottle out of her hand, drinked its contents, saying, "Well, Ill run it through again, maybe I can filter it better this time."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4027, 'Doctor and nurse jokes', 'Interns think of God, residents pray to God, doctors talk to God, nurses ARE God.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4028, 'Doctor and nurse jokes', 'Whats the difference between a nurse and a nun? A nun only serves one God.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4029, 'Doctor and nurse jokes', 'A nurse was showing some student nurses through the hospital. "This will be the most hazardous section in the hospital for you. The men on this floor are almost well."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4030, 'Doctor and nurse jokes', 'A doctor is going round the ward with a nurse and they come to the first bed where the chap is laying half dead."Did you give this man two tablets every eight hours?" asks the doctor."Oh, no," replies the nurse, "I gave him eight tablets every two hours!"At the next bed the next patient also appears half dead."Nurse, did you give this man one tablet every twelve hours?""Oops, I gave him twelve tablets every one hour," replies the nurse.Unfortunately at the next bed the patient is well and truly deceased, not an ounce of life. "Nurse," asks the doctor, "did you prick his boil?""OH MY GOODNESS!" replies the nurse.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4031, 'Doctor and nurse jokes', 'The nurse who can smile when things go wrong is probably going off duty.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4032, 'Doctor and nurse jokes', 'Why did the nurse always insist on using the rectal thermometer to obtain temperatures?Because nurses are taught in nursing school to always look for her patients best side.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4033, 'Doctor and nurse jokes', 'Did you hear about the nurse who died and went straight to hell?It took her two weeks to realize that she wasnt at work anymore!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4034, 'Doctor and nurse jokes', 'How many nurses does it take to change a light bulb?None, they just have a nursing assistant do it.As much as the doctor orders.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4035, 'Doctor and nurse jokes', 'How many triage nurses does it take to change a light bulb?One, but the bulb will have to spend four hours in the waiting room.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4036, 'Doctor and nurse jokes', 'How many doctors does it take to change a light bulb?Only one, but he has to have a nurse to tell him which end to screw in.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4037, 'Doctor and nurse jokes', '"The doctor said he would have me on my feet in two weeks.""And did he?""Yes, I had to sell the car to pay the bill."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4038, 'Doctor and nurse jokes', 'An old fellow came into the hospital truly on deaths door due to an infected gallbladder. The surgeon who removed the gallbladder was adamant that his patients be up and walking in the hall the day after surgery, to help prevent blood clots forming in the leg veins. The nurses walked the patient in the hall as ordered, and after the third day the nurse told how he complained bitterly each time they did. The surgeon told them to keep walking him.After a week, the patient was ready to go. His family came to pick him up and thanked the surgeon profusely for what he had done for their father. The surgeon was pleased and appreciated the thanks, but told them that it was really a simple operation and we had been lucky to get him in time. "But doctor, you dont understand," they said, "Dad hasnt walked in over a year!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4039, 'Doctor and nurse jokes', 'A man goes to the eye doctor. The receptionist asks him why he is there. The man complains, "I keep seeing spots in front of my eyes."The receptionist asks, "Have you ever seen a doctor?" and the man replies, "No, just spots."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4040, 'Doctor and nurse jokes', 'Patient: I always see spots before my eyes.Doctor: Didnt the new glasses help?Patient: Sure, now I see the spots much clearer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4041, 'Doctor and nurse jokes', 'A man needing a heart transplant is told by his doctor that the only heart available is that of a sheep. The man finally agrees and the doctor transplants the sheep heart into the man. A few days after the operation, the man comes in for a checkup. The doctor asks him "How are you feeling?" The man replies "Not BAAAAD!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4042, 'Doctor and nurse jokes', 'Whats the difference between a general practitioner and a specialist?One treats what you have, the other thinks you have what he treats.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4043, 'Doctor and nurse jokes', 'What is a double-blind study?Two orthopaedists reading an electrocardiogram.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4044, 'Doctor and nurse jokes', 'At a medical convention, a male doctor and a female doctor start eyeing each other. The male doctor asks her to dinner and she accepts. As they sit down at the restaurant, she excuses herself to go and wash her hands.After dinner, one thing leads to another and they end up in her hotel bedroom. Just as things get hot, the female doctor interrupts and says she has to go and wash her hands. Once she comes back they go for it. After the sex session, she gets up and says she is going to wash her hands.As she comes back the male doctor says, "I bet you are a surgeon".She confirms and asks how he knew. "Easy, youre always washing your hands."She then says, "I bet youre an anesthesiologist."Male doctor: "Wow, how did you guess?"Female doctor: "I didnt feel a thing."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4045, 'Doctor and nurse jokes', 'How many physiotherapists does it take to change a light bulb?None. They just give the dead bulb some exercises to do and hope it will be working a bit better the next time they see it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4046, 'Doctor and nurse jokes', '"Why are you so excited?", the surgeon asked the patient that was about to be anesthetized."But doc, this is my first operation.""Really? Its mine too, and I am not excited at all."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4047, 'Doctor and nurse jokes', '"What do you do?" a young man asked the beautiful girl he was dancing with. "Im a nurse." "I wish I could be ill and let you nurse me," he whispered in her ear. "That would be miraculous. I work on the maternity ward."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4048, 'Doctor and nurse jokes', 'A man who was very upset walked in to see his doctor. "Doctor, youve got to help me!" he wailed. "What seems to be the trouble?" asked the doctor. "I keep having the same dream, night after night. Theres this door with a sign on it, and I push and push the door but I cant get it open." "What does the sign say?" asked the Doctor. "Pull," said the patient.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4049, 'Doctor and nurse jokes', 'Doctor, Doctor, I keep dreaming of bats, creepy-crawlies, demons, ghosts, monsters, vampires, werewolves and yetis.Doctor: How interesting. Do you always dream in alphabetical order?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4050, 'Doctor and nurse jokes', 'There were ten zebras in the zoo. All but nine escaped. How many were left? Nine!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4051, 'Doctor and nurse jokes', 'Nurse: Would you like an appointment for next week?Patient: No, Im sick now.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4052, 'Doctor and nurse jokes', 'Jack went to see the camp nurse. I fell last night, he said. And I was unconscious for eight hours.The nurse was shocked. How awful. What happened?I fell asleep!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4053, 'Doctor and nurse jokes', 'Camp Doctor: Your cough sounds better today!Camper: It should, I practised all night!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4054, 'Doctor and nurse jokes', 'A coffin was being moved when it fell off a wagon, and started down the hill. One of the morticians started chasing it. As it rolled past the hospital, the mortician yelled to one of the nurse practitioners walking by, "Doc, quick, give me something to stop this coffin."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4055, 'Doctor and nurse jokes', 'The ninety-year-old man was in for his checkup when the nurse practitioner learned he was about to marry an eighteen year old girl. "Now, Mr. Jenkins," the nurse practitioner warned, "you should know that when a man your age marries an eighteen-year-old girl, somebody could get hurt." The old man shrugged, "If she dies, she dies."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4056, 'Doctor and nurse jokes', '1) Why did the nurse keep the bedpan in the refrigerator?Because when she kept it in the freezer it took too much skin off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4057, 'Doctor and nurse jokes', 'How can you tell who is the head nurse of a facility? Shes the one with dirty knees.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4058, 'Doctor and nurse jokes', 'How many nurses does it take to screw in a light bulb?None - They just have a nursing assistant do it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4059, 'Doctor and nurse jokes', 'Fireman rescued a man who was badly injured in a car accident. The entire left half of his body was torn off. He was taken to the hospital and examined. The doctors said he was all right. The nurses said there wasnt much left.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4060, 'Doctor and nurse jokes', 'Doctor, Doctor I keep thinking Im GodWhen did this start ?Well first I created the sun, then the earth', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4061, 'Doctor and nurse jokes', 'Doctor, Doctor youve taken out my tonsils, my adenoids, my gall bladder, my varicose veins and my appendix, but I still dont feel well.Thats quite enough out of you !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4062, 'Doctor and nurse jokes', 'Doctor how can I cure my sleep walking ?Sprinkle tin-tacks on your bedroom floor !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4063, 'Doctor and nurse jokes', 'Doctor, Doctor will this ointment clear up my spots ?I never make rash promises !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4064, 'Doctor and nurse jokes', 'Doctor Doctor I feel like a racehorse.Take one of these every 4 laps !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4065, 'Doctor and nurse jokes', 'Doctor, Doctor Im a burglar !Have you taken anything for it ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4066, 'Doctor and nurse jokes', 'Doctor, Doctor I keep seeing an insect spinning around.Dont worry, its just a bug thats going around !doc', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4067, 'Doctor and nurse jokes', 'Doctor, Doctor I need something to keep my falling hair in What about a matchbox !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4068, 'Doctor and nurse jokes', 'Doctor Doctor I think Im a moth.So why did you come around then ?Well, I saw this light at the window...!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4069, 'Doctor and nurse jokes', 'Doctor, Doctor Im on a diet and its making me irritable. Yesterday I bit someones ear off.Oh dear, thats a lot of calories !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4070, 'Doctor and nurse jokes', 'Doctor, Doctor I keep thinking Im a nit Will you get out of my hair !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4071, 'Doctor and nurse jokes', 'Doctor Doctor I keep thinking Im a caterpillar Dont worry youll soon change !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4072, 'Doctor and nurse jokes', 'Doctor, Doctor I keep thinking Im a snake about to shed its skinWhy dont you go behind the screen and slip into something more comfortable then !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4073, 'Doctor and nurse jokes', 'Q: Why do blonde nurses bring red magic markers to work?A: In case they have to draw blood.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4074, 'Doctor and nurse jokes', 'What kind of physician works on a cruise liner?A dry doc.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4075, 'Doctor and nurse jokes', 'What do you get if you have strep throat on Friday?Saturday Night Fever.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4076, 'Doctor and nurse jokes', 'Did you hear about the two podiatrists who opened their offices on the same street?They were arch enemies.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4077, 'Doctor and nurse jokes', 'The patient shook his doctors hand in gratitude and said, "Since we are the best of friends, I would not want to insult you by offering payment. But I would like for you to know that I had mentioned you in my will.""That is very kind of you," said the doctor emotionally, and then added, "May I see that prescription I just gave you? Id like to make a little change..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4078, 'Doctor and nurse jokes', 'Doctor, doctor, can I have a bottle of aspirin and a pot of glue?Why?Because Ive been at my computer all day and Ive got a splitting headache!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4079, 'Doctor and nurse jokes', 'Doctor, Doctor, my little brother thinks hes a computer.Well bring him in so I can cure him.I cant, I need to use him to finish my homework.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4080, 'Doctor and nurse jokes', 'A nurse had to take a patient back to her room after surgery. Woman was still feeling the effects of the anesthetic and was rather confused. After nurse had made her comfortable, she was confronted with four of woman friends who asked, "How is she?" The nurse replied, "Oh, shes quite dopey." One of the friends said, "We know that, but how is she healthwise?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4081, 'Doctor and nurse jokes', 'When a car skidded on wet pavement and struck a telephone pole, several bystanders ran over to help the driver. A woman was the first to reach the victim, but a man rushed in and pushed her back. "Step aside, lady," he barked. "Ive taken a course in first aid." The woman watched him for a few minutes, then tapped his shoulder. "Pardon me," she said. "But when you get to the part about calling a doctor, Im right here."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4082, 'Doctor and nurse jokes', 'The patient: Tell me, is it true that alcohol decreases blood pressure?Doctor: Yes, that is true.P: And, is it true that coffee increases blood pressure?D: Yes, that is also true.P: So, in average, I live normally.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4083, 'Doctor and nurse jokes', 'Jack: "My brother was sick and went to the doctor."John: "Is he feeling better now?"Jack: "No, he has a broken arm."John: "How did he break it?"Jack: "Well, the doctor gave him a prescription and told him no matter what happened, to follow that prescription. And the prescription blew out of the window."John: "How did he break his arm?"Jack: "He fell out of the window trying to follow the prescription."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4084, 'Doctor and nurse jokes', 'Doctor: "Good news you passed your hearing test!"Patient: "HUH"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4085, 'Doctor and nurse jokes', '"Doctor, doctor!" said the panic-stricken woman, "my husband was asleep with his mouth open, and hes swallowed a mouse! What shall I do?""Quite simple," said the doctor calmly. "You just tie a lump of cheese to a piece of string and lower it into your husbands mouth. As soon as the mouse takes a bite  haul it out.""Oh, I see. Thank you, doctor. Ill go around to the fishmonger straight away and get a cods head.""What do you want a cods head for?""Oh- I forgot to tell you. Ive got to get the cat out first!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4086, 'Dog jokes', 'A man walked by a table in a hotel and noticed three men and a dog playing cards. The dog was exhibiting an extraordinary performance. "That is a very smart dog," the man commented. "Hes not so smart," said one of the irked players. "Every time he gets a good hand he wags his tail."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4087, 'Dog jokes', 'A man took his Rottweiler to the vet and said to him, "My dogs cross-eyed. Is there anything you can do for it?" "Well," said the vet "lets have a look at him" The vet picks the dog up by the ears and has a good look at its eyes. "Well," says the vet "Im going to have to put him down." "Just because hes cross-eyed?" says the man. "No, because hes heavy," says the vet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4088, 'Dog jokes', 'A local business was looking for office help. They put a sign in the window, stating the following: "HELP WANTED. Must be able to type, must be good with a computer and must be bilingual. We are an Equal Opportunity Employer." A short time afterwards, a dog trotted up to the window, saw the sign and went inside. He looked at the receptionist and wagged his tail, then walked over to the sign, looked at it and whined. Getting the idea, the receptionist got the office manager. The office manager looked at the dog and was surprised, to say the least. However, the dog looked determined, so he lead him into the office. Inside, the dog jumped up on the chair and stared at the manager. The manager said, "I cant hire you. The sign says you have to be able to type." The dog jumped down, went to the typewriter and proceeded to type out a perfect letter. He took out the page and trotted over to the manager  and gave it to him, then jumped back on the chair. The manager was stunned, but then told the dog, "The sign says you have to be good with a computer." The dog jumped down again and went to the computer. The dog proceeded to enter and execute a perfect program, that worked flawlessly the first time. By this time the manager was totally dumb-founded! He looked at the dog and said, "I realize that you are a very intelligent dog and have some interesting abilities. However, I still cant give you the job." The dog jumped down and went to a copy of the sign and put his paw on the sentences that told about being an Equal Opportunity Employer. The manager said, "Yes, but the sign also says that you have to be bilingual". The dog looked at the manager calmly and said "Meow".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4089, 'Dog jokes', 'Paul got off the elevator on the 40th floor and nervously knocked on his blind dates door. She opened it and was as beautiful and charming as everyone had said. "Ill be ready in a few minutes," she said. "Why dont you play with Rollo while youre waiting? He does wonderful tricks. He rolls over, shakes hands, sits up, and if you make a hoop with your arms, hell jump through." The dog followed Paul onto the balcony and started rolling over. Paul made a hoop with his arms and Rollo jumped through -- and over the balcony railing. Just then Pauls date walked out. "Isnt Rollo the cutest, happiest dog youve ever seen?" "To tell the the truth," he replied, "he seemed a little depressed to me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4090, 'Dog jokes', 'Q: Whens the best time to take your doberman pinscher for a walk? - A: Anytime he wants to go.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4091, 'Dog jokes', 'Q: Why do dogs bury bones in the ground? - A: Because you cant bury them in the sky!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4092, 'Dog jokes', 'Q: How did bulldogs get such flat noses? - A: From chasing cars.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4093, 'Dog jokes', 'Q: What has got four legs and an arm? - A: A Rottweiler in a playground.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4094, 'Dog jokes', 'Q: How do you get a dog to stop barking in the back seat of a car? - A: Put him in the front seat.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4095, 'Dog jokes', 'Q: What do you say to a dog before he eats? - A: Bone appetite!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4096, 'Dog jokes', 'Q: Why did the dog cross the road? - A: Because it was the chickens day off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4097, 'Dog jokes', 'Q: Why is a dogs nose in the middle of its face? - A: Because its the scenter.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4098, 'Dog jokes', 'Q: When is a strange dog most likely to go into your house? - A: When the door is open.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4099, 'Dog jokes', 'Q: What happened when the dog went to the flea circus? - A: It stole the show!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4100, 'Dog jokes', 'Q: Why did the lazy person buy a tall dog? - A: So that they didnt have to bend down to pet it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4101, 'Dog jokes', 'Q: What kind of dog does a dracula like? - A: A Bloodhound.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4102, 'Dog jokes', 'Q: What did the puppy say when he sat on sand paper? - A: RUFF!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4103, 'Dog jokes', 'Q: What goes "krab, krab, krab"? - A: A dog barking in a mirror.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
