INSERT INTO `jokes` VALUES (4229, 'Dog jokes', 'A man and his son were shovelling the driveway after a heavy snowfall when their dog, Lady, wandered away from them. Man, fearing the dog might be hit by car, shouted angrily: "Lady! Lady! Get over here right now!" The dog charged happily back over to them, accompanied by a commuter who had been standing at the bus stop. "Yes, sir, what can I do for you?" she asked.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4230, 'Dog jokes', 'Four workers were discussing how smart their dogs were. The first was an engineer who said his dog could draw. His dogs name was "T-Square", and he told him to get some paper and draw a square, a circle and a triangle, which he did with no sweat. The accountant said he thought his dog, "Balance", could do better. He told him to fetch a dozen cookies and divide them into piles of three, which he did with no problem. The chemist said that was a very good stunt, but that his dog, "Apothecary", could do better yet. He told his dog to get a quart of milk and pour seven ounces into a ten ounce glass. Apothecary did this without a hitch. All three men agreed their dogs were equally smart. They turned to the Civil Servant and asked him what his dog could do. The Civil Servant called his dog, whose name was "Coffee break", and said, "Show the fellows what you can do, old buddy." Coffee Break then stroll ed over and ate the cookies, drank the milk, shit on the paper, screwed the other three dogs and claimed he injured his back while doing so. He then filed a grievance for unsafe conditions, applied for Workers Compensation, and left for home on sick leave.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4231, 'Dog jokes', 'I bought a dog the other day... I named him Stay. Its fun to call him... "Come here, Stay! Come here, Stay!" He went insane. Now he just ignores me and keeps typing. Hes an East German Shepherd.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4232, 'Dog jokes', 'The front door was accidentally left open and our dog was gone. After unsuccessfully whistling and calling, my husband got in the car and went looking for him. He drove around the neigbourhood for some time with no luck. Finally he stopoed beside a couple out for a walk and asked if they had seen our dog. "You mean the one following your car?" they asked.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
