INSERT INTO `jokes` VALUES (4511, 'Face jokes', 'Two boys were watching TV when the fabulous face and figure of Pamela Anderson appeared on the screen. "if I ever stop hating girls," said one to the other, "I think Ill stop hating her first."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4512, 'Face jokes', 'I never forget a face, but in your case Ill make an exception.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4513, 'Face jokes', 'Did you hear about the witch who was so ugly that when a tear rolls down her cheek it takes one look at her face and rolls straight up again?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4514, 'Face jokes', 'Fred: Your sister uses too much make-up. Harry: Do you think so? Fred: Yes. Its so thick that if you tell her a joke, five minutes after shes stopped laughing her face is still smiling!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4515, 'Face jokes', 'Wife to Husband: Ill have you know Ive got the face of a teenager! Husband to Wife: Then you should give it back, youre wearing it out.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4516, 'Face jokes', 'Patient: The trouble is, doctor, I keep pulling ugly faces. Doctor: Dont worry, I dont expect anyone will notice.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4517, 'Face jokes', 'Fred: Do you like my new hairstyle?Harry: In as much as it covers most of your face, yes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
