INSERT INTO `jokes` VALUES (4529, 'Face jokes', 'Once there was a church that had a bell that no one could ring. One day, a boy came and asked the priest if he could try. So the boy went up into the tower and ran straight into the bell, face-first. The bell tolled loud and clear. The shocked priest gave him the job. But one Sunday, he ran straight toward the bell with his face and missed and fell off the tower and died. "Congregation," the priest said before the assembled masses. "Does anybody know this boys name? Because I dont know him, but his face rings a bell."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4530, 'Face jokes', 'Q.What do me and a mirror have in common? A.When we see your face we both crack up!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4531, 'Face jokes', '"Mommy, all the kids at school say Im a werewolf! Is that true?" "No, of course not. Now shut up and comb your face."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4532, 'Face jokes', 'Teacher: What a glum face, what would you say if I came to school with a face like yours ?Pupil: Id be too polite to mention it !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4533, 'Face jokes', 'Witch: Doctor, I cant help pulling ugly faces. Doctor: Well theres nothing terrible about that. Witch: It is when the people with ugly faces dont like them being pulled.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4534, 'Face jokes', 'A little boy came running into the kitchen. "Dad, dad," he said, "theres a monster at the door with a really ugly face.""Tell him youve already got one," said his father.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4535, 'Face jokes', 'Boy: Youve got a face like a million dollars. Girl: Have I really? Boy: Yes ? its green and wrinkly.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4536, 'Face jokes', 'Freds new girlfriend uses such greasy lipstick that he has to sprinkle his face with sand to get a better grip.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4537, 'Face jokes', 'A woman just back from Arizona was telling her friends about the trip. "When my husband first saw the Grand Canyon, his face dropped a mile," she said."Why, was he disappointed with the view?""No, he fell over the edge."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4538, 'Ethnic jokes', 'A Texan, while visiting Toronto, found himself in the back seat of a taxi cab on the way to his hotel. Passing by the Royal York the Texan asked the cab driver "Whats that building there?" "Thats the Royal York Hotel" replied the cabbie. "The Royal York? How long did it take to build that?" asked the Texan. "About 12 years" replied the cabbie."12 years? We build em twice as high, twice as wide and four times as long down in Texas, and we do that in six months." A while later the cab driver makes his was past the Metro-Toronto Convention Centre. "Whats that building over there?" asked the Texan. "Thats the Metro-Toronto Convention Centre" replied the cabbie. "Convention Centre? How longd it take to build that?" asked the Texan. "About three years" replied the cabbie. "Three years? We build em twice as high, three times as long and four times as wide as that down in Texas, and  it only takes us about two weeks." Shortly thereafter the cabbie drives past the CN Tower. "Whats that building there?" asks the Texan, pointing at the tower. "Danged if I know" replied the cabbie, "It wasnt here when I drove by yesterday."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4539, 'Ethnic jokes', 'A Frenchman, an Englishman and a New Yorker were captured by cannibals. The chief comes to them and says, "The bad news is that now weve caught you and were going to kill you. We will put you in a pot, cook you, eat you and then were going to use your skins to build a canoe. The good news is that you can choose how to die." The Frenchman says, "I take ze sword." The chief gives him a sword, the Frenchman says, "Vive la France!" and runs himself through. The Englishman says, "a pistol for me please." The chief gives him a pistol, the Englishman points it at his head and says, "God save the queen!" and blows his brains out. The New Yorker says, "Gimme a fork!" The chief is puzzled, but he shrugs and gives him a fork. The New Yorker takes the fork and starts jabbing himself all over--the stomach, the sides, the chest, everywhere. There is blood gushing out all over, its horrible. The  chief is appalled and asks, "My God, what are you doing?" And the New Yorker responds, "So much for your canoe you stupid cannibal!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4540, 'Ethnic jokes', 'The Americans and Russians at the height of the arms race realized that if they continued in the usual manner they were going to blow up the whole world. One day they sat down and decided to settle the whole dispute with one dog fight. Theyd have five years to breed the best fighting dog in the world and whichever sides dog won would be entitled to dominate the world. The losing side would have to lay down its arms. The Russians found the biggest meanest Doberman and Rottweiler dogs in the world and bred them with the biggest meanest Siberian wolves. They selected only the biggest and strongest puppy from each litter, killed his siblings, and gave him all the milk. The used steroids and trainers and after five years came up with the biggest meanest dog the world had ever seen. Its cage needed steel bars that were five inches thick and nobody could get near it. "When the day came for th e fight, the Americans showed up with a strange animal. It was a nine foot long Dachshund. Everyone felt sorry for the Americans because they knew there was no way that this dog could possibly last ten seconds with the Russian dog. "When the cages were opened up, the Dachshund came out and wrapped itself around the outside of the ring. It had the Russian dog almost completely surrounded. When the Russian dog leaned over to bite the Dachshunds neck, the Dachshund leaned up and consumed the Russian dog in one bite. There was nothing left at all of the Russian dog. The Russians came up to the Americans shaking their heads in disbelief. `We dont understand how this could have happened. We had our best people working for five years with the meanest Doberman and Rottweiler dogs in the world and the biggest meanest Siberian wolves." "Thats nothing", an American replied. "We had our best plastic surgeons worki ng for five years trying to make an alligator look like a Dachshund."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4541, 'Ethnic jokes', 'When young Jose, newly arrived in the United States, made his first trip to Yankee Stadium, there were no tickets left for sale. Touched by his disappointment, a friendly ticket salesman found him a perch near the American flag. Later, Jose wrote home enthusiastically about his experience. "And the Americans, they are so friendly!" he concluded. "Before the game started, they all stood up and looked at me and sang, .... Jose, can you see?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4542, 'Ethnic jokes', 'An old Indian lined up all of his 10 little Indian sons and stood in front of them.He then asked, "Who push port-a-potty over cliff?"Nobody answered him.He then asked again, "Who push port-a-potty over cliff?"Again nobody answered.The old Indian said, "I tell story of Georgie and Georgie father. Georgie chop down cherry tree. Georgie tell truth, Big Georgie no punish." So the Indian asked again,"Who push port-a-potty over cliff?"To which the littlest Indian replied, "I push port-a-potty over cliff."The old Indian then shakes and spanks him, for his punishment. When he is done, the little Indian asks, "Georgie tell truth, Georgie no get punish. I tell truth, I get punished. Why you punish, father?"The old Indian replied, "Big Georgie not in cherry tree when it got chopped down!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4543, 'Elephant jokes', 'Why did the elephant eat the candle? He wanted a light snack!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4544, 'Elephant jokes', 'Q: What happened when the elephant sat on the car?A: Everyone knows a Mercedes Bends!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4545, 'Elephant jokes', 'Two elephants jumped off a cliff....... BOOM BOOM!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4546, 'Elephant jokes', 'It was a boring Sunday afternoon in the jungle so the Elephants decided to challenge the Ants to a game of soccer. The game was going well with the Elephants beating the Ants ten goals to nil, when the Ants gained possession. The Ants star player was dribbling the ball towards the Elephants goal when the Elephants left back came lumbering towards him.The elephant trod on the little ant, killing him instantly. The referee stopped the game. "What the hell do you think youre doing? Do you call that sportsmanship, killing another player?" The elephant replied, "Well, I didnt mean to kill him -- I was just trying to trip him up."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4547, 'Elephant jokes', 'An elephant was walking in a park. With each step he took, he squished many little ants. Upset, the ants began to crawl up on the elephant -- first his legs and then up all over his body. When the elephant started feeling all the little ants on him, he shook hard, making all the little ants, except for one, fall to the ground. As the only ant on the elephant hung on close to the elephants neck, the ones on the ground began to yell, "Strangle him!!! Strangle him!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4548, 'Ethnic jokes', 'An old Native American wanted a loan for $500. He approached his local banker. The banker pulled out the loan application, asking, "What are you going to do with the money?" "Take jewelry to city and sell it," said the old man. "What have you got for collateral?" queried the banker, going strictly by the book. "Dont know of collateral." "Well thats something of value that would cover the cost of the loan. Have you got any vehicles?" "Yes, I have a 1949 Chevy pickup." The banker shook his head, "How about livestock?" "Yes, I have a horse." "How old is it?" "I dont know; it has no teeth." Finally the banker decided to make the $500 loan. Several weeks later the old man was back in the bank. He pulled out a roll of bills, "Heres the money to pay loan," he said, handing the entire amount including interest. "What are you going to  do with the rest of that money?" "Put it in my pocket." "Why dont you deposit it in my bank?" he asked. "I dont know of deposit." "Well, you put the money in our bank and we take care of it for you. When you want to use it you can withdraw it." The old Indian leaned across the desk, looking suspiciously at the banker, and asked, "What you got for collateral?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4549, 'Ethnic jokes', 'A visitor from Holland was chatting with his American friend and was jokingly explaining about the red, white and blue in the Netherlands flag. "Our flag symbolizes our taxes," he said. "We get red when we talk about them, white when we get our tax bill, and blue after we pay them." "Thats the same with us," the American said, "only we see stars, too."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4550, 'Ethnic jokes', 'These four guys were walking down the street, a Saudi, a Russian, a North Korean, and a New Yorker. A reporter comes running up and says, "Excuse me, what is your opinion about the meat shortage?"The Saudi says, "Whats a shortage?"The Russian says, "Whats meat?"The North Korean says, "Whats an opinion?"The New Yorker, says, "Excuse me?? Whats excuse me?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4551, 'Ethnic jokes', 'An American tourist in Moscow found himself needing to get rid of a large supply of garbage from his recent stay at an apartment. After a long search, he just couldnt find any place to discard of it. So, he just went down one of the side streets to dump it there.Yet, he was stopped by a Moscow police officer, who said, "Hey you, what are you doing?""I have to throw this away," replied the tourist."You cant throw it away here. Look, follow me," the policeman offered.The police officer led him to a beautiful garden with lots of grass, pretty flowers, and manicured hedges. "Here," said the cop, "dump all the garbage you want."The American shrugs, opens up the large bags of garbage, and dumps them right on the flowers."Thanks for giving me a place to dump this stuff. This is very nice of you. Is this Russian courtesy?" asked the tourist."No. This is the Amer ican Embassy."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4552, 'Ethnic jokes', 'A family was visiting an Indian reservation when they happen upon an old tribesman laying face down in the middle Of the road with his ear pressed firmly against the blacktop. The father of the family asked the old tribesman what he was doing. The tribesman began to speak..."woman, late thirties, three kids, one barking dog in late model, Four door station wagon, traveling at 65 m.p.h." "Thats amazing" exclaimed the father. "You can tell all of that by just listening to the ground"? "No", said the old tribesman. "They just ran over me five minutes ago"!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4553, 'Ethnic jokes', 'A prominent Polish scientist conducted very important experiment. He trained a flea to jump upon giving her a verbal command ("Jump!").In a first stage of experiment he removed fleas leg, told her to jump, and the flea jumped. So he wrote in his scientific notebook: "Upon removing one leg all flea organs function properly."So, he removed the second leg, asked the flea to jump, she obeyed, so he wrote again: "Upon removing the second leg all flea organs function properly."Thereafter he removed all the legs but one, the flea jumped when ordered, so he wrote again: "Upon removing the next leg all flea organs function properly."Then he removed the last leg. Told flea to jump, and nothing happened. He did not want to take a chance, so he repeated the experiment several times, and the leg less flea never jumped. So he wrote the conclusion: "Upon removing the last leg the flea loses  sense of hearing"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4554, 'Ethnic jokes', 'A Brit, a Frenchman and a Russian are viewing a painting of Adam and Eve frolicking in the Garden of Eden. "Look at their reserve, their calm," muses the Brit. "They must be British." "Nonsense," the Frenchman disagrees. "Theyre naked, and so beautiful. Clearly, they are French." "No clothes, no shelter," the Russian points out, "they have only an apple to eat, and theyre being told this is paradise. They are Russian."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4555, 'Ethnic jokes', 'There was a Japanese man who went to America for sightseeing. On the last day, he hailed a cab and told the driver to drive to the airport. During the journey, a Honda drove past the taxi. Thereupon, the man leaned out of the window excitedly and yelled, "Honda, very fast! Made in Japan!"After a while, a Toyota sped past the taxi. Again, the Japanese man leaned out of the window and yelled, "Toyota, very fast! Made in Japan!"And then a Mitsubishi sped past the taxi. For the third time, the Japanese leaned out of the window and yelled, "Mitsubishi, very fast! Made in Japan!"The driver was a little angry, but he kept quiet. And this went on for quite a number of cars. Finally, the taxi came to the airport. The fare was US$300.The Japanese exclaimed, "Wah... so expensive!"There upon, the driver yelled back, "Meter, very fas t! Made in Japan!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4556, 'Ethnic jokes', 'Sid and Al were sitting in a Chinese restaurant. "Sid," asked Al, "are there any Jews in China?""I dont know," Sid replied. "Why dont we ask the waiter?"When the waiter came by, Al asked him, "Are there any Chinese Jews?""I dont know sir, let me ask," the waiter replied, and he went into the kitchen. He returned in a few minutes and said, "No, sir. No, Chinese Jews.""Are you sure?" Al asked."I will check again, sir," the waiter replied and went back to the kitchen. While he was still gone, Sid said, "I cannot believe there are no Jews in China. Our people are scattered everywhere."When the waiter returned he said, "Sir, no Chinese Jews.""Are you really sure?" Al asked again."I cannot believe there are no Chinese Jews.""Sir, I ask everyone," the waiter replied exasperated. "We have Orange Jews, Prune Jews, Tomato Jews and Grape Jews, but we have no Chin ese Jews."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4557, 'Ethnic jokes', 'Two Arabs boarded a shuttle out of Washington for New York. One sat in the window seat, the other in the middle seat. Just before takeoff a fat, little Israeli guy got on and took the aisle seat next to the Arabs. He kicked off his shoes, wiggled his toes and was settling in when the Arab in the window seat said, "I think Ill go up and get a coke." "No problem," said the Israeli. "Ill get it for you." While he was gone, the Arab picked up the Israelis shoe and spit in it. When the Israeli returned with the coke, the other Arab said, "That looks good. I think Ill have one too." Again, the Israeli obligingly went to fetch it, and while he is gone the Arab other picked up the other shoe and spit in it. The Israeli returned with the coke, and they all sat back and enjoyed the short flight to New York. As the plane was landing the Israeli slipped his feet into his shoes and knew  immediately what had happened. "How long must this go on?" he asked. "This enmity between our peoples..... this hatred... this animosity... this spitting in shoes and peeing in cokes?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4558, 'Ethnic jokes', 'Two Polish guys were taking their first train trip to Warsaw on the train. A vendor came down the corridor selling bananas which theyd never seen before. Each bought one.The first one eagerly peeled the banana and bit into it just as the train went into a tunnel. When the train emerged from the tunnel, he looked across to his friend and said, "I wouldnt eat that if I were you." "Why not?" "I took one bite and went blind for half a minute."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4559, 'Ethnic jokes', 'These two newfies are building a house. One of them is putting on the siding. He picks up a nail, hammers it in. Picks up another nail, throws it away. Picks up a nail, hammers it in. Picks up another, throws it away. This goes on for a while, and finally his friend comes over and asks him why he is throwing half of the nails away. He replies, "Those ones were pointed on the wrong end." The buddy gets exasperated and says "You idiot, those nails are for the other side of the house!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4560, 'Ethnic jokes', 'Two Newfies landed themselves a job at a saw mill. Just before morning the one yelled, "Mick! I lost me finger!" "Have you now?" says Mick. "And how did you do it?" "I just touched this big spinning thing here... No! There goes another one!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4561, 'Ethnic jokes', 'There were three guys, a Torontonian, an American and a Newfoundlander. They were all going to be executed. The executioner said that since all three were to be executed that night, that they would each get to choose the method by which they would die.Their choices were: lethal injection, electric chair or by hanging. The American was afraid of needles and didnt want to be hanged. The American chose the electric chair. He sat in the chair and they pulled the switch and nothing happened. The executioner said that if this happens a second time that he could go free. They tried a second time and again nothing happened so they set him free.The guy from Toronto was also afraid of needles and didnt want to be hanged so he too chose the electric chair. Once again, the chair didnt work and he was free.Next it was the Newfoundlanders turn to pick how he was to be executed. He said "Im a fraid of needles, the electric chair wont work so youre going to have to hang me".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4562, 'Ethnic jokes', 'There was once a Scotsman and an Englishman who lived next door to each other. The Scotsman owned a hen and each morning would look in his garden and pick up one of his hens eggs for breakfast.One day he looked outside and saw that the hen had laid an egg in the Englishmans garden. He was about to go next door when he saw the Englishman pick up the egg. The Scotsman ran up to the Englishman and told him that the egg belonged to him because he owned the hen. The Englishman disagreed because the egg was laid on his property.They argued for a while until finally the Scotsman said, "In my family we normally solve disputes by the following actions: I punch you in the nose and note how long it takes you to recover, then you punch me in the nose and note how long it takes for me to recover, whomever recovers quicker wins the egg."The Englishman agreed to this and so the Scotsman held the  heaviest object he could find, took a few steps back, then ran toward the Englishman and punched him as hard as he could in the nose. The Englishman fell to the ground and was howling in agony and holding his nose for thirty minutes.Eventually the Englishman stood up and said, "Now its my turn to punch you."The Scotsman said, "Keep the lousy egg."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4563, 'Ethnic jokes', 'There was a young Scottish boy called Angus who decided to try life in Australia. He found an apartment in a small block and settled in. After a week or two, his mother called from Aberdeen to see how her son was doing in his new life. Im fine,  Angus said. But there are some really strange people living in these apartments. One woman cried all day long, another lies on her floor moaning, and there is a guy next door to me who bangs his head on the wall all the time. Well, ma laddie, says his mother, I suggest you dont associate with people like that. Oh, says Angus, I dont, Mam, I dont. No, I just stay inside my apartment all day and night, playing my bagpipes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4564, 'Ethnic jokes', 'There was an Irishman, an Englishman and Claudia Schiffer sitting together in a carriage in a train going through Tasmania. Suddenly the train went through a tunnel and as it was an old style train there were no lights in the carriages and it went completely dark. Then there was this kissing noise and the sound of a really loud slap. When the train came out of the tunnel, Claudia Schiffer and the Irishman were sitting as if nothing had happened and the Englishman had his hand against his face as he had been slapped there. The Englishman was thinking: "The Irish fella must have kissed Claudia Schiffer and she missed him and slapped me instead." Claudia Schiffer was thinking: "The English fella must have tried to kiss me and actually kissed the Irishman and got slapped for it." The Irishman was thinking: "This is great! The next time the train goes through a tunnel Ill make another  kissing noise and slap that English idiot again."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4565, 'Ethnic jokes', 'An Irishman, a black guy, and a white guy were driving through the desert when they suddenly ran out of gas. They all decided to start walking to the nearest town (which they had passed 50 miles back) to get some help. A rancher was sitting on his front porch that evening when he saw the white guy top the horizon and walk toward him. The rancher noticed that the white guy was carrying a glass of water, so when he was within hearing distance, the rancher said, "Hi there...what are you doing carring a glass of water through the desert?" The white guy explained his predicament and explained that since he had a long way to go, he might get thirsty, so thats why he was carrying the water. A little while later the rancher noticed the black guy walking toward him with a loaf of bread in his hand. "What are you doing?" asked the rancher again. As before, the black guy explained the s ituation and said that since he had a long way to go, he might get hungry and thats why he had the bread. Finally the Irishman appeared, dragging a car door through the sand. More curious than ever, the rancher asked, "Hey, why are you dragging that car door?" "Well," he said, "I have a long way to go, so if it gets too hot, Ill roll down the window."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4566, 'Ethnic jokes', 'OConnell was staggering home with a pint of booze in his back pocket when he slipped and fell heavily. Struggling to his feet, he felt something wet running down his leg. "Please, God," he implored, "let it be blood!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4567, 'Ethnic jokes', 'A cop pulled up two Irish drunks, and asked to the first, "Whats your name and address?" "Im Paddy ODay, of no fixed address." The cop turned to the second drunk, and asked the same question. "Im Seamus OToole, and I live in the flat above Paddy."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4568, 'Ethnic jokes', 'Paddy was trapped in a bog and seemed a goner when Big Mick OReilly wandered by. "Help!" Paddy shouted, "Oim sinkin!" Dont worry," assured Mick. "Next to the Strong Muldoon, Oim the strongest man in Erin, and Oill pull ye right out o there." Mick leaned out and grabbed Paddys hand and pulled and pulled to no avail. After two more unsuccessful attempts, Mick said to Paddy, "Shure, an Oi cant do it. The Strong Muldoon could do it alone, mebbe, but Oill have to get some help." As Mick was leaving, Paddy called "Mick! Mick! Dye think it will help if Oi pull me feet out of the stirrups?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4569, 'Ethnic jokes', 'Q: Whats Irish and sits outside in the summertime?A: Paddy OFurniture!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4570, 'Ethnic jokes', 'Q: What are the best ten years of an Irishmans life?A: Third grade.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4571, 'Ethnic jokes', 'Q: How do you sink an Irish submarine?A: Knock on the hatch.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4572, 'Ethnic jokes', 'Q: How can you identify an Irish pirate?A: Hes the one with patches over both eyes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4573, 'Ethnic jokes', 'The Irish girl knelt in the confessional and said, "Bless me, Father, for I have sinned.""What is it, child?"The girl said, "Father, I have committed the sin of vanity. Twice a day I gaze at myself in the mirror and tell myself how beautiful I am."The priest turned, took a good look at the girl, and said, "My dear, I have good news. That isnt a sin - its only a mistake."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4574, 'Ethnic jokes', 'Pat and Mick landed themselves a job at a sawmill. Just before morning tea Pat yelled: "Mick! I lost me finger!" "Have you now?" says Mick. "And how did you do it?" "I just touched this big spinning thing here like thi... Darn! There goes another one!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4575, 'Ethnic jokes', 'Scorcher Murphy was selling his house, and put the matter in an agents hands. The agent wrote up a sales blurb for the house that made wonderful reading. After Murphy read it, he turned to the agent and asked, "Have I got all ye say there?" The agent said, "Certainly ye have...Why dye ask?" Replied Murphy, "Cancel the sale...tis too good to part with."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4576, 'Ethnic jokes', 'Three guys, one Irish, one English, and one Scottish, are out walking along the beach together one day. They come across a lantern and a Genie pops out of it. "I will give you each one wish, thats three wishes in total", says the Genie.The Scottish guy says, "I am a fisherman, my Dads a fisherman, his Dad was a fisherman and my son will be one too. I want all the oceans full of fish for all eternity." So, with a blink of the Genies eye FOOM! the oceans were teaming with fish. The Englishman was amazed, so he said, "I want a wall around England, protecting her, so that no one will get in for all eternity."Again, with a blink of the Genies eye POOF! there was a huge wall around England.The Irishman asks, "Im very curious. Please tell me more about this wall." The Genie explains, "well, its about 150 feet high, 50 feet thick, protecting England so that nothing can get in or ou t."The Irishman says, "Fill it up with water."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4577, 'Ethnic jokes', 'Recently, Germany conducted some scientific exploration involving their best scientists. Core drilling samples of earth were taken to a depth of 50m and during the core examinations, small pieces of copper were discovered. After running many arduous tests on these samples, the German government announced that the ancient Germans 25,000 years ago had a nationwide telephone network.Naturally, the British government was not that easily impressed. So they ordered their own scientists to take their core samples at a depth of 100m. From these samples, they found small pieces of glass and soon announced that the ancient Brits 35,000 years ago already had a nationwide optical fibre network. Irish scientists were outraged. So immediately after this announcement, they ordered their scientist to take samples at a depth of 200m but found absolutely nothing. They concluded that the ancient Irish 55,000  h years ago were an even more advanced civilisation, as they already had a mobile telephone network in place.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4578, 'Ethnic jokes', 'An Englishman, a Scotsman and an Irishman were without tickets for the opening ceremonies of the summer Olympics but hoped to be able to talk their way in at the gate. Security was very tight, however, and each of their attempts was met with a stern refusal.While wandering around outside the stadium, the Englishman came upon construction site, which gave him an idea. Grabbing a length of scaffolding, he presented himself at the gate and said, "Johnson, the pole vault," and was admitted.The Scotsman, overhearing this, went at once to search the site. When he came up with a sledge hammer, he presented himself at the gate and said, "McTavish, the hammer." He was also admitted.The Irishman combed the site for an hour and was nearly ready to give up when he spotted his ticket in. Seizing a roll of barbed wire, he presented himself at the gate and announced, "OSullivan, fencing."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4579, 'Ethnic jokes', 'An American man, a Russian man, and an African man were all up in a hot-air balloon together. After a few minutes, the Russian man put his hand down through the clouds. "Aaah!" he said. "Were right over my homeland.""How can you tell?" asked the American."I can feel the cold air." he replied.A few hours later the African man put his hand through the clouds. "Aah were right over my homeland." he said."How do you know that?" asked the Russian. "I can feel the heat of the desert."Several more hours later the American put his hand through the clouds. "Aah, were right over New York."The Russian and the African were amazed. "How do you know all of that?" they exclaimed.The American pulled his hand up. "My watch is missing."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4580, 'Ethnic jokes', 'Two Scots, father and son, go to America.- Daddy, when well arrive?- Shut up and swim.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4581, 'Ethnic jokes', 'One Scot came back from work earlier then usual and saw plumbers car in the front of the house.- Oh my God, I hope it is her lover.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4582, 'Ethnic jokes', 'A visitor from Holland was chatting with his American friend and was jokingly explaining about the red, white and blue in the Netherlands flag. "Our flag symbolizes our taxes," he said. "We get red when we talk about them, white when we get our tax bill, and blue after we pay them.""Thats the same with us," the American said, "only we see stars, too."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4583, 'Ethnic jokes', 'Once upon a time in the kingdom of Heaven, God went missing for seven days. Eventually, Michael the archangel found him. He inquired of God, "Where were you?". God sighed a deep sigh of satisfaction and proudly pointed downwards through the clouds; look my child, look what Ive just finished making. Archangel Michael looked puzzled and said what is it? God replied, "its another planet, but this time, I ve decided to put LIFE on it. Ive named it earth and theres going to be a balance between evertyhing on it. For example, theres North America and South America. North America is going to be rich and South America is going to be poor, and the narrow bit joining them - thats going to be a hot spot. Now look over here. Ive put a continent of white people in the North and another one of black people in the South".And then the archangel said, "and whats that long white line there?"  And God said "ahhh thats the land of the long white cloud - Aotearoa - (New Zealand) thats a very special place. Thats going to be the most glorious spot on earth; Beautiful mountains, lakes, rivers, streams and an exquisite coastline. These people here are going to be modest, intelligent and humorous and theyre going to be fond of travelling the world. Theyll be extremely sociable, hard working and high achieveing. And Im going to give them this superhuman, undefeatable rugby team which will be blessed with the most talented, and charasmatic specimens on the planet, and they will be admired and feared by all who come across them". Michael the archangel gasped in wonder and admiration but then seeming startled proclaimed, "hold on a second, what about the BALANCE, you said ther was going to be a balance....."God replied wisely, "wait until you see the neighbours Im going to give them".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4584, 'Ethnic jokes', 'Do you know why the baby Jesus wasnt born in Iowa?They couldnt find three wise men!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4585, 'Ethnic jokes', 'A tourist from the United States of America is at a resturantin Havana. He tells the waiter that the USA is the bestcountry in the world because of the freedoms it has. He says,"Take Freedom of Speech for example. I could stand in frontof the White House in Washington D.C. and yell PresidentClinton is a bastard! and nothing would be done to me." TheCuban waiter replies, "We have that same freedom in Cuba. Icould stand in front of El Capital and yell the same thing andnothing would be done to me too!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4586, 'Ethnic jokes', 'How do you play Iraqi bingo? F18...B52...F18', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4587, 'Ethnic jokes', 'Q: What do Israeli soldiers do when they get bored?A: They go over to the West Bank & the Gaza Strip and get stoned.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4588, 'Ethnic jokes', 'Four Mexicans were in an open truck that had run into the lake.The twoin the front seat escaped unharmed, but the two in the back bed drowned -they couldnt get the tailgate open!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4589, 'Ethnic jokes', 'Why did the mexicans fight so hard for the alamo?They wanted 4 clean walls to spray paint.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4590, 'Ethnic jokes', 'The only good thing to ever come out of Oklahoma:An empty greyhound.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4591, 'Ethnic jokes', 'How do you separate the Greek boys from the Greek men at a Greek BBQ?With a Crowbar!!!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4592, 'Ethnic jokes', 'Did you hear about the Jewish doctor who gave a patient six months to live?When the patient couldnt pay, the doctor gave him another six months.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4593, 'Ethnic jokes', 'Two Jewish businessmen meet in the street."Oy, Abraham, Im sorry to hear about that fire at your warehouse". "Ssh!" hisses the other, "Its not till next week".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4594, 'Ethnic jokes', 'Two Jewish businessmen meet in the street."Well, Morrie, hows your warehouse business going?". "Oy vey, Abraham, its not going so good, we had a flood last week.""So, Morrie," whispers Abraham "How do you start a flood?".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4595, 'Ethnic jokes', 'Why dont mexicans have checking accounts?Its too hard to spray paint your name on the little line.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4596, 'Ethnic jokes', 'Why dont mexicans have barbeques?the beans keep slipping through the grill.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4597, 'Ethnic jokes', 'What do you call 500 Natives running on the race track? The Indy 500.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4598, 'Ethnic jokes', 'What do West Virginians call a pretty woman? A tourist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4599, 'Ethnic jokes', 'What do you call four Mexicans in quicksand? - Quattro Sink-o', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4600, 'Ethnic jokes', 'Q: How do you tell if an Arkansas girl is old enough to marry? A: Make her stand in a barrel. If her chin is over the top, shes old enough.If it isnt, cut the barrel down a bit.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4601, 'Ethnic jokes', 'Q: Why do Southern guys go to family reunions?A: To meet chicks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4602, 'Ethnic jokes', 'How many Serbs does in take to change a Lighbulb?It doesnt matter..Theres a Blackout!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4603, 'Ethnic jokes', 'Q: Where do you find 60 million french jokes?A: In France.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4604, 'Ethnic jokes', 'Q: What happened to the Irishman who tried to kill himself by.swallowing 100 pain killers?A: After two he began to feel better.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4605, 'Ethnic jokes', 'Q: Why did the Jews wander in the desert for forty years?A: Somebody dropped a shekel.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4606, 'Ethnic jokes', 'Did you hear about the man who was half Jewish & half Italian?He made himself an offer he couldnt understand.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4607, 'Ethnic jokes', 'How do Jewish people celebrate Christmas?They all gather around their cash registers and sing"What a Friend We Have In Jesus..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4608, 'Ethnic jokes', 'Whats the difference between an Italian mother and a Jewish mother?An Italian mother says, "If you dont eat it, Ill kill you."A Jewish mother says, "If you dont eat it, Ill kill myself."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4609, 'Ethnic jokes', 'Q: Did you hear about the Jewish Santa Claus?A: He comes down the chimney, wakes up the children and says,"Hey kids, do you want to buy some toys?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4610, 'Ethnic jokes', 'Q: Did you hear about the Mexico City earthquake?A: It did $100 million worth of improvements.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4611, 'Ethnic jokes', 'A black guy walks into a tavern with a parrot on his shoulder...thebartender looks up and says " where the hell did you get that thing?The Parrot replies " Over in Africa, theres millions of them " !!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4612, 'Ethnic jokes', 'Did you hear about the New 3 Million Dollar Alabama State Lottery?3 dollars a year for a million years.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4613, 'Ethnic jokes', 'A boy comes home from school and tells his mother that he got a part in the school play. "What part?" the mother asked."I play a Jewish husband," the boy replied. "Go back to school and tell your teacher that you want a speaking role!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4614, 'Ethnic jokes', 'Q: How is Christmas celebrated in a Jewish home?A: They put parking meters on the roof!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4615, 'Ethnic jokes', 'Two Irishmen are sitting in a bar. Micks looking particularly sad and Patrick asks him what the matter is. mick says, "well, I knew that my grandfather had died in the war, but Ive just found out that he actually died in the auschwitz concentration camp."Patrick says, "thats terrible, did he go to the gas chamber?" and Mickreplies, "no, he fell out of the machine gun tower."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4616, 'Ethnic jokes', 'A Jewish father has two kids who want to sell lemonade on the street corner for 15 cents a glass. He figures hell spend about 3 bucks on the ingredients, the kids will sell maybe 10 glasses and then drink the rest and get stomach aches. His eventual response:"Go stand on the corner for two hours and come back, Ill giveyou two dollars. Everybody wins."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4617, 'Ethnic jokes', 'Q: What do you get when you cross an Arab with a Mexican?A: Oil of Ole', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4618, 'Ethnic jokes', 'Q: Why cant Chinese Barbecue?A: Because the rice falls through the grill', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4619, 'Ethnic jokes', 'Have you heard about the latest Polish parachute?It opens on impact.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4620, 'Ethnic jokes', 'Whats the national anthem of Puerto Rico?"Attention K-Mart shoppers..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4621, 'Ethnic jokes', 'Why does the new Polish Navy have glass bottomed boats?So they can see the old Polish Navy!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4622, 'Ethnic jokes', 'The Arkansas lad was obviously deeply troubled."Why so glum, Chum?" asked the kindly stranger."If my parents get divorced...will they still be brother and sister?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4623, 'Ethnic jokes', 'How does every ethnic joke start?By looking over your shoulder.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4624, 'Ethnic jokes', 'Jewish telegram: "Begin worrying. Details to follow."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4625, 'Ethnic jokes', 'Q: What do you get when you cross a matzo ball with LSD?A: A trip to Israel.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4626, 'Ethnic jokes', 'Whats the object of a Jewish football game?To get the quarter back!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4627, 'Ethnic jokes', 'How do we know the Indians were the first people in North America?They had reservations.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4628, 'Ethnic jokes', 'If you take an Oriental person and spin himaround several times, does he become disoriented?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4629, 'Ethnic jokes', 'Why dont Jewish mothers drink?Alcohol interferes with their suffering.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4630, 'Ethnic jokes', 'Q: Why arent Hindu and Chinese people allowed to play hockey?A: Because everytime they go into the corner they open up a convienent store.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4631, 'Ethnic jokes', 'Q: Do you know why the new football stadium they built in Warsaw could not be used?A: No matter where you sat you were behind a Pole.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4632, 'Ethnic jokes', 'Q: How do you know youre flying over Poland?A: Toilet paper hanging on the clotheslines.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4633, 'Ethnic jokes', 'Q: How do you take census in a Polish village?A: Roll a quarter down the street, count the legs, divide by two, and subtract one for the Jew who catches it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4634, 'Ethnic jokes', 'Q: Why do Polish hate Cauchys dog? (hint on Cauchy-Riemann theorem)A: Because it leaves residues at each Pole.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4635, 'Ethnic jokes', 'Q: Did you hear about the Polak who thought his wife was trying to kill him?A: On her dressing table he found a bottle of "Polish Remover".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4636, 'Ethnic jokes', 'Q: Did you hear about the Polak who married an Amish woman?A: He drove her buggy.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4637, 'Ethnic jokes', '"Wheres your pencil, Bud?" the teacher asked an American boy who had just come to school in Britain. "I aint got one, Sir." "Youre in England.now, Bud. Not aint, havent. I havent got a pencil. You havent got a pencil. They havent got a pencil.""Gee!" said Bud. "Pop said things were tough in this country, but I didnt know pencils were so hard to come by."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4638, 'Ethnic jokes', 'An American tourist was visiting a quaint country village, and got talking to a farmer in the local pub. "And have you lived here all your life, Sir?" asked the American. "Not yet, mdear," said the farmer wisely.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4639, 'Ethnic jokes', 'An Irishman joined the American Air Force and was making his first parachute jump. The instructor said, "When you jump out of the plane, shout Geronimo and pull the ripcord." When the Irishman woke up in hospital a few days later the first thing he said was, "What was the name of that Indian again?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4640, 'Ethnic jokes', 'What do you call an American with a lavatory on his head ?John.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4641, 'Ethnic jokes', 'Q: How do you tell which is the Groom at a Polish wedding?A: Hes the one with the CLEAN bowling shirt.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4642, 'Ethnic jokes', 'Q: How many French farmers does it take to change a lightbulb ? A: Three. Farmer #1 goes away and gets a new lightbulb. Farmer #2 notices that it has been imported from Britain and promptly sets fire to it, so farmer #1 has to go and get another one, and then farmer #3 changes it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4643, 'Ethnic jokes', 'Q: How many Australians does it take to screw in a light bulb? A: One, but you have to pry him off the sheep first. A: Two - one to say "Shell be right mate" and one to fetch the beers. A: 16. One to change the bulb and 15 to say "Good on yer, mate!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4644, 'Ethnic jokes', 'Q: How many Canadians does it take to change a lightbulb ? A: Twelve. Four to form a Parliamentary study committee to decide how to solve the problem, one Francophone to complain that I didnt translate this joke into French, one Native Canadian to protest that the interests of Native Canadians have been overlooked, one woman from the National Action Committee On the Status Of Women to say that women have been underrepresented in the process, one to go over the border to the Niagara Falls Factory Outlet Mall and buy a new bulb and not pay duty on it on the way back, one to actually screw it in, one to collect taxes on the whole procedure so the government can afford it, one to buy a case of Molson for everybody to drink, and one to drop the puck.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4645, 'Ethnic jokes', 'Q: How many Canadians does it take to change a lightbulb ? Q: How many Canadians does it take to change a lightbulb ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4646, 'Ethnic jokes', 'Q: How many Chinese Red Guards does it take to screw in a light bulb? A: 10,000 - to give the bulb a cultural revolution.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4647, 'Ethnic jokes', 'Q: How many Chinamen does it take to change a lightbulb? A: Thousands, because Confucious say many hands make light work.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4648, 'Ethnic jokes', 'Q: How many Englishmen does it take to screw in a light bulb? A: What do you mean change it? Its a perfectly good bloody bulb! We have had it for a thousand years and it has worked just *fine*.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4649, 'Ethnic jokes', 'Q: How many Ethiopians does it take to change a lightbulb ? A: Three. One to change it and two to squabble over who gets to eat the packaging.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4650, 'Ethnic jokes', 'Q: How many Germans does it take to screw in a light bulb? A: Ve are asking ze qvestions here! A: Two, one to give the order that the bulb be changed and one to screw it in.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4651, 'Ethnic jokes', 'Q: How many Iranians does it take to change a light bulb? A: One hundred - One to screw it in and 99 to hold the house hostage.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4652, 'Ethnic jokes', 'Q: How many Ayatollahs does it take to screw in a light bulb? A: None-there werent any light bulbs in the 13th century.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4653, 'Ethnic jokes', 'Q: How many Italians does it take to change a lightbulb ? A: Two. One to change it and one to sprinkle it with Parmesan.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4654, 'Ethnic jokes', 'Q: How many retarded Italian gardeners does it take to screw in a lightbulb? A: One, but dont expect results.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4655, 'Ethnic jokes', 'Q: How many Poles does it take to change a light bulb?A: Just one, but you need 6000 Russian troops in case he goes on strike!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4656, 'Ethnic jokes', 'Q: How many Russian leaders does it take to change a light bulb? A: Nobody knows. Russian leaders dont last as long as light bulbs. A: None, the old bulb is just suffering from a cold.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4657, 'Ethnic jokes', 'Q: How many Russians does it take to change a light bulb? A: Thats a military secret.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4658, 'Ethnic jokes', 'Q: How many Serbs does it take to screw in a light bulb? A: Two-one to shoot the old bulb out and one to screw the new one in.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4659, 'Ethnic jokes', 'Q: How many Americans does it take to change a lightbulb ? A: Two. One to replace it and one to tell him it was burned out (in states that still have car-inspection laws.) A: Three. One to stand on the ladder, and two to carry enough light bulbs until one is found that isnt defective. A: 250,000,000, one to change it and 249,999,999 to debate whether it it was politically correct.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4660, 'Ethnic jokes', 'Q: How many Polish-Americans does it take to screw in a light bulb? A: 170. One to send the Never Fail Novena to the Cheektowaga Times for publication so St. Jude may grant the lightbulb request, one to say the Last Rites for the old lightbulb, ten volunteer firemen to break into the house and smash the old light bulb to bits, fifty to protest the abortion of the old lightbulb, ten to organize a lawn fete and spaghetti dinner at Our Most Holy Precious Blood of the Seventeen Martyred Saints R.C. Church to raise funds to buy a new light bulb (and the Monsignor a new pair of bowling shoes as a gift on St. Stanislaus Day), twenty from Chiavettas Catering to serve the food, twenty to run the Monte Carlo gambling tent, fifty to run everything else, one to go to Koplinskis Appliances to buy the light bulb, one to screw it in, five to say the Rosary as the bulb is being screwed in, and the Monsignor to bless  it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4661, 'Ethnic jokes', 'Q: How many Italian-Americans does it take to screw in a light bulb? A: I dunno exactly, but my brothers girlfriends fathers boss secretarys sisters next door neighbors priests cousins union shop stewards uncles Knights Of Columbus club Seargant-of-Arms nephews best friend did it real cheap for me once.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4662, 'Ethnic jokes', 'Q: How many Scotsmen does it take to change a light bulb? A: Scotsmen dont change light bulbs, its cheaper to sit in the dark', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4663, 'Ethnic jokes', 'Q: How many Oregonians does it take to screw in a light bulb? A: Six. One to screw in the lightbulb and five to fend off all those Californians trying to share the experience.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4664, 'Ethnic jokes', 'Q: How many newsmen does it take to screw in a light bulb? A: Only one, but hell tell everybody.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4665, 'Ethnic jokes', 'What is the most common educational degree in New Mexico?Kindergarten dropout.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4666, 'Ethnic jokes', 'Q: Why do Polish police cars have stripes on the side?A: So the cops can find the handles.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4667, 'Ethnic jokes', '"Helga, tell me something. Why do Swedish men always have stupid grins on their faces?" "Because theyre stupid," said her friend.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4668, 'Ethnic jokes', 'Q: How do you stop a Polish army on horseback?A: Turn off the carousel.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4669, 'Ethnic jokes', 'What do you call an intelligent man in America? A tourist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4670, 'Ethnic jokes', 'A US Border Patrol Agent catches an illegal alien in the bushes right by the border fence, he pulls him out and says "Sorry, you know the law, youve got to go back across the border right now." The mexican man pleads with them, "No, noooo Senior, I must stay in de USA! Pleeeze!" The Border Patrol Agent thinks to himself, Im going to make it hard for him and says "Ok, Ill let you stay if you can use 3 english words in a sentence". The Mexican man of course agrees. The Border Patrol Agent tells him, "The 3 words are: Green, Pink and Yellow. Now use them in 1 sentence." The Mexican man thinks really hard for about 2 minutes, then says, "Hmmm, Ok. The phone, it went Green, Green, Green, I Pink it up and sez Yellow?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4671, 'Ethnic jokes', 'Three guys are debating about which of their languages is the most pleasing to the ear. The Spaniard says, "Consider the word for butterfly. In Spanish, it is pronounced Mariposa, a beautiful sounding word."The French man says, "True, but Papillion, the French word for butterfly, is even more beautiful." "Whats wrong with Schmetterlink," asks the German?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4672, 'Ethnic jokes', 'An American, a Jew and a Canadian were in a terrible car accident. They were all brought to the same emergency room, but all three of them died before they arrived. Just as they were about to put the toe tag on the American, he stirred and opened his eyes.Astonished, the doctors and nurses present asked him what happened."Well," said the American, "I remember the crash, and then there was a beautiful light, and then the Canadian and the Jew and I were standing at the gates of heaven. St. Peter approached us and said that we were all too young to die, and that for a donation of $50, we could return to the earth. So, of course, I pulled out my wallet and gave him the $50, and the next thing I knew I was back here.""Thats amazing!" said one of the doctors, "But what happened to the other two?" "Last I saw them," replied the American, "the Jew was haggling over the price and the  Canadian was waiting for the government to pay for his!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4673, 'Ethnic jokes', 'An Italian, a Scotsman, and a Chinese fellow are hired at a construction site.The foreman points to a huge pile of sand and says to the Italian guy, "Youre in charge of sweeping." To the Scotsman, he says, "Youre in charge of shoveling." And to the Chinese guy, "Youre in charge of supplies."The foreman then shrugs his beefy shoulders and says, "Now, I have to leave for a little while. I expect you guys to make a good dent in that pile of sand by the time I get back."A few hours later when the foreman returns, he sees that the pile of sand is still untouched.Pointing to the pile of sand, the forman says to the Italian, "Why didnt you sweep any of it?"The Italian replies in a heavy accent, "I no gotta broom. You tella the Chinesea guy he inna charge of a supplies, but hea disappeara, and I coulda no finda him!"Then the foreman turns to the Scotsman and asks, " Didnt I tell you to shovel that sand?"The Scotsman replies in his heavy brogue, "Aye, ye did, laddie, but I couldna get meself a shovel. Ye left the Chinee in charge of supplies, but I couldna find him!"The foreman is really angry now and storms off toward the pile of sand, looking for the Chinese guy.Just then, the Chinese guy springs out from behind the pile of sand and yells, "SUPPLIES!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4674, 'Ethnic jokes', 'A long time ago, Britain and France were at war.During one battle, The French captured an English major.Taking the major to their headquarters, the French general began to question him.The French general asked, "Why do you English officers all wear red coats? Dont you know the red material makes you easier targets for us to shoot at?" In his bland English way, the major informed the general that the reason English officers wear red coats is so that if they are shot, the blood wont show and the men they are leading wont panic.And that is why from that day to now, all French Army officers wear brown pants.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4675, 'Ethnic jokes', 'Three Irishmen, Paddy, Sean and Shamus, were stumbling home late one night and found themselves on the road which led past the old graveyard."Come have a look over here," says Paddy, "Its Michael OGradys grave, God bless his soul. He lived to the ripe old age of 87." "Thats nothing," says Sean, "heres one named Patrick OToole. It says here that he was 95 when he died." Just then, Shamus yells out, "But heres a fella that died when he was 145 years old!""What was his name?" asks Paddy. Shamus lights a match to see what else is written on the stone marker, and exclaims, "Miles, from Dublin."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4676, 'Ethnic jokes', 'A Brit, a Frenchman and a Russian are viewing a painting of Adam and Eve frolicking in the Garden of Eden. "Look at their reserve, their calm," muses the Brit. "They must be British." "Nonsense," the Frenchman disagrees. "Theyre naked, and so beautiful. Clearly, they are French." "No clothes, no shelter," the Russian points out, "they have only an apple to eat, and theyre being told this is paradise. They are Russian."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4677, 'Ethnic jokes', 'What is the difference between Russian Optimist, Pessimist and Realist?An Optimist learns German.A Pessimist learns Chinese.A Realist learns AK-47.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4678, 'Ethnic jokes', 'An Arab diplomat visiting the U.S. for the first time was being wined and dined by the State Department. The Grand Emir was unused to the salt in American foods (french fries, cheeses, salami, anchovies etc.) and was constantly sending his manservant Abdul to fetch him a glass of water. Time and again, Abdul would scamper off and return with a glass of water, but then came the time when he returned empty-handed. Abdul, you son of an ugly camel, where is my water? demanded the Grand Emir. A thousand pardons, O Illustrious One, stammered the wretched Abdul, white man sit on well.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4679, 'Ethnic jokes', 'Q: Whats the motto of the Polish Solidarity Union?A: Every man for himself.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4680, 'Ethnic jokes', 'Q: Whats delaying the Polish space program?A: Development of a working match.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4681, 'Ethnic jokes', 'Q: What happens when a Polak doesnt pay his garbage bill?A: They stop delivering.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4682, 'Ethnic jokes', 'Q: What happened to the Polish National Library?A: Someone stole the book.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4683, 'Ethnic jokes', 'Q: You go to a cockfight. How do you know if a Polak is there?A: Hes the one with a duck.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4684, 'Ethnic jokes', 'Q: Why did the Polish couple decide to have only 4 children?A: Theyd read in the newspaper that one out of every five babies born in the world today is Chinese.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4685, 'Ethnic jokes', 'Q: How do you get a Polak out of the bath tub?A: Throw in a bar of soap.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4686, 'Ethnic jokes', 'Q: How many polaks does it take to kidnap a child?A: 12. One to kidnap the child and the remaining 11 to write a ransom letter.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4687, 'Ethnic jokes', 'Q: Did you hear about the man who was Polishing the flagpole?A: He varnished into thin air!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4688, 'Ethnic jokes', 'Q: How did the Germans conquer Poland so fast?A: They marched in backwards and the Polish thought they were leaving.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4689, 'Ethnic jokes', 'Why is Russia a very fast country ? Because the people are always Russian !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4690, 'Ethnic jokes', 'What language do they speak in Cuba ?Cubic !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4691, 'Ethnic jokes', 'How do we know that Joan of Arc was French ?She was maid in France !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4692, 'Ethnic jokes', 'What do you call a man with a kilt over his head ?Scott !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4693, 'Ethnic jokes', 'Why did the Aggie think the weatherman got the sunny forecast wrong?-The Aggie drove through a car wash', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4694, 'Ethnic jokes', 'Q: What is Iraqs national bird?A: Duck.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4695, 'Ethnic jokes', 'Q:Whats the fastest way to end an Iraqi bingo game?A:Call B52', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4696, 'Ethnic jokes', 'where does saddam hussein keep his c.d collection?In Iraq (a rack)', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4697, 'Ethnic jokes', 'Q: Why doesnt Saddam go out drinking? A: Why should he when he can get bombed at home?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4698, 'Ethnic jokes', 'Q:What should Iraq get for its air defense system?A:A refund.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4699, 'Ethnic jokes', 'Su Wong marries Lee Wong. The next year, the Wongshave a new baby. The nurse brings them over a lovely,healthy, bouncy, definitely Caucasian white baby boy!"Congratulations," says the nurse to the new parents."What will you name the baby"?The puzzled father looks at his new baby boy and says,"Well, two Wongs dont make a white, so I think wewill name him Sum Ting Wong!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4700, 'Ethnic jokes', 'Once upon a time Nasa decided to send 3 astronauts to space for 2 years. One was American, One was Russian and the other was English. NASA allowed each of them to take 200 pounds of baggage each. The American decided to take along his wife, the Englishman decided to take along books to learn how to speak German whilst the Russian decided to take along cigarettes. Two years later, when the space shuttle landed, there was a big crowd waiting to welcome them home. First came the American and his wife and each of them had a baby in their arms. Next came the Englishman speaking fluent German. They both gave their speeches and got a rousing round of applause. Suddenly, out came the Russian with a cigarette in his mouth. He walked up to the podium, snarled at the crowd, and asked "Has anyone got a friggin match?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4701, 'Ethnic jokes', 'These two Scottish characters are chatting. One of them then pulls out an expensive looking pocket watch from his pocket to check the time. "Thats a fine watch you got there!" says the other. "Yeah it is, isnt it? I got it from my grandfather," says the guy with the watch. "Really?" "Yeah, he sold it to me on his death bed."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4702, 'Ethnic jokes', 'Q: How do you sink a Polish ship? A: Put it in water.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4703, 'Ethnic jokes', 'An American businessman goes to Japan on a business trip, but he hates Japanese food, so he asks the concierge at his hotel if theres any place around where he can get American food. The concierge tells him hes in luck; theres a pizza place that just opened, and they deliver. The concierge gives the businessman the phone number, and he goes back to his room and orders a pizza. Thirty minutes later, the delivery guy shows up to the door with the pizza. The businessman takes the pizza, and starts sneezing uncontrollably. He asks the delivery man, What the heck did you put on this pizza? The delivery man bows deeply and says, We put on the pizza what you ordered, pepper only.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4704, 'Ethnic jokes', 'A Scottish man, an Englishman and an Irishman were sitting in a pub discussing the best pubs around. The Englishman says, Theres a pub in the West Midlands where the landlord buys you a drink for every that you buy. The Scot is not impressed and says, Thats nothing! In the Highlands every time you buy a drink the landlord buys you five. At this point the Englishman is fairly impressed. The Irishman, totally unimpressed, says Thats nothing. In Dublin theres this pub where the landlord buys your drinks all night, and then when the bar shuts he takes you into a room and makes love to you. The Scot and Englishman are well impressed and ask if the Irishman goes there a lot. He replies No, but my sister told me about it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4705, 'Ethnic jokes', 'Q: What happened to the Indian who drank too much tea? A: He drowned in his teapea.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4706, 'Ethnic jokes', 'A man once asked Gandhi what he thought of western civilization. Ghandi replied, I think it would be a good idea.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4707, 'Ethnic jokes', 'Q: What county in Ireland hates "South Park?" A: Killkenny.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4708, 'Ethnic jokes', 'Q: What do you get when you cross and Chinese and a Mexican man?A: A car thief who cant drive!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4709, 'Ethnic jokes', 'Once there were two chinese gentlemen named Mr. Ho and Mr. Chen. They were neighbors but happened to be very competitive. One day Mr. Ho decided to start a shoe business, he named his store WE DO SHOE. now Mr. Chen decided he must compete with Mr. Ho, so he started a shoe business right next door to Mr. Hos store and he named it SHOE DO WE.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4710, 'Ethnic jokes', 'Once a Sardarji (a caste man in India ) goes to visit a temple on a top of Mt. Abu, where the roads are like a zig-zag. At the starting point towards the Temple, a man tells Sardarji that it will be better to take his car in reverse to the top of Mt. Abu as there will be no space at the top to turn around up there. So, as per the guidelines given by the man, The Sardarji, goes to the top of Mt. Abu in reverse. After sometime the Sardarji comes down of the hill in reverse.. When the man sees him, he asks the Sardarji why he came down the hill in a reverse gear. The Sardarji replies that he got some space at the top of the hill so he reversed his car.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4711, 'Ethnic jokes', 'Q: What do you call a Mexican with a rubber toe? A: Roberto.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4712, 'Ethnic jokes', 'Q: Why dont Polish people kill frogs? A: Because its their national bird.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4713, 'Ethnic jokes', 'Q: Why did the Canadian cross the road? A: He saw some American do it on TV.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4714, 'Ethnic jokes', 'Q: Whats the capital of Afghanistan? A: KABOOM!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4715, 'Ethnic jokes', 'Q: How many Osamas does it take to screw in a lightbulb? A: None. They dont have lightbulbs in caves', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4716, 'Ethnic jokes', 'A Texan, a Russian, and a New Yorker go into a restaurant in London. Excuse me, but if you wanted the steak you might not get one as there is a shortage due to the mad cow disease, says the waiter. The Texan says, Whats a shortage? The Russian says, Whats a steak? The New Yorker says, Whats excuse me?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4717, 'Ethnic jokes', 'A boy from France comes to America. He wants to learn some new words so he goes to the airport and learns "take off." Then he learnes "zebra" from the zoo and "baby" from the hospital. Then he goes home and says, Mommy, I learned new words today. She says, "Great, honey what did you learn?" He says, Takeoffzebrababy!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4718, 'Ethnic jokes', 'Canada, in view of recent events, will be changing the maple leaf on the flag to a marijuana plant. That way, the people of Quebec will have good reason to burn the flag.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4719, 'Ethnic jokes', 'A White man explaining to a Mexican man says that there are three words the Mexican needs to know in order to be all right in the city: The White man says these words are: green, pink, and yellow. Then the White man says Now tell me a sentence using all three words. The Mexican says I hear de telephona ah greena greena, I pink up de phona and say ah yellow?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4720, 'Ethnic jokes', 'Q: Whats the slowest thing in the world?A: A Mexican funeral with only two sets of jumper cables.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4721, 'Ethnic jokes', 'There were three men working at the top of a building. One was Chinese, one was Mexican, and the other one was Polish. At lunch they went to the edge and the top of the building the Mexican guy pulled out a taco and he said if I get another taco I am gonna jump off this bulding tomorrow. The Chinese guy pulled out fried rice and said if I get fried rice tomorrow Im gonna jump off with you. The Polish guy pulled out a ham sanwich and said if I get another ham sandwich Im gonna jump tomorrow with you guys too. The next day the Mexican guy got a taco so he jumped off. The Chinese guy got fried rice so he jumped off. The Polish guy got a ham sandwich so hey jumped off the building. The next day their wives had a triple funeral and the Mexican guys wife was crying and she said I could have made him a burrito or something. The Chinese guys wife was cring and said I could have made him some sushi. Th e Polish guys wife couldnt stop laughing. The others asked what was so funny? She stopped for a second and said that he had always made his own lunch.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4722, 'Ethnic jokes', 'This small Latino man walks into a bar, sits, and orders a beer. A big man comes in, taps him on his shoulder, and says, "Youre sitting in my seat!" The same Spanish man ignores him and orders another beer. The man again taps him on his shoulder, and tells him hes sitting in his seat. The same Spanish man gets up, leans over the seat, and says. "I dont see your name on it." He sits down again and orders still another beer. "The man says...I know Karate!" The small Latino man says, "I know JUDO! JU DONT KNOW IF I HAVE A GUN! JU DONT KNOW IF I HAVE A KNIFE!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4723, 'Ethnic jokes', 'Q: Did you know they are taking out all the K-Marts in Afghanistan? A: They are putting in TARGETS!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4724, 'Ethnic jokes', 'Q: What does K-mart stand for? A: Kuz Mexicans Are Rich Too', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4725, 'Ethnic jokes', 'Q: Why did the Italian boy want to grow a mustache? A: So he could look like his mama.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4726, 'Ethnic jokes', 'Q: What do you call Italian women in a sauna? A: Gorillas In The Mist!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4727, 'Ethnic jokes', 'Q: Two men drive into a car wash. Which one is the Irishman? A: The one on the motorbike.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4728, 'Ethnic jokes', 'Q: Where does an Irish person go on a vacation? A: A new bar', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4729, 'Ethnic jokes', 'An insect falls into a mug of beer. English Man: Throws his mug of bear on the floor and walks out. American Man: Takes out the insect and drinks tbe beer. Chinese Man: Eats the insect and throws the beer. Indian Man: Sells the insect to the Chinese and the beer to the Englishman and buys himself a new mug of beer. Pakistani Man: Accuses the Indian of throwing the insect into his mug, relates the issue to Kashmir, asks the Chinese for military aid and takes a loan to buy another mug of beer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4730, 'Ethnic jokes', 'Q: Where is the worlds fastest chicken from? A: Ethiopia!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4731, 'Ethnic jokes', 'One night, God spoke to a preacher to tell him what he wanted him to do. After God had briefed him on his mission, the minister decided to ask him a question."God," he said, "What is heaven like?" God replied, "Well, normally I dont tell people this, but since you are my servant, I guess I can tell you. Heaven will be like a city. It will have the best of everything. For example, the French will be the chefs; the Italians will be the lovers; the English will be the policeman; the Germans will be the mechanics; and the Dutch will be the politicians!" The man looked pleased. "What is hell like?" he asked."Well," he said with a sigh, "the French will be the mechanics; the Italians will be the politicians; the English will be the chefs; the Germans will be the policemen; and the Dutch will be the lovers."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4732, 'Ethnic jokes', 'Q: What would you call an Arab who owns a harem of cows? A: A milk sheik!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4733, 'Ethnic jokes', 'The Englishmans, Irishmans and Scotsmans wives go shopping one day to a big department store. While they are there a fire breaks out. Everyone in the store is killed, including the three women. Their husbands are summoned to the local police station where a policewoman breaks the news to them: "Im afraid sirs, that we believe your wives were killed in the fire at the department store. However the fire was so intense we cannot identify the bodies. Only their handbags survived the blaze. Can you identify your wives handbags from these three found in the store?" The three men all look at the handbags and each one is able to identify one of the handbags as belonging to his wife. With all handbags accounted for the policewoman leaves the men to deal with their grief in peace. The three men sit in silence for a while, then the Englishman opens his wifes handbag and rummages through the conte nts, finally pulling out a half-empty packet of cigarettes and says "All these years married and I never knew the old girl smoked." The Scotsman looks into his wifes handbag and pulls out a half-empty bottle of scotch. "Jings, I knew her all that time an ah didnae ken ma missus drank." The Irishman empties his wifes handbag onto the floor, looks through the contents and picks up a half empty packet of condoms. "Saints preserve us! All dese years an oi never knew me wife was a man."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4734, 'Ethnic jokes', 'Q: Whats the highest position in the Greek Navy? A: Rear Admiral!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4735, 'Ethnic jokes', 'Q: How do you get a German out of the bath? A: Turn on the water.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4736, 'Ethnic jokes', 'A French guy, an American guy and a Cuban guy are standing on a cliff. The French guy throws a case of fine wine off the cliff. Why did you do that?asked the other men. We have plenty of fine wine in France, said the man. Next, the Cuban guy throws a box of fine cigars off the cliff. Why did you do that? asked the other men. We have plenty of cigars in Cuba, said the Cuban man. Finally, the American man pickes up the Cuban man and throw him off the cliff. What did you do that for? asked the French man. We have plenty of Cubans in America, answered the American man.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4737, 'Ethnic jokes', 'Q: Why did the eskimo wash his clothes in Tide? A: Because it was too cold outside.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4738, 'Ethnic jokes', 'An Englishman, a Scotsman, and an Irishman are wandering through the desert, hungry and hallucinating, when they come upon a rotting, dead camel. "Well," said the Englishman, "I support the Liverpool football club, so Ill eat the liver." "I support the Hearts club," said the Scotsman, "so Ill eat the heart." "I support Arsenal," said the Irishman, "but I seem to have lost my appetite."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4739, 'Ethnic jokes', 'Q: What did the Egyptian man say to the Egyptian woman? A: "Come behind the pyramid, and Ill make you a mummy!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4740, 'Ethnic jokes', 'What is the Cuban national anthem? Row Your Boat!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4741, 'Ethnic jokes', 'Q: Why do they have so much trouble with the phone systems in China? A: Because there are so many Wings and so many Wongs that someones always Winging the Wong number.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4742, 'Ethnic jokes', 'What do you get when you cross a Cuban and a Pollock? Ricky Retardo', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4743, 'Ethnic jokes', 'There were three explorers, hiking through what is now known as Canada. "You know," said one of the explorers, "we should name this place were hiking through." "I know," said the second explorer. "Well each pick a letter and then make a name out of that." "Okay," said the third, "Ill go first. C, eh." "N, eh." "D, eh." And thats how they named Canada...', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4744, 'Ethnic jokes', 'They say that its tough to learn Bosnian because it has seven verb tenses: six past, one present, and no future.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4745, 'Ethnic jokes', 'Two Bedouins were in the middle of a desert. When one gets something blown into his eye. His companion takes a look at his eye for him and says, "Hold still Abdul, it might be sand."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4746, 'Ethnic jokes', 'Whats the most famous coffee in Afghanistan? Osama bin Latte', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4747, 'Ethnic jokes', 'How do you stop a taliban tank ?Shoot the Guy Pushing it', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4748, 'Ethnic jokes', 'At the Russian War College, the general is a guest lecturer and tells the class of officers that the session will focus on potential problems and the resulting strategies. One of the officers in the class begins by asking the first question, "Will we have to fight a World War Three?" "Yes, comrades, looks like you will," answers the general. "And who will be our enemy, Comrade General?" another officer asks. "The likelihood is that it will be China." The class looks alarmed, and finally one officer asks, "But Comrade General, we are 150 million people and they are about 1.5 billion. How can we possibly win?" "Well," replies the general, "Think about it. In modern war, it is not the quantity, but the quality that is the key. For example, in the Middle East, 5 million Jews fight against 50 million Arabs, and the Jews have been the winners every time." "But sir ," asks the panicky officer, "Do we have enough jews"?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4749, 'Ethnic jokes', 'Q: Why do Polish names end in "ski" ?A: Because they cant spell tobbagan.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4750, 'Ethnic jokes', 'What did the Eskimo children sing when their principal was leaving? Freeze a Jolly Good Fellow.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4751, 'Ethnic jokes', 'What did the Eskimo schoolboy say to the Eskimo schoolgirl? Whats an ice girl like you doing in a place like this?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4752, 'Ethnic jokes', 'Q: Why do Greek men wear gold neck chains?A: So they know where to stop shaving.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4753, 'Ethnic jokes', 'Do you know why Eskimos always do their laundry in tide?Because its too cold out-tide!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4754, 'Ethnic jokes', 'Q: Have you heard about the new Iraqi Air Force exercise program?A: Each morning you raise your hands above your head and leave them there.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4755, 'Ethnic jokes', 'Q: What do you call an Inibrian who has been buried for 1000 years? A: Peat!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4756, 'Ethnic jokes', 'Only in America do we chain $2.00 ink pens to the counter but leave our $58,000 cars out in the driveway.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4757, 'Ethnic jokes', 'Q: Have you seen the polish mine detector.A1: Put you fingers in your ears and start stamping the ground with your foot.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4758, 'Firefighter jokes', 'Q: Why dont Deputy Fire Marshals look out the window in the morning? A: So they have something to do in the afternoon.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4759, 'Firefighter jokes', 'Three firefighters went out on a hunting trip. There was a rookie, a captain, and a chief. The weather wasmisrable and they hadnt seen any deer all day. They came across an old shack where they went inside to playa game of poker. After loosing a couple of hands, the rookie threw down his cards and said "that does it! I amgoing out to get me a deer." Fifteen minutes later, the rookie came back with a nice four point buck. Thecaptain and chief asked, "how did you get that?" The rookie replied, "I walked out fifty feet, followed sometracks and shot this buck". The captain then said, "Ive had enough of this I am going to get my deer." Hecame back a half hour later with a 6-point buck. The chief asked, "how did you get that?" The captain replied,"I walked out a hundred feet, followed some tracks and shot this buck." The chief not wanting to be out donesaid "I am out of here, I am g oing to bag the biggest buck of the day." He came back an hour later, all mangledup and bloody. The rookie and captain asked, "what happened to you?" The chief replied, "I walked out therefive hundred feet, followed some tracks, and got hit by a train."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4760, 'Firefighter jokes', 'here were these 3 Riverside City Firemen who always went bird hunting together and they always rented ahunting dog name Rex from a local farmer. Rex was a great dog and would always hold point and find anybirds they shoot. One year they didt go hunting and the farmer rented Rex out to some Corona City Firemenwho used him that season. The next year the Riverside guys went to rent Rex from the farmer for hunting butthe farmer had bad news for them. He told them Rex was no longer any good for hunting and didnt have areplacement for him and to tell the Corona firemen they were not welcome there any more and that if he sawthem he would probably shoot them for what they did to Rex. The R.F.D. guys asked the farmer what theCorona boys did that could be so bad. Well the farmer said last year when they rented Rex it all started off fineuntil one of the Corona guys decided to rename him. We ll whats wrong with that they asked. The farmer saidthey renamed him CHIEF and now all he does is sit on his ass and bark all the time.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4761, 'Firefighter jokes', 'Q: Did you know that the three wise men were firemen?A: It says they came from afir (a fire, a far).', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4762, 'Firefighter jokes', 'A fireman and policeman died and both went to heaven where they were issued their wings with the warningthat if they had even one bad thought their wings would fall off. Well, everything went well for some time thenone day they passed a very attractive and well put together young lady. As the fireman turned to watch herpass his wings fell off. When he bent over to pick them up the policemans wings fell off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4763, 'Firefighter jokes', 'A fire chief died and went to heaven. When he got there he saw a long line waiting to get in to the pearly gates.He told himself, "Im a fire chief, Im not going to wait in line." He went to the angels guarding the gates and said, "Let me in. Im a fire chief." The angels replied, "Youll haveto wait in line like everyone else, sir."While waiting at the back of the line he saw a sedan pull up with red lights and a man got out wearing a whitehelmet that said "CHIEF". The angels popped to attention and let the chief enter heaven. The waiting fire chiefwas pissed and went to talk to the angels.He asked, "Why did you let that fire chief go through and not me?" To which the angels replied, "You have it allwrong, sir. Thats God, he just thinks hes a Fire Chief."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4764, 'Firefighter jokes', 'Seems the Shah of Iran was visiting Disneyland with his young son. The son seemed to be having a good timebut had that look that something else was on his mind. The Shah asked, "What do you really want, Son?" TheSon said, "A Mickey Mouse Outfit." With that, the Shaw went out and bought him a uniform from theneighboring Fire Department.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4765, 'Firefighter jokes', 'Q. What does CHAOS stand for? A.The Chiefs Have Arrived On Scene.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4766, 'Firefighter jokes', 'If - H 2 O - is on the inside of a fire hydrant, what is on the outside? K 9 P', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4767, 'Firefighter jokes', 'Q.What do you get when you cross a Fire Chief two Lotus Notes Gurus ? A. FireWeb .... of course!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4768, 'Firefighter jokes', 'One day a boy was drowning in a near by lake. A firefighter swam out and pulled the boy up onto the beachand began CPR. A crowed watched as the firefighter frantically pumped on the boys chest. With greatamazement water was pooring from the boys mouth. Each time the firefighter pumped more water came out.A short time later seaweed started coming out, then minnows, then more water started coming out of the boysmouth. The firefighter feared this would never stop. Just then, a paramedic arrived and quickly ran over to thefirefighter and b lurted out. "Hey Chief! You better get that kids ass out of the water before you pump that lakedry".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4769, 'Firefighter jokes', 'There was a huge fire at a big city soda factory. The city company was losing ground and the owner wasfrantic. He told the fire department that he needed a secret formula in the safe that was in the center of theblaze, and he would give 10,000 dollars to the department that got the formula. An hour later no ground wasgained and a mutual aid call was put out. When 12 departments couldnt subdue the blaze the owner saw thishe raised the reward to 100,000 dollars. Suddenly a small town department drove their truck right into the fireand emerged 10 minutes later with the formula. When asked what they would do with the money one said,"Get them damn brakes fixed we figure."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4770, 'Firefighter jokes', 'When the employees of a restaurant attended a fire safety seminar, they watched a fire official demonstrate theproper way to operate an extinguisher. "Pull the pin like a hand grenade," he explained, "then depress the triggerto release the foam." Later an employee was selected to extinguish a controlled fire in the parking lot. In her nervousness, she forgotto pull the pin. The instructor hinted, "Like a hand grenade, remember?" In a burst of confidence she pulled the pin -- and hurled the extinguisher at the blaze.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4771, 'Firefighter jokes', 'Q.How can you tell when a Chicago Fireman is dead? A. The remote control slips from his hand.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4772, 'Firefighter jokes', 'Q.How do you put out a fire? A.Take away the HEAT , FUEL , OXYGEN , or the CHIEF!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4773, 'Firefighter jokes', 'Q. How do you get down from an aerial ladder? A. You dont get down from an aerial ladder. You get down from a duck.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4774, 'Firefighter jokes', 'Q. What kind of ears do pumpers have? A. Engineers.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4775, 'Firefighter jokes', 'All of the firefighters at my station are quick. Theyre even "fast" asleep!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4776, 'Firefighter jokes', 'What usually comes after the monster lights the birthday candles?The fire department.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4777, 'Firefighter jokes', 'Why do firemen wear red suspenders?To keep their pants up.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4778, 'Firefighter jokes', 'What did the fireman say when the church caught on fire? "Holy smoke!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4779, 'Firefighter jokes', 'What did the firemans wife get for Christmas ?A ladder in her stocking !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4780, 'Firefighter jokes', 'A fire started on some grassland near a farm in Indiana. The fire department from the nearby town was called to put the fire out.The fire proved to be more than the small town fire department could handle, so someone suggested that a rural volunteer fire department be called. Though there was doubt that they would be of any assistance, the call was made.The volunteer fire department arrived in a dilapidated old fire truck. They drove straight towards the fire and stopped in the middle of the flames. The volunteer firemen jumped off the truck and frantically started spraying water in all directions. Soon they had snuffed out the center of the fire, breaking the blaze into two easily controllable parts.The farmer was so impressed with the volunteer fire departments work and so grateful that his farm had been spared, that he presented the volunteer fire department with a check for  $1000. A local news reporter asked the volunteer fire captain what the department planned to do with the funds."That should be obvious," he responded, "the first thing were gonna do is get the brakes fixed on that stupid fire truck."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4781, 'Firefighter jokes', 'Q: What is the first thing off the truck at a trailer fire? A: Lawn chair.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4782, 'Firefighter jokes', 'Two fellows were sitting in a coffee shop...suddenly the Towns Fire Alarm went off ... one jumped up and headed for the door ... his friend shouted, "Hey, Tom, I didnt know you were a fireman!"Tom replied, "Im not, but my girlfriends husband is..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4783, 'Firefighter jokes', 'A fire broke out in a six story apartment building last week in a near by town. A blonde, a redhead, and a brunette escaped the flames by climbing up onto the roof.When the fire department arrived they got out a blanket held it up and the Chief called out to the brunette to jump into the blanket.The brunette jumped. As she was falling swoosh the firefighters pulled the blanket away and she landed on the street like a brick.The firefighters then held the blanket back up and the Chief told the redhead to jump."No way! I saw what you did to my friend." exclaimed the redhead."I am sorry" said the Chief, "My wife was a brunette and she divorced me. I just dont like brunettes. We have no problems with redheads....jump its your only chance."So the redhead jumped. On the way down swoosh the firefighters pulled the blanket away and she hit the pavement like a tomato!"The firefighters a gain held up the blanket and the Chief told the blonde to jump. The fire was getting worse and her only chance of survival was to jump."No I am not jumping. I saw what you did to my two friends.""Im sorry" said the Chief, "I explained what happened to the brunette and when the redhead jumped we were a little distracted. It will not happen again, just jump!"The blonde thought for a moment. "OK Ill jump - but first I want you to lay the blanket on the ground, back away, and then Ill jump into it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4784, 'Firefighter jokes', 'During a big fire downtown the firemen were having a bit of trouble. A woman was stuck on the fourth floor with her baby. The fire fighters instructed her to toss the child out the window, under which they had placed a net, but the mother refused. Things looked grim until a tall, well-built black man burst through the crowd and shouted to the women. He said that he was a professional football player and that he could catch the baby safely. After a few minutes more of reassurances by the man, the mother finally let the child drop.The football player made a breathtaking catch, and everybody cheered. At that moment the man suddenly raised the child high in the air, spiked it on the ground and yelled, "TOUCHDOWN!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4785, 'Firefighter jokes', 'Q. What does CHAOS stand for?A. The Chiefs Have Arrived On Scene.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4786, 'Firefighter jokes', 'When the employees of a restaurant attended a fire safety seminar, they watched a fire official demonstrate the proper way to operate an extinguisher. "Pull the pin like a hand grenade," he explained, "then depress the trigger to release the foam."Later an employee was selected to extinguish a controlled fire in the parking lot. In her nervousness, she forgot to pull the pin.The instructor hinted, "Like a hand grenade, remember?"In a burst of confidence she pulled the pin -- and hurled the extinguisher at the blaze.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4787, 'Firefighter jokes', 'A firefighter died and went to hell where he finds a wall of clocks.After seeing all these clocks on a wall, with his friends names under them, he asked the devil, what the clocks mean?"Thats easy, each time one of your friends mess up on earth, their clock speeds up one hour." says the devil."I dont see the Chiefs clock anywhere?" the fireman says.The devil replied, "Oh him, we have his down in the basement, were using it for a fan."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4788, 'Firefighter jokes', 'The Volunteer Fire Chief in a small town had just been buried. The last words of the service over, his friends and family started toward their cars.However, they stopped because a strange, eerie sound suddenly was heard from the grave.As the guests looked around, a colleague of the deceased said, "Dont worry... its just the dispatcher toning him out."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4789, 'Firefighter jokes', 'Q. A fireman had two sons. What did he name them?A. Hosea and Hoseb', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4790, 'Firefighter jokes', 'Q: What word begins with the letter "F" and ends in "UCK"?A: FIRETRUCK.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4791, 'Farmer jokes', 'Seems a guy was driving for hours thu desolate country when he passed a farmhouse, and before he could react, a cat ran out in front of him and*splat*... he flattened the cat. Out of kindness and consideration, he stopped, turned around and drove back to the farmhouse to notify the occupants. When the housewife came to the door, said he, "Pardon memadame, but I just ran over a cat in front of your house, and assumed that it must belong to you. I know this might be hard to hear, but Iwanted to let you know instead of just driving off...." "Not so fast", says she. "How do you know it was our cat? Could youdescribe him? What does he look like?" The man promptly flopped down on the ground, and said "He looks like thts"as he gave his best shot at a dead cat impression. "Oh no, you *horrible* man", she replied. "I meant, what did he look like*before* you hit him?" At that, the man got up , covered his eyes with both hands and screamed"Agggghhhhhhhhhh !!!!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4792, 'Farmer jokes', 'A lone tourist who is passing through the suburbs on the way to town by car, unfortunately experiences mechanical problems with the automobile. The car stalls and the tourist parks the car by the side of the road and waits for help. Not much later, a farmer happens to pass by with a truck full of farm animals. The farmer offers the tourist a lift to town and proceeds to explain that he is bringing his farm animals to the town market, where they will be auctioned off to the highest bidders. Well, it so happens that on the way to the town, the farmer being so engrossed in his story, unintentionally wanders into the other side of road where another vehicle is approaching in the other direction. The farmer realizes his absent mindness and attempts to avoid the possible collision with the other vehicle. He just misses the other car, but unfortunately crashes the truck into the side of the road.  The tourist winds up thrown into a ditch and suffers broken ribs and a broken arm and leg and is obviously in extreme pain. The farm animals are all messed up very badly and the farmer, although remaining inside the vehicle, still suffers cuts and scrapes. The farmer gets out of the truck and looks at his farm animals. The chickens all have broken limbs and can barely move. "These chickens are all useless! Nobody will want to buy these chickens anymore!" bellows the farmer. With that, he grabs and loads his shotgun and blows away the chickens. Next, he sees the pigs and they are all lame and bleeding profusely. "These pigs are all worthless now! Ill get nothing for them!" yells the farmer. With great rage, the farmer reloads his shotgun and blows away the pigs. The farmer looks at the sheep and they all have broken limbs and their wool is all bloodied. "Worthless sheep!" screams the farmer and wit h that, he reloads his shotgun and blows away the sheep. Meanwhile, the injured tourist witnesses all of this carnage in great horror. The farmer then moves over to the side of the ditch and looks at the tourist. "Are you okay down there?" asked the farmer. "NEVER FELT BETTER IN MY ENTIRE LIFE!!!" the tourist yelled back.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4793, 'Farmer jokes', 'An aged farmer and his wife were leaning against the edge of their pig-pen when the old woman wistfully recalled that the next week would mark their golden wedding anniversary."Lets have a party, Homer," she suggested. "Lets kill a pig."The farmer scratched his grizzled head. "Gee, Ethel," he finally answered, "I dont see why the pig should take the blame for something that happened fifty years ago."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4794, 'Farmer jokes', 'Howard County Police officers still write their reports by hand, and the data is entered later by a computer tech into their database. One theft report stated that a farmer had lost 2,025 pigs. Thinking that to be an error, the tech called the farmer directly."Is it true Mr. (Smith) that you lost 2,025 pigs?" she asked."Yeth." lisped the farmer.Being a Howard County girl herself, the tech entered: "Subject lost 2 sows and 25 pigs."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4795, 'Farmer jokes', 'A man is driving down a country road, when he spots a farmer standing in the middle of a huge field of grass. He pulls the car over to the side of the road and notices that the farmer is just standing there, doing nothing, looking at nothing.The man gets out of the car, walks all the way out to the farmer and asks him, "Ah excuse me mister, but what are you doing?"The farmer replies, "Im trying to win a Nobel Prize.""How?" asks the man, puzzled."Well, I heard they give the Nobel Prize . . . to people who are out standing in their field."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4796, 'Farmer jokes', 'The farmers son was returning from the market with the crate of chickens his father had entrusted to him, when all of a sudden the box fell and broke open. Chickens scurried off in different directions, but the determined boy walked all over the neighborhood scooping up the wayward birds and returning them to the repaired crate. Hoping he had found them all, the boy reluctantly returned home, expecting the worst."Pa, the chickens got loose," the boy confessed sadly, "but I managed to find all twelve of them.""Well, you did real good, son," the farmer beamed. "You left with seven."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4797, 'Farmer jokes', 'A very zealous soul-winning young preacher recently came upon a farmer working in his field. Being concerned about the farmers soul the preacher asked the man, "Are you laboring in the vineyard of the Lord my good man?"Not even looking at the preacher and continuing his work the farmer replied, "Naw, these are soybeans.""You dont understand," said the preacher. "Are you a Christian?"With the same amount of interest as his previous answer the farmer said, "Nope my name is Jones. You must be lookin for Jim Christian. He lives a mile south of here."The young determined preacher tried again asking the farmer, "Are you lost?""Naw! Ive lived here all my life," answered the farmer."Are you prepared for the resurrection?" the frustrated preacher asked.This caught the farmers attention and he asked, "Whens it gonna be?"Thinking he had accomplished somet hing the young preacher replied, "It could be today, tomorrow, or the next day." Taking a handkerchief from his back pocket and wiping his brow, the farmer remarked, "Well, dont mention it to my wife. She dont get out much and shell wanna go all three days."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4798, 'Farmer jokes', 'A retiring farmer in preparation for selling his land, needed to rid his farm of animals. So he went to every house in his town. To the houses where the man is the boss, he gave a horse. To the houses where the woman is the boss, a chicken was given. He got toward the end of the street and saw a couple outside gardening. "Whos the boss around here?" he asked. "I am." said the man. "I have a black horse and a brown horse," the farmer said, "which one would you like?" The man thought for a minute and said, "The black one." "No, no, no, get the brown one." the mans wife said. "Heres your chicken." said the farmer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4799, 'Farmer jokes', 'A clergyman walking down a country lane and sees a young farmer struggling to load hay back onto a cart after it had fallen off."You look hot, my son," said the cleric. "why dont you rest a moment, and Ill give you a hand.""No thanks," said the young man."My father wouldnt like it.""Dont be silly," the minister said."Everyone is entitled to a break. Come and have a drink of water."Again the young man protested that his father would be upset. Losing his patience, the clergyman said, "Your father must be a real slave driver. Tell me where I can find him and Ill give him a piece of my mind!""Well," replied the young farmer, "hes under the load of hay."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4800, 'Farmer jokes', 'A farmer was milking his cow. He was just starting to get a good rhythm going when a bug flew into the barn and started circling his head. Suddenly, the bug flew into the cows ear. The farmer didnt think much about it, until the bug squirted out into his bucket. It went in one ear and out the udder.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4801, 'Farmer jokes', 'A man from the city is out plowing his field and gets his tractor stuck in the wet ground.A farmer driving by stops his truck and walks to the fence to call over the city feller. You need a mule to plow such wet ground he says."Where can I buy one?" he is asked.Well, I just happened to have one for 100 dollars he says."Ill take him," says the other man as he counts out the money.I cant bring him over today. I dont work on Sunday morrow OK?"Sure."The next day the truck pulls up and the old farmer gets out. He says, "sorry, bad news."I went out after breakfeast and the mule was dead.The city feller says just give me my money back then."Cant, spent it already!""Well... unload the mule then.""What ya gonna do with him?""Raffle him off!""Naw, ya cant raffle off a dead mule!""Just watch me us! City fellers know a few tri cks."One month goes by and the city feller and farmer run into each other at the barber shop."What did ya do with that dead mule?""Raffled him off, sold 100 tickets at two dollars each and made 98 dollars profit.""Didnt anyone complain?" "Just one guy so I gave him his two dollars back!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4802, 'Farmer jokes', 'Rush Limbaugh and his chauffeur were out driving in the country and accidentally hit and killed a pig that had wandered out on a country road. Limbaugh told the chauffeur to drive up to the farm and apologize to the farmer. They drove up to the farm, the chauffeur got out and knocked on the front door and was let in. He was in there for what seemed like hours. When the chauffeur came out, Limbaugh was confused about why his driver had been in there so long. "Well, first the farmer shook my hand, then he offered me a beer, then his wife brought me some cookies, and his daughter showered me with kisses." explained the driver. "What did you tell the farmer?" Limbaugh asked. The chauffeur replied, "I told him I was Rush Limbaughs driver and Id just killed the pig."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4803, 'Farmer jokes', 'A farmer and his brand new bride were riding home from the chapel in a wagon pulled by a team of horses, when the older horse stumbled.The farmer said, "Thats once."A little further along, the poor old horse stumbled again.The farmer said, "Thats twice."After a little, while the poor old horse stumbled again.The farmer didnt say anything, but reached under the seat, pulled out a shotgun and shot the horse.His brand new bride yelled, telling him, "That was an awful thing to do."The farmer said, "Thats once."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4804, 'Farmer jokes', 'A Texan farmer goes to Australia for a vacation. There he meets an Aussie farmer and gets talking. The Aussie shows off his big wheat field and the Texan says, "Oh! We have wheat fields that are at least twice as large". Then they walk around the ranch a little and the Aussie shows off his herd of cattle. The Texan immediately says, " We have longhorns that are at least twice as large as your cows". The conversation has, meanwhile, almost died when the Texan sees a herd of kangaroos hopping through the field. He asks, "And what are those"? The Aussie asks with an incredulous look, "Dont you have any grasshoppers in Texas"?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4805, 'Farmer jokes', 'How did the aliens hurt the farmer? They trod on his corn.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4806, 'Farmer jokes', 'Did you hear about the farmer you ploughed his field with a steamroller ?He wanted to grow mash potatoes!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4807, 'Farmer jokes', 'What did the neurotic pig say to the farmer? You take me for grunted.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4808, 'Farmer jokes', 'Q: When is a farmer like a magician?A: When he turns his cow to pasture.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4809, 'Farmer jokes', 'Q: Why did the farmer call his pig "Ink"?A: Because it was always running out of the pen.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4810, 'Farmer jokes', 'Q: Why cant the bankrupt cowboy complain?A: He has got no beef.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4811, 'Farmer jokes', 'A husband and wife were driving down a country lane on their way to visit some friends. They came to a muddy patch in the road and the car became bogged. After a few minutes of trying to get the car out by themselves, they saw a young farmer coming down the lane, driving some oxen before him.The farmer stopped when he saw the couple in trouble and offered to pull the car out of the mud for $50. The husband accepted and minutes later the car was free. The farmer turned to the husband and said, "You know, youre the tenth car Ive helped out of the mud today."The husband looks around at the fields incredulously and asks the farmer, "When do you have time to plough your land? At night?""No," the young farmer replied seriously, "Night is when I put the water in the hole."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4812, 'Farmer jokes', 'A bus load of politicians were driving down a country road one afternoon, when all of a sudden, the bus ran off the road and crashed into a tree in an old farmers field.Seeing what happened, the old farmer went over to investigate. He then proceeded to dig a hole and bury the politicians.A few days later, the local sheriff came out, saw the crashed bus, and asked the old farmer, "Were they all dead?"The old farmer replied, "Well, some of them said they werent, but you know how them politicians lie."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4813, 'Farmer jokes', 'A mans car stalled on a country road one morning. When the man got out to fix it, a cow came along and stopped beside him. "Your trouble is probably in the carburetor," said the cow.Startled, the man jumped back and ran down the road until he met a farmer. The amazed man told the farmer his story."Was it a large red cow with a brown spot over the right eye?" asked the farmer. "Yes, yes," the man replied."Oh! I wouldnt listen to Bessie," said the farmer. "She doesnt know a thing about cars."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4814, 'Farmer jokes', 'A farmer in the country has a watermelon patch and upon inspection he discovers that some of the local kids have been helping themselves to a feast.The farmer thinks of ways to discourage this profit-eating situation. So he puts up a sign that reads: "WARNING! ONE OF THESE WATERMELONS CONTAINS CYANIDE!"He smiled smugly as he watched the kids run off the next night without eating any of his melons. The farmer returns to the watermelon patch a week later to discover that none of the watermelons have been eaten, but finds another sign that reads: "NOW THERE ARE TWO!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4815, 'Farmer jokes', 'A New York City yuppie moved to the country and bought a piece of land. He went to the local feed and livestock store and talked to the proprietor about how he was going to take up chicken farming. He then asked to buy 100 chicks."Thats a lot of chicks," commented the proprietor. "I mean business," the city slicker replied.A week later the yuppie was back again. "I need another 100 chicks," he said. "Boy, you are serious about this chicken farming," the man told him."Yeah," the yuppie replied. "If I can iron out a few problems." "Problems?" asked the proprietor. "Yeah," replied the yuppie, "I think I planted that last batch too close together."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4816, 'Farmer jokes', 'A newlywed farmer and his wife were visited by her mother, who immediately demanded an inspection of the place. The farmer had genuinely tried to be friendly to his new mother-in-law, hoping that it could be a friendly, non-antagonistic relationship. All to no avail though, as she kept nagging them at every opportunity, demanding changes, offering unwanted advice, and generally making life unbearable to the farmer and his new bride.While they were walking through the barn, during the forced inspection, the farmers mule suddenly reared up and kicked the mother-in-law in the head, killing her instantly. It was a shock to all no matter their feelings toward her demanding ways.At the funeral service a few days later, the farmer stood near the casket and greeted folks as they walked by. The pastor noticed that whenever a woman would whisper something to the farmer, he would nod his head yes a nd say something. Whenever a man walked by and whispered to the farmer, however, he would shake his head no, and mumble a reply.Very curious as to this bizarre behavior, the pastor later asked the farmer what that was all about.The farmer replied, "The women would say, What a terrible tragedy and I would nod my head and say, Yes, it was. The men would then ask, Can I borrow that mule? and I would shake my head and say, Cant. Its all booked up for a year."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4817, 'Farmer jokes', 'An out-of-towner drove his car into a ditch in a desolated area. Luckily, a local farmer came to help with his big strong horse named Buddy.He hitched Buddy up to the car and yelled, "Pull, Nellie, pull." Buddy didnt move.Then the farmer hollered, "Pull, Buster, pull." Buddy didnt respond.Once more the farmer commanded, "Pull, Jennie, pull." Nothing.Then the farmer nonchalantly said, "Pull, Buddy, pull." And the horse easily dragged the car out of the ditch.The motorist was most appreciative and very curious. He asked the farmer why he called his horse by the wrong name three times.The farmer said, "Oh, Buddy is blind, and if he thought he was the only one pulling, he wouldnt even try!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4818, 'Farmer jokes', 'Farmer Brown decided his injuries from the accident were serious enough to take the trucking company (responsible for the accident) to court. In court, the trucking companys fancy lawyer was questioning Farmer Brown. "Didnt you say, at the scene of the accident, Im fine?" asked the lawyer.Farmer Brown responded, "Well Ill tell you what happened. I had just loaded my favorite mule Bessie into the...""I didnt ask for any details," the lawyer interrupted, "just answer the question. Did you not say, at the scene of the accident, Im fine!"Farmer Brown said, "Well I had just gotten Bessie into the trailer and I was driving down the road..."The lawyer interrupted again and said, "Judge, I am trying to establish the fact that, at the scene of the accident, this man told the Highway Patrolman on the scene that he was just fine. Now several weeks after the accident he  is trying to sue my client. I believe he is a fraud. Please tell him to simply answer the question."By this time the Judge was fairly interested in Farmer Browns answer and said to the lawyer, "Id like to hear what he has to say about his favorite mule Bessie."Brown thanked the Judge and proceeded, "Well as I was saying, I had just loaded Bessie, my favorite mule, into the trailer and was driving her down the highway when this huge semi-truck and trailer ran the stop sign and smacked my truck right in the side."He continued, "I was thrown into one ditch and Bessie was thrown into the other. I was hurting real bad and didnt want to move. However, I could hear ole Bessie moaning and groaning. I knew she was in terrible shape just by her groans.""Shortly after the accident a highway patrolman came on the scene. He could hear Bessie moaning and groaning so he went over to her. After he looked at h er, he took out his gun and shot her between the eyes. Then the patrolman came across the road with his gun in his hand and looked at me."Finally, farmer Brown came to the end of the story. "The patrolman looked at me and said, Your mule was in such bad shape I had to shoot her. How are YOU feeling?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4819, 'Farmer jokes', 'Liam had left Dublin to go up to Belfast for a bit of skydiving, Late Sunday evening he was found in tree by a farmer. What happened said the farmer, Liam replied, that his parachute failed to open, well said the farmer if you had of asked the locals before you jumped, they would have told you nothing opens here on a Sunday.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4820, 'Farmer jokes', 'A hindu priest, rabbi and a lawyer were driving down the road, when the car breaks down. Fortunately finding a farmhouse nearby, the farmer informed them that he had only one spare room, and that it had only two twin beds.They were welcome to it, but one of them had to sleep in the barn. After much discussion, the hindu volunteered to go to the barn. A few moments later, a knock on the bedroom door, and the hidu explained that there was a cow in the barn, and cows are sacred and he could not possibly sleep in the barn with a cow.Annoyed, the rabbi volunteered. A few moments later, a knock on the door. The rabbi explained that there was a pig in the barn and that he, being very orthodox, could not possibly spend the evening in the barn with the origin of pork.Finally the lawyer said that he would go to the barn. A few moments later there was a knock on the door. It was the cow and the p ig!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4821, 'Farmer jokes', 'A man was driving down a quiet country lane when out into the road strayed a rooster. Whack! The rooster disappeared under the car. A cloud of feathers. Shaken, the man pulled over at the farmhouse, rang the door bell. A farmer appeared. The man, somewhat nervously said, "I think I killed your rooster, please allow me to replace him." "Suit yourself," the farmer replied, "you can go join the other chickens that are around the back."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4822, 'Farmer jokes', 'There was a farmer who raised watermelons. He was disturbed by some local kids who would sneak into his watermelon patch at night and eat watermelons. After some careful thought he came up with a clever idea that he thought would scare the kids away for sure. So he made up the sign and posted it in the field. The next day the kids show up and they see this sign, it says "Warning!! One of the watermelons in this field has been injected with cyanide."So the kids run off, make up their own sign and post it next to the sign that the farmer made. The farmer shows up the next week and when he looks over the field he notices that no watermelons are missing but he notices a new sign next to his. He drives up to the sign which read: "Now there are two".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4823, 'Farmer jokes', 'An agriculture student said to a farmer: "Your methods are too old fashioned. I wont be surprised if this tree will give you less than twenty pounds of apples.""I wont be surprised either," said the farmer, "this is an orange tree".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4824, 'Farmer jokes', 'A farm boy was drafted. On his first furlough, his Father asked him what he thought of Army life."Its pretty good Pa. The foods not bad, the works easy but best of all, they let ya sleep real late in the morning."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4825, 'Farmer jokes', 'There was a farmer who had a herd of pigs. One day someone went to the farm and asked the farmer: "What do you use to feed your pigs?""Well, I give them acorn, corn, and things like that. Why?""Because I am from the Animals Protection Association and I think you dont feed them like you should, they shouldnt eat wastes."Then he fined the farmer.Some days later, another person arrived and asked the same question. The farmer answered: "Well, I feed them very well. I give them salmon, caviar, shrimp, steak...why?""Because I am from the United Nations Organization and I think its unfair that you feed your pigs like that when there are people dying with nothing to eat."And he fined the farmer.Finally, another man came in and asked just the same question. The hesitant farmer answered after a few minutes: "Well, I give five dollars to each pig so they can buy whatever they want."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4826, 'Farmer jokes', 'On a drive in the country, a city slicker noticed a farmer lifting a pig up to an apple tree and holding the pig there as it ate one apple after another."Maybe I dont know what Im talking about," said the city slicker, "but if you just shook the tree so the apples fell to the ground, wouldnt it save a lot of time?""Time?" said the farmer. "What does time matter to a pig?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4827, 'Farmer jokes', 'A farmer gets sent to jail, and his wife is trying to hold the farm together until her husband can get out. Shes not, however, very good at farm work, so she writes a letter to him in jail: "Dear sweetheart, I want to plant the potatoes. When is the best time to do it?"The farmer writes back: "Honey, dont go near that field. Thats where all my guns are buried."But, because he is in jail all of the farmers mail is censored. So when the sheriff and his deputies read this, they all run out to the farm and dig up the entire potato field looking for guns. After two full days of digging, they dont find one single weapon.The farmer then writes to his wife: "Honey, now is when you should plant the potatoes."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4828, 'Farmer jokes', 'An accountant is in a car travelling with a farmer client around his farm.They pass a large mob of sheep and the farmer says, "Youre pretty good with numbers, Keith. How many sheep do you reckon are in that paddock?"The accountant looks at the sheep for a moment and says, "One thousand, eight hundred and thirty two."The farmer is amazed. "Exactly right", he says. "How did you work that out so fast?""Easy," says the accountant "I counted the number of feet and divided by 4."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4829, 'Farmer jokes', 'A husband and wife were driving down a country lane on their way to visit some friends. They came to a muddy hollow in the road and the car became bogged. After a few minutes of trying to get the car out by themselves, they saw a young farmer coming down the lane, driving some oxen before him. The farmer stopped when he saw the couple in trouble and offered to pull the car out of the mud for $50. The husband accepted, and minutes later the car was free. The farmer turned to the husband and said, "You know, youre the tenth car Ive helped out of the mud today." The husband looks around at the fields incredulously and asks the farmer, "When do you have time to plough your land? At night?" "No," the young farmer replied seriously, "Night is when I put the water in the hole."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4830, 'Farmer jokes', 'A farmer and his girlfriend were out for a strollin the fields when they came across a cow and acalf rubbing noses."Boy," said the farmer, "that sure makes me want todo the same.""Well, go ahead," said his girlfriend. "Its your cow."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4831, 'Farmer jokes', 'An old farmer is driving down a country road in his pickup truck whenit starts making an awful noise. He stops the truck and crawlsunderneath to investigate the problem."Hmmm...mufflers loose. I bet I could fix that if I had a MonkeyWrench." He says.He crawls out from underneath the truck and looks down the road. Offin the distance he sees a small house. There is a black woman andseveral small black children playing in the yard.The Farmer yells to her "Hey Miss, do you happen to have MonkeyWrench?""What?" She yells back."A Monkey Wrench!!?" He screams."What?""MONKEY WRENCH!!?...MONKEY WRENCH!!?""Naw, this aint no Monkey Ranch, its a Day Care Center!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4832, 'Farmer jokes', 'A farmer was interviewing a young man for the job of assistant farmhand.`Youll need to be fit, said the farmer. `Have you ever had any illnesses? Any accidents?No, sir, replied the young man proudly. `But youre on crutches. You must have had an accident! said the farmer.`Oh, the crutches! said the young man. `A bull tossed me last week. But that wasnt an accident! He did it on purpose!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4833, 'Farmer jokes', 'What do you call an Arab dairy farmer? A milk sheik.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4834, 'Farmer jokes', 'A farmer lived on a quiet rural highway. But, as time went by, the traffic slowly built up at an alarming rate. The traffic was so heavy and so fast that his chickens were being run over at a rate of three to six a day. So one day he called the sheriffs office and said, "Youve got to do something about all of these people driving so fast and killing all of my chickens.""What do you want me to do?" asked the sheriff."I dont care, just do something about those drivers!"So the next day he had the county workers go out and erect a sign that said: SLOW: SCHOOL CROSSINGThree days later the farmer called the sheriff and said, "Youve got to do something about these drivers. The school crossing sign seems to make them go faster."So, again, the sheriff sends out the county workers and they put up a new sign: SLOW: CHILDREN AT PLAYAnd that really sped them up. So the f armer called and called and called everyday for three weeks. Finally, he asked the sheriff, "Your signs are doing no good. Is it all right for me to put up my own sign?"The sheriff told him, "Sure thing, put up your own sign." He was going to let the farmer do just about anything in order to have him stop calling. Well, the sheriff got no more calls from the farmer.Three weeks after the farmers last call, the sheriff decided to call him. "Hows the problem with those drivers. Did you put up your sign?""Oh, I sure did. And not one chicken has been killed since then. Ive got to go. Im very busy." And he hung up the phone.The sheriff thought to himself, "Id better go to that farmers house and look at that sign... There might be something there that WE could use to slow down drivers."So the sheriff drove out to the farmers house, and he saw the sign. It was a whole sheet of plywood. And writte n in large yellow letters were the words: SLOW: NUDIST COLONY', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4835, 'Farmer jokes', '"Tell me," said the hiker to the local farmer, "will this pathway take me to the main road?" "No, sir," replied the farmer, "youll have to go by yourself!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4836, 'Farmer jokes', 'How did the aliens hurt the farmer? They trod on his corn.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4837, 'Farmer jokes', 'Q: When is a farmer like a magician?A: When he turns his cow to pasture.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4838, 'Farmer jokes', 'Q: Why did the farmer call his pig "Ink"?A: Because it was always running out of the pen.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4839, 'Farmer jokes', 'A Texan farmer goes to Australia for a vacation. There he meets an Aussie farmer and gets talking. The Aussie shows off his big wheat field and the Texan says, "Oh! We have wheat fields that are at least twice as large". Then they walk around the ranch a little and the Aussie shows off his herd of cattle. The Texan immediately says, " We have longhorns that are at least twice as large as your cows". The conversation has, meanwhile, almost died when the Texan sees a herd of kangaroos hopping through the field. He asks, "And what are those"? The Aussie asks with an incredulous look, "Dont you have any grasshoppers in Texas"?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4840, 'Farmer jokes', 'A farmer purchased an old, run-down, abandoned farm with plans to turn it into a thriving enterprise. The fields were grown over with weeds, the farmhouse was falling apart, and the fences were broken down. During his first day of work, the town preacher stops by to bless the mans work, saying, "May you and God work together to make this the farm of your dreams!" A few months later, the preacher stops by again to call on the farmer. Lo and behold, its a completely different place. The farm house is completely rebuilt and in excellent condition, there is plenty of cattle and other livestock happily munching on feed in well-fenced pens, and the fields are filled with crops planted in neat rows. "Amazing!" the preacher says. "Look what God and you have accomplished together!" "Yes, reverend," says the farmer, "but remember what the farm was like when God was working it alone!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4841, 'Farmer jokes', 'Did you hear about the farmers boy who hated the country ? He went to the big city and got a job as a shoeshine boy and so the farmer made hay while the sun shone !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4842, 'Farmer jokes', 'Why was the farmer hopping mad ? Because someone had trodden on his corn !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4843, 'Farmer jokes', 'Camper: Is it easy to milk a cow?Farmer: Sure it is. Any jerk can do it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4844, 'Farmer jokes', 'Camp Woodland was across the road from a dairy farm. One day the kids saw a large bull.Is that bull safe? someone asked the farmer.Safer than you are! was his answer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4845, 'Farmer jokes', 'Did you hear about the farmer who fed crayons to his chickens? He wanted them to lay coloured eggs!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4846, 'Farmer jokes', 'How does a farmer send messages?By e-i-e-i-o-mail.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4847, 'Farmer jokes', 'What is the difference between a dressmaker and a farmer?A dressmaker sews what she gathers, a farmer gathers what he sows.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4848, 'Farmer jokes', 'Why are farmers cruel?Because they pull corn by the ears.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4849, 'Farmer jokes', 'What did the farmer say when all his cows charged him at once ?Im on the horns of a dilemma here !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4850, 'Farmer jokes', 'Why did the farmer feed his pigs sugar and vinegar ?He wanted sweet and sour pork !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4851, 'Farmer jokes', 'What did the farmer say when he lost his tractor ? Wheres my tractor!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4852, 'Farmer jokes', 'Farmer Brown put up a pig-shaped weather vane, but hes not happy with it. Instead of pointing with the wind, the pig vane keeps pointing toward the feed trough.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4853, 'Farmer jokes', 'Farmer Giles is so interested in conserving energy, he built a pig-powered car. He has to get rid of it, though. Every time he turns a corner, the tires squeal', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4854, 'Farmer jokes', 'Farmer Jones bought a herd of pigs from a Roman farmer who moved into the next valley and boy, is he sorry. The hogs wont come to the feed trough unless he calls them in Pig Latin.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4855, 'Farmer jokes', 'FARMER: Did you sleep well last night? GUEST: No, the bed was soft and the air was fresh, but an old sow kept pushing at the door. FARMER: Never mind her. She always gets upset when we rent out her room.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4856, 'Farmer jokes', 'How does the pig farmer get to the fair? He rides piggyback.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4857, 'Farmer jokes', 'What did the farmer say when his fat pig wouldnt fit into the pen? "Theres more there than meets the sty."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4858, 'Fishing jokes', 'Far away in the tropical waters of the Caribbean, two prawns were swimming around in the sea - one called Justin and the other called Christian. The prawns were constantly being harassed and threatened by sharks that patrolled the area. Finally one day Justin said to Christian, "Im bored and frustrated at being a prawn, I wish I was a shark, then I wouldnt have any worries about being eaten..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4859, 'Fishing jokes', 'Two guys are talking about fishing. One says to the other, "I am NEVER going to take my wife fishing with me, ever again!""That bad, huh""She did everything wrong! She did everything wrong! She talked too much, made the boat rock constantly, tried to stand up in the boat, baited the hook wrong, used the wrong lures and WORST of all she caught more fish than me!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4860, 'Fishing jokes', 'A man was stopped by a game-warden in Northern Algonquin Park recently with two buckets of fish leaving a lake well known for its fishingThe game warden asked the man, "Do you have a license to catch those fish?" The man replied to the game warden, "No, sir. These are my pet fish." "Pet fish?!" the warden replied. "Yes, sir. Every night I take these here fish down to the lake and let them swim around for a while. I whistle and they jump back into their buckets, and I take em home." "Thats a bunch of hooey! Fish cant do that!" The man looked at the game warden for a moment, and then said, "Here, Ill show you. It really works." "O.K. Ive GOT to see this!" The game warden was curious. The man poured the fish in to the river and stood and waited. After several minutes, the game warden turned to the man and said, "Well?" "Well, what?" the man respond ed. "When are you going to call them back?" the game warden prompted. "Call who back?" the man asked."The FISH""What fish?" the man asked.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4861, 'Fishing jokes', 'The fishing season hasnt opened and a fisherman who doesnt have a license, is casting for trout as a stranger approaches and asks "Any luck?""Any luck? This is a wonderful spot. I took 10 out of this stream yesterday" he boasts. "Is that so? By the way, do you know who I am?" asks the stranger. "Nope.""Well, meet the new game warden." "Oh," gulped the fisherman. "Well, do you know who I am?" "Nope". "Meet the biggest liar in the state."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4862, 'Fishing jokes', 'One day, two guys Joe and Bob were out fishing. A funeral service passes over the bridge theyre fishing by, and Bob takes off his hat and puts it over his heart. He does this until the funeral service passes by.Joe then said "Gee Bob, I didnt know you had it in you!"Bob then replies " Its the least I could do. After all I was married to her for 30 years."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4863, 'Fishing jokes', 'Two blondes rented a fishing boat, and were having a great day catching fish. The first blonde said "This is such a great spot, we need to mark it so we can come back." The second blonde proceeded to put a mark on the side of the boat. The first blonde asked "What are you doing?" The second blonde replied "Marking the spot." "Dont be stupid" the first blonde said. "What if we dont get the same boat next time?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4864, 'Fishing jokes', 'Two Irishmen were walking down the street with two salmon each under their arms. Two other Irishmen walking in the opposite direction see the two lucky fishermen and ask " how did you catch those ?" Well its like this! Michael here holds my legs over the bridge, and I grab the salmon as they swim up the river. We got four salmon A great days fishing! So the fishless pair look at each other and agree to give it a try. They get to the bridge and Sean calls to his friend "hold my legs now Paddy". Well he is hanging there upside down for thirty minutes when he suddenly cries.. "pull me up, pull me up!!" Paddy asks " do you have a fish Sean?"............ No replies Sean, "theres a bloody train coming!!!!!!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4865, 'Fishing jokes', 'Three priests were fishing on a boat when they ran out of bait.The first priest got up and walk across the water to get some more bait. After 2 hours they ran out of bait again and the second priest said he would go get more bait...so he got up and walk across the water. After 3 hours of fishing they ran out of bait again and the third priest said he would get more bait. So he stepped out of the boat and went straight to the bottom. The first priest turned to the second priest and asked, "Should we have told him where the rocks were? "', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4866, 'Fishing jokes', 'An Irish priest loved to fly fish, it was an obsession of his. So far this year the weather had been so bad that he hadnt had a chance to get his beloved wadders on and his favourite flies out of their boxStrangly though, every Sunday the weather had been good, but of course Sunday is the day he has to go to work.The weather forcast was good again for the coming Sunday so he called a fellow priest claiming to have lost his voice and be in bed with the flu. He asked him to take over his sermon.The fly fishing priest drove fifty miles to a river near the coast so that no one would recognise him. An angel up in Heaven was keeping watch and saw what the priest was doing. He told God who agreed that he would do something about it.With the first cast of his line a huge fish mouth gulped down the fly. For over an hour the priest ran up and down the river bank fighting the fish. At  the end when he finally landed the monster size fish it turned out to be a world record Salmon.Confused the angel asked God, "Why did you let him catch that huge fish? I thought you were going to teach him a lesson."God replied "I did. Who do you think hes going to tell?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4867, 'Fishing jokes', 'Three fishermen were fishing when they came upon a mermaid, the mermaid offered them one wish each so the first fisherman said: "double my I.Q" so the mermaid did it and to his surprise he started reciting shakespeare. Then the second fisherman said: "triple my I.Q." and sure enough the mermaid did it and amazingly he started doing math problems he didnt know existed. The third fisherman was so impressed he asked the mermaid to quadruple his I.Q and the mermaid said "Are you sure about this? It will change your whole life!" the fisherman said "yes" so the mermaid turned him into a woman', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4868, 'Fishing jokes', 'A small town Doctor was famous in the area for always catching large fish.One day while he was on one of his frequent fishing trips he got a call that a woman at a neighboring farm was giving birth. He rushed to her aid and delivered a healthy baby boy.The farmer had nothing to weigh the baby with so the Doctor used his fishing scales.The baby weighed 22 lbs 10 oz..', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4869, 'Fishing jokes', 'A couple of young guys were fishing at their special pond off the beaten track when out of the bushes jumped the game warden. Immediately, one of the boys threw his rod down and started running through the woods like a bat out of hell and hot on his heels came the game warden. After about a half mile, the guy stopped and stooped over with his hands on his thighs to catch his breath and the game warden finally caught up to him. "Lets see yer fishin license, boy!" the warden gasped. With that, the guy pulled out his wallet and gave the game warden a valid fishing license. "Well, son," said the Game Warden. "You must be about as dumb as a box of rocks! You dont have to run from me if you have a valid license!" "Yes sir," replied the young feller. "But my friend back there, well, he dont have one..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4870, 'Fishing jokes', 'Heard the one about the three blondes that went ice fishing and didnt catch anything?By the time they cut a hole big enough for the boat to fit in it was time to go home.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4871, 'Fishing jokes', 'One day a rather inebriated ice fisherman drilled a hole in the ice and peered into the hole and a loud voice said, "There are no fish down there."He walked several yards away and drilled another hole and peered into the hole and again the voice said, "Theres no fish down there."He then walked about 50 yards away and drilled another hole and again the voice said, "Theres no fish down there." He looked up into the sky and asked, "God, is that you?" "No, you idiot," the voice said, "its the rink manager."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4872, 'Fishing jokes', 'Mother to daughter advice: Cook a man a fish and you feed him for a day. But teach a man to fish and you get rid of him for the whole weekend.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4873, 'Fishing jokes', 'There was a salmon fisherman who was out in the ocean fishing when his boat sank. He was lucky enough to make to a deserted island where he had to survive on what he could find.When the Coastguard eventually found him, the leader noticed there was a fire pit with California Condor feathers all around.He went over to the fisherman and said, "You know, its illegal to kill a California Condor, Im afraid Im going to have to arrest you."The fisherman protested for some time saying that he killed it because he was going to starve but eventually he calmed down. "Out of curiosity" the coastguard asked, "What did it taste like?" The fisherman replied, " Well, it was kind of a mix between a snowy owl and a bald eagle."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4874, 'Fishing jokes', 'A priest was walking along the cliffs at Dover when he came upon two locals pulling another man ashore on the end of a rope."Thats what I like to see," said the priest, "A man helping his fellow man." As he was walking away, one local remarked to the other, "Well, he sure doesnt know the first thing about shark fishing."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4875, 'Fishing jokes', 'Q. Where does a fish keep his moneyA. In the River Bank!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4876, 'Fishing jokes', '"Do you really believe your husband when he tells you he goes fishing every weekend?" asked Janes best friend."Why shouldnt I?" said Jane."Well, maybe he is having an affair?""No way" said Jane "he never returns with any fish..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4877, 'Fishing jokes', 'A guy rings his boss and says "I cant come to work todayThe boss asks why and the guy says "its my eyes.""Whats wrong with your eyes?" asks the boss."I just cant see myself coming to work, so Im going fishing instead..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4878, 'Fishing jokes', '"Whats the biggest fish you ever caught?" "That would be the one that measured fourteen inches...." "Thats not so big!" "Between the eyes?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4879, 'Fishing jokes', 'Henrys son, David, burst into the house, crying. His mother asked him what the problem was."Daddy and I were fishing, and he hooked a giant fish. Really big. Then, while he was reeling it in, the line busted and the fish got away." "Now come on, David," his mother said, "a big boy like you shouldnt be crying about an accident like that. You should have just laughed it off." "But thats just what I did, mommy."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4880, 'Fishing jokes', 'I was given the ultimatum 3 weeks ago. She said "its me or your fishing."Gee I miss her.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4881, 'Fishing jokes', '"I didnt see you in church last Sunday, Nigel. I hear you were out playing football instead." "Thats not true, vicar. And Ive got the fish to prove it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4882, 'Fishing jokes', '"I caught a twenty pound salmon last week." "Were there any witnesses?""There sure were. If there hadnt been, it would have been forty pounds."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4883, 'Fishing jokes', 'Fishing rule #1: The least experienced fisherman always catches the biggest fish. Fishing rule #2: The worse your line is tangled, the better is the fishing around you. Fishing rule #3: Fishing will do a lot for a man but it wont make him truthful.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4884, 'Fishing jokes', 'Q. What is the difference between a fish and a piano? A. You cant tuna fish.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4885, 'Fishing jokes', 'How much fishing tackle can a man accumulate before his wife throws him out?I dont know the answer but I think Im nearly there.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4886, 'Fishing jokes', 'Q. Where do fish sleep?A. In a river bed', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4887, 'Fishing jokes', 'What do you call a deaf fishing boat captain?Anything you like, he cant hear you.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4888, 'Fishing jokes', 'I was glad when one fish got away.There just wasnt room in the boat for both of us!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4889, 'Fishing jokes', 'Standing at the edge of the lake, a man saw a woman flailing about in the deep water. Unable to swim, the man screamed for help. A trout fisherman ran up. The man said, "My wife is drowning and I cant swim. Please save her. Ill give you a hundred dollars." The fisherman dove into the water. In ten powerful strokes, he reached the woman, put his arm around her, and swam back to shore. Depositing her at the feet of the man, the fisherman said, "Okay, wheres my hundred dollars?"The man said, "Look, when I saw her going down for the third time, I thought it was my wife. But this is my mother-in-law."The fisherman reached into his pocket and said, "Just my luck. How much do I owe you?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4890, 'Fishing jokes', 'Q: What you get when four men go fishing and one comes back not catching anything. A: Three Men And A Baby', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4891, 'Fishing jokes', 'One mans hobby was fishing, he spent all his weekends near the river or lake, paying no attention to weather. One Sunday, early in the morning, he went to the river, as usual. It was cold and raining, and he decided to return back to his house. He came in, went to his bedroom, undressed and laid near his wife. "What a terrible weather today, honey." he said to her. "Yes. And my idiot went fishing!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4892, 'Fishing jokes', 'What do you call a dangerous fish who drinks too much ? A beer-a-cuda !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4893, 'Fishing jokes', 'Which fish can perform operations ? A Sturgeon !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4894, 'Fishing jokes', 'What fish goes up the river at 100mph ? A motor pike !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4895, 'Fishing jokes', 'Where do fish wash ? In a river basin !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4896, 'Fishing jokes', 'While sports fishing off the Florida coast, a tourist capsized his boat. He could swim, but his fear of alligators kept him clinging to the overturned craft. Spotting and old beachcomber standing on the shore, the tourist shouted,"Are there any gators around here?!" "Naw," the man hollered back, "they aint been around for years!" "Feeling safe, the tourist started swimming leisurely toward the shore. About halfway there he asked the guy,"Howd you get rid of the gators?" "We didnt do nothin," the beachcomber said. "The sharks got em."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4897, 'Fishing jokes', 'Many years ago, a fishermans wife blessed her husband with twin sons. They loved the children very much, but couldnt think of what to name their children. Finally, after several days, the fisherman said, "Lets not decide on names right now. If we wait a little while, the names will simply occur to us." After several weeks had passed, the fisherman and his wife noticed a peculiar fact. When left alone, one of the boys would also turn towards the sea, while the other boy would face inland. It didnt matter which way the parents positioned the children, the same child always faced the same direction. "Lets call the boys Towards and Away," suggested the fisherman. His wife agreed, and from that point on, the boys were simply known as Towards and Away. The years passed and the lads grew tall and strong. The day came when the aging fisherman said to his sons, "Boys, it is time that learned  how to make a living from the sea." They provisioned their ship, said their goodbyes, and set sail for a three month voyage. The three months passed quickly for the fishermans wife, yet the ship had not returned. Another three months passed, and still no ship. Three whole years passed before the greiving woman saw a lone man walking towards her house. She recognized him as her husband. "My goodness! What has happened to my darling boys?" she cried. The ragged fisherman began to tell his story: "We were just barely one whole day out to see when Towards hooked into a great fish. Towards fought long and hard, but the fish was more than his equal. For a whole week they wrestled upon the waves without either of them letting up. Yet eventually the great fish started to win the battle, and Towards was pulled over the side of our ship. He was swallowed whole, and we never saw either of them again." "Oh dear,  that must have been terrible! What a huge fish that must of been!" "Yes, it was, but you should have seen the one that got Away...."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4898, 'Fishing jokes', 'A fisherman returned to shore with a giant marlin that was bigger and heavier than he. On the way to the cleaning shed, he ran into a second fisherman who had a stringer with a dozen baby minnows. The second fisherman looked at the marlin, turned to the first fisherman and said, " Only caught one, eh?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4899, 'Fishing jokes', 'Two fishermen were out on the lake when one of them dropped his wallet. As they watched the wallet float down to the depths of the lake, a carp came along and snatched up the wallet. Soon came another carp who stole it away and then a third joined in. Remarked one of the fisherman, "Thats the first time Ive ever seen carp-to-carp walleting."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4900, 'Fishing jokes', 'Two Virginia rednecks go on a fishing trip. They rent all the equipment - the reels, the rods, the wading suits, the rowboat, the car, and even a cabin in the woods. I mean they spend a fortune!The first day they go fishing, but they dont catch anything. The same thing happens on the second day, and on the third day. It goes on like this until finally, on the last day of their vacation, one of the men catches a fish.As theyre driving home theyre really depressed. One guy turns to the other and says, "Do you realise that this one lousy fish we caught cost us fifteen hundred bucks?"The other guy says, "Wow! Then its a good thing we didnt catch any more!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4901, 'Fishing jokes', 'Two young men were out in the woods on a camping trip, when the came upon this great trout brook. They stayed there all day, enjoying the fishing, which was super.At the end of the day, knowing that they would be graduating from college soon, they vowed that they would meet, in twenty years, at the same place and renew the experience.Twenty years later, they met and traveled to a spot near where they had been years before. They walked into the woods and before long came upon a brook. One of the men said to the other, "This is the place!".The other replied, "No, its not!".The first man said, "Yes, I do recognize the clover growing on the bank on the other side.To which the other man replied, "Silly, you cant tell a brook by its clover."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4902, 'Fishing jokes', 'A father and son went fishing one day. While they were out in the boat, the boy suddenly became curious about the world around him. He asked his father, "How does this boat float?The father replied, "Dont rightly know son." A little later, the boy looked at his father and asked, "How do fish breath underwater?"Once again the father replied, "Dont rightly know son." A little later the boy asked his father, "Why is the sky blue?"Again, the father repied. "Dont rightly know son." Finally, the boy asked his father, "Dad, do you mind my asking you all of these questions?"The father replied, "Of course not, you dont ask questions, you never learn nothin."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4903, 'Fishing jokes', 'Three guys were fishing in a lake one day, when an angel appeared in the boat. When the three astonished men had settled down enough to speak, the first guy asked the angel humbly, "Ive suffered from back pain ever since I took shrapnel in the Vietnam War ... Could you help me?" "Of course," the angel said, and when he touched the mans back, the man felt relief for the first time in years. The second guy who wore very thick glasses and had a hard time reading and driving. He asked if the angel could do anything about his poor eyesight. The angel smiled, removed the mans glasses and tossed them into the lake. When they hit the water, the mans eyes cleared and he could see everything distinctly. When the angel turned to the third guy, the guy put his hands out defensively -- "Dont touch me!" he cried, "Im on a disability pension."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4904, 'Fishing jokes', 'One day a fisherman was lying on a beautiful beach, with his fishing pole propped up in the sand and his solitary line cast out into the sparkling blue surf. He was enjoying the warmth of the afternoon sun and the prospect of catching a fish. About that time, a businessman came walking down the beach, trying to relieve some of the stress of his workday. He noticed the fisherman sitting on the beach and decided to find out why this fisherman was fishing instead of working harder to make a living for himself and his family. "You arent going to catch many fish that way," said the businessman to the fisherman, "you should be working rather than lying on the beach!" The fisherman looked up at the businessman, smiled and replied, "And what will my reward be?" "Well, you can get bigger nets and catch more fish!" was the businessmans answer. "And then what will my reward be?"  asked the fisherman, still smiling. The businessman replied, "You will make money and youll be able to buy a boat, which will then result in larger catches of fish!" "And then what will my reward be?" asked the fisherman again. The businessman was beginning to get a little irritated with the fishermans questions. "You can buy a bigger boat, and hire some people to work for you!" he said. "And then what will my reward be?" repeated the fisherman. The businessman was getting angry. "Dont you understand? You can build up a fleet of fishing boats, sail all over the world, and let all your employees catch fish for you!" Once again the fisherman asked, "And then what will my reward be?" The businessman was red with rage and shouted at the fisherman, "Dont you understand that you can become so rich that you will never have to work for your living again! You can spend all the rest of your day s sitting on this beach, looking at the sunset. You wont have a care in the world!" The fisherman, still smiling, looked up and said, "And what do you think Im doing right now?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4905, 'Fishing jokes', 'MacAndrews was visiting his Irish cousin, OBannon. While there he decided to do a bit of fishing. As he sat there on afternoon, his cousin walked by."What are ye doing?" asked OBannon."Fishin," said MacAndrews."Caught anything?""Ach, nae a bite,""What are ye usin fer bait?""Worms""Let me see it," said OBannon.MacAndrews lifted the line from the water and handed it to his cousin. OBannon took out his flask of potcheen and dipped the worm in it. He handed it back to MacAndrews, who cast his line once more. As soon as the worm hit the water, his rod bent over double, the line screaming out."Have ye got a bite?" asked OBannon."No!" shouted MacAndrews, fighting with the rod, "The worms got a salmon by the throat!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4906, 'Fishing jokes', 'How many fishermen does it take to change a light bulb?One, but you should have seen the bulb, it must have been THIS big.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4907, 'Fishing jokes', 'A man was fishing in the jungle. After a while another angler came to join him. "Have you had any bites?" asked the second man. "Yes, lots," replied the first one, "but they were all mosquitoes."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4908, 'Fishing jokes', 'Retired colonel, talking of the good old days: Have you ever hunted bear? His grandsons teacher: No, but Ive been fishing in shorts.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4909, 'Fishing jokes', 'An old lady saw a little boy with a fishing-rod over his shoulder and a jar of tadpoles in his hand walking through the park one Sunday. "Little boy," she called, "dont you know you shouldnt go fishing on a Sunday?" "Im not going fishing, maam," he called back, "Im going home."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4910, 'Fishing jokes', 'The little kid sat on the side of the road with a fishing line down the drain. Feeling sorry for him, and wanting to humor him, a lady gave him 50 cents, and kindly asked "How many have you caught?" "Youre the tenth this morning," was the reply.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4911, 'Fishing jokes', 'What kind of musical instrument can you use for fishing? The cast-a-net.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4912, 'Fishing jokes', 'Tim once took his small cousin with him while he went fishing: When he returned, he was looking very fed up. "Ill never do that again," he complained to his Dad. "Did she frighten off the fish?" enquired Dad. "No," replied Tim. "She sat on the bank and ate all my maggots."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4913, 'Fishing jokes', 'Whats the difference between an angler and a dunce? One baits his hooks while the other hates his books.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4914, 'Fishing jokes', 'Fisherman: What are you fishing for sonny? Boy: Im not fishing, Im drowning worms.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4915, 'Fishing jokes', 'Q: How many anglers does it take to change a light bulb? A: Four, one to change the light bulb and three to brag about how big the old one was and about the one that they would have changed, but "It got away"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4916, 'Fishing jokes', 'How many South Dakotans does it take to go ice fishing? Four. One to cut the hole in the ice, and three to push the boat through.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4917, 'Fishing jokes', 'Lee: I just swallowed a fish bone! Counselor: Are you choking? Lee: No, Im serious!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4918, 'Fishing jokes', 'George went fishing, but at the end of the day he had not caught one fish.On the way back to camp, he stopped at a fish store.I want to buy three trout, he said to the owner. But instead of putting them in a bag, throw them to me.Why should I do that? the owner asked.So I can tell everyone that I caught three fish!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4919, 'Fishing jokes', 'Have you seen the new fishing website?No, its not online yet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4920, 'Fishing jokes', 'What is the difference between a fisherman and a lazy student?One baits his hook, the other hates his book.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4921, 'Fishing jokes', 'What sort of net is useless for catching fish ?A football net !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4922, 'Fishing jokes', 'What did Noah do while spending time on the ark ?Fished, but he didnt catch much. He only had two worms !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4923, 'Fishing jokes', 'Fishing season hasnt opened and a fisherman who doesnt have a license, is casting for trout as a stranger approaches and asks: "Any luck?""Any luck? This is a wonderful spot. I took 10 out of this stream yesterday," he boasts."Is that so? By the way, do you know who I am?" asks the stranger."Nope.""Well, meet the new game warden.""Oh," gulped the fisherman. "Well, do you know who I am?""Nope.""Meet the biggest liar in the state!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4924, 'Fishing jokes', 'When fish play football, who is the captain ?The teams kipper !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4925, 'Fishing jokes', 'How do fish go into business ? The start on a small scale !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4926, 'Fishing jokes', 'What do you call a fish with no eyes ? Fish !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4927, 'Fishing jokes', 'Why are fish so smart?They are always in schools!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4928, 'Fishing jokes', 'Which fish go to heaven when they die ? Angelfish !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4929, 'Fishing jokes', 'What bit of fish doesnt make sense ? The piece of cod that passeth all understanding !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4930, 'Fishing jokes', 'What kind of money do fishermen make ? Net profits !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
