INSERT INTO `jokes` VALUES (4993, 'Food jokes', 'When the waitress in a New York City restaurant brought him the soup du jour, the Englishman was a bit dismayed. "Good heavens," he said, "what is this?""Why, its bean soup," she replied."I dont care what it has been," he sputtered. "What is it now?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4994, 'Food jokes', 'In February 1994 in New Brighton, Minn., a 32-year-old man and his 24-year-old girlfriend were arrested after a food fight in a grocery store. After arguing loudly, the couple began throwing sweet potatoes at each other. Eventually, the man allegedly threw the woman into several vegetable racks, sending the contents spilling to the floor. As both continued to brawl on the floor, she allegedly stuffed lettuce into the mans mouth.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4995, 'Food jokes', 'Johnny: Daddy, are caterpillars good to eat?Father: Have I not told you never to mention such things during meals!Mother: Why did you say that, Junior? Why did you ask the question?Johnny: Its because I saw one on daddys lettuce, but now its gone.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4996, 'Food jokes', 'An elderly couple were killed in an accident and found themselves being given a tour of heaven by Saint Peter. "Here is your oceanside condo, over there are the tennis courts, swimming pool, and two golf courses. If you need any refreshments, just stop by any of the many bars located throughout the area.""Heck, Gloria," the old man hissed when Saint Peter walked off, "we could have been here ten years ago if you hadnt heard about all that stupid oat bran, wheat germ, and low-fat diets!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4997, 'Food jokes', 'Q: Ever wonder about people who pay $2 for a bottle of Evian water?A: Just spell "Evian" backwards!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4998, 'Food jokes', 'A lady was picking through the frozen turkeys at the grocery store, but couldnt find one big enough for her family.She asked a stock boy, "Do these turkeys get any bigger?"The stock boy replied, "No maam, theyre dead."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (4999, 'Food jokes', 'A friend and I were standing in line at a fast-food restaurant, waiting to place our order.There was a big sign posted. "No bills larger than $20 will be accepted." The woman in front of us, pointing to the sign, remarked, "Believe me, if I HAD a bill larger than $20, I wouldnt be eating here."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5000, 'Food jokes', 'The American tourist in Dublin had been complaining a great deal about the food. "Here," he said to the waitress holding out a piece of meat for inspection, "do you call that pig?" "Which end of the fork, sir?" the waitress asked sweetly.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5001, 'Food jokes', 'A man went into a deli shop and took a seat at the lunch counter. "Give me a corned beef sandwich," he ordered."Corned beef sandwich is not on the menu, but I can give you a sandwich with corned beef in it, like our Midnight Special.""Whats a Midnight Special?""A triple decker with corned beef, tongue, bologna, tomato, lettuce, onion, pickle and mayonnaise, on toasted raisin bread.""Could you just place a piece of corned beef between two slices of white bread and serve it to me on a plate?""Why, sure!" Then, turning to the sandwich man, he sang out: "One Midnight Special. Make it one deck, hold the tongue, bologna, tomato, lettuce, onion, pickle and mayonnaise, and make the raisin bread white, untoasted!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5002, 'Food jokes', 'What are the four food groups?For bachelors: Fast, Frozen, Junk and Spoiled.For drinkers: Malt, Hops, Barley and Yeast.For heavies: Caffeine, Fat, Sugar, Chocolate.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5003, 'Food jokes', 'At a dinner party, one of the guests, an obnoxiously loud young man, tried to make clever remarks about everyone and everything.When he was served a piece of meat, he picked it up with his fork, held it up and smirked: Is this pig?Another guest, sitting opposite, asked quietly: Which end of the fork are you referring to?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
