INSERT INTO `jokes` VALUES (5051, 'Food jokes', 'An irate woman burst into the bakers shop and said, "I sent my son in for two pounds of cookies this morning but when I weighed them there was only one pound. I suggest you check your scales." The baker looked at her calmly for a moment or two and then replied, "Maam, I suggest you weigh your son."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
