INSERT INTO `jokes` VALUES (5056, 'Food jokes', 'At a party, a conjurer was producing egg after egg from a little boys ear. "There!" he said proudly. "I bet your Mum cant produce eggs without hens, can she?" "Oh yes, she can," said the boy. "She keeps ducks."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
