INSERT INTO `jokes` VALUES (5068, 'Food jokes', 'An elderly couple were killed in an accident and found themselves being given a tour of heaven by Saint Peter. "Here is your oceanside condo, over there are the tennis courts, swimming pool, and two golf courses. If you need any refreshments, just stop by any of the many bars located throughout the area.""Heck, Gloria," the old man hissed when Saint Peter walked off, "we could have been here ten years ago if you hadnt heard about all that stupid oat bran, wheat germ, and low-fat diets!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5069, 'Food jokes', 'A family of three tomatoes were walking downtown one day when the little baby tomato started lagging behind. The big father tomato walks back to the baby tomato, stomps on her, squashing her into a red paste, and says, "Ketchup!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
