INSERT INTO `jokes` VALUES (5150, 'Frog jokes', 'A frog came into a bank to obtain a loan. He spoke to the loan officer Mr. Paddywack. When Mr. Paddywack asked the frog what he had for loan collateral, the frog held out his hand. "Whats that?" asked Mr. Paddywack, but the frog could not talk. So, Mr. Paddywack took the frog in to see the manager and explained the situation. The manager then asked the frog what collateral he had for the loan and the frog held out his hand. "Oh," said the manager, "thats a knickknack Paddywack, give the frog a loan."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5151, 'Frog jokes', 'Once upon a time, a beautiful, independent, self-assured princess happened upon a frog in a pond. The frog said to the princess, " I once was a handsome prince until an evil witch put a spell on me. One kiss from you and I will turn back into a prince and then we can marry, move into the castle with my mom and you can prepare my meals, clean my clothes, bear my children and forever feel happy doing so." That night, while the princess dined on frog legs,she kept laughing and saying, "I dont THINK so."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
