INSERT INTO `jokes` VALUES (5287, 'Gorilla jokes', 'A gorilla was walking through the jungle when he came across a deer eating grass in a clearing. The gorilla roared, Who is the king of the jungle?and the deer replied, Oh, you are, Master.The gorilla walked off pleased. Soon he came across a zebra drinking at a water hole. The gorilla roared, Who is the king of the jungle? and the zebra replied, Oh, you are, Master.The gorilla walked off pleased. Then he came across an elephant. Who is the king of the jungle? he roared. With that, the elephant threw the gorilla across a tree and jumped on him. The gorilla scraped himself up off the ground and said, Okay, okay, theres no need to get mad just because you dont know the answer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
