INSERT INTO `jokes` VALUES (5297, 'Halloween jokes', 'One Halloween this woman opens her door to find the most adorable little girl, with golden blond curly hair and the biggest blue eyes. She was dressed as an Angel, and was just delightful. The woman said, "what are you supposed to say sweetheart?"The little girl looks up at the woman and says "Twick or Tweat!" The woman thinks this is just adorable, and she calls her husband to come to the door. The woman say to the child, "Go ahead honey say it just one more time." Once again the little Angel looks up and says, "Twick or Tweat!" The husband agrees with his wife, this little Angel is just the cutest thing. The woman picks an apple from the Treat Bowl, shines it up with her apron, and drops it into the little girls Treat Bag.The little Angel looks in her bag then looks up at the woman and says, "Thanks a lot lady, you just broke my f**king cookies!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
