INSERT INTO `jokes` VALUES (5384, 'Hair and bald jokes', 'A guy admired the hair of three girls. He walked by one and asked, "Howd you get such lovely blonde hair" Taking her hand and gently running it through her hair, the girl answered, "Its natural." The guy walked by the second girl and asked, "Howd you get such pretty brown hair?" Fluffing her hair, the second girl said, "Its natural." Finally the guy approached the third girl and asked, "Howd you get such cool green hair?" Taking her hand and rubbing it up past her nose, then skimming it through the hair, she said, "Its natural."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5385, 'Hair and bald jokes', 'Q: Why are brunettes so proud of their hair? A: It matches their mustaches.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5386, 'Hair and bald jokes', 'A woman was cutting her husbands thinning hair, when their teenage son arrived home looking for a snack. She ofered a kiwifruit and tried to tempt him with its nutritious qualities. "It has more vitamin C than an orange," she remarked. "And more hair than Dad," added their son.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5387, 'Hair and bald jokes', 'A guy walks in to the Barbershop. Barber says, "What will it be today?" Guy says, "well I want it going with my waves on top, faded on one side, plug the other, and just make it all out of shape and messed up." Barber says, "Now why in the world do you want your hair cut like that."Guy says, "Thats how you cut it last time"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
