INSERT INTO `jokes` VALUES (5548, 'Horse jokes', 'Why is horse racing so romantic?Because the horse hugs the rails, the jockey puts his arms around the horse and you can kiss your money goodbye!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5549, 'Horse jokes', 'Why is it difficult to identify horses from the back?Theyre always switching their tails!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
