INSERT INTO `jokes` VALUES (5551, 'Horse jokes', 'Why is the old, decrepit horse named Flattery?Because it gets you nowhere!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5552, 'Horse jokes', 'Why was Teddy Roosevelt mean to horses?He was a rough rider!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5553, 'Horse jokes', 'You said it was a great horse and it is.It took twenty other horses to beat him!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5554, 'Horse jokes', 'You said this horse could jump as high as a ten foot fence and he cant jump at all.Well neither can a fence!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5555, 'Horse jokes', 'What kind of horse can swim underwater without coming up for air ? A seahorse !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5556, 'Horse jokes', 'What is the slowest racehorse in the world ? A clotheshorse !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5557, 'Horse jokes', 'A mean horseman went into a saddlers shop and asked for one spur. "One spur?" asked the saddler. "Surely you mean a pair of spurs, sir?" "No, just one," replied the horseman. "If I can get one side of the horse to go, the other side is bound to come with it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5558, 'Horse jokes', 'Why did the bareback performer ride his horse? Because it got too heavy to carry.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5559, 'Horse jokes', 'A man has a racehorse, never won a race. Man in disgust says," Horse, you win today or you pull a milk wagon tomorrow morning." The starting gate opens, the horses take-off, they move the gate away and there lays his horse asleep on the track. He kicks the horse and asks, "WHY ARE YOU SLEEPING. The horse, half asleep says, "I have to get up at three in the morning."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5560, 'Humor jokes', 'Three men stood before a judge on a charge of drunk and disorderly conduct in a public park.Judge: What were you doing?1st man: Oh, just throwing peanuts in the pond.Judge: And what were you doing?2nd man: I was throwing peanuts in the pond, too."Judge: Sounds harmless. And you, were you throwing peanuts in the pond as well?3rd man: No, sir. I AM Peanuts!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5561, 'Humor jokes', 'One afternoon, a man was riding in the back of his limousine when he saw two men eating grass by the road side. He ordered his driver to stop and he got out to investigate. "Why are you eating grass?", he asked one man. "We dont have any money for food.", The poor man replied. "Oh, come along with me then." "But sir, I have a wife with two children!" "Bring them along! And you, come with me too!", he said to the other man. "But sir, I have a wife with six children!" The second man answered. "Bring them as well!" They all climbed into the car, which was no easy task, even for a car as large as the limo. Once underway, one of the poor fellows says "sir, you are too kind. Thank you for taking all of us with you." The rich man replied "No, you dont understand, the grass at my home is about three feet tall!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5562, 'Humor jokes', 'Two friends: - I heard that you have founded a musical band.- Yes, it is a quartet.- How many are you?- We are three.- Three?- Me and my brother.- You have a brother?- No, why do you ask?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5563, 'Humor jokes', 'Two guys are talking:(1) - Ive bought a tour to my mother-in-law.(2) - Your mother-in-law???!!!(1) - Why not, to Bagdad.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5564, 'Humor jokes', 'A newlywed couple, after bringing their luggage into their cabin, stormed down to the desk. The bride was in tears, and the groom was red faced. When asked what the problem was, the groom started swearing at the desk clerk. "We booked a cabin with a view for our honeymoon, and all we get to see out the window is a parking lot!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5565, 'Humor jokes', 'Two women were sitting by the pool, and one asked what kind of water they fill the pool with -- freshwater or sea water? The cruise director answered,"Sea water." "Oh, that explains why its so roughtoday."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5566, 'Humor jokes', 'A man was given the job of painting the white lines down the middle of a highway. On his first day he painted six miles; the next day three miles; the following day less than a mile. When the foreman asked the man why he kept painting less each day, he replied "I just cant do any better. Each day I keep getting farther away from the paint can."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5567, 'Humor jokes', 'A man is hired by the circus to perform a necessary but rather unpleasant task. He is asked to walk behind the elephants in the center ring, shoveling aside their droppings as they walk about. After a rather difficult evening at work, he goes to the circus cafeteria, sits with other workers, and begins complaining about his work."Its just terrible work, walking behind those huge beasts and first dodging, then shoveling aside the dung they produce. My arms are tired, my shoes and pants are a mess, and Ill have to shower before I return home, because of the stink."His friends at work agree: "Why dont you just quit this miserable job and find something more rewarding to do. You have to have some skills and talents that you can put to use somewhere else."He looks at them, stunned: "You know, youre probably right, but I just cant give up the glamour of show business!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5568, 'Humor jokes', 'Abraham wanted a new suit, so he bought a nice piece of cloth and then tried to locate a tailor. The first tailor he visited looked at the cloth and measured Abraham, then told him the cloth was not enough to make a suit.Abraham was unhappy with this opinion and sought another tailor. This tailor measured Abraham, then measured the cloth, and then smiled and said, "There is enough cloth to make a pair of trousers, a coat and a vest, please come back in a week to take your suit."After a week Abraham came to take his new suit, and saw the tailors son wearing trousers made of the same cloth. Perplexed, he asked, "Just how could you make a full suit for me and trousers for your son, when the other tailor could not make a suit only?""Its very simple," replied the tailor, "The other tailor has two sons."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5569, 'Humor jokes', 'An archaeologist was digging in the Negev Desert in Israel and came upon a casket containing a mummy. After examining it, he called the curator of a prestigious natural-history museum. "Ive just discovered a 3,000 year-old mummy of a man who died of heart failure!" the excited scientist exclaimed.To which the curator replied, "Bring him in. Well check it out." A week later, the amazed curator called the archaeologist. "You were right about the mummys age and cause of death. How in the world did you know?""Easy. There was a piece of paper in his hand that said, 10,000 Shekels on Goliath."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5570, 'Humor jokes', 'How many archaeologists does it take to change a light bulb?Three. One to change it while the other two argue about how old the old one is.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5571, 'Humor jokes', 'How many architects does it take to change a light bulb?Just one, but he has to coordinate ten other professionals who are doing this quiet complicated task.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5572, 'Humor jokes', 'How many brewers does it take to change a light bulb?Third as many as for a regular bulb.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5573, 'Humor jokes', 'How many cashiers does it take to change a light bulb?"Are you kidding? They wont even change a five dollar bill."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5574, 'Humor jokes', 'How many civil servants does it take to change a light bulb? Twelve. One to change the bulb, and eleven to do the paperwork.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5575, 'Horse jokes', 'Why was the horse all charged up?It ate some haywire!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5576, 'Horse jokes', 'Why was the horseman fired from his job of saddle testing?He was always standing up on the job!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5577, 'Horse jokes', 'Why was the man sued by his horse?For palomino-money!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5578, 'Horse jokes', 'Why was the racehorse named Bad News?Because bad news travels fast!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5579, 'Horse jokes', 'Why was the racehorse names Strawberry Ice?He was a sherbet!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5580, 'Humor jokes', 'How many librarians does it take to screw in a light bulb?"I dont know, but I can look it up for you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5581, 'Humor jokes', 'How many social scientists does it take to change a light bulb?None. Social scientists do not change light bulbs; they search for the root cause as to why the last one went out.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5582, 'Humor jokes', 'How many tax auditors does it take to find a $1.00 mistake in an expense report?Three. One to find the mistake and two to discuss the significance of it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5583, 'Humor jokes', 'How many tax advisors does it take to change a light bulb?"In the summer there is a tax deductible convention in Hawaii, dealing exactly with this issue."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5584, 'Humor jokes', 'How many applicants does it take to change a light bulb? Only one, but 200 applied for the job.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5585, 'Humor jokes', 'Bill and Steve are enjoying a beer and discussing the possibility of love. "I thought I was in love three times," Bill says. "Thought?" Steve asks. "What do you mean?" "Three years ago, I cared very deeply for a woman who wanted nothing to do with me," Bill says. "Wasnt that love?" Steve asks. "No, that was obsession," Bill explains. "Then two years ago, I cared very deeply for an attractive woman who didnt understand me." "Wasnt that love?" asks Steve. "No, that was lust," Bill replies. "And just last year, I met a woman while I was on a cruise. She was gorgeous, intelligent, a great conversationalist and had a super sense of humor. Everywhere I followed her on that ship, I would get a very strange sensation in the pit of my stomach." "Well, wasnt that love," asks Steve. "No. That was motion sickness!" Bill replies.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5586, 'Humor jokes', 'A wife and her husband were having a dinner party for all the major status figures in Rome, Italy. The wife was very excited about this and wanted everything to be perfect. At the very last minute, she realized that she didnt have any snails for this dinner party, so she asked her husband to run down to the beach with the bucket she was handing him to gather some snails. Very grudgingly he agreed. He took the bucket, walked out the door, down the steps, and out to the beach. As he was collecting the snails, he noticed a beautiful woman walking alongside the water just a little further down the beach. He kept thinking to himself "Wouldnt it be great if she would even just come down and talk to me." He went back to gathering the snails. All of a sudden he looked up, and the beautiful woman was standing right over him. They got to talking, and she invited him back to her place. \r nThey were at her apartment a ways down the beach, and they started messing around. It got so hot and heavy, that he was exhausted afterwards and passed out there. At seven oclock the next morning he woke up and exclaimed, "Oh no! My wifes dinner party!" He gathered all his clothes, put them on really quickly, grabbed his bucket, and ran out the door. He ran down the beach all the way to his apartment. He ran up the stairs of his apartment. He was in such a hurry that when he got to the top of the stairs, he dropped the bucket of snails. There were snails all down the stairs. The door opened just then, with a very angry wife standing in the door way wondering where hes been all this time. He looked at the snails on the steps, then he looked at her, then back at the snails and said - "Come on guys, were almost there!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5587, 'Humor jokes', 'A young man was strolling down a street. As he passed a large building with a fence around it, he heard a group of people chanting "Thirteen, thirteen, thirteen" over and over again.Curious, he tried to see over the fence, but couldnt. Then he spotted a hole in the wood.He put his eye to the hole. He just managed to spy some old people sitting in deckchairs chanting, before a finger came out of nowhere and poked him in the eye. As he staggered back, the old people started chanting, "Fourteen, fourteen, fourteen..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5588, 'Humor jokes', 'Once there was a millionaire who had a collection of live alligators. He kept them in a pool at the back of his mansion. The millionaire also had a beautiful daughter who was single. One day, he decides to throw a huge party. During the party he announces, "My dear guests, I have a proposition to every man here. I will give one million dollars or my daughter to the man who can swim across this pool full of alligators and emerge unharmed!" As soon as he finishes his last word, there is the sound of a large splash. The guests all turn to see a man in the pool swimming as fast as he can. They cheer him on as he keeps stroking. Finally, the swimming man makes it to the other side unharmed. The millionaire is so impressed, e says, "My boy, that was incredible! Fantastic! I didnt think it could be done! Well, I must keep my end of the bargain. Which do you want, my daughter or the one million dollars?" The  man says, "Listen, I dont want your money. I dont want your daughter, either. I want the person who pushed me in that water!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5589, 'Humor jokes', 'Three friends were stranded on a desert island. After several weeks with no food and no drinking water, they were beginning to lose heart. Suddenly, a bottle floated into the shore and a beautiful genie popped out. She said "I have three wishes to grant. Each of you gentleman can make one wish come true." Friend number one got excited. He said "I wish I was in Las Vegas with dice in one hand and a drink in the other, surrounded by music, food, and beautiful women." Instantly he was gone, his wish granted. Friend number two smiled and said, "I wish I was back home right now with my wonderful wife and our two small children, at our log cabin in the woods sitting in front of the fire and singing Christmas carols together." Just like that, he disappeared. The genie asked the remaining man, "And what do you wish for?" He answered, "Gee, I wish I had my buddies back to help me dec ide..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5590, 'Humor jokes', 'A girl walked over to her neighbors for her morning chat session. When she got there, her neighbor remarked how tired she looked. "Yeah" she said, "I didnt sleep well last night, I had this really strange dream." "Do tell" said her neighbor, pouring the coffee. "Well, I dreamed I woke up and went downstairs as usual, but when I looked in the mirror my face had turned orange, and my hair was sticking straight up out of my head and was green!" "Sounds like you turned into a punk rocker or something" the neighbor said, with a grin. "No" she said, "It wasnt like that. It was as if I knew something was wrong, but it seemed normal somehow, you know what I mean?" "Sure" said the neighbor, "Everybodys had dreams like that." "Well anyway" she continued, "I decided to go down and get the mail, because even in my dream, I figured I must be dreaming, so what the heck  if I was orange, you know? So I walk down and get my mail, and I keep feeling everybody looking at me! "Then I get a good look at myself in the big window in front of the store, and Ill be darned if I wasnt a carrot! It was such a shock I stumbled backwards and got hit by a truck driven by that nice doctor down the street. The last thing I remember before I woke up was him bending over me, telling me his diagnosis." "Wow" laughed the neighbor, "Did you live?" "Yeah, I lived" sighed the girl, "But the doctor said Id be a vegetable the rest of my life."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5591, 'Humor jokes', 'There was an engineer who had an exceptional gift for fixing all things mechanical. After serving his company loyally for over 30 years, he happily retired. Several years later the company contacted him regarding a seemingly impossible problem they were having with one of their multi-million dollar machines. They had tried everything and everyone else to get the machine fixed, but to no avail. In desperation, they called on the retired engineer who had solved so many of their problems in the past. The engineer reluctantly took the challenge. He spent a day studying the huge machine. At the end of the day, he marked a small "x" in chalk on a particular component of the machine and proudly stated, "This is where your problem is". The part was replaced and the machine worked perfectly again. The company received a bill for $50,000 from the engineer for his service. They demanded an itemize d accounting of his charges. The engineer responded with the following account: Chalk: $1 Knowing where to put it: $49,999 It was paid in full and the engineer retired again in peace.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5592, 'Humor jokes', 'Steve, Bob and Jeff are all working on some very high scaffolding. Suddenly, Steve falls off and is killed instantly. After the ambulance leaves with Steves body, Bob and Jeff realise theyll have to inform his wife. Bob says hes good with this sort of sensitive stuff, so he volunteers to do it. After two hours, he returns carrying a six-pack of beer. "So, did you tell her?" Asks Jeff. "Yep." Replies Bob. "Hey, where did you get the six-pack?" "She gave it to me." "What?!" Exclaims Jeff. "You just told her that her husband died, and she gave you a six-pack?!" "Sure. When she answered the door, I asked her whether she was Steves widow. Widow? She said. No, no..Im not a widow. You must be mistaken. So I said, Ill bet you a six-pack you are!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5593, 'Humor jokes', 'My mother-in-law is like a fine French Impressionist painting.Shes very lovely, but is best appreciated at a distance.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5594, 'Humor jokes', 'My mother-in-law was bitten by a dog yesterday.How is she now ?Shes fine. But, the dog died.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5595, 'Humor jokes', 'Q. Is it possible to kill a mother-in-law with newspaper?A. Yes, if you wrap an iron in it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5596, 'Humor jokes', 'I used to not get on with my mother-in-law, but over the last few months Ive developed quite an attachment for her.It goes over her head and a strap comes down under her chin to keep her mouth shut!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5597, 'Humor jokes', 'One day a wife complained, "This wall clock almost killed my mother today.It fell only seconds after she got up from the couch."The husband grunted and replied, "The darn clock always was slow."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5598, 'Humor jokes', 'Mother-in-law: I baked two kinds of cookies today. Would you like to takeyour pick?Son-in-law: No thanks. Ill just use the hammer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5599, 'Humor jokes', 'A woman reported the disappearance of her husband to the police. The officer looked at the guys photograph, questioned her, and then asked if she wanted to give her husband any message if they found him."Yes, please" she replied. "Tell him Mother didnt come after all."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5600, 'Humor jokes', 'A young Jewish man excitedly tells his mother hes fallen in loveand going to get married. He says, "Just for fun, Ma, Im goingto bring over three women and you try and guess which one Imgoing to marry."The mother agrees. The next day, he brings three beautiful womeninto the house and sits them down on the couch and they chat fora while.He then says,"Okay, Ma. Guess which one Im going to marry."She immediately replies, "The red-head in the middle.""Thats amazing, Ma. Youre right. How did you know?""I dont like her."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5601, 'Humor jokes', 'The young wife was in tears when she opened the door for her husband. "Ive been insulted," she sobbed. "Your mother insulted me." "My mother!" he exclaimed. "But she is a hundred miles away." "I know, but a letter came for you this morning and I opened it." He looked stern, "I see, but where does the insult come in?" "In the postscript," she answered. "It said: Dear Alice, dontforget to give this letter to George."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5602, 'Humor jokes', 'What is the difference between a English actuary and a Sicilian actuary?An English actuary can tell you how many people are going to die next year. A Sicilian actuary can give you their names...', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5603, 'Humor jokes', 'Did you hear about the fire in the rednecks library? Both the books got burned, and one hadnt even been coloured in yet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
