INSERT INTO `jokes` VALUES (5608, 'Humor jokes', 'Mother: Fred, why did you put a slug in your grandmas bed? Fred: Because I couldnt find a snake.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5609, 'Humor jokes', 'My mother-in-law has got so many double chins it looks like she is peering over a pile of pancakes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5610, 'Humor jokes', 'Q. Why do bakers work so hard? A. Because they need the dough', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5611, 'Humor jokes', 'After a visit to the circus, Geoff and Don were discussing the thrills and marvels they had seen. "I didnt think much of the knife thrower, did you?" said Geoff. "I thought he was great!" enthused Don. "Well, I didnt," said Geoff. "He kept throwing those knives at that soppy girl but he didnt hit her once."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5612, 'Humor jokes', 'Did you hear about the ghouls favorite hotel? It had running rot and mould in every room.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5613, 'Humor jokes', 'What happened to the wizard who ran away with the circus?The police made him bring it back again.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5614, 'Humor jokes', 'A magician was employed by a Shipping Line to entertain the passengers during cruises. The captain owned a parrot which always insisted on being part of the acts put on by the magician. He would perch on the edge of the stage and screech, "He does it with a mirror" or "Hes got it up his sleeve." The magician was furious, but since the bird was a favorite with the captain and he was anxious to retain his position for future cruises, he maintained an angry silence.One evening as the magician worked, the parrot continued to harass the unfortunate man. Sadly the ship ran into a mine which had become detached from the sea floor after a storm. The explosion tore the bow off the ship which sank within a few minutes. Amid the wreckage and the lifeboats, the magician sat on one end of a table from the first class dining room. At the other end sat the parrot, dirty and disheveled, his feathers caked with f uel oil. For some time they eyed each other malevolently saying nothing. Finally the parrot shook himself and advanced across the table. He fixed the magician with a beady eye. "Okay, I give up," he squawked. "What did you do with the ship?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5615, 'Humor jokes', 'A gang of witches broke into a blood bank last night and stole a thousand pints of blood. Police are still hunting for the clots.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5616, 'Humor jokes', 'At the scene of a bank raid the police officer came running up to his inspector and said, "He got away, sir!" The inspector was furious. "But I told you to put a man on all the exits!" he roared. "How could he have got away?" "He left by one of the entrances, sir!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5617, 'Humor jokes', 'When Fred was applying for a credit card, the manager of the credit card company asked him if he had much money in the bank. "I have," said Fred. "How much?" asked the manager. "I dont know exactly," said Fred, "I havent shaken it lately."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5618, 'Humor jokes', 'Bank manager: Im sorry, sir, you cant open an account with this sort of money. Theyre wooden pieces! Lumberjack: But I only want to open a shavings account.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5619, 'Humor jokes', 'Whats the best way to increase the size of your bank balance? Look at it through a magnifying glass.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5620, 'Humor jokes', 'A man went in to the bank and asked to see the man who arranged the loans. Im sorry, sir, said a cashier, the loan arranger is out to lunch. Can I speak to Tonto, then? asked the man.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5621, 'Humor jokes', 'Dad, did you manage to fix my toy? No, its not broken, the batterys flat. Well, what shape should it be?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
