INSERT INTO `jokes` VALUES (5625, 'Humor jokes', 'Clown: Why are you wearing such a large shirt?Second Clown: I always perform in the big top.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5626, 'Humor jokes', 'Q: How many Mafia hitmen does it take to change a lightbulb ? A: Three. One to screw it in, one to watch, and one to shoot the witness.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5627, 'Humor jokes', 'Q: How many circus performers does it take to change a lightbulb ? A: Four: One for the money, two for the show, three to get ready, and four to go! A: Four. One to change the bulb and three to sing, Ta da!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5628, 'Humor jokes', 'Coleman moved to Wyoming and was sitting in the unemployment office applying for a job. "Have you any experience in coal mining?" asked the clerk. "Yeah, in Pennsylvania," he replied. "Theyre using that new safety lamp down there now, arent they?" "Ah dont know, mister," said Coleman. "I worked on the day shift."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5629, 'Humor jokes', 'Seems a guy was driving for hours thu desolate country when he passed a farmhouse, and before he could react, a cat ran out in front of him and*splat*... he flattened the cat. Out of kindness and consideration, he stopped, turned around and drove back to the farmhouse to notify the occupants. When the housewife came to the door, said he, "Pardon memadame, but I just ran over a cat in front of your house, and assumed that it must belong to you. I know this might be hard to hear, but Iwanted to let you know instead of just driving off...." "Not so fast", says she. "How do you know it was our cat? Could youdescribe him? What does he look like?" The man promptly flopped down on the ground, and said "He looks like thts"as he gave his best shot at a dead cat impression. "Oh no, you *horrible* man", she replied. "I meant, what did he look like*before* you hit him?" At that, the man got  up, covered his eyes with both hands and screamed"Agggghhhhhhhhhh !!!!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5630, 'Humor jokes', 'Do you know the punishment for bigamy? Two mothers-in-law.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5631, 'Humor jokes', 'The mother-in-law stopped unexpectedly by the recently married couples house. She rang the doorbell and stepped into the house to see her daughter-in-law standing naked by the door. "What are you doing?" the mother-in-law asked. "I am waiting for my husband to come home from work." the daughter-in-law replied. "Why are you naked?" asked the mother-in-law. "This is my love dress." the daughter-in-law replied. "LOVE DRESS! You are naked." said the mother-in-law "But my husband loves it when I wear this dress. It makes him happy and he makes me happy." said the daughter-in-law. "I would appreciate it if you left now because my husband will be home any minute." The daughter-in-law continued. Soured by all of this romantic stuff, the mother-in-law left. On the way home she thought about the "LOVE DRESS" and got an idea. She undressed, showered, applied her best perfume  and waited by the door for her husband to come home. Finally the pickup truck drove up the drive way and she took her place by the door. The father-in-law opened the door and immediately saw his wife naked by the door. "What are you doing?" he asked. "This is my love dress" the mother-in-law replied. "Maybe you should iron it." he replied.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5632, 'Humor jokes', 'A young family moved into a house next door to a vacant lot. One day a construction crew turned up to start building a house on the empty lot. The young familys 6 year old daughter naturally took an interest in all the activity going on next door and started talking with the workers. She hung around and eventually the construction crew - gems in the rough, all of them - more or less adopted her as a kind of project mascot. They chatted with her, let her sit with them while they had coffee and lunch breaks,and gave her little jobs to do here and there to make her feel important. At the end of the first week they even presented her with a pay envelope containing a dollar. The little girl took this home to her mother who said all the appropriate words of admiration and suggested that they take the dollar pay she had received to the bank the next day to start a savings account. When they  got to the bank the teller was equally impressed with the story and asked the little girl how she had come by her very own pay check at such a young age. The little girl proudly replied, "Ive been working with a crew building a house all week". "My goodness gracious", said the teller, "and will you be working on the house again this week too"? "I will if those useless morons at the lumber yard ever bring us the f****** bricks", replied the little girl.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5633, 'Humor jokes', 'A woman walks into a bank in New York City and asks for the loan officer. She says she is going to Europe on business for two weeks and needs to borrow $5000. The bank officer says the bank will need some kind of security for such a loan, so the woman hands over the keys to a new Rolls Royce, parked on the street, in front of the bank. Everything checks out, and the bank agrees to accept the car as collateral for the loan. An employee drives the Rolls into the banks underground garage and parks it there. Two weeks later, the woman returns, repays the $5000. and the interest which is $15.41. The loan officer says, "We are very happy to have had your business, and this transaction has worked out very nicely, but we are a little puzzled. While you were away, we checked you out and found that you are a multimillionaire. What puzzles us , is why would you bother to borrow $5000 ?" The woman replied, "Where else in New York, can I park my car for 2 weeks for $15.00?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5634, 'Humor jokes', 'A young banker decided to get his first tailor made suit. So he went to the finest tailor in town and got measured for a suit. A week later he went in for his first fitting. He put on the suit and he looked stunning, he felt that in this suit he can do business. As he was preening himself in front of the mirror he reached down to put his hands in the pockets and to his surprise he noticed that there were no pockets. He mentioned this to the tailor who asked him, "Didnt you tell me you were a banker?" The young man answered, "Yes, I did." To this the tailor said, "Who ever heard of a banker with his hands in his own pockets?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5635, 'Humor jokes', 'Before going to Europe on business, a man drove his Rolls Royce to a downtown NY City bank and went in to ask for an immediate loan of $6,000. The loan officer was quite taken a back, and requested collateral. "Well, then, here are the keys to my Rolls-Royce", the man said. The loan officer promptly had the car driven into the banks underground parking for safekeeping, and gave him 6,000. Two weeks later, the man walked through the banks doors, and asked to settle up his loan and get his car back. The loan officer checked the records and told him, "That will be $6,000 in principal, and $18.40 in interest." The man wrote out a check, thanked the loan officer, and started to walk away. "Wait sir," the loan officer said, "while you were gone, I found out you are a millionaire. Why in the world would you need to borrow? The man smiled. "Where else could I securely park my Rolls-Royce in Manhattan for t wo weeks and pay only $18.40?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5636, 'Humor jokes', 'At a country-club party a young man was introduced to an attractive girl. He immediately began paying her court and flattering her. The girl liked the young man, but she was taken a bit aback by his fast and ardent pitch. She was amazed when, after 30 minutes, he seriously proposed marriage. "Look," she reacted. "We only met a half hour ago. How can you be so sure? We know nothing about each other." "Youre wrong," the young man replied. "For the past 5 years Ive been working in the bank where your father has his account."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5637, 'Humor jokes', 'Q: Why did the clown cross the road? A: To find his rubber chicken.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5638, 'Humor jokes', 'Q: Why did the clown wear loud socks? A: So his feet wouldnt fall asleep.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5639, 'Humor jokes', 'Standing at the edge of the lake, a man saw a woman flailing about in the deep water. Unable to swim, the man screamed for help. A trout fisherman ran up. The man said, "My wife is drowning and I cant swim. Please save her. Ill give you a hundred dollars." The fisherman dove into the water. In ten powerful strokes, he reached the woman, put his arm around her, and swam back to shore. Depositing her at the feet of the man, the fisherman said, "Okay, wheres my hundred dollars?" The man said, "Look, when I saw her going down for the third time, I thought it was my wife. But this is my mother-in-law." The fisherman reached into his pocket and said, "Just my luck. How much do I owe you?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5640, 'Humor jokes', 'An engineer, an experimental physicist, a theoretical physicist, and a philosopher were hiking through the hills of Scotland. Cresting the top of one hill, they see, on top of the next, a black sheep. The engineer says: "What do you know, the sheep in Scotland are black." "Well, *some* of the sheep in Scotland are black," replies the experimental physicist. The heoretical physicist considers this for a moment and says "Well, at least one of the sheep in Scotland is black." "Well," the philosopher responds, "on one side, anyway."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5641, 'Humor jokes', 'A monastery in the English countryside was having a hard time with its cash flow because of the dwindling number of monks available to help with all the work. Then one day two of the monks, who had been discussing the problem, suggested they open a fish and chips stand down on the highway, right next to a scenic vista area popular with tourists. The other monks agreed, and the two put up the stand. One day a tourist who wanted to offer a compliment asked the monk on duty, "Are you the fish friar?" "No, sir," retorted the brother, "Im the chip monk."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5642, 'Humor jokes', 'Harry was telling his friend about his holiday in Switzerland. His friend had never been to Switzerland and asked, what did you think of the scenery ?Oh, I couldnt see much, Harry admitted. There were all these mountains in the way.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5643, 'Humor jokes', 'The garbage men were just about to leave the street when a girl came running out of the house carrying some cardboard boxes.Am I too late for the garbage ? she called.No, replied one of the men, jump right in !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5644, 'Humor jokes', 'Whats a cows favourite love song?When I fall in love , it will be for heifer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5645, 'Humor jokes', 'Freda: Boys whisper they love me.Fred: Well, they wouldnt admit it out loud, would they?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
