INSERT INTO `jokes` VALUES (5648, 'Humor jokes', 'How did the octopus lovers walk down the road?Arm in arm in arm in arm in arm in arm in arm in arm in arm.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5649, 'Humor jokes', 'What do lovesick owls say when its raining?Too-wet-to-woo.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5650, 'Humor jokes', 'My brothers looking for a girlfriend. Trouble is, he cant find a girl who loves him as much as he loves himself.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5651, 'Humor jokes', 'Sharon: Im so homesick.Sheila: But this is your home!Sharon: I know and Im sick of it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
