INSERT INTO `jokes` VALUES (5655, 'Humor jokes', '"Do you love me more than you love sleep?""I cant answer now. Its time for my nap!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5656, 'Humor jokes', 'What do you call two birds in love? Tweethearts!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
