INSERT INTO `jokes` VALUES (5659, 'Humor jokes', 'Why did the kangaroo love the little Australian bear? Because the bear had many fine koala-ties!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5660, 'Humor jokes', 'What did one bell say to the other? "Be my valenchime!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5661, 'Humor jokes', 'What happened when the monster kissed his one true love? He left lip prints on the mirror!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
