INSERT INTO `jokes` VALUES (5663, 'Humor jokes', 'What did the elephant say to his girlfriend? "I love you a ton!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5664, 'Humor jokes', 'A Counselor saw a camper sitting alone. Why dont you play with your friends? he asked.Because I only have one friend, the girl replied. And I hate her.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5665, 'Humor jokes', 'Camper: Theres a leak over my bunk!Counselor: Dont complain. It only leaks when it rains.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5666, 'Humor jokes', 'Camper: Theres a leak over my bunk!Counselor: Shh! Dont make such a fuss. Soon everyone will want one.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5667, 'Humor jokes', 'Camper: Theres a leak over my bunk!Counselor: Thats what we said in the camp ads. Running water in every cabin!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5668, 'Humor jokes', 'The Counselor was greeting the new campers.So you decided to come to camp, she said to one.Nope, the camper answered. I was sent to camp!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5669, 'Humor jokes', 'The Counselor was talking to the campers about safety. She said Dont climb any trees. If you fall down and break a leg, dont come running to me!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5670, 'Humor jokes', 'The head Counselor gathered all the campers together. To get their attention, the Counselor called out, Order! Order!In a flash someone shouted out, Hamburger, coke and fries!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5671, 'Humor jokes', 'At the end of camp, Julie won the prize for neatest trunk. Her mother was amazed.How did your trunk get so neat? she asked her messy daughter.It was easy, said Julie. I just never unpacked!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5672, 'Humor jokes', 'New camper: I thought you said this camp has no mosquitoes.Old camper: Thats right. These mosquitoes come from the camp down the road!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5673, 'Humor jokes', 'On the last day of camp everyone was asked the same question: What is the best part of the camp?One wise guy answered, Going home!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5674, 'Humor jokes', 'One day the counsellor got a phone call. It was from a camper who had been at camp the summer before. The old camper said, I thought of camp yesterday.Why? the counsellor asked. Where were you?At the garbage dump! the old camper answered.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5675, 'Humor jokes', 'Sammy: My parents are sending me to camp.Tammy: Why? Do you need a vacation?Sammy: No. They do!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5676, 'Humor jokes', 'Steve wrote home. Im glad you named me Steve, he said in the letter.Why? asked his mother in her reply.Because thats what all the kids at camp call me, he wrote back.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5677, 'Humor jokes', 'Megs mother was visiting her daughter at camp. How did you find the steak dinner? she asked.With a magnifying glass!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5678, 'Humor jokes', 'Pierre was a camper from France. In his honour, Jenny sang a French song in the talent show. But she didnt sing very well.Does that make you homesick? someone asked Pierre.No, he answered. Just sick sick!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5679, 'Humor jokes', 'John was hard at work with the broom in his familys tent.His mother came in and said, Thats nice. Are you sweeping out the tent?No, John answered. Im sweeping out the dirt.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5680, 'Humor jokes', 'Terry and Debbie were camping with their parents deep in the woods.How far is it to town? Terry wanted to know.Six miles, said Debbie.Thats too far to walk, Terry replied.Its not too bad, Debbie said. We can each walk three miles!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5681, 'Humor jokes', 'Bob: Did you hear about the camper who was killed by a garter snake?Betty: Thats impossible. A garter snake is not poisonous.Bob: It doesnt have to be if it can make you jump off a cliff!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5682, 'Humor jokes', 'The Rocky Mountains are very big and far apart. It takes a long time for an echo to bounce back off one of these mountains.One night, a camper in the Rockies went to sleep early. But before climbing into his sleeping bag he yelled, Time to get up.And eight hours later the echo came back and woke him up!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5683, 'Humor jokes', 'Dawn was breaking over the camp grounds. Tony and Steve were lying in their tent.That was a terrible thunder and lightening storm last night, Tony announced.Steve turned to him and said, Why didnt you wake me up? You know I cant sleep during a storm!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
