INSERT INTO `jokes` VALUES (5705, 'Humor jokes', 'There once was a German schoolteacher. She went to England to teach. When she arrived at the boardinghouse, she wanted to use the bathroom of the Water Closet. She sent a note with a messenger boy to the host asking where the WC was, thinking that the house knew what WC stood for. When the host recieved the letter, he wrote a response thinking that the WC was the Wayside Chapel. He reponse read:The WC is 3 miles away. My wife has been sick for a while, so she was not able to go for 3 years. The WC can hold up to 300 people at one time. The people complained about the hard wooden seats so instead soft, plush seats were made. I have reserved for you the best seat where EVERYONE can see you!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5706, 'Humor jokes', 'So one day, Gramma sent her grandson Johnny down to the water hole to get some water for cooking dinner. As he was dipping the bucket in, he saw two big eyes looking back at him. He dropped the bucket and hightailed it forGrammas kitchen. "Well now, wheres my bucket and wheres my water?" Gramma asked him. "I cant get any water from that water hole, Gramma" exclaimed Johnny. "Theres a BIG ol alligator down there!""Now dont you mind that ol alligator, Johnny. Hes been there for a few years now, and hes never hurt no one. Why, hes probably as scared of you as you are of him!" "Well, Gramma," replied Johnny, "if hes as scared of me as I am of him, then that water aint fit to drink!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5707, 'Humor jokes', 'What do you call a boomerang that doesnt come back? A stick.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5708, 'Humor jokes', 'After wedding a young couple rented a town house in a large complex. Concerned about a leak in an upstairs bathroom, young woman called the manager several times, but nothing happened. Finally her husband reached the manager and, noting the seriousness of the problem, said, " My wife is afraid the bathtub will fall through the kitchen." "Oh, no," the manager quickly replied. "The bathtub falls through the living room."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5709, 'Humor jokes', 'The young Southern belle came to the hospital for a check-up. "Have you ever been x-rayed?", asked the doctor. "Nope," she replied, "But ahve been ultra-violated."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
