INSERT INTO `jokes` VALUES (5720, 'Humor jokes', 'This morning I felt that today was going to be my lucky day. I got up at seven, had seven dollars in my pocket, there were seven of us at lunch and there were seven horses in the seven oclock race - so I backed the seventh. Did it win?No, it came seventh.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
