INSERT INTO `jokes` VALUES (5733, 'Humor jokes', 'Q: How many existentialists does it take to screw in a light bulb? A: Two: One to screw it in and one to observe how the light bulb itself symbolizes a single incandescent beacon of subjective reality in a netherworld of endless absurdity reaching out toward a cosmos of nothingness.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5734, 'Humor jokes', 'Q: Why did the scientist install a knocker on his door? A: To win the no-bell prize.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5735, 'Humor jokes', 'The strong young man at the construction site was bragging that he could outdo anyone in a feat of strength. He made a special case of making fun of one of the older workmen. After several minutes, the older worker had had enough. "Why dont you put your money where your mouth is," he said. "I will bet a weeks wages that I can haul something in a wheelbarrow over to that outbuilding that you wont be able to wheel back." "Youre on, old man," the braggart replied. "Lets see what you got." The old man reached out and grabbed the wheelbarrow by the handles. Then, nodding to the young man, he said, "All right. Get in."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5736, 'Humor jokes', 'The worlds most incredibly lazy man found a magic lamp. He rubbed it and a genie appeared and granted him three wishes. He wished for a horse, a sumo wrestler and a squirrel. "Theyre yours, but what are they for?" the genie asked."Im tired of walking everywhere--I want to just ride the horse. The sumo wrestler is so that I wont have to work to get on the horse.""But the squirrel?" asked the genie."I need something to go click-click to start the horse!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5737, 'Humor jokes', 'There was a man who entered a local papers pun contest. He sent in ten different puns, in the hope that at least one of the puns would win.Unfortunately, no pun in ten did.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5738, 'Humor jokes', 'Martin asked David, "In which state does the Ohio River run?" David answered with cool, "In the liquid state."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5739, 'Humor jokes', 'A man walks into a palm reader store and asks the reader, "Could you read my palm?" He shows his hand to her, and she says, "But...I cant read your hand.""Why?" the man asks."I dont understand your handwriting," the woman replies.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5740, 'Humor jokes', 'A man had a nose ring fitted into his nose, a friend asked, "how much did you pay for that?""I paid through the nose!" he replied', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5741, 'Humor jokes', 'A guy goes to a girls house for the first time, and she shows him into the living room. She excuses herself to go to the kitchen to make them a few drinks, and as hes standing there alone, he notices a cute little vase on the mantel.He picks it up, and as hes looking at it, she walks back in. He says "Whats this?"She says, "Oh, my fathers ashes are in there."He goes, "Geez...oooh....I..."She says, "Yeah, hes too lazy to go to the kitchen to get an ashtray."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5742, 'Humor jokes', 'Do you believe in love at first sight or do I have to walk by you again?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
