INSERT INTO `jokes` VALUES (5762, 'Humor jokes', 'Mad men are given a test to prove they are getting normal their teacher draws a door on the wall and orders them to go out. They tart fighting but one remains sitting and the teacher goes to him and asks why he didnt join others and he says "let them fight they forgot I have the keys"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5763, 'Hunting jokes', 'Two Canadian hunters were driving through the country to go bear hunting. They came upon a fork in the road where a sign read "BEAR LEFT" so they went home.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5764, 'Hunting jokes', 'Some men go on a hunting trip and separate into pairs. That evening one hunter, Sam, returned to camp alone toting a 12 point buck. "Wheres George?" one of the men asked, noticing that Sam had returned alone."Hes about 6 miles back. He tripped and broke his ankle. I left him there cause I figured aint nobody bout to steal him."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5765, 'Hunting jokes', 'Two guys were out hunting, but they werent getting any ducks. "What do you think the problem is?" one man asked his companion. "I dunno," came the reply, "Maybe we arent throwing the dog up high enough."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5766, 'Hunting jokes', 'A big-game hunter went on safari with his wife and mother-in-law. One evening, while still deep in the jungle, the Mrs awoke to find her mother gone. Rushing to her husband, she insisted on them both trying to find her mother. The hunter picked up his rifle, took a swig of whiskey, and started to look for her. In a clearing not far from the camp, they came upon a hilling sight: the mother-in-law was backed up against a thick, impenetrable bush, and a large male lion stood facing her. The wife cried, "What are we going to do?" "Nothing," said the hunter husband. "The lion got himself into this mess, let him get himself out of it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5767, 'Hunting jokes', 'A small village was troubled by a man-eating lion. So its leaders senta message to the great hunter, Jonesie, to come and kill the beast.For several nights the hunter lay in wait for the lion, but it never appeared. Finally, he told the village chief to kill a cow and give himits hide. Draping the skin over his shoulders, he went to the pasture towait for the lion.In the middle of the night, the villagers woke to the sound of blood-curdling shrieks coming from the pasture. As they carefully approached, they saw the hunter on the ground, groaning in pain. There was no sign of the lion."What happened, Jonesie? Where is the lion?" asked the chief."Forget the damn lion!" he howled. "Which one of you idiots let the bull loose?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5768, 'Hunting jokes', 'Two men were out hunting when one of them saw a rabbit. "Quick," said the first, "shoot it." "I cant," said the second. "My gun isnt loaded." "Well," said the first," you know that, and I know that, but the rabbit doesnt."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5769, 'Hunting jokes', 'Commissioned by a zoo to bring them some baboons, the big game hunter devised a novel scheme to trap them - his only requirements being a sack, a gun, and a particularly vicious and bad tempered dog. Once in the jungle he explained to his assistant, "Ill climb this tree and shake the branches; if there are any baboons up there, they will fall to the ground - and the dogs will bite their tail and immobilise them so that you can pick them up quite safely and put them in the sack." "But what do I need the gun for?" asked the assisant. "If I should fall out of the tree by mistake, shoot the dog."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5770, 'Hunting jokes', 'The big game hunter was showing his friends his hunting trophies. Drawing their attention to a lion skin rug on the floor he said, "I shot this fellow in Africa. Didnt want to kill such a magnificent beast, of course, but it was either him or me." "Well," said a guest, "he certainly makes a much better rug than you would!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5771, 'Hunting jokes', 'Whats a big game hunter? Someone whos lost his way to the match.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5772, 'Hunting jokes', 'Two Virginia boys, Sonny and Rick, went out hunting and split up. Sonny heard some rustling in the bushes and, by mistake, shot his friend. After trying to remove the bullet, he carried Rick to a doctor. Two hours later, after the physician had patched up the wounded hunter, Sonny asked, "Please, Doc. Hows my friend?" "Well," answered the M.D., "hed be a lot better off if you hadnt taken out his gut!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5773, 'Hunting jokes', 'A Cowboy was going deer hunting.. His blonde wife said she was going with him.. That they never did anything together.. So, they went.. He put her in a stand by herself.. Later in the morning he heard her shoot.. He went over to her stand and she was pointing her rifle at a guy with a cowboy hat on.. The guy was telling her, Mamm, you can have the deer you shot.. I just want to take my saddle off of him!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5774, 'Hunting jokes', 'An avid duck hunter was in the market for a new bird dog. His search ended when he found a dog that could actually walk on water to retrieve a duck. Shocked by his find, he was sure none of his friends would ever believe him. He decided to try to break the news to a friend of his, the eternal pessimist who refused to be impressed with anything. This, surely, would impress him. He invited him to hunt with him and his new dog. As they waited by the shore, a flock of ducks flew by. they fired, and a duck fell. The dog responded and jumped into the water. The dog, however, did not sink but instead walked across the water to retrieve the bird, never getting more than his paws wet. This continued all day long; each time a duck fell, the dog walked across the surface of the water to retrieve it. The pessimist watched carefully, saw everything, but did not say a single word. On the drive home the hunter asked \r \nhis friend, "Did you notice anything unusual about my new dog?" "I sure did," responded the pessimist. "He cant swim."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5775, 'Hunting jokes', 'A group of hunters fully equipped with rifles, ammo and camping supplies, came upon a young boy armed only with a slingshot. "What are you hunting for?" asked an older hunter. "I dont know. I aint seen it yet," said the boy.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5776, 'Hunting jokes', 'A big-game hunter came across a dinosaur in the middle of the jungle and stared at it surprise."Youre extinct," he said. The dinosaur was hard of hearing."What was that you said?" The hunter shouted at the top of his voice."You are extinct." The dinosaur looked a little nonplused. "So would you if youd been dead for six milion years."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5777, 'Hunting jokes', 'What is the best way to hunt bear ?With your clothes off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5778, 'Hunting jokes', 'Mike and Pat went hunting. Mike saw a large goose fly by. He raised his rifle to shoot.Dont waste your time, Pat hollered.The rifle is not loaded.I cant wait, Mike shouted back.The bird will be gone if I take the time to load!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5779, 'Hunting jokes', 'Dick and Bob were on a hunting trip. At nightfall, Dick complained, Weve been hunting all day. Weve shot at five deer - and not hit one!OK. Lets miss two more and then head back to camp, said Bob.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5780, 'Hunting jokes', 'What did the turkey say to the turkey hunter?"Quack! Quack! Quack!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5781, 'Hunting jokes', 'Two fathers and two sons went duck hunting. Each shot a duck but they shot only three ducks in all. How come?The hunters were a man, his son and his grandson.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5782, 'Hunting jokes', 'What is the best way to hunt bear? With your clothes off', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5783, 'Hunting jokes', 'What do you get if you cross a telephone with a hunting dog? A golden receiver!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5784, 'Hunting jokes', 'Whats the difference between a hunter and a fisherman?A hunter lies in wait. A fisherman waits and lies.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5785, 'Hunting jokes', 'The Wednesday-night church service coincided with the last day of hunting season. Our pastor asked who had bagged a deer. No one raised a hand. Puzzled, the pastor said, "I dont get it. Last Sunday many of you said you were were unable to make service because of hunting season. I had the whole congregation pray for your deer."One hunter groaned, "Well, it worked. Theyre all safe."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5786, 'Hunting jokes', 'Whats the easiest way for a Gorilla hunter to make money?Collect unemployment insurance!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5787, 'Hunting jokes', 'Did you hear about the bear hunter? Well, he was out hunting for bears one day, and soon came across a large, trophy sized bear. He raised his rifle and took careful aim. Just as he was about to pull the trigger, the bear turned and began tospeak to him!"Isnt it better to talk than to shoot? What do you want? Lets negotiate the matter," said the bear.Lowering his rifle in shock, the hunter thought a second, and then replied, "I want a fur coat."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5788, 'Hunting jokes', 'Two rednecks from Arkansas were out hunting. They decided to separate to get a better chance of catching something.The first redneck says to the other, "If you get lost, fire three shots into the air every hour. That way I can pinpoint you and find you."After about three hours, the second redneck finds he is really lost. He decides to fire three shots into the air as the first man told him. He then waits an hour and does it again. He repeats this until he is out of ammo.The next morning, the first redneck finds the second with the help of forest rangers. He asks the second redneck man if he did what he told him to do.The redneck answers, "Yes, I fired three shots into the air every hour on the hour until I ran out of arrows."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5789, 'Hunting jokes', 'Two hunters went moose hunting every winter without success. Finally, they came up with a fool-proof plan. They got a very authentic cow moose costume and learned the mating call of a cow moose. The plan was to hide in the costume, lure the bull, then come out of the costume and shoot the bull. They set themselves up on the edge of a clearing, donned their costume, and began to give the moose love call. Before long, their call was answered as a bull came crashing out of the forest and into the clearing. When the bull was close enough, the guy in front said, "Okay, lets get out and get him." After a moment that seemed like an eternity, the guy in the back shouted, "The zipper is stuck! What are we going to do!?" The guy in the front says, "Well, I dont know how about you but Im going to start nibbling grass."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5790, 'Hunting jokes', 'What does the lion say to his friends before they go out hunting for food ? Let us prey.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5791, 'Hunting jokes', 'A young reporter went to a retirement home to interview an aged but legendary explorer. The reporter asked the old man to tell him the most frightening experience he had ever had. The old explorer said, "Once I was hunting Bengal tigers in the jungles of India. I was on a narrow path and my faithful native gunbearer was behind me. Suddenly the largest tiger I have ever seen leaped onto the path in front of us. I turned to get my weapon only to find the native had fled. The tiger leapt toward me with a mighty ROARRRR! I soiled myself." The reporter said, "Under those circumstances anyone would have done the same." The old explorer said, "No, not then - just now when I went ROARRRR!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5792, 'Hunting jokes', 'A couple of hunters from Prague are out hunting, and an emormous bear runs up and in a single gulp devours one of the hunters. Miraculously, the swallowed hunter remained alive, trapped in the belly of the grizzly.The other hunter runs back to town and organizes a rescue party which heads back to the woods armed with torches, guns, spears, etc.Soon they spot two bears on the horizon and everybody starts shooting at the bear thats closest to them."No, not that one," shouts the surviving hunter, "Thats the female.""The Czech is in the male."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5793, 'Idiot and fool jokes', 'Fred: Do you think Im a fool? Harry: No. But whats my opinion against thousands of others?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5794, 'Idiot and fool jokes', 'Did you hear about the fool who keeps going round saying "no"? No. Oh, so its you!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5795, 'Idiot and fool jokes', 'A man went into a pet shop to buy a parrot. He was shown an especially fine one which he liked the look of, but he was puzzled by the two strings which were tied to its feet. "What are they for?" he asked the pet shop manager. "Ah well, sir," came the reply, "thats a very unusual feature of this particular parrot. You see, hes a trained parrot, sir, he used to be in the circus. If you pull the string on his left foot he says Hello and if you pull the string on his left foot he says Goodbye." "And what happens if you pull both strings at once?" "I fall off my perch, you fool!" screeched the parrot.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5796, 'Idiot and fool jokes', 'How does an idiot call for his dog? He puts two fingers in his mouth and then shouts Rover.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5797, 'Idiot and fool jokes', 'Did you hear about the idiot who made his chickens drink boiling water? He thought they would lay hard boiled eggs.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5798, 'Idiot and fool jokes', 'Did you hear about the village idiot buying bird seed? He said he wanted to grow some birds.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5799, 'Idiot and fool jokes', 'I cant understand the critics saying that only an idiot would like that television program. I really enjoyed it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5800, 'Idiot and fool jokes', 'What do you get when you cross an idiot with a watch? A cuckoo clock.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5801, 'Idiot and fool jokes', 'Why did the idiot plant nickels in his garden? He wanted to raise some hard cash.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5802, 'Idiot and fool jokes', 'Two men were knocking in nails to the sides of a house, one of them kept throwing them away."Why do you keep throwing nails away" said the other."Because they have the point at the wrong end", he replied"You fool, we could use those on the other side of the house!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5803, 'Idiot and fool jokes', 'What did the stupid ghost do? He used to climb over walls.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5804, 'Idiot and fool jokes', 'What do you call a stupid skeleton? Bonehead.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5805, 'Idiot and fool jokes', 'Did you hear about the stupid wizard? He couldnt remember if he used to be forgetful.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5806, 'Idiot and fool jokes', 'Did you hear about the stupid woodworm? He was found in a brick.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5807, 'Idiot and fool jokes', 'What do stupid kids do at Halloween? They carve a face on an apple and go bobbing for pumpkins.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5808, 'Idiot and fool jokes', 'A stupid glazier was examining a broken window. He looked at it for a while and then said, "Its worse than I thought. Its broken on both sides."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5809, 'Idiot and fool jokes', 'My friend is so stupid that he thinks twice before saying nothing.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5810, 'Idiot and fool jokes', 'Did you hear about the stupid photographer?He saved burned out lightbulbs for use in his darkroom.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5811, 'Idiot and fool jokes', 'I dont know what it is that makes you stupid but whatever it is, it works.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5812, 'Idiot and fool jokes', 'My friend is so stupid he thinks that an autograph is a chart showing sales figures for cars.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5813, 'Idiot and fool jokes', 'An idiotic laborer was told by an equally idiotic foreman to dig a hole in the road. "And what shall I do with the earth, sir?" asked the laborer. "Dont be daft, man," he replied. "Just dig another hole and bury it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5814, 'Idiot and fool jokes', 'A stupid man was struggling out of his house with a big table. His neighbor said to him, "Hello, Harry. Where are you going with that then?" And Harry replied, "Im taking it to the store to have it measured for a new tablecloth."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5815, 'Idiot and fool jokes', 'An Irishman saw a notice outside a police station which read: MAN WANTED FOR ROBBERY. So he went in and applied for the job!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5816, 'Idiot and fool jokes', 'Did you hear about the idiot who invented the one-piece jigsaw puzzle?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5817, 'Idiot and fool jokes', 'What do you call an alien starship that drips water? A crying saucer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5818, 'Idiot and fool jokes', 'Teacher: Thats the stupidest boy in the whole school. Mother: Thats my son. Teacher: Oh! Im so sorry. Mother: Youre sorry?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5819, 'Idiot and fool jokes', 'How do you confuse an idiot? Give him two spades and ask him to take his pick.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5820, 'Idiot and fool jokes', 'A man in a swimming pool was on the very top diving board. He poised, lifted his arms, and was about to dive when the attendant came running up, shouting, "Dont dive ? theres no water in that pool!" "Thats all right," said the man. "I cant swim!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5821, 'Idiot and fool jokes', 'Did you hear about the stupid water-polo player?His horse drowned . . .', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5822, 'Idiot and fool jokes', 'Fred: Did you hear about the Irish window cleaner who put a sign at the top of his ladder? Harry: What did the sign say? Fred: Stop.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5823, 'Idiot and fool jokes', 'Q: How many idiots who ask stupid questions does it take to screw in a light bulb? A: Change it to what?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5824, 'Idiot and fool jokes', 'Housekeeper: Professor, theres a bill collector at the door. I told him you were out. But he wouldnt believe me. Professor: No? Then I suppose Ill have to go and tell him myself.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5825, 'Idiot and fool jokes', '"Say, your house is burning.""Thats okay. I got enough lumber in the attic to build a new one."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5826, 'Idiot and fool jokes', 'Loomis: Does your dog have a license? Fenton: Hell, no! I do all the drivin.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5827, 'Idiot and fool jokes', 'Did you hear about the dumb father who got up and struck a match to see if he had blown out the candle?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5828, 'Idiot and fool jokes', 'Personnel Director: What would you do if you broke your arm in two places? Vanderkron: I wouldnt go to these places no more!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5829, 'Idiot and fool jokes', 'Did you hear about the dimwit who was so dumb he thought Gatorade was welfare for crocodiles?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5830, 'Idiot and fool jokes', '"Can you read Chinese?" "Yes, but only when its printed in English."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5831, 'Idiot and fool jokes', 'Hatton: I aint as dumb as I look! Folsom: You couldnt be!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5832, 'Idiot and fool jokes', 'Did you hear about the rookie Rhode Island cop who gave out twenty-two parking tickets before he found out he was at a drive-in movie?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5833, 'Idiot and fool jokes', 'Hoot: How the hell can ya be so stupid? Jessie: Well, it aint somethin yew can pick up overnight.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5834, 'Idiot and fool jokes', 'Holton sat down in a Green Bay restaurant and said to the waitress, "Do you know whether the milk from this dairy is pasteurized?" "Sure is!" she answered. "Every morning they turn the cows out to pasture."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5835, 'Idiot and fool jokes', 'Did you hear about the dimwit who went to visit his girlfriend and found she didnt have very much on? He went back nine months later and she had a little moron.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5836, 'Idiot and fool jokes', 'What has eight legs and an IQ of forty? Four guys watching a baseball game.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5837, 'Idiot and fool jokes', 'Young Bradley arrived at his dates house wearing a shirt that had water dripping from it. "Whatre you doin?" asked his girlfriend. "How come your shirt is soakin wet?" "Well," said Bradley, "it said on the label: WASH AND WEAR."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5838, 'Idiot and fool jokes', 'Calvin went to Pearsons Pet Shop to complain that his canary wouldnt sing. "File the beak just a little," said the owner, "and the bird will sing. But if you file it too much, the canary will die." Two weeks later Pearson ran into Calvin on the street and asked about his canary. "He died," said Calvin. "But I told you not to file the beak too much." "I didnt," explained Calvin, "but by the time I got him out of the vise, he was already dead."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5839, 'Idiot and fool jokes', 'Guidry called in Plotke, the painter, for an estimate to paint his house. "How much you gonna charge me?" asked Guidry. "Twenty dollars an hour," replied Plotke. "Good Lord!" exclaimed the home owner. "I wouldnt pay Michelangelo that price!" "I tell you one thing, mister," said the painter. "If that guy you mentioned is doin the job for less, he aint no member of our union!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5840, 'Idiot and fool jokes', 'Delmer: Howd you like the play last night over at the high school? Parley: I only seed the first act, but not the second. Delmer: Why didnt you stay? Parley: I couldnt wait that long. It said on the program, Two Years Later.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5841, 'Idiot and fool jokes', 'Edney and Cole, two Ohio Edison electrical repairmen, were working on a blown house circuit. "Hey, Cole!" said Edney. "See those two wires?" "Sure," Cole answered. "Now just grab one of them." Cole grabbed one of the wires. "Feel anything?" asked his partner. "Not a thing," answered Cole. "Good!" said Edney. "Dont touch the other one or youll drop dead!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5842, 'Idiot and fool jokes', 'Duayne met Patricia Ann from Birmingham at a Tus-caloosa ballroom. They danced every dance together. When the evening was over, he asked if he could see her next time he was in town. "Yes," replied Patricia Ann shyly. The young man hurriedly took out his pad and pencil and asked, "Whats your number?" "CApitol 4-6173." After a long embarrassed pause, Duayne asked, "How do yew make a capital 4?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5843, 'Idiot and fool jokes', 'Rigby drove into the city with his girl to catch their first play at a theater. Rigby rushed up to the box office and said, "Gimme two tickets for tonights show." "Sorry," said the box office attendant. "There are no seats left. We have only two standing rooms left." "Well, Ill be hog tied! Only two left in standing room!" said the farm boy. "Are they together?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5844, 'Idiot and fool jokes', 'Tyfus applied for a job in a factory. The company doctor who was giving him a physical asked, "Have your eyes ever been checked?" "No," said the worker. "Theyve always been brown."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5845, 'Idiot and fool jokes', 'Chaffee could talk on any subject whether he knew anything about it or not. Mostly he didnt. One day his neighbor Nibley could stand no more. "Do you realize," asked Nibley, "that you and I know all there is to be known?" "Do you really think so?" said Chaffee. "How do you figure that?" "Easy," answered Nibley. "You know everything except that youre a damn idiot. And I know that!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5846, 'Idiot and fool jokes', 'Wyatt, Milford and Calhoun were standing one on top of the other trying to measure a flag pole. A man passing by yelled up to them, "Why dont you guys just take down the pole, lay it down on the ground and measure it?" "We dont wanna measure the length, mister!" Wyatt sneered. "We wanna measure the height!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5847, 'Idiot and fool jokes', 'Shingles were loose on Pennocks roof, and he complained about leaks to Barton, his neighbor. "Why dont you mend the roof?" asked Barton. "I cant today," Pennock replied. "Its pouring rain.""Well, why dont you patch it in dry weather." "It dont leak then!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5848, 'Idiot and fool jokes', 'An army sergeant told Private Perkins to go to the end of the line. He did, but then returned. "I thought I told you to go to the end of the line," barked the NCO. "Why did you come back?" "Because theres already somebody there!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5849, 'Idiot and fool jokes', 'Henderson bought a new car and, after he left the showroom, decided to catch a movie. When he came out, Henderson noticed hed locked the car and left the keys in the ignition. He telephoned the dealer. "Which is the cheapest window to break?" he asked. "You dont have to break any of the windows," explained the dealer. "Ill come right down with another key and we can open it together." "No, no!" shouted the new car owner. "I gotta know now! Its about to rain and I wanna put the top up!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5850, 'Idiot and fool jokes', 'Did you hear about the dumb father who returned from lunch and saw a sign on his door, "Back in 30 minutes," so he sat down to wait for himself?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5851, 'Idiot and fool jokes', 'Did you hear about the Iranian terrorist who switched off the fans of his stolen helicopter because he couldnt stand the draft?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5852, 'Idiot and fool jokes', 'The Albanian planted lightbulbs in his garden. He heard that tulips grew from bulbs.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5853, 'Idiot and fool jokes', 'Why are Canadians given only a half hour for lunch? They dont want to have to retrain them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5854, 'Idiot and fool jokes', 'Did you hear about the guy from Newfoundland who was twenty-two years old before he knew which part of the olive to throw away?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5855, 'Idiot and fool jokes', 'And then there was the Newfie who was found dead in his jail cell with twelve bumps on his head. Hed tried to hang himself with a rubber band.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5856, 'Idiot and fool jokes', 'Did you hear about the Finn who spent a fortune building a storm cellar in case there was an earthquake.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5857, 'Idiot and fool jokes', 'Why does the Philippines ban rectal thermometers? They cause too much brain damage.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5858, 'Idiot and fool jokes', 'Did you hear about the Mexican bricklayer who went crazy trying to lay a cornerstone in a roundhouse.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5859, 'Idiot and fool jokes', 'Did you hear about the Puerto Rican secretary who was getting so experienced she could type twenty mistakes a minute?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5860, 'Idiot and fool jokes', 'Then there was the Puerto Rican surgeon who made medical history. He performed the first appendix transplant.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5861, 'Idiot and fool jokes', 'Why did Rudolfo salute the box of Cornflakes in the supermarket? Because the label said General Foods.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5862, 'Idiot and fool jokes', 'How does a Russian Aeroflot pilot navigate? By reading street signs.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5863, 'Idiot and fool jokes', 'Carmella and Mario were out on their first date. "Have you ever read Shakespeare?" asked Carmella. "No," said Mario. "Who wrote it?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5864, 'Idiot and fool jokes', 'Iraq has just ordered two thousand septic tanks from Russia. As soon as the Iraqis learn to drive them, they are going to invade Iran.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5865, 'Idiot and fool jokes', 'Why cant the Philippines field an ice hockey team? The players all drowned in spring training.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5866, 'Idiot and fool jokes', 'How do Filipinos count money? One-a, two-a, three-a, four-a, another-a ...', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5867, 'Idiot and fool jokes', 'What do Filipinos call Canada? Upper U.S.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5868, 'Idiot and fool jokes', 'Did you hear about the Irishman who tried to swim the English channel? Halfway across he decided he couldnt make it so he swam back.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5869, 'Idiot and fool jokes', 'Doctor: That deafness cure help your brother? Archie: Sure did! He hadnt heard a sound in years, and the very day after he took that medicine, he heard from America!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5870, 'Idiot and fool jokes', '"What did Shawn like most about his trip to Paris?" "He said it was lovely to hear the French pheasants singing the Mayonnaise."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5871, 'Idiot and fool jokes', 'Did you hear about the Baton Rouge bride who cancelled the wedding when she heard her friends were planning to give her a shower?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5872, 'Idiot and fool jokes', 'Did you hear about the Georgia accountant who absconded with all the accounts payable?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5873, 'Idiot and fool jokes', 'Did you hear about the Omaha mother who got tired of putting name tags on her sons shirts, so she had his name legally changed to "Machine Washable"?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5874, 'Idiot and fool jokes', '"How come youre only watering half your lawn?" a perplexed tourist asked a Richmond resident. "I just heard there was a fifty percent chance of rain."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5875, 'Idiot and fool jokes', 'Did you hear about the Texan who moved to Oklahoma and raised the IQ level of both states?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5876, 'Idiot and fool jokes', 'Did you hear about the Montana moron who went looking for a gas leak with a safety match?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5877, 'Idiot and fool jokes', 'Did you hear about the Murfreesboro muddlebrain whose father told him about the birds and the bees? The next day, the Tennessean was stung by a bee and thought he was pregnant.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5878, 'Idiot and fool jokes', 'How do Alaska CB radio operators say "10-4"? "5-5-2-2."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5879, 'Idiot and fool jokes', 'Treadwell walked into a Biloxi stationery store and asked, "Have you got any invisible ink?" "Certainly sir," said the owner. "What color?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5880, 'Idiot and fool jokes', 'Did you hear about the Brooklyn bubblebrain who was two hours late for work because the escalator got stuck?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5881, 'Idiot and fool jokes', 'The teacher asked a Louisiana teenager to count to five. The youngster proceeded to count to five on his fingers. Then the teacher asked, "Can you count any higher?" The boy raised his hands over his head and counted to five again.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5882, 'Idiot and fool jokes', 'Kowalski and Janzek left Hamtramack and went out in the woods looking for Christmas trees. They looked all day without any luck. Near nightfall Kowalski finally said, "Janzek, Im takin the next tree we come to, whether it has lights on it or not!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5883, 'Idiot and fool jokes', 'Did you hear about the hillbilly who asked his friends to give him their burnt-out light bulbs. He wanted to start a dark room.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5884, 'Idiot and fool jokes', 'Four Independence boys, Pugh, Sumter, Kilby and Grayson, were walking down a Clay County road when they came to a high, solid brick wall. Wondering what was behind it, Pugh, Sumter and Kilby boosted Grayson so he could take a look. "Looks like one of them nudist camps," reported Grayson. "Men or women?" asked Pugh. "Cant tell," said Grayson. "They dont have no clothes on."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5885, 'Idiot and fool jokes', 'Titus was on a Knoxville elevator with several other people. As the elevator moved up, he stared at the small fan revolving slowly in the elevator ceiling. "Its amazing," he said to the other people, "that such a small fan could lift all these people!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5886, 'Idiot and fool jokes', 'Did you hear about the idiot who planted Cheerios in his backyard? He thought they were donut seeds.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5887, 'Idiot and fool jokes', 'Did you hear about the Oklahoma idiot who married an American Indian? They had a baby and wanted to name it to reflect both races. So they called it Running Dummy.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5888, 'Idiot and fool jokes', 'Slim walked into his local post office and noticed a new sign on the wall: MAN WANTED FOR ROBBERY IN MONTANA "Gosh!" he said, "If n only that job was in Texas, Ahd take it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5889, 'Idiot and fool jokes', 'Did you hear about the idiot who filled out an employment application? In the blank labeled "Church Preference" he filled in: Red brick.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5890, 'Idiot and fool jokes', 'Why did the idiot drive his pickup truck over the side of the cliff? He wanted to try out his new air brakes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5891, 'Idiot and fool jokes', '"Why do rednecks act like such morons? "Who says theyre acting?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5892, 'Idiot and fool jokes', 'Jett was trying to light a match. He struck the first one and it didnt work, so he threw it away. He struck the second match. That didnt work either, so he tossed it. Jett struck the third one and it lit up. "Thats a good one!" said the idiot, blowing it out. "Ahm gonna save it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5893, 'Idiot and fool jokes', 'IRS Agent: Whats all this? Bracken: Well, you told me to bring all my records with me and I did. Heres some by Willie Nelson, Tammy Wynette, and Garth Brooks . . .', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5894, 'Idiot and fool jokes', 'Melburn was strolling along downtown Natchez with a framed picture under his arm. "Hey, what yew got there?" asked a neighbor. "I dunno much bout art," replied Melburn, "but Ah just bought me an original Michelangelo for two hundred dollars! Its one of the few he ever did in ballpoint!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5895, 'Idiot and fool jokes', 'When a small Montana village decided to buy a new fire truck, the town council met to decide what to do with the old one. Randall, an old rancher, stood up. "Ah think we should keep the old truck," he said."We can use it for all them false alarms!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5896, 'Idiot and fool jokes', 'Zack and Tybe, two Alabama farm boys, bought themselves a truckload of watermelons for a buck apiece. They sold each one for a dollar. After counting up their cash, they realized theyd wound up with the same amount of money theyd started out with. "See!" said Tybe. "Ah told yew we shoulda got a bigger truck!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5897, 'Idiot and fool jokes', 'Mayne and Willard, two idiots, were in a rowboat on a lake fishing. Suddenly the spray from a motorboat racing by flooded their boat. "How we gonna get the water out?" asked Mayne. "Easy," said Willard. "We just bore a hole in the bottom of the boat and let the water drain out." The men drilled a hole in the bottom, and more water started rushing in. "Wait a minute!" exclaimed Mayne. "We need another hole sos the water comin in through the first one has a place to go back into the lake!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5898, 'Idiot and fool jokes', 'Izzard went into a Baltimore bank to cash his check. Since he didnt have an account there, the teller asked if he could identify himself. "Sure," said Izzard. "There a mirror around here?" "Theres one on the wall right beside you," said the clerk. Izzard took a glance in the mirror and heaved a sigh of relief. "Yep!" he said. "Its me, all right!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5899, 'Idiot and fool jokes', 'The July temperature in Joplin climbed over the one hundred mark. Despite the scorching heat, Bozell was outside painting his house. A passerby stopped for a moment to watch him and then asked, "How cum yer wearin two jackets?" " Cause," said the redneck, "the directions on the can say ta put on two coats!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5900, 'Idiot and fool jokes', 'Kennen was having a drink in a saloon when his neighbor, Stakely, came rushing in. "Ah think somebodys stealin yore pickup truck!" the man said breathlessly. Kennan ran outside, but came back right away. "Well, did yew stop him?" asked Stakely. "Naw!" said the redneck. "He was too fast. But Ah got his license plate before he got away!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5901, 'Idiot and fool jokes', 'During a break on a North Dakota office building project, one of the construction workers approached Pyle. "Ah heard the boys is gonna strike," he said. "What fer?" asked Pyle. "Shorter hours." "Good fer them!" said the redneck. "Ah always did think sixty minutes was too long fer an hour!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5902, 'Idiot and fool jokes', 'Police in Oakland, California spent two hours attempting to subdue a gunman who had barricaded himself inside his home. After firing ten tear gas canisters, officers discovered that the man was standing beside them, shouting please to come out and give himself up.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5903, 'Idiot and fool jokes', 'I live in a semi-rural area. We recently had a new neighbor call the local township administrative office to request the removal of the Deer Crossing sign on our road. The reason: Many deer were being hit by cars and he no longer wanted them to cross there.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5904, 'Idiot and fool jokes', 'My neighbor works in the operations department in the central office of a large bank. Employees in the field call him when they have problems with their computers. One night he got a call from a woman in one of the branch banks who had this question: "Ive got smoke coming from the back of my terminal. Do you guys have a fire downtown?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5905, 'Idiot and fool jokes', 'I was sitting in my science class, when the teacher commented that the next day would be the shortest day of the year. My lab partner became visibly excited, cheering and clapping. I explained to her that the amount of daylight changes, not the actual amount of time. Needless to say, she was very disappointed.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5906, 'Idiot and fool jokes', 'My daughter went to a local Taco Bell and ordered a taco. She asked the individual behind the counter for "minimal lettuce." He said he was sorry, but they only had iceberg.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5907, 'Idiot and fool jokes', 'Police in Radnor, Pennsylvania, interrogated a suspect by placing a metal colander on his head and connecting it with wires to a photocopy machine. The message "Hes lying" was placed in the copier, and police pressed the copy button each time they thought the suspect wasnt telling the truth. Believing the "lie detector" was working, the suspect confessed.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5908, 'Idiot and fool jokes', 'Jim sees his neighbor out back building a bunker, loading in 75 gallons of bottled water, hauling in a gas generator and so on. "So, uh, I guess you believe Y2K is a biggie huh?" "Naw", says the neighbor. "Ahs jes stockin the bunker now, cuz if I did it any other time, peopled think ahs nuts."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5909, 'Idiot and fool jokes', 'Swedish business consultant Ulf af Trolle labored 11 years on a book about Swedish economic solutions. He took the 175-page manuscript to be copied, only to have it reduced to 25,000 strips of paper in seconds when a worker confused the copier with the shredder.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5910, 'Idiot and fool jokes', 'According to the Knight-Ridder News Service, the inscription on the metal bands used by the U.S. Department of the Interior to tag migratory birds has been changed. The bands used to bear the address of the Washington Biological Survey, abbreviated, "Wash. Biol. Surv." until the agency received the following letter from an Arkansas camper: "Dear Sirs: While camping last week I shot one of your birds. I think it was a crow. I followed the cooking instructions on the leg tag and I want to tell you it was horrible."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5911, 'Idiot and fool jokes', 'He is so dumb, he thinks an agent is someone who keeps track of your age!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5912, 'Idiot and fool jokes', 'Why did the stupid boy wear a turtle neck sweater?To hide his flea collar.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5913, 'Idiot and fool jokes', 'A boy went into the local department store where he saw a sign on the escalator - Dogs must be carried on this escalator.The boy then spent the next tow hours looking for a dog.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5914, 'Idiot and fool jokes', 'A silly boy spent the afternoon with some friends, but when the time came for him to leave, a terrific storm started with thunder, lightning and torrential rain.You cant go home in this, said one of his friends,  youd better stay the night.Thats very kind of you, said the boy.  Ill just run home and get my pyjamas.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5915, 'Idiot and fool jokes', 'My friend is so silly that he spent two weeks in a revolving door looking for the doorknob!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5916, 'Idiot and fool jokes', 'Sister: Why are you putting the saddle on backward ? Brother: How do you know which way Im going ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5917, 'Idiot and fool jokes', 'A guy walking down a street one afternoon passes an old man sitting on the side of the road with a large sack.The younger guy says to the old man, "Watcha got in the sack?"The old man responds, "I got some monkeys in that there sack."The younger man asks, "If I guess how many monkeys you got in the sack, can I keep one?"The old man replies, "Son, if you guess how many monkeys I got in this sack, Ill give you both of em!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5918, 'Idiot and fool jokes', 'Why did Silly Sue throw her guitar away ?Because it had a hole in the middle.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5919, 'Idiot and fool jokes', 'Did you hear about the stupid Kamikaze pilot ?He flew 57 missions !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5920, 'Idiot and fool jokes', 'Why did the idiot have his sundial floodlit ?So he could tell the time at night !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5921, 'Idiot and fool jokes', 'How do you keep an imbecile happy all his life ?Tell him a joke when hes a baby !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5922, 'Idiot and fool jokes', 'Why did the Aggie call 911 in the car wash?- He thought he saw the rotating car washer as a tornado', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5923, 'Idiot and fool jokes', 'An Illinois man pretending to have a gun kidnapped a motorist and forced him to drive to two different automated teller machines. The kidnapper then proceeded to withdraw money from his own bank accounts.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5924, 'Idiot and fool jokes', 'A 9-year-old boy in Manassas, Virginia received a one-day suspension under his elementary schools drug policy last week - for Certs! Joey Hoeffer allegedly told a classmate that the mints would make him "jump higher."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5925, 'Idiot and fool jokes', 'A student in Belle, West Virginia was suspended for three days for giving a classmate a cough drop. School principal Forest Mann reiterated the schools "zero-tolerance" policy...not to be confused with the "zero-intelligence" policy.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5926, 'Idiot and fool jokes', 'Fire investigators on Maui have determined the cause of a blaze that destroyed a $127,000 home last month - a short in the homeowners newly installed fire prevention alarm system. "This is even worse than last year," said the distraught homeowner, "when someone broke in and stole my new security system..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5927, 'Idiot and fool jokes', 'After interviewing a particularly short-spoken job candidate, I described the person to my boss as rather monosyllabic. My boss said, "Really? Where is Monosyllabia?". Thinking that he was just kidding, I played along and said that it was just south of Elbonia. He replied, "Oh, you mean over by Croatia?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5928, 'Idiot and fool jokes', 'Q: Did you hear about the 25 Irish people that drowned? A: They were riverdancing.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5929, 'Idiot and fool jokes', 'Q: Have you heard about the Irish abortion clinic? A: Theres a 12-month waiting list.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5930, 'Idiot and fool jokes', 'Two newfies walked into a pet store. The first says "I want four budgies." Salesman-certainly sir, would you like two male and two female or all male or all female? Newfie-I dont care. I just want 4 budgies! Salesman-certainly sir, what color would you like? We have yellow, blue, gr... Newfie - I dont care what color they are, just put four budgies in a box for me. Is that too hard? Salesman - O.K. O.K. The two newfies pay for the budgies and leave. They drive out to this high cliff in Newfoundland and the first newfie reaches in the box and pulls out two of the birds, grasps them firmly and jumps off the cliff while flapping his arms. Of course he SPLATS at the bottom. The second newfie looks down at his friends twisted remains and says "What a shame. this budgie jumping isnt all its cracked up to be!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5931, 'Idiot and fool jokes', 'QUESTION: Why does the town idiot take his bedroom door off the hinges and put it to the sid every night when he goes to sleep? ANSWER: Because hes afraid someone would look through the keyhole.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5932, 'Idiot and fool jokes', 'What did the idiot do to the flea in his ear? Shot it!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5933, 'Insect jokes', 'What do you call a bee whos had a spell put on him ?Hes bee-witched !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5934, 'Insect jokes', 'Q: What kind of suit does a bee wear to work?A: A buzzness suit!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5935, 'Insect jokes', 'What has four wheels and flies ?A rubbish bin !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5936, 'Insect jokes', 'What lives in gum trees ?Stick insects !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5937, 'Insect jokes', 'What is the biggest ant in the world ?An elephant !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5938, 'Idiot and fool jokes', 'One idiot said to the other, "You know, there are really only three kinds of people in the world: those who can count, and those who cant.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5939, 'Idiot and fool jokes', 'There were two guys working for the city. One would dig a hole -- he would dig, dig, dig.The other would come behind him and fill the hole -- fill, fill, fill. These two men worked furiously; one digging a hole, the other filling it up again.A man was watching from the sidewalk and couldnt believe how hard these men were working, but couldnt understand what they were doing. Finally he had to ask them.He said to the hole digger, "I appreciate how hard you work, but what are you doing? You dig a hole and your partner comes behind you and fills it up again!"The hole digger replied, "Oh yeah, must look funny, but the guy who plants the trees is sick today."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (5940, 'Idiot and fool jokes', 'An idiot decided to start a chicken farm, so he bought a hundred chickens to start. A month later, he returned to the dealer for another hundred chickens because all of the first lot had died. A month later he was back at the dealers for another hundred chickens for the second lot had also died. "But I think I know where Im going wrong," said the idiot. "I think I am planting them too deep."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
