INSERT INTO `jokes` VALUES (6227, 'Journalist jokes', 'George W. Bush is seen crossing the Potomac river on foot.The Washington Post : "President Bush crosses the Potomac River".The Washington Time : "Bushs conservative approach saves taxpayers a boat".Mother Jones : "Bush cant swim".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6228, 'Journalist jokes', 'A shy guy goes into a bar and sees a beautiful woman sitting at the bar. After an hour of gathering up his courage, he finally goes over to her and asks tentatively. "Would you mind if I chatted with you for a while?"To which she responds by yelling, at the top of her lungs, "No, I wont sleep with you tonight!"Everyone in the bar is now staring at them. Naturally, the guy is hopelessly and completely embarrassed and he slinks back to his table. After a few minutes, the woman walks over to him and apologizes. She smiles at him and says, "Im sorry if I embarrassed you. You see, Im a journalist and Ive got an assignment to study how people respond to embarrassing situations."To which he responds, at the top of his lungs, "What do you mean $200?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6229, 'Journalist jokes', 'A Soviet journalist walks into the hospital and tells the desk nurse, "I want to see the eye-ear doctor.""There is no such doctor" she tells him. "Perhaps you would like to see someone else?""No, I need to see an eye-ear doctor," he says."But there is no such doctor," she replies. "We have doctors for the eyes and doctors for the ear, nose and throat, but no eye-ear doctor."No help. He repeats, "I want to see the eye-ear doctor."They go around like this for a few minutes and then the nurse says: "Comrade, there is no eye-ear doctor, but if there were one, why would you want to see him?""Because," he replies, "I keep hearing one thing and seeing another."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6230, 'Journalist jokes', 'A film crew was on location deep in the desert. One day an old Indian went up to the director and said, "Tomorrow rain." The next day it rained. A week later, the Indian went up to the director and said, "Tomorrow storm." The next day there was a hailstorm."This Indian is incredible," said the director. He told his secretary to hire the Indian to predict the weather. However, after several successful predictions, the old Indian didnt show up for two weeks. Finally the director sent for him. "I have to shoot a big scene tomorrow," said the director, "and Im depending on you. What will the weather be like?"The Indian shrugged his shoulders. "Dont know," he said. "Radio is broken."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6231, 'Journalist jokes', 'A newsboy was standing on the corner with a stack of papers, yelling, "Read all about it. Fifty people swindled! Fifty people swindled!"Curious, a man walked over, bought a paper, and checked the front page. Finding nothing, the man said, "Theres nothing in here about fifty people being swindled."The newsboy ignored him and went on, calling out, "Read all about it. Fifty-one people swindled!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6232, 'Journalist jokes', 'How many journalists does it take to change a light bulb?"We just report the facts, we dont change them."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6233, 'Journalist jokes', 'How many journalists does it take to change a light bulb?"We just report the facts, we dont change them." Three. One to report it as an inspired government program to bring light to the people, one to report it as a diabolical government plot to deprive the poor of darkness, and one to win a Pulitzer prize for reporting that Electric Company hired a light bulb assassin to break the bulb in the first place.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6234, 'Journalist jokes', 'How many computer journalists does it take to screw in a light bulb?Five. One to write a review of all the existing light bulbs so you can decide which one to buy, another one to write a remarkably similar one in another magazine the next month, a third to have a big one come out on glossy paper two months later that is by then completely out of date, a fourth to hint in her column that a completely new and updated bulb is coming out, and the fifth to report a rumor that that new bulb is shipping with a virus.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6235, 'Journalist jokes', 'How many editors does it take to change a light bulb?Only one, but first he has to rewire the entire building.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6236, 'Journalist jokes', 'A journalist assigned to the Jerusalem bureau takes an apartment overlooking the Wailing Wall. Every day when she looks out, she sees an old Jewish man praying vigorously. So the journalist goes down and introduces herself to the old man. She asks: "You come every day to the wall. How long have you done that and what are you praying for?"The old man replies, "I have come here to pray every day for 25 years. In the morning I pray for world peace and then for the brotherhood of man. I go home have a cup of tea and I come back and pray for the eradication of illness and disease from the earth."The journalist is amazed. "How does it make you feel to come here every day for 25 years and pray for these things?" she asks.The old man looks at her sadly. "Like Im talking to a wall."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6237, 'Journalist jokes', 'A woman telephoned her local newspaper to let them know that she had just given birth to eighteen children. The reporter didnt quite hear the message and said, "Would you repeat that?" "Not if I can help it," replied the woman.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6238, 'Journalist jokes', 'Reporter: My editor sent me to do the burglary. Policeman: Youre too late - its already been done.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6239, 'Journalist jokes', 'Reporter: To what do you attribute your old age?Old Man: To the fact that I was born in 1890.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6240, 'Journalist jokes', 'Reporter: What made you go out on that dangerous pond ice and risk your life to save a friend?Boy Hero: I had to do it. He had my skates on.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6241, 'Journalist jokes', 'Q: How many journalists does it take to screw in a lightbulb? A: Three. One to report it as an inspired government program to bring light to the people, one to report it as a diabolical government plot to deprive the poor of darkness, and one to win a pulitzer prize for reporting that Electric Company hired a lightbulb assassin to break the bulb in the first place.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6242, 'Journalist jokes', 'Why did the nutty kid throw butter out of the window? He wanted to see a butterfly.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6243, 'Journalist jokes', 'What do you get if you cross a sports reporter with a vegetable ?A common tater !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6244, 'Journalist jokes', 'What do you get if you cross a newsreader and a toad ?A croaksman !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6245, 'Journalist jokes', 'What do you get if you cross a ghost and a newsreader ?A spooksman !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6246, 'Journalist jokes', 'What do you get if you cross a radio music presenter with Match of the Day ?DDDDDDDDDDDDDJ !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6247, 'Journalist jokes', 'A weather forecaster took a job in another part of the country. When asked why he transferred he replied, "The weather didnt agree with me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6248, 'Journalist jokes', 'An honest weatherman says, "Todays forecast is bright and sunny with an 80% chance that Im wrong."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6249, 'Journalist jokes', 'Who do you think was sent to cover the story of the baby lion born in the zoo? A cub reporter.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6250, 'Journalist jokes', 'Q: How many publishers does it take to change a lightbulb? A: Three. One to screw it in and two more to hold down the editor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6251, 'Journalist jokes', 'Q: How many editors does it take to change a lightbulb?A: It was supposed to be in place last week!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6252, 'Judge jokes', 'The Judge asked the defendant, "Mr. Jones ,do you understand that you have sworn to tell the truth, the whole truth and nothing but the truth?""I do.""Now what do you say to defend yourself?""Your Honor, under those limitations... nothing."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6253, 'Judge jokes', 'The judge said to his dentist: "Pull my tooth, the whole tooth and nothing but the tooth."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6254, 'Judge jokes', 'Judge: "Is it true that you owe your neighbor a thousand dollars?"Defendant: "Yes, its true."Judge: "Then, why dont you just pay him back?"Defendant: "Because it wouldnt be true anymore."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6255, 'Judge jokes', 'People who love sausage and respect the law should never watch either being made.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6256, 'Judge jokes', 'A young woman was appearing in court to face a public disorder charge. The charges were read out, and she was asked how she pleaded. "Not guilty," the woman answered emphatically.The prosecution council then approached the woman and said: "Is it true that on the 11th of December, last year, you committed an act of gross indecency with a one-legged dwarf - who was waving a union jack - on the roof of a car, whilst travelling at over 100mph through the center of London, in a blizzard?"The woman composed herself, looked straight at the prosecution council and calmly said: "What was the date again?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6257, 'Judge jokes', 'A prosecuting attorney called his first witness, a grandmotherly, elderly woman, to the stand. He approached her and asked, "Mrs. Jones, do you know me?"She responded, "Why, yes, I do know you Mr. Williams. Ive known you since you were a young boy. And frankly, youve been a big disappointment to me. You lie, you cheat on your wife, you manipulate people and talk about them behind their backs. You think youre a rising big shot when you havent the brains to realize you never will amount to anything more than a two-bit paper pusher. Yes, I know you."The lawyer was stunned. Not knowing what else to do he pointed across the room and asked, "Mrs. Williams, do you know the defense attorney?"She again replied, "Why, yes I do. Ive known Mr. Bradley since he was a youngster, too. I used to baby-sit him for his parents. And he, too, has been a real disappointment to me. Hes lazy, bigoted,  he has a drinking problem. The man cant build a normal relationship with anyone and his law practice is one of the shoddiest in the entire state. Yes, I know him."At this point, the judge rapped the courtroom to silence and called both counselors to the bench. In a very quiet voice, he said with menace, "If either of you asks her if she knows me, youll be jailed for contempt!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6258, 'Judge jokes', 'Prosecutor: Did you kill the victim?Defendant: No, I did not.Prosecutor: Do you know what the penalties are for perjury?Defendant: Yes, I do. And theyre a hell of a lot better than the penalty for murder.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6259, 'Judge jokes', 'Judge: All your responses to the questions must be oral. Do you understand?A: YesJudge: What school did you attend in the fall of 1995?A: Oral.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6260, 'Judge jokes', 'Judge: Are you married?A. No, Im divorced.Judge. And what did your husband do before you divorced him?A. A lot of things I didnt know about.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6261, 'Judge jokes', 'Judge: Your first marriage was terminated by death?A: Yes, by death.Judge: And by whose death was it terminated?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6262, 'Judge jokes', 'Judge: You stated that the stairs went down to the basement, is that correct?A: Yes.Judge: And these same stairs, did the also go up?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6263, 'Judge jokes', 'Judge: What is your relationship with the plaintiff?A: She is my daughter.Judge: Was she your daughter on February 13, 1979?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6264, 'Judge jokes', 'Judge: Doctor, how many autopsies have you performed on dead people?A: All my autopsies are on dead people.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6265, 'Judge jokes', 'Jury: Twelve men and women trying to decide which party has the best lawyer.Justice: A decision in your favor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6266, 'Judge jokes', 'How many judges does it take to change a light bulb?Just one; he holds it still and the whole world revolves around him.Just one, but two lawyers have to explain him how to do it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6267, 'Judge jokes', 'When asked for her occupation, a woman charged with a traffic violation saidshe was a schoolteacher. The judge rose from the bench. "Madam, I havewaited years for a schoolteacher to appear before this court," he smiledwith delight. "Now sit down at that table and write I will not pass througha red light five hundred times."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6268, 'Judge jokes', 'Mr. Schneider stood up in court. "As God is my judge, I do not owe myex-wife any money."Glaring down at him, the judge replied, "Hes not. I am. You do."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6269, 'Judge jokes', 'Judge to witness: "And where was the location of the accident?"Witness: "Approximately milepost 499."Judge:: "And where is milepost 499?"Witness: "About halfway between milepost 498 and milepost 500."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6270, 'Judge jokes', 'Judge: Is there any reason you could not serve as a juror in this case? Juror: I dont want to be away from my job that long. Judge: Cant they do without you at work? Juror: Yes, but I dont want them to know it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6271, 'Judge jokes', 'A lawyer passed on and found himself in Heaven,but not at all happy with his accommodations.He complained to St. Peter, who told him that hisonly recourse was to appeal his assignment. Thelawyer immediately advised that he intended toappeal, but was then told that he would be waitingat least three years before his appeal could beheard. The lawyer protested that a three-year waitwas unconscionable, but his words fell on deaf ears.The lawyer was then approached by the devil, whotold him that he would be able to arrange an appealto be heard in a few days, if the lawyer was willingto change venue to Hell. The lawyer asked: "Why canappeals be heard so much sooner in Hell?"The devil answered: "We have all of the judges."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6272, 'Judge jokes', 'At night court, a man was brought in and set before the judge.The judge said, "State your name, occupation, and the charge."The defendant said, "Im Sparks, Im an electrician, charged with battery."The judge winced and said, "Bailiff! Put this man in a dry cell!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6273, 'Judge jokes', 'Who is the most powerful ghoul? Judge Dread.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6274, 'Judge jokes', 'When is an English teacher like a judge? When she hands out long sentences.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6275, 'Judge jokes', 'A red-faced judge convened court after a long lunch. The first case involved a man charged with drunk driving who claimed it simply wasnt true."Im as sober as you are, your honor," the man claimed.The judge replied, "Clerk, please enter a guilty plea. The defendant is sentenced to 30 days."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6276, 'Judge jokes', 'It seems that a lawyer had a little bit too much to drink and on his way home rear-ended the car in front of him. The lawyer got out of his car, walked over to the driver of the other car and said, "Boy, are you in trouble. Im a lawyer!"The driver looked out his window and said, "No, youre in trouble. Im a judge."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6277, 'Judge jokes', 'Before a burglary trial, the judge explained to the defendant, "You can let me try your case, or you can choose to have a jury of your peers."The man thought for a moment. "What are peers?" he asked."Theyre people just like you  your equals.""Forget it," retorted the defendant. "I dont want to be tried by a bunch of thieves."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (6278, 'Judge jokes', 'What did the judge say when a skunk entered the courtroom?Answer: Odor, Odor in the court!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
