INSERT INTO `jokes` VALUES (7041, 'Men jokes', 'One day in the Garden of Eden, Eve calls out to God, "Lord, I have a problem!" "Whats the problem, Eve?" "Lord, I know youve created me and have provided this beautiful garden and all of these wonderful animals, and that hilarious comedy snake, but Im just not happy." "Why is that, Eve?" came the reply from above. "Lord, I am lonely. And Im sick to death of apples." "Well, Eve, in that case, I have a solution. I shall create a man for you." "Whats a man, Lord?" "This man will be a flawed creature, with aggressive tendencies, an enormous ego and an inability to empathize or listen to you properly. All in all, hell give you a hard time. But, hell be bigger and faster and more muscular than you. Hell be really good at fighting and kicking a ball about and hunting fleet-footed ruminants, and not altogether bad in the sack." "Sounds g reat," says Eve, with an ironically raised eyebrow. "Yeah, well. Hes better than a poke in the eye with a burnt stick. But, you can have him on one condition." "Whats that, Lord?" "Youll have to let him believe that I made him first."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
