INSERT INTO `jokes` VALUES (7097, 'Mental health jokes', 'Psychiatrist to his nurse: "Just say were very busy. Dont keep saying Its a madhouse."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7098, 'Mental health jokes', 'A guy goes in to see a psychologist. He says, "It seems I cant make any friends. Can you help me, you fat slob?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7099, 'Mental health jokes', 'Why is psychoanalysis a lot quicker for a man then for a women?Because when its time to go back to childhood, a man is already there.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7100, 'Mental health jokes', 'A psychologist returned from a confrence in Aspen lodge, where all the psychologists were permited to ski for free. Her husband asked her, "How it went?". She replied, "Fine, but Ive never seen so many Freudians slips."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7101, 'Mental health jokes', 'Two psychologists meet at their twentieth college reunion. One of them looks like he just graduated, while the other psychologist looks old, worried and withered.The older looking one asks the other, "Whats your secret? Listening to other peoples problems every day, all day long, for years on end, has made an old man of me."The younger looking one replies, "Who listens?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7102, 'Mental health jokes', 'Patient: Doctor, my wife thinks Im crazy because I like sausages. Psychiatrist: Nonsense! I like sausages too.Patient: Good, you should come and see my collection. Ive got hundreds of them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7103, 'Mental health jokes', 'When the new patient was settled comfortably on the couch, the physiatrist began his therapy session, "Im not aware of your problem," the doctor said. "So perhaps, you should start at the very beginning.""Of course." replied the patient. "In the beginning, I created the Heavens and the Earth..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7104, 'Mental health jokes', 'In a psychiatrists waiting room two patients are having a conversation. One says to the other, "Why are you here?"The second answers, "Im Napoleon, so the doctor told me to come here."The first is curious and asks, "How do you know that youre Napoleon?"The second responds, "God told me I was."At this point, a patient on the other side of the room shouts, "NO I DIDNT!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7105, 'Mental health jokes', 'A man who thinks hes George Washington has been seeing a psychiatrist. He finishes up one session by telling him, "Tomorrow, well cross the Delaware and surprise them when they least expect it." As soon as hes gone, the psychiatrist picks up the phone and says, "King George, this is Benedict Arnold. I have the plans."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7106, 'Mental health jokes', 'Joe has been seeing a psychoanalyst for four years for treatment of the fear that he had monsters under his bed. It had been years since he had gotten a good nights sleep. Furthermore, his progress was very poor, and he knew it. So, one day he stops seeing the psychoanalyst and decides to try something different.A few weeks later, Joes former psychoanalyst meets his old client in the supermarket, and is surprised to find him looking well-rested, energetic, and cheerful. "Doc!" Joe says, "Its amazing! Im cured!""Thats great news!" the psychoanalyst says. "you seem to be doing much better. How?""I went to see another doctor," Joe says enthusiastically, "and he cured me in just ONE session!""One?!" the psychoanalyst asks incredulously."Yeah," continues Joe, "my new doctor is a behaviorist.""A behaviorist?" the psychoanalyst asks. "How did he cure you in one session?""Oh,  easy," says Joe. "He told me to cut the legs off of my bed."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7107, 'Mental health jokes', 'One behaviorist to another after lovemaking: "Darling, that was wonderful for you. How was it for me?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7108, 'Mental health jokes', 'How do you tell the difference between the staff and the inmates at a psychiatric hospital?The patients get better and leave.Not everyone of the patients thinks he is God.The staff have the keys!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7109, 'Mental health jokes', 'Doctor, doctor, people tell me Im a wheelbarrow.Dont let people push you around.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7110, 'Mental health jokes', 'Doctor, doctor, nobody understands me.What do you mean by that?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7111, 'Mental health jokes', 'Doctor, doctor, No one believes a word I say.Tell me the truth now, whats your REAL problem?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7112, 'Mental health jokes', 'Doctor, doctor, people keep telling me Im ugly!Lay on the couch, face down.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7113, 'Mental health jokes', 'Doctor, doctor, I keep thinking Im a spoon.Sit there and dont stir.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7114, 'Mental health jokes', 'Doctor, doctor, Im manic-depressive.Calm down. Cheer up. Clam down. Cheer up. Calm', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7115, 'Mental health jokes', 'Doctor, doctor, I keep trying to get into fights.And how long have you had this complaint?Who wants to know?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7116, 'Mental health jokes', 'Doctor, doctor, I cant concentrate, one minute Im ok, and the next minute, Im blank!And how long have you had this complaint?What complaint?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7117, 'Mental health jokes', 'Doctor, doctor, I feel so short!No problem. Hop up on the couch.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7118, 'Mental health jokes', 'Doctor, doctor, I feel like a small bucket.You do look a little pail.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7119, 'Mental health jokes', 'Doctor, doctor, Ive only got 59 seconds to live.Wait a minute please.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7120, 'Mental health jokes', 'Doctor, I have a ringing in my ears.Dont answer!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7121, 'Mental health jokes', 'Patient: Doctor, you must help me. Im under such a lot of stress, I keep losing my temper with people.Doctor: Tell me about your problem.Patient: I JUST DID, DIDNT I, YOU STUPID BASTARD!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7122, 'Mental health jokes', 'Doctor, Doctor, I think Im a bridge. Whats come over you? Oh, two cars, a large truck and a coach.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7123, 'Mental health jokes', 'How many psychologists does it take to change a light bulb?None. The light bulb will change itself when its ready.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7124, 'Mental health jokes', 'How many psychologists does it take to change a light bulb? Just one, but the light bulb really has to want to change.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7125, 'Mental health jokes', 'How many psychologists does it take to change a light bulb? Just one, but it takes nine visits.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7126, 'Mental health jokes', 'How many psychiatrists does it take to change a light bulb? "How long have you been having this phantasy?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7127, 'Mental health jokes', 'How many psychiatrists does it take to change a light bulb? "Why does the light bulb necessarily have to change?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7128, 'Mental health jokes', 'How many psychiatrists does it take to change a light bulb? One, but he must consult the DSM-IV.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7129, 'Mental health jokes', 'How many psychoanalysts does it take to change a light bulb?"How many do you think it takes?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7130, 'Mental health jokes', 'What do Psychologists say to each other when they meet?" "Youre fine, how am I? "', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7131, 'Mental health jokes', 'The head doctors in an insane asylum had a meeting and decided that one of their patients was potentially well. So they decide to test him and take him to the movies. When they get to the movie theater, there are signs of wet paint pointing to the benches. The doctors just sit down, but the patient puts a newspaper down first and then sits down. The doctors get all excited cause they think maybe hes in touch with reality now. So they ask him, " Why did you put the newspaper down first?" He answers, "So Id be higher and have a better view."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7132, 'Mental health jokes', 'When they arrived at the therapists office, the therapist jumped right in and opened the floor for discussion. "What seems to be the problem?" Immediately, the husband held his long face down without anything to say. On the other hand, the wife began talking 90 miles and hour describing all the wrongs within their marriage. After 5 - - 10 - - 15 minutes of listening to the wife, the therapist went over to her, picked her up by her shoulders, kissed her passionately for several minutes, and sat her back down. Afterwards, the wife sat there - speechless. He looked over at the husband who was staring in disbelief at what had happened. The therapist spoke to the husband, "Your wife NEEDS that at least twice a week!" The husband scratched his head and replied, "I can have her here on Tuesdays and Thursdays."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7133, 'Mental health jokes', 'Patient: Im really depressed. Therapist: I see. Yes. You are depressed. Patient: Nothing is going well. Therapist: Nothing well. Patient: I feel like killing myself. T: Youre thinking of killing yourself. P: Yes, Im going to do it NOW. T: You want to do it now. P: [Jumps out window.] T: Woosh. Splat.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7134, 'Mental health jokes', 'One out of every four people is suffering from some form of mental illness. Check three friends. If theyre OK, then its you.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7135, 'Mental health jokes', '"Great news, Mr. Oscarson," the psychiatrist reported. "After eighteen months of therapy, I can pronounce you finally and completely cured of your kleptomania. Youll never be trapped by the desire to steal again.""Gee, thats great, Doc," the patient replied."And just to prove it, I want you to stop by Sears on the way home and walk the length of the store. Youll see - youll feel no temptation to shoplift whatsoever.""Oh, Doctor, whatever can I do to thank you?""Well," suggested the psychiatrist, "if you DO have a relapse, I could use a new microwave."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7136, 'Mental health jokes', 'Patient: Doctor, I get the feeling that people dont give a hoot about anything I say. Psychiatrist: So?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7137, 'Mental health jokes', 'Three patients at a psychiatric clinic are up for release. The shrink informs them that they will have to pass a simple test. Asking the first patient: Q. How much is two plus two? A: Blue. At which the kind doctor calls in the orderly to escort the patient back to his room. Turning to the second patient, he asks what is six minus three? To which the patient replies: Square. Once again the orderly is called in to remove the patient. Turning to the third and last patient, he asks, "How much is five plus five?" The patient answers very confidentally: Ten. The doctor, amazed then inquires how did you figure it out? The patient: "Easy.Blue multiplied by square equals ten."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7138, 'Mental health jokes', 'How many Borderline P.D. does to take to change a lightbulb?Just one. To threaten suicide if you dont change it for him/her.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7139, 'Mental health jokes', 'How many Obsessive-Compulsive P.D. does to take to change a lightbulb?Just one. But he has to check it 100 times, one for each watt.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7140, 'Mental health jokes', 'How many Passive Aggressive P.D. does to take to change a lightbulb?Oops.I cant believe I broke the last one. I guess youll have to sit in the dark.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7141, 'Mental health jokes', 'How many Dependent P.D. does to take to change a lightbulb?None, hes still clinging to the old lightbulb.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7142, 'Mental health jokes', 'How many Histrionic P.D. does to take to change a lightbulb?"You want me to change the lightbulb? I could burn my hand! I could be electrocuted! I could fall off the ladder and be paralyzed for life! You dont love me anymore!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7143, 'Mental health jokes', 'Two psychiatrists were walking down a hall.One turned to the other and said, "Hello."The other one thought, "I wonder what he meant by that."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7144, 'Mental health jokes', 'Three patients in a mental institution prepare for an examination given by the head psychiatrist. If the patients pass the exam, they will be free to leave the hospital. However, if they fail, the institution will detain them for five years.The doctor takes the three patients to the top of a diving board looking over an empty swimming pool, and asks the first patient to jump.The first patient jumps head first into the pool and breaks both arms.Then the second patient jumps and breaks both legs.The third patient looks over the side and refuses to jump. "Congratulations! Youre a free man. Just tell me why didnt you jump?" asked the doctor.To which the third patient answered, "Well Doc, I cant swim!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7145, 'Mental health jokes', 'The mother of a problem child was advised by a psychiatrist, "You are far too upset and worried about your son. I suggest you take tranquilizers regularly."On her next visit the psychiatrist asked, "Have the tranquilizers calmed you down?""Yes," the boys mother answered."And how is your son now?" the psychiatrist asked."Who cares?" the mother replied.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7146, 'Mental health jokes', 'After hearing that one of the patients in a mental hospital had saved another from a suicide attempt by pulling him out of a bathtub, the hospital director reviewed the rescuers file and called him into his office."Mr. Haroldson, your records and your heroic behavior indicate that youre ready to go home. Im only sorry that the man you saved later killed himself with a rope around the neck.""Oh, he didnt kill himself," Mr. Haroldson replied. "I hung him up to dry."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7147, 'Mental health jokes', 'A man is strolling past the mental hospital and suddenly remembers an important meeting.Unfortunately, his watch has stopped, and he cannot tell if he is late or not. Then, he notices a patient similarly strolling about within the hospital fence.Calling out to the patient, the man says, "Pardon me, sir, but do you have the time?"The patient calls back, "One moment!" and throws himself upon the ground, pulling out a short stick as he does. He pushes the stick into the ground, and, pulling out a carpenters level, assures himself that the stick is vertical.With a compass, the patient locates north and with a steel ruler, measures the precise length of the shadow cast by the stick.Withdrawing a slide rule from his pocket, the patient calculates rapidly, then swiftly packs up all his tools and turns back to the pedestrian, saying, "It is now precisely 3:29 pm, provided  today is August 16th, which I believe it is."The man cant help but be impressed by this demonstration, and sets his watch accordingly.Before he leaves, he says to the patient, "That was really quite remarkable, but tell me, what do you do on a cloudy day, or at night, when the stick casts no shadow?" The patient holds up his wrist and says, "I suppose Id just look at my watch."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7148, 'Mental health jokes', 'Mary was having a tough day and had stretched herself out on the couch to do a bit of what she thought to be well-deserved complaining and self- pitying.She moaned to her mom and brother, "Nobody loves me ... the whole world hates me!"Her brother, busily occupied playing a game, hardly looked up at her and passed on this encouraging word: "Thats not true, Mary. Some people dont even know you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7149, 'Mental health jokes', 'My therapist told me the way to achieve true inner peace is to finish what I start. So far today, I have finished two bags of chips and a chocolate cake. I feel better already.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7150, 'Mental health jokes', 'A guy goes to a psychiatrist. "Doc, I keep having these alternating recurring dreams. First Im a teepee; then Im a wigwam; then Im a teepee; then Im a wigwam. Its driving me crazy. Whats wrong with me?" The doctor replies: "Its very simple. Youre two tents."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7151, 'Mental health jokes', 'A doctor of psychology was doing his normal morning rounds when he entered a patients room. He found Patient #1 sitting on the floor, pretending to saw a piece of wood in half. Patient #2 was hanging from the ceiling, by his feet. The doctor asked patient number 1 what he was doing. The patient replied, "Cant you see Im sawing this piece of wood in half?" The doctor inquired of Patient #1 what Patient #2 was doing. Patient #1 replied, "Oh. Hes my friend, but hes a little crazy. He thinks hes a lightbulb." The doctor looks up and notices Patient #2s face is going all red. The doctor asks Patient #1, "If hes your friend, you should get him down from there before he hurts himself" Patient #1 replies, "What? And work in the dark?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7152, 'Mental health jokes', 'A group of psychiatrists were attending a convention. Four of them decided to leave, and walked out together. One said to the other three, "People are always coming to us with their guilt and fears, but we have no one that we can go to when we have problems." The others agreed.Then one said, "Since we are all professionals, why dont we take some time right now to hear each other out?"The other three agreed.The first then confessed, "I have an uncontrollable desire to kill my patients."The second psychiatrist said, "I love expensive things and so I find ways to cheat my patients out of their money whenever I can so I can buy the things I want."The third followed with, "Im involved with selling drugs and often get my patients to sell them for me."The fourth psychiatrist then confessed, "I know Im not supposed to, but no matter how hard I try, I cant kee p a secret..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7153, 'Mental health jokes', 'The aspiring psychiatrists were attending their first class on emotional extremes. "Just to establish some parameters," said the professor to the student from Arkansas, "What is the opposite of joy?""Sadness," said the student.And the opposite of depression?" he asked of the young lady from Oklahoma."Elation," said she."And you sir," he said to the young man from Texas, "how about the opposite of woe?"The Texan replied, "Sir, I believe that would be giddy-up."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7154, 'Mental health jokes', 'A man walked into a therapists office looking very depressed. "Doc, youve got to help me. I cant go on like this.""Whats the problem?" the docotor inquired."Well, Im 35 years old and I still have no luck with the ladies. No matter how hard I try, I just seem to scare them away.""My friend, this is not a serious problem. You just need to work on your self-esteem. Each morning, I want you to get up and run to the bathroom mirror. Tell yourself that you are a good person, a fun person, and an attractive person. But say it with real conviction. Within a week youll have women buzzing all around you."The man seemed content with this advice and walked out of the office a bit excited. Three weeks later he returned with the same downtrodden expression on his face. "Did my advice not work?" asked the doctor."It worked alright. For the past several weeks Ive e njoyed some of the best moments in my life with the most fabulous looking women.""So, whats your problem?" "I dont have a problem," the man replied. "My wife does."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7155, 'Mental health jokes', 'The psychology instructor had just finished a lecture on mental health and was giving an oral test.Speaking specifically about manic depression, she asked, "How would you diagnose a patient who walks back and forth screaming at the top of his lungs one minute, then sits in a chair weeping uncontrollably the next?"A young man in the rear raised his hand and answered, "A basketball coach?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7156, 'Mental health jokes', 'A guy had been feeling down for so long that he finally decided to seek the aid of a psychiatrist.He went there, lay on the couch, spilled his guts then waited for the profound wisdom of the psychiatrist to make him feel better.The psychiatrist asked me a few questions, took some notes then sat thinking in silence for a few minutes with a puzzled look on his face.Suddenly, he looked up with an expression of delight and said, "Um, I think your problem is low self-esteem. It is very common among losers."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7157, 'Mental health jokes', 'Why did the witch go to the psychiatrist? Because she thought everybody loved her.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7158, 'Mental health jokes', 'Psychiatrist: Well, whats your problem? Patient: I prefer brown shoes to black shoes.Psychiatrist: Theres nothing wrong with that. Lots of people prefer brown shoes to black shoes. I do myself.Patient: Really? How do your like yours - fried or boiled?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7159, 'Mental health jokes', 'What happens if you tell a psychiatrist you are schizophrenic? He charges you double.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7160, 'Mental health jokes', '"The trouble is," said the entertainer to the psychiatrist, "that I cant sing, I cant dance, I cant tell jokes, I cant act, I cant play an instrument or juggle or do magic tricks or do anything!" "Then why dont you give up show business?" "I cant - Im a star!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7161, 'Mental health jokes', 'Fred: "Why are you so upset?" Harry: "My wife introduced me to her psychiatrist this morning." Fred: "So what?" Harry: "So she said to him, Doctor, this is my husband. You know, one of the men Ive been telling you about."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7162, 'Mental health jokes', 'Patient: Why did you charge me a group rate?Psychiatrist: Youve got multiple personalities.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7163, 'Mental health jokes', 'Did you hear about the auto mechanic who went to a psychiatrist and insisted on laying under the couch?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7164, 'Mental health jokes', 'A woman entered a psychiatrists consulting room leadind a kangaroo."Im worried about my husband, doctor, " she said. "He keeps thinking hes a kangaroo! "', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7165, 'Mental health jokes', 'Doctor ! Doctor ! I think Im going crazy. I have a carrot growing out of my ear.Amazing ! so you have. How could that have happened ?I cant understand it either, because I planted cabbage !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7166, 'Mental health jokes', 'What do you know when you see three rabbits walking down the street wearing tuxedos and top hats? You know you need a psychiatrist!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7167, 'Mental health jokes', 'Why is a psychiatrist like a squirrel?Because they are both surrounded by nuts.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7168, 'Military jokes', 'SIX PHASES OF THE MONTH IN NAVY RECRUITING 1. ENTHUSIASM 2. DISILUSIONMENT 3. PANIC 4. SEARCH FOR THE GUILTY 5. PUNISHMENT OF THE INNOCENT 6. PRAISE AND HONORS FOR THE NON-PARTICIPANTS', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7169, 'Military jokes', 'An airforce officer goes to heaven and at the gate St Peter asks him if he has ever done anything in his life that he believes makes him worthy of attmittance to heaven. The officer flyboy replies; yes, I once went into a bar with four of my pilot friends and saw two seabees harrassing a young girl at the bar, so being a gentelman I went up to the biggest one and told him to leave this young lady alone. When he refused I told him again more forcefully. This time I slapped him across the face and told this seabee to stand down. St Peter said this was a very good thing to do and asked when the pilot did this great act. The pilot replied; about 5 minutes ago! My friends should be here shortly!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7170, 'Military jokes', 'At a lesson in topography a soldier was asked: "What is farther away, Harrison, the moon or that object on this map?""That object, naturally.""What makes you think that?"" Cause we can see the moon any clear night, and we cant see that object even at day time."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7171, 'Military jokes', 'As the family gathered for a big dinner together, the youngest son had an announcement to make: Hed just signed up at an army recruiters office. There were audible gasps around the table, then some laughter, as his older brothers shared their disbelief that he could handle this new situation."Oh, come on, quit pulling our legs," snickered one: "You didnt really do that, did you?""Im positive youd never get through basic training" scoffed another.The new recruit looked to his mother for help; but she was just gazing at him. When she finally spoke, it was to voice a single question: "Do you really plan to make your own bed every morning?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7172, 'Military jokes', 'You Might be a Marine Wife if:1. Your mail goes to four addresses in two countries before it reaches you. 2. You earned an Accounting degree by deciphering your husbands LES and running a family on what was ACTUALLY deposited. 3. "Savings" sounds like a great idea and you hope to someday have some. 4. Sex - see #3. 5. You can simultaneously be a control freak, change plans on a moments notice, yet you are not being treated for schizophrenia. 6. You know the Tricare regulations/procedures better than their service reps. 7. You know what forms you need better than your husbands Admin clerk. 8. You are strangely attracted (or repulsed) by the color green. 9. You can calculate the cost of a 5-minute phone call from any country, any time, on up to four different calling plans. 10. At a distance, you can pick out your husband from 100 other men with identical haircuts and clo thes. 11. The face paint in your closet is NOT for your children. 12. Name tapes are not just for kids.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7173, 'Military jokes', 'One of my husbands duties as a novice drill instructor at Fort Jackson, S.C., was to escort new recruits to the mess hall. After everyone had made it through the chow line, he sat them down and told them, "There are three rules in this mess hall: Shut up! Eat up! Get up!"Checking to see that he had everyones attention, he asked, "What is the first rule?" Much to the amusement of the other instructors, 60 privates yelled in unison, "Shut up, Drill Sergeant!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7174, 'Military jokes', 'A drill sergeant had just chewed out one of his cadets, and as he was walking away, he turned to the cadet and said, "I guess when I die youll come and dance on my grave." The cadet replied, "Not me, Sarge...no sir! I promised myself that when I got out of the Army Id never stand in another line!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7175, 'Military jokes', 'The cavalryman was galloping down the road, rushing to catch up with his regiment. Suddenly his horse stumbled and pitched him to the ground. Lying in the dirt with a broken leg, terrified of the approachingenemy, the soldier called out: "All you saints in heaven, help me get up on my horse!"Then, with superhuman effort, he leaped onto the horses back and fell off the other side. Once again on the ground, he called to the heavens:"All right, just half of you this time!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7176, 'Military jokes', 'Airman Jones was assigned to the induction center, where he advised new recruits about their government benefits, especially their GI insurance. It wasnt long before Captain Smith noticed that Airman Jones was having a staggeringly high success-rate, sellinginsurance to nearly 100% of the recruits he advised. Rather than ask about this, the Captain stood in the back of the room and listened to Jones sales pitch.Jones explained the basics of the GI Insurance to the new recruits, and then said: "If you have GI Insurance and go into battle and are killed, the government hasto pay $200,000 to your beneficiaries. If you dont have GI insurance, and you go into battle and get killed, the government only has to pay a maximum of $6000.Now," he concluded, "which group do you think they are going to send into battle first?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7177, 'Military jokes', 'The reason the Air Force, Army, Navy and Marines bicker amongst themselves is that they dont speak the same language. For instance, Take the simple phrase "secure the building".The Army will post guards around the place.The Navy will turn out the lights and lock the doors.The Marines will kill everybody inside and set up a headquarters.The Air Force will take out a 5 year lease with an option to buy.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7178, 'Military jokes', 'On some air bases the Air Force is on one side of the field and civilian aircraft use the other side of the field, with the control tower in the middle.One day the tower received a call from an aircraft asking, "What time is it?"The tower responded, "Who is calling?"The aircraft replied, "What difference does it make?"The tower replied, "It makes a lot of difference. If it is an American Airlines flight, it is 3 oclock. If it is an Air Force plane, it is 1500 hours. If it is a Navy aircraft, it is 6 bells. If it is an Army aircraft, the big hand is on the 12 and the little hand is on the 3. If it is a Marine Corps aircraft, its Thursday afternoon."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7179, 'Military jokes', 'One Sunday morning, the priest noticed Little Johnny was staring up at the large plaque that hung in the foyer of the church. It was covered with names, and small American flags were mounted on either side of it. The seven-year old had been staring at the plaque for some time, so the priest walked up, stood beside the boy, and said quietly, "Good morning, Little Johnny." "Good morning, Father," replied the young man, still focused on the plaque. "Father Scott, what is this?" Little Johnny asked. "Well, son, its a memorial to all the young men and women who died in the service." Soberly, they stood together, staring at the large plaque. Little Johnnys voice was barely audible when he asked, "Which service, the 9:45 or the 11:15?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7180, 'Military jokes', 'It was a dark, stormy, night. The Marine was on his first assignment, and it was guard duty. A General stepped out taking his dog for a walk. The nervous young Private snapped to attention, made a perfectsalute, and snapped out, "Sir, Good Evening, Sir!"The General, out for some relaxation, returned the salute and said "Good evening soldier, nice night, isnt it?"Well it wasnt a nice night, but the Private wasnt going to disagree with the General, so the he saluted again and replied, "Sir, Yes Sir!"The General continued, "You know theres something about a stormy night that I find soothing, its really relaxing. Dont you agree?"The Private didnt agree, but then the private was just a private, and responded, "Sir, Yes Sir!"The General, pointing at the dog, "This is a Golden Retriever, the best type of dog to train."The Private glanced at the dog, saluted  yet again, and said, "Sir, Yes Sir!"The General continued "I got this dog for my wife."The Private simply said, "Good trade, Sir!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7181, 'Military jokes', 'While practicing auto-rotations during a military night training exercise, a Huey Cobra messes up and lands on its tail rotor.The landing is so hard it breaks off the tail boom. However, the chopper fortunately remains upright on its skids, sliding down the runway, doing 360s.As the Cobra slides past the tower, trailing a brilliant shower of sparks, this radio exchange takes place:Tower: "Sir, do you need any assistance?"Cobra: "I dont know, Tower, we aint done crashin yet."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7182, 'Military jokes', 'A trio of old veterans were bragging about the heroic exploits of their ancestors one afternoon down at the VFW hall. "My great grandfather, at age 13," one declared proudly, "was a drummer boy at Shiloh.""Mine," boasts another, "went down with Custer at the Battle of Little Big Horn.""Im the only soldier in my family," confessed vet number three, "but if my great grandfather was living today hed be the most famous man in the world.""Really? Whatd he do?" his friends wanted to know."Nothing much. But he would be 165 years old."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7183, 'Military jokes', 'A general noticed one of his soldiers behaving oddly. The soldier would pick up any piece of paper he found, frown and say, "Thats not it" and put it down again. This went on for some time, until the general arranged to have the soldier psychologically tested. The psychologist concluded that the soldier was deranged, and wrote out his discharge from the army. The soldier picked it up, smiled and said, "Thats it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7184, 'Military jokes', 'As he was drilling a batch of recruits, the sergeant saw that one of them was marching out of step. Walking up next to the man as they marched, he said sarcastically: "Do you know they are all out of step except you?""What?" asked the recruit innocently."I said -- they are all out of step except you!" thundered the sergeant.The recruit replied, "Well, sarge, youre in charge -- you tell them!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7185, 'Military jokes', 'There were three American pilots captured by Germans in WWII. The Germans thought up a way to make the pilots crack and tell what they knew. They made them stand at attention, turn their heads from side to side and say, "Tick - Tock" over and over.After about three hours, the first pilot cracked and started telling all he knew, signing everything they put in front ofhim. An hour later, the second pilot cracked and started confessing to things that he didnt even do.The third pilot was fighting hard not to crack. He was about half-way cracked. He was turning his head to one side only and saying, "Tick...Tick...Tick..." The German officer in charge went up to him and said, "You thinks you iss so schmart! But Im telling you dot vee haf vays to make you TOCK!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7186, 'Military jokes', 'A solider stationed in the South Pacific wrote to his wife in the States to please send him a harmonica to occupy his free time and keep his mind off of the local women. The wife complied and sent the best one she could find, along with several dozen lesson and music books.Rotated back home, he rushed to their home and through the front door. "Oh darling" he gushed, "Come here. Let me look at you. Let me hold you! Lets have a fine dinner out, then make love all night. Ive missed your lovin so much."The wife, keeping her distance, said, "All in good time lover. First, lets hear you play that harmonica."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7187, 'Military jokes', 'In the 1970s, before women were allowed to sign up for combat duty, a man was bragging to his friends about how his sister disguised herself as a man and was able to join the army."But, wait a minute," said one listener, "Shell have to dress with the boys and shower with them too. Wont she?""Sure," replied the man."Well, wont they find out?" asked his friend.The man shrugged and replied, "But who will tell?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7188, 'Military jokes', 'During the Mexican American War, an intense long standoff occurred along the front. For days and days neither side made any advances.Finally, an American general had a bright idea. He aimed his rifle to the Mexican trenches and yelled, "Hey, Juan!"A soldier jumped up and replied, "What?" The general shot him dead. This continued for three days.A Mexican general decided that two could play this game and decided to try it out. He called out, "Hey, John!"An American replied, "John isnt here. Is that you Juan?"The Mexican general stood up, "Yeah" . . .', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7189, 'Military jokes', 'A young naval student was being put through the paces by an old sea captain. "What would you do if a sudden storm sprang up on the starboard?" asked the captain."Throw out an anchor, sir." replied the naval student."What would you do if another storm sprang up aft?" asked the captain."Throw out another anchor, sir." answered the student."And if another terrific storm sprang up forward, what would you do?" asked the captain."Throw out another anchor." replied the student."Hold on," said the Captain. "Where are you getting all your anchors from?"The naval student replied, "From the same place youre getting all of your storms, sir."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7190, 'Military jokes', 'During training exercises, the lieutenant who was driving down a muddy back road encountered another car stuck in the mud with a red-faced colonel at the wheel. "Your jeep stuck, sir?" asked the lieutenant as he pulled alongside "Nope," replied the colonel, coming over and handing him the keys "Yours is."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7191, 'Military jokes', 'Officer: Soldier, do you have change for a dollar? Soldier: Sure, buddy. Officer: Thats no way to address an officer! Now lets try it again. Soldier, do you have change for a dollar? Soldier: No, SIR!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7192, 'Military jokes', 'Q: Whats the difference between God and fighter pilots? A: God doesnt think hes a fighter pilot.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7193, 'Military jokes', 'An Air Force cargo plane was preparing for departure from Thule Air Base in Greenland. They were waiting for the truck to arrive to pump out the aircrafts sewage holding tank.The Aircraft Commander was in a hurry, the truck was late in arriving, and the Airman performing the job was extremely slow in getting the tank pumped out.When the commander berated the Airman for his slowness and promised punishment, the Airman responded: "Sir, I have no stripes, it is 20 below zero, Im stationed in Greenland, and I am pumping sewage out of airplanes. Just what are you going to do to punish me?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7194, 'Military jokes', 'Having just moved into his new office, a pompous, new colonel was sitting at his desk when a PFC knocked on the door.Conscious of his new position, the colonel quickly picked up the phone, told the PFC to enter, then said into the phone, "Yes, General, Ill be seeing him this afternoon and Ill pass along your message. In the meantime, thank you for your good wishes, sir."Feeling as though he had sufficiently impressedthe young enlisted man, he asked, "What do you want?""Nothing important, sir," the PFC replied, "Im just here to hook up your telephone."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7195, 'Military jokes', 'An Army Ranger was on holiday in the depths of Louisiana, where he tried to buy some Alligator shoes. However, he was not prepared to pay the high prices. After failing to haggle the vendor down to a reasonable price level, he ended up shouting "I dont give two hoots for your shoes, man, Ill go and kill my own!"The shopkeeper replied, "By all means. Just watch out for the two Marines who are doing the same."So the Ranger went out into the Bayou, and after a while saw two men with spears, standing still in the water. "They must be the two Marines," he thought. Just at that point he noticed an alligator moving in the water towards one of them. The Marine stood completely passive, even as the gator came ever closer. Just as the beast was about to swallow him, the Marine struck home with his spear and wrestled the gator up onto the beach, where several already lay. Together the two Marines threw \r nthe gator onto its back, whereupon one exclaimed "Damn! This one doesnt have any shoes either!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7196, 'Military jokes', 'The Captain called the Sergeant in. "Sarge, I just got a telegram that Private Jones mother died yesterday. Better go tell him and send him in to see me." So the Sergeant calls for his morning formation and lines up all the troops. "Listen up, men," says the Sergeant. "Johnson, report to the mess hall for KP. Smith, report to Personnel to sign some papers. The rest of you men report to the Motor Pool for maintenance. Oh by the way, Jones, your mother died, report to the commander." Later that day the Captain called the Sergeant into his office. "Hey, Sarge, that was a pretty cold way to inform Jones his mother died. Couldnt you be a bit more tactful, next time?" "Yes, sir," answered the Sarge. A few months later, the Captain called the Sergeant in again with, "Sarge, I just got a telegram that Private McGraths mother died. Youd better go tell him and send him in to see me . This time be more tactful." So the Sergeant calls for his morning formation. "Ok, men, fall in and listen up." "Everybody with a mother, take two steps forward." "Not so fast, McGrath!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7197, 'Military jokes', 'An Israeli soldier who just enlisted asked the Commanding Officer for a 3-day pass. The CO says "Are you crazy? You just join the Israeli army, and you already want a 3-day pass? You must do something spectacular for that recognition!" So the soldier comes back a day later in an Arab tank! The CO was so impressed, he asked "How did you do it?" "Well, I jumped in a tank, and went toward the border with the Arabs. I approached the border, and saw an Arab tank. I put my white flag up, the Arab tank put his white flag up. I said to the Arab soldier, "Do you want to get a three-day pass? So we exchanged tanks!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7198, 'Military jokes', 'The General went out to find that none of his G.I.s were there. One finally ran up, panting heavily. "Sorry, sir! I can explain, you see I had a date and it ran a little late. I ran to the bus but missed it, I hailed a cab but it broke down, found a farm, bought a horse but it dropped dead, ran 10 miles, and now Im here." The General was very skeptical about this explanation but at least he was here so he let the G.I. go. Moments later, eight more G.I.s came up to the general panting, he asked them why they were late. "Sorry, sir! I had a date and it ran a little late, I ran to the bus but missed it, I hailed a cab but it broke down, found a farm, bought a horse but it dropped dead, ran 10 miles, and now Im here." The General eyed them, feeling very skeptical but since he let the first guy go, he let them go, too. A ninth G.I. jogged up to the General, panting heavily. \r \n"Sorry, sir! I had a date and it ran a little late, I ran to the bus but missed it, I hailed a cab but..." "Let me guess," the General interrupted, "it broke down." "No," said the G.I., "there were so many dead horses in the road, it took forever to get around them."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7199, 'Military jokes', 'The chief of staff of the US Air Force decided that he would personally intervene in the recruiting crisis affecting all of our armed services. He directed a nearby Air Force base that will be opened and that all eligible young men and women be invited. As he and his staff were standing near a brand new F-15 Fighter, a pair of twin brothers who looked like they had just stepped off a Marine Corps recruiting poster walked up to them. The chief of staff walked up to them, stuck out his hand and introduced himself. He looked at the first young man and asked, "Son, what skills can you bring to the Air Force?" The young man looks at him and says, "Im a pilot!" The general gets all excited, turns to his aide and says, "Get him in today, all the paper work done, everything, do it!" The aide hustles the young man off. The general looks at the second young man and asked, "What s kills to you bring to the Air Force?" The young man says, "I chop wood!" "Son," the general replies, "we dont need wood choppers in the Air Force, what do you know how to do?" "I chop wood!" "Young man," huffs the general, "you are not listening to me, we dont need wood choppers, this is the 20th century!" "Well," the young man says, "you hired my brother!" "Of course we did," says the general, "hes a pilot!" The young man rolls his eyes and says, "So what! I have to chop it before he can pile it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7200, 'Military jokes', 'Two men were boasting to each other about their old army days."Why, my outfit was so well drilled," declared one, "that when they presented arms all you could hear was slap, slap, click.""Very good," conceded the other, "but when my company presented arms youd just hear slap, slap, jingle.""What was the jingle?" asked the first. "Oh," replied the other offhand, "just our medals."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7201, 'Military jokes', 'Following some duty overseas, the officers at the Fort were planning a welcome home party and dance for the unit. Being an all male combat force, they decided to request coeds from some of the surrounding colleges to attend. The Captain called Vassar and was assured by the Dean that arrangements could be made to send over a dozen of their most trustworthy students. The Captain hesitated, then said, "Would it also be possible to send a dozen or so of the other kind?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7202, 'Military jokes', 'A sailor in the Navy who had been at sea for a long time was anxious to be reunited with his girlfriend, so he sent her the following message a few days before his ship was due back in port: "I have missed you so much and I cant wait to make love to you. I want you to come down to the pier to meet me, and I want you to bring the station wagon and have a mattress ready in the back so we can do "it" as soon as I step ashore."The young lady who was just as anxious to make love, sent him a reply: "I will get the station wagon ready as you said, but you had better be the first one off that ship, sailor, because I am not checking I.D. cards."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7203, 'Military jokes', 'During a visit to a military medical clinic, I was sent to the lab to have blood drawn. The technician there was friendly and mentioned that his mood improved every day because he was due to leave the service in two months.As he applied the tourniquet on my arm, he told me that taking the blood wouldnt hurt much. Then, noticing my Air Force T-shirt he asked me what my husband did.When I replied that he was a recruiter, the technician smiled slyly and said, "This might hurt a little more than I thought."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7204, 'Military jokes', 'The first woman recruit in the Army reported for duty and was told that although her quarters would be in a separate building, she was to mess with the men.It wasnt until four weeks later someone finally told her that meant to eat her meals with them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7205, 'Military jokes', 'This Marine drill instructor, completely frazzled by the ineptitude of his recruits, burst into a blue streak of swearing hot enough to blister paint. He broke off suddenly when he noticed one of the recruits had been talking in ranks. "WHAT WAS THAT YOU SAID, RECRUIT??" the drill sergeant hollered. In a quivering voice, the recruit replied, "I said, to myself, Drill Sergeant Sir, if that sucker thinks Im going to stand here and take his crap . . . well, hes certainly an uncanny judge of character.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7206, 'Military jokes', 'The Pentagon once did a study on why so many American Servicemen marry women in the countries where theyre stationed. Contrary to popular belief, loneliness had nothing to do with it. Once the men rotated back to the US, all their in-laws were thousands of miles away.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7207, 'Military jokes', 'Having passed the enlistment physical, Jon was asked by the doctor, "Why do you want to join the Navy, son?""My father said itd be a good idea, sir.""Oh? And what does your father do?""Hes in the Army, sir."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7208, 'Military jokes', 'The Army Airborne major was used to harassment from Air Force fliers about crazy Army paratroopers jumping out of perfectly good aircraft. "Obviously the Air Force knows theres no such thing as a perfectly good aircraft," the irritated officer finally countered one afternoon, "because they pay you bastards four times as much to stay in one as the Army pays its men to jump.""Youve got it all wrong, Major," an Air Force sergeant replied. "The Army figures anyone stupid enough to jump out of an airplane voluntarily is gonna be too dumb to bitch about the salary."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7209, 'Military jokes', 'Why did the army send so many women with PMS to the Persian Gulf?They fought like animals and retained water for 4 days.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7210, 'Military jokes', 'We have women in the military, but they dont put us in the front lines. They dont know if we can fight, if we can kill. I think we can. All the general has to do is walk over to the women and say, You see the enemy over there? They say you look fat in those uniforms.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7211, 'Military jokes', 'Seems there was a young soldier, who, just before battle, told his sergeant that he didnt have a rifle."Thats no problem, son," said the sergeant. "Here, take this broom. Just point it at the Germans, and go Bangety Bang Bang.""But what about a bayonet, Sarge?" asked the young (and gullible) recruit.The sergeant pulls a piece of straw from the end of the broom, and attaches it to the handle end. "Here, use this... just go, Stabity Stab Stab."The recruit ends up alone on the battlefield, holding just his broom. Suddenly, a German soldier charges at him. The recruit points the broom, "Bangety Bang Bang!" The German falls dead.More Germans appear. The recruit, amazed at his good luck, goes "Bangety Bang Bang! Stabity Stab Stab!" He mows down the enemy by the dozens. Finally, the battlefield is clear, except for one German soldier walking slowly toward him.\r n"Bangety Bang Bang! shouts the recruit. The German keeps coming. "Bangety Bang Bang!" repeats the recruit, to no avail. He gets desperate. "Bangety Bang Bang! Stabity Stab Stab!" Its no use.The German keeps coming. He stomps the recruit into the ground, and says, "Tankety Tank Tank."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7212, 'Military jokes', '- How many Iraqis does it take to launch a Scud missile?- Two. One to launch it, one to watch CNN to find out where it landed.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7213, 'Military jokes', '- How many Russians does it take to screw in a light bulb?- That is a military secret. If I told you Id have to kill you.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7214, 'Military jokes', '- How many survivors of nuclear war does it take to screw in a light bulb?- None. People that glow in the dark dont need lights.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7215, 'Military jokes', 'Paddy n Mick join the army, and are put on street patrol in a city with a military curfew. They are given instructions to shoot anybody whos on the streets after 6 oclock. So one day, theyre out at twenty to 6, when Paddy spots a man walking on the other side of the street. He lines up the man in his sights and shoots the man dead. Mick is shocked. "What are you doin, Paddy? It aint 6 yet!" "I know what Im doin. I know where he lives and he wouldnt have made it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7216, 'Military jokes', 'A soldier at the Pentagon got out of the shower, and realized that his clothes were missing. And then he accidentally locked himself out of the locker room. So now he was completely naked in the halls of the headquarters of the most powerful military organization on the planet. And he felt pretty ridiculous. Getting an idea, he walked naked and purposefully through the corridors until he reached the Research & Development laboratory. He walked in and saluted the Head Scientist. "I am here to report the partial success of the personal invisibility device!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7217, 'Military jokes', 'At Parris Island, a sergeant was teaching a private to throw a grenade at a pracitice training course. He ran about 10 yards away to be safe, and yelled the instructions."Pull the pin, throw and hit the dirt!"The private proceeds to do so, and throws the explosive directly at the sergeant!A few months later, the sergeant meets the private in a group of men killed in battle. He goes up the the private- no hard feelings because heaven is well, great- and asks him how he bit the dust. Responds the private: "Well, i was caught in a ambush; these guys," He thumbs behind him. "got caught in the jeep under the fire. I managed to make it to a ditch where i yanked a grenade form my belt and pulled the pin and lever. The enemy runs away seeing it, so i put the grenade back onto my belt."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7218, 'Military jokes', '- What do you think about the coming battle, General?- God knows it will be lost.- Then why should we go for it?- To find out who is the loser.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7219, 'Military jokes', 'A patrol of allied soldiers were in a ruined city during World War Two. They are bragging and joshing about how many kills they have so far to keep up courage on their route through the rubbled buildings. Sergeant Joe thumps his chest and proclaims. "I got me 4 germans bagged so far. Howabout you John?"Before Pfc John can reply, a lone german soldier runs out of a trashed hotel. In the process of throwing down his rifle after seeing the larger allied soldier group, he shouts "NEIN!"Pfc John takes aim at the enemy and shoots him. "Well, he wont get himself a tenth allied soldier." Joe all year long!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7220, 'Military jokes', 'A warrant officer was crossing a road one-day when a frog called out to him and said, "If you kiss me, Ill turn into a beautiful princess". He bent over, picked up the frog and put it in his pocket. The frog spoke up again and said, "If you kiss me and turn me back into a beautiful princess, I will stay with you for one week." The warrant officer took the frog out of his pocket, smiled at it and returned it to his pocket. The frog then cried out, "If you kiss me and turn me back into a princess, Ill stay with you for one week and do ANYTHING you want." Again the warrant officer took the frog out, smiled at it and put it back into his pocket. Finally, the frog asked, "What is the matter? Ive told you Im a beautiful princess, that Ill stay with you for a week and do anything you want. Why wont you kiss me?" The warrant officer said, "Look Im an warrant officer. I dont have time for a girlfriend, but a talking frog, now thats cool."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7221, 'Military jokes', 'A trooper asks a sergeant:- Is it true that man descended from a monkey?- Yes, troopers possibly were. But not sergeants.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7222, 'Military jokes', 'A Maintenance Battalion in Germany had just received a brand new Executive Officer, an Armor Major. The Major proceeded to issue new SOP directives (Standard Operating Procedures) that WOULD be followed under all circumstances. One of these directives was that NO ONE over the rank of Staff Sergeant would drive their own vehicle, that was what the lower enlisted were for. One morning, the Master Sergeant in charge of the S-2 shop of the battalion had an intel report that was due at Division Headquarters within the hour, and his clerk, a PFC, was off that morning because of duty the night before. The Sergeant felt that he had no choice, the report HAD to get to Division; so he got into his Jeep and started to Division Headquarters.As he got to the gate, the XO stopped him. In a very sarcastic voice he said, "Arent we paying our drivers a lot these days?"The NCO, without missing a beat re plied, "Not at all, Sir, when you consider what we are paying gate guards."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7223, 'Military jokes', 'I was an Air Force ICBM launch control officer in South Dakota. Two officers pulled 24-hour alerts in a launch control center that was surrounded by several Minuteman II silos. The facility and the silos were separated by several miles. We were not allowed to leave the "capsule" until relieved the next day, and we were supported by several on-site personnel in the support building upstairs. The capsules were Spartan, but each boasted a small refrigerator and a small microwave. On one tour of duty, the cook called down around lunch time and informed us that she was cleaning her oven and that hot food would be unavailable for a short time. Later, around supper time, she called down again and apologized that she had dismantled her oven to clean it, was having trouble reassembling it, and would again be unable to heat our food orders. We were somewhat annoyed, but, being the kinder, gent ler military officers we were, told her "No problem. Just send down the frozen meals and well nuke them ourselves." Several seconds of dead silence on the phone followed before she whispered, "You can DO that?" :', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7224, 'Military jokes', 'A recruit examines the food served to him in the batallion dining room.- Do I have any choice here, he asks a sergeant.- Yes, you do. You may eat it or not.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7225, 'Military jokes', 'This is the difference between a lousy Golfer and a lousy Parachutist. The lousy Golfer goes splash then damn. The lousy Parachutist goes damn then splash.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7226, 'Military jokes', 'Father Murphy walked into a pub and said to the first Marine he met, "Do you want to go to heaven?" The Marine said, "I do Father." The priest said, "Leave this pub right now!" He then approached a second Marine. "Do you want to got to heaven?" "Certainly, Father," was the Marines reply. "Then leave this den of Satan!" said the priest. Father Murphy then walked up to an old SgtMaj and asked, "Do you want to go to heaven?" The SgtMaj replied: "No, I dont Father." The priest looked him right in the eye and said, "You mean to tell me that when you die you dont want to go to heaven?" The SgtMaj smiled, "Oh, when I die! Why...yes Father. Shit, I thought you were getting a working party together to go right now!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7227, 'Military jokes', 'A soldier keeps a mug upside down and tells the sergeant:- I cant drink from this mug. It has no opening.The sergeant examines the mug and says:- You are right. And besides this, it has no bottom.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7228, 'Military jokes', 'A general calls a colonel:- Do you have a couple of smart majors?- Yes I do.- Send them to me. I need to move my furniture around.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7229, 'Military jokes', 'Q: "What has an IQ of 42?" A: "40 Marines plus their lieutenant"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7230, 'Military jokes', 'Q. "Why does the Navy put Marines on board ships?" A. "Because sheep would be too obvious"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7231, 'Military jokes', 'Q. "Why do the commodes in Marine barracks have the cut-out type seats?" A. "So that if the seat falls while theyre drinking, it wont smack them in the back of the head"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7232, 'Military jokes', 'The story goes that Air Force One was over the UK a few years ago and called up a USAF base "Requesting Radar". "What is you position?" asked ATC "You got radar you find us" Air Force One replied. After a few minutes ATC announced "Air Force One were changing frequency" "What frequency are you changing to?" asked Air Force One "Youve got 720 channels - you find us!" ATC replied.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7233, 'Military jokes', 'Q: How many British navy Officers does it take to change a light bulb?A: Only one, but it takes him seven weeks to get there.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7234, 'Military jokes', 'Q: how many vietnam vets does it take to screw in a lightbulb?A: YOU DONT KNOW! YOU WERENT THERE, MAN!!! YOULL NEVER KNOW!!!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7235, 'Military jokes', 'Q: How many Honor Guards does it take to screw in a light bulb?A: 22, one to screw it in, 21 to shoot the bulb.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7236, 'Military jokes', 'Q: How many U.S marines does it take to screw in a light bulb ?A: 50. One to screw in the light bulb and the remaining 49 to guard him .', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7237, 'Military jokes', 'Q: How many Pentagon procurement officers does it take to change a lightbulb ?A: Look, for only $87 billion, we can put up this chain of fluorescent satellites that will illuminate the whole planet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7238, 'Military jokes', 'Q: How many military information officers does it take to change a lightbulb ?A: At the present point in time it is against policy and the best interests of military strategy to divulge information of such a statistical nature. Next question, please.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7239, 'Military jokes', 'During the Vietnam War, a hillbilly soldier shot about a dozen of the enemy during his first battle. The Sergeant said, "Howd you learn to shoot like that ? Have you ever been in combat before?" "Well suh," drawled the boy, "To be honest, this is my first public war."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7240, 'Military jokes', 'A destroyer pulled into a foreign port, and put down maximum liberty. The skeleton crew didnt notice a chimpanzee, escaped from a nearby civilian transport, crawled up the ropes and up to the smokestack. Down the stack, it made its way into the engine room. It came across a power panel opened up for maintenance, couldnt read the warning signs, and with a bright blue blast shorted out the ships electrical system, and plunged the ship into darkness. A little bit later, two junior Hull Technicians wander down with their flashlights, looking for the problem. They come upon the blackened body of the chimp. They shine their flashlights on its long, burnt arms. They look at each other. They highlight its short legs and odd feet. They look at each other. Finally one says, "Well, its too hairy to be an Electrician, the legs are too short for a Hull Tech, and there would be more tatoos on a Bosu n. Call the wardroom, see if one of the duty officers is missing."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7241, 'Military jokes', 'Short-sighted sarge: "Attention! You also, you little one in the back row with the red cap!""But sarge, thats a hydrant!"Sarge:"Anyway, in this place academics have to obey as well."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7242, 'Military jokes', '- When the general comes, report to me immediately. The general doesnt show. The sergeant gets nervous and every hour reminds the sentry to report about the generals arrival. Finally, the general comes in.- Where have you been? asks the sentry. The sergeant has already asked about you four times.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7243, 'Military jokes', 'A draftee went in for his physical wearing a truss and with a little convincing acting got his papers marked M.E. for Medically Exempt.Afterward a friend borrowed the truss to wear for his physical. At the end of the examination the doctor stamped M.E. on his papers."Does that mean Im medically exempt?" he asked."No," answered the doctor. "M.E. stands for Middle East. Anyone who can wear a truss upside down can certainly ride a camel."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7244, 'Military jokes', 'Colin Powell, once USAs highest ranking military officer, (now Secretary of State), loves to relate this incident from his Vietnam days. It shows the importance of clear objectives. Finding an outpost at a very vulnerable spot, Powell decided to investigate why it was location was chosen. He was assured that it was a very important outpost."Whats its mission?"" To protect the airfield!""Whats the airfield here for?""To resupply the outpost!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7245, 'Military jokes', 'Soldier Ivanov was ordered to peel a barrel of potatos.- In this day and age, the army should have a machine to peel potatos, complains Ivanov.- Absolutely, answered the sergeant. And you are its latest model.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7246, 'Military jokes', 'Sargeant Williams was the newest drill instructor at AOCS, Aviation Officer Candidate School and as such was always trying to impress his company commander and the other officers in the Command. Daily he was seen jumping all over his officer candidates and yelling at them as he supposedly developed them into future Naval Officers. We were lined up behind his company awaiting our turn to go into the mess hall for lunch. We all listened as Sargeant Williams yelled at his company, " you will eat in a military fashion, enjoy this delicious meal and fall by in formation at 1215, do you worms understand me?""Yes drill sargeant.""There are only three rules in this galley, shut up, eat up and get up, do you pukes understand me?""Yes drill sargeant.""Then proceed. Company forward march."When they got inside, they were surprised to see several Miss Florida contestants getting a tour of the mess hall.  Not one to let an opportunity slip by the drill sargeant yelled at the top of his lungs, " bravo company what is the first rule of the mess hall?"To his chagrin, his company all yelled out in unison, "shut up drill sargeant!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7247, 'Military jokes', 'Airmen had to launch two E-3 AWACS from a National Guard base after a heavey snow strom. Well after a 5 hour delay waiting for the snow to be plowed of, they were able to take-off. The planes taxied off and stoped a hundred yards to the flight line. The civilians had forgot to finish the rest of the taxi way.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7248, 'Military jokes', 'Q. What do Baghdad and Hiroshima have in common ? A. Nothing, yet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7249, 'Military jokes', 'Q: What does Saddam want for Thanksgiving ? A: Turkey.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7250, 'Military jokes', 'Q: What do Saddam Hussein and General Custer have in common ? A: They both want to know where the hell those Tomahawks are coming from !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7251, 'Military jokes', 'Q: What is the best Iraqi job ? A: Foreign Ambassador', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7252, 'Military jokes', 'Q: "How many members of the coalition does it take to screw in a light bulb?" A: "We are not prepared to comment on specific numbers at this time."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7253, 'Military jokes', 'Q: Did you hear that it is twice as easy to train Iraqi fighter pilots? A: You only have to teach them to take off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7254, 'Military jokes', 'Q: What is Iraqs national bird ? A: Duck', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7255, 'Military jokes', 'Q: Whats the difference between Aeroflot and the Scud Missile ? A: Aeroflot has killed more people.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7256, 'Military jokes', 'Q: How is Saddam like Fred Flintstone ? A: Both may look out their windows and see Rubble.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7257, 'Military jokes', 'Two paratrooper recruits in a plane:- Are you crazy, Vasily? You are going to jump without a parachute.- Is it mandatory to wear it?- Sure. Its raining outside.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7258, 'Military jokes', 'Recruits were shocked at the language the sergeant used in their unit. During a smoke break one young soldier asked: "Sergeant, where did you le-arn your language?""Learnit, hell, its a gift," proudly informed the NCO.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7259, 'Military jokes', 'The theatrical manager exclaimed: "Your last role was magnificent, Mr. Brown. You enacted so well that officer wounded on the battlefield. Your suffering looked very much like real." "It was. Ive got a large nail in my shoe." "Well," said the manager, "for heavens sake leave it in until the end of the run of the play."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7260, 'Military jokes', '- Who likes music? - asks a commander.- Two soldiers step forward.- All right. I bought a piano. Take it to my apartment on the fourth floor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7261, 'Military jokes', 'During camouflage training in Louisiana, a private disguised as a tree trunk had made a sudden move that was spotted by a visiting general."You simpleton!" the officer barked. "Dont you know that by jumping and yelling the way you did, you could have endangered the lives of the entire company?""Yes sir," the solder answered apologetically. "But, if I may say so, I did stand still when a flock of pigeons used me for target practice. And I never moved a muscle when a large dog peed on my lower branches. But When two squirrels ran up my pants leg and I heard the bigger say, "Lets eat one now and save the other until winter --- that did it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7262, 'Military jokes', 'Following some duty overseas, the officers at the Fort were planning a welcome home party and dance for the unit. Being an all male combat force, they decided to request coeds from some of the surrounding colleges to attend. The Captain called Vassar and was assured by the Dean that arrangements could be made to send over a dozen of their most trustworthy students. The Captain hesitated, then said, "Would it also be possible to send a dozen or so of the other kind?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7263, 'Military jokes', 'While practicing autorotations during a military night training exercise a Huey Cobra screwed up the landing and landed on the tail rotor. The landing was so hard that it broke off the tail boom. However, the chopper fortunately remained upright on its skids, sliding down the runway doing 360s. As the Cobra slid past the tower, trailing a brilliant shower of sparks, this was the radio exchange that took place... Tower: "Sir, do you need any assistance?" Cobra: "I dont know Tower, we aint done crashin yet."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7264, 'Money jokes', 'Why is money called dough? Because we all knead it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7265, 'Money jokes', 'Where do bees keep their money? In a honey box.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7266, 'Money jokes', 'Why did the mean teacher walk around with her purse open? Shed read there was going to be some change in the weather.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7267, 'Money jokes', 'Fred collected lots of money from trick-or-treating and he went to the candy store to buy some chocolate. "You should give that money to charity," said the sales girl.Fred thought for a moment and said, "No, Ill buy the chocolate. You give the money to charity."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7268, 'Money jokes', 'What happened when the cat swallowed a coin? There was money in the kitty.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7269, 'Money jokes', 'How can a can you double your money?By folding it in half.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7270, 'Money jokes', 'Three animals were having a drink in a cafe, when the owner asked for the money. "Im not paying," said the duck. "Ive only got one bill and Im not breaking it.""Ive spent my last buck," said the deer. "Then the duckll have to pay," said the skunk. "Getting here cost me my last scent."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7271, 'Money jokes', 'Dad, would you like to save some money?I certainly would, son. Any suggestions? Sure. Why not buy me a bike, then I wont wear my shoes out so fast.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7272, 'Money jokes', 'I hate paying my income tax.You should be a good citizen - why dont you pay with a smile? Id like to but they insist on money', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7273, 'Money jokes', 'What happened when Dumbo went to a mindrreader? They gave him his money back.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7274, 'Money jokes', 'The best way of saving money is to forget who you borrowed it from.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7275, 'Money jokes', 'Fred: Thank you so much for lending me that money. I shall be everlastingly in your debt. Harry: Thats what Im afraid of!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7276, 'Money jokes', 'Who dropped a wad of notes with an elastic band round them? I did! Well, heres the elastic band.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7277, 'Money jokes', 'A doctor had been attending a rich old man for some time, but it became apparent that the old chap had not long to live. Accordingly, the doctor advised his wealthy patient to put his affairs in order. "Oh yes, Ive done that," said the old gentleman. "Ive only got to make a will. And do you know what Im going to do with all my money? Im going to leave it to the doctor who saves my life."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7278, 'Money jokes', 'Have you heard about the new aftershave that drives women crazy? No! Tell me about it. It smells of $50 dollar bills.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7279, 'Money jokes', 'At the Cedar Rapids Chamber of Commerce meeting the treasurer reported a deficit of two hundred dollars.One of the chamber members stood up and said,"I vote that we donate half of it to the Red Cross and then give the other fifty dollars to the Salvation Army."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7280, 'Money jokes', 'Elmore walked into his favorite truck stop cafe and said to the owner,"Hey, Roy, you wanna take a chance on a raffle?" "Whada ya win?" "A million dollars!" said the redneck. "You get a dollar a year for a million years." "How much are they each?" "Ten cents. Two for a quarter. Or three for half a dollar!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7281, 'Money jokes', 'A business man called and had a question about the documents he needed in order to fly to China. After a lengthy discussion about passports, I reminded him he needed a visa. "Oh no I dont, Ive been to China many times and never had to have one of those." I double checked, and sure enough, his stay required a visa. When I told him this he said, "Look, Ive been to China four times and every time they have accepted my American Express."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7282, 'Money jokes', 'Three boys were walking along the beach one day when they see a cave. The first boy goes in and is looking at a banknote on a big rock when a ghostly voice calls out  I am the ghost of Auntie Abel and this five dollars stays on the table! The second boy goes in and is reaching for the money when the same thing happens again.The third boy goes in ,sees the five dollars and cries out,I am the ghost of David Crockett and this five dollars goes in my pocket!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7283, 'Money jokes', 'An English teacher asked her class to write an essay on what theyd do if they had a million dollars. Alec handed in a blank sheet of paper. Alec ! yelled the teacher, youve done nothing. Why?Because if I had a million dollars, thats exactly what I would do !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7284, 'Money jokes', 'Little Johnny was crying one day, and his dad asked him why. Ive lost five cents, sobbed Johnny.Dont worry, said his dad kindly. Heres five more for you,At this Johnny howled louder than ever.Now what is it ? asked his dad.I wish Id said Id lost ten cents!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7285, 'Money jokes', 'William: May I have some money for the man crying outside ?Mum: What crying man ?William: The one thats crying, Ice cream! Ice Cream !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7286, 'Money jokes', 'Johnny collected lots of money from trick or treating and he went to the candy store to buy some chocolate.  You should give that money to charity, said the shopkeeper.No, Ill buy the chocolate. You give the money to charity!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
