INSERT INTO `jokes` VALUES (7521, 'Movie and TV jokes', 'Q: How many Agents does it take to screw in a light bulb?A: Actually, agents will screw in just about anything.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7522, 'Movie and TV jokes', 'Q: How many Studio Executives does it take to screw in a light bulb?A: We dont know. Light bulbs last longer than studio executives.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7523, 'Movie and TV jokes', 'Q: How many Development Executives does it take to screw in a light bulb?A: Well, first lets talk about the concept behind this whole "light bulb" thing.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7524, 'Movie and TV jokes', 'Q: How many Development Executives does it take to screw in a light bulb?A: Two. One to take notes while the other screws it into the faucet.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7525, 'Movie and TV jokes', 'Q: How many Screenwriters does it take to screw in a light bulb? A: The bulbs IN and its staying IN!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7526, 'Movie and TV jokes', 'Q: How many Sound Recordists does it take to screw in a light bulb?A: WHAT?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7527, 'Movie and TV jokes', 'Q: How many 1st ADs does it take to screw in a light bulb?A: Why are you asking me that question? Cant you see Im busy!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7528, 'Movie and TV jokes', 'Q: How many 2nd ADs does it take to screw in a light bulb?A: Uh...standby, Ill check on that.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7529, 'Movie and TV jokes', 'Q: How many UPMs does it take to screw in a light bulb?A: None! If youd just make it a day exterior we wouldnt be screwing around with all these damn light bulbs!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7530, 'Movie and TV jokes', 'Q: How many fire safety guys dose it take to screw in a light bulb?A: One -- but its an 8 hour minimum.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7531, 'Movie and TV jokes', 'Q: How many absurdist/surrealist comedians does it take to screw in a light bulb?A: November.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7532, 'Movie and TV jokes', 'Q: What did the Production Manager give his kids for Christmas? A: Nothing. But he promised hed make it up to them on the next one.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7533, 'Movie and TV jokes', 'Q: How can you tell the dumbest actress working on a movie?A: Shes the one sleeping with the writer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7534, 'Movie and TV jokes', 'Q: How many screenwriters to make "Titanic" a good movie? A: One more than they had.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7535, 'Movie and TV jokes', 'After a difficult day a struggling actor returns to his neighborhood and is shocked to find a cadre of police and fire trucks surrounding the smoldering remains of his house. Explaining who he was he asks "What happened?" "Well," one of the officers says, "It seems that your agent came by your house earlier today and while he was here he attacked your wife, assaulted your children, beat your dog and burned your house to the ground." The actor is struck speechless, his jaw hanging open in disbelief... "My agent came to my house?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7536, 'Movie and TV jokes', 'After a difficult day a struggling actor returns to his neighborhood and is shocked to find a cadre of police and fire trucks surrounding the smoldering remains of his house. Explaining who he was he asks "What happened?" "Well," one of the officers says, "It seems that your agent came by your house earlier today and while he was here he attacked your wife, assaulted your children, beat your dog and burned your house to the ground." The actor is struck speechless, his jaw hanging open in disbelief... "My agent came to my house?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7537, 'Movie and TV jokes', 'After a venerable career of endless, stellar successes the greatest director who ever lived is in his prime and preparing for his most ambitious project ever when he unexpectedly dies and is called home to heaven. St. Peter meets him at the gate. "So sorry about your untimely death," he tells the director. "But God himself has called you home. You see, God wants you to direct a movie for Him." The great man is humbled, "God wants ME to direct a film?" "Yes," St. Peter tells him. "And weve arranged to have the best of everything made available to you. For example, the script is by William Shakespeare." The director is stunned, "An original screenplay by William Shakespeare?" "Yes," St. Peter assures him, "And its his greatest work ever." "Wow!" says the Director, awe struck. "Your Production Designer will be Michaelangelo. Weve got Leonardo Da Vinci d oing the sets, your musical score will be an original work by Wolfgang Amadeus Mozart and your cast includes a young Laurence Olivier and the greatest actors of all time in supporting roles." The Director cant believe it. "This is incredible," he says. "This will be the greatest movie ever?" St. Peter kind of shuffles his feet. "Well," he says, "we do have one tiny little problem." "Problem?" says the director. "What kind of a problem?" St. Peter puts his arm around the directors shoulder, "Ya see," he whispers, "Gods got this girlfriend..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7538, 'Movie and TV jokes', 'The producer of a low budget film is trying to convince the newly hired director of the quality of the work by telling him the big names theyve gotten for the cast. "First of all," he tells him, "Weve got Gibson in the lead." The director is surprised, "You got Mel Gibson?" "Well, no," the Producer responds, "we got Marvin Gibson, hes a distant cousin who lives in Queens, but hes very up and coming. And besides, weve also got Redford." "You got Robert Redford?" the director asks. "No, we got Jeremy Redford, but hes very talented and has lots of acting experience from years of dinner theater. But," he says enthusiastically, " weve got Streisand and in a singing role." "Barbara Streisand?" he asks. "No, Elizabeth Streisand." The Producer responds. "But shes got a great voice. AND weve got Goulet." "You got Robert Goulet?" the director asks.  "Yeah," the producer replies glumly, "we got Robert Goulet."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7539, 'Movie and TV jokes', 'One agent stops by another agents table to tell him the big news: "Elvis just died!" The second agent says nothing, then starts nodding. "Good career move."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7540, 'Movie and TV jokes', 'Denied membership in an exclusive country club because he was an actor, biblical epic star Victor Mature is reported to have said "Hell, Im no actor, and Ive got thirty movies to prove it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7541, 'Movie and TV jokes', 'Why was the actor pleased to be on the gallows? Because at last he was in the noose.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7542, 'Movie and TV jokes', 'Fred: Id love to be an actress. Harry: Break a leg then! Amy: Whatever for? Fred: Then youd be in a cast for weeks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7543, 'Movie and TV jokes', 'An actor went to see a new agent one day and said, `You must have a look at my act, it really is innovative.So saying, he flew up to the ceiling, circled the room a few times and landed smoothly on the agents desk.`So you do bird impressions, said the agent, `what else can you do?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7544, 'Movie and TV jokes', 'Whats the definition of a good actor? Somebody who tries hard to be everybody but himself.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7545, 'Movie and TV jokes', 'Neighbour: Havent I seen you on TV? Actor: Well, I do appear, on and off, you know. How do you like me? Neighbour: Off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7546, 'Movie and TV jokes', 'A bit-part actor finally got his first leading role in a major film. In one scene the actor had to jump off a high diving board in to a swimming pool. He climed to the top of the board, looked down and promptly climbed down again.`Whats the matter? asked the director.`I cant jump from that board! said the actor. `Do you know theres only one foot of water in that pool?Yes, said the director. `We dont want you to drown, you know.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7547, 'Movie and TV jokes', 'Why does an actor enjoy his work so much?Because its all play.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7548, 'Movie and TV jokes', 'Why do actors like snooker halls?Because thats where they get their best cues.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7549, 'Movie and TV jokes', 'Fred: I met a really conceited actor the other day.Harry: Why do you say hes conceited?Fred: Well, every time there was a thunderclap during the storm, he went to the window and took a bow.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7550, 'Movie and TV jokes', 'Producer: Would you call your leading lady ugly?Director: Lets just say shed look better on radio than on TV.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7551, 'Movie and TV jokes', 'Q: How many movie directors does it take to change a lightbulb? A: Just one, but he wants to do it thirty-two times and when hes done everyone thinks that his last lightbulb was much better.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7552, 'Movie and TV jokes', 'Why cant anyone stay angry long with an actress?Because she always makes up.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7553, 'Movie and TV jokes', 'What kind of star wears sunglasses?A movie star.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7554, 'Movie and TV jokes', 'What is an Actor? A man who tries to be everything but himself', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7555, 'Movie and TV jokes', 'What sort of animals make the best TV presenters ?Gnus - readers !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7556, 'Movie and TV jokes', 'What do you call a fight between film actors ?Star wars !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7557, 'Movie and TV jokes', 'What do you get if you cross a dog and a film studio ?Collie-wood !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7558, 'Movie and TV jokes', 'Why did Captain Kirk go into the ladies toilet ? To boldly go where no man has been before !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7559, 'Music jokes', 'Q: What is the difference between a lawnmower and a soprano sax?A: You can tune the lawnmower and the owners neighbors dont mind if you dont return the sax when you borrow it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7560, 'Music jokes', 'Q: How many alto sax players does it take to change a light bulb?A: Five. One to handle the bulb, and 4 to contemplate how David Sanborn wouldve done it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7561, 'Music jokes', 'Q: If you were out in the woods, who would you trust for directions, an in-tune tenor sax player, an out-of-tune tenor sax player, or Santa Claus?A: The out-of-tune sax player! You were hallucinating the other two.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7562, 'Music jokes', 'Q: Whats the definition of a gentleman?A: One who knows how to play the saxophone, but doesnt!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7563, 'Music jokes', 'Q: How do you make a trombone sound like a french horn?A: Stick your hand in the bell and play lots of wrong notes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7564, 'Music jokes', 'Q: What is the difference between a trombone and a trumpet?A: A trombone will bend before it breaks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7565, 'Music jokes', 'Q: There is a frog driving east and a trombonist walking west. What can be surmised from this?A: The frogs probably on its way to a gig.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7566, 'Music jokes', 'Q: How many lead trumpet players does it take to change a light bulb?A: Fifty. One to do it and the others to stand around and say, "I could do that better.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7567, 'Music jokes', 'Q: What do lead trumpet players use for birth control?A: Their personality.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7568, 'Music jokes', 'Q: What is the difference between a trumpet soloist and King Kong?A: King Kong is more sensitive.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7569, 'Music jokes', 'Q: Whats the difference between trumpet players and government bonds?A: Government bonds eventually mature and earn money.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7570, 'Music jokes', 'Q: How do you know when a trumpet player is at your door?A: The doorbell shrieks!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7571, 'Music jokes', 'Q: What is the range of a tuba?A: Twenty yards if youve got a good arm.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7572, 'Music jokes', 'Tuba Player: Did you hear my last recital?Friend: I hope so.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7573, 'Music jokes', 'Q: How do you fix a broken tuba?A: With a "tuba glue."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7574, 'Music jokes', 'Q: What is the best recording of the Walton viola concerto?A: Music Minus One.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7575, 'Music jokes', 'Q: What is the difference between a viola and a trampoline?A: You take off your shoes before you jump on the trampoline.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7576, 'Music jokes', 'Q: What is the difference between the first and last desk of a viola section?A: Half a measure.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7577, 'Music jokes', 'Conductor: Again from measure 5, if you please.Voice from viola section: But Maestro, we have no measure numbers.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7578, 'Music jokes', 'Q: What do you call a person who plays the viola?A: A violator.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7579, 'Music jokes', 'Q: Why are violas so large?A: It is an optical illusion. Its not that the violas are large, just that the viola players heads are so small.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7580, 'Music jokes', 'Q: What do you call the folks who hang around the musicians at conservatories?A: Violists.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7581, 'Music jokes', 'Q: What is the difference between a dog and a viola?A: The dog knows when to stop scratching.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7582, 'Music jokes', 'Q: Why cant you hear a viola on a digital recording?A: Recording technology has reached such an advanced level of development that all extraneous noise is eliminated.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7583, 'Music jokes', 'Q: What is the definition of a major seventh?A: A violist playing octaves.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7584, 'Music jokes', 'Q: How is lightning like a violists fingers?A: Neither one strikes in the same place twice.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7585, 'Music jokes', 'Q: Which positions does a violist use?A: First, third, and emergency.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7586, 'Music jokes', 'Q: Why are orchestra intermissions only twenty minutes long?A: So the violists dont need to be retrained.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7587, 'Music jokes', 'Q: When a 16-inch viola and a 17-inch viola are dropped simultaneously from a 30-story building, which one hits the pavement first?A: Who cares!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7588, 'Music jokes', 'Q: How do you get a viola section to play spiccato?A: Write a whole note with "solo" above it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7589, 'Music jokes', 'A violist and a cellist were standing on a sinking ship together."Help!" cried the cellist, "I cant swim!""Dont worry," said the violist, "just fake it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7590, 'Music jokes', 'A violist comes home late at night to discover fire trucks, police cars, and a smoking crater where his house used to be.The chief of police comes over to him and tells him, "While you were out, the conductor came to your house, killed your family, and burned the house down."The violist replied, "Youre kidding! The conductor came to my house?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7591, 'Music jokes', 'Q: How can you tell if a violin is out of tune?A: The bow is moving.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7592, 'Music jokes', 'Q: How do you make a violin sound like a viola?A: Sit in the back and dont play.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7593, 'Music jokes', 'Q: How do you make a violin sound like a viola?A: Play in the low register with a lot of wrong notes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7594, 'Music jokes', 'Q: What is the difference between a violin and a viola?A: A viola burns longer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7595, 'Music jokes', 'Q: Why does a viola burn longer than a violin?A: It is usually still in the case.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7596, 'Music jokes', 'Q: What do a viola and a lawsuit have in common?A: Everyone is happy when the case is closed.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7597, 'Music jokes', 'Q: Why is a violinist like a Scud missile?A: Both are offensive and inaccurate.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7598, 'Music jokes', 'Q: What is the difference between a violist and a terrorist?A: Terrorists have sympathizers.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7599, 'Music jokes', 'Q: Why dont violists play hide and seek?A: Because no one will look for them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7600, 'Music jokes', 'Q: Why shouldnt violists take up mountaineering?A: Because if they get lost, it takes ages before anyone notices that theyre missing.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7601, 'Music jokes', 'Jacques Thibault, the violinist, was once handed an autograph book by a fan while in the greenroom after a concert."Theres not much room on this page," he said. "What shall I write?"Another violinist, standing by, offered the following helpful hint, "Write your repertoire."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7602, 'Music jokes', 'Two violinists make a pact that whoever dies first, he will contact the other and tell him what life in Heaven is like. Poor Max has a heart attack and dies.He manages to make contact with Abe the next day.Abe says, "I cant believe this worked! So what is it like in Heaven?"Max replies, "Well, its great, but Ive got good news, and Ive got bad news. The good news is that theres a fantastic orchestra up here, and in fact, were playing "Sheherezade," your favorite piece, tomorrow night!"Abe says, "So whats the bad news?"Max replies, "Well, youre booked to play the solo!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7603, 'Music jokes', '"Havent I seen your face before?" a judge demanded, looking down at the defendant."You have, Your Honor," the man answered hopefully. "I gave your son violin lessons last winter.""Ah, yes," recalled the judge. "Twenty years!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7604, 'Music jokes', 'Q: How do you tell when your lead singer is at the door?A: He cant find the key and doesnt know when to come in.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7605, 'Music jokes', 'Q: What is the missing link between the bass and the ape?A: The baritone.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7606, 'Music jokes', 'Q: What is the difference between a Wagnerian soprano and a Wagnerian Tenor?A: About 10 pounds.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7607, 'Music jokes', 'Q: How can you tell when a tenor is really stupid?A: When the other tenors notice.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7608, 'Music jokes', 'Person 1: It must be terrible for an opera singer to realize that he can never sing again.Person 2: Yes, but its much more terrible if he doesnt realize it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7609, 'Music jokes', 'Q: Dad, why do the singers rock left and right while performing on stage?A: Because, son, it is more difficult to hit a moving target.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7610, 'Music jokes', 'Q: Mom, why do you always stand by the window when I practice for my singing lessons?A: I dont want the neighbours to think Im employing corporal punishment, dear.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7611, 'Music jokes', 'When a young hotshot conductor was making his debut at the Met, he showed the jaded and skeptical orchestra how well he knew the music by singing all parts of the Lucia sextet during rehearsal.Afterwards, one musician was overheard whispering to the other, impressed, "Well, this kid really knows his stuff!"The other replied, "I dont think he is so hot. Did you notice how flat his high E was at the end?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7612, 'Music jokes', 'Q: What is the definition of a Soviet String Quartet?A: A Soviet Symphony Orchestra after a tour of the USA!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7613, 'Music jokes', 'Q: What do you do with percussionists that lose one of their drumsticks?A: Stick them up front of the group and tell them to wave their arms!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7614, 'Music jokes', 'Q: Why are conductors hearts popular for transplants?A: Theyve had little use.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7615, 'Music jokes', 'A musician calls the orchestra office, asks for the conductor, and is told that he is dead.The musician calls back 25 times more and gets the same message from receptionist.She asks why he keeps calling. He replies, "I just like to hear you say it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7616, 'Music jokes', 'Q: What do you get when you play a new age song backwards?A: A new age song.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7617, 'Music jokes', 'Q: What happens if you sing country music backwards?A: You get your job and your wife back.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7618, 'Music jokes', 'Q: How can you tell someone is a true music lover?A: When they even put their ear up to the bathroom keyhole.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7619, 'Music jokes', 'Q: What do you get if Bach falls off a horse, but has the courage to get on again and continue riding?A: Bach in the saddle again.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7620, 'Music jokes', 'Q: How many bluegrass musicians does it take to screw in a light bulb?A: Two. One to screw it in, and one to complain that its electrified.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7621, 'Music jokes', 'Q: How many musicians does it take to change a light bulb?A: Twenty. 1 to hold the bulb, 2 to turn the ladder, and 17 to be on the guest list.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7622, 'Music jokes', 'Q: How many folk musicians does it take to change a light bulb?A: Seven; one to change and the other six to sing about how good the old one was.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7623, 'Music jokes', 'Q: Why dont they know where Mozart is buried?A: Because hes Haydn!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7624, 'Music jokes', 'Q: Whats musical and handy in a supermarket?A: A Chopin Liszt.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7625, 'Music jokes', 'Q: What do you get if Bach dies and is reincarnated as twins?A: A pair of Re-bachs.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7626, 'Music jokes', 'Q: What do you call a male quartet?A: Three men and a tenor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7627, 'Music jokes', 'Fritz Kriesler and Rachmaninov had a recital in Carnegie Hall once. In the middle of the music, Kriesler got lost and turned around to ask Rachmaninov, "Where are we?"Rachmaninov said, "Carnegie Hall, sir!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7628, 'Music jokes', 'A tourist is sightseeing in a European city. She comes upon the tomb of Beethoven, and begins reading the commerative plaque, only to be distracted by a low scratching noise, as if something was rubbing against a piece of paper.She collars a passing native and asks what the scratching sound is.The local person replies, "Oh, that is Beethoven. Hes decomposing."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7629, 'Music jokes', 'Q: What is the definition of an optimist?A: An accordion player with a pager.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7630, 'Music jokes', 'Q: Whats the range of an accordion?A: Twenty yards if youve got a good arm!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7631, 'Music jokes', 'Q: Whats the difference between an onion and an accordion?A: No-one cries when you chop up an accordion.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7632, 'Music jokes', 'Q: Whats the definition of perfect pitch?A: When an accordion is thrown down the toilet without it touching the sides.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7633, 'Music jokes', 'Q: How do you protect a valuable instrument?A: Hide it in an accordion case.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7634, 'Music jokes', 'Q: Whats an accordion good for?A: Learning how to fold a map.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
