INSERT INTO `jokes` VALUES (7636, 'Music jokes', 'Q: Why is it good that accordionists have a half-ounce more brains than horses?A: So they dont disgrace themselves in parades.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7637, 'Music jokes', 'Q: Why do bagpipers walk when they play?A: To get away from the noise.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7638, 'Music jokes', 'Q: Whats the only thing worse than a bagpiper?A: Good question. Were still trying to find out too.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7639, 'Music jokes', 'Q. How can you tell a bagpiper with perfect pitch? A. He can throw a set into the middle of a pond and not hit any of the ducks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7640, 'Music jokes', 'Q. How is playing a bagpipe like throwing a javelin blindfolded? A. You dont have to be very good to get peoples attention.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7641, 'Music jokes', 'Q. Why did the chicken cross the road? A. To get away from the bagpipe recital.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7642, 'Music jokes', 'Q. Whats the difference between a lawnmower and a bagpipe? A. You can tune the lawnmower, and the owners neighbors are upset if you borrow the lawnmower and dont return it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7643, 'Music jokes', 'Q. If you were lost in the woods, who would you trust for directions, an in-tune bagpipe player, an out of tune bagpipe player, or Santa Claus? A. The out of tune bagpipe player. The other two indicate you have been hallucinating.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7644, 'Music jokes', 'Q. Why do bagpipers leave their cases on their dashboards? A. So they can park in handicapped zones.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7645, 'Music jokes', 'Q. Whats the definition of a quarter tone? A. A bagpiper tuning his drones.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7646, 'Music jokes', 'Q. Whats the difference between a dead bagpiper in the road and a dead country singer in the road? A. The country singer may have been on the way to a recording session.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7647, 'Music jokes', 'Q. What did the bagpiper get on his I.Q. test? A. Drool.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
