INSERT INTO `jokes` VALUES (7660, 'Music jokes', 'Q: How many bass players does it take to change a light bulb?A: Only one - but the guitarist has to show him first.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7661, 'Music jokes', 'Q: How many bass players does it take to change a light bulb?A: Six. One to change it, five to fight off the lead guitarists who are hogging the light.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7662, 'Music jokes', 'Q: Did you hear about the drummer who locked his keys in his car?A: It took him four hours to get the bass player out.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
