INSERT INTO `jokes` VALUES (7685, 'Music jokes', 'Why did the boy who rode his bike over a barbed wire fence miss his music lesson? Because hed already done the sharps and flats.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7686, 'Music jokes', 'Whats musical and holds gallons and gallons of beer? A barrel organ.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
