INSERT INTO `jokes` VALUES (7688, 'Music jokes', 'Do you think, Professor, that my wife should take up the piano as a career? No, I think she should put down the lid as a favor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7689, 'Music jokes', 'Q: What do you get if you cross a lamp with a violin?A: You get light music.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7690, 'Music jokes', 'Q: Why did the boy bring a ladder to chorus?A: He wanted to sing higher!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7691, 'Music jokes', 'One day the bass player hid one of the drummers sticks.The drummer said, "finally! After being a drummer for so long, now I am a conductor!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7692, 'Music jokes', 'A down and out musician was playing his harmonica in the middle of a busy shopping mall. Striding over, a policeman asked, "May I please see your permit?" I dont have one," confessed the musician. "In that case, youll have to accompany me.""Splendid!" exclaimed the musician. "What shall we sing?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7693, 'Music jokes', '1st man: "My neighbors were screaming and yelling at three oclock this morning!"2nd man: "Did they wake you?"1st man: "Nah....I was up playing my bagpipes."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7694, 'Music jokes', 'Did you hear about the classical pianist who was not a good speller? When she went out to buy something she left a sign on her door that said: "Out Chopin. Be Bach in a minuet"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7695, 'Music jokes', 'Hey buddy. How late does the band play?About half a beat behind the drummer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7696, 'Music jokes', 'A saxophone is like a lawsuit.Everyone is happy when the case is closed.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7697, 'Music jokes', 'An eight-year-old kid says t his dad, "When I grow up, I want to be a musician."The dad says, "I am sorry -- cant have it both ways."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7698, 'Music jokes', 'How do you make a bandstand?Take away their chairs', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7699, 'Music jokes', 'Q.How is a heart like a musician?A.They both have a beat :)', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7700, 'Old age jokes', 'Seems an elderly gentleman had serious hearing problems for a number of years.He went to the doctor and the doctor was able to have him fitted for a set of hearing aids that allowed the gentleman to hear 100%. The elderly gentleman went back in a month to the doctor and the doctor said, "Your hearing is perfect. Your family must be really pleased that you can hear again."To which the gentleman said, "Oh, I havent told my family yet. I just sit around and listen to the conversations. Ive changed my will three times!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7701, 'Old age jokes', 'A wise old gentleman retired and purchased a modest home near a junior high school. He spent the first few weeks of his retirement in peace and contentment. Then a new school year began. The very next afternoon three young boys, full of youthful, after-school enthusiasm, came down his street, beating merrily on every trash can they encountered. The crashing percussion continued day after day, until finally the wise old man decided it was time to take some action.The next afternoon, he walked out to meet the young percussionists as they banged their way down the street. Stopping them, he said, "You kids are a lot of fun. I like to see you express your exuberance like that. In fact, I used to do the same thing when I was your age. Will you do me a favor? Ill give you each a dollar if youll promise to come around every day and do your thing." The kids were elated and continued to do a bang-up jo b on the trash cans.After a few days, the old-timer greeted the kids again, but this time he had a sad smile on his face. "This recessions really putting a big dent in my income," he told them. "From now on, Ill only be able to pay you 50 cents to beat on the cans."The noisemakers were obviously displeased, but they did accept his offer and continued their afternoon ruckus. A few days later, the wily retiree approached them again as they drummed their way down the street."Look," he said, "I havent received my Social Security check yet, so Im not going to be able to give you more than 25 cents. Will that be okay?" "A lousy quarter?" the drum leader exclaimed. "If you think were going to waste our time, beating these cans around for a quarter, youre nuts! No way, mister. We quit!" And the old man enjoyed peace.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7702, 'Old age jokes', 'Three ladies were discussing the travails of getting older. One said, "Sometimes I catch myself with a jar of mayonnaise in my hand, while standing in front of the refrigerator, and I cant remember whether I need to put it away, or start making a sandwich." The second lady chimed in with, "Yes, sometimes I find myself on the landing of the stairs and cant remember whether I was on my way up or on my way down." The third one responded, " Well, ladies, Im glad I dont have that problem. Knock on wood," as she rapped her knuckles on the table, and then said, "That must be the door, Ill get it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7703, 'Old age jokes', 'An elderly woman from Brooklyn decided to prepare her will and make her final requests. She told her rabbi she had two final requests. First, she wanted to be cremated, and second, she wanted her ashes scattered over Bloomingdales. "Bloomingdales!" the rabbi exclaimed. "Why Bloomingdales?" "Then Ill be sure my daughters visit me twice a week."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7704, 'Old age jokes', 'An 80 year old couple were having problems remembering things, so they decided to go to their doctor to get checked out to make sure nothing was wrong with them. When they arrived at the doctors, they explained to the doctor about the problems they were having with their memory. After checking the couple out, the doctor tells them that they were physically okay but might want to start writing things down and make notes to help them remember things. The couple thanked the doctor and left. Later that night while watching TV, the old man got up from his chair and his wife asks, "Where are you going?" He replies, "To the kitchen." She asks, "Will you get me a bowl of ice cream?" He replies, "Sure." She then asks him, "Dont you think you should write it down so you can remember it?" He says, "No, I can remember that." She then says, "Well, I also would like  some strawberries on top. You had better write that down cause I know youll forget that." He says, "I can remember that, you want a bowl of ice cream with strawberries." She replies, "Well, I also would like whip cream on top. I know you will forget that so you better write it down." With irritation in his voice, he says, "I dont need to write that down, I can remember that." He then fumes into the kitchen. After about 20 minutes he returns from the kitchen and hands her a plate of bacon and eggs. She stares at the plate for a moment and says, "You forgot my toast."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7705, 'Old age jokes', 'A young man saw an elderly couple sitting down to lunch at McDonalds. He noticed that they had ordered one meal, and an extra drink cup. As he watched, the gentleman carefully divided the hamburger in half, then counted out the fries, one for him, one for her, until each had half of them. Then he poured half of the soft drink into the extra cup and set that in front of his wife. The old man then began to eat, and his wife sat watching, with her hands folded in her lap. The young man decided to ask if they would allow him to purchase another meal for them so that they didnt have to split theirs. The old gentleman said, "Oh no. Weve been married 50 years, and everything has always been and will always be shared, 50/50." The young man then asked the wife if she was going to eat, and she replied, "Its his turn with the teeth."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7706, 'Old age jokes', 'The Senate is investigating deceptive sweepstakes practices. These companies target the elderly and make them think they will receive a bunch of money, but in reality they never see any of it. The most popular of these scams is called Social Security.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7707, 'Old age jokes', 'Two elderly women were out driving in a large car-both could barely see over the dashboard. As they were cruising along they came to an intersection. The stoplight was red but they just went on through. The woman in the passenger seat thought to herself "I must be losing it, I could have sworn we just went through a red light." After a few more minutes they came to another intersection and the light was red again and again they went right though. This time the woman in the passenger seat was almost sure that the light had been red but was really concerned that she was losing it. She was getting nervous and decided to pay very close attention to the road and the next intersection to see what was going on. At the next intersection, sure enough, the light was definitely red and they went right through and she turned to the other woman and said, "Mildred! Did you know we just ran through thre e red lights in a row! You could have killed us!" Mildred turned to her and said, "Oh, am I driving?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7708, 'Old age jokes', 'Worried because they hadnt heard anything for days from the widow in the neighboring apartment, Mrs. Silver said to her son, "Timmy, would you go next door and see how old Mrs. Kirkland is?"A few minutes later, Timmy returned."Well," asked Mrs. Silver, "is she all right?""Shes fine, except that shes angry at you.""At me?" the woman exclaimed. "Whatever for?""She said Its none of your business how old she is," snickered Timmy.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7709, 'Old age jokes', 'A reporter was interviewing a 104 year-old woman: "And what do you think is the best thing about being 104?" the reporter asked.She simply replied, "No peer pressure."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7710, 'Old age jokes', 'Ive sure gotten old. Ive had two By-pass surgeries. A hip replacement, new knees. Fought prostate cancer, and diabetes. Im half blind, cant hear anything quieter than a jet engine, take 40 different medications that make me dizzy, winded, and subject to blackouts. Have bouts with dementia. Have poor circulation, hardly feel my hands and feet anymore. Cant remember if Im 85 or 92. Have lost all my friends.But.....Thank God, I still have my Florida drivers license!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7711, 'Old age jokes', 'When you are young, you want to be the master of your fate and the captain of your soul. When you are older, you will settle for being the master of your weight and the captain of your bowling team.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7712, 'Old age jokes', 'Three old men are sitting on the porch of a retirement home. The first says, "Fellas, I got real problems. Im seventy years old. Every morning at seven oclock I get up and I try to urinate. All day long I try to urinate. They give me all kinds of medicine but nothing helps." The second old man says, "You think you have problems. Im eighty years old. Every morning at 8:00 I get up and try to move my bowels. I try all day long. They give me all kinds of stuff but nothing helps." Finally the third old man speaks up, "Fellas: Im ninety years old. Every morning at 7:00 sharp I urinate. Every morning at 8:00 I move my bowels. Every morning at 9:00 sharp I wake up."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7713, 'Old age jokes', 'There was an old man whose family could no longer afford to take care of him. So the family decided that a nusring for the aged would be appropriate. Of course the old man rejected the idea, but no sooner he was convinced that it was the right thing to do. On his first day at the home, he spent most of his time laying in bed reflecting on life, feeling lonely. A while later, an orderly stopped by to seee how the old mans first day was going. "How you doing today?", she said to the old man, "First day I see". The Old man replied with a nod. In no time the two began talking up a storm. As the conversation began to drag on, the orderly was eyeing the room filled with fresh flowers, cards and balloons from friends and relatives. She noticed a bowl full of peanuts sitting on top of the table next to the bed, and help herself to a handful. As the two continued to converse with eac h other, the orderly kept eating more helpings of the peanuts. She look at her watch and noticed that nearly 2 hours had passed and said, "My goodness, the time has gone by quickly. I have to tend to other people here too." "Thats okay.", said the old man, "I feel so much better being able to talk to someone." Looking into the bowl the orderly said, "I feel awful! I ate almost all of your peanuts!" The old man responded, "Thats okay. Ever since I got these false teeth, all I could do was suck the chocolate off of them anyhow."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7714, 'Old age jokes', 'A woman walked up to a little old man rocking in a chair on his porch. "I couldnt help noticing how happy you look," she said. "Whats your secret for a long happy life?" "I smoke three packs of cigarettes a day," he said. "I also drink a case of whiskey a week, eat fatty foods, and never exercise." "Thats amazing," the woman said. "How old are you? "Twenty-six," he said.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7715, 'Old age jokes', 'A retiring farmer in preparation for selling his land, needed to rid his farm of animals. So he went to every house in his town. To the houses where the man is the boss, he gave a horse. To the houses where the woman is the boss, a chicken was given. He got toward the end of the street and saw a couple outside gardening. "Whos the boss around here?" he asked. "I am." said the man. "I have a black horse and a brown horse," the farmer said, "which one would you like?" The man thought for a minute and said, "The black one." "No, no, no, get the brown one." the mans wife said. "Heres your chicken." said the farmer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7716, 'Old age jokes', 'An elderly widow and widower were dating for about five years. The man finally decided to ask her to marry. She immediately said "yes". The next morning when he awoke, he couldnt remember what her answer was! "Was she happy? I think so, wait, no, she looked at me funny..." After about an hour of trying to remember to no avail, he got on the telephone and gave her a call. Embarrassed, he admitted that he didnt remember her answer to the marriage proposal. "Oh", she said, "Im so glad you called. I remembered saying yes to someone, but I couldnt remember who it was."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7717, 'Old age jokes', 'Two elderly couples were enjoying friendly conversation when one of the men asked the other, "Fred, how was the memory clinic you went to last month?" "Outstanding," Fred replied. "They taught us all the latest psychological techiniques-visulization, association-it made a huge difference for me." "Thats great! What was the name of the clinic?" Fred went blank He thought and thought, but couldnt remember. Then a smile broke across his face and he asked, "What do you call that flower with the long stem and thorns?" "You mean a rose?" "Yes, thats it!" He turned to his wife. . ."Rose, what was the name of that clinic?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7718, 'Old age jokes', 'A small town prosecuting attorney called his first witness to the stand in a trial--a grandmotherly, elderly woman. He approached her and asked, "Mrs. Jones, do you know me?" She responded, "Why, yes, I do know you Mr. Williams. Ive known you since you were a young boy. And frankly, youve been a big disappointment to me. You lie, you cheat on your wife, you manipulate people and talk about them behind their backs. You think youre a rising big shot when you havent the brains to realize you never will amount to anything more than a two-bit paper pusher. Yes, I know you." The lawyer was stunned. Not knowing what else to do he pointed across the room and asked, "Mrs. Williams, do you know the defense attorney?" She again replied, "Why, yes I do. Ive known Mr. Bradley since he was a youngster, too. I used to baby-sit him for his parents. And he,too, has been a real disappointment to  me. Hes lazy, bigoted, he has a drinking problem. The man cant build a normal relationship with anyone and his law practice is one of the shoddiest in the entire state. Yes, I know him." At this point the judge rapped the courtroom to silence and called both counselors to the bench. In a very quiet voice, he said with menace, "If either of you asks her if she knows me, youll be in jail for contempt within 5 minutes!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7719, 'Old age jokes', 'Two police officers saw this old woman staggering down the street, stopping her they can tell she has had far too much to drink and instead of taking her to jail they decide to just drive her home. They loaded her into the police cruiser one of the officers gets in the back with the drunk woman. As they drove through the streets they kept asking the woman where she lived, all she would say as she stroked the officers arm is "Your Passionate" They drove awhile longer and asked again, again the same response as she stroked his arm "Your Passionate". The officers were getting a little upset so they stopped the car and said to the woman, Look we have driven around this City for two hours and you still havent told us where you live. She replied I keep trying to tell you: "Your Passin It!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7720, 'Old age jokes', 'An elderly lady was well-known for her faith and for her boldness in talking about it. She would stand on her front porch and shout "PRAISE THE LORD!"Next door to her lived an atheist who would get so angry at her proclamations he would shout, "There aint no Lord!!"Hard times set in on the elderly lady, and she prayed for GOD to send her some assistance. She stood on her porch and shouted "PRAISE THE LORD. GOD I NEED FOOD!! I AM HAVING A HARD TIME. PLEASE LORD, SEND ME SOME GROCERIES!!"The next morning the lady went out on her porch and noted a large bag of groceries and shouted, "PRAISE THE LORD."The neighbor jumped from behind a bush and said, "Aha! I told you there was no Lord. I bought those groceries, God didnt."The lady started jumping up and down and clapping her hands and said, "PRAISE THE LORD. He not only sent me groceries, but He made the devil pay for them.  Praise the Lord!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7721, 'Old age jokes', 'One day a lady was driving on the Highway. She frequently checked her speed gauge to make sure she stayed within the speed limit. However, when she looked into her rear mirror, much to her dismay, she saw a police car not far behind! And, to make matters worse, the police car turned on his flashing lights. She thought to herself, "Uh-oh, what have I done now? Im not speeding. Im not drinking. I have my seat belt on! I have kept up my license dues and everything!"So, she pulled over and the police car pulled over to the side right behind her car. She drove her car slowly to a stop, slowly rolled down the window, and prepared for a ticket when she knew she didnt deserve it. A policeman walked up to her window, and spoke to her. The lady pointed to her ear and shook her head, meaning she was deaf. The policeman smiled slightly, and knowing sign language, signed back, "I know. Im here to  tell you that your horn is stuck."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7722, 'Old age jokes', 'Two elderly women were staring at the numbers ofthe floors listed above the elevator door. When askedif they needed any assistance with something, oneasked how they were going to be able to reach way upthere to push the button for their floor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7723, 'Old age jokes', 'An elderly couple were driving across the country. The woman was driving when she got pulled over by the highway patrol. The officer said, "Maam did you know you were speeding?" The woman, hard of hearing, turned to her husband and asked, "What did he say?" The old man yelled, "He says you were speeding!" The patrolman said, "May I see your license?" The woman turned to her husband once again and asked, "What did he say?" The old man yelled, "He wants to see your license!" The woman gave the officer her license. The patrolman then said, "I see you are from Arkansas. I spent some time there once and went on a blind date with the ugliest woman Ive ever seen." The woman turned to her husband and asked, "What did he say?" The old man yells, "He said he thinks he knows you!".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7724, 'Old age jokes', 'An eighty year old couple were having problems remembering things, so they decided to go to their doctor to make sure nothing was wrong with them. When they arrived at the doctors office, they explained to the doctor about the problems they were having with their memory. After checking the couple out, the doctor told them that they were physically okay but might want to start writing things down, making notes to help them remember things. The couple thanked the doctor and left. Later that night while watching TV, the old man got up from his chair and his wife asked, "Where are you going?" He replied, "To the kitchen." She asked, "Will you get me a bowl of ice cream?" "Sure." Then his wife asked him, "Dont you think you should write it down so you can remember it?" "No, I can remember that." "Well, I also would like some strawberries on top. You had bett er write that down cause I know youll forget that," his wife said. "I can remember that, you want a bowl of ice cream with strawberries." She replied, "Well, I also would like whipped cream on top. I know you will forget that. You had better write it down." With irritation in his voice, he said, "I dont need to write that down, I can remember that." He went into the kitchen. After about 20 minutes, he returned from the kitchen and handed her a plate of bacon and eggs. She stared at the plate for a moment and said, "You forgot my toast."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7725, 'Old age jokes', 'One day, an out-of-work man knocks on the door of a home in an upper-class neighborhood. The lady of the house answers. "Pardon me Mam, Im out of work and looking for any odd jobs that people need done. Im very handy with everything from repairs to yard work, to painting..." "Painting?" the woman jumped in. "Oh, yes, Maam! Im a very careful painter," the man replied, his face brightening at the realization she could provide him some work. "Ill tell you what. My husband just bought some green paint last week to paint the porch out back with, but we havent had any time. If you can do a good job, then you can paint it before he gets home and surprise him. "Now, do a particularly good job and paint the trimmings white also, and Ill pay you an extra bonus." "Oh yes, Maam, Ill do an excellent job!" He was told the paints were also around back in the garage. \r nA few hours later, the man returns to the door. "That was quick, did you do a good job?" the woman inquires. "Oh yes Maam, two coats! But theres something you should know," the man says. "Thats not a Porsche, thats a Mercedes!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7726, 'Old age jokes', 'A group of senior citizens were exchanging notes about their ailments. "My arm is so weak I can hardly hold this coffee cup." "Yes, I know. My cataracts are so bad I cant see to pour the coffee." "I cant turn my head because of the arthritis in my neck." "My blood pressure pills make my dizzy." "I guess thats the price we pay for getting old." "Well, its not all bad. We should be thankful that we can still drive."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7727, 'Old age jokes', 'A young woman on a rough Atlantic crossing was in hercabin undressing then suddenly she was overcome by seasickness. In a panic she rushed into the corridor andheaded for the bathroom. It was not until she collidedwith an elderly gentleman that she realized she didnthave a stitch of clothing on. Horrified, she let out ashriek. Her fellow sufferer looked at her sadly."Dont let it bother you, miss," he moaned. "Ill neverlive to tell anyone."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7728, 'Old age jokes', 'An old lady was standing at the railing of the cruise ship holdingher hat on tight, so that it would not blow off in the wind.A gentleman approached her and said: "Pardon me, madam. I do notintend to be forward, but did you know that your dress is blowingup in this high wind?""Yes, I know," said the lady, "I need both hands to hold onto this hat."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7729, 'Old age jokes', 'One night, an 87-year-old woman came home from Bingo to find her husband in bed with another woman. Angry, she became violent and ended up pushing him off the balcony of their apartment, killing him instantly. When brought before the court on charges of murder, she was asked if she had anything to say to defend herself."Well, Your Honor," she replied coolly. "I figured that at 92, if he could make love to another woman, he could fly!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7730, 'Old age jokes', 'A strained voice called out through the darkenedtheater, "Please, is there a doctor in the house?!" Several men stood up as the lights came on. An older lady pulled her daughter to stand next to her,"Good, are any of you doctors single and interested ina date with a good, Jewish girl?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7731, 'Old age jokes', 'A little Italian grandfather comes up to Customs.The Customs official says, "Have you got anything to declare?"He thinks a second and he says, "Its a nice-a day!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7732, 'Old age jokes', 'A tiny but dignified old lady was among a group looking at an art exhibition in a newly opened gallery. Suddenly one contemporary painting caught her eye."What on earth," she inquired of the artist standing nearby, "is that?"He smiled condescendingly. "That, my dear lady, is supposed to be a mother and her child.""Well, then," snapped the little old lady, "why isnt it?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7733, 'Old age jokes', 'Minutes before the cremation, the undertaker quietly sat down next to the grieving widow. "How old was your husband?" he asked."He was ninety-eight," she answered softly. "Two years oder than I am.""Really?" the undertaker said. "Hardly worth going home, wouldnt you say?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7734, 'Old age jokes', 'The 75 year old man and his young, knockout wife wereshopping in an upscale jewelry boutique when the mansoldest friend bumped into him. Eyeing the curvaceousblonde bending over the counter to try on a necklace,the friend asked "How in the hell did YOU land a wifelike that?" The old man whispered back, "Easy. I told her I was 90!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7735, 'Old age jokes', 'Whats the worst thing about having to kiss Grandma?When the damn coffin lid falls and hits you in the head.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7736, 'Old age jokes', 'Two really old guys decided they would go out and try to play a round of golf together. They get on the first tee and the first old guy says to the second, "My eyesight isnt what it used to be. Can you watch my ball for me?".The second guy says, "Sure! I see fine. Go ahead and hit."So the first old man steps up to the tee and really hits it. He turns to his buddy and says, "Did you see it?"."Sure!", says his buddy."Where did it go?", the first guy asks. The second old man thinks for a minute and says, "I cant remember."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7737, 'Old age jokes', 'Whats the best thing about turning 65?No more calls from insurance salesmen.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7738, 'Old age jokes', '"Whats wrong, sonny?" asked the old timer sympathetically, coming overto the little kid who was sitting on the curb, crying his heart out."Im crying cause I cant do what the big boys do!" So the old man sat down and wept too.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7739, 'Old age jokes', 'How do you get four old ladies to say the F word?Have the fifth one say.... BINGO!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7740, 'Old age jokes', 'A little old lady walked into the bank, cashed a small check, and started out. Passing the armed guard, she smiled and said, "You can go home now."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7741, 'Old age jokes', 'Perhaps you know why women over fifty dont have babies.They would put them down somewhere and forget where they left them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7742, 'Old age jokes', 'Two 80 year old men are driving down the road when they hear the Ex-Lax commercial end with the statement: "It makes you feel young again." John looks at Sylvester and says, "We need to pull over and get a bottle of that stuff!" Sylvester agrees and the two old men pull over and get a bottle of Ex-Lax. They both take two tablespoons each and continue to drive. About one mile later Sylvester asks, "Well John, do you feel young yet?" "No," replies John. So they pull over and take four more tablespoons a piece and continue to drive down the road. A couple of miles later, Sylvester asks, "John, do you feel younger?" "No," replies John, "but I sure did a childish thing!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7743, 'Old age jokes', 'A wise old gentleman retired and purchased a modest home near a junior high school. He spent the first few weeks of his retirement in peace and contentment. Then a new school year began. The very next afternoon three young boys, full of youthful, after-school enthusiasm, came down his street, beating merrily on every trash can they encountered. The crashing percussion continued day after day, until finally the wise old man decided it was time to take some action.The next afternoon, he walked out to meet the young percussionists as they banged their way down the street. Stopping them, he said, "You kids are a lot of fun. I like to see you express your exuberance like that. In fact, I used to do the same thing when I was your age. Will you do me a favor? Ill give you each a dollar if youll promise to come around every day and do your thing." The kids were elated and continued to do a bang-u p job on the trash cans.After a few days, the old-timer greeted the kids again, but this time he had a sad smile on his face. "This recessions really putting a big dent in my income," he told them. "From now on, Ill only be able to pay you 50 cents to beat on the cans."The noisemakers were obviously displeased, but they did accept his offer and continued their afternoon ruckus. A few days later, the wily retiree approached them again as they drummed their way down the street."Look," he said, "I havent received my Social Security check yet, so Im not going to be able to give you more than 25 cents. Will that be okay?" "A lousy quarter?" the drum leader exclaimed. "If you think were going to waste our time, beating these cans around for a quarter, youre nuts! No way, mister. We quit!" And the old man enjoyed peace.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7744, 'Old age jokes', 'Worried because they hadnt heard anything for days from the widow in the neighboring apartment, Mrs. Silver said to her son, "Timmy, would you go next door and see how old Mrs. Kirkland is?"A few minutes later, Timmy returned."Well," asked Mrs. Silver, "is she all right?""Shes fine, except that shes angrywith you.""With me?" the woman exclaimed. "Whatever for?""She said Its none of your business how old she is," snickered Timmy.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7745, 'Old age jokes', 'Grandpa: You youngsters are soft and lazy today. When I was your age I got up at six oclock every morning and walked five or six miles before breakfast. I used to think nothing of it. Fred: I dont blame you, Grandpa. I wouldnt think,much of it myself.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7746, 'Old age jokes', 'An American tourist found himself in a sleepy country village, and asked one of the locals the age of the oldest inhabitant. "Well, sir," replied the villager, "we aint got one now. He died last week."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7747, 'Old age jokes', 'Fred: I havent slept a wink for the past two nights. Harry: Whys that? Fred: Granny broke her leg. The doctor put it in plaster and told her she shouldnt walk upstairs. You should hear the row when she climbs up the drainpipe.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7748, 'Old age jokes', 'How old is your Grandma? I dunno, but weve had him a long time.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7749, 'Old age jokes', 'How can you tell an old person from a young person? An old person can sing and brush their teeth at the same time.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7750, 'Old age jokes', 'Why is it easy to break in to an old mans house? Because his gait is broken, and his locks are few.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7751, 'Old age jokes', 'My grandma has so many wrinkles she has to screw her hat on.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7752, 'Old age jokes', '"Grandma, why dont you drink tea anymore?" "I dont like it ever since that tea bag got stuck in my throat."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7753, 'Old age jokes', 'An 80-year-old man is having his annual checkup. The doctor asks him how hes feeling. "Ive never been better!" he replies. "Ive got an 18-year-old bride whos pregnant and having my child! Whatdo you think about that?"The doctor considers this for a moment, then says, "Well, let me tell you a story. I know a guy whos an avid hunter. He never misses a season. But one day hes in a bit of a hurry and he accidentally grabs his umbrella instead of his gun.""So hes in the woods," the doctor continues, "and suddenly a grizzly bear appears in front of him! He raises up his umbrella, points it at the bear, and squeezes the handle. The bear drops dead in front of him, suffering from a bullet wound in his its chest.""Thats impossible! Someone else must have shot that bear," the man said."Exactly."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7754, 'Old age jokes', 'Two elderly ladies had been friends for many decades. Over the years they had shared all kinds of activities and adventures. Lately, their activities had been limited to meeting a few times a week to play cards.One day they were playing cards when one looked at the other and said, "Now dont get mad at me... I know weve been friends for a long time, but I just cant remember your name. Ive thought and thought, but I cant recall it. Please tell me what your name is."Her friend glared at her. For at least three minutes she just looked at her.Finally she said, "How soon do you need to know?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7755, 'Old age jokes', 'Seventy-two-year-old Edgar recently picked a new primary care physician. After two visits and exhaustive lab tests, the doctor said Edgar was doing "fairly well" for his age.A little concerned about that comment, Edgar couldnt resist asking the doctor, "Do you think Ill live to be 80?"The doctor asked, "Well, do you smoke or drink beer?""Oh no," Edgar replied, "Ive never done either."Then the doctor asked, "Do you eat rib-eye steaks and bar-b-qued ribs?"Edgar said, "No, Ive heard that all red meat is very unhealthful!""Do you spend a lot of time in the sun, like playing golf?" the doctor asked."No, I dont," Edgar replied.Then the doctor asked, "Do you gamble, drive fast cars, or run around with women?""No," Edgar said, "I dont do any of those things."The good doctor looked at Edgar and said, "Then why the heck do you want to live to  be 80?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7756, 'Old age jokes', 'Do you think my skin is starting to show its age?""I cant tell. There are too many wrinkles."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7757, 'Old age jokes', 'How can you tell that youre getting old? You go to an antique auction and three people bid on you!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7758, 'Old age jokes', 'Are you getting older and wiser? No, hes getting older and wider!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7759, 'Old age jokes', 'A grandmother was telling her little granddaughter what her own childhood was like: "We used to skate outside on a pond. I had a swing made from a tire; it hung from a tree in our front yard. We rode our pony. We picked wild raspberries in the woods."The little girl was wide-eyed, taking this in. At last she said, "I sure wish Id gotten to know you sooner!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7760, 'Old age jokes', 'You have to stay in shape. My grandmother started walking five miles a day when she was 60. Shes 97 today and we dont know where the hell she is.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7761, 'Old age jokes', 'One day, a grandpa and his grandson go golfing. The young one is really good and the old one is just giving him tips. They are on hole 8 and there is a tree in the way and the grandpa says, "When I was your age, I would hit the ball right over that tree." So, the grandson hits the ball and it bumps against the tree and lands not to far from where it started. "Of course," added the grandpa, "when I was your age, the tree was only 3 feet tall."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7762, 'Parent jokes', 'When our second child was on the way, my wife and I attended a pre-birth class aimed at couples who had already had at least one child.The instructor raised the issue of breaking the news to the older child. It went like this: "Some parents," she said, "tell the older child, We love you so much we decided to bring another child into this family. But think about that. Ladies, what if your husband came home one day and said, Honey, I love you so much I decided to bring home another wife." One of the women spoke up immediately. "Does she cook???"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7763, 'Parent jokes', 'On a flight to Florida, I was preparing my notes for one of the parent-education seminars I conduct as an educational psychologist.The elderly woman sitting next to me explained that she was returning to Miami after having spent two weeks visiting her six children, 18 grandchildren and ten great-grandchildren in Boston.Then she inquired what I did for a living.I told her, fully expecting her to question me for free professional advice. Instead she sat back, picked up a magazine and said, "If theres anything you want to know, just ask me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7764, 'Parent jokes', 'For two solid hours, the lady sitting next to a man on an airplane had told him about her grandchildren. She had even produced a plastic-foldout photo album of all nine of the children.She finally realized that she had dominated the entire conversation on her grandchildren."Oh, Ive done all the talking, and Im so sorry. I know you certainly have something to say. Please, tell me... what do you think of my grandchildren?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7765, 'Parent jokes', 'A woman meant to call a record store but dialed the wrong number and got a private home instead. "Do you have Eyes of Blue and A Love Supreme?" she asked. "Well, no," answered the puzzled homeowner. "But I have a wife and eleven children." "Is that a record?" she inquired. "I dont think so," replied the man, "but its as close as I want to get."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7766, 'Parent jokes', 'Kids can sometimes ask the toughest questions.Son: Father, Can I ask you a question?Father: Ok ask.Son: When a doctor doctors a doctor, does the doctor doing the doctoring doctor as the doctor being doctored wants to be doctored or does the doctor doing the doctoring doctor as he wants to doctor.Father: !!!??????!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7767, 'Parent jokes', 'For weeks a six-year old lad kept telling his first-grade teacher about the baby brother or sister that was expected at his house.One day the mother allowed the boy to feel the movements of the unborn child. The six-year old was obviously impressed, but made no comment. Furthermore, he stopped telling his teacher about the impending event.The teacher finally sat the boy on her lap and said, "Tommy, whatever has become of that baby brother or sister you were expecting at home?"Tommy burst into tears and confessed, "I think Mommy ate it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7768, 'Parent jokes', 'Four expectant fathers were in a Minneapolis hospital waiting room, while their wives were in labor.The nurse arrived and announced to the first man, "Congratulations sir, youre the father of twins.""What a coincidence!" the man said with some obvious pride. "I work for the Minnesota Twins baseball team."The nurse returned in a little while and turned to the second man, "You, sir, are the father of triplets.""Wow, thats really an incredible coincidence," he answered. "I work for the 3M Corporation. My buddies at work will never let me live this one down."An hour later, while the other two men were passing cigars around, the nurse came back. This time, she turned to the third man, who had been quiet in the corner. She announced that his wife had just given birth to quadruplets. Stunned, he barely could reply."Dont tell me another coincidence?" asked the nurse. r\nAfter finally regaining his composure, he said, "I dont believe it, I work for the Four Seasons Hotel."After hearing this, everybodys attention turned to the fourth guy, who had just fainted, flat out on the floor. The nurse rushed to his side and, after some time, he slowly gained back his consciousness.The nurse asked, "Sir, are you all right?""Yes" says the man, "Im o.k. now. I just had a shocking thought. I work at the 7-11 Store."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7769, 'Parent jokes', 'There was a woman who was pregnant with twins, and shortly before they were due, she had an accident and went into a coma. Her husband was away on business, and unable to be reached. While in the coma, she gave birth to her twins, and the only person around to name her children was her brother.When the mother came out of her coma to find she had given birth and that her brother had named the twins, she became very worried, because he wasnt a very bright guy. She was sure he had named them something absurd or stupid.When she saw her brother she asked him about the twins.He said, "The first one was a girl."The mother: "What did you name her?!?"Brother: "Denise!"The Mom: "Oh, wow, thats not bad! What about the second one?"Brother: "The second one was a boy."The Mom: "Oh, and what did you name him?"Brother: "Denephew."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7770, 'Parent jokes', 'A country doctor went way out to the boondocks to deliver a baby.It was so far out, there was no electricity. When the doctor arrived, no one was home except for the laboring mother and her 5-year-old child. The doctor instructed the child to hold a lantern high so he could see, while he helped the woman deliver the baby.The child did so, the mother pushed and after a little while, the doctor lifted the newborn baby by the feet and spanked him on the bottom to get him to take his first breath.The doctor then asked the 5-year-old what he thought of the baby."Hit him again," the 5-year-old said. "He shouldnt have crawled up there in the first place!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7771, 'Parent jokes', 'There was this little kid who had a bad habit of sucking his thumb. His mother finally told him that if he didnt stop sucking his thumb, hed get fat.Two weeks later, his mother had her friends over for a game of bridge. The boy points to an obviously pregnant woman and says, "Ah, ha! I know what youve been doing!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7772, 'Parent jokes', 'A woman got on a bus holding a baby.The bus driver said: "Thats the ugliest baby Ive ever seen."In a huff, the woman slammed her fare into the fare box and took an aisle seat near the rear of the bus.The man seated next to her sensed that she was agitated and asked her what was wrong."The bus driver insulted me," she fumed.The man sympathized and said: "Why, hes a public servant and shouldnt say things to insult passengers.""Youre right," she said. "I think Ill go back up there and give him a piece of my mind.""Thats a good idea," the man said. "Here, let me hold your monkey."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7773, 'Parent jokes', 'A man observed a woman in the grocery store with a three year old girl in her basket. As they passed the cookie section, the child asked for cookies and her mother told her "no." The little girl immediately began to whine and fuss, and the mother said quietly, "Now Ellen, we just have half of the aisles left to go through; dont be upset. It wont be long." He passed the Mother again in the candy aisle. Of course, the little girl began to shout for candy. When she was told she couldnt have any, she began to cry. The mother said, "There, there, Ellen, dont cry. Only two more aisles to go, and then well be checking out." The man again happened to be behind the pair at the check-out, where the little girl immediately began to clamor for gum and burst into a terrible tantrum upon discovering there would be no gum purchased today. The mother patiently said, "Ellen, well be through this ch eck out stand in five minutes, and then you can go home and have a nice nap." The man followed them out to the parking lot and stopped the woman to compliment her. "I couldnt help noticing how patient you were with little Ellen..." The mother broke in, "My little girls name is Tammy... Im Ellen."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7774, 'Parent jokes', 'The lifeguard told the mother to make her young son stop urinating in the pool."Everyone knows," the mother lectured him, "that from time to time, young children will urinate in a pool." "Oh really?" said the lifeguard, "from the diving board!?!?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7775, 'Parent jokes', 'Martin had just received his brand new drivers license. The family troops out to the driveway, and climbs in the car, where he is going to take them for a ride for the first time. Dad immediately heads for the back seat, directly behind the newly minted driver. "Ill bet youre back there to get a change of scenery after all those months of sitting in the front passenger seat teaching me how to drive," says the beaming boy to his father. "Nope," comes dads reply, "Im gonna sit here and kick the back of your seat as you drive, just like youve been doing to me all these years."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7776, 'Parent jokes', 'A very successful businessman had a meeting with his new son-in-law. "I love my daughter, and now I welcome you into the family," said the man. "To show you how much we care for you, Im making you a 50-50 partner in my business. All you have to do is go to the factory every day and learn the operations." The son-in-law interrupted, "I hate factories. I cant stand the noise." "I see," replied the father-in-law. "Well, then youll work in the office and take charge of some of the operations." "I hate office work," said the son-on-law. "I cant stand being stuck behind a desk all day." "Wait a minute," said the father-in-law. "I just make you half-owner of a moneymaking organization, but you dont like factories and wont work in a office. What am I going to do with you?" "Easy," said the young man. "Buy me out."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7777, 'Parent jokes', 'A small boy is sent to bed by his father...[Five minutes later] "Da-ad..." "What?" "Im thirsty. Can you bring me a drink of water?" "No. You had your chance. Lights out." [Five minutes later] "Da-aaaad..." "WHAT?" "Im THIRSTY...Can I have a drink of water??" "I told you NO! If you ask again Ill have to spank you!!" [Five minutes later] "Daaaa-aaaAAAAD..." "WHAT??!!" "When you come in to spank me, can you bring me a drink of water?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7778, 'Parent jokes', 'Q: How much does it cost to get married, Dad?A: I dont know son, Im still paying for it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7779, 'Parent jokes', 'What do young ghosts call their parents? Deady and Mummy.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7780, 'Parent jokes', 'When is a parent like a child?When hes a miner.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7781, 'Parent jokes', 'Whats another name for an parent?Someone whos stopped growing except around the waist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7782, 'Parent jokes', 'Why are parents boring?Because theyre groan-ups.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7783, 'Parent jokes', 'What didnt Adam and Eve have that everyone else has?Parents.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7784, 'Parent jokes', 'We spend the first twelve months of our childrens lives teaching them to walk and talk, and the next Twenty-four years telling them to sit down and shut up!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7785, 'Parent jokes', 'When Ben hit his thumb with a hammer he let out a few choice words. Shocked by her sons outburst, his mother said, "Dont you dare use that kind of language in here." "William Shakespeare did," replied Ben. "Well, youd better stop going around with him," said Mom.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7786, 'Parent jokes', 'NEWS ITEM. Kidnappers grabbed a little boy and two days later sent him home with a ransom note. His parents immediately sent the kid back with the money.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7787, 'Parent jokes', 'Tad looked up from the book on ancient history he was reading and asked his father, "Pop, whats a millennium?" "Well," he muttered, "I think its something like a centennial, only it has more legs!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7788, 'Parent jokes', 'Son: Where are the Himalayas? Father: If youd put things away, youd know where to find them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7789, 'Parent jokes', '"Can I go outside and watch the solar eclipse?" asked Rupert. "Okay," replied his father, "but dont stand too close."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7790, 'Parent jokes', 'Father: Dont you think our son gets his brains from me? Mother: Probably, dear. I still have all of mine.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7791, 'Parent jokes', 'Young Bobby was being fitted for glasses, and his father, standing beside him, said, "Now, remember, son. Dont wear them when youre not looking at anything."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7792, 'Parent jokes', '"Papa, who was Hamlet?" "You birdbrain! Bring me the Bible and Ill show you who he was."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7793, 'Parent jokes', '"Dad, do you believe in Buddha?" "Why, of course, but I think margarine is just as good."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7794, 'Parent jokes', '"Dad, why do you write so slow?" asked Dennis. "I have to," replied his father. "Im a slow reader."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7795, 'Parent jokes', 'Son: What is an autobiography? Father: Er, the story of an automobile.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7796, 'Parent jokes', 'Talbot and his son James were called to Mrs. Cren-shaws classroom. "Mr. Talbot," said the teacher, "I asked James Who shot Abraham Lincoln? and he said that he didnt do it!" "Well, teacher," said Talbot, "if my kid said he didnt do it he didnt do it!" Father and son left the school, and on their way home Talbot turned to the boy and asked, "Tell me, son, did you do it?" ', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7797, 'Parent jokes', 'An irate father stormed into the principals office. "I demand to know," he screamed, "why my son Winslow was given a zero on his English examination." "Now, dont get excited," said the principal. "Well get your Winslows English teacher in here. Im sure she has some explanation." A few minutes later, the English teacher arrived. "Why did you give Winslow a zero on his English final?" demanded the father. "I had no choice," said the schoolmarm. "He handed in a blank paper with absolutely nothing on it." "Thats no excuse," shouted the father. "You could have at least given him an A for neatness!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7798, 'Parent jokes', '"What are you reading?" demanded the father of his seven-year-old. "A story about a cow jumping over the moon," was the reply. "Throw that book away at once," he commanded. "How many times have I told you youre too young to read science fiction?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7799, 'Parent jokes', 'At dinner, Seth said to his father, "Dad, I got into trouble at school today and its all your fault.""Hows that?" asked the master of the house."Remember I asked you how much $500,000 was?""Yeah, I remember.""Well, a helluva lot aint the right answer."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7800, 'Parent jokes', 'Down at the office Bostwick boasted to one of his buddies,"My son Arthur is smarter even than Abraham Lincoln. Arthur could recite the Gettysburg Address when he was ten years old. Lincoln didnt say it till he was fifty!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7801, 'Parent jokes', '"Honey," said Mrs. Beldon to her husband,"Lesters teacher says he ought to have an encyclopedia." "Encyclopedia, my eye!" exclaimed Beldon. "Let him walk to school like I did."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7802, 'Parent jokes', '"Son, you sure do ask a lot of questions," said the father. "Id like to know what would have happened if Id asked as many questions when I was a boy." "Perhaps," said the boy, "youdve been able to answer some of mine."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7803, 'Parent jokes', 'Mrs. Filmore returned home from a business trip and asked her husband, "How did Greg do on his history exam?" "Oh, not so good," he replied."But it wasnt his fault. They asked him about things that happened before he was born!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7804, 'Parent jokes', '"Dad," said Rickey, "what is electricity?" "Uh," replied his father, "I dont really know too much about electricity." A few minutes later the boy said, "How does gas make the engine go?" "Son, Im afraid I dont know much about motors." "Dad," said the boy, "what is anthropology?" "Anthropology?" The father frowned. "I really dont know." "Gee, Dad, I guess Im making a nuisance of myself." "Not at all, son. If you dont ask questions, youll never learn anything."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7805, 'Parent jokes', 'Bentley and his wife and son were sitting at the dinner table when the boy suddenly blurted out,"Gee, youre dumb, Mom. You dont know anything." "Now, son," scolded Bentley, "you musnt be picky about your mothers little faults."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7806, 'Parent jokes', 'During a flood in a small Ohio town, a young girl was perched on top of a house with a little boy. As they sat watching articles float along with the water, they noticed a baseball cap float by. Suddenly, the cap turned and came back, then turned around and went downstream. After it had gone some distance, it turned again and came back. "Do you see that baseball cap?" said the girl. "First it goes downstream, then turns around and comes back." "Oh, thats my dad," replied the boy. "This morning he said that come hell or high water, he was going to cut the grass today."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7807, 'Parent jokes', 'Old-fashioned Zachary approached Lureens father, intent upon asking him for her hand in marriage. "Sir," he blurted out, "I have an attachment for your daughter, and " "See here, young man," interrupted the parent, "when my daughter needs accessories, Ill buy them myself."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7808, 'Parent jokes', 'Mrs. Ellis came home from work one evening to find her three-year-old son lighting up a cigar. She raced into the kitchen where her husband was making dinner. "Hey!" she announced. "This is terrible! I just caught Matthew lighting a cigar!" "You put a stop to that right now," he shouted. "That kid is altogether too young to be playing with matches!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7809, 'Parent jokes', 'Did you hear about the little boy who was named after his father ?They called him Dad !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7810, 'Parent jokes', 'Dad: Why is your January report card so bad ?Son: Well, you know how it is. Things are always marked down after Christmas !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7811, 'Parent jokes', 'Teddy came thundering down the stairs, much to his fathers annoyance.Teddy, he called, how many more times have I got to tell you to come down the stairs quietly? Now, go back up and come down like a civilised human being.There was a silence, and Teddy reappeared in the front room.Thats better, said his father. Now will you always come down stairs like that?Suits me, said Teddy. I slid down the bannister.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7812, 'Parent jokes', 'Come here, you greedy wretch. Ill teach you to eat all your sisters birthday chocs.Its all right Dad, I know how !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7813, 'Parent jokes', 'Boy: Dad, Dad, come out. My sisters fighting this ten foot gargoyle with three heads.Dad: No, Im not coming out. Shes going to have to learn to look after herself.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7814, 'Parent jokes', 'Father: I want to take my girl our of this terrible math class.Teacher: But shes top of the class.Father: Thats why I think it must be a terrible class.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7815, 'Parent jokes', 'What do you call a small parent?A minimum !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7816, 'Parent jokes', 'Girl: Mom, mom a monsters just bitten my foot off. Mom: Well, keep out of the kitchen, Ive just washed the floor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7817, 'Parent jokes', 'Father: Son at your age, Winston Churchill used be up and out for his morning walk at 5 a.m.. Son: Dad, at your age, he had become the Prime Minister of England.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7818, 'Parent jokes', 'Pride is what you feel when your kids net $143 from a garage sale. Panic is what you feel when you realize your car is missing.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7819, 'Parent jokes', 'Father: " I know the answer to your bad grades. Youre spending too much time watching television." Son: " Im sorry, youll have to phrase that in the form of a question."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
