INSERT INTO `jokes` VALUES (7969, 'Political jokes', 'When not in stores, Republicans shop from a catalog. Democrats watch for "incredible TV offers" on late night television.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7970, 'Political jokes', 'Democrats do much of their shopping at Target and Wal-Mart. So do Republicans, but they dont admit it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7971, 'Political jokes', 'Republican parents have no problem buying toy guns for their kids. Democrats refuse to do so. That is why their kids pretend to shoot each other with dolls.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7972, 'Political jokes', 'Republicans spends hundreds of dollars and hours of work decorating the yard with outdoor lights and Christmas displays. Democrats save their time and money, and drive around at night to look at *other* peoples lights.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7973, 'Political jokes', 'Democrats favorite Christmas movie is "Miracle on 34th Street." Republicans favorite Christmas movie is "Its a Wonderful Life." Right-Wing Republicans favorite Christmas movie is "Die Hard."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7974, 'Political jokes', 'Republicans always take the price tag off expensive gifts before wrapping. Democrats also remove price tags off pricey gifts ... and reposition them to make sure they are seen.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7975, 'Political jokes', 'Democrats wear wide red ties and green sports jackets during the festive season. Republicans do too, all year round.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7976, 'Political jokes', 'Most Republicans try, at least once, enclosing indulgent, wretchedly maudlin form letters about their families in their Christmas cards. Public ridicule from Democrats usually discourages them from doing it again.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7977, 'Political jokes', 'Democrats favorite Christmas carol is "Deck the Halls." Young Democrats favorite Christmas carol is "Grandma Got Run Over by a Reindeer." Republicans favorite Christmas carol is "White Christmas." Young Republicans favorite Christmas carol is "White Christmas."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7978, 'Political jokes', 'Cheapskate Republicans buy an artificial Christmas tree. Tight-fisted Democrats buy a real tree, but they wait until the week before Christmas when the lots lower their prices. Green Democrats buy a real tree with roots, and then replant it after New Years.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7979, 'Political jokes', 'Republicans see nothing wrong with letting their children play "Cowboys and Indians." Democrats dont either, as long as the Indians win.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7980, 'Political jokes', 'Republicans first began thinking like Republicans when they stopped believing in Santa Claus. Democrats became Democrats because they never stopped believing in Santa Claus.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7981, 'Political jokes', 'Democrat men like to watch football while the women fix holiday meals. On this, Republicans are in full agreement.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7982, 'Political jokes', 'Q: How many republicans does it take to disarm the law abiding public so that the government can enforce totalitarianistic and unconstitutional laws?A: None. The Sociali--Democrats do that', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7983, 'Political jokes', 'Q: How many republicans does it take to raise your taxes?A: None. The democrats do that.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
