INSERT INTO `jokes` VALUES (7987, 'Political jokes', 'Two opposing county chairman were sharing a rare moment together. The Democratic chairman said, "I never pass up a chance to promote the party. For example, whenever I take a cab, I give the driver a sizable tip and say, Vote Democratic." His opponent said, "I have a better scheme, and it doesnt cost me a nickel. I dont give any tip at all. And when I leave, I also say, Vote Democratic."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (7988, 'Political jokes', 'A Republican and a Democrat were walking down the street when they came to a homeless person. The Republican gave the homeless person his business card and told him to come to his business for a job. He then took twenty dollars out of his pocket and gave it to the homeless person.The Democrat was very impressed, and when they came to another homeless person, he decided to help. He walked over to the homeless person and gave him directions to the welfare office. He then reached into the Republicans pocket and gave the homeless person fifty dollars.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
