INSERT INTO `jokes` VALUES (8009, 'Political jokes', 'Q: Know how to solve the Serbian/Bosnian problem in less than 48 hours?A: Put Janet Reno in charge.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8010, 'Political jokes', 'Three boys were heading home from school one day when one started the time-honored game of paternal one-upmanship. He said, "My dads way faster than any of yours, he can throw a 90-mph fast ball from the pitchers mound and run and catch it just after it crosses the plate!" One of the other boys said, "Oh yeah? Well, my dad can shoot an arrow from his bow and run to the target and hold it up to make sure the arrow hits the bulls eye!" The last boy said, "Your dads dont even come close to being faster than mine. My dad works for the government, and even though he works every day until 4:00 he gets home at 3:30!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8011, 'Political jokes', 'Q: How can you tell if it was a shared computer used by many staffers?A: There is writing on the White-out.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8012, 'Political jokes', 'Q: Why do they always fly around a live turkey in a cage on Air Force 1?A: For spare parts.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8013, 'Political jokes', 'What is the difference between the government and the Mafia? One of them is organized.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8014, 'Political jokes', 'A political man to a woman, "You look beautiful today!!!!"The woman replied, "Thanks, but unfortunately I could not say the same about you.""Sure you could!!" said the political man, "if you could lie as well as I do!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8015, 'Political jokes', 'I dont think this whole White House scandal is good for parents. I caught my six year old son David in a lie, and he said we could discuss it tonight in a "National Town Meeting."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8016, 'Political jokes', 'When that fool Reagan said that the Soviet Union was a failedexperiment headed for the ash heap of history, I knew he was ademagogue.When that fool Reagan said that the Soviet Union was an evilempire, I knew he was a dangerous kook.When that fool Reagan said that we could end the Cold War byescalating the arms race, I knew the odds favored nuclearannihilation.When the Soviet Union went broke, dissolved, and repudiatedits past, I knew it was all Gorbachevs genius, and that fool Reaganhad nothing to do with it.Because if that fool Reagan was right all along......what kind of fool am I?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8017, 'Political jokes', 'Definition:Politics Poli (Poly): Many.... Tic(k)s: Blood sucking creatures', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8018, 'Political jokes', 'A redneck calles up the White House and tells the receptionist:"Id like to become the next President of the United States."The receptionist: "What are you, an idiot?"Redneck: "Why, is it required?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8019, 'Political jokes', 'A little girl asked her father, "Daddy? Do all Fairy Tales begin with OnceUpon A Time?"And he replied, "No, there is a whole series of Fairy Tales that begin with If Elected I promise..."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8020, 'Political jokes', 'Three Republicans walk into a bar.The bartender says, "We dont serve Republicans here."The Republicans say, "Thats OK...We dont serve you either.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8021, 'Political jokes', 'Two men were stopped by a TV newswoman doing streetinterviews about the upcoming presidential primary election."Im not voting for any of the candidates," the first man said. "Idont know any of them.""I feel the same way," the second man said. "Only I knowthem all."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8022, 'Political jokes', 'The politician was sitting at his campaign headquarters when the phone rang. He listened intently, and after a moment his face brightened. When he hung up, he immediately phoned his mother to tell her the good news. "Ma," he shouted, "the results are in. I won the election!" "Honestly?" The politicians smiled faded. "Aw hell, ma, why bring that up at a time like this?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8023, 'Political jokes', 'One day a boy and his father were at the dining room tableworking on the boys Social Studies homework, the chapterabout government. The boy turns to his father and asks,"Dad, how many people work in the U.S. government?"The father replies without hesitating, "Oh, about ten percent."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8024, 'Political jokes', 'Late one night, a mugger wearing a ski mask jumped into the pathof a well-dressed man and stuck a gun in his ribs. "Give me yourmoney", he demanded. Indignant, the affluent man replied, "Hey, watch it - Im a UnitedStates Congressman!" "In that case," replied the mugger, "give me MY money."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8025, 'Political jokes', 'If the State of the Union is really "the best its ever been" Why do we "need" dozens of new government programs to fix it!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8026, 'Political jokes', 'Q: How many US Presidents does it take to screw in a light bulb? A: None, the constitution says that only Congress can screw in light bulbs, so only Congress is responsible for the dark, which is why we need a Constitutional ammendment. A: Only one. If he can handle 250000000 people a day I think he can handle screwing one extra lightbulb.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8027, 'Political jokes', 'Q: How many senators does it take to screw in a light bulb? A: Two to sponsor the bill and thirty-three to constitute a quorum.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8028, 'Political jokes', 'Q: How many Republicans does it take to screw in a light bulb? A: Two-one to do it and one to steady the chandelier. A: None, they only screw the poor', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8029, 'Political jokes', 'Q: How many politicians does it take to change a lightbulb ?A: Two. One to change it, and another one to change it back again.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8030, 'Political jokes', 'Q: How many politicians does it take to change a lightbulb ? A: Four, one to change it and the other three to deny it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8031, 'Political jokes', 'Q: How many believable, competent, "just right for the job" presidential candidates does it take to change a lightbulb ? A: Its going to be a dark 4 years, isnt it?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8032, 'Political jokes', 'Q: How many MPs does it take to change a lightbulb ? A: Twenty-one. One to change it and twenty to form a fact-finding committee to learn more about how its done.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8033, 'Political jokes', 'Q: How many Labour Party members does it take to change a lightbulb ? A: None. They havent got a policy on that.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8034, 'Political jokes', 'Q: How many liberals does it take to screw in a light bulb? A: One liberal and twenty eight delegates representing all the social, economic, and ethnic communities. A: Two-one to do it and the other to keep the first ones knee from jerking. A: None: They cant remove the old ones since they are already part of the environment.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8035, 'Political jokes', 'Q: How many Liberal Democrats does it take to change a lightbulb ? A: None. "Well its not really a question of should we change it or should we not change the lightbulb, but more a question of...(blah blah waffle)"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8036, 'Political jokes', 'Q: How many Communists does it take to screw in a light bulb? A: Two - one to screw it in, and a second to hand out leaflets. A: One, but it takes him about 30 years to realize that the old one has burnt out.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8037, 'Political jokes', 'Q: How many conservatives does it take to change a light bulb? A: One; after reflecting in the twilight on the merit of the previous bulb.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8038, 'Political jokes', 'A reporter heard Bush and one of his underlings talking in the hallway:"Mr President, how do we know for sure Iraq has weapons of mass destruction?"Pres says: "You think were stupid boy??? We made copies of all the receipts!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8039, 'Political jokes', 'I want to become a politician when I grow up so Ive made a list of skills I want to aquire, butIve only come up with one: Lying.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8040, 'Political jokes', 'A reporter cornered George W. Bush at a press conference: "Many say the only reason why you would be elected for President is due to the enormous power and influence of your father.""That notion is ridiculous!" mocked George Jr. "It doesnt matter how powerful the man is. He can only vote once!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8041, 'Political jokes', 'A cargo plane is in mid-flight over the ocean when suddenly the cockpit door bursts open to reveal an armed, masked hijacker to a startled pilot, copilot, navigator, and a passenger. The passenger happens to be George W Bush. (Why?} Maybe, he was on his way to check on the coca plant life in South America!") The masked gunman held a gun to the pilots head and said, "Take this plane to Iraq or Im gonna spill your brains all over the place." The pilot calmly reached up, pushed the gun aside and said, "Look buddy, if you shoot me this plane will crash right into the sea and youll die along with the rest of us." The hijacker thought about it, then held the gun to the copilots head and said, "Take this plane to Iraq or Im gonna spill HIS brains all over the place." The copilot also calmly reached up, pushed the gun aside and said, "Listen to me. The pilots got a bad heart  and he could keel over at the shock of my being killed. So if you shoot me, this plane will still crash right into the sea and youll die along with the rest of us." The hijacker thought about it for a moment and then held the gun to the navigators head and repeated, "Take this plane to Iraq or Im gonna spill HIS brains all over the place." The navigator calmly reached up, pushed the gun aside and said, "I wouldnt do that if I were you. Those other two guys have no sense of direction. Without me they couldnt find their way out of a paper bag much less get this plane to Iraq. So if you shoot me, this plane will still crash right into the sea and youll die along with the rest of us." The hijacker thought some more, shrugged and this time held the gun to the passengers head and demanded, "Take this plane to Iraq or Im gonna spill HIS brains all over the place." No one said a word, at first,  then the pilot, co-pilot, and navigator all brust into laughter. "Hes George W Bush!" they laughed. "He doesnt have any brains!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8042, 'Political jokes', 'The President is running down the street one day, and he sees a little girl who is giving away puppies that her dog just had.He goes up to the girl and says, "Little girl, I think that its wonderful that youre doing such a good thing."The little girl says, "Thank you, Mr. Clinton. Would you like a puppy? Theyre Democrats."Bill declines and jogs onward. The next day Billy jogs past the same girl and decides to talk to her again. "You know what, little girl? I think Ill take one of those puppies after all, seeing as how theyre Democrats."The girl says, "Im sorry Mr. Clinton, but theyre not Democrats any more. Theyre Republican now."Bill says, "They are? How do you know? As a matter of fact, how did you know that they were Democrats at first to begin with?"She says, "Well, just after they were born they were Democrats, but now their eyes are open."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8043, 'Political jokes', 'A tourist climbed out of his car in downtown Washington, DC. He saw a man standing near the curb, and asked, "Listen, Im going to be only a couple of minutes. Would you watch my car while I run into this store?" "What?" the man huffed. "Do you realize that I am a member of the United States Senate?" "Well no," the tourist said, "I didnt realize that. But listen, Im really in a bind so Im going to have to trust you anyway."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8044, 'Political jokes', 'An aircraft is about to crash. There are five passengers on board, but unfortunately only 4 parachutes. The first passenger says, "Im Shaquille ONeill, the best NBA basketball player. The Lakers need me, it would be unfair to them if I died." So he takes the first parachute and jumps.The second passenger, Hillary Clinton, says, "I am the wife of the former President of the United States. I am also the most dedicated woman in the world, a Senator in New York and Americas potential future President". She takes one of the parachutes and jumps.The third passenger, George W. Bush, says, "I am the President of the United States of America. I have a huge responsibility in world politics. And apart from that, I am the most intelligent President in the history of the country and I have a responsibility to my people not to die." So he takes a parachute and jumps.The fourth passenger, th e Pope, says to the fifth passenger, a ten year old schoolboy, "I am already old. I have already lived my life, as a good person and a priest I will give you the last parachute". The boy replies "No problem your Pope-ness, there is also a parachute for you. Americas most intelligent President has taken my schoolbag."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8045, 'Political jokes', 'A first grade teacher explained to her class that she is a liberal Democrat. She asks her students to raise their hands if they were liberal Democrats, too. Not really knowing what a liberal Democrat was, but wanting to be like their teacher, their hands flew up into the air. There was one exception. A girl named Lucy had not gone along with the crowd. The teacher asks her why she has decided to be different. "Because Im not a liberal Democrat." "Then," asks the teacher, "What are you?" "Why Im a proud conservative Republican," boasts the little girl. The teacher, a little perturbed and her face slightly red, asked Lucy why she is a conservative Republican. "Well, I was brought up to trust in myself instead of relying on an intrusive government to care for me and do all of my thinking. My Dad and Mom are conservative Republicans, and I am a conservative Republican too."  The teacher, now angry, loudly says, "Thats no reason! What if your Mom was a moron, and your dad was a moron? What would you be then?" The teacher paused and smiled. "Then," Lucy said, "Id be a liberal Democrat."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8046, 'Political jokes', 'A small boy was asked by his teacher, "What is the size of the Democratic Party?" "About 5 feet 2 inches," he replied promptly. "NO!" exploded the teacher.. "I mean, how MANY members does it have? How did you get 5 feet 2 inches?" "Well," replied the boy, "my father is 6 feet tall and every night he puts his hands to his chin and says.. "Ive had it up to HERE with the Democratic Party!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8047, 'Political jokes', 'Why is Congress like a cold?Because sometimes the ayes (eyes) have it and sometimes the nos (nose).', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8048, 'Political jokes', 'Why are Vampires Democrats?They want Gore in 2000.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8049, 'Political jokes', 'At an outdoor press conference, Al Gore was addressing harsh criticism of being "lifeless as a statue.""That is absurd," Gore stoically stated. "When elected, the people of America will see just how passionate and alive I truly am."Embarrassed for her husband, Tipper, leaned in to whisper, "Honey, you have a pigeon on your head."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8050, 'Political jokes', 'Two political candidates were having a hot debate. Finally, one of them jumped up and yelled at the other, "What about the powerful interest that controls you?"And the other guy screamed back, "You leave my wife out of this!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8051, 'Political jokes', 'George W. Bush and Osama bin Laden are having a conversation via Al Jazeera television. Bin Laden tells George Bush, "There is no point of engaging in further war. I can see total peace in the future!" George Bush replies, "Oh yeah and tell me what you see?" Osama answers, "I can see New York, with new great buildings on one side and beautiful new buildings on the other side, and everything is peaceful and wonderful." George Bush says, "Wow is that what you see? Well Ill tell ya what I see for the future of Afghanistan... I see a house here, a house there, a small building here and small building there, but there are signs hanging in the middle of the street." Osama asks, "And what do they say?" George answers, "Hell, I dont know. I cant read Hebrew!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8052, 'Political jokes', 'A Japanese man was boasting about how his country had such advanced medical technology. He said, "We take the lungs out of a man, perform an operation, put the lungs back in, and in 4 weeks, the man is looking for work." An Englishman said, "We are far more advanced than you. We can take the heart out of a man, perform surgery and have him ready for work in just 3 weeks." The Irishman says, "Thats nothing; we can take a kidney out of a man, put into another mans body and have them looking for work in 2 weeks." The American says, "Well hell, thats nothin. We had an idiot taken out of Texas, put in the Whitehouse and now half the country is lookin for work!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8053, 'Political jokes', 'Once a madman said, "Do you know there is a war going on between India and Bharat? Another madman said, "Why should we worry, we live in Hindustan."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8054, 'Political jokes', 'Osama bin Laden threatened Russia: If you get caught up in this war... Ill hide from you too!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8055, 'Political jokes', 'QUESTION: How long does a United States Congressman serve? ANSWER: Until he gets caught.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8056, 'Political jokes', 'QUESTION: Name the loser in the 1976 presidential race. ANSWER: The American people.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8057, 'Political jokes', 'A minister and lawyer were chatting at a party: "What do you do if you make a mistake on a case?" the minister asked. "Try to fix it if its big; ignore it if its insignificant," replied the lawyer. "What do you do?" lawyer asked. "Oh, more or less the same. Let me give you an example. The other day I meant to say the devil is the father of liars, but instead I said the devil is the father of lawyers, so I let it go," minister replied.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8058, 'Political jokes', 'A Congressman was once asked about his attitude toward whiskey. "If you mean the demon drink that poisons the mind, pollutes the body, desecrates family life, and inflames sinners, then Im against it." "But if you mean the elixir of Christmas cheer, the shield against winter chill, the taxable potion that puts needed funds into public coffers to comfort little crippled children, then Im for it." "This is my final position, and I will not compromise!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8059, 'Political jokes', 'Q: How many Marxists does it take to screw in a light bulb? A: None: The light bulb contains the seeds of its own revolution.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8060, 'Political jokes', 'Q: What has dual airbags and has lots of room?A: The White House.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8061, 'Police jokes', 'A shoplifter was caught red-handed trying to steal a watch from an exclusive jewelry store. "Listen," said the shoplifter, "I know you dont want any trouble either. What do you say I just buy the watch and we forget about this?" The manager agreed and wrote up the sales slip. The crook looked at the slip and said, "This is a little more than I intended to spend. Can you show me something less expensive?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8062, 'Police jokes', 'The local sheriff was looking for a deputy, so Gomer - who was not exactly the sharpest nail in the bucket went in to try out for the job."Okay," the sheriff drawled, "Gomer, what is 1 and 1?""11" he replied.The sheriff thought to himself, "Thats not what I meant, but hes right.""What two days of the weekstart with the letter T?""Today and tomorrow."He was again surprised that Gomer supplied a correct answer that he had never thought of himself."Now Gomer, listen carefully: Who killed Abraham Lincoln?"Gomer looked a little surprised himself, then thought really hard for a minute and finally admitted, "I dont know.""Well, why dont you go home and work on that one for a while?"So, Gomer wandered over to the pool hall where his pals were waiting to hear the results of the interview. Gomer was exultant."It went great! First day on the  job and Im already working on a murder case!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8063, 'Police jokes', 'Two rednecks, Bubba and Earl, were driving down the road drinking a couple of bottles of Bud.The passenger, Bubba, said "Lookey thar up ahead, Earl, its a police roadblock!! Were gonna get busted fer drinkin these here beers!!""Dont worry, Bubba," Earl said. "Well just pull over and finish drinkin these beers then peel off the label and stick it on our foreheads, and throw the bottles under the seat.""What fer?", asked Bubba."Just let me do the talkin, OK?," said Earl.Well, they finished their beers, threw the empties out of sight & put label on each of their foreheads.When they reached the roadblock, the sheriff said, "You boys been drinkin?""No, sir," said Earl while pointing at the labels. "Were on the patch."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8064, 'Police jokes', 'A police car pulls up in front of grandma Bessies house, and grandpa Morris gets out.The polite policeman explained that this elderly gentleman said that he was lost in the park...and couldnt find his way home. " Oy Morris ", said grandma, " Youve been going to that park for over 30 years ! So how could you get lost ? " Leaning close to grandma, so that the policeman couldnt hear. Morris whispered, " I wasnt lost.....I was just too tired to walk home."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8065, 'Police jokes', 'Juggler, driving to his next performance, was stopped by the police. "What are those knives doing in your car?" asked the officer. "I juggle them in my act." "Oh yeah?" says the cop. "Lets see you do it." So the juggler starts tossing and juggling the knives. A guy driving by sees this and says, "Wow, am I glad I quit drinking. Look at the test theyre making you do now!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8066, 'Police jokes', 'A policeman stops a lady and asks for her license. He says "Lady, it says here that you should be wearing glasses."The woman answered "Well, I have contacts."The policeman replied "I dont care who you know! Youre getting a ticket!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8067, 'Police jokes', 'A police officer attempts to stop a car for speeding and the guy gradually increases his speed until hes topping 100 mph. He eventually realizes he cant escape and finally pulls over.The cop approaches the car and says, "Its been a long day and my tour is almost over, so if you can give me a good excuse for your behavior, Ill let you go."The guy thinks for a few seconds and then says, "My wife ran away with a cop about a week ago. I thought you might be that officer trying to give her back!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8068, 'Police jokes', 'A rookie police officer was out for his first ride in a cruiser with an experienced partner. A call came in telling them to disperse some people who were loitering.The officers drove to the street and observed a small crowd standing on a corner.The rookie rolled down his window and said, "Lets get off the corner people."A few glances, but no one moved, so he barked again, "Lets get off that corner... NOW!"Intimidated, the group of people began to leave, casting puzzled stares in his direction.Proud of his first official act, the young policeman turned to his partner and asked, "Well, how did I do?"Pretty good," chuckled the vet, "especially since this is a bus stop."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8069, 'Police jokes', 'The Los Angeles Police Department (LAPD), The FBI, and the CIA are all trying to prove that they are the best at apprehending criminals. The President decides to give them a test. He releases a rabbit into a forest and each of them has to catch it.The CIA goes in. They place animal informants throughout the forest. They question all plant and mineral witnesses. After three months of extensive investigations they conclude that rabbits do not exist.The FBI goes in. After two weeks with no leads they burn the forest, killing everything in it, including the rabbit, and they make no apologies. The rabbit had it coming.The LAPD goes in. They come out two hours later with a badly beaten bear. The bear is yelling: "Okay! Okay! Im a rabbit! Im a rabbit!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8070, 'Police jokes', 'Late one Friday night the policeman spotted a man driving very erratically through the streets of Dublin. They pulled the man over and asked him if he had been drinking that evening."Aye, so I have. Tis Friday, you know, so me and the lads stopped by the pub where I had six or seven pints. And then there was something called "Happy Hour" and they served these mar-gar-itos which are quite good. I had four or five o those. Then I had to drive me friend Mike home and O course I had to go in for a couple of Guinness - couldnt be rude, ye know. Then I stopped on the way home to get another bottle for later .." And the man fumbled around in his coat until he located his bottle of whiskey, which he held up for inspection.The officer sighed, and said, "Sir, Im afraid Ill need you to step out of the car and take a breathalyzer test."Indignantly, the man said, "Why? Dont ye believe me? !"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8071, 'Police jokes', 'A police officer pulls over this guy who had been weaving in and out of the lanes.He goes up to the guys window and says, "Sir, I need you to blow into this breathalyzer tube."The man says, "Sorry officer I cant do that. I am an asthmatic. If I do that Ill have a really bad asthma attack.""Okay, fine. I need you to come down to the station to give a blood sample." "I cant do that either. I am a hemophiliac. If I do that, Ill bleed to death.""Well, then we need a urine sample.""Im sorry officer I cant do that either. I am also a diabetic. If I do that Ill get really low blood sugar.""Alright then I need you to come out here and walk this white line.""I cant do that, officer.""Why not?""Because Im too drunk to do that!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8072, 'Police jokes', 'A man went to the Police Station wishing to speak with the burglar who had broken into his house the night before."Youll get your chance in court." said the Desk Sergeant."No, no no!" said the man. "I want to know how he got into the house without waking my wife. Ive been trying to do that for years!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8073, 'Police jokes', 'Traffic was backed up for miles, the police were going car to car. When they got to my car I asked the officer what was going on.He said "Its Al Gore. Hes up there threatening to set himself on fire! We are going car to car collecting donations.""Donations!" I said, "How much you got so far?"He said "about ten gallons."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8074, 'Police jokes', '"When I saw you driving down the road, I guessed 55 at least.""Youre wrong, officer, its only my hat that makes me look that old."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8075, 'Police jokes', 'A tourist asks a man in uniform, "Are you a policeman?""No, I am an undercover detective.""So why are you in uniform?""Today is my day off."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8076, 'Police jokes', 'A cop pulls a car over on the highway for speeding. When he asks for the drivers license, the driver argued, "Speeding??? But officer, I was only trying to keep a safe distance between my car the the car in back of me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8077, 'Police jokes', 'Warning to shoplifters: Anyone caught shoplifting will be beaten, gagged, whipped and tortured. Any survivors will be prosecuted to the full extent of the law.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8078, 'Police jokes', 'A man was caught for speeding and went before the judge.The judge said, "What will you take....30 days or $30."The man replied, "I think Ill take the money."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8079, 'Police jokes', 'Two robbers were robbing a hotel. The first one said, "I hear sirens. Jump!"The second one said, "But were on the 13th floor!"The first one screamed back, "This is no time to be superstitious."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8080, 'Police jokes', 'A client of a hospital where they made brain transplantations asked about the prices.The doctor said, "Well, this Ph.D. brain costs $10,000. This brain belonged to a NASA top scientist and costs $15,000. Here we have a policemans brain as well. It costs $50,000."The client asked, "What? Hows that possible?"The doctor replied, "You see, its totally unused."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8081, 'Police jokes', 'A man was speeding down a Alabama highway, feeling secure in a gaggle of cars all traveling at the same speed. However, as they passed a speed trap, he got nailed with an infrared speed detector and was pulled over.The officer handed him the citation, received his signature and was about to walk away when the man asked, "Officer, I know I was speeding, but I dont think its fair - there were plenty of other cars around me who were going just as fast, so why did I get the ticket?""Ever go a fishin?" the policeman suddenly asked the man."Ummm, yeah..." the startled man replied.The officer grinned and added, "Did you ever catch em all?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8082, 'Police jokes', 'A squad car driver was covering a quiet beat out in the sticks when he was amazed to find a former lieutenant on the police force covering the beat.He stopped the car and asked, "Why, Irish Mike, this wouldnt be your new beat out here in the sticks, would it?""That it is, "Irish Mike replied grimly, "ever since I arrested the judge on his way to the masquerade ball.""You mean you pinched his honor?" asked Pat."How was I to know that his convict suit was only a costume?" demanded Mike."Well," mused Pat, "theres a lesson in this somewhere.""That there is," replied Irish Mike...." Tis wise never to book a judge by his cover."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8083, 'Police jokes', 'A cop stops a man for running a stop sign and the subject gives the cop a lot of grief explaining that he did stop.After several minutes, the cop explained to the gentleman that he didnt stop, he just slowed down a little.The gentleman said Stop or slow down, whats the difference?.The cop pulled the guy out of the car and hit him with a nightstick for about a minute and then said, Would you like for me to stop or just slow down?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8084, 'Police jokes', 'Little Tommys kindergarten class was on a field trip to their local police station. There they saw pictures tacked to a big bulletin board. The label clearly read, "The 10 Most Wanted."One of the youngsters pointed to a picture and asked if it really was the photo of a wanted person."Yes," said the policeman, "the detectives want him very badly."So Little Tommy asked, while tugging on the mans belt, "Um, mister, why didnt you keep them when you took their pictures?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8085, 'Police jokes', 'A lady was filling her tank at a gas station, smoking a cigarette, even though all the signs say not to. The fumes that came out of the gas tank ignited, severely burning her hands.But it also lit up her arm, too!Instead of rolling on the ground to put it out, she panicked. She took off running down the street.A police car was at the intersection where it happened and he tried to stop her to put out her arm, but she just kept running and screaming. All the officer could think of doing was to shoot her. This took everyone by surprise. The officer ran over to her and put the fire out, then called for an ambulance.When questioned about his course of action to stop her, the officer said, "My only thought was to stop her. After all, she was waving a fire-arm."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8086, 'Police jokes', 'John was driving when a policeman pulled him over. He rolled down his window and said to the officer, "Is there a problem, Officer?""No problem at all. I just observed your safe driving and am pleased to award you a $5,000 Safe Driver Award. Congratulations. What do you think youre going to do with the money?"John thought for a minute and said, "Well, I guess Ill go get that drivers license."Judi, sitting in the passenger seat said to the policeman, "Oh, dont pay attention to him -- hes just a wise guy when hes drunk and stoned."Brian from the back seat said, "I told you guys we wouldnt get far in a stolen car!"At that moment, there was a knock from the trunk and a muffled voice said, "Are we over the border yet?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8087, 'Police jokes', 'A traffic Policeman recently stopped a woman for exceeding the posted speed limit. He asked the driver her name.She said, "Im Mrs. Chadivaler Zuminskagia Ragretumunga from the Republic of Uzbetikan visiting my daughter in Columbia."As she finished speaking the cop paused for a moment and then put away his summons book and pen, and said, "Well... OK... but dont let me catch you speeding again."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8088, 'Police jokes', 'This guy walked into a little corner store with a shot gun and demanded all the cash from the cash drawer. After the cashier put the cash in a bag, the robber saw a bottle of scotch that he wanted behind the counter on the shelf. He told the cashier to put it in the bag as well, but the cashier refused and said "Because I dont believe you are over 21." The robber said he was, but the clerk still refused to give the scotch to him because he didnt believe him. At this point the robber took his drivers license out of his wallet and gave it to the clerk. The clerk looked it over, and agreed that the man was in fact over 21 and he put the scotch in the bag. The robber then ran from the store with his loot. The cashier promptly called the police and gave the name and address of the robber that he got off of the license. They arrested the robber two hours later.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8089, 'Police jokes', 'One day there was a woman who lost her cat named "LOVE." It was pretty dark outside and she lived in New York. So, thinking that he might be down the street, she put on her house-coat and went looking for him.When a police officer stopped to ask what she was doing, she said very honestly, "Im looking for LOVE." The policeman arrested her on the spot.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8090, 'Police jokes', 'A policeman spots a woman driving and knitting at the same time. Driving up beside her, he shouts out the window... "Pull over!""No," she shouts back, "a pair of socks!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8091, 'Police jokes', 'Police Chief: As a recruit, youll be faced with some difficult issues. What would you do if you had to arrest your mother?New Recruit: Call for backup!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8092, 'Police jokes', 'There was an inebriated driver who was pulled up by the police. When the cop opened the door, the driver fell out."YOURE DRUNK!" exclaimed the police officer."Thank God for that!" said the drunk, "I thought the steering had gone."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8093, 'Police jokes', 'At recent trade talks the American representative offered to sell sophisticated American telephone technology to the Russians.American : "In the United States, anyone can pick up any phone and dial 9-1-1. This will record the call and connect them with the police."Russian : "In Russia we dont require that you dial anything."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8094, 'Police jokes', 'Five year old Little Johnny was lost, so he went up to a policeman and said, "Ive lost my dad!"The policeman said, "Whats he like?"Little Johnny replied, "Beer and women!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8095, 'Police jokes', 'The cop got out of his car and the kid, that was stopped for speeding, rolled down his window."Ive been waiting for you all day," the cop said.The guy replied, "Yeah, well I got here as fast as I could." When the cop finally stopped laughing, he sent the kid on his way without a ticket.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8096, 'Police jokes', 'A cop was interrogating a very intoxicated Irishman, who was also severly bleeding.The officer asked, "Can you describe the person who did this to you?"The Irishman replied, "Thats what I was doing when he hit me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8097, 'Police jokes', 'Two guys were walking along a road in Georgia when they were struck by a police car driven by a drunken cop.One guy was thrown through the windshield and his buddy was knocked down an embankment.The first guy was charged with breaking and entering and the second with leaving the scene of an accident.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8098, 'Police jokes', 'The Judge said to the defendant. "I thought I told you I never wanted to see you in here again.""Your Honor," the criminal said, "thats what I tried to tell the police, but they wouldnt listen."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8099, 'Police jokes', 'A truck driver was driving along on the freeway. A sign comes up that reads "low bridge ahead." Before he knows it the bridge is right ahead of him and he gets stuck under the bridge.Cars are backed up for miles.Finally, a police car comes up. The cop gets out of his car and walks around to the truck driver, puts his hands on his hips and says, "Got stuck, huh?"The truck driver says, "No, I was delivering this bridge and ran out of gas."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8100, 'Police jokes', 'A motorist was mailed a picture of his car speeding through an automated radar.A $40 speeding ticket was included.Being cute, he sent the police department a picture of $40.The police responded with another mailed photo -- of handcuffs.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8101, 'Police jokes', 'This hillbilly is traveling across Texas when a state policeman pulls him over."You got any I.D.?" the patrolman asked.""Bout what?" the hillbilly replied.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8102, 'Police jokes', 'A farmer whos been involved in a terrible road accident with a large truck ended up in court fighting for a big compensation claim."I understand youre claiming damages for the injuries youre supposed to have suffered?" Stated the counsel for the insurance company."Yes, thats right," replied the farmer, nodding his head."You claim you were injured in the accident, yet I have a signed police statement that says that when the attending police officer asked you how you were feeling, you replied, Ive never felt better inn my life. Is that the case?""Yeah, but" stammered the farmer."A simple yes or not will suffice," counsel interrupted quickly."Yes," Replied the farmer.Then it was the turn of the farmers counsel to ask him questions. "Please tell the court the exact circumstance of events following the accident when you made your statement of health," his  lawyer said."Certainly," replied the farmer. "After the accident my horse was thrashing around with a broken leg and my poor old dog was howling in pain. This cop comes along, takes one look at my horse and shoots him dead. "Then he goes over to my dog, looks at him and shoots him dead too. Then he come straight over to me and asked me how I was feeling. "Now, mate, what the heck would you have said to him?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8103, 'Police jokes', 'A policeman had a perfect spot to watch for speeders, but was not getting many.Then, he discovered the problem; a 10 year old boy was standing up the road with a hand painted sign which read, "SPEED TRAP AHEAD".The officer then found a young accomplice down the road with a sign painted "TIPS" and a bucket of change.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8104, 'Police jokes', 'A defense attorney was cross-examining a police officer during a felony trial -- it went like this:Q: Officer, did you see my client fleeing the scene?A: No sir, but I subsequently observed a person matching the description of the offender running several blocks away.Q: Officer, who provided this description?A: The officer who responded to the scene.Q: A fellow officer provided the description of this so-called offender. Do you trust your fellow officers?A: Yes sir, with my life.Q: With your life? Let me ask you this then officer, do you have a locker room in the police station, a room where you change your clothes in preparation for your daily duties?A: Yes sir, we do.Q: And do you have a locker in that room?A: Yes sir, I do.Q: And do you have a lock on your locker?A: Yes sir.Q: Now why is it, officer, if you trust your fellow of ficers with your life, that you find it necessary to lock your locker in a room you share with those officers?A: You see sir, we share the building with a court complex, and sometimes defense attorneys have been known to walk through that room.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8105, 'Police jokes', 'A farmer and his pig were driving down the road when a cop pulled him over.The cop asked the farmer, "Didnt you know it is against the law to ride with a pig in the front of you truck?"The farmer replied, "No, I didnt knowed that."The cop ask the farmer where he was going and he said, "To Memphis". The cop said, "I will let you off the hook this time if you promise to take the pig to the zoo when you get to Memphis."So the farmer promised he would.Several days later the cop spotted the farmer with the pig driving down the road and he pulled him over again.The cop said "I thought I told you to take this pig to the zoo when you got to Memphis" and to this the farmer replied "I did and we had so much fun, Im taking him to the circus."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8106, 'Police jokes', 'Sitting on the side of the highway waiting to catch speeding drivers, a State Police Officer sees a car puttering along at 22 MPH.He thinks to himself, "This driver is just as dangerous as a speeder!"So he turns on his lights and pulls the driver over.Approaching the car, he notices that there are five old ladies, two in the front seat and three in the back, wide eyed and white as ghosts.The driver, obviously confused, says to him, "Officer, I dont understand, I was doing exactly the speed limit! What seems to be the problem?""Maam," the officer replies, "You werent speeding, but you should know that driving slower than the speed limit can also be a danger to other drivers.""Slower than the speed limit? No sir, I was doing the speed limit exactly twenty-two miles an hour!" the old woman says a bit proudly.The State Police officer, trying to contain a chuckle exp lains to her that "22" was the route number, not the speed limit.A bit embarrassed, the woman grinned and thanked the officer for pointing out her error."But before I let you go, Maam, I have to ask... Is everyone in this car OK? These women seem awfully shaken and they havent muttered a single peep this whole time," the officer asks."Oh, theyll be all right in a minute officer. We just got off Route 142."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8107, 'Police jokes', 'The drunken wino was stumbling down the street with one foot on the curb and one foot in the gutter.A cop pulled up and said, "Ive got to take you in, sir. Youre obviously drunk"The wasted wino asked, "Ociffer, are ya absolutely sure Im drunk?""Yeah, buddy, Im sure," said the copper. "Lets go."Obviously relieved, the wino said "Thats a relief - I thought I was a cripple."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8108, 'Police jokes', 'A lawyer opened the door of his BMW, when suddenly a car came along and hit the door, ripping it off completely.When the police arrived at the scene, the lawyer was complaining bitterly about the damage to his precious BMW."Officer, look what theyve done to my Beeeeemer!!!", he whined."You lawyers are so materialistic, you make me sick!!!", retorted the officer. "Youre so worried about your stupid BMW, that you didnt even notice that your left arm was ripped off!""Oh no!", replied the lawyer, finally noticing the bloody left shoulder where his arm once was."Wheres my Rolex???!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8109, 'Police jokes', 'A middle aged woman was driving through a school zone when a policeman pulled her over for speeding. As he was giving her the ticket, she said, "How come I always get a ticket and everyone else gets a warning? Is it my face?""No, maam," explained the officer, "its your foot."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8110, 'Police jokes', 'A blonde was visiting Washington, DC for the first time. She wanted to see the Capitol building. Unfortunately, she couldnt find it, so she asked a police officer for directions, "Excuse me, officer, how do I get to the Capitol building?"The officer replied, "Wait here at this bus stop for the number 54 bus. Itll take you right there." She thanked the officer and he drives off.Three hours later the police officer returned to the same area and, sure enough, the blonde is still waiting at the same bus stop. The officer got out of his car and said, "Excuse me, but to get to the Capitol building, I said to wait here for the number 54 bus. That was three hours ago. Why are you still waiting?"The blonde replied, "Dont worry, officer, it wont be long now. The 45th bus just went by!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8111, 'Police jokes', 'A police officer stops a blonde for speeding and asks her very nicely if he could see her license.She replied in a huff, "I wish you guys would get your act together. Just yesterday you take away my license and then today you expect me to show it to you!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8112, 'Police jokes', 'A policeman was interrogating 3 blondes who were training to become detectives. To test their skills in recognizing a suspect, he shows the first blonde a picture for 5 second and then hides it."This is your suspect, how would you recognize him?"The first blonde answers, "Thats easy, well catch him fast because he only has one eye!"The policeman says, "Well...uh...thats because the picture shows his PROFILE."Slightly flustered by this ridiculous response, he flashes the picture for 5 seconds at the second blonde and asks her, "This is your suspect, how would you recognize him?"The second blonde giggles, flips her hair and says, "Ha! Hed be too easy to catch because he only has one ear!"The policeman angrily responds, "Whats the matter with you two?? Of course only one eye and one ear are SHOWING because its a picture of his profile!! Is that the best ans wer you can come up with?"Extremely frustrated at this point, he shows the picture to the third blonde and in a very testy voice asks, "This is your suspect, how would you recognize him?"He quickly adds "...think hard before giving me a stupid answer."The blonde looks at the picture intently for a moment and says, "Hmmmm...the suspect wears contact lenses."The policeman is surprised and speechless because he really doesnt know himself if the suspect wears contacts or not. "Well, thats an interesting answer...wait here for a few minutes while I check his file and Ill get back to you on that."He leaves the room and goes to his office, checks the suspects file in his computer, and comes back with a beaming smile on his face. "Wow! I cant believe it...its TRUE! The suspect does in fact wear contact lenses. Good work! How were you able to make such an astute observation?""Thats e asy," the blonde replied. "He cant wear regular glasses because he only has one eye and one ear."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8113, 'Police jokes', 'The policeman arrived at the scene of an accident to find that a car had struck a telephone pole. Searching for witnesses, he discovered a pale, nervous young man in work clothes who claimed he was an eyewitness."Exactly where were you at the time of the accident?" inquired the officer."Mister," exclaimed the telephone lineman, "I was at the top of the pole!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8114, 'Police jokes', 'A young man was walking into town one day when a wood hauler gave him a ride.After traveling about a mile or two, the truck was stopped by the highway patrol for a weight check and inspection.The truck inspection revealed the truck had slick tires; no horn; no head, tail or signal lights; no windshield wipers. Also, it was overloaded and had bad brakes."Mister," the patrolman said to the driver, "I think the best way to charge you is hauling wood without a truck."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8115, 'Police jokes', 'The phone rings at FBI headquarters."Hello? Im calling to report my neighbor, Clifford. He is hiding marijuana inside his firewood!""Thank you very much for the call, sir."The next day, FBI agents descend on the neighbors house. They search the shed where the firewood is kept. Using axes, they bust open every piece of wood, but find no marijuana. They swear at the neighbors and leave.The phone rings at the neighbors house. Hey, Clifford, did the FBI come?""Yep.""Did they chop your firewood?""Yep.""Great, now its your turn to call. I need my garden plowed."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8116, 'Police jokes', 'Two Alabama State Troopers were chasing a Camaro East on I-20 toward Georgia. When the suspect crossed the Georgia line, the first Trooper pulled over quickly.The rookie Trooper pulled in behind him and said, "Hey, sarge, why did you stop?"The sarge replied, "Hes in Georgia now. Theyre an hour ahead of us, so well never catch him."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8117, 'Police jokes', 'Police officer: Excuse me, but your dog has been chasing a man on his bicycle.Dog owner: Are you crazy? My dog cant even ride a bicycle.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8118, 'Police jokes', 'A deputy police officer responded to a report of a barroom disturbance. The "disturbance" turned out to be well over six feet tall and weighed almost 300 pounds. Whats more, he boasted that he could whip the deputy and Muhammad Ali too.Said the policeman, "Ill bet that youre also an escape artist-probably better than Houdini."The giant nodded."If I had some chains," the deputy continued, "you could show us how strong you really are. But all Ive got is a set of handcuffs. Why dont you see just how quickly you can break out of them?"Once in the cuffs, the man puffed, pulled and jerked for four minutes. "I cant get out of these," the giant growled."Are you sure?" the deputy asked. The fellow tried again. "Nope," he replied. "I cant do it.""In that case," said the deputy, "youre under arrest."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8119, 'Police jokes', 'Returning home from work, a blonde was shocked to find her house ransacked and burglarized. She telephoned the police at once and reported the crime. The police dispatcher broadcast the call and a K-9 unit patrolling nearby was the first to respond.As the K-9 officer approached the house with his dog on a leash, the blonde ran out on the porch, shuddered at the sight of the cop and his dog, then sat down on the steps.Putting her face in her hands, she moaned: "I come home to find all my possessions stolen. I call the police for help, and what do they do? They send me a BLIND policeman!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8120, 'Police jokes', 'The man was in no shape to drive, so he wisely left his car parked and walked home. As he was walking unsteadily along, he was stopped by a policeman."What are you doing out here at 2 A.M.?" said the officer."Im going to a lecture." the man said."And who is going to give a lecture at this hour?" the cop asked."My wife." said the man.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8121, 'Police jokes', 'An elderly woman had just returned to her home from an evening worship service and was startled to find an intruder in her house.Catching the man in the act of burglarizing her home, she yelled, "STOP! Acts 2:38!" ("Repent and be baptized, every one of you, in the name of Jesus Christ so that your sins may be forgiven.")As the burglar stopped dead in his tracks, the woman calmly called the police and explained what she had done. Shortly, several officers arrived and took the man into custody.As he was placing the handcuffs on the burglar, one of the officers asked, "Why did you just stand there? All the lady did was mention a scripture verse.""Scripture?" replied the burglar."She said she had an axe and two 38s!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8122, 'Police jokes', 'While driving down the road the motorist saw a roadside stand which had a fortune teller sitting under an umbrella. She was just sitting there smiling and laughing. The motorist passed on by and went a couple of miles on down the road. All of a sudden he spun his car around and sped back toward the fortune teller. As he got closer to the still laughing fortune teller he began to slow down. He pulled up next to the woman and jumped out of his car and suddenly began slapping and beating her.A policeman passing by screeched to a stop and wrestled the man to the ground. After cuffing the man he stood him up and asked him, "What do you think youre doing?"After a moment the man replied, ... "Well, Ive always wanted to strike a happy medium."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8123, 'Police jokes', 'A cop pulls a guy over for weaving across two lanes of traffic.He walks up to the drivers window and asks, "You drinkin?"The driver said, "You buyin?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8124, 'Police jokes', 'A brunette, a redhead, and a blonde were robbing a supermarket when a police officer walked in the store.The three women decide to hide in three potato sacks.The cop kicks the first bag, and the brunette says, "meow", the cop says, "oh, its only a cat"He kicks the second bag, and the redhead says, "woof, woof". The cop says, "its only a dog".He kicks the third bag, and the blonde says, "potato"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8125, 'Police jokes', 'One Day Stupid, Trouble, and Shut Up were driving along in their car when Trouble suddenly hurled himself out of the window.Well, Stupid and Shut Up did not know what to do so they went to the police station. When they got there the chief asked them their names."Shut Up", replied Shut Up."Stupid", replied Stupid.The police chief thought these people were telling him to shut up, and were calling him stupid. Which made him very mad. "Excuse Me!" shouted the chief.Thinking the chief was hard of hearing, They once again shouted there names."Shut Up!""Stupid!"The police chief was very riled. He then asked" Are you looking for trouble?"!!!Stunned at the idea of the chief knowing that they were looking for their friend, they replied,"Why yes, how did you know?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8126, 'Police jokes', 'A very wealthy lawyer retreated for several weeks each year to his summer home in the backwoods of Maine. Every summer, he would invite one friend or another to stay with him there for a week or two.One summer he invited a Czechoslovakian friend to visit him. The friend, happy to get anything free from a lawyer, eagerly agreed. When the time came, they spent a wonderful time, getting up early every morning and enjoying the great outdoors.One morning, as the lawyer and his Czechoslovakian friend were picking raspberries and blueberries for their breakfast, they were approached by two huge bears--a male and a female.The lawyer noticed them in time to run for cover. His friend, however, was not so lucky. The male bear reached him and swallowed him whole.Seeing this, the lawyer ran back to his Mercedes and raced for the nearest town to get the local sheriff. The sheriff grabbed his hig h-powered rifle and raced back to the berry area with the lawyer. All the while, he was plagued by visions of lawsuit from his friends family. He just had to save his friend.Luckily, the bears were still there. "Hes in THAT one!" cried the lawyer, pointing to the male.The sheriff looked at the bears, leveled his gun, took careful aim, and shot the female."What did you do that for?!" exclaimed the lawyer, "I said he was in the other bear!""Exactly," replied the sheriff. "Would you believe a lawyer who told you that the Czech was in the male?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8127, 'Police jokes', 'A police officer pulls a guy over for speeding and has the following exchange:Officer: May I see your drivers license?Driver: I dont have one. I had it suspended when I got my 5th DUI.Officer: May I see the owners card for this vehicle?Driver: Its not my car. I stole it.Officer: The car is stolen?Driver: Thats right. But come to think of it, I think I saw the owners card in the glove box when I was putting my gun in there.Officer: Theres a gun in the glove box?Driver: Yes sir. Thats where I put it after I shot and killed the woman who owns this car and stuffed her in the trunk.Officer: Theres a BODY in the TRUNK?!?!?Driver: Yes, sir.Hearing this, the officer immediately called his captain.The car was quickly surrounded by police, and the captain approached the driver to handle the tense situation:Captain: Sir, can I  see your license?Driver: Sure. Here it is.It was valid.Captain: Whos car is this?Driver: Its mine, officer. Heres the owner card.The driver owned the car.Captain: Could you slowly open your glove box so I can see if theres a gun in it?Driver: Yes, sir, but theres no gun in it.Sure enough, there was nothing in the glove box.Captain: Would you mind opening your trunk? I was told you said theres a body in it.Driver: No problem.Trunk is opened; no body.Captain: I dont understand it. The officer who stopped you said you told him you didnt have a license, stole the car, had a gun in the glovebox, and that there was a dead body in the trunk.Driver: Yeah, Ill bet the liar told you I was speeding, too', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8128, 'Police jokes', 'My horoscope read, "Youre going places and you cant be stopped."Apparently the cop who gave me a ticket hadnt read it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8129, 'Police jokes', 'Polceman: "Im afraid that Im going to have to lock you up for the night."Man: "Whats the charge?"Polceman: "Oh, theres no charge. Its all part of the service.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8130, 'Police jokes', 'Recently, a distraught wife went to the local police station, along with her next-door neighbor, to report that her husband was missing. The policeman asked for a description of the missing man.The wife said, "He is 35 years old, 6-foot 4-inches, has dark eyes, dark wavy hair, an athletic build, weighs 185 pounds, is soft-spoken, and is good to the children."The next-door neighbor protested, "Your husband is 5-foot 8-inches, chubby, bald, has a big mouth, and is mean to your children."The wife replied, "Yes, but who wants HIM back?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8131, 'Police jokes', 'A cop pulls over a carload of nuns. Cop: "Sister, this is a 65 MPH highway -- why are you going so slow?" Sister: "Sir, I saw a lot of signs that said 22, not 65." Cop: "Oh sister, thats not the speed limit, thats the name of the highway youre on! Sister: Oh! Silly me! Thanks for letting me know. Ill be more careful. At this point the cop looks in the backseat where the other nuns are shaking and trembling. Cop: Excuse me, Sister, whats wrong with your friends back there? Theyre shaking something terrible. Sister: Oh, we just got off of highway 119.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8132, 'Police jokes', 'Q: What problems would you face if you were arrested for drunk driving?A: Id probably lose my buzz a lot faster.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8133, 'Police jokes', 'Q: Why would it be difficult to be a police officer?A: It would be tough to be an idiot all day long.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8134, 'Police jokes', '- Santa Claus, one smart and one stupid policeman are walking together when they spotted hundred dollars on the ground. Who will take the money?- ???- Stupid policeman, since Santa Claus and the smart policeman dont exist.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8135, 'Police jokes', 'On a narrow mountains road a man saw a police car driving uphill backwards.- Hi guys. Why are you driving backwards?- Because we are not sure that we will find the place to make u-turn on the top of the mountain.After one hour the same man saw the same police car driving downhill backwards again.- But guys, why are you driving backwards again?- We have found the place to make u-turn up there.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8136, 'Police jokes', 'HEADLINE: A hole has appeared in the ladies changing rooms at the sports club. Police are looking into it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8137, 'Police jokes', 'I went to the store the other day. I was only in there for about five minutes, and when I came out there was a motorcycle cop writing a parking ticket. So I went up to him and said, Come on buddy, how about giving a guy a break?He ignored me and continued writing the ticket. So I called him a stupid idiot. He glared at me and started writing another ticket for having bald tires!Then I really got angry at him. He finished the second ticket and put it on the car with the first. Then he started writing a third ticket!This went on for about 20 minutes. The more I abused him, the more tickets he wrote. I didnt care. My car was parked around the corner.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8138, 'Police jokes', 'When Mike got arrested, they told him, "Anything you say will be held against you."Mike said, "Claudia Schiffers breasts."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8139, 'Police jokes', 'While the pope was visiting the USA, he told the driver of his limo that he has the sudden urge to drive. The driver was a good Catholic man, and would not ever dream of questioning the popes authority. So the pope sat at the wheel, while his driver got in the back.They were traveling down the road doing between 70 and 80 mph, when a policeman happened to see them. As he pulled them over, he called in to headquarters reporting a speeding limo, with a VIP inside it.The chief asked: "Who is in the limo, the mayor?"The policeman told him: "No, someone more important than the mayor."Then the chief asked "Is it the governor?"The policeman answered: "No, someone more important than the governor."The chief finally asked: "Is it the President?"The policeman answered: "No, someone even more important than the President."This made the chief very angry and he bellowed: "Now who is m ore important than the President?!"The policeman calmly wispered: "Ill put it to you this way chief. I dont know who is this guy, but he has the pope as his chauffeur."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8140, 'Police jokes', 'A man pulls up to the curb and asks the policeman, "Can I park here?""No," says the cop."What about all these other cars?""They didnt ask!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8141, 'Police jokes', 'A policeman is on scene at a terrible accident - body parts everywhere. He is making his notes of where the pieces are and comes across a head. He writes in his notebook: "Head on bullevard" and scratchs out his spelling error. "Head on bouelevard" Nope, doesnt look right - scratch scratch. "Head on boolevard..." dang it! Scratch scratch. He looks around and sees that no one is looking at him as he kicks the head. "Head on curb."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8142, 'Police jokes', 'How many cops does it take to throw a man down the stairs?None. He fell.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8143, 'Police jokes', 'How many LA cops does it take to change light bulb?Six. One to do it and five to smash the old bulb to splinters.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8144, 'Police jokes', 'How many cops does it take to change light bulb?Just one, but he is never around when you need him.Only one, but he has to see an officer do it first.Three, one to do it, one to direct traffic and one to say "Shows over, nothing left to see here, folks, move along."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8145, 'Police jokes', 'One evening this Columbia Yuppie was stopped for allegedly drunken driving and was given a breath test by the Howard County Police."Well ?" he asked somewhat belligerently as the Desk Sergeant slowly read the print out and entered the information in the arrest record."Disappointing to say the least," the Sergeant replied. "Chateau Duvalier... 1962... rather thin... not aged well at all."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8146, 'Police jokes', 'A police officer, though scheduled for all-night duty at the station, was relieved of duty early and arrived home four hours ahead of schedule, at 2 in the morning. Not wanting to wake his wife, he undressed in the dark, crept into the bedroom and started to climb into bed. Just then, his wife sleepily sat up and said, "Mike, dearest, would you go down to the all-night drug store on the next block and get me some aspirin? Ive got a splitting headache." "Certainly, honey," he said, and feeling his way across the dark room, he got dressed and walked over to the drug store. As he arrived, the pharmacist looked up in surprise, "Say," said the druggist, "I know you - arent you a policeman? Officer Fenwick, right?" "Yeah, so?" said the officer. "Well what the heck are you doing all dressed up like the Fire Chief?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8147, 'Police jokes', 'A police officer stopped a young man for speeding. He stepped out of his patrol car, adjusted his sunglasses, and swaggered up to the young mans window. "What chew driving so fast for boy? You going to a fahhr? Let me see your license, boy." The young man handed over his license. Then the officer noticed that the back seat of the car was full of large knives. The officer said, "Tell me boy, why you got them knives on that there back seat?" The young man replied, "Well sir, Im a juggler." The officer spat some tobacco juice and then he said, "A juggler; well you dont say. Boy, put cha hands on the trunk of yer car; you going to jail!"The young man pleaded with the officer not to take him to jail. He offered to prove to the officer that he was a juggler by way of demonstration. He said, "You can even hold me at gunpoint while I juggle for you." The officer reluctantly allowed him to prove  his point while he held him at gunpoint.Two miles down the road at Joes Tavern, Billy Bub was drinking it up with Jerry Lee Jones. Billy Bub soon left and got into his old, rusty pickup truck. He proceeded down the road trying his best to stay on the right side. All of a sudden Billy Bub spotted the most unbelievable sight of his life! He drove to the nearest phone booth and dialed the number for Joes Tavern and asked for his buddy, Jerry Lee.When Jerry Lee got on the phone, Billy Bub said, "Whatever you do when you leave that tavern, dont go north on route 109. The state police are giving a sobriety test that nobody can pass!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8148, 'Police jokes', 'A police man was on duty one night and he headed up to "Make outMountain" to try to catch some couples in the act.When he got up there he stopped at the first car where a couple sat, and was surprised to see the man was reading and the girl next to himwas knitting.He tapped on the window and said he was with the police department then asked how old he was and the guy said, "Im 22 sir." "Well how old is she?" the officer then asked.Looking at his watch the guy replied, "Shell be 18 in about 6minutes."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8149, 'Police jokes', 'A man decided that he was going to ride a 10-speed bike from Phoenix to Flagstaff. He got as far as Black Canyon City before the mountains justbecame too much and he could go no farther. He stuck his thumb out, but after 3 hours hadnt gotten a single person to stop. Finally, a guy in a Corvette pulled over and offered him a ride. Of course, the bike wouldnt fit in the car. The owner of the Corvette found a piece of rope lying by the highway and tied it to his bumper.He tied the other end to the bike and told the man that if he was going too fast, to honk the horn on his bike and that he would slow down. Everything went fine for the first 30 miles.Suddenly, another Corvette blew past them. Not to be outdone, the Corvette pulling the biketook off after the other. A short distance down the road, the Corvettes, both going well over 120 mph, blew through a speed trap. The police officer noted t he speeds from his radar gun and radioed to the other officer that he had two Corvettes headed his way at over 120 mph.He then relayed, "...and youre not going to believe this, there is aguy on a bike honking his horn trying to pass....', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8150, 'Police jokes', 'A seargent is interviewing three cadets who were training to become detectives. To test their skills in recognizing a suspect, he shows the first cadet a picture for 5 seconds and then hides it. "This is your suspect, how would you recognize him?" The first cadet answers, "Thats easy, well catch him fast because he only has one eye!" The seargent says, "Well...uh...thats because the picture I showed is his side profile." Slightly flustered by this ridiculous response, he flashes the picture for 5 seconds at the second cadet and asks him, "This is your suspect, how would you recognize him?" The second cadet smiles, and says, "Ha! Hed be too easy to catch because he only has one ear!" The policeman angrily responds, "Whats the matter with you two? Of course only one eye and one ear are showing because its a picture of his side profile! Is that the best answer you can  come up with?!" Extremely frustrated at this point, he shows the picture to the third cadet and in a very testy voice asks, "This is your suspect, how would you recognize him?" He quickly adds, "Think hard before giving me a stupid answer." The cadet looks at the picture intently for a moment and says, "The suspect wears contact lenses." The seargent is surprised and speechless because he really doesnt know himself if the suspect wears contacts or not. "Well, thats an interesting answer. Wait here for a few minutes while I check his file and Ill get back to you on that." He leaves the room and goes to his office, checks the suspects file in his computer, and comes back with a beaming smile on his face. "Wow! I cant believe it. Its TRUE! The suspect does in fact wear contact lenses. Good work! How were you able to make such an astute observation?" "Thats easy," the cadet replied. "He  cant wear regular glasses because he only has one eye and one ear."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8151, 'Police jokes', 'A policeman stops a car and suggests an apparently drunken fellow to take a breath test. He blows, the thing shows: positive. He protests, cries he is a teetotaler and that the instrument isnt working properly. He says his wife is also a teetotaler. She blows- again positive. Then he gives it to their little kid on the backseat- also positive! The ashamed policeman lets them go. They take off and the man says to his wife:- And you kept telling me: dont give the kid any alcohol, dont give the kid any alcohol!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8152, 'Police jokes', 'Dispatcher: Nine-one-oneCaller: Hi, is this the police?Dispatcher: This is 911. Do you need police assistance?Caller: Well, I dont know who to call. Can you tell me how tocook a turkey? Ive never cooked one before.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8153, 'Police jokes', 'The sheriff of a small town was also the towns veterinarian. One night the phone rang, and his wife answered. An agitated voice inquired, "Is your husband there?" "Do you require his services as a sheriff or as a vet?" the wife asked. "Both!" was the reply. "We cant get our dogs mouth open, and theres a burglar in it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8154, 'Police jokes', 'A policeman had a perfect spot to watch for speeders, but wasnt getting many. Then he discovered the problem-a 10-year old boy was standing up the road with a hand painted sign which read "RADAR TRAP AHEAD." The officer then found a young accomplice down the road with a sign reading "TIPS" and a bucket full of change.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8155, 'Police jokes', 'As a female shopper exited a New York convenience store, a man grabbedher purse and ran. The clerk called 911 immediately, and the woman wasable to give them a detailed description of the snatcher.Within minutes, the police apprehended the snatcher. They put him in thecar and drove back to the store. The thief was then taken out of the carand told to stand there for a positive ID. To which he replied,"Yes, officer, thats her. Thats the lady I stole the purse from."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8156, 'Police jokes', 'Two Rangers stopped a guy for speeding on the state highway in Waxahachie, Texas. As they were writing up the ticket, one Ranger turned to the other and said, "How do you spell Waxahachie?"The other one replied, "I dont know."So the first one said, "Well what are we gong to do? If we spell it wrong it will get dismissed."The second Ranger said, "Why dont we just let him go and stop him again when he gets to Waco?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8157, 'Police jokes', 'A defense attorney was cross-examining a police officer duringa felony trial - it went like this:Q. Officer, did you see my client fleeing the scene?A. No sir, but I subsequently observed a person matching thedescription of the offender running several blocks away.Q. Officer, who provided this description?A. The officer who responded to the scene.Q. A fellow officer provided the description of this so-called offender. Do you trust your fellow officers?A. Yes sir, with my life.Q. With your life? Let me ask you this then officer - do youhave a locker room in the police station - a room where youchange your clothes in preparation for you daily duties?A. Yes sir, we do.Q. And do you have a locker in that room?A. Yes sir, I do.Q. And do you have a lock on your locker?A. Yes sir.Q. Now why is it, officer, if you trust your fellow officerswith your life , that you find it necessary to lock your lockerin a room you share with those same officers?A. You see sir, we share the building with a court complex,and sometimes lawyers have been known to walk through thatroom.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8158, 'Police jokes', 'A local law enforcement officer stops a car for traveling faster thanthe posted speed limit. Since hes in a good mood that day he decidesto give the poor fellow a break and write him out a warning instead of aticket. So, he asks the man his name."Fred," he replies. Fred what?" the officer asks. "Just Fred," the man responds.When the officer presses him for a last name, the man tells him thathe used to have a last name but lost it. The officer thinks he has a nutcase on his hands but plays along with it."Tell me Fred, how did you lose your last name?"The man replies, "Its a long story so stay with me. I was born FredDingaling. I know, funny last name. The kids used to tease me all the time.So I stayed to myself. I studied hard and got good grades. When I gotolder I realized that I wanted to be a doctor. I went through college,medical school, internship, residency, finally got my  degree, so I wasFred Dingaling, MD.After a while I got bored being a doctor so I decided to go back toschool. Dentistry was my dream. Got all the way through school, gotmy degree so I was now Fred Dingaling MD DDS. I got bored doingdentistry so I started fooling around with my assistant. She gave me VD.So, I was Fred Dingaling MD DDS with VD. Well, the ADA found outabout the VD so they took away my DDS so I was Fred Dingaling MDwith VD. Then the AMA found out about the ADA taking away my DDSbecause of the VD, so they took away my MD leaving me asFred Dingaling with VD. Then the VD took away my dingaling so nowIm just Fred."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8159, 'Police jokes', 'A local policeman had just finished his shift one cold November evening and was at home with his wife. You just wont believe what happened this evening , in all my years on the force Ive never seen anything like it. Oh yes dear, what happened ? I came across two guys down by the canal, one of them was drinking battery acid and the other was eating fireworks. Drinking battery acid and eating fireworks!! What did you do with them? Oh that was easy, I charged one and let the other off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8160, 'Police jokes', 'An off-duty police officer, familiar with radar guns,drove through a school zone within the legal speed limitwhen the flash of a camera went off, taking a picture ofhis license plate.The officer, thinking the radar was in error, drove by again;even more slowly. Another flash. He did it again for a thirdtime, at an even slower speed. Same result."This guy must have screwed up the settings," the off-dutyofficer thought.A few weeks later, when he received the violations in the mail,he discovered three traffic tickets:Each for not wearing a seat belt!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8161, 'Police jokes', '"Now as I understand it, Sir," said the police officer to the motorist, "you were driving this vehicle when the accident occurred. Can you tell me what happened?""Im afraid not, officer," replied the motorist. "I had my eyes shut!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8162, 'Police jokes', 'Policeman: Now, sir, how did you come to have this accident?Motorist: Well, the sign just there says, `Stop ? Look ? Listen. And while I was doing that the train hit me.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8163, 'Police jokes', 'The police are looking for a thief with one eye Why dont they use two?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8164, 'Police jokes', 'Police officer: And what do you think you are doing on this road, Dracula? Dracula: Looking for the main artery, officer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8165, 'Police jokes', 'What did the police officer say to his stomach? Ive got you under a vest.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8166, 'Police jokes', 'What nickname did the police give to the new blonde woman police officer? A fair cop.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8167, 'Police jokes', 'What nickname did the police give to the new blonde woman police officer? A fair cop.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8168, 'Police jokes', '"Ill have to report you, sir," said the traffic cop to the speeding driver. "You were doing 85 miles an hour." "Nonsense, officer," declared the driver. "Ive only been in the car for ten minutes."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8169, 'Police jokes', 'How can you tell if you are looking at a police glow-worm? He has a flashing light.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8170, 'Police jokes', 'Woman: Officer you must help. Ive just lost my wig. Police officer: Certainly, maam, well comb the area.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8171, 'Police jokes', 'Cop: Why didnt you stop when I shouted at you back there?Motorist: I thought you were saying "Good morning, Mr. Mayor."Cop: Right. I wanted to warn you about going too fast through the next town.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8172, 'Police jokes', 'Motorist: Why are you crying after giving me that ticket?Policeman: It was a moving violation.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8173, 'Police jokes', 'Police Chief: Why are you putting handcuffs on that building?Officer: Im making a house arrest', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8174, 'Police jokes', 'Police Chief: Why did you arrest that doctor?Officer: He was trying to take someones pulse.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8175, 'Police jokes', 'Police Chief: Why did you ticket the computer?Officer: It was speeding along the information highway.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8176, 'Police jokes', 'Police Chief: Why did you tie a rope on that criminal?Officer: You ordered me to get a line on the suspect.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8177, 'Police jokes', 'Police Chief: Why do you spend all your time trying to hit flies?Officer: You assigned me to the swat team, didnt you?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8178, 'Police jokes', 'Veronica was practicing the piano when suddenly there was a loud pounding on the front door. She opened it and found a breathless cop. "Whats the matter?!" she asked. "Wheres the body?!" demanded the officer. "What are you talking about?" "We just got a tip that some guy named Mozart was being murdered in this house."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8179, 'Police jokes', 'Why do Iraqi police officers walk in threes? The first knows how to read, the second knows how to write and the third is to keep an eye on the two intellectuals.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8180, 'Police jokes', 'A man leaves a bar, gets into his car and drives away. 200 yards further hes stopped by a police officer. Officer: "Good evening sir. Were testing drivers for drunken driving. Would you please blow into this machine?". Man: "Im sorry, I cant do that. I have asthma. If I blow on that machine I will get out of air". Officer: "Please come along to the office and we can give you a blood test". Man: "I cant do that. I have anemia and if you stick a needle in me I will bleed to death". Officer: "Then youll have to get out and walk 5 yards along this white line". Man: "Cant do that either". Officer: "Why not?". Man: "Because Im dead drunk".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8181, 'Police jokes', 'Lady:(standing in the middle of a busy street) Officer, can you tell me how to get to the Hospital?Officer: Just stand where you are!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8182, 'Rabbit jokes', 'Did you hear about the rich rabbit?He was a millionhare!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8183, 'Rabbit jokes', 'How can you tell which rabbits are the oldest in a group?Look for gray hares.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8184, 'Rabbit jokes', 'How did the close race between the rabbit and the tortoise end?It was won by a hare!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8185, 'Rabbit jokes', 'How did the rabbit become a wrestling champion?It had a lot of hare pins!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8186, 'Rabbit jokes', 'How do rabbits get to work?By rabbit transit!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8187, 'Rabbit jokes', 'How do you know when theres a rabbit in your bed? You can smell the carrots on his breath.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8188, 'Rabbit jokes', 'How do you know when youre eating rabbit stew? When it has hares in it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8189, 'Rabbit jokes', 'How do you make a rabbit fast? Dont feed it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8190, 'Rabbit jokes', 'How do you make a rabbit stew? Keep it waiting.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8191, 'Rabbit jokes', 'How far can a rabbit run into the woods? Halfway. After that shes running out of the woods.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8192, 'Rabbit jokes', 'How is a rabbit like a plum? Theyre both purple, except for the rabbit.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8193, 'Rabbit jokes', 'Lara Rabbit: Do you think thats Sophies natural color? Zara Rabbit: Only her hare dresser knows for sure.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8194, 'Rabbit jokes', 'May I buy half a rabbit?No, we dont split hares!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8195, 'Rabbit jokes', 'My friend is nuts. He thinks hes Bugs Bunny. But Im positive he isnt. How do you know he isnt? Because I am.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8196, 'Rabbit jokes', 'Rabbit: Are you sure this bottle of special carrot juice will cure me? Doctor: Absolutely. No rabbit ever came back for another.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8197, 'Rabbit jokes', 'Rabbit: I got kicked out of my cage for not paying the rent. My wife walked out and took our twenty-nine bunnies with her. Im all out of carrots. What should I do? Friend: Dont worry; be hoppy!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8198, 'Rabbit jokes', 'Waiter, what is this hare doing in my salad? I believe hes eating your lettuce.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8199, 'Rabbit jokes', 'What are four hundred rabbits hopping backwards? A receding hare line.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8200, 'Rabbit jokes', 'What book did the rabbit take on vacation? One with a hoppy ending.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8201, 'Rabbit jokes', 'What did the bunny say when he only had thistles to eat?Thistle have to do!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8202, 'Rabbit jokes', 'What did the bunny want to do when he grew up?Join the Hare Force.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8203, 'Rabbit jokes', 'What did the customer say to the pet shop assistant after buying a bunny?Rabbit up nicely, its a gift!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8204, 'Rabbit jokes', 'What did the magician say when he made his rabbit disappear? Hare today, gone tomorrow.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8205, 'Rabbit jokes', 'What did the naughty rabbit leave for Easter?Deviled eggs!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8206, 'Rabbit jokes', 'What did the rabbit bride get on her wedding day? A forty-carrot wedding ring.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
