INSERT INTO `jokes` VALUES (8274, 'Religious jokes', '"And how much of that stack of hay did you steal, Kavanaugh?" the priest asked at confession. "I might as well confess to the whole stack, your Reverence," said Kavanaugh. "Im goin after the rest of it tonight!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8275, 'Religious jokes', 'OToole worked in the lumber yard for twenty years and all that time hed been stealing the wood and selling it. At last his conscience began to bother him and he went to confession to repent. "Father, its 15 years since my last confession, and Ive been stealing wood from the lumber yard all those years," he told the priest. "I understand my son," says the priest. "Can you make a Novena?" OToole said, "Father, if you have the plans, Ive got the lumber."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
