INSERT INTO `jokes` VALUES (8294, 'Religious jokes', 'Q. How do we know that Job went to a chiropractor?A. Because in Job 16:12 we read, "I had come to be at ease, but he proceeded to shake me up and he grabbed me by the back of the neck and proceeded to smash me."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
