INSERT INTO `jokes` VALUES (8296, 'Religious jokes', 'Two bishops were discussing the decline in morals in the modern world."I didnt sleep with my wife before I was married," said one clergyman self-righteously, "Did you?""I dont know," said the other. "What was her maiden name?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8297, 'Religious jokes', 'A minister told his congregation, "Next week I plan to preach about the sin of lying. To help you understand my sermon, I want you all to read Mark 17." The following Sunday, as he prepared to deliver his sermon, the minister asked for a show of hands. He wanted to know how many had read Mark 17. Every hand went up. The minister smiled and said, "Mark has only sixteen chapters. I will now proceed with my sermon on the sin of lying."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8298, 'Religious jokes', 'I was walking across a bridge one day, and I saw a man standing on the edge, about to jump off. I immediately ran over and said "Stop! Dont do it!" "Why shouldnt I?" he said. I said, "Well, theres so much to live for!" "Like what?" "Well ... are you religious or atheist?" "Religious." "Me too! Are you Christian or Jewish?" "Christian." "Me too! Are you Catholic or Protestant?" "Protestant." "Me too! Are you Episcopalian or Baptist?" "Baptist." "Wow! Me too! Are you Baptist Church of God or Baptist Church of the Lord?" "Baptist Church of God." "Me too! Are you Original Baptist Church of God, or are you Reformed Baptist Church of God?" "Reformed Baptist Church of God." "Me too! Are you Reformed Baptist Church of God, reformation of 1879, or Reformed Baptist Church of God, reformation of 1915?" \r \n"Reformed Baptist Church of God, reformation of 1915!" To which I said, "Die, heretic scum!" and pushed him off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8299, 'Religious jokes', 'Theres this guy who had been lost and walking in the desert for about 2 weeks. One hot day, he sees the home of a missionary. Tired and weak, he crawls up to the house and collapses on the doorstep. The missionary finds him and nurses him back to health. Feeling better, the man asks the missionary for directions to the nearest town. On his way out the backdoor, he sees this horse. He goes back into the house and asks the missionary, "Could I borrow your horse and give it back when I reach the town?" The missionary says, "Sure but there is a special thing about this horse. You have to say Thank God to make it go and Amen to make it stop." Not paying much attetion, the man says, "Sure, ok." So he gets on the horse and says, "Thank God" and the horse starts walking. Then he says, "Thank God, thank God," and the horse starts trotting. Feeling really brave, the man says, "Thank  God, thank God, thank God, thank God, thank God" and the horse just takes off. Pretty soon he sees this cliff coming up and hes doing everything he can to make the horse stop. "Whoa, stop, hold on!!!!" Finally he remembers, "Amen!!" The horse stops 4 inches from the cliff. Then the man leans back in the saddle and says, "Thank God."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8300, 'Religious jokes', 'Pat and Mike were walking down the street, when they came to the church, Pat says, Mike, you wait here, Im going to run in for confession, its been a long time.Pat enters the confessional and says, Father forgive me, I have sinned with a married woman.The priest asks, was it Mrs Murphy? no, Father, was the reply.Was it Mrs OBoyle? Again the reply was No, Father.Was it Mrs. OGrady? Pat said, Father, Ill not be teling you the ladys name!So the priest told him to say two Hail Marys for each time he had sinned with the woman.Back on the street, Mike said, Well, how did you do? Pat said, Just fine, I kept me mouth shut and got 3 new prospects!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8301, 'Religious jokes', 'A drunk man who smelled like a beer sat down on a subway seat next to a priest. The mans tie was stained, his face was smeared with red lipstick, and a half empty bottle of gin was sticking out of his torn coat pocket. He opened his newspaper and began to read. After a few minutes the man turned to the priest and asked Say Father, what causes arthritis? The priest replies My son, its caused by loose living, being with cheap wicked women, too much alcohol and comtempt for your fellow man Well Ill be darned the drunk muttered, returning to his newspaper. The priest thinking about what he said, nudged the drunk and apologised. Im sorry to come on so strong. How long have you had arthritis? I dont have it, Father. I was just reading here that the Pope does.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8302, 'Religious jokes', 'One afternoon a little boy was playing outdoors. He used his mothers broom as a horse and had a wonderful time until it was getting dark.He left the broom on the back porch. His mother was cleaning up the kitchen when she realized that her broom was missing. She asked the little boy about the broom and he told her where it was.She then asked him to please go get it. The little boy informed his mom that he was afraid of the dark and didnt want to go out to get the broom.His mother smiled and said The Lord is out there too, dont be afraid. The little boy opened the back door a little and said Lord if youre out there, hand me the broom.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8303, 'Religious jokes', 'Q: Why do they say Amen at the end of a prayer instead of Awomen? A: The same reason they sing Hymns instead of Hers!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
