INSERT INTO `jokes` VALUES (8309, 'Religious jokes', 'Q: Why did Moses wander in the desert for 40 years? A: Even then men wouldnt ask for directions!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8310, 'Religious jokes', 'A Christian man had just died and was on his way to heaven. When he got to the gates of heaven he met an angel. The angel asked him what Gods name was. Oh thats easy, the man replied, His name is Andy. What make you think his name is Andy? the angel asked incredulously. Well, you see at Church we used to sing this song Andy walks with me, Andy talks with me.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8311, 'Religious jokes', 'A Baptist missionary was walking in Africa when he heard the ominous padding of a lion behind him. "Oh Lord," prayed the missionary, "Grant in Thy goodness that the lion walking behind me is a good Christian lion." And then, in the silence that followed, the missionary heard the lion praying too: "Oh Lord," he prayed, "I thank Thee for the food which I am about to receive."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8312, 'Religious jokes', 'There is a story about a monastery in Europe perched high on a cliff several hundred feet in the air.The only way to reach the monastery was to be suspended in a basket which was pulled to the top by several monks who pulled and tugged with all their strength.Obviously the ride up the steep cliff in that basket was terrifying. One tourist got exceedingly nervous about half-way up as he noticed that the rope by which he was suspended was old and frayed.With a trembling voice he asked the monk who was riding with him in the basket how often they changed the rope. The monk thought for a moment and answered brusquely, "Whenever it breaks."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8313, 'Religious jokes', 'A Catholic Priest and a Rabbi were chatting one day when the conversation turned to a discussion of job descriptions and promotion."What do you have to look forward to in way of a promotion in your job?" asked the Rabbi."Well, Im next in line for the Monsignors job." replied the Priest."Yes, and then what?" asked the Rabbi."Well, next I can become Arch-Bishop." said the Priest."Yes, and then?" asked the Rabbi."If I work real hard and do a good job as Arch-Bishop, its possible for me to become a full Bishop." said the Priest."O.K., then what?" asked the Rabbi.The Priest, begining to get a bit exasperated replied, "With some luck and real hard work, maybe I can become a Cardinal.""And then?" asked the Rabbi.The Priest is really starting to get mad now and replies, "With lots and lots of luck and some real difficult work and if Im in the  right places at the right times and play my political games just right, maybe, just maybe, I can get elected Pope.""Yes, and then what?" asked the Rabbi."Good grief!" shouted the Priest. "What do you expect me to become, GOD?""Well," said the Rabbi, "One of our boys made it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8314, 'Religious jokes', 'A farmer named Muldoon lived alone in the Irish countryside except for a pet dog he for a long time.The dog finally died and Muldoon went to the parish priest, saying "Father, the dog is dead. Could you possibly be saying a Mass for the poor creature?" Father Patrick told the farmer "No, we cant have services for an animal in the church, but Ill tell you what, theres a new denomination down the road apiece, and no telling what they believe in, but maybe theyll do something for the animal." Muldoon said "Ill go right now. By the way, do you think $50,000 is enough to donate for the service?" Father Patrick replied "Why didnt you tell me the dog was Catholic."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8315, 'Religious jokes', 'The little church in the suburbs suddenly stopped buying from its regular office supply dealer. So, the dealer telephoned Deacon Brown to ask why."Ill tell you why," shouted Deacon Brown. "Our church ordered some pencils from you to be used in the pews for visitors to register.""Well, interrupted the dealer, "didnt you receive them yet?""Oh, we received them all right," replied Deacon Brown."However, you sent us some golf pencils...each stamped with the words, `Play Golf Next Sunday."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8316, 'Religious jokes', 'Delivering a speech at a banquet on the night of his arrival in a large city, a visiting minister told several anecdotes he expected to repeat at meetings the next day.Because he wanted to use the jokes again, he requested the reporters to omit them from any accounts they might turn in to their newspapers.A cub reporter, in commenting on the speech, ended his piece with the following: "The minister told a number of stories that cannot be published."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8317, 'Religious jokes', 'A couple had two little mischievous boys, ages 8 and 10. They were always getting into trouble, and their parents knew that if any mischief occurred in their town, their sons would get the blame. The boys mother heard that a clergyman in town had been successful in disciplining children, so she asked if he would speak with her boys. The clergyman agreed and asked to see them individually.So, the mother sent her 8-year-old first, in the morning, with the older boy to see the clergyman in the afternoon. The clergyman, a huge man with a booming voice, sat the younger boy down and asked him sternly, "Where is God?"They boys mouth dropped open, but he made no response, sitting there with his mouth hanging open.The clergyman repeated the question. "Where is God?"Again, the boy made no attempt to answer.So, the clergyman raised his voice some more and shook his finger i n the boys face and bellowed, "Where is God!?"The boy screamed and bolted from the room. He ran directly home and dove into his closet, slamming the door behind him.When his older brother found him in the closet, he asked, "What happened?" The younger brother, gasping for breath, replied: "We are in real BIG trouble this time! God is missing, and they think we did it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8318, 'Religious jokes', 'A young lad was visiting a church for the first time, checking all the announcements and posters along the walls.When he came to a group of pictures of men in uniform, he asked a nearby usher, "Who are all those men in the pictures?"The usher replied, "Why, those are our boys who died in the service".Dumbfounded, the youngster asked, "Was that the morning service or the evening service?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8319, 'Religious jokes', 'A friend was in front of me coming out of church one day, and the preacher was standing at the door as he always is to shake hands. He grabbed my friend by the hand and pulled him aside.The Pastor said to him, "You need to join the Army of the Lord!" My friend replied, "Im already in the Army of the Lord, Pastor." Pastor questioned, "How come I dont see you except at Christmas and Easter?" He whispered back, "Im in the secret service.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8320, 'Religious jokes', 'It was about a month ago when a man in Amsterdam felt that he needed to confess, so went to his priest:"Forgive me Father, for I have sinned. During WWII I hid a refugee in my attic.""Well," answered the priest, "thats not a sin.""But I made him agree to pay me 20 Gulden for every week he stayed." "I admit that wasnt good, but you did it for a good cause." "Oh, thank you, Father; that eases my mind. I have one more question..." "What is that, my son?" "Do I have to tell him the war is over?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8321, 'Religious jokes', 'The two thousand member Baptist church was filled to overflowing capacity one Sunday morning. The preacher was ready to start the sermon when two men, dressed in long black coats and black hats entered thru the rear of the church.One of the two men walked to the middle of the church while the other stayed at the back of the church. They both then reached under their coats and withdrew automatic weapons.The one in the middle announced, "Everyone willing to take a bullet for Jesus stay in your seats!"Naturally, the pews emptied, followed by the choir. The deacons ran out the door, followed by the choir director and the assistant pastor.After a few moments, there were about twenty people left sitting in the church. The preacher was holding steady in the pulpit.The men put their weapons away and said, gently, to the preacher, "All right, pastor, the hypocrites are gone now. You  may begin the service."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8322, 'Religious jokes', 'A little nine year old girl was in church with her mother when she started feeling ill. "Mommy" she said "Can we leave now?" "No" her mother replied. "Well, I think I have to throw up!" "Then go out the front door and around to the back of the church and throw up behind a bush." In about two minutes the little girl returned to her seat. "Did you throw up?" her mother asked. "Yes" the little girl replied. "Well, how could you have gone all the way to the back of the church and return so quickly?" "I didnt have to go out of the church, Mommy" the little girl replied, "They have a box next to the front door that says for the sick."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8323, 'Religious jokes', 'A man sobering up from the night before is sitting through the Sunday sermon, finding it long and boring. Still feeling hung over and tired, he finally nods off. The priest has been watching him all along, noticing his apparent hangover and is disgusted. At the end of the sermon, the preacher decides to make an example of him. He says to his congregation, "All those wishing to have a place in heaven, please stand." The whole room stands up except, of course, the sleeping man. Then the preacher says even more loudly, "And he who would like to find a place in hell please STAND UP!" The weary man catching only the last part groggily stands up, only to find that hes the only one standing. Confused and embarrassed he says, "I dont know what were voting on here, Father, but it sure seems like you and me are the only ones standing for it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8324, 'Religious jokes', 'Mortal: What is a million years like to you? God: Like one second. Mortal: What is a million dollars like to you? God: Like one penny. Mortal: Can I have a penny? God: Just a second.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8325, 'Religious jokes', 'God looks down and notices that Adam is all alone while all the animals have companions, so he decides to create a companion for man as well. He comes to see Adam and says to him, "Adam, you are my greatest creation and therefore, I am going to create for you the ultimate companion. She will worship the very ground you walk on, she will long for you and no other, she will be highly intelligent, she will wait on you hand and foot and obey your every command, she will be beautiful, and all it will cost you is an arm and a leg." Thinking for a few moments, Adam replies, "What could I get for a rib?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8326, 'Religious jokes', 'Sometimes women are overly suspicious of their husbands. When Adam stayed out very late for a few nights, Eve became upset. "Youre running around with other women," she charged."Youre being unreasonable," Adam responded. "Youre the only woman on earth." The quarrel continued until Adam fell asleep, only to be awakened by someone poking him in the chest. It was Eve. "What do you think youre doing?" Adam demanded. "Counting your ribs," said Eve.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8327, 'Religious jokes', 'A priest and a nun are on their way back home from a trip when their car breaks down. They are unable to get it fixed, so they decide to spend the night in a hotel. The only hotel in the town has only one room available. Priest: Sister, I dont think the Lord would have a problem, under the circumstances, if we spent the night together in this one room. Ill sleep on the lounge and you have the bed. Nun: I think that would be okay. They prepare for bed and each one takes their agreed place in the room. Ten minutes later... Nun: Father, Im terribly cold. Priest: Okay, Ill get you a blanket. (He does) Ten minutes later...Nun: Father, Im still terribly cold. Priest: Okay Sister, Ill get you another blanket. (He does) Ten minutes later... Nun: Father, Im still terribly cold. I dont think the Lord would mind if we acted as man and wif e just for this one night.Priest: Youre probably right...get up and get your own blanket.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8328, 'Religious jokes', 'A preacher, who shall we say was "humor impaired," attended a conference to help encourage and better equip pastors for their ministry.Among the speakers were many well known and dynamic speakers. One such boldly approached the pulpit and, gathering the entire crowds attention, said, "The best years of my life were spent in the arms of a woman that wasnt my wife!" The crowd was shocked! He followed up by saying, "And that woman was my mother!" - The crowd burst into laughter and delivered the rest of his talk, which went over quite well.The next week, the pastor decided hed give this humor thing a try, and use that joke in his sermon. As he surely approached the pulpit that sunny Sunday, he tried to rehearse the joke in his head. It suddenly seemed a bit foggy to him.Getting to the microphone he said loudly, "The greatest years of my life were spent in the arms of another woma n that was not my wife!" The congregation inhaled half the air in the room. After standing there for almost 10 seconds in the stunned silence, trying to recall the second half of the joke, the pastor finally blurted out, "...and I cant remember who she was!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8329, 'Religious jokes', 'A preacher was completing a temperance sermon: with great expression he said, "If I had all the beer in the world, Id take it and throw it into the river." With even greater emphasis he said, "And if I had all the wine in the world, Id take it and throw it into the river."And then finally, he said, "And if I had all the whiskey in the world, Id take it and throw it into the river."He sat down. The song leader then stood very cautiously and announced with a smile, "For our closing song, let us sing Hymn # 365: "Shall We Gather at the River."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8330, 'Religious jokes', 'The preacher was wired for sound with a lapel mike, and as he preached, he moved briskly about the platform, jerking the mike cord as he went. Then he moved to one side, getting wound up in the cord and nearly tripping before jerking it again. After several circles and jerks, a little girl in the third pew leaned toward her mother and whispered, "If he gets loose, will he hurt us?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8331, 'Religious jokes', 'This minister just had all of his remaining teeth pulled and new dentures were being made.The first Sunday, he only preached 10 minutes.The second Sunday, he preached only 20 minutes.But, on the third Sunday, he preached 1 hour 25 minutes.When asked about this by some of the congregation, he responded this way.The first Sunday, my gums were so sore it hurt to talk.The second Sunday, my dentures were hurting a lot.The third Sunday, I accidentally grabbed my wifes dentures... and I couldnt stop talking!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8332, 'Religious jokes', 'A big, burly man visited the pastors home and asked to see the ministers wife, a woman well known for her charitable impulses."Madam," he said in a broken voice, "I wish to draw your attention to the terrible plight of a poor family in this district. The father is dead, the mother is too ill to work, and the nine children are starving. They are about to be turned into the cold, empty streets unless someone pays their rent, which amounts to $400.""How terrible!" exclaimed the preachers wife. "May I ask who you are?"The sympathetic visitor applied his handkerchief to his eyes. "Im the landlord," he sobbed.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8333, 'Religious jokes', 'An old preacher was dying. He sent a message for his banker and his lawyer, both church members, to come to his home.When they arrived, they were ushered up to his bedroom. As they entered the room, the preacher held out his hands and motioned for them to sit on each side of the bed. The preacher grasped their hands, sighed contentedly, smiled, and stared at the ceiling. For a time, no one said anything.Both the banker and lawyer were touched and flattered that the preacher would ask them to be with him during his final moments. They were also puzzled; the preacher had never given them any indication that he particularly liked either of them. They both remembered his many long, uncomfortable sermons about greed, covetousness, and avaricious behaviour that made them squirm in their seats.Finally, the banker said, "Preacher, why did you ask us to come?"The old preacher mustere d up his strength and then said weakly, "Jesus died between two thieves, and thats how I want to go."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8334, 'Religious jokes', 'It seems that there was a little old church out in the countryside: painted white and with a high steeple.One Sunday, the pastor noticed that his church needed painting. He checked out the Sunday ads and found a paint sale. The next day, he went into town and bought a gallon of white paint. He went back out to the church and began the job.He got done with the first side. It was looking great. But he noticed he had already used a half gallon. He didnt want to run back in town and being the creative person that he was, he found a gallon of thinner in the shed out back, and began to thin his paint.It worked out great. He finished the remaining three sides with that last half gallon of paint.That night, it rained: it rained hard. The next morning when he stepped outside of the parsonage to admire his work, he saw that the first side was looking great, but that the paint on the oth er three sides had washed away.The pastor looked up in sky in anguish and cried out, "What shall I do?"A voice came back from the heavens saying, "Repaint, and thin no more!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8335, 'Religious jokes', 'The Baptist preacher just finished his sermon for the day and proceeded toward the back of the church for his usual greetings and handshaking as the congregation left the church. After shaking a few adult hands he came upon the seven year old son of one of the Deacons of the church. "Good morning, Jonathan," the preacher said as he reached out to shake Joanthans hand. As he was doing do he felt something in the palm of Jonathans hand. "Whats this?" the preacher asked. "Money," said Jonathan with a big smile on his face, "Its for you!" "I dont want to take your money, Jonathan," the preacher answered. "I want you to have it," said Jonathan. After a short pause Jonathan continued, "My daddy says youre the poorest preacher we ever had and I want to help you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8336, 'Religious jokes', 'As Bill was approaching mid-life, physically he was a mess. Not only was he going bald, but years of office work had given him a large pot belly. The last straw came when he asked a woman co-worker out on a date, and she all but laughed at him. That does it, he decided. Im going to start a whole new regimen. He began attending aerobics classes. He started working out with weights. He changed his diet. And he got an expensive hair transplant. In six months, he was a different man. Again, he asked his female co-worker out, and this time she accepted. There he was, all dressed up for the date, looking better than he ever had. He stood poised to ring the womans doorbell, when a bolt of lightning struck him and knocked him off his feet. As he lay there dying, he turned his eyes toward the heavens and said, "Why, God, why now? After all Ive been through, how could you do this to me?" Fr om up above, there came a voice, "Sorry. I didnt not recoginize you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8337, 'Religious jokes', 'This fundamentalist Christian couple felt it important to own an equally fundamentally Christian pet. So, they went shopping. At a kennel specializing in this particular breed, they found a dog they liked quite a lot. When they asked the dog to fetch the Bible, he did it in a flash. When they instructed him to look up Psalm 23, he complied equally fast, using his paws with dexterity. They were impressed, purchased the animal, and went home (piously, of course). That night they had friends over. They were so proud of their new fundamentalist dog and his major skills, they called the dog and showed off a little. The friends were impressed, and asked whether the dog was able to do any of the usual dog tricks, as well. This stopped the couple cold, as they hadnt thought about normal tricks. "Well," they said, "lets try this out." Once more they called out to the dog, and then clearl y pronounced the command, "Heel!" Quick as a wink, the dog jumped up, put his paw on the mans forehead, closed his eyes in concentration, and bowed his head.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8338, 'Religious jokes', 'The Reverend Billy Graham tells of a time early in his ministry when he arrived in a small town to preach a sermon. Wanting to mail a letter, he asked a young boy where the post office was. When the boy had told him, Dr. Graham thanked him and said, "If youll come to the Church this evening, you can hear me telling everyone how to get to Heaven." "I dont think Ill be there," the boy said. "You dont even know your way to the post office."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8339, 'Religious jokes', 'Theres this cathedral thats still being worked on, and the workers have rigged a "cage elevator" inside so they can get material up and down to the upper floors. A characteristic of these "cage elevators" is that the doors (gate) must be closed manually for them to be "called" to another floor. One day one of the workers, Peter by name, takes the elevator to the top floor, and it is subsequently needed on the first floor by the sexton. Unfortunately, Peter forgot and left the door open. After the sexton rings for the elevator a couple times, to no avail, he yells up for the worker to send the lift back down. Visitors to the cathedral were treated to this sight: The sexton of the cathedral, head tipped up, yelling up to the heavens: "Peter! CLOSE THE GATES!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8340, 'Religious jokes', 'Jesus saw a crowd chasing down a woman to stone her and approached them. "Whats going on here, anyway?" he asked."This woman was found committing adultery, and the law says we should stone her!" one of the crowd responded."Wait," yelled Jesus. "Let he who is without sin cast the first stone."Suddenly, a stone was thrown from out of the sky, and knocked the woman on the side of her head."Aw, cmon, Dad..." Jesus cried, "Im trying to make a point here!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8341, 'Religious jokes', 'A Nun and her friend, Sarah were playing golf. Sarah misses a 3 foot putt and yells, "Goddamn it, missed the bugger!" and the nun says, "If you keep saying that then God will punish you." Next hole Sarah misses a 2 foot putt and says "Goddamn it, missed the bugger!" and the nun says, "ONE more time Sarah, and God will punish you!" Then Sarah misses a neoot putt and says "GOD DAMN IT!!!MISSED THE BUGGER!" Suddenly clouds form overhead. God comes down from Heaven and strikes the nun dead with a bolt of thunder. God says, "Goddamn it! Missed the bugger!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8342, 'Religious jokes', 'God created the donkey & said to him : " You will work unceasingly from sunrise to sunset carrying burdens on your back. You will eat grass, you will have no intelligence & you will live 50 years.You will be a donkey. " The donkey answered: " I will be a donkey, but to live 50 years is too much. Give me only 20 years. God granted his wish. God created the dog and said to him: "You will be a dog. " You will guard the house of man. You will be his best friend. You will eat the scraps that he gives you and you will live 25 years. You will be a dog. " The dog answered: " Sir, to live 25 years is too much, you give me only 10 years. God granted his wish. God created the Monkey and said to him: " You will be a monkey. " You will swing from branch to branch doing tricks. You will be amusing and you will live 20 years. You will be a monkey. " The monkey answered: " Sir, to live 20 years is too much , you give me only 10 years. God granted his wish. Finally God created the man and said to him: " You will be a man, the only rational creature on the face of the earth. " You will use your intelligence to become master over all animals. You will dominate the world and you will live 20 years. Man responded: " Sir, I will be a man but to live only 20 years is very little, give the 30 years that the donkey refused, the 15 years that the dog did not want and the 10 years the monkey refused. God granted his wish. And since then, man lives 20 years as a man, he marries and spend 30 years like a donkey, working and carrying all the burdens on his back. Then when his children are gone, he lives 15 years like a dog, taking care of the house and eating whatever is given to him, so that when he is old, he can retire and live 10 years like a monkey, going from house to house, from one son or daughter to another, doing tricks to amuse  his grandchildren.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8343, 'Religious jokes', 'The Reverend Francis Norton woke up Sunday morning and realizing it was an exceptionally beautiful and sunny early spring day, decided he just had to play golf. So.... he told the associate pastor that he was feeling sick and convinced him to say Mass for him that day.As soon as the associate pastor left the room, Father Norton headed out of town to a golf course about forty miles away. This way he knew he wouldnt accidentally meet anyone he knew from his parish. Setting up on the first tee, he was alone. After all, it was Sunday morning and everyone else was in church!At about this time, Saint Peter leaned over to the Lord while looking down from the heavens and exclaimed, "Youre not going to let him get away with this, are you?" The Lord sighed, and said, "No, I guess not."Just then Father Norton hit the ball and it shot straight towards the pin, dropping just short of it,  rolled up and fell into the hole. IT WAS A 420 YARD HOLE IN ONE!Saint Peter was astonished. He looked at the Lord and asked, "Why did you let him do that?"The Lord smiled and replied, "Whos he going to tell?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8344, 'Religious jokes', 'The Chief Rabbi and the Pope are in a meeting in Rome. The Rabbi notices a fancy shmancy phone on a side table in the Popes private chambers. "Whats that phone for?" he asks. "Its my direct line to the Lord!" the Pope replies.The Rabbi is doubtful, but the Pope insists that he tries it out and, indeed, he is connected to the Lord and chats away with Him for a while. After he hangs up the Rabbi says. "Thank you very much. This is great! But listen, I want to pay for the charges I have used up." The Pope doesnt want to take the money, but finally gives in, checks the counter and says: Allright! The charge was 50,000 Lira.", which the Rabbi gladly pays.A couple of weeks later, the Pope is in Jerusalem on an official visit. In the Rabbis chambers he sees the identical phone he has with a direct line to the Lord. The Pope asks if he could use it, because there were some urgent matt ers he needed to consult with Him. The Rabbi gladly hands him the phone and the Pope chats away. After he hangs up, he says: "Now I also want to pay for my charges on your phone." The Rabbi looks on the counter and says: "1 Shekel 50!" The Pope looks surprised: "Why so cheap!" The Rabbi smiles: "Local call."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8345, 'Religious jokes', 'Johnny was asked by his mother what he had learned in Sunday School. "Well, mum, our teacher told us how God sent Moses behind enemy lines on a rescue mission to lead the Israelites out of Egypt. "When he got to the Red Sea he had his engineers build a pontoon bridge and all the people walked across safely. Then he used his walkie-talkie to radio headquarters for reinforcements. They sent bombers to blow up the bridge and saved the Israelites." "Now, Johnny, is that really what your teacher taught you?" his mother asked. "Well, no, mom, but if I told it the way the teacher did, youd never believe it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8346, 'Religious jokes', 'Two nuns, Sister Mary Agnes and Sister Mary Vincent, are traveling through Europe in their car, sightseeing inTransylvania. As they are stopped at a traffic light, outof nowhere, a small vampire jumps onto the hood of the carand hisses at them through the windshield."Quick, quick!" shouts Sister Mary Agnes, "What should wedo?""Turn the windshield wipers on. That will get rid of theabomination," says Sister Mary Vincent.Sister Mary Agnes switches on the wipers, which knock themini-Dracula around. But, he hangs on and continues hissingat the nuns. "What shall I do now?" she shouts."Try the windshield washer. I filled it with holy waterbefore we left the Vatican," replies Sister Mary Vincent.Sister Mary Agnes turns on the windshield washer. Thevampire screams as the water burns his skin, but he hangs onand continues hissing at the nuns."Now what?" shouts Sis ter Mary Agnes."Show him your cross," says Sister Mary Vincent."Now youre talking," says Sister Mary Agnes. She thenopens the window and shouts, "Get the hell off our car!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8347, 'Religious jokes', 'Three Reform Rabbis were in a terrible auto wreck. None survived. One minute they were driving along the highway, talking and laughing and joking, and the next, BOOM! they were before the Creator of all. Shaking his head, The Omnipotent One looks at the three. "Reform I can understand. But where will it end? You! Goldblum! The ashtrays in your temple so My people could smoke while the Torah was being read???"Goldblum shuddered.God went on. "I can live with that. Men are weak, but the Word is strong!" Goldblum sighed with relief. "Bauman! Really, I can accept My people need to eat, but really: serving Ham Sandwiches to the devout at the temple during Yom Kippur?" Bauman hung his head in shame. "Even that I can allow to pass, even with the eating of that which is not Kosher. Im not pleased at all with the playing fast and loose with my peo ple, but I can accept these indiscretions."Bauman also heaved a sigh of relief.Finally, He turns to the third rabbi and says, "You, Rabinowitz, have gone too far! Am I asking too much? No, you flaunt the world at Me, even on the holiest days of Rosh Hashana and Yom Kippur by putting out a sign saying.... "Closed for the Holiday !!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8348, 'Religious jokes', 'A very religious man lived right next door to an atheist. While the religious one prayed day in, day out, and was constantly on his knees in communion with his Lord, the atheist never even looked twice at a church.However, the atheists life was good, he had a well-paying job and a beautiful wife, and his children were healthy and good-natured, whereas the pious mans job was strenuous and his wages were low, his wife was getting fatter every day and his kids wouldnt give him the time of the day.So one day, deep in prayer as usual, he raised his eyes towards heaven and asked:"Oh God, I honour you every day, I ask your advice for every problem and confess to you my every sin. Yet my neighbour, who doesnt even believe in you and certainly never prays, seems blessed with every happiness, while I go poor andsuffer many an indignity. Why is this?"And a great voice w as heard from above:"BECAUSE HE DOESNT BOTHER ME ALL THE TIME!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8349, 'Religious jokes', 'A Jewish lady named Mrs. Rosenberg who many years ago wasstranded late one night at a fashionable resort - one that didnot admit Jews.The desk clerk looked down at his book and said, "Sorry, noroom. The hotel is full." The Jewish lady said, "But yoursign says that you have vacancies." The desk clerkstammered and then said curtly, "You know that we do notadmit Jews. Now if you will try the other side of town..."Mrs. Rosenberg stiffened noticeable and said, "Ill have youknow I converted to your religion."The desk clerk said, "Oh, yeah, let me give you a little test.How was Jesus born?"Mrs. Rosenberg replied, "He was born to a virgin named Maryin a little town called Bethlehem.""Very good," replied the hotel clerk. "Tell me more."Mrs. Rosenberg replied, "He was born in a manger.""Thats right," said the hotel clerk. "And why was he born in amanger?"Mrs. Rosenberg said loudly , "Because a jerk like you in thehotel wouldnt give a Jewish lady a room for the night!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8350, 'Religious jokes', 'Theres this old priest who got sick of all the people in his parishwho kept confessing to adultery. One Sunday, in the pulpit, he said,"If I hear one more person confess to adultery, Ill quit!" Well, everyone liked him, so they came up with a code word. Someonewho had committed adultery would say they had "fallen."This seemed to satisfy the old priest and things went well, until thepriest died at a ripe old age. About a week after the new priestarrived, he visited the mayor of the town and seemed very concerned.The priest said, "You have to do something about the sidewalks intown. When people come into the confessional, they keep talking abouthaving fallen." The mayor started to laugh, realizing that no one had told the newpriest about the code word.Before the mayor could explain, the priest shook an accusing finger atthe mayor and said, "I dont know what youre l aughing about, yourwife fell three times this week."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8351, 'Religious jokes', 'A mother was teaching her three year old daughter The Lords Prayer. For several evenings at bedtime, she repeated it after her mother. One night she said she was ready to solo. The mother listened with pride, as she carefully enunciated each word right up to the end..."And lead us not into temptation", she prayed, "but deliver us some e-mail, Amen."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8352, 'Religious jokes', 'When the airline Captain announced they were flying over Salt LakeCity, Utah, a womantold the man sitting beside her, "I understand this is the home of theMormon religionwhere husbands believe its OK to have more than one wife." Thatstrue," he replied, "asa matter of fact I happen to be a Mormon myself and have nine wives.""Howdisgusting,"she said,"you should be ashamed of yourself, suchpractices should be againstthe law and you ought to be hung." With a slight grin, he just said,"Yes, mam I am."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8353, 'Religious jokes', 'An old drunk stumbles into a confessional. After not hearing anythingfor a while thePriest knocked on the wall. The drunk said forget it buddy theres nopaper in here either.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8354, 'Religious jokes', 'The Pope dies and, naturally, goes to heaven. Hes met by thereception committee, andafter a whirlwind tour is told that he can enjoy any of the myriadrecreations available.He decides that he wants to read all of the ancient original text ofthe Holy Scriptures, andspends the next eon or so learning the languages. After becoming alinguistic master, hesits down in the library and begins to pore over every version of theBible, working backfrom the most recent "Easy Reading" to the original script.All of a sudden there is a scream in the library. The angels comerunning to him, only tofind the Pope huddled in a chair, crying to himself, and muttering,"An R! They left outthe R."God takes him aside, offering comfort and asks him what the problemis. After collectinghis wits, the Pope sobs again, "Its the letter R ... the word wassupposed to beCELEBRATE!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8355, 'Religious jokes', 'An elderly man was quite unhappy because he had lost his favorite hat.Instead of buying anew one, he decided he would go to church and swipe one out of thevestibule. When hegot there, an usher intercepted him at the door and took him to a pewwhere he had to sitand listen to the entiresermon on "The Ten Commandments." Afterchurch, the man metthe preacher in the vestibule doorway, shook his had vigorously, andtold him "I want tothank you preacher for saving my soul today. I came to church to steala hat and afterhearing your sermon on the 10 Commandments, I decided against it."Preacher: "You mean the commandment I shall not steal changed yourmind?"Old Man: "No, the one about adultery did.As soon as you said that I remember where I left my old hat!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8356, 'Religious jokes', 'Moses, Jesus and an old man are golfing. Moses steps up tothe tee and hits the ball. It goes sailing over the fairway and landsin the water trap. Moses parts the water and chips the ball onto thegreen.Jesus steps up to the tee and hits the ball. It goes sailing over thefairway and lands in the water trap.Jesus just walks on the water and chips the ball onto the green. Theold man steps up to the tee and hits the ball. It goes sailing overthe fairway and heads for the water trap. But, just before it fallsinto the water, a fish jumps up and grabs the ball in its mouth. As thefish is falling back down into the water, an eagle swoops down and grabs the fish in its claws. The eagle flies over the green where alightning bolt shoots from the sky and barely misses it. Startled, theeagle drops the fish. When the fish hits the ground, the ball pops outof its mouth and rolls into the hole for a hole-in -one.Jesus then turns to the old man and says, "Dad, if you dont stopfooling around, we wont bring you next time."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8357, 'Religious jokes', 'After church on Sunday morning, a young boy suddenly announced to his mother, "Mom, Ive decided Im going to be a minister when I grow up. "Thats okay with us," the mother said, "But what made you decide to be a minister?" "Well," the boy replied, "Ill have to go to church on Sunday anyway, and I figure it will be more fun to stand up and yell than to sit still and listen.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8358, 'Religious jokes', 'A pious man who had reached the age of 105 suddenly stopped going to synagogue. Alarmed by the old fellows absence after so many years of faithful attendance the Rabbi went to see him. He found him in excellent health, so the Rabbi asked, "How come after all these years we dont see you at services anymore?"The old man looked around and lowered his voice. "Ill tell you, Rabbi," he whispered. "When I got to be 90, I expected God to take me any day. But then I got to be 95, then 100, then 105. So I figured that God is very busy and mustve forgotten about me, and I dont want to remind Him!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8359, 'Religious jokes', 'The Pope took a philosophy professor (an atheist at that) out fishing ona large lake. As they drifted on the still lake, the philosopheraccidentally dropped an oar and watched it float away. The pontiffstepped out of the boat, walked across the water to the oar, grabbed itand walked back to the boat. The next day at the university, a colleagueasked the philosopher if he had enjoyed fishing with the Pope. "It wasokay, but would you believe that guy cant swim?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8360, 'Religious jokes', 'What do you get when you cross Holy Water with castor oil?A religious movement!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8361, 'Religious jokes', 'A Rabbi and a Priest were sitting together on a train, and the Rabbileans over and asks, "So how high can you advance in your organization?"The Priest says "If I am lucky, I guess I could become a Bishop.""Well, could you get any higher than that?" asks the Rabbi."I suppose that if my works are seen in a very good light that I mightbe made an ArchBishop" said the Priest a bit cautiously."Is there any way that you might go higher than that?""If all the Saints should smile, I guess I could be made a Cardinal""Could you be anything higher than a Cardinal?" probed the Rabbi.Hesitating a little bit, the Priest said "I supose that I could beelected Pope, but..."So the Rabbi says "And could you be anything higher than that?,is there any way to go up from being the Pope?""What!!! I should be the Messiah himself!?!"The Rabbi leaned back and said "One of ou r boys made it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8362, 'Religious jokes', 'A man is struck by a bus on a busy street in in New York City.He lies dying on the sidewalk as a crowd of spectators gathers around."A priest. Somebody get me a priest!" the man gasps. A policemanchecks the crowd----no priest, no minister, no man of God of any kind."A PRIEST, PLEASE!" the dying man says again. Then out of thecrowd steps a little old Jewish man of at least eighty years of age."Mr. Policeman," says the man, "Im not a priest. Im not evena Catholic. But for fifty years now Im living behind St. ElizabethsCatholic Church on First Avenue, and every night Im listeningto the Catholic litany. Maybe I can be of some comfort to this man."The policeman agreed and brought the octogenarian over to wherethe dying man lay. He kneels down, leans over the injured and saysin a solemn voice:"Under the B, 4. Under the I, 19. Under the N, 38.Under the G, 54. Under th e O, 72. . ."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8363, 'Religious jokes', 'Did you hear about that guy who was asked to be a Jehovahs witness? - He refused becuase he hadnt seen the accident.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8364, 'Religious jokes', 'A lawyer and the pope were both killed in an accident.The two were in line to see St. Peter at the Pearly Gates.St. Peter asked the lawyer his name and looked it up inhis book. He then asked the Pope for his name, and lookedit up in his book also. "Now, if you will come with me, Iwill show you your eternal dwellings," said St. Peter. Theywalked along the clouds and came to a huge mansion with allsorts of lavish trappings. St. Peter turned to the lawyerand told him this was to be his house. The Pope, knowing howimportant he was to the church could hardly imagine what hishouse would be like. St. Peter and the Pope continued on toa small, beat-up wooden shack. St. Peter told the Pope thatthis would be his dwelling. The Pope, shocked, said toSt. Peter, "Just a minute! That other guy was a lawyer and hegets a mansion. I was the head of the Roman Catholic church,and this is all the reward I g et?" St. Peter looked at thePope and said "True, you have done great things. Butwe have lots of Popes in Heaven, and that guy was the firstlawyer ever to make it up here."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8365, 'Religious jokes', 'One Sunday morning the pastor noticed little Johnny was standing staring up at the large plaque that hung in the foyer of the church. The young man of seven had been staring at the plaque for some time, so the pastor walked up and stood beside him and gazing up at the plaque he said quietly, "Good morning son." "Good morning pastor" replied the young man not taking his eyes off the plaque. "Sir, what is this?" Johnny asked."Well son, these are all the people who have died in the service", replied the pastor. Soberly, they stood together staring up at the large plaque.Little Johnnys voice barely broke the silence when he asked quietly, "Which one sir, the 8:30 or the 10:30?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8366, 'Religious jokes', 'A priest and a rabbi operated a church and a synagogueacross the street from each other. Since their schedulesintertwined, they decided to go in together to buy a car.So they did. They drove it home and parked it in thestreet between their establishments. A few minutes later, the rabbi looked out and saw thepriest sprinkling water on their new car. It didnt needa wash, so he ran out and asked the priest what he wasdoing. "Im blessing it" the priest replied.The rabbi replied "Oh," then he ran back into the synagogue.He reappeared a few minutes later with a hack saw, ran to thecar and cut off the last 2 inches of the tailpipe.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8367, 'Religious jokes', 'There was an old woman on a plane, sitting next to the Pope. It was stormy outside, and the plane wasbeing rocked by some severe turbulence. So this kindly old lady looked upon Deaths door, and said to her papal neighbour. Father, surely you can do something about this...To which the Pope replied, Sorry lady, Im in sales, not management.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8368, 'Religious jokes', 'Sister Mary burst into the office of the principal of Our Ladyof Perpetual Motion parochial school in an advanced state ofagitation. "Father!" she cried, "just WAIT until you hear this!"The priest led the sister to a chair, and said, " Now just calmdown and tell me what has you so excited?" "Well, father" the nunbegan, "I was just walking down the hall to the chapel and Iheard some of the older boys wagering money!""A serious infraction, indeed!" said the priest. "But thats not what has me so excited, father" replied the nun,"it was WHAT they were wagering ON! They had wagered on acontest to see who could urinate the highest on the wall!!""What an incredible wager!" exclaimed the priest, "What did you do?""Well, I hit the CEILING, father.""How much did you win?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8369, 'Religious jokes', 'When this guy heard that the Pope was coming to town, he wentout and bought a tuxedo in the hope that the Pope might noticehim on the parade route. When he went to the parade, there wasthis bum standing next to him, with old, dirty clothes on. Thethe guys amazement, when the Pope came, he went over to thebum, and whispered something in his ear. Enraged, the guy wentover to the bum and offered him $100 for the clothes off hisback. Next day, he went back to the parade dressed like a bum.Sure enough, when the Pope came, he stopped in front of thisguy, and whispered in his ear, "I thought I told you to getthe hell out of here!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8370, 'Religious jokes', 'Two priests and a rabbi were discussing what portion of theweekly collection they kept for themselves. The first priestexplained that he drew a circle on the ground, stepped a fewpaces back and pitched the money towards the circle. Whatlanded in the circle he kept and what landed outside thecircle god kept.The second priest claimed that his method was almost the same,except that what landed outside the circle went to the priestand the money that landed inside the circle god kept.The rabbi said, "Ive got you both beat. I throw the moneyinto the air and what god wants, god takes."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8371, 'Religious jokes', 'A few years ago, when the Catholic church reform began to be muchin the news, Mrs. Moskowitz said to Mrs. Finkelstein, "Tell me,Becky, have you heard by chance whats going on in Rome?""No," said Mrs Finkelstein. "I havent. Whats going on in Rome?""A meeting of high Catholic churchmen has, among other things,decided that the Jews are not responsible for the crucifixion ofJesus."Mrs Finkelstein raised her eyebrows. "Indeed? And who is responsible, then?""Im not sure," said Mrs. Moskowitz. "I think they suspect the Puerto Ricans."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8372, 'Religious jokes', 'On the steps of this church two pan handlers were doing their dailybusiness. One wore a large cross on his chest and the other - a starof David. Of course, most of the church goers generously gave to thecross wearer and the other was overlooked.Finally the Pastor approached the Jew and suggested that if he takeoff the star of David maybe hed get some more hand outs."Get this guy, Chaim" laughs the pan handler and turns to his crosswearing pal, "Hes trying to teach *us* how to do business!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8373, 'Religious jokes', 'The local priest came across Paddy who had stumbled out of the town tavern."Paddy," he said, " Im afraid Ill not be seeing you in Heaven one day.""Really, Father?" slurred Paddy. "What have you done?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8374, 'Religious jokes', 'The priest was preparing a man for his long days journey into night.Whispering firmly, the priest said, "Denounce the Devil! Let him knowhow little you think of his evil!"The dying man said nothing.The priest repeated his order. Still the dying man said nothing.The priest asked, "Why do you refuse to denounce the Devil and his evil?"The dying man said, "Until I know where Im heading, I dont think Iought to aggravate anybody!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8375, 'Religious jokes', 'Easter is approaching. Father OMaley checks estimates for the flowerdecoration of the altar.The catholic florist - $ 300. "Too expensive" moans the priest.The protestant florist - $ 250, "No, it would not be right to buy atanother Christian believer, especially as the price difference is rather small." But lo! Solly Goldberg - $ 75!!!Religion or economics? After much consideration, Solly obtains thecontract.On Easter Sunday morning, Goldbergs men deliver the flowers: wonderfulroses, azaleas, camellias, tulips and carnations. OMaleys last reservations are discarded.When the parishioners arrive in the church, they see the magnificentflower arrangement and a ribbon with the inscription:"Jesus has risen! But the prices of Goldberg always stay the same."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8376, 'Religious jokes', 'Paul says to Jesus, "Hey man, whatcha doing for Passover?"Jesus says, "Just hanging around."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8377, 'Religious jokes', 'Mr. Smith was brought to Mercy Hospital (a Catholic hospital),and taken quickly in for coronary surgery. The operation wentwell and, as the groggy man regained consciousness, he wasreassured by a Sister of Mercy, who was waiting by his bed."Mr. Smith, youre going to be just fine," said the nun, gentlypatting his hand. "We do need to know, however, how you intend topay for your stay here. Are you covered by insurance?""No, Im not," the man whispered hoarsely."Then can you pay in cash?" persisted the nun."Im afraid I cannot, Sister.""Well, do you have any close relatives?" the nun questionedsternly."Just my sister in New Mexico," he volunteered. "But shes ahumble spinster nun.""Oh, I must correct you, Mr. Smith. Nuns are not spinsters - they are married to God.""Wonderful," said Mr. Smith. "In that case, please send the bill to my brother-in -law."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8378, 'Religious jokes', 'Q: Did you hear about the dyslexic Satanist?A: He sold his soul to Santa.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8379, 'Religious jokes', 'Q: Whats the difference between Jesus and a picture of Jesus?A: It only takes one nail to hang the picture.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8380, 'Religious jokes', 'Several years ago, the Catholic Church required women to wear a headcovering in order to enter the sanctuary. One Sunday a lady arrivedwithout her head covering. The priest informs her that she cannot enter without it. A few moments later, the lady re-appears wearing her blouse tied toher head. The shocked priest says, "Madam, I cannot allow you toenter this holy place without your wearing a blouse." "But Father, I have a divine right," she informs."Yes, I see. And your left one isnt bad either, but you still must wear a blouse to enter *this* church!" he insists.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8381, 'Religious jokes', 'Jesus and Moses are sitting in a boat fishing and Jesus says to Moses "I want to do a miracle so we can feel like the good old days." and Moses says "Yeah sure." So Jesus gets up and says "I think Ill walk on the water, that was always a good one." So Jesus walks over to the edge of the boat, steps into the water, and sinks like a stone. Moses drags Jesus back into the boat and revives him. Moses then says "Whats the problem?" and Jesus says, "I think its the holes in my feet!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8382, 'Religious jokes', 'A little Catholic kid was praying as hard as he could.God, he prayed, I really want a car.Jumping up and dashing to the window, he saw that the driveway was empty.God, he prayed again, I really NEED a car.Still no answer to his prayers. Suddenly the kid stood up, ran into his parents bedroom, and grabbed the statuette of the Virgin Mary off the mantelpiece. He wrapped it up in ten layers of paper, using three rolls of tape and a spool of twine, then stuffed it inside a box at the very bottom of his closet.Okay, God, he said, getting down onto his knees again, if you ever want to see your mother again...', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8383, 'Religious jokes', 'While leading the Friday evening services, the Rabbi noticed a member ofthe congregation, Bernie, walk in with a St. Bernard dog. The Rabbi,horrified, asked the Cantor to continue the service and went to talk toBernie.Rabbi: "What are doing here with a dog?"Bernie: "The dog came here to pray.""Oh, come on." says the Rabbi."YES!" says Bernie.Rabbi: "I dont believe you. You are just fooling around; thats not aproper thing to do in temple."Bernie: "Its true!".."Ok", says the Rabbi, "then show me what the dog can do.""OK" says Bernie nodding to the dog...The dog proceeds to open up thebarrel under his neck and removes a yarmulke, a tallis (puts them on hishead) and prayer book and actually starts saying prayers in Hebrew! TheRabbi is so shocked he listens for a full 15 minutes.When the Rabbi regains his composure, he is so impressed with the qualityof the praying he  says to Bernie. "Do you think your dog would considergoing to Rabbinical school????"Bernie, throwing up his hands in disgust says,"YOU TALK TO HIM! He wants to be a doctor!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8384, 'Religious jokes', 'Three Pastors from the south were having lunch in a diner. One said, "Ya know, since summer started Ive been having trouble with bats in my loft and attic at church. Ive tried everything-noise, spray, cats-nothingseems to scare them away. Another said, "Yea, me too. Ive got hundreds living in my belfry and in the attic. Ive even had the place fumigated, and they wont go away." The third said, "I baptized all mine, and made them members of the church... Havent seen one back since!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8385, 'Religious jokes', 'A little nine year old girl was in church with her mother when she started feeling ill. "Mommy," she said. "Can we leave now?" "No," her mother replied. "Well, I think I have to throw up!" "Then go out the front door and to the back of the church and throw up behind a bush." In about two minutes the little girl returned to her seat. "Did you throw up?" her mother asked. "Yes," the little girl replied. "Well, how could you have gone all the way to the back of the church and return so quickly?" "I didnt have to go out of the church, Mommy." the little girl replied. "They have a box next to the front door that says, For the sick."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8386, 'Religious jokes', 'The church was conducting its annual fund drive. One member of the congregation said, "I give ten dollars." Just then, a piece of plaster fell from the ceiling and landed on his head. He spoke up again quickly. "I give a thousand dollars!"The minister said, "Lord, hit him again!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8387, 'Religious jokes', 'A preacher was completing a temperance sermon: with great expression he said, "If I had all the beer in the world, Idtake it and throw it into the river."With even greater emphasis he said, "And if I had all the wine in the world, Id take it and throw it into the river."And then finally, he said, "And if I had all the whiskey in the world, Id take it and throw it into the river." He sat down.The song leader then stood very cautiously and announced with a smile, "For our closing song, let us sing Hymn # 365:"Shall We Gather at the River."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8388, 'Religious jokes', 'And Jesus said unto his disciples, "Whom do men say that I am?"And His disciples answered unto Him, "Master, thou art the supreme eschatological manifestation of omnipotent ecclesiastical authority, the absolute, divine, sacerdotal monarch."And Jesus said, "What?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8389, 'Religious jokes', 'Two nuns were driving alone out in the boonies. They ran out of gas. Fortunately they could walk to a gas station not far away, where they asked to purchase a can of gasoline. "Im sorry, sister," said the attendant, "but all I have for you to carry it in is an old chamberpot. The nuns agreed that this would be fine. They returned to the car.As they were pouring the gasoline into the tank, a man drove by, stopped his car, and said, "Oh sister, if only I had your faith."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8390, 'Religious jokes', 'Q. How can you tell if someone is half Catholic and half Jewish?A. When he goes to confession, he takes a lawyer with him.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8391, 'Religious jokes', 'A Jesuit, a Dominican and a Franciscan were walking along an old road, debating the greatness of their orders. Suddenly, an apparition of the Holy Family appeared in front of them, with Jesus in a manger and Mary and Joseph praying over him. The Franciscan fell on his face, over come with awe at the of sight God born in such poverty. The Dominican fell to his knees, Adoring the beautiful reflection of the Trinity and the Holy Family. The Jesuit walked up to Joseph, put his arm around his shoulder, and said, "So, where ya thinking of sending the kid for school?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8392, 'Religious jokes', 'On the airplane on his way back to Rome, the Pope was doing a crossword puzzle. After a while, he turned the the bishop sitting next to him and said,"Whats a four -letter word ending in "unt" which means "woman"?The bishop said,"Did you try "aunt"?The Pope said,"Mmmm. Do you have an eraser?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8393, 'Religious jokes', 'One day God called the Pope, and he said "John Paul I have good news and bad news. First the good news. I am tired of all the squabbling between the religions. I have decided there will be only the one true religion". The Pope was overjoyed and told God how wise his decision was, then asked "Whats the bad news?". God said the bad news is that I am calling from Salt Lake City.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8394, 'Religious jokes', 'A priest was vested in his surplus and cassock ready to process at the beginning of the service. His surplus was very ornate and he was swinging the incense pot which had smoke coming from it. A lady touched him on the shoulder and said, "Darling, I love your dress; but your purse is on fire!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8395, 'Religious jokes', 'Seymour was a good and pious man, and when he passed away, the Lord himself greeted him at the pearly gates of heaven. "Hungry, Seymour?" the Lord asked."I could eat," said Seymour.The Lord opened a can of tuna, and they shared it.While eating this humble meal, Seymour looked down into Hell and noticed the inhabitants devouring enormous steaks, pheasant, pastries and vodka.The next day, the Lord again asked Seymour if he were hungry, and Seymour again said, "I could eat."Once again, a can of tuna was opened and shared, while down below Seymour noticed a feast of caviar, champagne, lamb, truffles, brandy, and chocolates.The following day, mealtime arrived and another can of tuna was opened. Meekly, Seymour said, "Lord, I am very happy to be be in heaven as a reward for the good life I lived. But, this is heaven, and all I get to eat is tuna. But in the Other Place, they e at like Kings. I just dont understand." "To be honest, Seymour," the Lord said, "for just two people, does it pay to cook?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8396, 'Religious jokes', 'Before performing a baptism, the priest approached the young father and said solemnly, "Baptism is a serious step. Are you prepared for it?""I think so," the man replied. "My wife has made appetizers and we have a caterer coming to provide plenty of cookies and cakes for all of our guests.""I dont mean that," the priest responded. "I mean, are you preparedspiritually?""Oh, sure," came the reply. "Ive got a keg of beer and a case of whiskey."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8397, 'Religious jokes', 'This fundamentalist Christian couple felt it important to own an equallyfundamentally Christian pet. So, they went shopping.At a kennel specializing in this particular breed, they found a dog theyliked quite a lot. When they asked the dog to fetch the Bible, he did it in a flash. When they instructed him to look up Psalm 23, he complied equally fast, using his paws with dexterity. They were impressed, purchased the animal, and went home (piously, of course).That night they had friends over. They were so proud of their newfundamentalist dog and his major skills, they called the dog and showed off a little.The friends were impressed, and asked whether the dog was able to do any of the usual dog tricks, as well. This stopped the couple cold, as they hadnt thought about "normal" tricks.Well, they said, "lets try this out."Once more they called the dog, and they clearly pronounce d the command,"Heel!"Quick as a wink, the dog jumped up, put his paw on the mans forehead,closed his eyes in concentration, and bowed his head.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8398, 'Religious jokes', 'A little boy was learning about God in his church, and he was talking to his mother about it. She, not wanting to place prejudice in the little boys mind, sat him and said: "God is not a man or a woman, and God is not black or white."To which the child responded, "Well, then is God Michael Jackson?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8399, 'Religious jokes', 'Johnny is walking along and a priest is coming the other way. Johnny says, "Hey, mister, why are you wearing your collar backwards?"The priest says, "Because Im a father."Johnny says, "Yeah? Well, my old mans got three kids and he dont wear his collar backwards."The priest says "You dont understand, son. I have thousands of children." Johnny says, "You should wear your trousers backwards."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8400, 'Religious jokes', 'A man walked into a gift shop that sold religious items. Nearthe cash register he saw a display of caps with "WWJD"printed on all of them. He was puzzled over what the letterscould mean, but couldnt figure it out, so he asked the clerk.The clerk replied that the letters stood for "What Would JesusDo", and was meant to inspire people to not make rashdecisions, but rather to imagine what Jesus would do in thesame situation.The man thought a moment and then replied, "Well, Im damnsure Jesus wouldnt pay $17.95 for one of these caps."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8401, 'Religious jokes', 'Is there a God?A billion Hindus cant be wrong.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8402, 'Religious jokes', 'What is the meaning of life?All evidence to date suggests its chocolate.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8403, 'Religious jokes', 'What language do the Vatican Police speak?Pig Latin!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8404, 'Religious jokes', 'A minister was asked by a politician,"Name something the government can do to help the church."The minister replied, "Quit making one dollar bills."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8405, 'Religious jokes', 'An old rabbi is talking with one of his friends andsays with a warm smile, "I gladdened seven hearts today." "Seven hearts?" asks the friend. "How did you do that?" The rabbi strokes his beard and replies, "I performed three marriages." The friend looks at him quizically."Seven?" he asks. "I could understand six, but..." "What do you think" says the rabbi, "that I do this for free?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8406, 'Religious jokes', 'Knowing that the minister was very fond of cherry brandy, one of the church elders offered to present him with a bottle on one consideration - that the pastor acknowledge receipt of the gift in the church paper. "Gladly," responded the good man. When the church magazine came out a few days later, the elder turned at once to the "appreciation" column. There he read: "The minister extends his thanks to Elder Brown for his gift of fruit and for the spirit in which it was given."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8407, 'Religious jokes', 'At the first session of a conversion class theminister conducting the class asked, "What mustwe do before we can expect forgiveness from sin?" After a long silence, one of the men in attendanceraised his hand and said: "Sin?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8408, 'Religious jokes', 'Morris was passing a small courtyard and heard voices murmuring.He went in and saw an altar with a large zero in the middle anda banner that said N I L. White-robed people were kneeling before the altar chanting hymnsto The Great Nullity ,The Blessed Emptiness, and The Big Zero inthe Sky. Morris turned to a white-robed observer beside him and wispered,.... ...... "Is Nothing Sacred?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8409, 'Religious jokes', 'The congregation was sitting and waiting for the preacherto began his sermon when two masked men burst into thechurch and said "Whoever is not willing to take a bulletfor Jesus better leave now." More than half of thecongregation jumped up and ran out the door. The two men took off their masks, sat in the front rowand said, "Okay, Reverend, you can preach now. All thehyprocrites are gone."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8410, 'Religious jokes', 'What do you get when you cross a Jehovas witness with a business man?A door to door salesman!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8411, 'Religious jokes', 'A kindergarten teacher was observing her classroom of children whilethey were drawing. She walked around to look at the artwork.As she got to one little girl who was working diligently, she askedwhat the drawing was.The girl replied, "Im drawing God."The teacher paused and said, "But no one knows what God looks like.Without missing a beat, or looking up from her drawing the girlreplied, "They will in a minute."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8412, 'Religious jokes', 'How do Religious Education teachers mark exams? With spirit levels.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8413, 'Religious jokes', 'Examiner: I think you know very little, if anything at all, about the Bible. Can you quote any passage? Student: Judas departed and went and hanged himself. Examiner: Well, thats a surprise. Can you quote another? Student: Go thou and do likewise.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8414, 'Religious jokes', 'Jill: Have you read the Bible? Jack: No, Im waiting for the film to come round.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8415, 'Religious jokes', 'Whats black and white, black and white, black and white? A nun rolling down a hill.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8416, 'Religious jokes', 'At what time of day was Adam born? Just before Eve.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8417, 'Religious jokes', 'What did Adam do when he wanted some sugar?He raised Cain.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8418, 'Religious jokes', 'Who is the fastest runner in history.Adam - because he was the first in the human race.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8419, 'Religious jokes', 'Three Pastors from the south were having lunch in a diner. One said, "Ya know, since summer started Ive been having trouble with bats in my loft and attic at church. Ive tried everything-noise, spray, cats-nothing seems to scare them away. Another said, "Yea, me too. Ive got hundreds living in my belfry and in the attic. Ive even had the place fumigated, and they wont go away." The third said, "I baptized all mine, and made them members of the church... Havent seen one back since!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8420, 'Religious jokes', 'God is sitting up in his ivory tower, hes had enough of the pressures and stresses of being the number one, so hes decided to go on holiday. He calls all his super-being mates up and they pop around to discuss a few suggestions. "What about Mars," says one of them. "Nah I went there 15,000 years ago," says God, "it was shit, no atmosphere and too dusty." "What about Pluto," suggests another. "Nah I went there about 10,000 years ago," says God. "Fucking freezing it was too." "What about Mercury," says another. "Its nice but I went there about 5,000 years ago, I nearly burnt me bollox off it was that hot, never again," says God. "What about Earth then," suggests another. "You must be joking," says God, "I went there about 2,000 years ago, knocked up some Jewish bird, and theyre still bloody talking about it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8421, 'Religious jokes', 'Who was the best actor in the bible ?Samson, he brought the house down !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8422, 'Religious jokes', 'Whats the moral of the story about Jonah and the whale ?You cant keep a good man down !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8423, 'Religious jokes', 'Who designed Noahs ark?An ark-itect !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8424, 'Religious jokes', 'Q. How do you make holy water?A. Boil the hell out of it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8425, 'Religious jokes', 'A Sunday school teacher of preschoolers asked the students to learned one fact about Jesus by the following Sunday. The following week she asked each child in turn what he or she had learned. Susie said, "He was born in a manger." Bobby said, "He threw the money changers out of the temple." Little Johnny said, "He has a red pickup truck but he doesnt know how todrive it."Curious, the teacher asked, "And where did you learn that, Johnny?""From my Daddy," said Johnny. "Yesterday we were driving down the highway,and this red pickup truck pulled out in front of us and Daddy yelled at him,Jesus Christ! Why dont you learn how to drive?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8426, 'Restaurant jokes', 'How many cafeteria staff does it take to change a light bulb?"Sorry, we closed 18 seconds ago, and Ive just cashed up."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8427, 'Restaurant jokes', 'How many McDonalds counter girls does it take to change a light bulb?Two. One to change it and one to put some chips with it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8428, 'Restaurant jokes', 'A man walks into a Chinese restaurant but is told by theMaitred that there will be at least a twenty minute wait."Would you like to wait in the bar, Sir?", he says.The man goes into the bar and the bartender says, "Whatll it be?"The man replies, "Give me a Stoli with a twist."The bartender pauses for a few seconds, then smiles andsays, "Once upon time, there were FOUR little peegs . . . "', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8429, 'Restaurant jokes', 'Why was the restaurant called "Out of this World"? Because it was full of Unidentified Frying Objects.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8430, 'Restaurant jokes', 'Janes father decided to take all the family out to a restaurant for a meal. As hed spent quite a lot of money for the meal he said to the waiter, "Could I have a bag to take the leftovers home for the dog?" "Gosh!" exclaimed Jane, "Are we getting a dog?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8431, 'Restaurant jokes', 'Customer to friend: This is a wonderful restaurant. I ordered salad and I got the freshest salad in the world, I ordered coffee, and I got the freshest coffee in the world.Friend: I know - I ordered a small steak and got a calf.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8432, 'Restaurant jokes', 'At our local restaurant you can eat dirt cheap - but who wants to eat dirt?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8433, 'Restaurant jokes', '"Can I have some two-handed cheese, please?" a man in a restaurant asked the waiter. "What do you mean, two-handed cheese? asked the waiter. "You know, the kind you eat with one hand and hold your nose with the other."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8434, 'Restaurant jokes', 'Patron 1: I eat at a different restaurant every day.Patron 2: I dont tip, either.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8435, 'Restaurant jokes', 'Eulus stood in front of the take-out window of a Rawl-ins fast food restaurant. "I want two hamburgers," he said. "One with onions, and one without." The counter man: "Okay. Which ones without the onions?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8436, 'Restaurant jokes', 'I went to a restaurant that serves -breakfast at any time.- So I ordered French Toast during the Renaissance.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8437, 'Restaurant jokes', 'Have you ever seen a man-eating tiger ?No, but in the restaurant next door I once saw a man eating chicken !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8438, 'Restaurant jokes', 'Girl: How much is a soft drink ?Waitress: Fifty cents.Girl: How much is refill ?Waitress: The first is free.Girl: Well then, Ill have a refill.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8439, 'Restaurant jokes', 'What does a Chinese restaurant serve for Easter? Coloured eggrolls!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8440, 'Restaurant jokes', 'Hello? Freds Restaurant. Hello! Id like to know, do you serve crabs? We serve anyone, sir! Come on in!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8441, 'Restaurant jokes', 'Once a man went to a resturant and ordered an egg. When it was brought he didnt liked it so he informed the waiter that the egg was bad. Came the reply: "I dont lay egg sir I just lay table !"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8442, 'Restaurant jokes', 'At which fast food restaurant is a hamburger happiest?Arthur Treachers Fish and Chips!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8443, 'Restaurant jokes', 'Waiter, what is this bug doing on my wives shoulder!I dont know - friendly thing isnt he !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8444, 'Restaurant jokes', 'Two little boys were visiting their grandfather and he took them to a restaurant for lunch. They couldnt make up their minds about what they wanted to eat.Finally the grandfather grinned at the server and said, "Just bring them bread and water."One of the little boys looked up and quavered, "Can I have ketchup on it?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8445, 'Restaurant jokes', 'A out-of-towner in New York at the height of the tourist season decided to revisit an uptown restaurant hed enjoyed on a previous trip to the city. Finally catching the eye of an overworked waiter, he said, "You know, its been over five years since I first came in here." "Youll have to wait your turn, sir," replied the harried and now irritated waiter, "I can only serve one table at a time."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8446, 'Restaurant jokes', '"Whats the matter with your dinner ?""Can you describe it for me please in case I need to tell my doctor later what Ive eaten !"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8447, 'Restaurant jokes', 'Is your food spicy Sir ?No, smoke always comes out of my ears !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8448, 'Restaurant jokes', 'Young woman sat down in small restaurant, a waitress came over to take her order. "Ill have a hamburger please." "Burger!" she yelled over her shoulder. Then woman added. "Make that well done." Waitres turned away again. "Torture it!" she yelled.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8449, 'Restaurant jokes', 'The headwaiter of an elegant restaurant recoiled in disgust as a man in boots, torn jeans and a leather jacket approached him. "Hey, man," he said, "wheres the toilet?" "Go down the hall and turn left, "replied the headwaiter. "When you see the sign marked Gentlemen; pay no attention to it and go right on in."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8450, 'Restaurant jokes', 'There was an awful fight at the seafood restaurant.Four fish got battered!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8451, 'Restaurant jokes', 'Waiter, waiter, does the pianist play requests? Yes, sir. Then ask him to play tiddlywinks until Ive finished my meal.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8452, 'Restaurant jokes', 'Q:What did one plate say to the other plate? A:(Lunch is on me!)', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8453, 'Restaurant jokes', 'A man and his girlfriend were out to dinner one night. The waiter tells them the nights special is chicken almondine and fresh fish."The chicken sounds good; Ill have that," the woman says.The waiter nods. "And the vegetable?" he asks."Oh, hell have the fish," she replies.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8454, 'Restaurant jokes', 'Sign at restaurant reads: Eat here diet home', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8455, 'Restaurant jokes', 'An American tourist was lunching in a restaurant in China where the specialty was duck. The waiter explained each dish as he brought it to the table. "This is the breast of the duck; this the leg of the duck; this is the wing of the duck; etc." Then came the dish that the American knew was chicken. He waited for the explanation. Silence. "Well?" he finally asked, "Whats this?" The waiter replied, "Its a friend of duck."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8456, 'Salesmen jokes', 'A salesman who was out on his territory had a heart attack in his motel room and died. The motel manager called the salesmans company and related the tragedy to the sales manager.The sales manager received the news in a nonchalant manner and told the motel manager, "Return his samples by freight and search his pants for orders."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8457, 'Salesmen jokes', 'How can you tell when a salesperson is lying?His lips are moving.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8458, 'Salesmen jokes', 'A door-to-door vacuum cleaner salesman manages to bull his way into a womans home in a rural area."This machine is the best ever" he exclaims, whilst pouring a bag of dirt over the lounge floor.The woman says shes really worried it may not all come off, so the salesman says, "If this machine doesnt remove all the dust completely, Ill lick it off myself.""Do you want ketchup on it?" she says, "were not connected for electricity yet!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8459, 'Salesmen jokes', 'The out-of-work newlywed took a temporary job as a vacuum cleaner salesman to make ends meet. After 3 days of intensive training, the sales manager told him to go home and practice his pitch on his wife.The next morning, the manager asked the novice how he made out.Well," the man began, "I did what you said, and after I finished, I asked her if she would buy the vacuum cleaner from me. She said Yes. Then I asked her why ? She replied, Because I love you."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8460, 'Salesmen jokes', 'A traveling salesman was held up by a bad storm in the Hawaiian Islands. He sent an e-mail to his corporate headquarters advising them that he was stranded for a few days and requested instructions.The reply came back shortly: "Begin vacation as of yesterday."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8461, 'Salesmen jokes', 'Insurance agent to would-be client: "Dont let me frighten you into a hasty decision. Sleep on it tonite. If you wake in the morning, give me a call then and let me know.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8462, 'Salesmen jokes', 'The couple was standing staring at one of the more expensive models in the auto showroom. A salesman sensing their debate over the price moved in and said, "This model is priced just over the car which is priced a few dollars above the car which costs no more than some models of the lowest priced cars."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8463, 'Salesmen jokes', 'An insurance salesman was getting nowhere in his efforts to sell a policy to a farmer. "Look at it this way sir." he said finally. "How would your wife carry on if you should die ?""Well..." drawled the weather-beaten man, "I dont reckon thatd be any concern of mine -- long as she behaves herself while Im alive."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8464, 'Salesmen jokes', 'A policeman came upon a super-salesman about to jump from a bridge and yelled, "Wait, Fellow! Please dont do that !!!"The salesman said, "Why not ?" and proceeded to expound on his views on the shaky economy, declining family life and Clinton politics.Shortly thereafter, they both jumped.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8465, 'Salesmen jokes', 'A woman was shopping in a fairly nice dress store. Trying on a dress and liking it, she asked the salesman the price. When he told her she launched into a tirade about prices these days, covering just about everything from housing to auto tires.After ten minutes or so, the salesman had obviously had enuff and said, "My dear lady. If the cost of living is so high and obviously so offensive to you, why do you bother ?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8466, 'Salesmen jokes', 'Had a door-to-door salesman call one time selling of all things -- burial plots. I told him that we already had our plots in another cemetery.He seemed uncertain as to what to say next, but he recovered to say politely, "I hope youll be very happy there."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8467, 'Salesmen jokes', 'Patient: Doctor, you have to help me stop talking to myself. Doctor: Why is that? Patient: Im a salesman and I keep selling myself things I dont want.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8468, 'Salesmen jokes', '"No, no, no!" said the enraged businessman to the persistent salesman. "I cannot see you today!" "Thats fine," said the salesman, "Im selling spectacles."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8469, 'Salesmen jokes', 'Salesman: Roll up, roll up! Come to our mammoth sale. Mammoth bargains to be had in our mammoth sale. Customer: Forget it! No one round heres got room in their houses for a mammoth.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8470, 'Salesmen jokes', 'One day Mikey was sitting in his apartment when his doorbell unexpectedly rang. He answered the door and found a salesman standing on his porch with a strange object."What is that?" Mikey asked. "Its a thermos," the salesman replied. "What does it do?" asked Mikey. "This baby," the salesman said, "keeps hot things hot and cold things cold."After some deliberation Mikey bought one, deciding it would really help his lunch situation. The next day he arrived at the plant where he works. Sure enough, all the other employees were curious about his new object. "What is it?" they asked."Its a thermos," Mikey replied."What does it do?" they asked."Well," Mikey says in a bragging manner, "It keeps hot things hot and cold things cold.""What do ya got in it?"To which Mikey says, "Three cups of coffee and a popsicle."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8471, 'Salesmen jokes', 'The top toothbrush salesman at the company was asked by his boss how he managed to sell so many brushes. He replied "Its easy" and he pulled out his card table, setting his display of brushes on top. He told his boss, I lay the brushes out like this, and then I put out some potato chips and dip to draw in the customers. He laid out his chips and dip. His boss said, "Thats a very innovative approach" and took one of the chips, dipped it, and stuck it in his mouth. "Yuck, this tastes terrible!" his boss yelled. The salesman replied "IT IS! Want to buy a toothbrush?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8472, 'Salesmen jokes', 'An inexperienced real estate salesman asked his boss if he could refund the deposit to an angry customer who had discovered that the lot he had bought was under water."What kind of salesman are you?" the boss scolded. "Get out there and sell him a boat."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8473, 'Salesmen jokes', 'Policeman: Why didnt you check your speedometer?Driver: It broke when I hit 100.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8474, 'Salesmen jokes', 'Salesman: That suit looks nice. It fits like a bandage.Customer: Thanks. I bought it by accident.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8475, 'Salesmen jokes', 'Salesman: This jug is genuine Indian pottery.Customer: But it says "Made in Cleveland."Salesman: Havent you ever heard of the Cleveland Indians?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8476, 'Salesmen jokes', 'Salesman: Would you like to buy a pocket calculator?Customer: No, thanks. I know how many pockets I have.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8477, 'Salesmen jokes', 'Customer: You said these pants were pure wool, but the label says "all cotton."Salesman: Oh, thats just to keep the moths away.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8478, 'Salesmen jokes', 'Ned: What does your Dad sell ?Ed: Salt.Ned: Well, my dad is a salt seller, too.Ed: Shake.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8479, 'Salesmen jokes', 'What does a carpet salesman give his wife for Valentines Day? Rugs and kisses!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8480, 'Salesmen jokes', 'A famous art collector is walking through the city when he notices a mangy cat lapping milk from a saucer in the doorway of a store and he does a double take. He recognizes that the saucer is extremely old and very valuable, so he walks casually into the store and offers to buy the cat for two dollars. The storeowner replies "Im sorry, but the cat isnt for sale. The collector says, "Please, I need a hungry cat around the house to catch mice. Ill pay you twenty dollars for that cat." And the owner says "Sold," and hands over the cat. The collector continues, "Hey, for the twenty bucks I wonder if you could throw in that old saucer. The cats used to it and itll save me from having to get a dish." And the owner says, "Sorry buddy, but thats my lucky saucer. So far this week Ive sold sixty-eight cats."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8481, 'Salesmen jokes', 'What happened when the man asked the salesman for a good belt?"O.K., you asked for it," the salesman said as he gave him a good belt.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8482, 'Salesmen jokes', 'What do you have to know to be a real estate salesman?Lots.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8483, 'Salesmen jokes', 'What salesman has the slickest line?A hair grease salesman.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8484, 'Salesmen jokes', 'A realty salesman had just closed his first deal, only to discover that the piece of land he had sold was completely under water."That customers going to come back here pretty mad," he said to his boss. "Should I give him his money back?""Money back?" roared the boss. "What kind of salesman are you? Get out there and sell him a houseboat."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8485, 'Salesmen jokes', '"Is your mother home?" the salesman asked a small boy sitting on the steps in front of a house. "Yeah, shes home," the boy said, scooting over to let him past. The salesman rang the doorbell, got no response, knocked once, then again. Still no one came to the door. Turning to the boy, the fellow said, "I thought you said your mother was home." The kid replied, "She is; but this isnt where I live.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8486, 'School jokes', 'When a teacher closes his eyes, why should it remind him of an empty classroom?Because there are no pupils to see!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8487, 'School jokes', 'Why did the teacher put the lights on?Because the class was so dim!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8488, 'School jokes', 'Teacher: How much is half of 8?Pupil: Up and down or across?Teacher: What do you mean?Pupil: Well, up and down makes a 3 or across the middle leaves a 0!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8489, 'School jokes', 'Great news, teacher says we have a test today come rain or shine.So whats so great about that?Its snowing outside!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8490, 'School jokes', 'Teacher: Where is your homework?Pupil: I was mugged on the way to school and the mugger took everything I had', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8491, 'School jokes', 'An ideal homework excuseTeacher: Where is your homework?Pupil: I was mugged on the way to school and the mugger took everything I had', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8492, 'School jokes', 'Where did all the cuts and blood come from?The school went on a trip!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8493, 'School jokes', 'Whats the worst thing youre likely to find in the school cafeteria?The food!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8494, 'School jokes', 'What kind of food do maths teachers eat?Square meals!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8495, 'School jokes', 'The food in our school canteen is perfect.If your a bug!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8496, 'School jokes', 'Whats black and white all over and difficult?An exam paper!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8497, 'School jokes', 'Why arent you doing very well in history?Because the teacher keeps asking about things that happened before I was born!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8498, 'School jokes', 'What was King Arthurs favourite game?Knights and crosses!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8499, 'School jokes', 'Did they play tennis in ancient Egypt?Yes, the bible tells how Joseph served in Pharoahs court!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8500, 'School jokes', 'Father: How do you like going to school?Son: The going bit is fine, as is the coming home bit too, but Im not too keen on the time in-between!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8501, 'School jokes', 'Teacher: Now class, whatever I ask, I want you to all answer at once. How much is six plus 4?Class: At once!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8502, 'School jokes', 'Where did the pilgrims land when they came to America?On their feet!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8503, 'School jokes', 'Teacher: Class, we will have only half a day of school this morning.Class: Hooray!Teacher: We will have the other half this afternoon!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8504, 'School jokes', 'Teacher: Is Lapland heavily populated?Class: No, there are not many Lapps to the mile!Teacher: Name an animal that lives in Lapland!Pupil: A reindeerTeacher: Good, now name another.Class: Another reindeer!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8505, 'School jokes', 'Teacher: Thats quite a cough you have there, what are you taking for it?Pupil: I dont know teacher. What will you give me?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8506, 'School jokes', 'Teacher: You arent paying attention to me. Are you having trouble hearing?Pupil: No, teacher Im having trouble listening!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8507, 'School jokes', 'Teacher: What are the Great Plains?Pupil: 747, Concorde and F-16!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8508, 'School jokes', 'Son: I cant go to school today. Father: Why not?Son: I dont feel wellTeacher: Where dont you feel well?Son: In school!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8509, 'School jokes', 'Teacher: Ill call you Fred Smith then.Pupil: My dad wont like that.Teacher: Why is that?Pupil: He doesnt like people taking the Mickey out of my name!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8510, 'School jokes', 'I failed every subject except for algebra.How did you keep from failing that?I didnt take algebra!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8511, 'School jokes', 'Teacher: Are you good at math?Pupil: Yes and noTeacher: What do you mean?Pupil: Yes, Im no good at math!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8512, 'School jokes', 'Teacher: Why is the Mississippi such an unusual river?Pupil: Because it has four eyes and cant see!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8513, 'School jokes', 'Teacher: Youre new here arent you, whats your name?Pupil: Fred Mickey Smith', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8514, 'School jokes', 'Pupil (on phone) : My son has a bad cold and wont be able to come to school today.School Secretary: Who is this?Pupil: This is my father speaking!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8515, 'School jokes', 'Father: I hear you skipped school to play footballSon: No I didnt, and I have the fish to prove it!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8516, 'School jokes', 'A history jokeTeacher: When was Rome built?Pupil: At night.Teacher: Why did you say that?Pupil: Because my Dad always says that Rome wasnt built in a day!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8517, 'School jokes', 'Pupil: My teacher was mad with me because I didnt know where the Rockies were.Mother: Well next time remember where you put things!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8518, 'School jokes', 'Mother: What was the first thing you learned in class?Daughter: How to talk without moving my lips!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8519, 'School jokes', 'Teacher: Whats big and yellow and comes in the morning to brighten a mothers day?Pupil: The school bus!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8520, 'School jokes', 'Teacher: When you yawn, your supposed to put your hand to your mouth!Pupil: What?, and get bitten!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8521, 'School jokes', 'Teacher: You missed school yesterday didnt you?Pupil: Not very much!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8522, 'School jokes', 'An ideal homework excuseTeacher: Where is your homework?Pupil: I left it in my shirt and my mother put it in the washing machine', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8523, 'School jokes', 'An ideal homework excuse Teacher: Where is your homework?Pupil: I didnt do it because I didnt want to add to your already heavy workload.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8524, 'School jokes', 'An ideal homework excuse Teacher: Where is your homework?Pupil: My little sister ate it!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8525, 'School jokes', 'Bad timing for an excuse Teacher: Why were you late?Pupil: Sorry, teacher, I overslept.Teacher: Its three in the afternoon!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8526, 'School jokes', 'An ideal homework excuseTeacher: Where is your homework?Pupil: Some aliens from outer space borrowed it so they could study how the human brain worked', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8527, 'School jokes', 'An ideal homework excuseTeacher: Where is your homework?Pupil: I loaned it to a friend, but he suddenly moved away', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8528, 'School jokes', 'Teacher: Can anyone tell me how many seconds there are in a year?Pupil: 12 - 2nd January, 2nd February...!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8529, 'School jokes', 'An ideal homework excuseTeacher: Where is your homework?Pupil: Our furnace stopped working and we had to burn it to stop ourselves from freezing', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8530, 'School jokes', 'Mother: What did you learn in school todaySon: How to write Mother: What did you write?Son: I dont know, they havent taught us how to read yet!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8531, 'School jokes', 'Teacher: This is the third time Ive had to tell you off this week, what have you got to say about that?Pupil: Thank heavens its Friday!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8532, 'School jokes', 'Teacher: Didnt you hear me call you?Pupil: But you said not to answer you back!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8533, 'School jokes', 'Why was the headmaster worried?Because there were too many rulers in school!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8534, 'School jokes', 'Why did the teacher wear sunglasses?Because his class was so bright!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8535, 'School jokes', 'Did you hear about the cross eyed teacher?He couldnt control his pupils!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8536, 'School jokes', 'Teacher: What family does the octopus belong to?Pupil: Nobody I know!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8537, 'School jokes', 'Whats yellow, has wheels and lies on its back?A dead school bus!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8538, 'School jokes', 'Teacher: I hope I didnt see you looking at Freds test paper.Pupil: I hope you didnt see me either!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8539, 'School jokes', 'Teacher: You copies from Freds exam paper didnt you?Pupil: How did you know?Teacher: Freds paper says "I dont know" and you have put "Me, neither"!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8540, 'School jokes', 'Teacher, I cant solve this problem.Any five year old should be able to solve this one.No wonder I cant do it then, Im nearly ten!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8541, 'School jokes', 'Teacher: Why cant you ever answer any of my questions?Pupil: Well if I could there wouldnt be much point in me being here!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8542, 'School jokes', 'Little Monster: I hate my teacher.Mother Monster: Well just eat your salad up then dear!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8543, 'School jokes', 'Dad, can you help me find the lowest common denominator in this problem please?Dont tell me that they havent found it yet, I remember looking for it when I was a boy!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8544, 'School jokes', 'Teacher: What came after the stone age and the bronze age?Pupil: The sausage!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8545, 'School jokes', 'Mother: Why did you just swallow the money I gave you?Son: Well you did say it was my lunch money!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8546, 'School jokes', 'Teacher: I said to draw a cow eating some grass but youve only drawn the cow?Pupil: Yes, the cow ate all the grass!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8547, 'School jokes', 'My teacher reminds me of history Shes always repeating herself!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8548, 'School jokes', 'Teacher: Did your parents help you with these homework problems?Pupil: No I got them all wrong by myself!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8549, 'School jokes', 'Father: What did the teacher think of your idea?Son: She took it like a lambTeacher: Really?, what did she say?Son: Baa!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8550, 'School jokes', 'What do history teachers make when they want to get together?Dates!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8551, 'School jokes', 'Teacher: What can you tell me about the Dead Sea?Pupil: Dead?, I didnt even know he was sick!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8552, 'School jokes', 'Father: How were the exam questions?Son: EasyFather: Then why look so unhappy?Son: The questions didnt give me any trouble, just the answers!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8553, 'School jokes', 'What are you going to be when you get out of school?An old man!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8554, 'School jokes', 'What did you learn in school today?Not enough, I have to go back tomorrow!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8555, 'School jokes', 'Mother: How was your first day at school?Son: It was all right except for some man called "Teacher" who kept spoiling all our fun!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8556, 'School jokes', 'Im not going back to school ever againWhy ever not?The teacher doesnt know a thing, all she does is ask questions!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8557, 'School jokes', 'Fred came home from his first day at school. "Nothing exciting happened", he told his mother, "Except the teacher didnt know how to spell cat so I told her"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8558, 'School jokes', 'What happens if you draw on the blackboard and the teacher told you not to?She draws a smack!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8559, 'School jokes', 'Pupil: I dont think I deserved zero on this test!Teacher: I agree, but thats the lowest mark I could give you!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8560, 'School jokes', 'Father: You were absent on the day of the test?Son: No but the boy who sits next to me was!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8561, 'School jokes', '"Its clear" said the teacher, "That you havent studied your geography. Whats your excuse?" "Well, my dad says the world is changing every day . So I decided to wait until it settles down!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8562, 'School jokes', 'An ideal homework excuseTeacher: Where is your homework?Pupil: I put it in a safe, but lost the combination!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8563, 'School jokes', 'Why do teachers use a bamboo cane?Because when the cane goes bam the child goes boo!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8564, 'School jokes', 'Sandy began a job as an elementary school counselor and she was eager to help. One day during recess she noticed a girl standing by herself on one side of a playing field while the rest of the kids enjoyed a game of soccer at the other.Sandy approached and asked if she was all right. The girl said she was. A little while later, however, Sandy noticed the girl was in the same spot, still by herself. Approaching again, Sandy offered, "Would you like me to be your friend?" The girl hesitated, then said, "Okay," looking at the woman suspiciously. Feeling she was making progress, Sandy then asked, "Why are you standing here all alone?" "Because," the little girl said with great exasperation, "Im the goalie!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8565, 'School jokes', 'A teacher was giving a lesson on the circulation of the blood. Trying to make the matter clearer, he said: "Now, students, if I stood on my head the blood, as you know, would run into it, and I should turn red in the face." "Yes, sir," the boys said. "Then why is it that while I am standing upright in the ordinary position the blood doesnt run into my feet?" A little fellow shouted, "Its because yer feet aint empty."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8566, 'School jokes', 'The children had all been photographed, and the teacher was trying to persuade them each to buy a copy of the group picture. "Just think how nice it will be to look at it when you are all grown up and say, Theres Jennifer; shes a lawyer, or Thats Michael, hes a doctor."A small voice from the back of the room rang out, "And theres the teacher; shes still old, nasty, and wrinkled"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8567, 'School jokes', 'A college business professor could not help but notice that one of his students was late to class for the third time that week. Before class ended he went around the room asking students some questions about the days lecture. Of course, he made sure to pick on his tardy pupil. "And who was it that developed the theories behind communism?" the professor asked."I dont know," the student said."Perhaps if you came to class on time, Mr. Reebs, you would know," said the professor."Thats not true," the student replied. "I never pay attention anyway!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8568, 'School jokes', 'A linguistics professor was lecturing to his English class one day. "In English," he said, "A double negative forms a positive. In some languages, though, such as Russian, a double negative is still a negative. However, there is no language wherein a double positive can form a negative."A voice from the back of the room piped up, "Yeah, right."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8569, 'School jokes', 'A professor was giving a big test one day to his students. He handed out all of the tests and went back to his desk to wait. Once the test was over, the students all handed the tests back in. The professor noticed that one of the students had attached a $100 bill to his test with a note saying "A dollar per point." The next class the professor handed the tests back out. This student got back his test and $56 change.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8570, 'School jokes', 'One day our professor was discussing a particularly complicated concept. A pre-med student rudely interrupted to ask, "Why do we have to learn this pointless information""To save lives." the professor responded quickly and continued the lecture.A few minutes later, the same student spoke up again. "So how does physics save lives?" he persisted."It keeps the ignoramuses like you out of medical school," replied the professor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8571, 'School jokes', 'A student called up his Mom one evening from his college and asked her for some money, because he was broke.His Mother said, "Sure, sweetie. I will send you some money. You also left your economics book here when you visited two weeks ago. Do you want me to send that up too?""Uhh, oh yeah, O.K." responded the kid.So his Mom wrapped the book along with the checks up in a package, kissed Dad goodbye, and went to the post office to mail the money and the book. When she gets back, Dad asked, "Well how much did you give the boy this time?""Oh, I wrote two checks, one for $20, and the other for $1,000 out to him.""Thats $1020!!!" yelled Dad, "Are you going crazy???""Dont worry hon," Mom said, kissed Dad on the on top of his bald head, "I taped the $20 check to the cover of his book, but I put the $1,000 one somewhere between the pages in chapter 15!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8572, 'School jokes', 'Introductory Chemistry was taught at Duke University for many years by professor Bonk. One year, two guys took the class and did pretty well on all the quizzes and mid-terms--so much so that going into the final, they each had a solid A. These two friends were so confident going into the final that the weekend before finals week, despite the Chemistry final being on Monday, they decided to go to the Uuniversity of Virginina to party with some friends.They did this and had a great time. However, with their hangovers and tiredness, they overslept all day Sunday and didnt make it back to Duke until early Monday morning. Rather than taking the final then, they found professor Bonk after the final and explained to him how they missed the final. They told him they went up to the University of Virgina for the weekend and had planned to come back in time to study, but they had a flat tire on the way  back and didnt have a spare. They couldnt fix it for a long time and were late getting back to campus.Bonk thought this over and agreed that they could take the final the following day. The two guys, elated and relieved, studied that night and went in the next day at the time that Bonk had told them. He placed them in separate rooms and handed each of them a test booklet. He told them to begin.They looked at the first problem which was something simple about molarity and solutions; it was worth 5 points. "Cool," they thought, "this is going to be an easy final". They then turned the page. They were unprepared, however, for what they saw on it. The question contained only two words: (95 points) Which tire?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8573, 'School jokes', 'A student comes to a young professors office hours. She glances down the hall, closes his door, kneels pleadingly."I would do anything to pass this exam." She leans closer to him, flips back her hair, gazes meaningfully into his eyes. "I mean..." she whispers, "...I would do...anything." He returns her gaze. "Anything?" "Anything." His voice softens. "Anything??" "Absolutely anything." His voice turns to a whisper. "Would you...study?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8574, 'School jokes', 'Man: "Hows your history paper coming?"Woman: "Well, my history professor suggested that I use the Internet for research, and its been very helpful. Man: "Really?"Woman: "Yes! Ive already located 17 people who sell them!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8575, 'School jokes', 'A mom and dad were worried about their son not wanting to learn math at the school he was in, so they decided to send him to a Catholic school. After the first day of school, their son comes racing into the house, goes straight into his room and slams the door shut. Mom and dad are a little worried about this and go to his room to see if he is okay. They find him sitting at his desk doing his homework. The boy keeps doing that for the rest of the year. At the end of the year the son brings home his report card and gives it to his mom and dad. Looking at it they see under math an A+.Mom and dad are very happy and ask the son, "What changed your mind about learning math?"The son looked at mom and dad and said, "Well, on the first day when I walked into the classroom, I saw a guy nailed to the plus sign at the back of the room behind the teachers desk and I knew they meant business."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8576, 'School jokes', 'The parents were very disappointed in the grades that their son brought home. "The only consolation I can find in these awful grades," lamented the father, "is that I know he never cheated during his exams."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8577, 'School jokes', '"Dad, can you write in the dark?""I think so. What is it you want me to write?""Your name on this report card."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8578, 'School jokes', 'A little girl came home from school and said to her mother, "Mommy, today in school I was punished for something that I didnt do."The mother exclaimed, "But thats terrible! Im going to have a talk with your teacher about this ... by the way, what was it that you didnt do?"The little girl replied, "My homework."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8579, 'School jokes', 'A teacher was having trouble teaching arithmetic to one little boy. So she said, "if you reached in your right pocket and found a nickel, and you reached in your left pocket and found another one, what would you have?""Somebody elses pants."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8580, 'School jokes', 'Teacher: "Sam, what is the outside of a tree called?"Sam: "I dont know."Teacher: "Bark, Sam, bark."Sam: "Bow, wow, wow!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8581, 'School jokes', 'The teacher came up with a good problem. "Suppose," she asked the second-graders, "there were a dozen sheep and six of them jumped over a fence. How many would be left?""None," answered little Norman."None? Norman, you dont know your arithmetic.""Teacher, you dont know your sheep. When one goes, they all go!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8582, 'School jokes', 'The teacher is droning away in the classroom when he notices a student sleeping way up in the back row. The teacher shouts to the sleeping students neighbor, "Hey wake that student up!"The neighbor yells back, "You put him to sleep, you wake him up!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8583, 'School jokes', 'Teacher: Johnny, you know you cant sleep in my class.Johnny: I know. But maybe if you were just a little quieter, I could.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8584, 'School jokes', '"If there are any idiots in the room, will they please stand up" said the sarcastic teacher. After a long silence, one freshman rose to his feet."Now then mister, why do you consider yourself an idiot?" enquired the teacher with a sneer."Well, actually I dont," said the student, "but I hate to see you standing up there all by yourself."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8585, 'School jokes', '"Isnt the principal a dummy!" said a boy to a girl."Say, do you know who I am?" asked the girl."No.""Im the principals daughter.""And do you know who I am?" asked the boy."No," she replied."Thank goodness!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8586, 'School jokes', 'Teacher: Why are you late, Joseph?Joseph: Because of a sign down the road.Teacher: What does a sign have to do with your being late?Joseph: The sign said, "School Ahead, Go Slow!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8587, 'School jokes', 'A little kids in school, taking a true-false test and hes flipping a coin. At the end of the test hes flipping the coin again. The teacher says, "What are you doing?" He says, "Checking my answers."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8588, 'School jokes', 'What do you get when you add 2 apples to 3 apples? A senior high school math problem.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8589, 'School jokes', 'How many schoolteachers does it take to change a light bulb?None. Anything not completed during the lesson is added to the homework.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8590, 'School jokes', 'How many students does it take to change a light bulb?None. Light bulb changing isnt in the course notes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8591, 'School jokes', 'Johnny comes back from school crying and says, "Mommy all the kids in the school say I have a big head." His mother replies, "No you dont Johnny. You have a hideously deformed head. The other children are merely hiding the truth to protect your feelings."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8592, 'School jokes', 'A school teacher injured his back and had to wear a plaster cast around the upper part of his body. He wore it under his shirt and it was not noticeable at all. On the first day of the term, still with the cast under his shirt, he found himself assigned to the toughest class in the school. Walking confidently into the rowdy classroom, he opened the window as wide as possible and then busied himself with desk work. The classroom became a bit unruly and he admonished them. This happened several times. While working at his desk, the strong breeze from the window made his tie flap annoyingly. He kept rearranging and rearranging the tie as the class become more and more unmanageable. Finally, becoming disgusted with the wayward tie, he stood up and took a big stapler off his desk and stapled the tie to his chest in several places. Discipline was not a problem from that day forth.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8593, 'School jokes', 'Did you hear what happened when there was an epidemic of laryngitis at school? The school nurse sent everyone to the croakroom.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8594, 'School jokes', 'Teacher: Why do you want to work in a bank, Alan? Fred: Cuz theres money in it, sir.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8595, 'School jokes', 'Teacher: Didnt you know the bell had gone? Fred: I didnt take it, Miss.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8596, 'School jokes', 'Whats the longest piece of furniture in the school? The multiplication table.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8597, 'School jokes', 'Teacher: What happened to your homework? Pupil: I made it into a paper plane and someone hijacked it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8598, 'School jokes', 'School Principal: Ive called you into my office, Peter, because I want to talk to you about two words I wish you wouldnt use so often. One is "great" and the other is "lousy." Peter: Certainly, sir. What are they?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8599, 'School jokes', 'Im not going to school today, Alexander said to his mother. The teachers bully me and the boys in my class dont like me. Why ?Firstly, youre 35 years old. Secondly, youre the principal.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8600, 'School jokes', 'Boy to Friend: Im sorry, I wont be able to go out after school. I promised Dad that I would stay in and help him with my homework.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8601, 'School jokes', 'Ann! the teacher shouted one day at the girl who had been daydreaming out the window. If India has the worlds second largest population, oranges are 50 cents for six and it costs $3 for a day return to Austin, how old am I ?Thirty two!Why did you say that ?Well, my brothers sixteen and hes half mad !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8602, 'School jokes', 'Mother: Did you enjoy the school outing, dear ?Jane: Yes, and were going again tomorrow.Mother: Really ? Whys that ?Jane: To try and find the kids we left behind.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8603, 'School jokes', 'Why were you late ?Sorry, teacher, I overslept.You mean you need to sleep at home too !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8604, 'School jokes', 'Teacher: Thats quite a cough you have there, what are you taking for it ?Pupil: I dont know teacher. What will you give me ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8605, 'School jokes', 'Our teacher talks to herself does yours ?Yes, but she doest realise it, she thinks were actually listening !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8606, 'School jokes', 'Teacher: Why didnt you answer me ?Pupil: I did, I shook my headTeacher: You dont expect me to hear it rattling from here do you !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8607, 'School jokes', 'Teacher: Id like to go through one whole day without having to tell you off.Pupil: You have my permission !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8608, 'School jokes', 'The brain is a wonder ful thingWhy do you say that ? Because it starts working the second you get up in the morning and never stops until you get asked a question in class !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8609, 'School jokes', 'Be sure that you go straight home after schoolI cant, I live just round the corner !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8610, 'School jokes', 'Playing truant from school is like a credit cardFun now, pay later !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8611, 'School jokes', 'Laugh and the class laughs with you.But you get detention alone !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8612, 'School jokes', 'Teacher: Where is the English Channel ?Pupil: I dont know, my TV doesnt pick it up', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8613, 'School jokes', 'Teacher: Why does the statue of liberty stand in New York harbour ?Pupil: Because it cant sit down !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8614, 'School jokes', 'Teacher: Give me three reasons why the world is roundPupil: Well my dad says so, my mum says so and you say so !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8615, 'School jokes', 'Teacher: Are you good at math ?Pupil: Yes and noTeacher: What do you mean ?Pupil: Yes, Im no good at math !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8616, 'School jokes', 'Teacher: Whats 2 and 2Pupil: 4Teacher: Thats goodPupil: Good ?, thats perfect !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8617, 'School jokes', 'Teacher: How much is half of 8Pupil: Up and down or across ?Teacher: What do you mean ?Pupil: Well,up and down makes a 3 or across the middle leaves a 0', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8618, 'School jokes', 'The teacher was reviewing counting with her first-grade class. "Jackie," she asked, "can you count to 10 without mistakes?""Yes," said Jackie, and she did."Now, Fred," said the teacher, "can you count from 10 to 20?""That depends," said Fred, "with or without mistakes"!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8619, 'School jokes', 'Teacher: Can you count to 10?Fred: Yes, teacher-one, two, three, four, five, six, seven, eight, nine, ten.Teacher: Now go on from there.Fred: Jack, Queen, King.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8620, 'School jokes', 'Teacher: If I lay one egg here and another there, how many eggs will there be?Fred: None!Fred (surprised): Why not?Fred: Because you cant lay eggs!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8621, 'School jokes', 'TEACHER: Jackie, take 932 from 1,439. What is the difference?Stella: Thats what I say, whats the difference`?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8622, 'School jokes', 'Fred: Ive added these figures ten times. Teacher: Good work! Fred: And here are my ten answers !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8623, 'School jokes', 'Teacher: If I gave you three rabbits today and five rabbits tomorrow, how many rabbits would you have?Jackie: Nine.Teacher: Thats not right, youd have eight.Jackie: No, Teacher, Id have nine. I already have one rabbit at home!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8624, 'School jokes', '"Our teacher has a bad memory. For three days she asked us how much is two and two. We told her it was four. But she still doesnt know. Today she asked us again!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8625, 'School jokes', 'How are you doing in arithmetic ?Ive learned to add up the zeros, but the numbers are still giving me trouble.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8626, 'School jokes', 'Fred: I got 100 in school today.Mother: Wonderful. What did you get 100 in?Jason: Two things: I got 50 in Spelling and 50 in History.Mother: Well, at least you can add !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8627, 'School jokes', 'If you had one dollar and you asked your father for another, how many dollars would you have? One dollar. You dont know your arithmetic. You dont know my father !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8628, 'School jokes', 'Jackie stood quietly as her father examined her report card."What is this 45 in math?" asked her father."I think thats the size of the class," she said quickly!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8629, 'School jokes', 'If I had five coconuts and I gave you three, how many would I have left ?I dont know.Why not ?In our school we do all our arithmetic in apples and oranges.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8630, 'School jokes', 'The teacher was giving her pupils a quiz on counting. Jackie got things started by counting from 1 to 10. "Now, Fred," said the teacher, "you take over, beginning with 11.""11, 14, 23, 42, 26," said Fred."What kind of counting is that?" asked the teacher"Whos counting?" replied Fred. "Im calling signals."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8631, 'School jokes', 'Teacher : Tommy, put some more water in the fish tank !Pupil : Why, Miss, I only put some in yesterday and he hasnt drunk that yet !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8632, 'School jokes', 'Teacher : Were you copying his sums ?Pupil : No Sir, just seeing if he got mine right !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8633, 'School jokes', 'Teacher : What are you reading ?Pupil : I dunno !Teacher : But youre reading aloud !Pupil : But Im not listening !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8634, 'School jokes', 'Teacher : Whats happens to gold when it is exposed to the air ?Pupil : Its stolen !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8635, 'School jokes', 'Teacher : Make up a sentence using the word lettuce !Pupil : Let us out of school early !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8636, 'School jokes', 'Teacher : Billy, please dont whistle while studying.Billy : Oh, but Im not studying - just whistling !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
