INSERT INTO `jokes` VALUES (8866, 'Sport jokes', 'It was a particularly tough football game, and nerves were on edge. The home team had been the victim of three or four close calls, and they were now trailing the visitors by a touch-down and a field goal. When the official called yet another close one in the visitors favor, the home quarterback blew his top.How many times can you do this to us in a single game?" he screamed. "You were wrong on the out-of-bounds, you were wrong on that last first down, and you missed an illegal tackle in the first quarter." The official just stared. The quarterback seethed, but he suppressed the language that might get him tossed from the game. "What it comes down to," he bellowed, "is that you STINK!" The official stared a few more seconds. Then he bent down, picked up the ball, paced off 15 yards, and put the ball down. He turned to face the steaming quarterback. The official finally  replied, "And how do I smell from here?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8867, 'Sport jokes', 'Two college basketball players were taking an important final exam. If they failed, they would be on academic probation and not allowed to play in the big game the following week. The exam was fill-in-the-blank.The last question read, "Old MacDonald had a ________."Bubba was stumped. He had no idea what to answer. But he knew he needed to get this one right to be sure he passed.Making sure the professor wasnt watching, he tapped Tiny on the shoulder. "Pssst. Tiny. Whats the answer to the last question?"Tiny laughed. He looked around to make sure the professor hadnt noticed then he turned to Bubba. "Bubba, youre so stupid. Everyone knows Old MacDonald had a FARM.""Oh yeah," said Bubba. "I remember now."He picked up his No. 2 pencil and started to write the answer in the blank. He stopped. Tapping Tinys should er again, he whispered, "Tiny, how do you spell farm?""You are really dumb, Bubba. Thats so easy. Farm is spelled E-I-E-I-O."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8868, 'Sport jokes', 'There was a Packers fan with a really crappy seat at Lambeau. Looking with his binoculars, he spotted an empty seat on the 50-yard line. Thinking to himself "what a waste" he made his way down to the empty seat. When he arrived at the seat, he asked the man sitting next to it, "Is this seat taken?" The man replied, "This was my wifes seat. She passed away. She was a big Packers fan." The other man replied,"Im so sorry to hear of your loss. May I ask why you didnt give the ticket to a friend or a relative?" The man replied, "Theyre all at the funeral."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8869, 'Sport jokes', 'St. Peter and Satan were having an argument one day about baseball. Satan proposed a game to be played on neutral grounds between a select team from the heavenly host and his own hand-picked boys."Very well," said the gatekeeper of Heaven. "But you realize, I hope, that weve got all the good players and the best coaches.""I know, and thats all right," Satan answered unperturbed. "Weve got all the umpires."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8870, 'Sport jokes', 'A guy took his girlfriend to her first football game. Afterward he asked her how she liked the game."I liked it, but I couldnt understand why they were killing each other for 25 cents," she said."What do you mean?" he asked."Well, everyone kept yelling, Get the quarter back!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8871, 'Sport jokes', 'Coming home from his Little League game, Billy swung open the front door very excited. Unable to attend the game, his father immediately wanted to know what happened. "So, how did you do son?" he asked."Youll never believe it!" Billy said. "I was responsible for the winning run!""Really? Howd you do that?" "I dropped the ball."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8872, 'Sport jokes', 'The seven dwarves are down in the mines when there is a cave-in. Snow White runs to the entrance and yells down to them. In the distance a voice shouts out "Charlton are good enough to win the European Cup." Snow White says "Well at least Dopeys alive!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8873, 'Sport jokes', 'Q: How does Stan Collymore change a lightbulb?A: He holds it in the air, and the world revolves around him', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
