INSERT INTO `jokes` VALUES (8879, 'Sport jokes', 'The Pope met with the College of Cardinals to discuss a proposal from Shimon Peres, the former leader of Israel. "Your holiness," said one of the Cardinals, "Mr. Peres wants to determine whether Jews or Catholics are superior, by challenging you to a golf match." The Pope was greatly disturbed, as he had never held a golf club in his life. "Not to worry," said the Cardinal, "well call America and talk to Jack Nicklaus. Well make him a Cardinal, he can play Shimon Peres... We cant lose!" Everyone agreed it was a good idea. The call was made and, of course, Jack was honored and agreed to play. The day after the match, Nicklaus reported to the Vatican to inform the Pope of his success in the match. "I came in second, your Holiness," said Nicklaus. "Second?!!" exclaimed the surprised Pope. "You came in second to Shimon Peres?!!" "No," said Nicklaus, "second to Rabbi Woods."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8880, 'Sport jokes', 'Fred got home from his Sunday round of golf later than normal and very tired. "Bad day at the course?" his wife asked. "Everything was going fine," he said. "Then Harry had a heart attack and died on the 10th tee." "Oh, thats awful!" "Youre not kidding. For the whole back nine it was hit the ball, drag Harry, hit the ball, drag Harry."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8881, 'Sport jokes', 'A man is stranded on a desert island, all alone for ten years. One day, he sees a speck in the horizon. He thinks to himself, "Its not a ship." The speck gets a little closer and he thinks, "Its not a boat." The speck gets even closer and he thinks, "Its not a raft." Then, out of the surf comes this gorgeous blonde woman, wearing a wet suit and scuba gear. She comes up to the guy and says, "How long has it been since youve had a cigarette?""Ten years!", he says.She reaches over and unzips a waterproof pocket on her left sleeve and pulls out a pack of fresh cigarettes. He takes one, lights it, takes a long drag, and says, "Man, oh man! Is that good!" Then she asked, "How long has it been since youve had a drink of whiskey?" He replies, "Ten years!" She reaches over, unzips her waterproof pocket on her right sleeve, pulls out a flask and gives it to him.  He takes a long swig and says, "Wow, thats fantastic!" Then she starts unzipping a longer zipper that runs down the front of her wet suit and she says to him, "And how long has it been since youve had some real fun?" And the man replies, "Wow! Dont tell me that youve got golf clubs in there!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8882, 'Sport jokes', 'The schoolteacher was taking her first golfing lesson."Is the word spelt p-u-t or p-u-t-t? she asked the instructor."P-u-t-t is correct, he replied."Put means to place a thing where you want it. Putt means merely a vain attempt to do the same thing."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8883, 'Sport jokes', 'A couple of old guys were golfing when one said he was going to Dr. Taylor for a new set of dentures in the morning.His friend remarked that he had gone to the same dentist a few years before. "Is that so?" the first said. "Did he do a good job?""Well, I was on the course yesterday when the fellow on the ninth hole hooked a shot," he said. "The ball most have been going 200 mph when it hit me in the stomach. That," he added, "was the first time in two years my teeth didnt hurt."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8884, 'Sport jokes', 'After a particularly poor game of golf, a popular club member skipped the clubhouse and started to go home. As he was walking to the parking lot to get his car, a policeman stopped him and asked, "Did you tee off on the sixteenth hole about twenty minutes ago?" "Yes," the golfer responded. "Did you happen to hook your ball so that it went over the trees and off the course?" "Yes, I did. How did you know?" he asked. "Well," said the policeman very seriously, "Your ball flew out onto the highway and crashed through a drivers windshield. The car went out of control, crashing into five other cars and a fire truck. The fire truck couldnt make it to the fire, and the building burned down. So, what are you going to do about it?" The golfer thought it over carefully and responded... "I think Ill close my stance a little bit, tighten my grip and lower my right thumb."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8885, 'Sport jokes', 'A young man who was also an avid golfer found himself with a few hours to spare one afternoon. He figured if he hurried and played very fast, he could get in nine holes before he had to head home. Just as he was about to tee off an old gentleman shuffled onto the tee and asked if he could accompany the young man as he was golfing alone. Not being able to say no, he allowed the old gent to join him. To his surprise the old man played fairly quickly. He didnt hit the ball far, but plodded along consistently and didnt waste much time. Finally, they reached the 9th fairway and the young man found himself with a tough shot. There was a large pine tree right in front of his ball - and directly between his ball and the green. After several minutes of debating how to hit the shot the old man finally said, "You know, when I was your age Id hit the ball right over that tree." With that chal lenge placed before him, the youngster swung hard, hit the ball up, right smack into the top of the tree trunk and it thudded back on the ground not a foot from where it had originally lay. The old man offered one more comment, "Of course, when I was your age that pine tree was only three feet tall."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8886, 'Sport jokes', 'A golfer, playing a round by himself, is about to tee off, and a greasy little salesman runs up to him, and yells, "Wait! Before you tee off, I have something really amazing to show you!" The golfer, annoyed, says, "What is it?" "Its a special golf ball," says the salesman. "You can never lose it!" "Whattaya mean," scoffs the golfer, "you can never lose it? What if you hit it into the water?" "No problem," says the salesman. "It floats, and it detects where the shore is, and spins towards it." "Well, what if you hit it into the woods?" "Easy," says the salesman. "It emits a beeping sound, and you can find it with your eyes closed." "Okay," says the golfer, impressed. "But what if your round goes late and it gets dark?" "No problem, sir, this golf ball glows in the dark! Im telling you, you can never lose this golf ball!" The golfer buys it at  once. "Just one question," he says to the salesman. "Where did you get it?" "I found it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8887, 'Sport jokes', 'A pastor, a doctor and an engineer were waiting one morning for a particularly slow group of golfers. Engineer: Whats with these guys? We must have been waiting for 15 minutes! Doctor: I dont know, but Ive never seen such ineptitude! Pastor: Hey, here comes the greens keeper. Lets have a word with him. [dramatic pause] Hi George. Say, whats with that group ahead of us? Theyre rather slow, arent they? George: Oh, yes, thats a group of blind fire fighters. They lost their sight saving our clubhouse from a fire last year, so we always let them play for free anytime. The group was silent for a moment. Pastor: Thats so sad. I think I will say a special prayer for them tonight. Doctor: Good idea. And Im going to contact my ophthalmologist buddy and see if theres anything he can do for them. Engineer: Why cant these guys play at night?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8888, 'Sport jokes', 'Joe decides to take his boss Phil to play 9 holes on their lunch. While both men are playing excellent they are often held up by two women in front of them moving at a very slow pace. Joe offers to talk to the women and see if they can speed it up a bit. He gets about half of the way there stops and jogs back.His boss asks what the problem is. "Well one of those women is my wife and the other my mistress," complained Joe. Phil just shook his head at Joe and started toward the women determined to finish his round of golf. Preparing to ask the ladies to speed up their game, he too stopped short and turned around.Joe asked "whats wrong?" Its a small, small world Joe, and youre fired"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8889, 'Sport jokes', 'A blonde golfer goes into the pro shop and looks around frowning.Finally the pro askes her what she wants. "I cant find any green golf balls," the blonde golfer complains.The pro looks all over the shop, and through all the catalogs, and finally calls the manufacturers and determines that sure enough, there are no green golf balls.As the blonde golfer walks out the door in disgust, the pro asks her, "Before you go, could you tell me why you want green golf balls?""Well obviously, because they would be so much easier to find in the sand traps!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8890, 'Sport jokes', '"How was your golf game, dear?" asked Jacks wife Tracy."Well, I was hitting pretty well, but my eyesights gotten so bad, Icouldnt see where the ball went.""Youre seventy-five years old, Jack!" admonished his wife. "Why dont you take my brother Scott along?""But hes eighty-five and doesnt even play golf anymore," protested Jack."Yes, but hes got perfect eyesight and can watch your ball for you,"Tracy pointed out.The next day Jack teed off with Scott looking on. Jack swung and the ball disappeared down the middle of the fairway. "Did you see where it went?" asked Jack."Yup," Scott answered."Well, where is it?" yelled Jack, peering off into the distance."I forgot."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8891, 'Sport jokes', 'A golfer, playing a round by himself, is about to tee off, and a greasy little salesman runs up to him, and yells, "Wait! Before you tee off, I have something really amazing to show you!" The golfer, annoyed, says, "What is it?" "Its a special golf ball," says the salesman. "You can never lose it!" "Whattaya mean," scoffs the golfer, "you can never lose it? What if you hit it into the water?" "No problem," says the salesman. "It floats, and it detects where the shore is, and spins towards it." "Well, what if you hit it into the woods?" "Easy," says the salesman. "It emits a beeping sound, and you can find it with your eyes closed." "Okay," says the golfer, impressed. "But what if your round goes late and it gets dark?" "No problem, sir, this golf ball glows in the dark! Im telling you, you can never lose this golf ball!" The golfer buys it at once . "Just one question," he says to the salesman. "Where did you get it?" "Ummm, I found it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
