INSERT INTO `jokes` VALUES (8942, 'Sport jokes', 'Bob and Tom both like to golf. One day Bob went to Tom and said, "Hey look at this great ball!" Tom replied, "Whats so great about it?" Bob said, "Well if you lose it, it will beep until you find it, and if it goes into the water it will float. This ball is impossible to lose!" "Wow!", said Tom, "Where did you get that from?" Bob replied, "I found it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8943, 'Spelling jokes', 'Daughter: I will never learn to spell.Mother: Why?Daughter: The teacher keeps changing the words.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8944, 'Spelling jokes', '"I gotta A in spelling," Tony told his father. "You dope!" he replied. "There isnt any A in spelling!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8945, 'Spelling jokes', 'Early Texas governors were not very well educated. There was once a chief executive who thought "grammar" was his fathers mother. On one occasion this governor went hunting and forgot his gun. He phoned his secretary and asked him to send the gun."The phone connections bad," said the secretary. "I couldnt catch that last word. Spell it." The governor replied, " G like in Jesus; U like in onion; N like in pneumonia GUN, you damn fool!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8946, 'Spelling jokes', 'A Hoosier, a Kentuckian and a West Virginian were on a Hollywood TV quiz show. The host asked them to complete the sentence: "Old MacDonald had a ..." The Indianan said, "Old MacDonald had a carburetor." "Sorry," said the MC. "Thats incorrect." "Old MacDonald had a flat tire," said the Kentuckian. "Wrong," said the host. "Old MacDonald had a farm," said the West Virginian. "Thats correct!" shouted the MC. "Now for $200,000, spell farm." The West Virginian thought hard and then spelled carefully: "E-I-E-I-O."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8947, 'Spelling jokes', 'Interviewer: How do you spell Mississippi? Redneck: Which one? The river or the state?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8948, 'Spelling jokes', '"Mah sons real smart!" crowed the redneck mother to an acquaintance. "Hes only six but he can already spell his name backwards and forwards!" "Whats his name?" asked the friend. "Bob."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8949, 'Spelling jokes', 'Two men were walking home after a Halloween party and decided to take a shortcut through the cemetery just for laughs. Right in the middle of the cemetery they were startled by a tap-tap-tapping noise coming from the misty shadows. Trembling with fear, they found an old man with a hammer and chisel, chipping away at one of the headstones. "Holy cow, Mister," one of them said after catching his breath, "You scared us half to death -- we thought you were a ghost! What are you doing working here so late at night?" "Those fools!" the old man grumbled. "They misspelled my name!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8950, 'Spelling jokes', 'A group of Texas A&M Aggies and a group of Harvard students had been deadlocked in a spelling bee for an entire week. At the end of the contest the score was tied and the judges had a dilemma. They told the contestants that each group was to quickly come up with a poem using the word Timbuktu. Well the Aggiess started laughing the minute the word was uttered but Harvard just smiled and prepared their short rhyme. One Harvard student stood up and for his group recited Through the desert all night we ride on camels walking two by two, Destination Timbuktu. Well the crowd politely applauded - they knew the Aggies couldnt beat that and the Aggies just continued laughing throughout the whole process. One Aggie stopped giggling long enough to stand and read the teams effort. He said, Tim and I, a hunting went, we came upon three women in a tent. Since they were three and we were two, I buk one  and Timbuktu!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8951, 'Spelling jokes', 'Luke had it first, Paul had it lost; boys never had it; girls have it but once; Miss Polly had it twice in the same place, but when she married Peter Jones she never had it again. What is it?The letter L.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
