INSERT INTO `jokes` VALUES (8972, 'Spelling jokes', 'Fred came home from his first day at school. "Nothing exciting happened", he told his mother, "Except the teacher didnt know how to spell cat so I told her"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8973, 'Spelling jokes', 'Teacher: R-O-X does spell rocks?Pupil: What does it spell then !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8974, 'Spelling jokes', 'THE teacher announced that to practice spelling, each member of the class would say what their fathers did for a living and then spell the occupation. Mary went first. "My Dad is a baker, b-a-k-e-r, and if he were here, he would give everyone a cookie." Next came Tommy. "My dad is a banker, b-a-n-k-e-r, and if he were here, hed give each of us a quarter." Third came Jimmy. "My dad is an electrician. But after struggling through a number of attempts to spell the word, the teacher asked him to sit and think about it for a moment while she called on someone else. She then turned to Johnny. "My dads a bookie, b-o-o-k-i-e," Johnny said. "And if he were here, hed lay you 8 to 5 that Jimmy aint never gonnaspell electrician."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8975, 'Spelling jokes', 'Little Johnny wasnt very good at spelling. During an oral spelling exam, the teacher wrote the word "new" on the blackboard. "Now," she asked Johnny, "what word would we have if we placed a "K" in the front?"After a moments reflection, Johnny said, "Canoe?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
