INSERT INTO `jokes` VALUES (8984, 'Teeth jokes', '"Your teeth are like the stars," he said, As he pressed her hand, so white. He spoke the truth, for, like the stars, Her teeth came out at night!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
