INSERT INTO `jokes` VALUES (8987, 'Teeth jokes', 'Whats the difference between a vampire with toothache and a rainstorm? One roars with pain and the other pours with rain.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8988, 'Teeth jokes', 'What do you get it you cross a porcupine with a giraffe? A long necked toothbrush.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8989, 'Teeth jokes', 'What did the mouse say when his friend broke his front teeth? Hard cheese.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8990, 'Teeth jokes', 'What happened when a man fell in love with a grand piano? He said, "Darling, youve got lovely teeth."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8991, 'Teeth jokes', 'A dinner speaker was in such a hurry to get to his engagement that when he arrived and sat down at the head table, he suddenly realized that he had forgotten his false teeth. Turning to the man next to him he said, "I forgot my teeth." The man said, "No problem." He reached into his pocket and pulled out a pair of false teeth. "Try these," he said. The speaker tried them. "Too loose," he said. The man then said, "I have another pair - try these." The speaker tried them and responded, "Too tight." The man was not taken back at all. He then said, "I have one more pair. Try them." The speaker said, "They fit perfectly."With that he ate his meal and gave his speech. After the dinner meeting was over, the speaker went over to thank the man who had helped him. "I want to thank you for coming to my aid. Where is your office? Ive been looking for a good dentist." The man replied, "Im not a dentist. Im an  undertaker."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8992, 'Teeth jokes', 'Why is 4,840 square yards like a bad tooth ?Because it is an acre.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
