INSERT INTO `jokes` VALUES (8997, 'Teeth jokes', 'Beatrice Lillie (Lady Peel) was once accosted by a haughty old dowager who scrutinized her through her lorgnettes. "What lovely pearls, dear Beatrice," she maliciously remarked. "Are they real?" Yes, nodded Lady Peel. "Of course," the dowager declared, "you can always tell real pearls by biting them. May I try?" "Gladly," Lady Peel replied. "But remember, Duchess, you cant tell real pearls with false teeth."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (8998, 'Teeth jokes', 'Mother: Has your tooth stopped hurting yet?...Son: I dont know. The dentist kept it', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
