INSERT INTO `jokes` VALUES (9157, 'Vampire jokes', 'Whats pink, lives in a sty and drinks blood? A hampire.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9158, 'Vampire jokes', 'What type of people do vampires like? Type O positive people.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9159, 'Vampire jokes', 'What kind of typewriters do vampires like? Blood type-writers.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
