INSERT INTO `jokes` VALUES (9161, 'Vampire jokes', 'What should you do if a vampire borrows your comic? Wait for him to give it back.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9162, 'Vampire jokes', 'Why was Dracula always willing to help young vampires? Because he liked to see new blood in the business.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9163, 'Vampire jokes', 'One vampire to the other : " Lets go and have a drink.I know a cosy little mortuary just round the corner"!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9164, 'Vampire jokes', 'Did you hear about the doctor who crossed a parrot with a vampire ?It bit his neck, sucked his blood, and said, Whos a pretty boy then ?!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9165, 'Vampire jokes', 'What did the vampire do to stop his son biting his nails ?He cut all his fingers off !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9166, 'Vampire jokes', 'Who is a vampire likely to fall in love with ?The girl necks door.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9167, 'Vampire jokes', 'Why is it tough to compete against a vampire? Because theyre always out for blood!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9168, 'Vampire jokes', 'Did you hear about the vampire in Camelot? He was a bite of the Round Table!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
