INSERT INTO `jokes` VALUES (9170, 'Vampire jokes', 'What is the best way to talk to a vampire?By long distance.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9171, 'Vampire jokes', 'What do you call a vampire that can lift up cars ?Jack-u-la !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9172, 'Vampire jokes', 'What do you call a vampire in a raincoat ?Mack-u-la !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9173, 'Vampire jokes', 'What do you get if you cross a vampire and a circus entertainer ?Something that goes straight for the juggler !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9174, 'Vampire jokes', 'What do you get if you cross a vampire and a mummy ?Something you wouldnt want to unwrap !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9175, 'Vampire jokes', 'Why did the vampire go crazy at Burger King?He saw all that catsup and wanted a transfusion.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9176, 'Vampire jokes', 'What do vampires make sandwiches out of? Self-raising dead.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9177, 'Vampire jokes', 'What do you get if you cross a vampire with a snail? I dont know but it would slow him down.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9178, 'Vampire jokes', 'Why did the vampire stand at the bus stop with his finger up his nose? He was a ghoulsnif fer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9179, 'Vampire jokes', 'Whats a vampires favorite drink? A Bloody Mary.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9180, 'Vampire jokes', 'Why are vampire families so close? Because blood is thicker than water.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
