INSERT INTO `jokes` VALUES (9182, 'Vampire jokes', 'What do you get if you cross Dracula with Sir Lancelot?A bite in shining armor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9183, 'Vampire jokes', 'Whats Draculas car called? A mobile blood unit.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9184, 'Vampire jokes', 'What do you call a vampire junkie? Count Drugula.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9185, 'Vampire jokes', 'Why do vampires hate arguments? Because they make themselves cross.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9186, 'Vampire jokes', 'How does a girl vampire flirt? She bats her eyes.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9187, 'Vampire jokes', 'MUMMY VAMPIRE: Jimmy, hurry up and drink your soup before it clots.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9188, 'Vampire jokes', 'Do you know how to catch a squirrel? Climb a tree and act like a nut!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9189, 'Travel and tourist jokes', 'A travel agent looked up from his desk to see an older lady and anolder gentleman peering in the shop window at the posters showingthe glamorous destinations around the world. The agent had had agood week and the dejected couple looking in the window gave him arare feeling of generosity. He called them into his shop and said, "I know that on your pension you could never hope to have a holiday, so I am sending you off to a fabulous resort at my expense, and I wont take no for an answer." He took them inside and asked his secretary to write two flight tickets and book a room in a five star hotel. They, as can be expected, gladly accepted, and were on their way. About a month later the little lady came in to his shop. "Andhow did you like your holiday?" he asked eagerly. "The flight was exciting and the room was lovely," she said. "Ive come to thank you.But, one th ing puzzled me. Who was that old guy I had to share the roomwith?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9190, 'Travel and tourist jokes', 'There was some mix-up with a womans room. Theclerk (or whatever they are called on ships) wastrying to remedy the situation. He asked, "Would youlike an inside cabin or an outside cabin?" Shereplied, "Well, it looks like it might rain today.Id better get an inside cabin."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9191, 'Travel and tourist jokes', 'Someone -- always a man -- always asks, "does theship run on generators?" The Cruise Director usuallytells them, "No, we just have a very long power linerunning to the mainland."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9192, 'Travel and tourist jokes', 'I got a call from a woman who wanted to go to Capetown.started to explain the length of the flight and the passportinformation when she interrupted me with "Im not trying to make you look stupid, but Cape Town is in Massachusetts." Without trying to make her look like the stupid one, I calmly explained, "Cape Cod is in Massachusetts, Capetown is in Africa." Her response... click.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9193, 'Travel and tourist jokes', 'The frightened tourist: "Are there any bats in this cave?"The guide: "There were, but dont worry, the snakes ate all of them."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9194, 'Travel and tourist jokes', 'The tourist: "Can you tell me why so many famous Civil War battles were fought on National Park Sites?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9195, 'Travel and tourist jokes', 'Windsor castle, outside of London, is directly in the flight path of Heathrow International Airport. While a group of tourist was standing outside the castle admiring the elegant structure, a plane flew overhead at a relatively low altitude making a tremendous amount of noise. One particularly annoyed tourist whined, "Why did they build the castle so close to the airport?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9196, 'Travel and tourist jokes', 'A pair of tourists were out in the fields when they discovered an abandoned well near an old farm house. Of course theyre curious so they drop a small stone into the well, but they never hear it hit bottom. They search and find a larger rock and drop it into the well but once again hear nothing. They decide they need something larger and search the farm yard for a larger object. After much struggle, they manage to drag a large railroad tie to the edge of the well and drop it over the edge.After several seconds, a goat tears across the yard and without any hesitation, dives head first into the open hole. The two tourists stand in amazement. About then a farmer appears and tells them he is looking for a lost goat. The tourists tell the farmer about the goat diving into the well."That couldnt be my goat", the farmer replies, "My goat was grazing in the field roped to a railroa d tie!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9197, 'Travel and tourist jokes', '"Were you in Paris on your vacation?""I dont know, my wife got the tickets."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9198, 'Travel and tourist jokes', 'Two anthropologists fly to the south sea islands to study the natives. They go to two adjacent islands and set to work. A few months later one of them takes a canoe over to the other island to see how his colleague is doing. When he gets there, he finds the other anthropologist standing among a group of natives."Greetings! How is it going?" says the visiting anthropologist."Wonderful!" says the other, "I have discovered an important fact about the local language! Watch!"He points at a palm tree and says, "what is that?"The natives, in unison, say "Umbalo-gong!"He then points at a rock and says, "and that?"The natives again intone "Umbalo-gong!""You see!", says the beaming anthropologist, "They use the SAME word for rock and for palm tree!""That is truly amazing!" says the astonished visiting anthropologist, "On the other island, the same word means ind ex finger!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9199, 'Travel and tourist jokes', 'In Alaskas National Forests, a tourists guide was giving a talk to a group of tourists about hiking in grizzly bear territory: "Most bear encounters occur when hikers, being extra quiet along the trails in hopes of viewing wildlife, accidentally stumble into bears. The resulting suprise can be catastrophic." To avoid this, he suggested that each hiker wear tiny bells on their clothing to warn the bears of their presence. "Also," he said further, "be especially cautious when you see signs of bears in the area, especially when you see bear droppings."One tourist asked, "How do you identify bear droppings?""Oh thats easy," the guide explained, "its the ones with all the tiny bells in them!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9200, 'Travel and tourist jokes', 'Two tourists were driving through Louisiana. As they were approaching Natchitoches, they started arguing about the pronunciation of the town. They argued back and forth until they stopped for lunch. As they stood at the counter, one tourist asked the employee, "Before we order, could you please settle an argument for us? Would you please pronounce where we are... very slowly?"The girl leaned over the counter and said, "Burrrrrrrr, gerrrrrrr, Kiiiiing."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9201, 'Travel and tourist jokes', 'A man is walking down the street when he sees a sign in the window of a travel agency that says CRUISES - $100. He goes into the agency and hands the guy $100. The travel agent then whacks him over the head with a baseball bat and throws him in the river.Another man is walking down the street a half hour later, sees the sign and pays the guy $100. The travel agent then whacks him with the baseball bat and throws him in the river.Sometime later, the two men are floating down the river together and the first man asks, "Do you think theyll serve any food on this cruise?"The second man says, "I dont think so. They didnt do it last year."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9202, 'Travel and tourist jokes', 'A tourist was being led through the swamps of Florida. "Is it true," he asked, "that an alligator wont attack you if you carry a flashlight?""That depends," replied the guide, "on how fast you carry the flashlight."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9203, 'Travel and tourist jokes', '"Look, guide, here are some LION tracks.""Good. You see where they go and Ill find out where they came from."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9204, 'Travel and tourist jokes', 'A person checks into a hotel for the first time in his life, and goes up to his room. Five minutes later he calls the desk and say, "Youve given me a room with no exit. How do I leave?"The desk clerk says, "Sir, thats absurd. Have you looked for the door?"The person says, " Well, theres one door that leads to the bathroom. Theres a second door that goes into the closet. And theres a door I havent tried, but it has a do not disturb sign on it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9205, 'Travel and tourist jokes', 'A farmer, who went to a big city to see the sights, asked the hotels clerk about the time of meals."Breakfast is served from 7 to 11, dinner from 12 to 3, and supper from 6 to 8," explained the clerk."Look here," inquired the farmer in surprise, "when am I going to get time to see the city?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9206, 'Travel and tourist jokes', 'A traveller pulls into a hotel around midnight and asks the clerk for a single room. As the clerk fills out the paperwork, the man looks around and sees a gorgeous blonde sitting in the lobby. He tells the clerk to wait while he disappears into the lobby. After a minute he comes back, with the girl on his arm."Fancy meeting my wife here," he says to the clerk. "Guess Ill need a double room for the night."Next morning, he comes to settle his bill, and finds the amount to be over $3000. "Whats the meaning of this?" he yells at the clerk. "Ive only been here one night!""Yes," says the clerk, "but your wife has been here for three weeks."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9207, 'Travel and tourist jokes', '"Room Service? Can you send up a towel?" "Please wait, someone else is using it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9208, 'Travel and tourist jokes', '"Room service? Send up a larger room."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9209, 'Travel and tourist jokes', 'A not so rich couple decided to stay at a very exclusive hotel for a night. The manager immediately recognized them for what they are but could not throw them out, instead he decided to be clever. In the morning the couple came to settle the bill and were surprized to find they owe $3000."Hows this? Weve only been here one night!" the man was annoyed."So?", said the manager, "this is a very expensive hotel. We have golf courts, tennis courts, swimming pools, exercise rooms, bars and restaurants, all this is very expensive to keep up.""But we didnt use any of these!" explained the couple."If you didnt use - thats your problem," came the reply."In that case, you owe me $2000. You see, my wife is a call girl who charges $5000 a night, so please settle your bill," said the man."What do you mean?" the manager was taken off guard, "I didnt sleep with your wife!""If yo u didnt use - thats your problem!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9210, 'Travel and tourist jokes', '"And will there be anything else, sir?" the bellboy asked after setting out an elaborate dinner for two."No thank you," the gentleman replied. "That will be all."As the young man turned to leave, he noticed a beautiful satin negligee on the bed. "Anything for your wife ?" he asked."Yeah! Thats a good idea," the fellow said. "Please bring up a postcard."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9211, 'Travel and tourist jokes', 'A traveler became lost in the Sahara desert. Realizing his only chance for survival was to find civilization, he began walking. Time passed, and he became thirsty. More time passed, and he began feeling faint. He was on the verge of passing out when he spied a tent about 500 meters in front of him. Barely conscious, he reached the tent and called out, "Water...".A bedouin appeared in the tent door and replied sympathetically, "I am sorry, sir, but I have no water. However, would you like to buy a tie?" With this, he brandished a collection of exquisite silken neckwear."You fool," gasped the man. "Im dying! I need water!""Well, sir," replied the bedouin, "If you really need water, there is a tent about two kilometers south of here where you can get some."Without knowing how, the man summoned sufficient strength to drag his parched body the distance to the second tent. With his  last ounce of strength he tugged at the door of the tent and collapsed.Another bedouin, dressed in a costly tuxedo, appeared at the door and enquired, "May I help you sir?""Water..." was the feeble reply."Oh, sir," replied the bedouin, "Im sorry, but you cant come in here without a tie!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9212, 'Travel and tourist jokes', 'Three New Zealanders and three Aussies are travelling by train to a cricket match at the World Cup in England. At the station, the three Aussies each buy a ticket and watch as the three New Zealanders buy just one ticket between them. "How are the three of you going to travel on only one ticket?" asks one of the Aussies. "Watch and learn," answers one of the New Zealanders. They all board the train. The Aussies take their respective seats but all three New Zealanders cram into a toilet and close the door behind them. Shortly after the train has departed, the conductor comes around collecting tickets. He knocks on the toilet door and says, "Ticket please." The door opens just a crack and a single arm emerges with a ticket in hand. The conductor takes it and moves on. The Aussies see this and agree it was quite a clever idea. So after the game, they decide to copy the  New Zealanders on the return trip and save some money (being clever with money, and all that). When they get to the station, they buy a single ticket for the return trip. To their astonishment, the New Zealanders dont buy a ticket at all!! "How are you going to travel without a ticket?" says one perplexed Aussie. "Watch and learn," answers a New Zealander. When they board the train the three Aussies cram into a toilet and soon after the three New Zealanders cram into another nearby. The train departs. Shortly afterwards, one of the New Zealanders leaves the toilet and walks over to the toilet where the Aussies are hiding. He knocks on the door and says, "Ticket please."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9213, 'Travel and tourist jokes', 'A magician was working on a cruise ship in the Caribbean. The audiencewould bedifferent each week, so the magician allowed himself to do the sametricks over and overagain. There was only one problem: The captains parrot saw the showseach week andbegan to understand how the magician did every trick. Once heunderstood he startedshouting in the middle of the show: "Look, its not the same hat""Look, he is hiding theflowers under the table" "Hey, why are all the cards the Ace of Spades?" The magicianwas furious but couldnt do anything; it was, after all, the captainsparrot.One day the ship had an accident and sank. The magician found himselfon a piece of woodin the middle of the ocean with the parrot, of course. They stared ateach other with hate,but did not utter a word. This went on for a day and another andanother.After a week the parrot said:  "OK, I give up. Wheres the boat?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9214, 'Travel and tourist jokes', 'A group of Americans was touring Ireland. One of the women in the group was a real curmudgeon, constantly complaining. The bus seats are uncomfortable.The food is terrible. Its too hot. Its too cold. The accommodations are awful.The group arrived at the site of the famous Blarney Stone. "Good luck will be followin ya all your days if you kiss the Blarney Stone,"the guide said. "Unfortunately, its being cleaned today and so no one willbe able to kiss it. Perhaps we can come back tomorrow.""We cant be here tomorrow," the nasty woman shouted. "We have some other boring tour to go on. So I guess we cant kiss the stupid stone.""Well now," the guide said, "it is said that if you kiss someone who has kissed the stone, youll have the same good fortune.""And I suppose youve kissed the stone," the woman scoffed."No, maam," the frustrated guide said,  "but Ive sat on it."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9215, 'Travel and tourist jokes', 'Father OMally has been preaching at his church in Ireland for solong, that he decides to take a vacation. He has never been marriedand he is curious as to what an American endures in everyday life. So,he decides to go to the States before it is too late. He hops on theplane bound for Nevada. He arrives in the Airport in Las Vegas. As he is exiting the plane, someone in the airport runs up to him and exclaims, "Elvis! Oh my God! Its Elvis! I knew you werent dead Elvis! How have you been?" Father looks at her and says, "Get outta meface. Cant you see Im not Elvis? I dont look a thing like Elvis." The father moves on to his cab waiting outside. He hops in his cab andhes a little upset so he tells the cabby, "Take me to my hotel andstep on it." The cabby turns and says, "Sure thing sir - Oh my God!Its Elvis! I knew you werent dead! Im your number one fan! Its  sogreat to see you!" "Shut up, you imbecile. Im not Elvis! Now turnaround and drive!" So, the cabby speeds up to the hotel. Father OMalley gets his things and walks up to the hotel check-in counter. "Oh my God! Oh my God!Its you!" screams the hotel clerk. "Youre back Elvis! I knew thisday would happen. We saved everything just the way you like it! Free cheeseburgers, peanut butter and banana fried sandwiches, masseurs, and a full liquor bar! Im so glad youre back!"Father OMalley looks at the hotel clerk and says, "Thank you... Thankyou very much!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9216, 'Travel and tourist jokes', 'The Zen Master is visiting New York City from Tibet. He goes up to ahot dog vendor and says, "Make me one with everything."The hot dog vendor fixes a hot dog and hands it to the Zen Master, whopays with a $20 bill.The vendor puts the bill in the cash box and closes it. "Wheres mychange?" asks the Zen Master. The vendor responds, "Change must come from within."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9217, 'Travel and tourist jokes', 'A couple were being given a guided tour of Pico da Bandeira, one of the highest mountains in the Americas. Their guide pointed out where a young couple, petrified by lava, had been discovered. They had died in the act of making love."How awful !" exclaimed the wife."Si, but what a great way to spend eternity." added the husband.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9218, 'Travel and tourist jokes', 'A German tourist walks into a McDonalds in New York City and orders a beer. (In Germany and many parts of Europe, McDonalds actually does serve beer.) The local guy in the line behind him immediately gives him the jab: "They dont serve BEER here, you MORON!" The German fellow felt pretty stupid, but suddenly turns to the New Yorker with a surprised look, and begins to chuckle."And whats so funny?!?" the New Yorker demands."Oh, nothing really, I just realized that you came here for the food."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9219, 'Travel and tourist jokes', 'This woman is visiting in Israel and notices that her little travel alarm needs a battery. She looks for a watch repair shop and while she doesnt read Hebrew she finally sees a shop with clocks and watches in the window. She goes in and hands the man her clock. The man says, "Madam, I dont repair clocks. I am a Mohel. I do circumcisions." She says, "Why all the clocks in the window?"And he says, "And what should I have in my window?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9220, 'Travel and tourist jokes', 'A businessman was having a tough time lugging his lumpy, oversized travelbag onto the plane. Helped by a flight attendant, he finally managed tostuff it in the overhead bin. "Do you always carry such heavy luggage?" she sighed."No more," the man said. "Next time, Im riding in the bag, and my partner can buy the ticket!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9221, 'Travel and tourist jokes', 'A tourist is visiting New York City when his car breaks down. He jumps out and starts fiddling under the hood. About five minutes later, he hears some thumping sounds and looks around to see someone taking stuff out of his trunk! He runs around and yells, "Hey, bud, this is my car!" "OK," the man says, "You take the front and I`ll take the back."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9222, 'Travel and tourist jokes', 'Helpful advice for travellers:If you are going to get on a commercial flight, take a bomb with you.BECAUSE: What are the odds of TWO guys being on the SAME PLANE at the SAME TIME with a bomb?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9223, 'Travel and tourist jokes', 'A man and a woman who have never met before find themselves in the same sleeping carriage of a train. After the initial embarrassment, they both manage to get to sleep; the woman on the top bunk, the man on the lower. In the middle of the night the woman leans over and says, "Im sorry to bother you but Im awfully cold and I was wondering if you could possibly pass me another blanket." The man leans out and, with a glint in his eye, says, "Ive got a better idea... lets pretend were married." "Why not?" giggles the woman. "Good," he replies. "Get your own blanket."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9224, 'Travel and tourist jokes', 'Steve is going on an ocean cruise, and he tells his doctor thathes worried about getting real seasick. The doctor tells him,"Just eat two pounds of stewed tomatoes before you leave the dock."Steve says, "Will that keep me from getting sick?"The doctor says, "No, but itll look real pretty in the water."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9225, 'Travel and tourist jokes', 'An American touring Spain stopped at a local restaurant following a day of sightseeing. While sipping his sangria, he noticed a sizzling, scrumptious looking platter being served at the next table. Not only did it look good, the smell was wonderful. He asked the waiter, "What is that you just served?"The waiter replied, " Ah senor, you have excellent taste! Those are bulls testicles from the bull fight this morning. A delicacy!"The American, though momentarily daunted, said, "What the hell, Im on vacation! Bring me an order!"The waiter replied, "I am so sorry senor. There is only one serving per day because there is only one bull fight each morning. If you come early tomorrow and place your order, we will be sure to save you this delicacy!"The next morning, the American returned, placed his order, and then that evening he was served the  one and only special delicacy of the day. After a few bites, and inspecting the contents of his platter, he called to the waiter and said, "These are delicious, but they are much, much smaller than the ones I saw you serve yesterday!"The waiter shrugged his shoulders and replied, "Si senor. Sometimes the bull wins."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9226, 'Travel and tourist jokes', 'A Jewish couple, are sitting together on an airplane flying to the Far East. Over the public address system, the Captain announces: "Ladies and Gentlemen, I am afraid I have some very bad news. Ourengines have ceased functioning, and this plane will be going down momentarily. Luckily, I see an island below us that should be able to accommodate our landing. This island appears to be uncharted; I amunable to find it on our maps. So the odds are that we will never berescued and will have to live on the island for a very long time, if notfor the rest of our lives. A few minutes later the plane lands safely onthe island, whereupon Morris turns to his wife and asks, "Esther, didwe pay our pledge to the Yeshiva yet?" No Morris!" she responded.Morris smiles, then asks, "Esther, did we pay our UJA pledge?" "Oy no, I forgot to send the check!!" Now Morris laughs. "One last thing, Esther.  Did you remember to send our TempleBuilding Fund check this month?" "Oy Morris I forgot that one too!" Now Morris is practically choking with laughter. Esther asks Morris,"So what are you smiling and laughing about?Morris responds, "Theyll find us."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9227, 'Travel and tourist jokes', 'An American tourist is visiting China. After visiting all the tourist attractions he decides to inquire about the people and askes his guide:"How large is the population here?""Around 1.5 billion" -- the guide answersAmerican, After a short pause: "So, what else do you do here?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9228, 'Travel and tourist jokes', 'What people travel the most? Romans.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9229, 'Travel and tourist jokes', 'What does a witch get if shes a poor traveler? Broom sick.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9230, 'Travel and tourist jokes', 'What steps should you take if you see a dangerous animal on your travels? Very large ones.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9231, 'Travel and tourist jokes', 'Mrs Jones: Now, remember, children, travel is very good for you. It broadens the mind. Betty, muttering: If youre anything to go by, thats not all it broadens!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9232, 'Travel and tourist jokes', 'There was a man staying the night in a hotel. He called the front desk and said, "Excuse me, sir, Ive got a leak in my sink." The man at the front desk replied, "Oh, okay, go ahead, but most guests just use the toilet."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9233, 'Travel and tourist jokes', 'A man arrived at a seaside hotel where he had made a reservation rather late at night. All the lights were out, so he knocked on the door. After a long time a light appeared in an upstairs window and a woman called out, "Who are you? What do you want?" "Im staying here!" "Stay there, then," she retorted, and slammed the window shut!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9234, 'Travel and tourist jokes', 'There was a little old lady from a small town in America who had to go to Texas. She was amazed at the size of her hotel and her suite. She went into the huge cafe and said to the waitress, who took her order for a cup of coffee, that she had never before seen anything as big as the hotel or her suite. "Everythings big in Texas maam," said the waitress. The coffee came in the biggest cup the old lady had ever seen. "I told you, maam, that everything is big in Texas," said the waitress. On her way back to her suite, the old lady got lost in the vast corridors. She opened the door of a darkened room and fell into an enormous swimming pool. "Please!" she screamed. "Dont flush it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9235, 'Travel and tourist jokes', 'Teacher: Id like a room, please. Hotel Receptionist: Single, Sir? Teacher: Yes, but I am engaged.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9236, 'Travel and tourist jokes', 'A huge American car screeched to a halt in a sleepy English village, and the driver called out to a local inhabitant, "Say, am I on the right road for Shakespeares birthplace?" "Ay, straight on, sir," said the rustic, "but no need to hurry. Hes dead."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9237, 'Travel and tourist jokes', 'What did the teacher say after spending thousands in the expensive hotel? Im sorry to leave, now that Ive almost bought the place.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9238, 'Travel and tourist jokes', 'On her annual visit to another planet, an old lady turns to the cabin steward and says. "I hope this spaceship doesnt travel faster than sound. "Why?" replies the cabin steward. "Because my friend and I want to talk, thats why."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9239, 'Travel and tourist jokes', 'The transatlantic liner was experiencing particularly heavy weather, and Mrs Jones wasnt feeling well. "Would you care for some more supper, maam?" asked the steward. "No, thanks," replied the wretched passenger. "Just throw it overboard to save me the trouble."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9240, 'Travel and tourist jokes', 'A police officer was amazed to see a hiker walking along the road carrying a sign which read "To Seattle." "What are you doing with that?" asked the police officer. "Im walking to Seattle," said the hiker, "and I dont want to lose my way."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9241, 'Travel and tourist jokes', 'Tourist: Is this 99 Main Street?Resident: No, its 66, but we turn it upside down to confuse people.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9242, 'Travel and tourist jokes', 'Tourist: The flies are awfully thick around here. Dont you ever shoo them?Native: No, we just let them go barefoot.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9243, 'Travel and tourist jokes', 'Tourist: Whats the speed limit in this hick town?Native: We dont have one. You strangers cant get out of here fast enough for us.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9244, 'Travel and tourist jokes', 'Police Officer: Why did you lead me on a five-state chase?Driver: I love to travel.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9245, 'Travel and tourist jokes', 'Guest: Why did you offer me a piece of candy?Hotel Clerk: You said you wanted the best suite in the hotel.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9246, 'Travel and tourist jokes', 'Q: How many tourists does it take to change a lightbulb ? A: Six: One to hold the bulb and five to ask for directions.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9247, 'Travel and tourist jokes', 'A boat docked in a tiny Mexican village. An American tourist complimented the Mexican fisherman on the quality of his fish and asked how long it took him to catch them."Not very long," answered the Mexican."But then, why didnt you stay out longer and catch more?" asked the tourist.The Mexican explained that his small catch was sufficient to meet his needs and those of his family.The tourist asked, "So what do you do with the rest of your time?""I sleep late, fish a little, play with my children, spend time with my wife... In the evenings I go into the village to see my friends, have a few drinks, play the guitar, chase the senioras, and sing a few songs. I have a full life."The tourist said, "I have a M.B.A. from Stanford and I can help you. You should start by fishing longer every day. You can then sell the extra fish you catch. With the extra revenue , you can buy a bigger boat. With the extra money the larger boat will bring, you can buy a second one and a third one and so on until you have an entire fleet of trawlers. Instead of selling your fish to a middle man, you can negotiate directly with the processing plants and maybe even open your own plant. You can then leave this little village and move to Mexico City, Los Angeles, or even New Jersey! From there you can direct your huge enterprise.""How long would that take?" asked the Mexican."Twenty, perhaps twenty-five years," replied the tourist."And after that?" asked the Mexican."Afterwards? Thats when it gets really interesting," answered the tourist, laughing. "When your business gets really big, you can start selling stocks and make millions!""Millions? Really?" asked the Mexican. "And after that?"The tourist replied, "After that youll be able to retire, live in a tiny village n ear the coast, sleep late, play with your children, catch a few fish, spend time with your wife, and spend your evenings drinking and playing the guitar with your friends!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9248, 'Travel and tourist jokes', 'An American tourist travelling in Limerick came across a little antique shop in which he was lucky enough to pick up, for a mere $150, the skull of Saint Patrick. Included in the price was a certificate of the skulls authenticity, signed by Saint Patrick himself.Ten years later the tourist returned to Ireland and asked the antique shop owner if he had any more bargains. "Ive got the very thing for you," said the Irishman. "Its the genuine skull of Saint Patrick". "You swindler!" shouted the American. "You sold me that ten years ago," and, producing the skull, added, "Look, theyre not even the same size!""You have it all wrong," said the Irishman. "This is the skull of Saint Patrick when he was a lad."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9249, 'Travel and tourist jokes', 'A client called in inquiring about a package to Hawaii. After going over all the cost info, she asked, "Would it be cheaper to fly to California and then take the train to Hawaii?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9250, 'Travel and tourist jokes', 'Joan, who was rather well-proportioned, spent almost all of her vacation sunbathing on the roof of her hotel. She wore a bathing suit the first day, but on the second, she decided that no one could see her way up there, and she slipped out of it for an overall tan. Shed hardly begun when she heard someone running up the stairs. She was lying on her stomach, so she just pulled a towel over her rear. "Excuse me, miss," said the flustered assistant manager of the hotel, out of breath from running up the stairs. "The Hilton doesnt mind your sunbathing on the roof, but we would very much appreciate your wearing a bathing suit as you did yesterday." "What difference does it make?" Joan asked rather calmly. "No one can see me up here, and besides, Im covered with a towel." "Not exactly," said the embarrassed man. "Youre lying on the dining room skylight."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9251, 'Travel and tourist jokes', 'Two Yanks touring London in a taxi. What is that asked one of the Yanks. Why that is Buckingham Palace answered the taxi driver. Well you should see the states we have much bigger houses over there, and that. That is the Post Office Tower. Oh our towers are much bigger. This went on for much of the day until they went past a another building. Our buildings are much bigger than that one too. I thought it might be said the taxi driver, That is the mental institute', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9252, 'Travel and tourist jokes', 'Where do werewolves stay when theyre on vacation? At the Howliday Inn!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9253, 'Travel and tourist jokes', 'Why did Mickey Mouse take a trip into space ?He wanted to find Pluto !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9254, 'Travel and tourist jokes', 'What do you get if you cross a sheep with a holiday resort ? The Baaahaaamaaas !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9255, 'Travel and tourist jokes', '"I cant believe it," said the tourist. "Ive been here an entire week and its done nothing but rain. When do you have summer here?" "Well, thats hard to say," replied the local. "Last year, it was on a Wednesday."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9256, 'Travel and tourist jokes', 'How can you tell elephants love to travel ?They are always packing their trunk !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9257, 'Travel and tourist jokes', 'Well-known lodging chain announced it was creating a line of nofrills hotels. The only way youll see a chocolate on the pillow now is if the last guest was eating an M&M.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9258, 'Travel and tourist jokes', 'What is a twip? A twip is what a wabbit takes when he wides a twain.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9259, 'Various animal jokes', 'A boy at a cinema notices what looks like a bear sitting next to him "Are you a bear?""Yes""What are you doing at the movies ?""Well, I liked the book!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9260, 'Various animal jokes', 'Why did the Pilgrims eat turkey on Thanksgiving? They couldnt get the moose in the oven!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9261, 'Various animal jokes', 'Whats a pets favorite day? ...Saint Petricks Day', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9262, 'Various animal jokes', 'What should you call a bald teddy ? Fred bear !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9263, 'Various animal jokes', 'What kind of money do polar bears use ? Ice lolly !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9264, 'Various animal jokes', 'A man takes his hamster to the vet, and after a short look at the creature the vet pronounces it dead. Not happy with the vets diagnosis the man asks for a second opinion. The vet gives a whistle and in strolls a Labrador dog. The dog nudges the hamster around with its nose and sniffs it a couple of times before shaking his head. "There" says the vet," Your hamster is dead". Still not happy the man asks for a third opinion. The vet opens the back door and in bounds a cat. The cat jumps onto the table and looks the hamster up and down for a few minutes before looking up and shaking its head. "Its definitely dead sir", says the vet. Convinced, the man enquires how much he owes. "That will be L1000, please". "A L1000 just to tell me my hamster is dead" fumes the man. "Well", says the vet, "Theres my diagnosis, the lab report and the cat scan".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9265, 'Various animal jokes', 'Why do bears have fur coats ? Because theyd look stupid in anoraks !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9266, 'Various animal jokes', 'What do you get if you cross a teddy bear with a pig ? A teddy boar !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9267, 'Various animal jokes', 'How do you hire a teddy bear? Put him on stilts !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9268, 'Various animal jokes', 'Why is polar bear cheap to have as a pet ? It lives on ice !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
