INSERT INTO `jokes` VALUES (9277, 'Various animal jokes', 'Whats yellow, comes from Peru, and is completely unknown ? Waterloo Bear, Paddington Bears forgotten cousin !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9278, 'Various animal jokes', 'What do you get if you cross a skunk with a bear ? Winnie the Pooh !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9279, 'Various animal jokes', 'Theres a guy whos hiking in the woods one day when a bear chases him up a really tall tree.The bear started to climb the tree, so the guy climbed up higher. Then, the bear climbed down and went away.So the guy starts to climb down the tree. Suddenly, the bear returns, and this time hes brought an even bigger bear with him. The two bears climb up the tree, the bigger bear going higher than the first. But the guy climbed even higher still, so the bears couldnt reach him. Eventually, the bears went away.Naturally quite relieved, the guy starts down the tree again. Suddenly, the two bears return. But this time the guy knew he was in big trouble.Each bear was carrying a BEAVER.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9280, 'Various animal jokes', 'Two hikers are out hiking. All of a sudden, a bear starts chasing them.They climb a tree, but the bear starts climbing up the tree after them. The first hiker gets his sneakers out of his knapsack and starts putting them on.The second hiker says, "What are you doing?"The first responds, "I figure when the bear gets close to us, well have to jump down and make a run for it."The second says, "Are you crazy? Dont you know you cant outrun a bear?The first guy says, "I dont have to outrun the bear... I only have to outrun you!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9281, 'Various animal jokes', 'What do you call a lion wearing a cravat and a flower in its mane ? A dandy lion !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9282, 'Various animal jokes', 'Why do you never see zebras or antelopes at Victoria Station ? Because its a mane-lion station !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9283, 'Various animal jokes', 'What do you call a show full of lions ? The mane event !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9284, 'Various animal jokes', 'How does a leopard change its spots ? When it gets tired of one spot it just moves to another !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9285, 'Various animal jokes', 'What happened to the man who tried to cross a lioin with a goat ? He had to get a new goat !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9286, 'Various animal jokes', 'Why was the lion-tamer fined ? He parked on a yellow lion !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
