INSERT INTO `jokes` VALUES (9288, 'Various animal jokes', 'What happened to the tiger who took a bath three times a day ? After a week he was spotless !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9289, 'Various animal jokes', 'What do you get if you cross a tiger with a sheep ? A stripey sweater !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9290, 'Various animal jokes', 'What do you get if you cross a tiger with a kangeroo ? A stripey jumper !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9291, 'Various animal jokes', 'How are tigers like sergeants in the army ? They both wear stripes !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
