INSERT INTO `jokes` VALUES (9293, 'Various animal jokes', 'What flies around your light at night and can bite off your head ? A tiger moth !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9294, 'Various animal jokes', 'What did the lions say to his cubs when he taught them to hunt ? Dont go over the road till you see the zebra crossing.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9295, 'Various animal jokes', 'What do tigers wear in bed ? Stripey pyjamas !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
