INSERT INTO `jokes` VALUES (9297, 'Various animal jokes', 'Which big cat should you never play cards with ? A cheetah !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9298, 'Various animal jokes', 'What is the fiercest flower in the garden ? The tiger lily !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9299, 'Various animal jokes', 'What was the name of the film about a killer lion that swam underwater ? Claws.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9300, 'Various animal jokes', 'If a four-legged animal is a quadruped and a two-legged animal is a biped, Whats a tiger ? A stri-ped !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9301, 'Various animal jokes', 'First Caribou: What kind of math do owls like?Second Caribou: Owlgebra.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9302, 'Various animal jokes', 'First Caribou: Which bug does amazing motor cycle stunts?Second Caribou: Evel Boll Weevil.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
