INSERT INTO `jokes` VALUES (9350, 'Various animal jokes', 'A family of tortoises went into a cafe for some ice cream. They sat down and were about to start when Father Tortoise said, "I think its going to rain. Junior, will you pop home and fetch my umbrella?" So off went junior for Fathers umbrella, but three days later he still hadnt returned. "I think, dear," said Mother Tortoise to Father Tortoise, "that we had better eat juniors ice cream before it melts." And a voice from the door said, "If you do that I wont go."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9351, 'Various animal jokes', 'Deep within a forest a little turtle began to climb a tree. After hours of effort he reached the top, jumped into the air waving his front legs and crashed to the ground. After recovering, he slowly climbed the tree again, jumped, and fell to the ground. The turtle tried again and again while a couple of birds sitting on a branch watched his sad efforts. Finally, the female bird turned to her mate. "Dear," she chirped, "I think its time to tell him hes adopted."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9352, 'Various animal jokes', 'There once was a baby elephant and a baby turtle drinking from a river deep in the jungle. For no reason, the turtle reaches over and bites the elephants tail, really hard. Years and years later, the same elephant, now grown up, is by the same river, having a drink with his giraffe buddy, when the same turtle that bit him on the tail all those years ago wanders up to the river. The elephant rears back a leg and kicks the turtle as hard as he can, sending him flying way off into the jungle. "Why did you do that?" the giraffe asks. "When we both were babies, that turtle bit my tail for no reason," the elephant replied. "Wow! You must have a good memory!" exclaimed the giraffe."Yep!" said the elephant. "Ive got Turtle-Recall."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
