INSERT INTO `jokes` VALUES (9418, 'Various animal jokes', 'What are the most athletic rodents?Track and field mice.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9419, 'Various animal jokes', 'Q. Why did Mrs. Smokey the Bear divorce Smokey the Bear?A. Because every time she got hot, hed beat her with a shovel!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9420, 'Various animal jokes', 'Q: What did the emu say to the nurse? A: Mend her bones or walk the plank', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9421, 'Various animal jokes', 'Why dont lobsters share?Theyre shellfish.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9422, 'Various animal jokes', 'Turtle to turtle: "Dont ya just love the sound of rain on your roof?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9423, 'Various animal jokes', 'What do you give a deer with an upset stomach?Elkaseltzer.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9424, 'Various animal jokes', 'Exasperated dragon on the field of battle:"Mother said there would be knights like this."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9425, 'Various animal jokes', 'A hungry lion was roaming through the jungle looking for something to eat.He came across two men. One was sitting under a tree reading a book; the other was typing away on his typewriter. The lion quickly pounced on the man reading the book and devoured him.Even the king of the jungle knows that readers digest, and writers cramp.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9426, 'Various animal jokes', 'Mama bear to Papa bear:"Well... You might call it hibernating -- I call it goofing off."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9427, 'Various animal jokes', 'One day Mullah was beating his donkey in a remote place. A man saw him and asked: why are you beating the poor animal. Sorry, said Mullah, is it a member of your family?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9428, 'Various animal jokes', 'Q. What did the snail say when he hitched a ride on the turtle?A. Wheeeee!!!!!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9429, 'Various animal jokes', 'One day there was a tortoise walking on the road. Along came the hare that had once been defeated by the tortoise in a race. The hare was so angry from what had happened to him so he challenged him to another race. The tortoise gladly accepted his challenge. It ended up that the tortoise and the hare never finished the race because they both took a nap right before the finish line. So the tortoise is still the champion of the race. So remember this you snooze you loose!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9430, 'Various animal jokes', 'This little snail bought a little car and took it to the body shop to have it painted. The service man asked him exactly what he wanted done, and the snail said he wanted little Ss painted all around and all over his car. The service man asked him why, and the snail answered "When people see me in my car I want them to say, look at that S-Car-Go!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9431, 'Various animal jokes', 'A lion was getting rather old and slow and having difficulty catching its prey. It decided it needed a disguise so that other animals did not know it was a lion and would not run away. So it goes into a fancy dress shop and buys a gorilla suit. It then heads for a watering hole to see if it can catch something with its new disguise. On the way it comes across two eagles sitting on a rock. One eagle says to it "Hi Mr. Lion!" The other said, "Where did you get the gorilla suit?" The lion, rather frustrated, asks, "How did you know I was a lion?" The eagles then started to sing, "You cant hide your lion eyes".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9432, 'Various animal jokes', 'A man moved to a mountain top to get rid of the hustle and be alone. One day he heard a knock at the door and no one was there but then he looked down and there sat a snail and it said "it is quite cold out here can I come in?" the man shouted "NO why dont you all understand I want to be alone!" and he kicked the snail down the mountain. One year later there was a knock at the door and no one was there and then he looked down and there again sat a snail and it said, "What did you do that for?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9433, 'Various animal jokes', 'Look over there! Said the frightened skunk to his pal."Theres a human with a gun, and hes getting closer and closer! What are we going to do?"To which the second skink calmly replied, "Let us spray ."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9434, 'Various animal jokes', 'A fish walks into a bar, the bartender asks,"What would you like?" the fish says holding his neck, "Water".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9435, 'Waiter jokes', 'Customer: Give me a hot dog.Waiter: With pleasure.Customer: No, with mustard.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9436, 'Waiter jokes', 'Waiter, whats this fly doing in my soup?Um, looks to me to be backstroke, sir', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9437, 'Waiter jokes', 'Waiter, theres a fly in my soup!Dont worry sir, the spider on the breadroll will get em.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9438, 'Waiter jokes', 'Waiter, theres a fly in my soup!No sir, thats a cockroach, the fly is on your steak.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9439, 'Waiter jokes', 'Waiter, theres a fly in my soup!Keep it down sir, or theyll all be wanting one.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9440, 'Waiter jokes', 'Waiter, theres a fly in my soup!Its OK, Sir, theres no extra charge!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9441, 'Waiter jokes', 'Waiter, theres a fly in my soup!Force of habit, sir. Our chef used to be a tailor.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9442, 'Waiter jokes', 'Waiter, theres a fly in my soup!Couldnt be, sir. The cook used them all in the raisin bread.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9443, 'Waiter jokes', 'Waiter, there is a fly in my soup!I know, but unfortunately we are out of turtle.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9444, 'Waiter jokes', 'Waiter, there is a fly in my soup!Sorry sir, maybe Ive forgotten it when I removed the other three.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9445, 'Waiter jokes', 'Waiter, theres a fly in my soup!Surely not, sir. It must be one of those vitamin bees you hear so much about.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9446, 'Waiter jokes', 'Waiter, theres a fly swimming in my soup!Then weve served you too much soup, the fly should be wading', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9447, 'Waiter jokes', 'Waiter, theres a dead fly in my soup!Yes sir, its the hot water that kills them.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9448, 'Waiter jokes', 'Waiter, theres a dead fly in my soup!What do you expect for $1 - a live one?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9449, 'Waiter jokes', 'Waiter, whats this fly doing in my soup?Its fly soup sir!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9450, 'Waiter jokes', 'Waiter, waiter, theres a bee in my soup.Yes Sir, its the flys day off.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9451, 'Waiter jokes', 'Waiter, Id like a cup of coffee, please, with no cream.Im sorry, sir, but were out of cream. How about with no milk?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9452, 'Waiter jokes', 'Waiter, what is this stuff?Thats bean salad sir.I know what its been, but what is it now?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9453, 'Waiter jokes', 'Waiter, I cant seem to find any oysters in this oyster soup.Would you expect to find angels in angel cake?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9454, 'Waiter jokes', 'Waiter, your tie is in my soup!Thats all right, sir, its not shrinkable.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9455, 'Waiter jokes', 'And how did you find your steak sir?Well, quite accidentally. I moved this tomato slice and there it was', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9456, 'Waiter jokes', 'Waiter: These are the best eggs weve had for years.Diner: Well, bring me some you havent had around for that long.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9457, 'Waiter jokes', 'How many waiters does it take to change a light bulb?None, a burned out bulb cant catch a waiters eye.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9458, 'Waiter jokes', 'Waiter, waiter! Theres a dead spider in my soup. Yes, maam, they cant stand the boiling water.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9459, 'Waiter jokes', 'Waiter, waiter! Theres a spider in my soup. Send for the manager! Its no good, sir, hes frightened of them, too.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9460, 'Waiter jokes', 'Waiter, waiter! Whats this creepy crawly thing doing in my dinner?Oh, that one ? he comes here every night.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9461, 'Waiter jokes', 'Why do waiters prefer elephants to flies? Have you ever heard anyone complaining of a elephant in their soup? .', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9462, 'Waiter jokes', 'What will a monster eat in a restaurant? The waiter.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9463, 'Waiter jokes', 'Customer: Waiter, this soup tastes funny. Waiter: So laugh, sir.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9464, 'Waiter jokes', 'Waiter, waiter! Theres a mosquito in my soup. Dont worry sir, mosquitoes have very small appetites !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9465, 'Waiter jokes', 'I say waiter, theres a fly in my soup! Well throw him a doughnut - they make fantastic life belts!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9466, 'Waiter jokes', 'Waiter, waiter, this lobsters only got one claw. It must have been in a fight, sir. Then bring me the winner.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9467, 'Waiter jokes', '"Waiter, waiter,theres a hand in my soup." "Thats not your soup, sir, thats your finger bowl."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9468, 'Waiter jokes', 'Waiter, waiter! Theres a wasp in my dessert. So thats where they go to in the winter.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9469, 'Waiter jokes', 'Customer: Do you have bacon and eggs on the menu:Waiter: No, we clean our menus regularly.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9470, 'Waiter jokes', 'Customer: How come the Board of Health hasnt come in and closed you up?Waiter: Theyre afraid to eat here.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9471, 'Waiter jokes', 'Customer: How long must I wait for that turtle soup I ordered?Waiter: Well, you know how slow turtles are.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9472, 'Waiter jokes', 'Customer: I didnt order this.Waiter: I know, but your meal tastes worse.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9473, 'Waiter jokes', 'Customer: I thought the meals here were supposed to be like mother used to make.Waiter: They are. She couldnt cook either.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9474, 'Waiter jokes', 'Customer: That crust on the apple pie was too tough.Waiter: That wasnt the crust, that was the pie plate.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9475, 'Waiter jokes', 'Customer: Theres something wrong with my hot dogs.Waiter: Sorry, Im a waiter, not a veterinarian.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9476, 'Waiter jokes', 'Customer: This fish isnt as good as what I ordered here last month.Waiter: Thats funny. Its from the same fish.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9477, 'Waiter jokes', 'Customer: Waiter, I cant eat this meal.Waiter: Why not? It looks all right to me.Customer: I dont have a fork.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9478, 'Waiter jokes', 'Customer: Waiter, I found a hair in my turtle soup.Waiter: How about that! The turtle and the hare finally got together.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9479, 'Waiter jokes', 'Customer: Waiter, look at this chicken! Its nothing but skin and bones.Waiter: Would you like the feathers, too?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9480, 'Waiter jokes', 'Customer: Waiter, theres a button in my salad.Waiter: It must have come off while the salad was dressing.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9481, 'Waiter jokes', 'Customer: Waiter, this food is repeating on me.Waiter: Good, we love repeat business.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9482, 'Waiter jokes', 'Customer: What is this fly doing in my alphabet soup?Waiter: Probably learning to read.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9483, 'Waiter jokes', 'Customer: Why does your sign say "Fine Dining"?Waiter: We can dream, cant we?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9484, 'Waiter jokes', 'Customer: Why doesnt this restaurant have any specials?Waiter: Because nothing about this food is special.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9485, 'Waiter jokes', 'Customer: Why doesnt your menu list prices?Waiter: We didnt want to make you sick before the food does.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9486, 'Waiter jokes', 'Customer: Why dont you eat here, waiter?Waiter: Serving it is bad enough, I dont want to compound the felony.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9487, 'Waiter jokes', 'Customer: Why dont you have doggie bags?Waiter: That would be cruelty to animals.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9488, 'Waiter jokes', 'Customer: Why is this sandwich half eaten? Waiter: I didnt have time to finish it.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9489, 'Waiter jokes', 'Diner: Could I have a glass of water?Waiter: To drink?Diner: No, I want to rinse out a few things.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9490, 'Waiter jokes', 'Diner: May I please have a glass of water?Waiter: Why, are you thirsty?Diner: No, I want to see if my neck leaks.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9491, 'Waiter jokes', 'Diner: Waiter, please close the window.Waiter: Why, is there a draft?Diner: Yes, its blown my steak off the plate three times.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9492, 'Waiter jokes', 'Diner: Waitress, the portions are getting smaller.Waiter: Its just an optical illusion. Its just that the restaurant has been enlarged.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9493, 'Waiter jokes', 'Diner: Whats wrong with these eggs I ordered?Waiter: Dont ask me. I only laid the table.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9494, 'Waiter jokes', 'Diner: Why are the waiters in here so nasty?Waiter: Look at who they have to serve.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9495, 'Waiter jokes', 'Patron: Didnt you tell me the chef here cooked for the late heads of Europe?Waiter: Yes, and thats why they are the late heads of Europe.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9496, 'Waiter jokes', 'Patron: Hey, theres a fly in my soup!Waiter: Why are you complaining? Isnt it cooked?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9497, 'Waiter jokes', 'Patron: How come this fly is swimming in my soup?Waiter: I gave you too much. It should be wading.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9498, 'Waiter jokes', 'Patron: This bread is stale.Waiter: It wasnt last week.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9499, 'Waiter jokes', 'Patron: Waiter, why is there a spider in my glass?Waiter: It scares away the flies.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9500, 'Waiter jokes', 'Waiter (serving soup): It looks like rain today.Patron: Yes it does, but it smells like soup.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9501, 'Waiter jokes', 'Waiter: If you know the food here is so lousy, why do you keep coming back?Customer: It reminds me of my ex-wifes cooking.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9502, 'Waiter jokes', 'Waiter: Im sorry I spilled a glass of water on you.Diner: Thats all right. My suit is too large anyway.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9503, 'Waiter jokes', 'Waiter: Im sorry to keep you waiting. Your soup will be ready soon.Customer: What bait are you using?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9504, 'Waiter jokes', 'Waiter: Why are you taking so long to order?Diner: I cant decide whether I want heartburn or nausea.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9505, 'Waiter jokes', 'Waiter: Why didnt you make all the food on that long order?Cook: Because Im a short order cook.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9506, 'Waiter jokes', 'Q: How many Waiters does it take to change a light bulb? A: None, even a burned out bulb cant catch a waiters eye', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9507, 'Waiter jokes', '"Waiter ! Have you got frogs legs ? " "No, sir, I always walk this way"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9508, 'Waiter jokes', 'Waiter, Waiter theres a fly in my ice-cream !Gee I did not know that they had started winter sports so early in the year !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9509, 'Waiter jokes', 'Waiter, is there soup on the menu ?No, madam I wiped it off !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9510, 'Waiter jokes', 'Waiter, theres a fly in my custard !Ill fetch him a spoon sir !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9511, 'Waiter jokes', 'Waiter, there is a cockroach on my steak !They dont seem to care what they eat do they sir !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9512, 'Waiter jokes', 'Waiter, there is a maggot in my soup !Dont worry sir, he wont last long in there !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9513, 'Waiter jokes', 'Waiter, there is a spider drowning in my soup !It hardly looks deep enough to drown in sir !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9514, 'Waiter jokes', 'Waiter, there is a worm on my plate !Thats not a worm sir, its your sausage ?', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9515, 'Waiter jokes', 'Waiter, there is a fly in my wine !Well you did ask for something with a little body in it!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9516, 'Waiter jokes', 'Waiter, there is a fly in my soup !Yes sir, thats the manager, the last customer was a witch doctor !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9517, 'Waiter jokes', 'Waiter, my lunch is talking to me !Well you did ask for a tongue sandwich !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9518, 'Waiter jokes', 'Waiter, theres a fly in my soup !Yes, its the rotting meat that attracts them !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9519, 'Waiter jokes', 'Waiter, are there snails on the menu !Yes sir, they must have escaped from the kitchen !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9520, 'Waiter jokes', 'Waiter, there is a mosquito in my soup !Dont worry sir, they dont eat much !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9521, 'Waiter jokes', 'Waiter, there is a bee in my alphabet soup !Yes sir, and Im sure there is an A, C and all the other letters too !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9522, 'Waiter jokes', 'Waiter, there is a fly in my soup !Hold on sir, Ill get the fly spray !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9523, 'Waiter jokes', 'Waiter, I cant eat this meat, its crawling with maggots !Quick, run to the other end of the table and grab it as it goes by !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9524, 'Waiter jokes', 'Waiter, what is this cockroach doing on my ice cream sundae ?Skiing sir !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9525, 'Waiter jokes', 'Waiter, there is a fly in my bean soup !Dont worry sir Ill fish him out and exchange it for a bean !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9526, 'Waiter jokes', 'Waiter, what is this creepy-crawly doing in my salad?Not him again, hes in here every night !', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
