INSERT INTO `jokes` VALUES (9538, 'Weather jokes', 'How did you find the weather at camp?It was easy. I just went outside - and there it was!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9539, 'Weather jokes', 'A city boy was on his first camping trip. He was eating his lunch under a tree when an old-timer came along.It smells like rain, he said to the boy.The city boy replied, They said it was lemonade.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9540, 'Weather jokes', 'A man was driving a black truck. His lights were not on. The moon was not out. A lady was crossing the street. How did the man see her?It was a bright, sunny day.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
