INSERT INTO `jokes` VALUES (9553, 'Weather jokes', 'Ole and Lena were sitting down to their usual morning cup of coffee listening to the weather report on the radio. "There will be 3 to 5 inches of snow today, and a snow emergency has been declared," the weather report said."You must park your cars on the odd numbered side of the streets." Ole said, "Jeez, okay," and got up from his coffee. The next day they were sitting down with their morning cups of coffee. The weather forecast was, "There will be 2 to 4 inches of snow today, and a snow emergency has been declared. You must park your cars on the even numbered side of the streets." Again Ole replied, "Jeez, okay," and got up from his coffee. Two days later, again theyre sitting down with their cups of coffee and the weather forecast said, "There will be 6 to 8 inches of snow today, and a snow emergency has been declared. You must park your cars on the..." and the power went out  and Ole didnt get the rest of the instructions. He turned to Lena, "Jeez, what am I going to do now, Lena?" Lena replied, "Aw, Ole, just leave the car in the damned garage today."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9554, 'Weather jokes', '"Gosh, its raining cats and dogs," said Fred looking out of the kitchen window. "I know," said his mother."Ive just stepped in a poodle!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9555, 'Weather jokes', 'Fred: Im sure Im right. Betty: Youre as right as rain - all wet!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9556, 'Weather jokes', 'There was a communist named Rudolph. One day he looked out the window and said, "It looks like a storm is coming." "No it isnt," said his wife. "Besides, how would you know?" "Because," he responded, "Rudolph the Red knows rain, dear."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9557, 'Weather jokes', 'Two Viking invaders are trudging up the beach in the pouring rain. One looks skywards and says, "So this is England. Whats it like?" The other snarls, "Well, if you like the weather, youll love the food."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9558, 'Weather jokes', 'A postcard home: The weather is here. Wish you were beautiful.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
