INSERT INTO `jokes` VALUES (9563, 'Weather jokes', 'How to predict weather in Seattle: If you can see Mt Ranier, its going to rain. If not, it already is.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
