INSERT INTO `jokes` VALUES (9566, 'Weather jokes', 'I really dont understand why the federal government was so slow to send aid to the areas hit by Hurricane Andrew. After all, both Florida and Louisiana have oil.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9567, 'Weather jokes', 'The U.S. has only three hurricane warning centers - Coral Gables, FL, Guam, and Honolulu, HI (recently completed). All three have faced Category 4 hurricanes in the past month. Which only goes to show: If you build it, they will come!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
