INSERT INTO `jokes` VALUES (9571, 'Weather jokes', 'A weather intern walks into a bar and asks for a Cold Draft. Suddenly the bar door swings open and gusty cool air fills up the bar. After drinking his Draft things seem to get back to normal. The guy then orders a Thunderclap on ice. Suddenly the roof gets pelted with hail stones and an intense lightning flash and thunderous explosion rock the bar. After drinking his Thunderclap things seem to once again get back to normal. Feeling rather good at this point he asks for a third drink- ordering a Tornado on the rocks. This time the bar is not only pelted with even larger hail stones but ferocious winds rip the door off its hinges, shake the bar violently and break every window. Feeling extra good and cocky at this point he then orders an extra large and extra strong Hurricane. The bartender after this request looks up at the guy perplexed and says, "Sorry fella, we have no Hurricanes in Kansas".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
