INSERT INTO `jokes` VALUES (9721, 'Women jokes', 'Shortly after the birth of their second child, her husband offered to take her shopping for a new dress. He endured more than two hours of listening to her complaints about which figure flaw each dress accentuated. As she emerged from the dressing room, having tried on the last selection, she asked for her husbands opinion. By this time, he had learned just the right things to say. "Its perfect!" he exclaimed. "It makes your waist look smaller, your legs look longer and slenderizes your hips." Just then, a voice from the dressing room piped up. "If theres a dress here that will do all that- Ill take ten!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
