INSERT INTO `jokes` VALUES (9724, 'Women jokes', 'A young woman with a happy, cheerful voice was working in her husbands trucking line office. She answered a phone call from a trucker asking for directions to the terminal. After a short conversation, he said he could hardly wait to meet her. "I just know you are small, blond with blue eyes," he said. "No," young woman replied, "Im tall, brunette and have brown eyes." "Close enough!" said the trucker.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9725, 'Women jokes', 'At a family gathering, husband began teasing his wife about how she always get her way. "Honey," she said to her husband, "when I get my way, thats a compromise." "What is it when I get my way?" he was quick to ask. She replied, "Thats a miracle!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9726, 'Women jokes', 'A young man called his mother and announced excitedly that he had just met the woman of his dreams. "Now what should I do?" His mother has an idea. "Why dont you send her flowers, and on the card invite her to your apartment for a home cooked meal?" He thought this was a great strategy, and a week later the woman came to dinner. His mother called the next day to see how things had gone. " I was humiliated," he groaned. "She insisted on washing the dishes." " Whats wrong with that?" asked his mother. " We hadnt started eating yet."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
