INSERT INTO `jokes` VALUES (9962, 'Yo momma jokes', 'Yo mama is so fat that she needs a book mark to keep track of all her chin rolls!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9963, 'Zoo jokes', 'Freds class was taken to the Natural History Museum in New York. "Did you enjoy yourself?" asked her mother when she got home. "Oh, yes," replied Fred. "But it was funny going to a dead zoo."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9964, 'Zoo jokes', 'Fred was definitely more than a bit dumb; when his pal asked him how he had enjoyed his day at the zoo, he replied, "it was a total con! I saw a sign that said To The Monkeys, so I followed it and saw the monkeys. Then I saw another sign that said To The Bears, so I followed that and saw the bears. But when I followed a sign that said To the Exit, I found myself out on the street."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9965, 'Zoo jokes', 'There was this truck driver who had to deliver 500 penguins to the state zoo. As he was driving his truck through the desert, his truck breaks down. After about 3 hours, he waves another truck down and offers the driver $500 to take these penguins to the state zoo for him.The next day the original truck driver arrives in town and sees the new truck driver crossing the road with 500 penguins walking in single file behind him.The original truck driver jumps out of his truck and asks, "Whats going on? I gave you $500 to take these penguins to the zoo!"The new truck driver responds, "I did take them to the zoo. And I had enough money left over so now were going to see a movie."', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9966, 'Zoo jokes', 'The Crist family worked at a zoo. Each year they predicted the general luck and overall mood of the year by watching the the gnu. If the gnus ears were forward, that meant a successful, joyous year was almost certain to happen. But if his ears were laid back flat against his head, it meant that an unlucky or very unhappy year was sure to come. One year it was young Marys turn to "survey" the animal and come up with the prediction. It was her first time solo, and in her excitement, she forgot to take the key to the cage. She was late in coming to check on the gnu. Well, she saw the wrong ear position and predicted a bad year, when in fact it was quite good. To explain the error, the local newspaper ran the following headline a year later: MARY CRIST MISSES AN HAPPY GNUS EAR!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9967, 'Zoo jokes', 'A father and his small son were standing in front of the tigers cage at the zoo. Father was explaining how ferocious and strong tigers are and junior was taking it all in with a serious expression. Dad," the boy said finally, "if the tiger got out of his cage and ate you up ..." "Yes, son?" the father said expectantly. "What bus should I take home?" the boy finished.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9968, 'Zoo jokes', 'Starting his new job at the zoo, the eager young zoo keeper asked the Head keeper what he should do for his first task. "Go and clean out the aquarium" he was told. Arriving at the aquarium, he discovered that all the fish were dead. He rushed back to the head keeper and asked what he should do. "Throw them to the lions" said the head keeper, "the lions will eat anything". So the young keeper returned to the aquarium, picked up all the dead fish and threw them into the lions cage. That done, he returned and asked what he should do now. He was instructed to go and clean out the ape house. Off he went and started cleaning. He was shocked to discover dead chimpanzees in the cage, and rushed back for instructions. "Dont worry" said the head keeper, "just throw them to the lions, the lions will eat anything". So the young man returns to the ape house  and throws the dead animals into the lions cage.Returning again for instructions, he is told to go along and help clean up the insect house. Busy cleaning out one off the exotic hives, he notices that all the bees have died. "I know what to do", he thinks to himself "Ill throw them all to the lions, as the lions will eat anything", whereupon he brushes them all up and throws them into the lion cage. The next day, the zoo obtains a new lioness. The lioness is walking around the new cage for the first time, and starts asking the other lions what things are like here. "Hows the accommodation?", she asks. "Fine" comes the reply from one lion. "And whats the food like?" she asks."Not bad" replies another, "yesterday, we had fish, chimps and mushy bees".', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9969, 'Zoo jokes', 'My wife asked me to take her to the zoo the other day. I said, "If you want people to see you they can come here and do it!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9970, 'Zoo jokes', '"Hey, Pop," pleaded Angelo, "can I go to the zoo to see the monkeys?" "Whats the matter with you?" asked his father. "Why would you wanna go see the monkeys when your Aunt Maud is here?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9971, 'Zoo jokes', 'Sauer and Tolbert went to the zoo and watched in awe as a lion let loose with a spine-tingling roar. "Lets get out of here!" said Sauer. "Go on, ifn you want to," said the other redneck. "But Ahm stayin for the whole movie!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9972, 'Zoo jokes', 'An enterprising mayor of the city of Granby, Quebec, a community south of Montreal, established a municipal zoo that has become a significant tourist attraction. It has also given rise to many unusual events. Last September one of the star attractions, Arnold, an Indonesian ape, escaped to the dismay of the zoo director. The matter was a serious one because the members of the staff of the zoo, while expert at caring for animals, had no experience whatsoever in rounding them up or capturing them. The zoo director appealed to the office of the mayor for help and the secretary to the mayor asked, "Have you looked in the yellow pages"? The director said he hadnt, but would, immediately. To his surprise, under "animal capturing service" he found a listing for the Acme Ape Apprehenders. He called them immediately. Within 20 minutes, a panel truck arrived at the admin office of the zoo and  a small man emerged and rushed to the director who was waiting at the door. "Is there a wooded area in the vicinity?", the little man asked. The director said there was, within one half mile from the zoo. "Hop in the truck", the little man said. The director did and they drove off. Minutes later they arrived at a small grove and immediately spotted Arnold on a branch about 25 feet above the ground. The two men got out, went to the back of the truck and the little man opened the door. An excited little dog jumped out and began running around in circles. The little man reached into the truck and took out a suitcase, which he opened. In the suitcase were a pair of handcuffs, which he handed to the zoo director, a sawed off shotgun, which he leaned against the trunk of the tree, and a baseball bat. "Now," the little man said, "Im going up into the tree with the baseball bat, and Im going to knoc k the ape out of the tree. The instant the ape hits the ground the dog, well trained, will bite the ape by the crotch and chomp-down with his jaws. The ape will, instantly and instinctively, grab at his crotch with both hands due to the pain, and you snap the handcuffs on and weve got him. The zoo director, pointing to the shotgun leaning against the tree, said "Im not too sure about this -- whats the gun for?" The little man said, "Look, Im an expert. I know what Im doing and things will go just fine, after all, I have the baseball bat. I know my job and itll never happen but if the ape should, by any chance, knock ME out of the tree, SHOOT THE DOG!!!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9973, 'Zoo jokes', 'Two young nuns having just been ordained were on a holiday in New York City and were standing in front of the gorilla cage at the Bronx Zoo. The gorilla took one look at this beautiful young nun, bent the bars, lept to the ground and kissed her. Then he went back into his cage, straightened the bars and resumed thumping on his massive chest. The nouns met again a week later and one of the nouns asked her friend,"I have one question.Did he sent flowers afterwards...?"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9974, 'Zoo jokes', 'Caller: Finally! I got through! Ive been trying to call the zoo for hours! Zookeeper: Yes, all our lions were busy!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9975, 'Zoo jokes', 'A Scotsman paying his first visit to a zoo stopped by one of the cages"An whut animal would that be ?" he asked the keeper."Thats a moose from Canada", came the reply."A moose !!", exclaimed the Scotsman. "Hoots, mon, if thats a moose then they must ha rats the size of elephants over there !"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9976, 'Zoo jokes', 'What did the Hollywood producer say to the Apes in the zoo when they refused to sign contracts to appear in his new film?Stop playing it cagey!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9977, 'Zoo jokes', 'When an ape visits his tailor, what kind of a suit does he order?A zoo-t suit!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9978, 'Zoo jokes', 'FRED: Did I ever tell you about the time I came face to face with a very fierce gorilla?BERT: No, what happened?FRED: Well, I stood there, without a gun . . . The gorilla looked at me and snarled and roared and beat his chest. Then it came closer and closer . . .BERT: What did you do?FRED: Oh, Id had enough, so I moved on to the next cage.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9979, 'Zoo jokes', 'Whats the difference between a Northern zoo and a Southern zoo?In a Northern zoo you have the name of the animal and the Latin name underneath. In a Southern zoo you haven the name of the animal and a recipe underneath.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9980, 'Zoo jokes', 'Little Jordan wanted to go to the zoo and pestered his parents, Al and Elaine, for days. Finally Elaine talked Jordans reluctant father into taking him. And so Jordan and Al got into the car and left."So how was it?" Elaine asked when they returned home."Great," Little Jordan replied."Did you and your father have a good time?" asked Elaine."Yeah, Daddy especially liked it," exclaimed Jordan, excitedly,"especially when one of the animals came racing home at 30 to 1!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9981, 'Zoo jokes', 'What did the zoo keeper say when he saw four elephants walking over the hill towards him wearing sunglasses?Nothing, he didnt recognize them!', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9982, 'Zoo jokes', 'Zoo Keeper:"Ive lost one of my elephants"Other Zoo Keeper:"Why dont you put an advert in the paper?"Zoo Keeper:"Dont be silly, he cant read!"', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9983, 'Zoo jokes', 'A father and his small son were standing in front of the tigers cage at the zoo. Father was explaining how ferocious and strong tigers are, and junior was taking it all in with a serious expression. Dad," the boy said finally, "if the tiger got out of his cage and ate you up ..." "Yes, son?" the father said expectantly. "What bus should I take home?" the boy finished.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9984, 'Zoo jokes', 'You dont see many reindeer in zoos, do you?No. They cant afford the admission.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
INSERT INTO `jokes` VALUES (9985, 'Zoo jokes', 'Zoo visitor: Whats the new baby hippos name? Hippopotamus keeper: I dont know, he wont tell me.', '2007-10-11 14:41:44', 0, 0, 0, 0, 0, 0, 0);
